  (11761, 'the-menzies-sydney-hotel-11761', 'The Menzies Sydney Hotel', '', 'The Menzies Sydney Hotel has been one of the city’s premier destinations for business and leisure travel.', 272022, '2014-12-03 06:55:39', '2016-04-14 03:10:43', '', 204, 2245, 'accommodation', 272022, 0, '', 'H2977@accor.com', '0292991000', '', '', '', 'http://www.menzies.com.au/', 'THE MENZIES SYDNEY\nSince welcoming our first guests in 1963, The Menzies Sydney Hotel has been one of the city’s premier destinations for business and leisure travel. Our staff have been consistently recognised for the warm hospitality and personalised service they extend to each guest. Enhanced by a timeless ambience and superb amenities, our grand Sydney hotel is the perfect retreat for family holidays and weekend getaways.\n\nLocated just ten kilometers from Sydney Airport and across the street from Wynyard Station, The Menzies is the ideal setting for exploring all that Sydney has to offer. Enjoy one of the best locations in the city — in the heart of the CBD, near iconic attractions such as the Sydney Opera House, The Rocks, Sydney Harbour Bridge, Darling Harbour Precinct and The Royal Botanic Gardens.\n\n\nWELCOME TO THE MENZIES SYDNEY\nThe Menzies Hotel features 446 contemporary, beautifully decorated guest rooms , many with marvellous views of Wynyard Park. With 13 contemporary yet elegant function rooms , we are the ideal destination for hosting impressive corporate gatherings and timeless wedding celebrations.\n\nOn your next visit to Sydney, we invite you to discover the time-honoured tradition and unparalleled service of the award-winning Menzies Hotel in Sydney’s Darling Harbour.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/TheMenziesSydney/', '', '', '', '', '', 'https://plus.google.com/111240976549094459596/posts'),
  (11869, 'aubergine-restaurant-11869', 'Aubergine Restaurant', '', 'Aubergine Restaurant located at Griffith offers contemporary style of food, however there is always a classic background to our ideas and our menu is updated daily.', 257733, '2015-02-26 07:31:15', '2016-04-22 00:22:54', '', 191, 1160, 'international cuisine', 257733, 0, '', 'restaurant@aubergine.com.au', '0262608666', '', '', '', 'http://www.aubergine.com.au/', 'Aubergine is an intimate space, with high ceilings, beautiful lights and simple, elegant decor which allows the product of creative and interesting food to shine. The food style is contemporary, however there is always a classic background to our ideas. \n\nThe kitchen is supplied by local farmers and benchmark suppliers that understand that rather than we tell them what we need we prefer for them to tell us what produce is at its best on the day. In turn that means that our menu is updated daily. \n\nOur wine list has won numerous awards and has over 500 labels of interesting and classic wines. It shows the same philosophy of using local and smaller growers that produce interesting wines for us to get excited about.\n\nAubergine has received consistently positive press and reviews by the media including 2 SMH Chef Hats for the last five consecutive years. This year Aubergine retained it’s 2 SMH Chef Hats, was listed in John Lethlean’s Hot 50 Restaurants and Gourmet Traveller’s top #100 restaurants and was also the only Canberra restaurant included in The Financial Review Australia’s Top Restaurants list.', 'A', '{"1":[[0.75,0.9583333333]],"2":[[0.75,0.9583333333]],"3":[[0.75,0.9583333333]],"4":[[0.75,0.9583333333]],"5":[[0.75,0.9583333333]],"6":[[0.75,0.9583333333]]}', 'http://www.facebook.com/auberginerestaurant', 'http://twitter.com/aubergineben', '', '', '', '', ''),
  (25465, 'ottoman-cuisine-25465', 'Ottoman Cuisine', '', 'Ottoman Cuisine is the most consistently awarded Turkish Restaurant in Canberra.We are open  for corporate dinners, medical presentations, private events, birthday parties or wedding receptions.', 135512, '2015-06-10 09:55:11', '2016-04-22 03:44:37', '', 191, 1039, 'international cuisine', 135512, 0, '', '', '0262736111', '', '', '0262736011', 'http://www.ottomancuisine.com.au', 'Chef & owner Şerif Kaya has been wooing diners at Ottoman Cuisine with his much awarded Turkish food since 1992.   Modern day Turkish food is a legacy of the vast Ottoman Empire, spanning over three continents, with access to many markets & cultures, as well as the location & climate of modern day Turkey.\n\nThe menu at the Ottoman Cuisine consists of mainly classic Turkish dishes that have withstood the test of time. There are also the dishes Şerif has created; inspired by his culinary heritage & his new home. With the specials of the day we bring you the best of the seasonal produce.   In the Ottoman tradition, we recommend sharing your dishes in order for you to experience the fantastic range of flavours on offer.\n\n', 'A', '{"2":[[0.5,0.6041666667],[0.75,0.9166666667]],"3":[[0.5,0.6041666667],[0.75,0.9166666667]],"4":[[0.5,0.6041666667],[0.75,0.9166666667]],"5":[[0.5,0.6041666667],[0.75,0.9166666667]],"6":[[0.75,0.9166666667]]}', 'https://www.facebook.com/Ottoman-Cuisine-202939186391466/', '', '', '', '', '', 'https://plus.google.com/103918119164456930143/about'),
  (29909, 'mezzalira-ristorante-29909', 'Mezzalira Ristorante', '', 'Mezzalira Restaurant is one of Canberra''s favourite Italian restaurants. Mezzalira has an extensive wine list, offering the best of the region, Australia and Italy by the glass or bottle. ', 246318, '2015-06-11 08:40:11', '2016-04-21 23:55:15', '', 191, 1174, 'italian restaurant', 246318, 0, '', 'mail@mezzalira.com.au', '0262300025', '', '', '', 'http://www.mezzalira.com.au', 'Mezzalira Restaurant is one of Canberra''s favourite Italian restaurants. It holds court in the corner of the Melbourne building, where amid some tough competition, Mezzalira stands proud. The fit-out is lovely. Floor-to-ceiling glass windows spill light out onto the street in the evenings. An al fresco section in the elegant collonade transports one to Milan. The menu is exquisite Italian. It is modern fine dining at its best, with focus on pristine produce and simple techniques. \n', 'A', '{"1":[[0.5,0.5833333333],[0.75,0.9166666667]],"2":[[0.5,0.5833333333],[0.75,0.9166666667]],"3":[[0.5,0.5833333333],[0.75,0.9166666667]],"4":[[0.5,0.5833333333],[0.75,0.9166666667]],"5":[[0.5,0.5833333333],[0.75,0.9166666667]],"6":[[0.75,0.9166666667]]}', 'https://www.facebook.com/MezzaliraRistorante', 'https://twitter.com/mezzalira_', '', '', '', '', 'https://plus.google.com/111370612363879227342/about'),
  (29913, 'club-mulwala-29913', 'Club Mulwala', '', 'Club Mulwala located in Mulwala is your  holiday accommodation, entertainment and relaxation centre in Yarrawonga Mulwala.', 276322, '2015-06-11 08:40:32', '2016-04-27 01:44:03', '', 191, 529, 'rsl club', 276322, 0, '', 'reception@clubmulwala.com.au', '0357442331', '', '', '0357442337', 'http://www.clubmulwala.com.au', 'At  Club Mulwala we pride ourselves on our quality and versatility, tailor-making each wedding reception, conference or event to your needs. Our goal is to ensure that you and your guests can simply enjoy the wonderful occasion of your wedding or conference, knowing that every detail is being managed by our professional staff.\n\nNo matter how small or large your event, we have a range of packages with many menu options to suit all your needs. Let us ensure professional service with attention to detail with a minimum of fuss.\n\nWe can also offer your offers your friends, family and colleagues special accommodation rates at Club Mulwala Resort during their stay.\n\nIn an area renowned for its wonderful climate, Club Mulwala stands out. Nestled on the edge of the beautiful waters of Lake Mulwala in the picturesque “Inland Aquatic Paradise” of Yarrawonga / Mulwala. Take the time to come and enjoy the majestic lake views at Club Mulwala. Immerse yourself in the tranquility of essenza resort spa or experience our range of dining options and entertainment available to suit every taste.\n\nClub Mulwala is perfect..... any season, any reason.', 'A', '{"1":[[0.3333333333,0.0833333333]],"2":[[0.3333333333,0.0833333333]],"3":[[0.3333333333,0.0833333333]],"4":[[0.3333333333,0.0833333333]],"5":[[0.3333333333,0.0833333333]],"6":[[0.3333333333,0.0833333333]],"0":[[0.3333333333,0.0833333333]]}', 'https://www.facebook.com/ClubMulwala', '', '', '', '', '', ''),
  (53729, 'guillaume-53729', 'Guillaume', '', 'Guillaume is an elegant local restaurant with a focus on seasonal, produce-driven food. Situated in Sydney''s leafy Eastern Suburbs.', 173669, '2015-06-15 15:56:57', '2016-04-22 06:03:44', '', 191, 1006, '', 173669, 0, '', 'reservations@guillaumes.com.au', '0293025222', '', '', '', 'http://guillaumes.com.au', 'Situated in Sydney’s leafy Eastern Suburbs, Guillaume is an elegant local restaurant with a focus on seasonal, produce-driven food. \n\nChef Guillaume Brahimi and his team have created a dining experience that is sophisticated yet comfortable, in the historic three level Darcy’s building in Paddington. After extensive renovations the restaurant opened in August 2014 with beautiful new interiors.', 'A', '{"2":[[0.7291666667,0.9166666667]],"3":[[0.7291666667,0.9166666667]],"4":[[0.7291666667,0.9166666667]],"5":[[0.5,0.625],[0.7291666667,0.9166666667]],"6":[[0.5,0.625],[0.7291666667,0.9166666667]],"0":[[0.5,0.625]]}', 'https://www.facebook.com/Guillaume-157358670950018/timeline/', 'https://twitter.com/GuillaumeGroup', '', '', '', '', ''),
  (56265, 'wisemans-ferry-bowling-club-56265', 'Wisemans Ferry Bowling Club', '', 'Wisemans Ferry Bowling Club located at the end of the Old Northern Rd near the car ferry features entertainment, dining, lawn bowls, functions no matter how big or small for every celebrations.', 0, '2015-06-15 19:34:41', '2016-05-01 22:58:24', '', 191, 1899, 'bowling club', 0, 0, '', 'manager@wfbc.com.au', '0245664307', '', '', '0245664603', 'http://www.wfbc.com.au/', 'Welcome to Wisemans Ferry Bowling Club\nLocated at the end of the Old Northern Rd near the car ferry with the cliffs of Dharag National Park overlooking the Bowling Green, this picturesque setting is relaxing all day long.            \n\n Bowling Club Bistro\nThe Bistro offers fresh up market cuisine at club prices and friendly helpful service.\n\nDining\nWe would like to welcome the Club''s new Bistro Caterers, Gerhard and Alice.\nSo please come and enjoy a totally new and fresh approach to the presentation of fine food, that’s guaranteed to delight your taste buds.\n\nFunctions\nFunction Area Type:\n•  Celebrations\n•  Corporate Events\n\nHere at the Wisemans Ferry Bowling Club we have seating available for up to 120 people. If you are looking to hold a function no matter how big or small, please call Ray Black on 02 4566 4307 to arrange all your function needs.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/Wisemans-Ferry-Bowling-Club-486892561405148/', 'https://twitter.com/wisemansbowlo', '', '', '', '', ''),
  (64894, 'plumber-to-the-rescue-64894', 'Plumber to the Rescue', '', 'We understand that you have better things to do than wait around for a plumber, so for reliable, punctual and passionate plumbers you can’t go past Plumber To The Rescue.', 144207, '2015-07-24 02:26:12', '2016-04-19 00:23:44', '81003276104', 683, 1487, 'plumbers\nplumbing', 144207, 0, '', 'digital@plumbertotherescue.com.au', '1800620227', '', '', '', 'http://plumbertotherescue.com.au/', 'Like any superhero, we take pride in our work, and for the last 30 years we''ve been pulling out all the stops to keep you satisfied. We are qualified and experienced in all plumbing problems, big and small, so no matter what your plumbing problem is, from tap repair and blocked drains to burst pipes and loss of water pressure, we’ve got you covered.\n\nNot only that, but our emergency 24/7 rescue service ensures that Plumber to the Rescue is truly your local superhero - nearby and ready to rescue you when you need it most.\n\nOur SUPERplumbers have all of your plumbing needs covered, including, but not limited to:\n\n   - Bathroom plumbing\n   - Kitchen Plumbing\n   - Leaking toilet\n   - Leaking taps and other tap repairs\n   - Blocked drains and toilets\n   - Hot water repairs\n   - Water leaks\n   - Water pressure problems\n   - Gas plumbing and gas fitting\n', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/plumbertotherescue', 'https://twitter.com/PlumToTheRescue?original_referer=http%3A%2F%2Fplumbertotherescue.com.au%2F&profile_id=52975392&tw_i=624126996537286656&tw_p=embeddedtimeline&tw_w=405287860749611008', 'https://www.linkedin.com/company/plumber-to-the-rescue', '', '', '', 'https://plus.google.com/+PlumbertotherescueAu/posts'),
  (68647, 'chinka-hep-steel-barrister-solicitor-68647', 'Chinka (Hep) Steel Barrister & Solicitor', '', 'Chinka (HEP) Steel is located in Woodend, offering comprehensive range of legal services including family law, wills and estate, property laws and business laws.', 270663, '2015-08-27 02:31:59', '2016-04-12 02:26:39', '', 191, 2731, 'divorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 270663, 0, '', 'chinka@chinkasteel.com.au', '0354272477', '', '', '', 'http://www.chinkasteel.com.au', 'Chinka (HEP) Steel is a vibrant, up to date law firm with a progressive and innovative attitude, based and in operation in Woodend in the picturesque Macedon Ranges for almost 40 years.\n\nIn accordance with our desire to continually move forward, as of 1 January 2016, we are very proud to be operating as a full paper light office.  This has been a big transition for the Team!\n\nWoodend is easily accessible to the Calder Freeway and is less than an hours drive to the Melbourne Court precinct. With such close proximity to the city combined with todays communication technology, we are able to assist clients not only located in Australia, but also overseas.\n\nChinka (HEP) Steel is committed to providing you with the best service possible and pride ourselves on our success. You can be confident that you will be treated with respect and understanding and that we will strive to bring you the best possible outcome.\n\nWe have a compassionate approach towards our clients who are often dealing with some of the most difficult situations life can serve up:\n\n-Marriage and Defacto (including same sex) separation\n-Property settlements\n-Parenting Plans\n-Victims of crime\n-Challenging a Will\n-Death of a loved one\n-Appearing in Court\n-Buying or selling a home or business\n-Being sued or wanting to sue someone', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]]}', 'https://www.facebook.com/chinkasteelsolicitor', '', '', '', '', '', ''),
  (68671, 'taylor-stratmann-lawyers-68671', 'Taylor Stratmann Lawyers', '', 'Taylor Stratmann Lawyers is a firm in Hamilton providing you with high quality of legal services in all areas of property, family, wills and estates, litigation and Business and commercial law.', 270715, '2015-08-27 02:33:35', '2016-04-12 02:48:45', '', 191, 2714, 'divorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 270715, 0, '', 'hamilton@taylorstratmann.com.au', '0355722822', '', '', '', 'http://www.taylorstratmann.com.au/', 'Taylor Stratmann Lawyers has experienced practitioners advising in the fields of business sales and purchases, land transactions, trusts and estates and commercial matters. In addition, it maintains strong family law and dispute resolution expertise, supporting clients with sound advice and solid legal representation when it is needed.\n\nTaylor Stratmann Lawyers will provide you with high quality legal services in a timely and cost effective manner.\n\nTaylor Stratmann Lawyers provides legal services including:\n\n-Property Law\n-Family Law\n-Wills and Deceased Estates\n-Dispute Resolution - Litigation\n-Commercial Law', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (68679, 'succession-legal-68679', 'Succession Legal', '', 'Succession Legal is located in Geelong West, providing expertise in range of legal services including wills and estates, conveyancing, powers of attorney and other firms.', 270759, '2015-08-27 02:34:07', '2016-04-12 03:13:31', '', 191, 2700, 'property lawyers\nestate lawyers', 270759, 0, '', 'admin@successionlegal.com.au', '0352232333', '', '', '', 'http://www.successionlegal.com.au', 'at Succession Legal we have a compassionate approach towards our clients who are often dealing with some of the most difficult situations life can serve up: \n\n• Death of a loved one \n• Aging family members\n• Buying or selling a home\n• Starting a new business\n• Negotiating a mortgage\n\nEven dealing with the everyday legal tasks associated with your business, aging parents or planning for the future can be stressful and Succession Legal are here to help with sound legal advice to help you find your way through. \n\nAs a small team of dedicated professionals we aim to provide a friendly, family atmosphere with a reputation for timely, personalised service. \n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/102776938288342942278/about'),
  (68701, 'taits-legal-68701', 'Taits Legal', '', 'Taits Legal has been providing high quality legal services to South West Victoria since 1867 offering legal services including commercial and business, property, estate, litigation and other firms.', 270829, '2015-08-27 02:35:35', '2016-04-12 03:55:01', '', 191, 2675, 'divorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 270829, 0, '', 'taits@taits.com.au', '0355602100', '', '', '', 'http://www.taits.com.au', 'Taits Legal has been providing high quality legal services to South West Victoria since 1867. We have continued to grow with the district, and today provide a wide range of legal services that reflect our commitment to providing a complete legal service to our clients.\n\nOur dynamic and trusted legal team of qualified and Accredited lawyers provides practical, timely and cost effective legal advice.\n\nOUR SERVICES\nCommercial, Business and Taxation\nProperty and Estates\nLitigation, Employment and Family\nRural Law', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (68736, 'david-stagg-tonkin-company-68736', 'David Stagg Tonkin & Company', '', 'David Stagg Tonkin & Company is located in Greensborough providing range of legal services including conveyancing, wills and estate, family law and collaborative law.', 270969, '2015-08-27 02:37:55', '2016-04-12 06:10:11', '', 191, 2625, 'divorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 270969, 0, '', 'mail@tonkinlaw.com', '0394359044', '', '', '', 'http://www.dtlawyers.com.au', 'David Stagg Tonkin & Company have been servicing the local area for over 50 years. We have grown to be a trusted legal service provider within the community and are committed to achieving the best outcome for every client. Our team of lawyers, conveyancers, legal executives and paralegals can assist you in all areas of Family Law, Estate Planning, Conveyancing, Collaborative Law and Wills & Probate. Our team pursues excellence whilst completing your matter in a professional, efficient and cost effective manner.\n\n-Conveyancing\n\nPurchase and sale of houses, commercial property, leases, pre-contract advice.\n\n-Estate Planning\n\nTestamentary trusts, self managed super funds, blended families.\n\n-Family Law\n\nDivorce, children, property settlements, child support queries.\n\n-Collaborative Law\n\nCollaborative Law is a non-Court based method of resolving your Family Law dispute.\n\n-Wills & Estates\n\nWills, probate, letters of administration, powers of attorney, and estate disputes.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/tonkinlaw/timeline', '', 'https://www.linkedin.com/company/david-stagg-tonkin-&-co?trk=ppro_cprof', '', '', '', 'https://plus.google.com/117600787512780583737/about'),
  (68769, 'tyler-tipping-woods-68769', 'Tyler Tipping & Woods', '', 'Tyler Tipping and Woods is a dynamic and innovative legal firm operating in Traralgon, providing wide range of legal services including family, commercial, property, criminal and other firms.', 271039, '2015-08-27 02:40:08', '2016-04-12 06:50:20', '', 191, 2599, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 271039, 0, '', 'admin@ttwoods.com.au', '0351746311', '', '', '', 'http://www.ttwoods.com.au', 'Tyler Tipping and Woods is a dynamic and innovative legal firm operating in Gippsland in regional Victoria. The firm can trace its legal roots back to the late 19th century in central Gippsland, and has a long history and heritage of service to the community. The firm took its current name in 1985, following a merger of the then legal firms of Tyler & Tipping and Rathjen, Wisely & Woods. The firm and its predecessors have maintained offices across the region, from Warragul to Sale and Maffra, and the major Latrobe Valley centres.\n\nThe firm has fostered a culture of excellence among its legal professionals, and those who are not qualified in law, but form an important part of the team. Professionals undergo regular professional development activities to ensure they are up to date with the practice of law, and new developments in the law itself.\n\nTyler Tipping and Woods is offering range of legal services including:\n\n-Administrative Law\n-Building Law\n-Commercial Law\n-Contract Law\n-Conveyancing and Property Law\n-Criminal Law\n-Violence and Personal Safety\n-Estate Planning\n-Family Law\n-Human Rights and Equal Opportunity\n-Insurance Law\n-Litigation\n-Wills and Probate', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://www.google.com/maps/place/Tyler+Tipping+and+Woods/@-38.1935324,146.5364171,17z/data=!3m1!4b1!4m2!3m1!1s0x6b291821760f8579:0x380f0ef59f404392?hl=en'),
  (68785, 'victoria-legal-aid-68785', 'Victoria Legal Aid', '', '', 0, '2015-08-27 02:41:12', '2016-04-12 07:15:28', '', 191, 2585, '', 0, 0, '', '', '1300792387', '', '', '', 'http://www.legalaid.vic.gov.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (68791, 'vivien-mavropoulos-associates-68791', 'Vivien Mavropoulos & Associates', '', 'Vivien Mavropoulos & Associates is located in Highett, providng wide range of legal services including conveyancing commercial law, criminal law, family law, litigation and other firms.', 271087, '2015-08-27 02:41:36', '2016-04-12 07:31:19', '', 191, 2583, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 271087, 0, '', 'viviengc@bigpond.net.au', '0395557558', '', '', '', 'http://www.vivienmavropoulos.com.au/', 'Vivien Mavropoulos & Associates offers comprehensive range of legal services including:\n\n-Conveyancing\n-Commerciasl Law\n-Criminal Law\n-Civil Litigation\n-Family Law\n-Magistrates’ Court ap[pearances\n-Wills & Estates', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (68793, 'voigt-lawyers-68793', 'Voigt Lawyers', '', 'Voigt Lawyers is located in Toorak providing comprehensive range of legal services including commercial and business law, property, family law, contracts and agreements and other firms.', 271093, '2015-08-27 02:41:44', '2016-04-12 07:39:11', '', 191, 2581, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 271093, 0, '', '', '0395273393', '', '', '', 'http://www.voigtlawyers.com.au', 'Voigt Lawyers provides quality, personalised legal services to individuals and businesses. From advice on commercial transactions, family law, going to court and buying and selling Voigt Lawyers can assist you to achieve the best possible outcome. Your needs are our priority.  \n\nVoigt Lawyers offers wide range of legal service including:\n\n-Commercial Law, \n-Mining Law, \n-Contracts and Agreements, \n-Property Matters, \n-Debt Recovery, \n-Corporations Law, \n-Business Law, \n-Litigation, \n-Family Law, \n-Leasing Matters, \n-Victims of Crime, \n-Companies and Directors.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]]}', '', '', '', '', '', '', 'https://plus.google.com/114523188592437433321/about'),
  (68798, 'wakefield-vogrig-lawyers-68798', 'Wakefield & Vogrig Lawyers', '', 'Wakefield & Vogrig Lawyers is located in Warrangul, providing comprehensive range of legal services including conveyancing, family law, wills and estates, business law and criminal laws.', 271115, '2015-08-27 02:42:04', '2016-04-12 08:36:25', '', 191, 2577, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 271115, 0, '', 'wgl@wvlawyers.com.au', '0356235166', '', '', '', 'http://www.wvlawyers.com.au/', 'At Wakefield & Vogrig Lawyers, we practice in all areas of Law. We offer premium legal services at cost effective rates and deliver them through a team of highly qualified and extensively experienced solicitors.\n\nPartners Anthony Vogrig and Sabina Wakefield are both accredited specialists in their respective areas. Anthony is an accredited Business and Property Law specialist, while Sabina’s accreditation is in the area of Property Law.\n\nBased in Warragul and Drouin, Wakefield & Vogrig Lawyers is a dynamic and progressive large regional firm who prides itself on excellence in client service. With a track record of success, our lawyers take the time needed to fully understand our clients'' legal position and to both provide professional advice and representation for all legal matters.\n\nOur clients range from individuals, small to medium businesses and large corporations. With our staff of experienced lawyers, we focus on professionalism and success.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Wakefield-Vogrig-Lawyers-484550214979951/', '', '', '', '', '', ''),
  (68816, 'waters-lawyers-68816', 'Waters Lawyers', '', 'Waters Lawyers is a small business in Cranbourne dedicated to provide legal services including criminal law, family law, conveyancing, litigation, compensation, wills & estate and personal injury.', 271401, '2015-08-27 02:43:16', '2016-04-13 01:58:00', '', 191, 2496, 'compensation lawyers\ncriminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\npersonal injury lawyers\ncommercial lawyers\nestate lawyers', 271401, 0, '', '', '0359968825', '', '', '', 'http://www.waterslawyers.com.au', 'Waters Lawyers is a small business dedicated to providing you with the legal advice that you seek. Situated in the heart of Cranbourne, we strive to provide you with the best legal service in a wide range of areas of the law.\n\nWaters Lawyers has team of expert staff that focuses on you at a personal level and takes the time to get to know you in order to deliver outstanding service and tailored legal advice. Our goal is to assist you with your circumstances and achieve the best possible result.\n\nLocal Legal Professionals, our firm offers a cost-effective range of services to assist you with Family law, Wills and Probate, Commercial, Conveyancing, Personal Injury, Criminal Law and Litigation.No matter is too big or too small and we treat you at all times with our high quality service.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://www.google.com/maps/place/Waters+Lawyers/@-38.1129254,145.2824014,17z/data=!3m1!4b1!4m2!3m1!1s0x6ad60fbbd0ad8127:0x711f68858486ced2?hl=en'),
  (68842, 'whyte-just-moore-lawyers-68842', 'Whyte Just Moore Lawyers', '', 'Whyte Just Moore Lawyers is offering the Geelong region legal services including wills and estates, family law and commercial and business laws.', 271455, '2015-08-27 02:45:00', '2016-04-13 02:29:40', '', 191, 2482, 'divorce lawyers\nfamily lawyers\ncommercial lawyers\nestate lawyers', 271455, 0, '', 'info@wjmlawyers.com.au', '0352222077', '', '', '', 'http://www.whytejustmoore.com.au', 'Whyte Just Moore Lawyers is committed to achieving best commercial practice in delivery of legal services.\n\nWhyte Just Moore Lawyers is offering the Geelong region legal services since 1877 WJM has a large team of lawyers, experienced conveyancing and probate paralegals and support staff providing our clients with a full range of legal services. We are large enough to provide services in a broad range of law, but small enough to provide continuity and personal service unlike many larger firms. Long serving loyal staff enhance our ability to provide personal service of the highest quality.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]]}', '', '', 'https://www.linkedin.com/company/whyte-just-moore-lawyers', '', '', '', 'https://plus.google.com/+WhytejustmooreAu/about'),
  (68844, 'wilckens-roche-lawyers-68844', 'Wilckens Roche Lawyers', '', 'Wilckens Roche Lawyers is Williamstown''s oldest law firm providing expertise with range of legal services including family law, business and commercial law, property, wills & estates and other firms.', 271483, '2015-08-27 02:45:08', '2016-04-13 02:50:22', '', 191, 2474, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\nestate lawyers', 271483, 0, '', 'info@wrl.com.au', '0383835999', '', '', '', 'http://www.wrl.com.au', 'Wilckens Roche Lawyers is Williamstown''s oldest law firm   and one of the oldest law firms in the western suburbs of Melbourne.  \n\nThe team at Wilckens Roche Lawyers is committed to the highest standards of ethics and integrity and to providing quality, cost-effective legal services. To achieve this, we handle all matters in an efficient, timely and personal manner. That''s why Wilckens Roche Lawyers is the firm of choice for so many people and businesses in Melbourne''s western suburbs.\n\nWilckens Roche Lawyers offer comprehensive legal services with a friendly and professional approach. Our services are strengthened by astute lawyers, local knowledge and a commitment to providing quality legal services.\n\nOur highly-qualified lawyers are hand-picked from the local community, for their strong academic qualifications, life experience, communication skills and ability. They bring a refreshing, commonsense and practical approach and will work with you to understand your needs.\n\nOur Legal Services\n\n-Family Law\n-Business & Commercial Law\n-Property Law & Developments\n-Conveyancing\n-Online Property Settlements - The Future\n-Wills & Estate Planning\n-Will Disputes\n-Criminal and Traffic Law\n-Debt Collection\n-Intellectual Property\n-Hungarian Clients', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/WilckensRoche', 'https://www.linkedin.com/company/2491031?goback=%2Efcs_GLHD_wilckens+roche_false_*2_*2_*2_*2_*2_*2_*2_*2_*2_*2_*2_*2&trk=ncsrch_hits', '', '', '', 'https://plus.google.com/+WilckensRocheLawyersWilliamstown/posts'),
  (68891, 'zindilis-lawyers-68891', 'Zindilis Lawyers', '', 'Zindilis Lawyers is located in Footscray offering range of legal services including criminal law, wills and estate, commercial law, family law, conveyancing and other firms.', 271645, '2015-08-27 02:48:18', '2016-04-13 06:30:18', '', 191, 2399, 'criminal lawyers\ndivorce lawyers\nfamily lawyers\nproperty lawyers\ncommercial lawyers\ncorporate lawyers\nestate lawyers', 271645, 0, '', 'george@zindilislawyers.com.au', '0396897829', '', '', '', 'http://www.zindilislawyers.com.au', 'ZINDILIS LAWYERS is a Melbourne based law firm with multilingual law experts providing expertise that encompasses a comprehensive range of legal services in 3 locations. ZINDILIS LAWYERS strongly believes in resolution through negotiation and agreement.\n\nWe will listen to your individual story, as we believe that each situation and each client is different and we will discuss the best outcomes for you!\n\nOur legal services include:\n\n-Criminal\n-Wills\n-Estate & Probate\n-Immigration Law\n-Commercial Law\n-Workplace Relations and Safety\n-Family Law\n-Real Estate Conveyancing\n-Road Traffic Offences', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Zindilis-LAWYERS-292998274208937/', '', 'https://au.linkedin.com/in/george-zindilis-95449a32', '', '', '', 'https://plus.google.com/105928710182198667131/about'),
  (81533, 'ultimate-refrigeration-air-conditioning-81533', 'Ultimate Refrigeration & Air Conditioning', '', 'Ultimate Refrigeration and Air conditioning sales, install and repair a variety of refrigeration and air conditioning systems.', 0, '2015-09-17 00:12:06', '2016-04-26 03:38:10', '90945322539', 708, 713, 'air conditioning installation\nair conditioning repair\nmulti split installation\nducting installation', 0, 276006, '', 'am@ultimaterefrigerationandairconditioning.com.au', '0357623838', '357623838', '', '', 'http://www.ultimaterefrigerationandairconditioning.com.au/', 'Ultimate Refrigeration and Air conditioning sales, install and repair a variety of refrigeration and air conditioning systems. Our services are performed by professionally qualified technicians. We have the experience, skills and tools to fix problems right the first time. All of our repair services are guaranteed 100% in writing for your complete peace of mind. Service experts are fully licensed and insured in air conditioning repair, sales, installation and air conditioning maintenance for all brands of cooling equipment, throughout BENALLA VIC.', 'A', '{"1":[[0.3333333333,0.5],[0.5416666667,0.7083333333]],"2":[[0.3333333333,0.5],[0.5416666667,0.7083333333]],"3":[[0.3333333333,0.5],[0.5416666667,0.7083333333]],"4":[[0.3333333333,0.5],[0.5416666667,0.7083333333]],"5":[[0.3333333333,0.5],[0.5416666667,0.7083333333]]}', 'https://www.facebook.com/Ultimaterefrigeration', '', '', '', '', '', ''),
  (83259, 'southside-veterinary-surgery-83259', 'Southside Veterinary Surgery', '', 'Southside Veterinary Surgery located in Woree specialises in emergency services, dentistry, desexing, microchipping, washing and grooming, preventative health and many more.', 270537, '2015-09-18 04:18:38', '2016-04-12 00:41:55', '', 191, 2761, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 270537, 0, '', 'info@southsidevetsurgery.com.au', '0740332900', '', '', '0740332205', 'http://www.southsidevetsurgery.com.au', 'Southside Veterinary Surgery was purchased by Wade and Helen McAuley back in May 2000 and has been owned by them ever since. Since that time, the practice has grown to include six vets and over ten nurses.\n\nSouthside Veterinary Surgery provides modern, professional, and personally tailored health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff are all passionate about pets and avid animal lovers.\n\nAt Southside, you’ll be fully supported with sound advice as we know that  helping our clients starts with providing a good understanding of health care issues and treatment options. Being well informed will allow you to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines, and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nSouthside Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n\n• Behavioural advice\n• Dentistry\n• Desexing\n• Clinical pathology\n• Emergency\n• Washing and grooming\n• Preventative medicine\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3125,0.75]],"2":[[0.3125,0.75]],"3":[[0.3125,0.75]],"4":[[0.3125,0.75]],"5":[[0.3125,0.75]],"6":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/Southside-Vet-Surgery-565138366864632/', '', '', '', '', '', ''),
  (83270, 'ranford-veterinary-hospital-83270', 'Ranford Veterinary Hospital', '', 'Ranford Veterinary Hospital located in Canning Vale specialises in surgical procedures, digital x-rays, dentistry, weight loss programs, puppy preschool, microchipping and many more.', 271838, '2015-09-18 04:19:17', '2016-04-14 01:11:43', '', 191, 2304, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271838, 0, '', 'ranfordvet@westnet.com.au', '0894560222', '', '', '0894560220', 'http://www.ranfordvet.com.au', 'Ranford Veterinary Hospital have been caring for pets in the local community since 1996. We pride ourselves on providing great customer care and the best in Veterinary services.\n\nRanford Veterinary Hospital is modern and well equipped, and is located on the corner of Wilfred Road and Rangeview Place (Just off Ranford Road) in Canning Vale, servicing the surrounding suburbs of Harrisdale, Willetton, Leeming, Southern River, Piara Waters, Huntingdale, Bull Creek and Parkwood.\n\nWe are located across the road from a lovely park and have plenty of easily accessible parking for your convenience. \n\nRanford Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgical procedures\n• Vaccinations\n• Digital x-ray\n• Dentistry\n• Puppy preschool\n• Dietary advice\n• Weight loss program\n• Microchipping\n• Re-homing\n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.2916666667,0.7083333333]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/ranfordvet', '', '', '', '', '', ''),
  (83278, 'sugarland-veterinary-clinic-83278', 'Sugarland Veterinary Clinic', '', 'Sugarland Veterinary Clinic located in Bundaberg specialises in grooming, consultations, surgery and anaesthesia, x-rays, ultrasound, hospitalisation, dentistry, reptiles and exotic pet care and more.', 270665, '2015-09-18 04:19:47', '2016-04-12 02:36:21', '', 191, 2724, 'pet wash\npet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 270665, 0, '', 'info@sugarland.com', '0741513550', '', '', '', 'http://bundabergvets.com.au', 'Sugarland Vet Clinic set the standard in veterinary care. At Sugarland Vet Clinic we pride ourselves on providing the best care for your animal at a competitive price. \n\nWe know that when you are looking for vets in the Bundaberg area that you want all the professionalism and expertise that you would expect from a vet but at the same time providing Quality Customer service and care for your loved pet.\n\nOur clients are our friends here, we like to make the visit to the vet relaxed and stress free for all. We offer your pet a treat with each visit as something to look forward to for future visits. Between my team of nurses and I you will get the care your pet deserves.... we treat them as our own!\n\nSo, when you are searching for a vet, with a personal touch in Bundaberg or surrounding areas, make sure you give us a call at Sugarland Vet Clinic.\n\nSugarland Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultation\n• Surgery\n• Anaesthesia\n• X-rays\n• Ultrasound\n• Hospital care\n• Dentistry\n• Farm animal and equine services\n• Grooming and washing\n• Reptiles and exotic pets services', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/SugarlandVet', 'https://twitter.com/Sugarland_Vet', '', '', '', '', ''),
  (83280, 'eastside-veterinary-emergency-specialists-83280', 'Eastside Veterinary Emergency & Specialists', '', 'Eastside Veterinary Emergency & Specialists located in Rose Bay specialises in surgical procedures, medicinal treatments, radiography, ultrasound, endoscopy, laboratory tests and more.', 217686, '2015-09-18 04:19:55', '2016-04-18 00:50:38', '', 191, 1734, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 217686, 0, '', '', '0291997206', '', '', '', 'http://www.eastsidevets.com.au', 'Eastside Veterinary Emergency & Specialists are dedicated to providing around the clock emergency care for injured and ill pets. We also conduct specialist vet services during regular business hours by appointment. We are a team who are extremely dedicated to our work, so you can be assured that your pet’s wellbeing is our highest priority.\n\nEastside Veterinary Emergency & Specialists have a variety of highly skilled professional and qualified staff. We boast specialist veterinary surgeons and feline medicine specialists, as well as a highly trained team of emergency vets. We also possess a veterinary intern, a full roster of trained veterinary nursing staff, as well as our highly competent and reliable reception staff.\n\nEastside Veterinary Emergency & Specialists offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgical services\n• Medicinal treatments\n• Around the clock care\n• Radiography\n• Ultrasound\n• Endoscopy\n• Laboratory testing\n\nand more.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/EastsideVets', '', 'https://www.linkedin.com/company/eastside-veterinary-emergency-&-specialists', '', '', '', 'https://plus.google.com/+EastsideVetsAustralia/about'),
  (83283, 'five-dock-veterinary-hospital-83283', 'Five Dock Veterinary Hospital', '', 'Five Dock Veterinary Hospital located in Five Dock specialises in routine care, nutritional counselling, behavioural counselling, boarding, grooming, desexing, geriatric pet care and many more.', 218332, '2015-09-18 04:20:08', '2016-04-18 02:56:02', '', 191, 1681, 'veterinary surgeons\npet care\ndog grooming\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 218332, 0, '', 'info@fivedockvet.com.au', '0297137364', '', '', '0297122462', 'http://www.fivedockvet.com.au', 'Five Dock Veterinary Hospital is a full-service, small animal veterinary hospital providing comprehensive medical, surgical and dental care.\n\nWe offer a broad range of diagnostic procedures using both in-house testing and the use of external laboratories. Our facility includes a well-stocked pharmacy, surgery, x-ray, pathology analysis, a closely supervised hospitalisation area and isolation cages for those pets that require to be separated from the main population.\n\nAt Five Dock Veterinary Hospital, we strive to offer optimal veterinary care and, just as importantly, sound advice. Our job is not only to treat your pet when unwell but also to help you keep your best friends happy and healthy all the time.\n\nFive Dock Veterinary Hospital is dedicated to delivering quality personal care to keep your pets healthy and happy.\n\nFive Dock Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Routine care\n• Nutritional counselling\n• Behavioural counselling\n• Boarding\n• Grooming\n• Desexing\n• Dental care\n• Senior pet care\n• Microchipping\n• Surgical procedure\n• Radiography\n• In-house laboratory\n\nand more.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7916666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.5416666667]]}', 'https://www.facebook.com/fivedockvet/?fref=ts', '', '', '', '', '', ''),
  (83294, 'veterinary-specialist-services-gold-coast-83294', 'Veterinary Specialist Services - Gold Coast', '', 'Veterinary Specialist Services located in Carrara specialises in medical consultation, surgical procedures, dermatology, dentistry, diagnostic imaging, pet intensive care and many more.', 271253, '2015-09-18 04:20:52', '2016-04-13 00:08:24', '', 191, 2540, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271253, 0, '', 'vssgoldcoast@vss.net.au', '0755306370', '', '', '0755591308', 'http://www.vss.net.au', 'Veterinary Specialist Services on the Gold Coast was established in 2009 in order to further provide the best referral service to our patients, clients and referring veterinarians within this region. Although only recently launched on the Gold Coast, Veterinary Specialist Services has been long established in Brisbane since 2000. Veterinary Specialist Services is an extension of general veterinary practices all over Australia, particularly Queensland, Northern Territory and Northern New South Wales in providing the best possible care for your pets at a specialist level. When your pet requires our expert attention, your primary veterinarian can refer the pet to either our Gold Coast or Brisbane Services via a simple referral process. \n\nVeterinary Specialist Services (Gold Coast) is open for consultations from 8am – 5 pm Monday to Friday. Emergencies referrals on Saturdays can be seen at our Brisbane Hospital by appointment only. Our wonderful reception team is here to assist from 8 am to 6 pm (Monday to Friday). Outside of these times, our phones are diverted to Animal Emergency Services (a separate company within the same premise) who will be able to update you on the care of your pet. \n\nVeterinary Specialist Services (Gold Coast) has a wonderful team of dedicated internal medicine and surgery veterinarians in conjunction with several Veterinary Specialist Consultants in the fields of cardiology, dermatology and dentistry. Our comprehensive scope of specialist fields ensures the depth of knowledge, experience and skills required to provide your pet with the best possible care are always close at hand. With the speed of medical advances and depth of scientific understanding rapidly increasing in both human and animal fields, Veterinary Specialist Services appreciates the inherent importance of continual education for all our team members as well as maintaining close connections with international Specialists and cutting edge research. \n\nOur new facilities have been designed to allow state of the art diagnostic work up and treatment options. For a comprehensive look at al the services and facilities we have available at VSS, please click on the links above. We all know ourselves that it helps to see where your pet is going, so take the time to explore our Gold Coast Practice via our virtual tour.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/Veterinary-Specialist-Services-Gold-Coast-142050099174864/?fref=ts', '', '', '', '', '', '');
