  (83297, 'holland-park-veterinary-clinic-83297', 'Holland Park Veterinary Clinic', '', 'Holland Park Veterinary Clinic located in Holland Park specialises in  vaccinations, heartworm prevention, flea & tick control, quality diets, geriatric pet care, desexing, house calls and many more.', 271213, '2015-09-18 04:21:04', '2016-04-12 23:52:55', '', 191, 2551, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 271213, 0, 'Cnr Framont Ave', 'hollandpark@southsidevet.com.au', '0733974664', '', '', '', 'http://www.southsidevet.com.au', 'Holland Park Veterinary Clinic have been well established for over 30 years and serve our community in the south-eastern suburbs of the beautiful sub-tropical city of Brisbane, Queensland. The current principal Peter Kitchen has been with this veterinary practice for more than 30 years, and is well supported by other caring and skilled veterinarians. The original practice was set up by Dr Gerald Whitwell who retired in July 2007.\n\nHolland Park Veterinary Clinic pride ourselves on retaining a skilled and dedicated team of vets and nurses for the long term. This enables us to develop a friendly and lasting working relationship with our clients and patients. Many of our staff have already or are approaching 15 years service with our practice. Both our Clinics have been regularly nominated for yearly local business awards. Many generations of family pets have passed through our clinics and we have sustained memorable relationships with them and always strove to deliver happy, healthy and long lifetimes to them all. Our mission, to the best of our ability, is to deliver the highest quality and the longest quantity of life to the patients in our care. This focuses on a 3 sided partnership between the Pet , the Owner/Carer and the Veterinarian. Our veterinarians and our nurses regularly attend seminars, conferences and training courses to keep their skill and knowledge base up to date with all the latest developments in the veterinary field.\n\nHolland Park Veterinary Clinic provides an excellent range of skills and expertise with more than 55 hours of access to our services each week at each clinic. The veterinarians are ably supported by a dedicated and friendly group of qualified and trainee veterinary nurses. This completes an enthusiastic team of caring individuals who strive to give you excellent and personal service. After Hour Emergencies are referred to the Animal Emergency Services at Underwood.\n\nHolland Park Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including: \n\n• Vaccinations\n• Parasite control and prevention\n• Quality diets and pet care advice\n• Geriatric pet care\n• Desexing\n• House calls\n• Surgical procedures\n• Microchipping\n• Pathology services\n• Puppy preschool\n• Dentistry\n• Diagnostics\n• Washing and grooming\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.5833333333]]}', 'https://www.facebook.com/Carina-and-Holland-Park-Veterinary-Clinics-219337084757891/', '', '', '', '', '', ''),
  (83301, 'fox-valley-animal-hospital-83301', 'Fox Valley Animal Hospital', '', 'Fox Valley Animal Hospital located in Wahroonga specialises in consultation, surgical procedures, rehabilitation,  preventative medicine, radiology, ultrasonography, pathology and many more.', 219420, '2015-09-18 04:21:20', '2016-04-18 03:40:53', '', 191, 1653, 'veterinary surgeons\npet care\ndog grooming\nanimal hospital\nveterinary hospital\nveterinary clinic\nvets', 219420, 0, '', 'foxvalleyanimalhospital@gmail.com', '0294894805', '', '', '', 'http://www.fvah.com.au', 'Fox Valley Animal Hospital was founded by vet Bob Kibble almost four decades ago. When he retired in 2001, vet Alex Brittan took over what was only Wahroonga’s local veterinary hospital. Today, Fox Valley Animal Hospital remains the original (and the best) independently owned and operated Wahroonga vet servicing the Ku-Ring-Gai area.\n\nOwner and Vet Alex Brittan, Vet Katie Syms and the team of Fox Valley Animal Hospital pride themselves on quality service. Fox Valley Animal Hospital is the one you choose for your family pet when the care your animal receives really matters.\n\nEven the most junior member of the Fox Valley Animal Hospital team, Archie, is an animal lover\n\nAt Fox Valley Animal Hospital, we use only the best equipment in our state-of-the-art surgery and diagnostic clinic. We hire animal health professionals who are not only qualified and trained in the latest veterinary techniques and practises, but who also genuinely care for animals and their health outcomes.\n\nWe know your animal is a part of your family. That’s why your family pet is treated as though it were our own. No matter emergency or animal treatment needed, our aim is to make sure you and your pet receive the best possible care in the least stressful environment possible. We love it when our patients (human and animal) leave happy.\n\nEach of our staff makes a commitment to continuous learning in animal health so that we’re always offering the right advice and treatment for your animal. We work with local specialists in animal healthcare to ensure that your family pet always receives the best possible care. Many of us are active supporters of organisations that support animal welfare, and we actively participate in animal re-homing and pet adoption.\n\nWhen you choose Fox Valley Animal Hospital, you aren’t just choosing a Wahroonga vet. You’re choosing to be a part of a community of animal lovers located in the Ku-Ring-Gai area who value the health and happiness of your family pet.\n\nFox Valley Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Nutritional advice\n• Dietary advice\n• Flea and tick prevention\n• Desexing\n• Microchipping\n• Surgical procedures\n• Rehabilitation\n• In-house radiology\n• Ultrasonography\n• Pathology\n• Dentistry\n\nand more.', 'A', '{"1":[[0.3541666667,0.7708333333]],"2":[[0.3541666667,0.7708333333]],"3":[[0.3541666667,0.7708333333]],"4":[[0.3541666667,0.7708333333]],"5":[[0.3541666667,0.7708333333]],"6":[[0.3541666667,0.6041666667]]}', 'https://www.facebook.com/FoxValleyAnimalHospital', 'https://twitter.com/FVAHospital', '', '', '', '', 'https://plus.google.com/u/0/+FoxValleyAnimalHospitalWahroonga/about'),
  (83307, 'semaphore-veterinary-surgery-83307', 'Semaphore Veterinary Surgery', '', 'Semaphore Veterinary Surgery located in Semaphore specialises in consultations, surgery, puppy preschool, adult dog classes, dentistry, senior health day stay, digital, x-rays, ultrasonography & more.', 273323, '2015-09-18 04:21:45', '2016-04-15 07:09:13', '', 191, 1796, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 273323, 0, '', 'info@semaphorevet.com.au', '0882499999', '', '', '0882499777', 'http://www.semaphorevet.com.au', 'Semaphore Veterinary Surgery provides the highest quality care for our patients. We offer personalised service with integrity, friendliness and efficiency.\n\nSemaphore Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgery\n• Puppy Pre-School\n• Adult Dog Classes\n• Dentistry\n• Senior Health Day Stay\n• Digital X-Rays\n• Ultrasonography\n• Laboratory\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5]],"0":[[0.4166666667,0.5]]}', 'https://www.facebook.com/SemaphoreVet', '', '', '', '', '', 'https://plus.google.com/103545770116434003361/about'),
  (83310, 'vogue-vets-83310', 'Vogue Vets', '', 'Vogue Vets located in Joodanna specialises in consultations, life plan, microchipping, routine surgery, in house laboratory, radiology, dentistry, specialist procedures, hospitalisation and many more.', 272258, '2015-09-18 04:21:57', '2016-04-14 05:59:50', '', 191, 2221, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 272258, 0, '', 'voguevets.reception@gmail.com', '0894446800', '', '', '', 'http://www.voguevets.com.au', 'Vogue Vets love all animals, So, as soon as your pet walks through our door, we are ready with a welcoming pat, cuddle, and softly spoken words. Your pet will also receive a yummy treat every time they visit- what better way to make their trip worthwhile?\n\nVogue Vets understand that, whilst dogs may LOVE to investigate cats, the feeling is certainly not mutual!  Feeling safe and secure in a relaxed and friendly environment is important to them.  Therefore, to maximise the comfort of both our cat and dog patients, we have separate cat and dog consult rooms and hospital facilities, which ensures their visit is as relaxing as possible.\n\nVogue Vets believe that your pets are highly valued members of your family and, as such, we treat your pets as we would treat our own.\n\nThis means that the service you receive is caring, personalised, and tailored to suit your individual needs. \n\nWe know that preventative medicine helps to keep your pets healthy, and this offers the best chance to keep them happy and part of your family life for many years to come.\n\nTo make this easy for you, we send reminders when preventative treatment milestones are reached for your pet, and we outline any treatment plans so that they are easy for you to manage at home.  This takes the worry out of remembering what to do so that you can concentrate on life''s other events.\n\nVogue Vets offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Life Plan\n• Micro-chipping\n• Routine Surgery\n• In House Laboratory\n• Radiology\n• Dentistry\n• Specialist Procedures\n• Hospitalisation\n• Pathology and Laboratory Tests\n• Puppy Pre-School\n\nand more.', 'A', '{"1":[[0.3541666667,0.7708333333]],"2":[[0.3541666667,0.7708333333]],"3":[[0.3541666667,0.7708333333]],"4":[[0.3541666667,0.7708333333]],"5":[[0.3541666667,0.7708333333]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Vogue-Vets-188133591238839/?fref=ts', 'https://twitter.com/voguevets', '', '', '', '', 'https://plus.google.com/109947626744508595036/about'),
  (83312, 'the-gap-veterinary-surgery-83312', 'The Gap Veterinary Surgery', '', 'The Gap Veterinary Surgery located in The Gap specialises in diagnostic imaging services, surgical services, radiography, dentistry, pathology, flea control programs, microchipping, boarding and more.', 270797, '2015-09-18 04:22:05', '2016-04-12 03:37:43', '', 191, 2683, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 270797, 0, '', 'thegapvet@westnet.com.au', '0733001533', '', '', '', 'http://www.thegapvet.com.au', 'The Gap Veterinary Surgery is a well-established, full-service, small animal veterinary hospital providing comprehensive medical, surgical and dental care.\n﻿\nWe provide a broad spectrum of diagnostic procedures through in-house testing and the use of external laboratories. We also work closely with local practices when special diagnostic procedures are required.\n​\nThe facility includes a well-stocked pharmacy, in-hospital surgery suite, in-house x-ray capabilities, a closely supervised hospitalization area, and indoor boarding kennels with outdoor walking areas.\n﻿\nAt The Gap Veterinary Surgery we strive to offer not only sound advice, but also optimal veterinary care, thus allowing you the enjoyment of your companion for a maximum number of years.\n​\nOur job is not only to treat your pet when he or she isn''t feeling well, but also to help you learn how to keep your best friend happy and healthy.\n\nThe Gap Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Radiography\n• Orthopaedic surgery\n• Surgical services\n• Diagnostic imaging services\n• Pathology\n• Anaesthesia\n• Pharmacy\n• Dentistry\n• Flea control programs\n• Dietary counselling\n• Behavioural counselling\n• Boarding\n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.3333333333,0.7083333333]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/thegapvet/', '', '', '', '', '', ''),
  (83315, 'newton-veterinary-centre-83315', 'Newton Veterinary Centre', '', 'Newton Veterinary Centre located in Newton specialises in dental checks, puppy checks, puppy preschool, surgery, parasite control and prevention, lab testing and many more.', 272888, '2015-09-18 04:22:17', '2016-04-15 01:12:29', '', 191, 2022, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272888, 0, '', 'gdbvet@hotmail.com', '0883655010', '', '', '', 'http://www.newtonvet.com.au', 'Newton Veterinary Centre offer a broad range of quality veterinary services to give them the best possible care at an affordable price. With our highly experienced veterinary surgeons and state-of-the-art clinic, we can look after your pet’s general wellness, dental care, nutritional care and surgery.\n\nNewton Veterinary Centre''s veterinary surgeon is highly qualified to care for your pet or pets. Whether you are looking for vet care in Paradise, Athelstone, Rostrevor, Campbelltown or any of Adelaide''s North Eastern suburbs we have caring and gentle staff who love animals as much as you do.\n\nWith the latest equipment and brand new, top quality facilities, we are able to provide the best medical care possible and ensure the ongoing health of your pet. Trust your pet to our highly skilled veterinary surgeon in Adelaide''s North East Suburbs.\n\nNewton Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Free Puppy Checks\n• Vaccinations and protection from parasites\n• Surgery including desexing\n• Lab testing for disease diagnosis\n• Nutritional care and pet accessories\n• Free Dental checking\n\nand more', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/Newton-Veterinary-Centre-160466867487656/', '', '', '', '', '', ''),
  (83316, 'glebe-veterinary-hospital-83316', 'Glebe Veterinary Hospital', '', 'Glebe Veterinary Hospital located in Glebe specialises in vaccinations, ticks and fleas protection, general surgery, sterilisation, laboratory testing, dental care, natural pet care and many more.', 216123, '2015-09-18 04:22:22', '2016-04-18 05:30:43', '', 191, 1628, 'pet care\ndog grooming\nanimal hospital\nveterinary hospital\nveterinary clinic\npets\nvets', 216123, 0, '', 'glebevet@tpg.com.au', '0296601771', '', '', '', 'http://www.glebevet.com.au', 'Glebe Veterinary Hospital provides a quality range of vet services in Glebe. Whether they’re young or old, sick or in perfect health, our vets will provide the best vet services for your loved one.\n\nTo ensure the ongoing good health of your pet, we can provide up-to-date vaccinations for your dog, cat or rabbit, as well as nutritional advice and quality protection from parasites including ticks, fleas and worms. We also offer microchipping, dentistry, and weight loss advice.\n\nWe offer general surgery services, including desexing of dogs, cats, and other domestic animals as well as soft tissue, orthopaedic and reconstructive surgery following trauma in our state-of-the-art clinic.\n\nAt Glebe Veterinary Hospital, we are well equipped to provide a comprehensive range of diagnostic testing including all required laboratory research with blood and urine pathology, as well as radiology and ultrasounds which allows us to offer a full range of vet services.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]],"0":[[0.375,0.5]]}', '', '', 'https://www.linkedin.com/company/glebe-veterinary-hospital', '', '', '', 'https://plus.google.com/105397369393004129764/about'),
  (83336, 'st-george-veterinary-practice-83336', 'St George Veterinary Practice', '', 'St George Veterinary Practice located in St George specialises in health checks, preventative medicine, radiography, surgical procedures, boarding, microchipping, washing and grooming and more.', 270559, '2015-09-18 04:23:43', '2016-04-12 00:56:31', '', 191, 2755, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 270559, 0, '', 'vets@stgeorgevet.com.au', '0746255929', '', '', '', 'http://www.stgeorgevet.com.au', 'The St George Veterinary Practice is located on the north side of the St George township on the banks of the Balonne River.\n\nThe Practice services a very productive cattle, sheep, cotton and mixed farming district.\n\nSt George Veterinary Practice provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt St George Veterinary Practice, you’ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nSt George Veterinary Practice has been an integral part of our local community for years. In that time, we’ve helped thousands of our clients cats & dogs, rabbits & guinea pigs, birds, horses and even a few snakes. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.\n\nSt George Veterinary Practice offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccination\n• Health checks\n• Parasite prevention\n• Radiography\n• Desexing \n• Orthopaedic surgery\n• Behavioural advice\n• Boarding\n• Emergency service\n• Washing and Grooming\n• Microchipping\n• Farm animal and equine services \n\nand more.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3541666667,0.4583333333]]}', '', '', '', '', '', '', 'https://plus.google.com/117168178509754177450/about'),
  (83345, 'sunnybank-veterinary-clinic-83345', 'Sunnybank Veterinary Clinic', '', 'Sunnybank Veterinary Clinic located in Sunnybank specialises in annual health care regime, dentistry, radiography, ultrasonography, desexing, orthopaedic, boarding, washing and grooming and more.', 270697, '2015-09-18 04:24:19', '2016-04-12 02:47:43', '', 191, 2716, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 270697, 0, '', 'sunnybankvet@gmail.com', '0733456689', '', '', '', 'http://www.sunnybankvets.com.au', 'Sunnybank Veterinary Clinic provides modern, professional and reliable health care for your pets. We aim to make you and your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated team shares a passion for animals and preventative care and can’t wait to meet you.\n\nAt Sunnybank Veterinary Clinic, you’ll be fully supported with sound advice first and foremost. We build relationships with each of our clients by providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, surgical suite, diagnostic machines including x-ray, ultrasound, blood analysis, microscope and pharmaceutical stores we provide prompt assistance for a wide range of pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet shortly.\n\nDr Michelle Walker took over the established practice of 25 years mid-2014 to instill her passion and dedication to the industry. Along with her professional dedicate team, Sunnybank Veterinary Clinic provides a personable and reliable health care service to its client and patients.  As owner and Principle Veterinarian Dr Michelle’s many years’ experience in clinics throughout Australia has seen her working with dogs, cats, birds and reptiles. Dr Michelle would and the team would like to welcome you are your furry family to Sunnybank Veterinary Clinic.\n\nSunnybank Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Annual health care check\n• Dentistry\n• Radiography\n• Ultrasonography\n• Clinical Pathology\n• Anaesthetic\n• Desexing\n• Orthopaedic\n• Ophthalmic\n• Boarding advice\n• Behavioural advice\n• Washing and grooming\n• Reptile and exotic pet care\n\nand more.', 'A', '{"1":[[0.3541666667,0.4583333333],[0.625,0.75]],"2":[[0.3541666667,0.4583333333],[0.625,0.75]],"3":[[0.3541666667,0.4583333333],[0.625,0.75]],"4":[[0.3541666667,0.4583333333],[0.625,0.75]],"5":[[0.3541666667,0.4583333333],[0.625,0.75]],"6":[[0.3541666667,0.5]]}', 'https://www.facebook.com/sunnybankvet/', '', '', '', '', '', 'https://plus.google.com/110349946224635856877/posts'),
  (83351, 'riseley-veterinary-centre-83351', 'Riseley Veterinary Centre', '', 'Riseley Veterinary Centre located in Myaree specialises in vaccinations, sterilisation, routine check up, dentistry, microchipping, surgical procedures and many more.', 271862, '2015-09-18 04:24:43', '2016-04-14 01:27:55', '', 191, 2293, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271862, 0, '', 'reception@riseleyvet.com.au', '0893299222', '', '', '', 'http://www.riseleyveterinarycentre.com.au', 'Riseley Veterinary Centre was established by Dr Ray Butler at 789 Canning Hwy, Applecross in 1985. After 24 enjoyable years providing professional, friendly and personalised care to his fantastic clients and their adorable pets, Dr Ian McDowell took over from Dr Ray Butler as principal veterinarian in 2009.\n\nDr Ian McDowell has worked and lived in the area since high school, graduating from Murdoch University in 1993. After a few years away gaining valuable skills and experience as a veterinary surgeon in the UK returned to Perth to continue working in his local area.\n\nDeveloping a keen interest in treating more unusual pets Riseley Veterinary Centre was hard to ignore.  As a truly “local vet” he is the perfect person to continue Dr Ray’s fantastic work.\n\nIn 2011 Riseley Veterinary Centre moved to a brand new purpose built clinic in Hulme Court, Myaree.  Where there is plenty of hassle free parking and a lot less traffic gridlock.\n\nThe new purpose built surgery offers improved care for clients along with a great team of passionate pet care professionals.\n\nRiseley Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Sterilisation\n• Routine check up\n• MIcrochipping\n• Boarding\n• Surgical procedures\n\nand more', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Riseley-Veterinary-Centre-216410525063531/?fref=ts', '', '', '', '', '', ''),
  (83353, 'salisbury-highway-veterinary-surgery-83353', 'Salisbury Highway Veterinary Surgery', '', 'Salisbury Highway Veterinary Surgery located in Salisbury specialises in digital x-rays, surgical procedures, dentistry, in-house laboratory testing, preventative health care programs and many more.', 273293, '2015-09-18 04:24:51', '2016-04-15 07:10:58', '', 191, 1794, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 273293, 0, '', 'info@shvs.com.au', '0882587978', '', '', '', 'http://www.shvs.com.au', 'Salisbury Highway Veterinary Surgery is a modern, well equipped practice providing exceptional care and service to our staff, clients and patients; producing the best possible outcomes within our clients’ capabilities and desires whilst caring for the environment. Visiting SHVS should be a positively memorable experience wherever possible for all who have contact with us.\n\nCommunity awareness and animal welfare are paramount to the staff and management of Salisbury Highway Veterinary Surgery.\n\nThe management and staff of Salisbury Highway Veterinary Surgery are dedicated to providing a high quality medical and surgical facility for your pet whilst maintaining a friendly, approachable service.\n\nSalisbury Highway Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• digital x-rays\n• surgery\n• dentals\n• blood pressure monitoring\n• in-house laboratory testing\n• preventative healthcare programs\n• behaviour consults\n• puppy preschool classes\n• doggy deportment classes\n\nand more.', 'A', '{"1":[[0.3333333333,0.7708333333]],"2":[[0.3333333333,0.7708333333]],"3":[[0.3333333333,0.7708333333]],"4":[[0.3333333333,0.7708333333]],"5":[[0.3333333333,0.7708333333]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/pages/Salisbury-Highway-Veterinary-Surgery/346348940941', '', '', '', '', '', 'https://plus.google.com/114332218401999838140/about'),
  (83354, 'kalgoorlie-veterinary-clinic-83354', 'Kalgoorlie Veterinary Clinic', '', 'Kalgoorlie Veterinary Clinic located in Kalgoorlie specialises in dental checks, hospitalisation, preventative medicine, vaccinations, desexing, endoscopy, arthritis management and many more.', 272513, '2015-09-18 04:24:55', '2016-04-14 07:14:15', '', 191, 2175, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272513, 0, '', 'kalgoorlievet@bigpond.com', '0890213965', '', '', '', 'http://www.kalvet.com.au', 'Kalgoorlie Veterinary Clinic has been a part of the Goldfields since the early 1970’s. We were originally situated next door but moved to our new premises in the 1990’s.\n\nWe have a lot of long term clients and friends, some of whom just come in for a chat occasionally and hopefully bring a cake.\n\nOur wonderful staff treat all our clients and their pets with respect and care and we all do our best to provide the best outcome possible for every pet at a reasonable price. \n\nOur modern, spacious, purpose-built premises are designed to make a visit as enjoyable \n\nKalgoorlie Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Desexing\n• Endoscopy\n• Microchipping\n• Ultrasound\n• Radiography\n• Radiology\n• Surgical procedure\n• Dentistry\n• Hospitalisation\n• Preventative care\n\nand more.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Kalgoorlie-Veterinary-Clinic-408315242637333/', '', '', '', '', '', ''),
  (83355, 'gowrie-vet-clinic-83355', 'Gowrie Vet Clinic', '', 'Gowrie Vet Clinic located in Inverell specialises in desexing, vaccinations, microchipping, in-house laboratory, radiography, surgical procedure, emergency care services, grooming and many more.', 274198, '2015-09-18 04:24:59', '2016-04-18 06:42:59', '', 191, 1586, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274198, 0, '', 'gowrievet@gowrievet.com.au', '0267212277', '', '0427236204', '', 'http://gowrievetclinic.com.au', 'Gowrie Vet Clinic is situated in Inverell NSW and provides veterinary services for small and large animals. It is our commitment to provide your animal with high quality veterinary care including routine preventative health care, early detection and treatment of disease and complete medical and surgical care.\n\nOur staff have a strong passion for animals as we’re all animal owners and lovers. From companion animals that are part of the family, valuable equines, to farm animals that are an investment, we have the experience to service your needs.\n\nGowrie Vet Clinic''s mission is to provide friendly, relate-able customer service and to practice the highest quality medical care while treating your pet as if it were our own – making their time with us as comfortable and stress free as possible while providing each and every animal personal attention to maximize the care of their own unique needs. .\n\nGowrie Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Desexing\n• Microchipping\n• Vaccinations\n• In-house laboratory\n• Radiography\n• Surgery\n• Emergency \n• Grooming\n• Nutritional advice\n• Farm animal and equine care services\n\nand more.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.4583333333]],"0":[[0.4166666667,0.4583333333]]}', 'https://www.facebook.com/Gowrie-Vet-Clinic-254159221290731/', '', '', '', '', '', ''),
  (83359, 'paralowie-veterinary-surgery-83359', 'Paralowie Veterinary Surgery', '', 'Paralowie Veterinary Surgery located in Paralowie diagnostics, vaccinations, pet dentistry, spay and neuter, microchipping, senior pet care, wellness care, exotic pet care and many more.', 273022, '2015-09-18 04:25:15', '2016-04-15 07:17:48', '', 191, 1782, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 273022, 0, '', 'paralowievetrecp@chariot.net.au', '0882584818', '', '', '0882582220', 'http://www.paralowievet.com', 'Paralowie Veterinary Surgery is a full service animal hospital dedicated to the treatment and care of domestic and exotic pets.  Now in its third ownership, Paralowie Veterinary Surgery has been a landmark veterinary facility for over 30 years. \n\nOur team of highly skilled and experienced Veterinarians and veterinary Support Staff are dedicated to compassionate care for all your pets. Our philosophy of care, advanced technology and service is driven by our dedication to animals. Paralowie Veterinary Surgery offers the highest level of veterinary medicine to the northern suburbs of Adelaide. \n\nDespite the modest exterior, our surgery houses some of the most comprehensive veterinary diagnostic and treatment facilities available in Southern Australia.  We continually invest in staff training and equipment which allows us to operate at the forefront of veterinary medicine, advanced surgery and diagnostic imaging.  \n\nWe have expanded our hospital and staff to offer treatment to birds, rabbits, pocket pets and exotics.  Our pledge to keep charges at very reasonable rates, allows our patients and clients to benefit from our extensive services.  We believe that every patient and client should have access to state-of-the-art procedures and treatment options. Our commitment to excellence has driven every facet of our veterinary surgery. \n\nWeekly reviews of everything from reception protocol, consultations, diagnostic strategies, surgical procedures and treatment options, ensure that our patients and clients always have access to the highest levels of pet health care.  Unique to this practice is collaboration by all of our veterinarians and nurses, three times a day, to discuss all cases whether in hospital or just part of a routine consultation. This ensures that your pet will benefit from the highest level of collaboration and expertise in providing superior veterinary care.\n\nParalowie Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Diagnostics\n• Vaccinations\n• Pet Dentistry\n• Spay and Neuter\n• Surgical procedures\n• Microchipping\n• Senior pet care\n• Wellness care\n• Exotic pet care\n\nand more.', 'A', '{"1":[[0.3333333333,0.8125]],"2":[[0.3333333333,0.8125]],"3":[[0.3333333333,0.8125]],"4":[[0.3333333333,0.8125]],"5":[[0.3333333333,0.8125]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/ParalowieVet/', '', '', '', '', '', ''),
  (83363, 'valley-vet-surgery-walkerston-83363', 'Valley Vet Surgery - Walkerston', '', 'Valley Vet Surgery located in Walkerston specialises in health check, microchipping, vaccination, parasite control and prevention, farm animals and equine services, puppy preschool and many more.', 271153, '2015-09-18 04:25:31', '2016-04-12 23:11:54', '', 191, 2567, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271153, 0, '', 'admin@valleyvet.com.au', '0749592099', '', '', '', 'http://www.valleyvet.com.au', 'Valley Veterinary Surgery aims to provide a high quality, professional service for both small and large animal clients. We understand the bond between you and your pet and are committed to offering high quality affordable veterinary care with compassion from people who really care. Our staff are an enthusiastic team of vets and nurses all who have a common goal of providing the best possible care for our patients and focusing on the unique concerns of each individual pet owner.\n\nWe pride ourselves on our team selection and use a team approach to problem solving and achieving results. This ensures you always receive the best possible advice and pet care from people who really care. We are constantly upgrading our skills and knowledge and know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nValley Veterinary Surgery understand that animals don''t get sick or injured between 9am and 5pm on weekdays which is why we have a strong commitment to afterhours service. We are here when you need us.\n\nValley Veterinary Surgery has been an integral part of our local community for years. Being so strongly integrated with our local community is important to us and our clients. Our clients know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our friendly veterinary team. Valley Veterinary Surgery provides family-style care for you and your pets, where modern-day medicine meets traditional "old fashioned" quality service.\nWe look forward to caring for you and your pets.\n\nValley Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health check\n• Microchipping\n• Pet behavioural advice\n• Vaccination\n• Pet insurance\n• Parasite control and prevention\n• Farm animals and equine services\n• Ultrasound\n• Dentistry\n• Desexing\n• Radiography\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Valley-Vet-Surgery-398142953544020/', '', '', '', '', '', ''),
  (83369, 'happy-tails-veterinary-hospital-83369', 'Happy Tails Veterinary Hospital', '', '', 274538, '2015-09-18 04:25:55', '2016-04-19 00:44:01', '', 191, 1475, 'pet care\ndog grooming\npet grooming\nanimal hospital\nveterinary hospital\nvets', 274538, 0, '', 'mail@happytails-vet.com', '0287531300', '', '', '', '', '', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.75]],"0":[[0.4166666667,0.5833333333]]}', 'https://www.facebook.com/happytailsvet/', '', '', '', '', '', 'https://plus.google.com/108429694017411684232/about'),
  (83372, 'macleay-valley-veterinary-services-83372', 'Macleay Valley Veterinary Services', '', 'Macleay Valley Veterinary Services located in Kempsey specialises in consultations, house calls, after hours calls, puppy preschool, pet insurance, digital x-rays, ultrasound and more.', 275211, '2015-09-18 04:26:07', '2016-04-22 00:02:43', '', 191, 1171, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 275211, 0, '', 'andrew@mvvs.net.au', '0265627391', '', '', '', 'http://www.andrewbennettvet.com.au', 'Macleay Valley Veterinary Services has been established in Kempsey for many years. Originally opened by David Simon in October 1982 in Forth Street before moving to the current site in Belgrave Street in 1984.\n\nCurrent owners Andrew Bennett and Mitchell Edwards joined the practice in 1991 and 2004 respectively. After returning from a year working in the UK in 1994, Andrew became a partner in 1996. Andrew & wife Karen took over as sole owners in 2001 with David leaving the practice. In 2013 Long term veterinarian Mitchell Edwards and his wife Nicole became partners in the practice.\n\nThe Practice has seen many changes & has grown to now be a busy 7 vet Practice. The workload is varied with all aspects of veterinary medicine being catered for. MVVS has Kempsey & South West Rocks Clinics as well as the Mid North Coast Equine Reproduction Centre\n\nThe Kempsey Clinic underwent renovations in 2008 and is now a fully equipped, purpose built veterinary centre which provides the platform for the veterinary team to pursue high quality veterinary care.\n\nThe clinic is fully equipped with all diagnostic and therapeutic tools, three consultation rooms, a large vet/conference room, an operating theatre, a large open treatment room, an intensive care ward, a fully equipped laboratory, separate dog and cat hospitals, X-ray, ultrasound & endoscopy facilities, an isolation unit, and equine ultrasound & radiology areas.\n\nMacleay Valley Veterinary Services offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• House calls\n• After hours calls\n• Puppy preschool\n• Pet insurance\n• Digital x-rays\n• Ultrasound\n• Video otoscope\n• Pathology services\n• Dentistry\n• Surgical procedures\n• Opthalmology\n• Farm animals and equine care services\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.375,0.4583333333]]}', 'https://www.facebook.com/MacleayValleyVetServices/', '', '', '', '', '', 'https://plus.google.com/115000465758412280679/about'),
  (83383, 'killarney-vale-veterinary-clinic-83383', 'Killarney Vale Veterinary Clinic', '', 'Killarney Vale Veterinary Clinic located in Killarney Vale specialises in vaccinations, flea and tick control, microchipping, dentistry, worming, nutrition advice and many more.', 274816, '2015-09-18 04:26:51', '2016-04-19 05:33:24', '', 191, 1368, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274816, 0, '', 'kvvets@optusnet.com.au', '0243342002', '', '', '', 'http://www.killarneyvalevet.com.au', 'Killarney Vale Veterinary Clinic pride ourselves on being a team of confident, ethical and warm-hearted veterinary professionals.\n \nWe encourage open and honest communication enabling our clients to make informed and responsible decisions concerning their pet’s health and wellbeing.\n\nTo ensure both our clients and patients feel safe and respected we deliver quality pet healthcare for all life stages with the highest levels of compassion.\n \nAs pet owners, we understand the human/animal bond and how important that connection is. This alone motivates us for continual improvement through learning and sharing, never losing sight of our patients’ and clients’ changing needs.\n\nKillarney Vale Veterinary Clinic aims to provide your pet with the very best in medical care. \n\nKillarney Vale Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Well Being Programs\n• Radiology\n• Pathology\n• Desexing\n• Dentistry\n• Ultrasound\n• Orthopaedic & Soft Tissue Surgery\n• Euthanasia and Cremation \n\nand many more.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Killarney-Vale-Vet-Clinic-387847757930522/', '', '', '', '', '', 'https://plus.google.com/110429596999429414049/about'),
  (83385, 'goonoo-goonoo-road-veterinary-clinic-83385', 'Goonoo Goonoo Road Veterinary Clinic', '', 'Goonoo Goonoo Road Veterinary Clinic located in Tamworth specialises in general health checks, vaccinations, dentistry, radiography, pathology, washing and grooming, microchipping and many more.', 274124, '2015-09-18 04:26:59', '2016-04-18 06:10:06', '', 191, 1608, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274124, 0, '', 'goonoovet@bigpond.com', '0267620300', '', '', '', 'http://www.goonoovet.com.au', 'Goonoo Goonoo Road Veterinary Clinic provide modern, professional and affordable health care for your pets in the Tamworth area. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations.\n\nOur dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n \nAt Goonoo Goonoo Road Veterinary Clinic, you’ll be fully supported with sound advice first and foremost. We know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nGoonoo Goonoo Road Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General Health Checks\n• Dog & Cat Vaccinations\n• Intestinal Worming\n• Heartworm\n• Flea & Tick Control\n• Dentistry\n• Radiography & Pathology\n• Dog & Cat Desexing\n• Orthopaedic Surgery\n• Dental Surgery\n• Soft Tissue Surgery\n• Ophthalmic Surgery\n• Emergency Surgical Procedures\n• Puppy & Kitten Microchipping Services\n• Washing & Grooming Services\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.4583333333]]}', 'https://www.facebook.com/GoonooGoonooVet/timeline?ref=page_internal', '', '', '', '', '', ''),
  (83392, 'spearwood-veterinary-hospital-83392', 'Spearwood Veterinary Hospital', '', 'Spearwood Veterinary Hospital located in Hamilton Hill specialises in consultations, vaccinations, surgical procedures, puppy preschool, do-it-yourself dog wash, grooming, boarding and many more.', 271968, '2015-09-18 04:27:27', '2016-04-14 02:15:14', '', 191, 2254, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271968, 0, '', 'spearwoodvet@gmail.com', '0894183400', '', '0417997500', '0894183106', 'http://spearwoodvet.squarespace.com', 'Spearwood Veterinary Hospital is a purpose built veterinary practice, dedicated  to offering the highest quality service to you and your pets. Our hospital is staffed with caring and professional staff, who are all pet owners themselves and understand the strong bond between owners and their pets.\n\nDr George Jackson has owned and run Spearwood Veterinary Hospital for over 30 years. He and his dedicated team provide Spearwood, Coogee, Hamilton Hill, Hilton, Fremantle, South Lakes, Yangebup, Beeliar and surrounds with compassionate and high quality veterinary care at competitive prices. We offer a service to the community by accepting injured wildlife and strays as well as offering a community services discount off our sterilisation prices.\n\nWe have an in-house laboratory for prompt, efficient processing of your pets blood work, state of the art digital xray processor and a full range of diagnostic and support equipment such as ultrasonic dental scaler, pulse oximeter, blood pressure monitor and intra venous infusion pumps.\n\nWhether its for a routine check up, microchip, behavioural advice, wellness screen or an overnight stay in hospital, you can be assured we will provide the best care possible for your furry friend.\n\nSpearwood Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Surgery\n• Grooming\n• Puppy preschool\n• Microchipping\n• Do-it-yourself dog wash\n• Cat boarding\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.625]],"0":[[0.4166666667,0.5416666667]]}', 'https://www.facebook.com/Spearwood-Veterinary-Hospital-173402256071260/', '', '', '', '', '', ''),
  (83397, 'griffith-veterinary-hospital-83397', 'Griffith Veterinary Hospital', '', 'Griffith Veterinary Hospital located in Griffith specialises in vaccination, health checks, microchipping, dentistry, radiography, ultrasonography, desexing, emergency procedures and many more.', 274498, '2015-09-18 04:27:47', '2016-04-19 00:09:35', '', 191, 1491, 'pet wash\npet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274498, 0, '', 'griffithveterinaryhospital@yahoo.com.au', '0269623142', '', '', '', 'http://www.griffithvethospital.com.au', 'Griffith Veterinary Hospital will always have your pet’s health, vitality and welfare at precedence. We are passionate advocates of our company vision ‘enriching your life through the joy of pets’ and our purpose is to provide our clients with ‘peace of mind’ in regards to the health requirements of their pet. To achieve this we have designed protocols based on the services we would insist upon receiving if one of our pets required a visit to a veterinary hospital. Considering our expectations, we perceive the care, expertise and premium standards our pet receives the most imperative part of making a decision when choosing a veterinary hospital. Allow us to provide you with a gold standard in service and ‘peace of mind’ that your pet will be treated like family when entrusted to our care.\n\nOur purpose is to provide our clients with ‘peace of mind’ in regards to the health needs of their loved pet. As a pet parent, it’s easy to recognise when your pet is off-colour and we understand how stressful and daunting visiting the vet may be for both of you. Rest assured we are here to accommodate you and provide ‘peace of mind’. We will achieve this by providing our clients with advice, services and products to maintain their pet’s health and vitality. Additionally, we offer treatments, diagnostics and surgeries for illnesses and injuries. We ensure our staff are up to date with the latest treatment options available in veterinary medicine and speak ‘plain English’ to ensure that our clients understand our solutions and treatments.\n\nGriffith Veterinary Hospital are always improving as individuals and team-members to ensure our services are ‘world’s best practice’. We are consistently improving our team with ongoing training and guidance to ensure they perform their duties to a level of excellence that you expect. We will always provide our clients and their pets with care and compassion and endeavour to exceed the call of duty.\n\nGriffith Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Flea and tick control\n• Microchipping\n• Dentistry\n• Radiography\n• Ultrasonography\n• Pet insurance\n• Desexing\n• Ophthalmic\n• Emergency procedures\n• Puppy preschool\n• Washing and grooming\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Griffith-Veterinary-Hospital-577228192327333/', '', '', '', '', '', 'https://plus.google.com/102954170806516577876/about');
