  (83402, 'south-burnett-veterinary-services-kingaroy-83402', 'South Burnett Veterinary Services - Kingaroy', '', 'South Burnett Veterinary Services located in Kingaroy specialises in health checks, vaccination, parasite control and prevention, dentistry, ultrasonography, radiography, surgery and many more.', 271577, '2015-09-18 04:28:07', '2016-04-13 05:23:26', '', 191, 2429, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 271577, 0, '', 'info@sbvets.com.au', '0741624999', '', '', '', 'http://www.sbvets.com.au', 'South Burnett Veterinary Services - Kingaroy Clinic provides professional, caring and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt South Burnett Veterinary Services - Kingaroy Clinic, you’ll be fully supported with sound advice first and foremost. We know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical range we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit at South Burnett Vets Murgon, Kingaroy or Wondai.\n\nSouth Burnett Veterinary Services as been an integral part of our local community for 27 years. In that time, we’ve helped thousands of our clients cats & dogs, guinea pigs, birds, horses, cattle and even a few alpacas. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.\n\nSouth Burnett Veterinary Services - Kingaroy Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Dentistry\n• Ultrasonography\n• Radiography\n• Clinical Pathology\n• Desexing\n• Orthopaedic\n• Emergency procedure\n• Microchipping\n• Grooming and Hydrobath\n• Behavioural advice\n• Large animal service\n\nand more.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3541666667,0.4791666667]]}', 'https://www.facebook.com/South-Burnett-Veterinary-Services-241795839352835', '', '', '', '', '', ''),
  (83411, 'yeronga-vet-surgery-83411', 'Yeronga Vet Surgery', '', 'Yeronga Vet Surgery located in Fairfield specialises in vaccinations, parasite control and prevention, desexing, dentistry, obesity management, geriatric care, behaviour consultation and many more.', 271519, '2015-09-18 04:28:43', '2016-04-13 03:30:11', '', 191, 2459, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271519, 0, '', 'yerongavetsurgery@gmail.com', '0738485775', '', '', '', 'http://www.yerongavet.com.au', 'Yeronga Vet Surgery has been owned by Dr Anita Bean BVSC (Hons) since 2006. Our veterinary practice team are highly experienced to care for your pet.\n\nYeronga Vet Surgery have caring and compassionate staff who love animals as much as you do. Our team has over 40 years experience and combined with the latest equipment and top quality facilities, we are able to provide the best medical care possible and ensure the ongoing health of your pet.\n\nYeronga Vet Surgery aims to provide your pet with the happy, healthy life it deserves. We take a holistic approach to your pet’s wellness. We offer a range of veterinary services covering routine vaccinations, medical treatments and a fully equipped surgical theatre.\n\nThe surgery also uses computerised records and has the ability to store information regarding all aspects of your pet’s health, even down to their favourite food!\n\nWe also offer additional services such as free nutritional and general behavioural advice and our staff has an extensive knowledge on a wide range of pet care products.\n\nOur staff is always on hand to offer friendly advice regarding all your pet care needs, such as worming and parasite control or just a yummy treat and a cuddle.\n\nYeronga Vet Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Heartworm prevention\n• Ticks and fleas control\n• Obesity management\n• Senior care\n• Puppy and kitten care\n• Desexing\n• Lump removal\n• Dentistry\n• Orthopaedic\n• Boarding\n• Behaviour consultation\n• Puppy preschool\n\nand many more.', 'A', '{"1":[[0.3333333333,0.7708333333]],"2":[[0.3333333333,0.7708333333]],"3":[[0.3333333333,0.7708333333]],"4":[[0.3333333333,0.7708333333]],"5":[[0.3333333333,0.7708333333]],"6":[[0.3333333333,0.5833333333]]}', 'https://www.facebook.com/Yeronga-Vet-Surgery-527596143927821/', '', '', '', '', '', ''),
  (83417, 'jersey-road-veterinary-hospital-83417', 'Jersey Road Veterinary Hospital', '', 'Jersey Road Veterinary Hospital located in Woollahra specialises in consultations, vaccinations, microchipping, anti-parasitic treatments, in-house blood tests, surgery, radiography and many more.', 216451, '2015-09-18 04:29:08', '2016-04-19 02:04:42', '', 191, 1440, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 216451, 0, '', 'jersvet@tpg.com.au', '0293633563', '', '', '0293276931', 'http://www.jerseyroadvet.com', 'Jersey Road Veterinary Hospital has been faithfully serving our furry friends in the Eastern Suburbs of Sydney for the last 30 years. \n \nWe provide professional veterinary services and pride ourselves in having great relationships with both our clients and their pets. \n\nLocated in the heart of Woollahra and Paddington, we aim to provide the best veterinary care to your pets. \n \nWe have a dedicated team of 2 veterinarians and 4 veterinary nurses.\n\nJersey Road Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Microchipping\n• Anti-parasitic treatments\n• In-house blood tests\n• Surgical procedure\n• Digital radiography\n• Ultrasonography\n• House calls\n\nand more.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7916666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.5833333333]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/jerseyroadvet/?fref=ts', '', '', '', '', '', ''),
  (83421, 'larkhill-small-animal-hospital-83421', 'Larkhill Small Animal Hospital', '', 'Larkhill Small Animal Hospital located inPort Kennedy specialises in dentistry, surgery, digital radiology, endoscopy, ultrasound, in-house laboratory, acupuncture, exotic pet care and many more.', 271677, '2015-09-18 04:29:24', '2016-04-13 07:11:07', '', 191, 2384, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271677, 0, '', 'reception@larkhillvets.com.au', '0895243838', '', '', '', 'http://www.larkhillvets.com.au/index.html', 'Larkhill Small Animal Hospital is a purpose built Veterinary Hospital, which has been providing the highest standard, compassionate veterinary care to the animals of Port Kennedy, Rockingham, Baldivis,and south to Mandurah since 2005. It is the only large hospital in the region built to ASAVA accreditation standards, and as such, we are always committed to providing your pets with the highest quality veterinary care available.\n\nWe ensure that excellence by utilizing the latest in veterinary technology, including cardiac and abdominal ultrasound, endoscopy, digital radiology, specialized surgical equipment, anaesthetic monitoring, a complete in-house laboratory, dental x-rays and orthopedic surgery. This combined with a team of dedicated, caring vets (all whom have between 10 and 25 years experience), and who regularly pursue post grad veterinary training and education, means we can deliver to our clients the highest standard of care in the region.\n\nLarkhill Small Animal Hospital is a very high standard medical and surgical practice , fully equipped to handle all the problems and emergencies with your pets, be they dogs,cats,rabbits,birds or even the occasional snake, in the most caring, compassionate way possible. We look forward to seeing you and your pets.\n\nLarkhill Small Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Anaesthesia\n• Dentistry\n• Surgery\n• Digital Radiology\n• Endoscopy\n• Ultrasound\n• In-house laboratory\n• Acupuncture\n• Exotic pet care\n• Puppy classes \n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.3333333333,0.5833333333]],"0":[[0.4166666667,0.5833333333]]}', 'https://www.facebook.com/Larkhill-Small-Animal-Hospital-1505215059691052/', '', '', '', '', '', ''),
  (83432, 'sunshine-hinterland-veterinary-clinic-83432', 'Sunshine Hinterland Veterinary Clinic', '', 'Sunshine Hinterland Veterinary Clinic located in Nambour specialises in consultations, vaccinations, surgical procedures, pet products, farm animal care and many more.', 270739, '2015-09-18 04:30:08', '2016-04-12 03:11:15', '', 191, 2702, 'pet care\nveterinary surgeons\nveterinary clinic\npet shops\npets\nvets', 270739, 0, '', '', '0754413022', '', '', '0754413046', 'http://www.nambourvet.com', 'Sunshine Hinterland Veterinary Clinic moved to new premises at 19 Matthew Street Nambour from the former clinic on National Park Road in July 2013. The practice has been owned and operated by Dr Justin Bulling and his wife Maryanne since 2007. They live at Montville where they also operate the Montville Veterinary Clinic as a branch of the main practice with limited consulting hours. At present Dr Bulling is the sole veterinarian in the practice so you assured of continuity of care and personalised service.\n\nSunshine Hinterland Veterinary Clinic is  a small practice but provide a full range of veterinary services and pride ourselves on a high standard of care for your pet while still providing personalised service. Our clinic is well equipped with high quality diagnostic, x-ray and surgical equipment.\n\nSunshine Hinterland Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Desexing\n• General, soft tissue and orthopaedic surgery\n• House visits\n• Farm visits for large animal care\n• Preparation of pets for export\n• A comprehensive range of Hills® pet foods and we are able to order Eukanuba®, Iams® and Royal Canin® foods.\n• A comprehensive range of heartworm and intestinal worming products, flea and tick preventatives with expert advice to help you choose the most effective preventative health strategies.\n• A range of pet products and accessories and we are able to source more specialised items you may require.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.3541666667,0.4791666667]]}', '', '', '', '', '', '', 'https://plus.google.com/109214038854098264357/about'),
  (83433, 'vetwest-animal-hospital-83433', 'Vetwest Animal Hospital', '', 'Vetswest Animal Hospital located in Bibra Lake specialises in hydrobath, puppy preschool, microchipping, lost and found, weight loss program and many more.', 271808, '2015-09-18 04:30:12', '2016-04-14 00:47:12', '', 191, 2321, 'pet wash\npet care\npet grooming\nanimal hospital\npets\nvets', 271808, 0, '', '', '0894041188', '', '', '', 'http://www.petdoc.com.au', 'Vetwest Animal Hospital has been in Perth for over 20 years and is a Western Australian privately owned organisation. We exist today because thousands of WA pet owners have been delighted with the compassion we provide to them and the care we provide to their companions. Our team is made up of people that truly love animals, and have dedicated their working careers to veterinary medicine.\n\nWe have purpose built facilities with an extensive range of diagnostic equipment and are committed to continuous improvement, namely the medical treatment and care of pets, the working conditions of our team, the service we provide to our clients, and promoting responsible pet ownership in the community.\n\nWe do all of this by implementing the "Vetwest standards of care."\n\nVetwest Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Dog and cat adoption\n• Nail clipping\n• Hydrobath\n• Microchipping\n• Puppy preschool\n• Weight loss program\n• Lost and found\n\nand more.', 'A', '{"1":[[0.3125,0.7916666667]],"2":[[0.3125,0.7916666667]],"3":[[0.3125,0.7916666667]],"4":[[0.3125,0.7916666667]],"5":[[0.3125,0.7916666667]],"6":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/vetwest/', '', '', '', '', '', ''),
  (83434, 'sunshine-coast-vets-83434', 'Sunshine Coast Vets', '', 'Sunshine Coast Vets located in Pomona specialises in puppy preschool, surgical procedures, pet spa and grooming, dentistry, desexing, microchip, wildlife animal care and many more.', 270729, '2015-09-18 04:30:16', '2016-04-12 03:01:04', '', 191, 2708, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 270729, 0, '', 'info@sunshinecoastvets.com.au', '0754850088', '', '', '', 'http://www.sunshinecoastvets.com.au', 'Sunshine Coast Vets are well known for our good "old fashioned" friendly & professional service while maintaining a high standard of Veterinary care and advice. We genuinely care about you and your pet and with our "best medicine" policy you can be assured that your pet will receive the best treatment options currently available. We follow up your pet''s treatment with phone calls to check their progress and give reminder calls for ongoing treatment & preventions.\n\nSunshine Coast Vets offers a modern well, equipped practice with quality facilities & equipment and would  love you to take a tour at any time. \n\nSunshine Coast Vets offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Puppy preschool\n• Pet spa and grooming\n• Dentistry\n• Desexing\n• Microchip\n• Surgical procedures\n• X-ray\n• Wildlife care services\n\nand more.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.4583333333]]}', 'https://www.facebook.com/SunshineCoastVets/?ref=ts', 'https://twitter.com/SCoastVets', '', '', '', '', 'https://plus.google.com/+SunshineCoastVetsPomona'),
  (83435, 'gordon-vet-hospital-83435', 'Gordon Vet Hospital', '', 'Gordon Vet Hospital located in Pymble specialises in vaccinations, health checks, dental care, parasite control and prevention, surgical procedure, emergency care services, puppy classes and more.', 219098, '2015-09-18 04:30:20', '2016-04-18 06:15:52', '', 191, 1604, 'veterinary surgeons\npet care\ndog grooming\nanimal hospital\nveterinary hospital\npets\nvets', 219098, 0, '', 'info@gordonvet.com.au', '0294983000', '', '', '0294181320', 'http://www.gordonvet.com.au', 'Gordon Vet Hospital is an independently owned hospital that has been serving the North Shore for more than 40 years. We pride ourselves on  providing professional  pet care as well  as compassion and understanding to all animals and their owners. Our partners are David Loneragan and Scott Lackenby, who are supported by a wonderful team of experienced, caring vets and nurses. Many of our staff have been at Gordon Vet for many years. Therefore, you are guaranteed to be greeted by a familiar face who knows you and your pet well. It is a place where you and your pet are made to feel welcome.\n\nFor your convenience, Gordon Vet Hospital is fully equipped with all the facilities, expertise and equipment for outstanding pet care – all under one roof. This means immediate results for you and better patient pet care. There is less reliance on expensive referral. On the one hospital site we have two operating theatres, radiology, ultrasound, a laboratory, dentistry and endoscopy.\n\nMost of our vets have further qualifications and are able to provide expert, up to date pet care. Our nurses are also well qualified and have been selected for their ability to bond with your animals. They show genuine love and care. Our reception nurses have excellent customer service skills and an amazing ability to remember the names of all the owners and their pets, which makes people feel welcome.\n\nGordon Vet Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccination\n• Health Checks\n• Dental Care\n• Flea & Tick Prevention\n• Nutritional Advice\n• Surgical Procedure\n• Emergency Care Services\n• Diagnostics\n• Puppy Classes\n• Boarding\n• Pet Insurance\n• Exotics and Wildlife Care Services\n\nand more.', 'A', '{"1":[[0.2916666667,0.8333333333]],"2":[[0.2916666667,0.8333333333]],"3":[[0.2916666667,0.8333333333]],"4":[[0.2916666667,0.8333333333]],"5":[[0.2916666667,0.8333333333]],"6":[[0.3125,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/GordonVetHospital', '', '', '', '', '', 'https://plus.google.com/105132290435539970103/about'),
  (83439, 'toowoomba-veterinary-hospital-83439', 'Toowoomba Veterinary Hospital', '', 'Toowoomba Veterinary Hospital located in Toowoomba specialises in 24-hour emergency care, annual vaccinations, check-ups, surgical procedures, house calls, microchipping, puppy preschool and more.', 270891, '2015-09-18 04:30:36', '2016-04-12 05:40:15', '', 191, 2642, 'pet wash\npet care\npet grooming\nveterinary hospital\npets\nvets', 270891, 0, 'Cnr Gore Street', 'mail@toowoombavet.com.au', '0746328333', '', '', '0746391778', 'http://www.toowoombavet.com.au', 'Toowoomba Veterinary Hospital has been providing quality veterinary care for the animals of Toowoomba for over 60 years and from our current site since 1998.\n\nWe believe pets are an important part of your family, and treat each animal we see as part of our own extended family.\n\nToowoomba Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• 24 hour emergency care\n• Annual vaccinations and check-ups\n• Surgery\n• Dentistry\n• House calls\n• Microchipping\n• Pathology\n• Radiology\n• Ultrasound\n• Dermatology\n• Chemotherapy\n• Accupuncture\n• Orthopaedics\n• Physiotherapy\n• Puppy Preschool\n• Hydrobaths\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]],"0":[[0.3958333333,0.4583333333]]}', 'https://www.facebook.com/toowoombavethospital', '', '', '', '', '', ''),
  (83450, 'hills-animal-hospital-83450', 'Hills Animal Hospital', '', 'Hills Animal Hospital located in Castle Hills specialises in cat boarding, cat rescue and adoption, AQIS accreditation, consultations, dentistry, desexing, digital radiography, grooming and many more.', 220903, '2015-09-18 04:31:21', '2016-04-19 01:08:55', '', 191, 1460, 'veterinary surgeons\npet care\ndog grooming\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 220903, 0, 'Unit 1A', 'info@hillsanimalhospital.com.au', '0296591088', '', '', '0296347377', 'http://www.hillsanimalhospital.com.au', 'Hills Animal Hospital is abrand new, purpose designed veterinary hospital located in Castle Hill.\n\nHills Animal Hospital is a family owned business offering high quality, personalised veterinary care for your valuable family pets. Our friendly team pride themselves in creating a comfortable and professional environment for both you and your pets. Our facilities are modern and well equipped with the latest technology to ensure your pet receives the high standard of care they deserve. We focus on putting your pet’s needs first and developing long-term relationships with our clients.\n\nHills Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• AQIS Accreditation\n• Cat Boarding\n• Cat Rescue and Adoption\n• Consultations\n• Dentistry\n• Desexing\n• Digital Radiography\n• Euthanasia\n• Grooming\n• In House Pathology\n• Microchipping\n• Nutrition and Weight Management\n• Specialist Ultrasonography\n• Surgery\n• Vaccinations', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/hillsanimalhospital/?fref=ts', '', '', '', '', '', 'https://plus.google.com/100509017523201639199/about'),
