  (83457, 'gilgandra-veterinary-clinic-83457', 'Gilgandra Veterinary Clinic', '', 'Gilgandra Veterinary Clinic located in Gilgandra specialises in general consultations, emergency services, desexing, surgical procedures, preventative health care, in-house diagnostics and many more.', 274024, '2015-09-18 04:31:49', '2016-04-18 05:22:58', '', 191, 1632, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274024, 0, '', 'gilvets@bigpond.com', '0268471129', '', '', '', 'http://gilgandravets.com.au/', 'Gilgandra Veterinary Clinic is your local country vet offering friendly & professional service. Our fully qualified team value our client & patient relationships and you will always be greeted with a smile. \n\nGilgandra Veterinary Clinic''steam strives to provide a safe nurturing environment for your furry children.\n\nGilgandra Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General consultations\n• Emergency services\n• Desexing\n• Cryosurgery\n• Obstetrical services\n• Ultrasound\n• X-ray\n• Comprehensive in-house pathology\n• Preventative health care and advice\n• Vaccinations\n• Dentistry\n• Eye Exam\n• Boarding\n• Grooming\n• Equine dentistry\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/GilgandraVeterinaryClinic/timeline', '', '', '', '', '', 'https://plus.google.com/110692615068685298890/about'),
  (83459, 'the-gardens-vet-83459', 'The Gardens Vet', '', 'The Gardens Vet located in Parafield Gardens specialises in surgical procedures, x-ray, ultrasound, ECG, full laboratory facilities, puppy preschool and many more.', 273432, '2015-09-18 04:31:57', '2016-04-15 07:06:21', '', 191, 1798, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273432, 0, '', '', '0881825855', '', '', '', 'http://www.thegardensvet.com.au', 'The Gardens Vet experienced Veterinary staff provide a full range of clinical, diagnostic and surgical services in our new purpose built premises. \n\nOur recently completed clinic was purpose built and has all surgical and hospital facilities. Both dog and cat wards are individually temperature controlled.\n\nThe Gardens Vet provide routine consultations, xray/diagnostic imaging, vaccinations, dog and cat de-sexing and dental care/dental therapy.  Our experienced surgeons perform both routine and complex surgeries.\nIn association with Adelaide Mobile Vet we also provide a comprehensive home visit service that services all suburbs of Adelaide. We provide the majority of our own after hours service. \n\nWe also carry an extensive range of pet health care products, including a full range of flea and worming products, Hill’s Prescription Diet food and Rogz collars, leads, and accessories.\n\nThe Gardens Vet offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• X-ray\n• Diagnostic imaging\n• Vaccinations\n• Desexing\n• Dental care\n• Puppy preschool\n\nand more', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.4583333333]]}', 'https://www.facebook.com/GardensVetClinic/', '', '', '', '', '', 'https://plus.google.com/108133034814703088768/about'),
  (83467, 'morley-vetcentre-83467', 'Morley Vetcentre', '', 'Morley Vetcentre located in Morley specialises in boarding, grooming, dog training, puppy classes, desexing, behaviour consultations and more.', 272224, '2015-09-18 04:32:29', '2016-04-14 05:29:46', '', 191, 2236, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\nveterinary clinic\npet shops\npets\nvets', 272224, 0, '', 'info@vetcentre.com.au', '0892753000', '', '', '0892753081', 'http://www.vetcentre.com.au', 'Morley Vetcentre is ne of the only Five veterinary hospitals in Western Australia which have been recognised as an ASAVA Accredited Hospital of Excellence. This accreditation scheme is to help members of the public understand what standards of work and care go on at the Morley Vetcentre.\n\nEach of our 32 dedicated staff, including six veterinary surgeons are committed to the health and wellbeing of your pet. We consult and perform surgery 7 days a week, weekdays 8am - 8pm and weekends 9am - 6pm. Public holidays: 9am - 5pm.\n\nPets, pet requirements, toys, food, nutritional supplements, collars, leads, brushes, grooming, boarding and expert advice - all for your convenience under one roof, 7 days a week and with easy parking\n\nOur separate dog and cat waiting areas proves very popular with our cat owners as it provides a more comfortable environment for cats to visit.\n\nMorley Vetcentre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Boarding\n• Grooming\n• Dog training\n• Pet adoption\n• Pet shop\n• Puppy classes\n• Desexing\n• Behaviour consultations\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/VetcentreMorley/', '', '', '', '', '', ''),
  (83470, 'lismore-veterinary-clinic-83470', 'Lismore Veterinary Clinic', '', 'Lismore Veterinary Clinic located in Lismore specialises in general medicine, extensive surgery, radiology, dermatology, dentistry, reproduction services, microchipping, euthanasia and many more.', 275060, '2015-09-18 04:32:41', '2016-04-21 06:23:30', '', 191, 1226, 'pet wash\npet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 275060, 0, '', 'customerservice@lismorevet.com.au', '0266220033', '', '', '0266222550', 'http://www.lismorevet.com.au', 'Lismore Veterinary Clinic was established in 1955 by Dr David Jones following in the footsteps of his father who was a veterinarian for the Pastures Protection Board. David wanted to provide the Northern Rivers with high quality professional veterinary care for both large and small animals. The practice had its humble beginnings in rooms under his first home at 79 Uralba street. As the practice grew a purpose built veterinary hospital was established a short distance away at the current address of 20-22 Uralba Street. Large animal facilities were added in 1985 and a major refurbishment in 1998 reinforced David’s commitment to provide Lismore and the surrounding districts with a professional and caring veterinary practice for many years to come.\n\nDavid retired at the end of 2000 and Richard Creed who has been in partnership with David for the past ten years and David’s son, Nick Jones, entered into partnership at the beginning of this year. Together they will continue servicing the Far North Coast’s veterinary requirements and will always strive to maintain the high standard of veterinary practice set by David over the years. They are also committed to reinvesting in the hospital in order to expand the already extensive range of diagnostic and treatment facilities available.\n\nLismore Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General medincine\n• Extensive Surgery\n• Radiology\n• Dermatology\n• Dentistry\n• Reproduction services\n• Microchipping\n• House calls and farm visits\n• Washing and Grooming\n• Farm animals and equine services\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.5208333333]]}', 'https://www.facebook.com/LismoreVet', '', '', '', '', '', ''),
  (83471, 'veterinary-ophthalmic-referrals-83471', 'Veterinary Ophthalmic Referrals', '', 'Veterinary Ophthalmic Referrals located in Plympton specialises in eye examinations, slit-lamp biomicroscopy, indirect and direct fundoscopy, streak retinoscopy, tonometry, gonioscopy and many more.', 273667, '2015-09-18 04:32:45', '2016-04-17 23:30:17', '', 191, 1745, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 273667, 0, '', 'reception@voreyevet.com.au', '0873242810', '', '', '0872256207', 'http://www.voreyevet.com.au', 'Veterinary Ophthalmic Referrals is a dedicated animal eye clinic, seeing animals with eye problems referred from general veterinary practice\n\nReferral cases are seen in Adelaide from throughout South Australia, Northern Territory, Western Victoria and Western New South Wales. There is also a visiting service to North Queensland.\n\nAt Veterinary Ophthalmic Referrals we aim to ensure clients return to their referring or usual veterinarian happy that everything within reason has been done to rectify their pet’s eye problem.\n\nVeterinary Ophthalmic Referrals offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations and eye examinations for problem eye cases in all animal species including dogs, cats, horses, production animal, exotic pets and zoo animals\n• Hereditary eye disease screening including `ACES’ screening for pure breed dogs\n• Slit-lamp biomicroscopy\n• Indirect and direct fundoscopy\n• Streak retinoscopy\n• Tonometry\n• Gonioscopy\n• Electroretinography\n• Ocular ultrasonography\n• Oscillometric blood pressure measurement\n• Eyelid surgery, including entropion and distichiasis correction\n• Corneal surgery, including non-healing ulcer treatments and corneal grafts\n• Cataract surgery, including artificial lens implantation\n• Luxated lens surgery\n• Glaucoma surgery, including laser and drainage implant surgery\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]]}', '', '', '', '', '', '', 'https://plus.google.com/108171287913574439977/about'),
  (83474, 'dr-paws-83474', 'Dr Paws', '', 'Dr Paws located in Port Macquarie specialises in vaccinations, heatworm treatment, fleas and intestinal worm control, dental care, surgical procedure, ultrasound, x-rays, puppy preschool and more.', 273849, '2015-09-18 04:32:57', '2016-04-18 02:50:16', '', 191, 1688, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 273849, 0, '', 'oxleyhwy@drpaws.com.au', '0265835366', '', '', '', 'http://www.drpaws.com.au', 'Dr Paws is a modern  vet clinic in Port Macquarie, with a focus on providing the best veterinary care. We are your partner in petcare! The practice has always be known for excellence in knowledge and care and today we are still at the forefront.\n\nWe work collaboratively with you to provide best outcome we can for your pet.  We want you to feel empowered to make the best decisions for your beloved animal.\n\nAs well as the knowledgable care we provide within the clinic, we are working hard to create a really informative petcare website for the local community. \n\nDr Paws strive to be a centre of information all things pet related and are always happy giving recommendations for local petcare providers or products.\n\nDr Paws offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Parasite control and prevention\n• Dental care\n• Blood tests\n• Health care program\n• Surgical procedures\n• Ultrasound\n• X-ray\n• Puppy preschool\n• Obedience class\n\nand more.', 'A', '{"1":[[0.3333333333,0.8125]],"2":[[0.3333333333,0.8125]],"3":[[0.3333333333,0.8125]],"4":[[0.3333333333,0.8125]],"5":[[0.3333333333,0.8125]],"6":[[0.375,0.5833333333]],"0":[[0.4166666667,0.5416666667]]}', 'https://www.facebook.com/drpawsoxleyhwy/?ref=hl', '', '', '', '', '', 'https://plus.google.com/113697333997694994804/posts'),
  (83479, 'walker-street-veterinary-surgery-83479', 'Walker Street Veterinary Surgery', '', 'Walker Street Veterinary Surgery located in Maryborough specialises in consultations, vaccinations, desexing, advanced surgical procedures, reproduction services, diagnostics and many more.', 271263, '2015-09-18 04:33:13', '2016-04-13 00:20:29', '', 191, 2536, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271263, 0, '', 'walkerstvet@bigpond.com', '0400796075', '', '', '', 'http://www.walkerstvet.com.au', 'Walker Street Veterinary Surgery, as pet owners ourselves, we know what an important part of the family pets are.\n \nWe want only the best for our own pets and believe that you, our clients and your pets deserve nothing less. \n\nWalker Street Veterinary Surgery offers a comprehensive range of services for all companion animals, including dogs, cats, birds, reptiles and rodents. In addition we cater for large animals, including horses, cattle, sheep, goats and alpacas.\n\nOur goal is to provide all our patients with the highest quality healthcare. \nQuality care requires good communication between the veterinary surgery and you. \n\nWalker Street Veterinary Surgery promise to provide you with the information necessary to make well informed decisions regarding the health care of your pet and encourage you to ask us questions about the treatment we recommend. \nYour peace of mind at having made the correct decision is very important to us. \n\nAs our clients we believe that your satisfaction with the services we provide is paramount and is the key to our continuous improvement. \nWe welcome feedback that you may have because keeping in touch with clients means we understand what they really need and want in a veterinary surgery.\n\nWalker Street Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations for small and large animals\n• Vaccinations – annual vaccination and heartworm injections \n• Desexing for all our canine, feline, equine, cavies and rodent friends\n• Fully equipped medical and surgical facilities\n• Canine Reproduction Services\n• Cattle Reproduction Services\n• Radiography\n• Ultrasonography\n• Endoscopy\n• Orthopaedic surgery including cruciate repair procedures and fracture repairs\n• Soft tissue surgery\n• Dentistry for our canine, feline or equine friends\n• Modern Intravenous fluid delivery pumps\n• Laboratory facilities including biochemistry, haematology and urinalysis.\n• Puppy Preschool\n• Up market cat boarding facilities\n• Home visits and Home euthanasia\n• 24/7 access to a veterinarian for emergencies\n\nand more', 'A', '{"1":[[0.3125,0.75]],"2":[[0.3125,0.75]],"3":[[0.3125,0.75]],"4":[[0.3125,0.75]],"5":[[0.3125,0.75]],"6":[[0.3541666667,0.5]]}', 'https://www.facebook.com/walkerstvet', '', '', '', '', '', ''),
  (83492, 'salisbury-vet-surgery-83492', 'Salisbury Vet Surgery', '', 'Salisbury Vet Surgery located in Salibury specialises in vaccinations, parasite check, health check, dental health, blood testing, osteoarthritis check, x-rays, and many more.', 270451, '2015-09-18 04:34:06', '2016-04-11 23:39:42', '', 191, 2791, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 270451, 0, '', 'salvet@ecn.net.au', '0732778620', '', '', '', 'http://www.salisburyvets.com.au', 'Salisbury Veterinary Surgery was opened in 1983. As the reputation spread about it’s good service and fair pricing, it has evolved into a strong general practice, seeing mainly cats and dogs, with the occasional rat, mouse and guinea pig.\n\nAfter working for 3 years in the practice, Dr John purchased the Surgery in 1999. In 2005, the Surgery was relocated to 220 Lillian Ave, to provide double the area. These bigger premises enabled separate Dog and Cat hospital wards, a second consult / grooming room, a separate surgical theatre and larger retail floor space.\n\nSalisbury Veterinary Surgery was again relocated in March 2016 to 1/668 Toohey Road, Salisbury, due to its continued strong growth. The new premises are double the size of the previous place. We now have 2 consult rooms, a Nurses room, a Grooming room, 2 surgical theatres, separate waiting areas for Cats and Dogs, a Treatment room, and separate Dog and Cat hospital wards. Most importantly – we have a Staff Room, and a private office (so the Boss can hide).\n\nOur dedicated Nurses and Veterinarians are passionate about all pets and avid animal lovers. At our Veterinary Surgery, you will be fully supported with sound advice first and foremost. We know that helping our clients, starts with providing a good understanding of health care issues, and treatment choices. With good advice and professional recommendations, you will be well equipped to make the best ongoing health care decisions for your pet. With fully equipped examination rooms, diagnostic equipment, in-house blood analysis, digital radiology, blood pressure monitoring, prescription nutrition and pharmacy stores, we provide an on-the-spot assistance for nearly all pet health and medical needs. The current philosophy of the practice is to offer, and provide the best service to our clients and their extended family.\n\nSalisbury Veterinary Surgery''s efficient nurses are continually informed of the latest treatments and medications available. They are competent groomers, surgical assistants, hospital attendants, as well as receptionists. They always greet our clients in a warm friendly manner.\n\nSalisbury Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations \n• Parasite check \n• Heart check \n• Dental health \n• Blood testing \n• Blood Pressure Monitoring \n• Chemistry panel \n• Urinalysis \n• Geriatric care \n• X-rays\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.5208333333]]}', 'https://www.facebook.com/Salisbury-Vet-208585335851582/', '', '', '', '', '', 'https://plus.google.com/u/0/106995471417827727876/about'),
  (83493, 'findon-veterinary-surgery-83493', 'Findon Veterinary Surgery', '', 'Findon Veterinary Surgery located in Findon specialises in day to day pet care advice, puppy preschool, behaviour advice, surgical procedure, diagnostics, dentistry, exotic pet care and many more.', 272738, '2015-09-18 04:34:10', '2016-04-14 23:00:48', '', 191, 2099, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 272738, 0, '', 'office@findonvet.com.au', '0883473444', '', '', '', 'http://www.findonvet.com.au', 'Findon Veterinary Surgery opened in May 1991, with myself (Ian) my wife Ali (as vet nurse and receptionist) AND our 3 month old daughter, Ella, in a bassinet behind the reception desk! It was certainly a family atmosphere as we also LIVED in the surgery, with our bedroom coming off of the consult room, and no kitchen to speak of (just a microwave on top of the dog cages…oh, and a kettle!!!). A year later our son, Angus, joined the team.\n\nTen years later we moved to our current purpose-renovated building, previously a medical clinic. Being designed as a vet surgery has meant that it is highly functional and very pleasing and efficient to work in.\n\nWe rapidly grew and now have three full-time veterinarians and 4 to 5 veterinary nurses to provide a vet service I am very proud of.\n\nWe strive to complement our vet services with cost saving rewards for certain routine procedures – see below about our CitiPaws Club and our No Consult Fee unless service or treatment provided.\n\nFindon Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Pet care advice\n• Puppy preschol\n• Behaviour advice\n• Surgical procedures\n• Diagnostic procedures\n• Radiography\n• Anaesthesia management\n• Dentistry\n• Exotic pet care\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/findon.vet.surgery', '', '', '', '', '', ''),
  (83498, 'hawkesbury-equine-veterinary-centre-83498', 'Hawkesbury Equine Veterinary Centre', '', 'Hawkesbury Equine Veterinary Centre located in Clarendon specialises in 24 hour emergency services, ambulatory service, lameness examinations, imaging, pre-purchase examination, surgery and more.', 222252, '2015-09-18 04:34:30', '2016-04-19 01:01:39', '', 191, 1464, 'veterinary surgeons\ndog grooming\nanimal hospital\nveterinary hospital\nveterinary clinic\nvets', 222252, 0, '', 'hevc@bigpond.com', '0245774611', '', '', '0245877279', 'http://www.hevc.com.au', 'Hawkesbury Equine Veterinary Centre, where we provide full surgical and medical facilities onsite, as well as a convenient pathology service. The practice prides itself on having one of the most modern surgical units in NSW and our medical facilities include 2 intensive care fully airconditioned stables. Several well grassed day yards provide the best conditions for the recovery of sick and debilitated horses.\n\nThe practice prides itself on having one of the most modern surgical units in NSW and our medical facilities include 2 intensive care fully airconditioned stables. Several well grassed day yards provide the best conditions for the recovery of sick and debilitated horses.\n\nHawkesbury Equine Veterinary Centre have an extensive reproductive unit offering a broad range of reproductive work with facilities for chilled and frozen semen, and even embyro transfer. Our modern reproductive laboratory caters for all aspects of artificial breeding including the freezing and storage of stallion semen.\n\nThe practice is a referral centre for many other practices around the state and regularly performs surgery, medical support and reproductive services on behalf of these practices.\n\nHawkesbury Equine Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Full surgical facilities.\n• In house Laboratory.\n• AQIS approved semen collection and Quarantine Centre.\n• Digital Radiography & Ultrasonography.\n• Video Endoscope.\n• Exercise Endoscope.\n• ECG Machine.\n• Experienced Equine Veterinary Dentist.\n• Chilled & Frozen semen Artificial Insemination.\n• Semen Collection & Freezing.\n• Embryo Transfer & Freezing.\n• Referral centre.\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Hawkesbury-Equine-Veterinary-Centre-465875616800975/?fref=ts', '', '', '', '', '', 'https://plus.google.com/109872215549995101332/about');
