  (83501, 'old-reynella-veterinary-clinic-83501', 'Old Reynella Veterinary Clinic', '', 'Old Reynella Veterinary Clinic located in Old Reynella specialises in consultation, surgical procedure, hospitalisation, dentistry, radiology, ultrasound, puppy playschool and more.', 272920, '2015-09-18 04:34:42', '2016-04-15 01:32:35', '', 191, 1982, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 272920, 0, '', 'enquiries@oldreynellavet.com.au', '0883224355', '', '', '', 'http://www.oldreynellavet.com.au', 'Old Reynella Veterinary Clinic offer friendly and personalised service from a team of professional and experienced Veterinarians and Veterinary Nurses.  Specialising in preventative care for your four-legged friend, we offer a variety of services including consultation; emergency and critical care; routine desexing for dogs, cats and pocket pets; orthopaedic surgery; ultrasound; radiology; dentistry; microchipping; and in-house laboratory.\n\nWe stock an extensive range of super premium dog foods, and prescription diets; have an in depth knowledge on the safest and most effective flea and worming control, including heartworm prevention. We also stock a large range of soap-free shampoos and conditioners, including South Australia’s own Champion Tails; dental health support and specialised companion care products and toys.\n\nAt Old Reynella Veterinary Clinic the importance of continuity of care is paramount. By having a smaller staff base, we strive to build and maintain personal relationships with all of our clients, while maintaining the highest level of care for your companions.\n\nOld Reynella Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultation\n• Surgery\n• Hospitalisation\n• Dentistry\n• Radiology\n• Ultrasound\n• Laboratory tests\n• Puppy Playschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.6666666667]]}', 'https://www.facebook.com/oldreynellaveterinaryclinic/', '', '', '', '', '', ''),
  (83507, 'wynnum-manly-vet-hospital-83507', 'Wynnum Manly Vet Hospital', '', 'Wynnum Manly Vet Hospital located in Wynnum specialises in emergency care procedures, surgical procedures, dentistry, digitial radiography, puppy preschool and many more.', 271467, '2015-09-18 04:35:07', '2016-04-13 02:45:37', '', 191, 2478, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271467, 0, '', 'vets@wmvh.com.au', '0733966488', '', '', '', 'http://www.wmvh.com.au', 'Wynnum Manly Veterinary Hospital pride ourselves on our caring and professional veterinary services. Approved as a veterinary hospital and built in 1980, our practice specialises in the treatment and care of companion animals such as dogs, cats, birds and wildlife. Medical and surgical care are our main areas of expertise, and between the five doctors on staff, our vets hold an amazing 90 years of clinical experience.\n\nAt Wynnum Manly Veterinary Hospital, care is our top priority, and we see to it that your pet receives the very best treatment possible. Whether it is an emergency procedure, or a simple check up, we put your pets'' health first.\n\nOur aim is to provide the best possible care to ensure your pet is in the best hands. Through problem-solving, knowledge and experience, we will take care of all your pets’ veterinary needs and provide a safe, friendly environment in which you both can feel at ease.\n\nOur experienced team of veterinarians are on-hand to provide professional and caring veterinary services in a warm and welcoming environment. We want to make the trip to the vet as friendly and stress-free as possible for both you and your pet. It is our goal here at Wynnum Manly Veterinary Hospital to solve your pet''s health issues in a timely and cost-effective manner, helping your pet maintain the best possible health.\n\nWynnum Manly Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgeries\n• Dental care\n• Radiology\n• Ultrasound\n• ECG\n• Pathology tests\n• Vaccinations\n• Intensive care\n• Hospitalisation\n• Grooming\n• Microchipping\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.5]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/Wynnum-Manly-Veterinary-Hospital-643264585730269/?fref=ts', '', '', '', '', '', ''),
  (83508, 'torrens-road-veterinary-clinic-83508', 'Torrens Road Veterinary Clinic', '', 'Torrens Road Veterinary Clinic located in Croydon Park specialises in after hours services, consultations, vaccinations, surgical procedures, microchipping, dentistry, dermatology and many more.', 273460, '2015-09-18 04:35:11', '2016-04-15 06:56:06', '', 191, 1808, 'pet wash\npet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273460, 0, '', 'torrensvet@internode.on.net', '0883469666', '', '', '0883408611', 'http://www.torrensroadvet.com.au', 'Torrens Road Veterinary Clinic''s staff  are all here because we enjoy the work we do, we like the team we work with and are proud of the equipment, facilities and services we provide for you and your pet.\n\nWe enjoy seeing our clients, and especially enjoy seeing your pets happy and healthy. When you choose us for your pet''s needs, you will be guaranteed the highest quality treatment, service and advice from our friendly team.\n\nWe put a lot of importance on continuing education for our vets and nurses alike. This ensures we always have the best knowledge to provide our patients with the highest standard of care.\n\nTorrens Road Veterinary Clinic was purpose built and completed in December 1998. Our aim was to build a vet clinic that addressed the needs of both our patients and our clients. For this reason our waiting area is quite spacious, is well lit and has a lot of glass - dogs love coming in and don''t feel at all trapped.\n\nDogs also love our special non slip "Tarquet" floor, not the usual polished slippery surface that sends their legs going in all directions. To avoid slipping on the consult tables we have used a textured laminate and have found it much more feet friendly than the usual stainless steel surface.\n\nThe entire clinic has reverse cycle air conditioning so even the kennel area has year round comfort. Our cages are stainless steel for hygiene reasons but are individually heated and well padded.\n\nProof of their comfort and happiness during a stay with us is often seen when animals return for a recheck or stitch removal. They will usually dive in the front door, greet the staff for a quick pat and a liver treat and then try to make a bee line for the kennels.\n\nWe have a grassy enclosure that we call the ''puppy run'', as it is most often used for Puppy Preschool sessions. It is also useful for you to let your dog have a bit of a frolic and sniff in, to guarantee vet visits are even more fun!\n\nTorrens Road Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations and health checks\n• Vaccinations\n• Anaesthesia and surgery\n• Orthopaedic surgery\n• Soft tissue surgery\n• Desexing\n• Microchipping\n• Dermatology\n• Dentistry\n• Intensive care\n• Geriatric care\n• Digital x-rays\n• Preventative medicine\n• Behaviour consultations\n• Weight control programs\n• Puppy preschools\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.5416666667]]}', 'https://www.facebook.com/Torrens-Road-Vet-Clinic-140737999325657/timeline', '', '', '', '', '', ''),
  (83516, 'redgum-vet-pet-boarding-83516', 'Redgum Vet & Pet Boarding', '', 'Redgum Vet & Pet Boarding located in Port Augusta specialises in boarding kennels and cattery, grooming services, happy hounds behavioural services, puppy school and many more.', 273176, '2015-09-18 04:35:43', '2016-04-15 07:14:24', '', 191, 1786, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 273176, 0, '', 'redgumboarding@bigpond.com', '0886423308', '', '', '0886426716', 'http://redgumvetandpetboarding.com.au/', 'Redgum Vet & Pet Boarding is a unique and total approach to pet care, including Vet Clinic, Boarding Kennels and Grooming.\n\nRedgum Vet & Pet Boarding offers an extensive range of veterinary services and medical care for all animals, no matter what stage of life. Dr. Roger Absalom and his well trained staff will always put the needs of your pet first.\n\nPeople come to see Dr. Absalom as he is a passionate, caring vet and is well known throughout Port Augusta and surrounding areas. Specialising in a range of services, the Redgum vet team pride themselves on reliable, professional, friendly and welcoming service.\n\nAdditionally Dr. Roger Absalom lives on-site, extending the care while your pets are boarding at Redgum Vet & Pet Boarding. The Boarding facilities are spacious and airconditioned. With generous exercise areas, your pets will be able to run and play and even make new friends during their visit.\n\nRedgum Vet & Pet Boarding offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Boarding kennel and cattery\n• Grooming services\n• Behavioural services\n• Puppy school\n\nand more.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333],[0.75,0.8333333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.4583333333]]}', 'https://www.facebook.com/RedgumVetandPetBoarding/?ref=ts', '', '', '', '', '', 'https://plus.google.com/103912446861339500019/about'),
  (83517, 'family-vet-centre-83517', 'Family Vet Centre', '', 'Family Vet Centre located in Albury specialises in surgery and medicine, radiography, ultrasound, acupuncture, laboratory faciilities, dentistry, behaviour medicine, puppy preschool and many more.', 273835, '2015-09-18 04:35:47', '2016-04-18 02:35:32', '', 191, 1692, 'pet care\nveterinary surgeons\nveterinary clinic', 273835, 0, '', '', '0260412522', '', '', '', 'http://www.familyvet.com.au', 'Family Vet Centre  seek to provide the best and highest quality veterinary care possible. We aim to treat all pets as our own and treat out clients the way we would want to be treated. We understand the important role your pet plays in your family – your pets’ good health and comfort are of the utmost importance to us.\n\nWe have two convenient locations in Albury and Wodonga. Our centres are modern, purpose-built facilities with state-of-the art diagnostics including radiography, ultrasound and endoscopy, and dedicated facilities for isolation and intensive care.\n\nFamily Vet Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgery and medicine\n• Radiography\n• Ultrasound\n• Acupuncture\n• Muscle release therapy\n• Laboratory facilities\n• Dentistry\n• Behaviour medicine\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.6666666667]],"0":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/Family-Vet-Centre-338338602425/', '', '', '', '', '', 'https://plus.google.com/103426865235629848227/about'),
  (83518, 'vetcall-veterinary-practices-83518', 'Vetcall Veterinary Practices', '', 'Vetcall Veterinary Practices located in Ashmore specialises in advanced surgical procedure, allergy and skin problems treatment, cancer care, dentistry, puppy preschool, diagnostic and many more.', 271173, '2015-09-18 04:35:51', '2016-04-12 23:26:58', '', 191, 2563, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271173, 0, '', 'ashmore@vetcall.com.au', '0755394133', '', '', '0755972816', 'http://www.vetcall.com.au', 'Vetcall Veterinary Practices was established by Dr Robert Thomasson at Burleigh Heads in1976 in a small surgery situated in a shopping centre and after a short period it was decided that larger facilities were required to provide extra care for small animals. Veterinary Hospitals were established at Ashmore and Burleigh. This allowed our Veterinarians to utilize their excellent diagnostics and surgical skills. Surgeries were later established at Mudgeeraba and Robina\n\nWe have grown today to a team of 11 Veterinarians and 25 Support staff including Nurses, Receptionists, Nurse Assistants, Groomers and Administration staff. Our staff regularly attend industry professional development courses and keep themselves up to date with the latest veterinary developments, so we can offer the latest and best care available for your pets. At Vetcall Veterinary Practices we strive to provide Excellent Pet Care and Exceptional Client Service. This has always been our goal.\n\nWith four separate practice locations, conveniently placed around the Gold Coast, our Vetcall staff strive to offer the best possible all-round services for your beloved animal(s).\n\nVetcall Veterinary Practices  offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Advanced surgical procedure\n• Allergy and skin problem treatments\n• Behaviour consultation\n• Cancer care\n• Boarding\n• Dentistry\n• Puppy and kitten health checks\n• House calls\n• Diagnostics\n• Grooming\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.2916666667,0.7708333333]],"2":[[0.2916666667,0.7708333333]],"3":[[0.2916666667,0.7708333333]],"4":[[0.2916666667,0.7708333333]],"5":[[0.2916666667,0.7708333333]],"6":[[0.3333333333,0.6666666667]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/vetcallashmore?fref=ts', '', '', '', '', '', ''),
  (83519, 'wynnum-bayside-veterinary-surgery-83519', 'Wynnum Bayside Veterinary Surgery', '', 'Wynnum Bayside Veterinary Surgery located Wynnum West specialises in small animal consultations, house calls, health checks, vaccinations, desexing, surgical procedures, microchipping and many more.', 271431, '2015-09-18 04:35:55', '2016-04-13 02:18:25', '', 191, 2484, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 271431, 0, '', 'team_wbvs@hotmail.com', '0738930858', '', '', '', 'http://www.wynnumbaysidevet.com.au', 'Wynnum Bayside Veterinary Surgery is an independent small animal practice located on the Preston Road in Wynnum West. Being independent, we are able to provide a more individual service, tailored to the needs of our clients and their pets. We have served the local area for nearly twenty years and take pride in our relationship with the Bayside community.\n\nBayside Veterinary Surgery is solely owned and run by Dr Jenny Hall and she is supported by Dr Cindy Sutherland. Both of our vets have over twenty years experience in small animal practice and their priority is to ensure that all your pets health needs are met.\n\nThere is nothing that we are more passionate about than providing tenderness, love and the highest standards of medical and surgical care to your beautiful pet at an affordable price.\n\nBayside Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Small animal consultations\n• House Calls by arrangement\n• Health checks and vaccinations\n• De-sexing\n• General & Specialist Surgery\n• Dental Surgery & Care\n• X-ray & Ultrasound\n• Puppy Pre-school\n• Microchipping\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Wynnum-Bayside-Veterinary-Surgery-601348169947569/', '', '', '', '', '', ''),
  (83545, 'wembley-veterinary-hospital-83545', 'Wembley Veterinary Hospital', '', 'Wembley Veterinary Hospital located in Jolimont specialises in dog and cat boarding, surgical procedures, laboratory tests, dentistry, oto-endoscopy, x-ray, puppy training classes and more.', 272414, '2015-09-18 04:37:41', '2016-04-14 06:51:08', '', 191, 2189, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 272414, 0, '', 'info@wembleyvet.com.au', '0893871555', '', '', '', 'http://www.wembleyvet.com.au', 'Wembley Veterinary Hospital was established in 1939. Since then, we have grown to become a well-respected practice, servicing the hospital, grooming and boarding needs of pets throughout the western suburbs of Perth.\n\nThe Wembley Veterinary Hospital practices a high standard of care and is focused on maintaining the health, welfare and comfort of its patients.  It believes in preventing disease wherever possible, but also is able to put the pieces back together when things sometimes go wrong.  Their outstanding care was recently recognised by being awarded a "Hospital of Excellence" award by the Australian Small Animal Veterinary Association.  They are one of only 4 Hospitals in Perth to have received this distinguished award. \n\nDr Garry Edgar is the owner and manager of the Hospital. He is originally from Perth and was trained at the Murdoch University Campus. He graduated in 1990. Garry commenced with the Wembley Veterinary Hospital in 1995, working briefly with the previous owner, Dr George Endacott. At the end of 1995 George retired after 23 years working at the Hospital, and Dr Edgar took over from him.\n\nDr Edgar became only the third veterinarian to have managed the Wembley Veterinary Hospital since 1940. Dr Edgar has many special interests, including Feline Medicine, Reconstructive (plastic) and Orthopaedic Surgery, Dermatology and Endocrinology (hormones). As well as his Veterinary work, Dr Edgar has served on various professional bodies and committees within the Veterinary Profession.  Like many Veterinarians, he is committed to Animal Welfare and has served on the Western Australian Emergency Welfare Advisory Committee and his interests in Cats resulted in him becoming a member of the Advisory Committee implementing the new Cat Act.\n\nDr Edgar is supported by Drs Kristen Holloway, Fiona Biemel and Kate Webber, as well as 5 Registered Veterinary Nurses, 2 trainee Veterinary Nurses and 3 Groomers.\n\nAll of the Veterinarians of the Wembley Veterinary Hospital are members of the Australian Veterinary Association and the Australian Small Animal Veterinary Association, and uphold their codes of practice. Dr Edgar is also a member of the Australian Veterinary Practice Management Association. All the Veterinarians at the Wembley Vet Hospital are also members of the Australasian Society of Feline Medicine.\n', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.7083333333]],"0":[[0.4166666667,0.5]]}', 'https://www.facebook.com/Wembley-Veterinary-Hospital-334014229996919/?ref=ts', '', '', '', '', '', ''),
  (83549, 'the-parade-norwood-veterinary-clinic-83549', 'The Parade Norwood Veterinary Clinic', '', 'The Parade Norwood Veterinary Clinic located in Norwood specialises in health checks, vaccinations, parasite control and prevention, dentistry, radiography, ultrasonography, surgery and more.', 272996, '2015-09-18 04:37:58', '2016-04-15 02:03:36', '', 191, 1958, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 272996, 0, '', 'radiovet@bigpond.net.au', '0883635323', '', '', '0883635424', 'http://www.paradevet.com', 'The Parade Norwood Veterinary Clinic in Norwood provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt The Parade Norwood Veterinary Clinic, you’ll be fully supported with sound advice first and foremost. We know that helping our client’s starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nThe Parade Norwood Veterinary Clinic has been an integral part of the Norwood community and The Parade Precinct for thirteen years. In that time, we’ve helped thousands of our client’s cats & dogs, rabbits & guinea pigs, birds, and even a few snakes. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands at The Parade Norwood Veterinary Clinic.\n\nThe Parade Norwood Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Dentistry\n• Radiography\n• Ultrasonography\n• Clinical Pathology\n• Desexing\n• Orthopaedic\n• Ophthalmic\n• Emergency procedures\n• Microchipping\n• Washing and grooming\n• Boarding advice\n• Behavioural advice\n• Nutritional advice\n• Puppy preschool \n• Exotic pet care\n\nand more.', 'A', '{"1":[[0.3125,0.8333333333]],"2":[[0.3125,0.8333333333]],"3":[[0.3125,0.8333333333]],"4":[[0.3125,0.8333333333]],"5":[[0.3125,0.8333333333]],"6":[[0.3125,0.75]],"0":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (83568, 'total-vet-care-83568', 'Total Vet Care', '', 'Total Vet Care located in Bentley specialises in consultations, general surgery, orthopaedic surgery, diagnostics, acupuncture, pet insurance, puppy schools and many more.', 272214, '2015-09-18 04:39:16', '2016-04-14 05:15:01', '', 191, 2240, 'pet wash\npet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 272214, 0, '', 'mail@totalvetcare.com.au', '0894588786', '', '', '0893568660', 'http://www.totalvetcare.com.au', 'Total Vet Care led by Paul Kluck aims to provide a high quality and value veterinary service for Perth’s small animal pet owners. We aim to treat your pets with the same care and dedication we would use to treat our own pets.\n\nPaul Kluck BVMS was born in Perth and graduated from Murdoch University in 1983. After working in mixed practice for 4 years in Northam and conducting locum work in WA Paul moved to the UK1n 1990, working in England and Ireland in both small animal and Dairy practice and managed a small animal pracice for 18 months in Elm Park in Essex. Despite loving the work and the opportunity to travel while there, home beckoned, so Paul came back to Perth in late 1993 with a view to starting a small animal practice in Perth.\n\nThis became a reality with the opening of the Innaloo Veterinary Hospital on the 18 March, 1996. The Bentley Veterinary Hospital was acquired in November 2009.\n\nTotal Vet Care''s slogan/mission statement is that “Your pets are special to us” signifying our aim to provide care for your pets as if they were our own.\n\nWe hope to offer an ever improving service to our clients. If at any time you feel we can improve our service in some way, please email us with your suggestion.\n\nTotal Vet Care offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• General surgery\n• Orthopaedic surgery\n• Diagnostics\n• Acupuncture\n• Hydrobathing\n• Pet Insurance\n• Cremation and burial services\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7708333333]],"2":[[0.3333333333,0.7708333333]],"3":[[0.3333333333,0.7708333333]],"4":[[0.3333333333,0.7708333333]],"5":[[0.3333333333,0.7708333333]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/totalvetcare.bentley/', '', '', '', '', '', ''),
  (83584, 'forrestfield-vet-hospital-83584', 'Forrestfield Vet Hospital', '', 'Forrestfield Vet Hospital located in Wattle Grove specialises in vaccinations, consultations, microchipping, sterilisations, fracture repairs, dental treatment, heartworm prevention and more.', 271603, '2015-09-18 04:40:21', '2016-04-13 05:49:49', '', 191, 2416, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npet shops\npets\nvets', 271603, 0, 'Cnr Arthur Road', 'reception@forrestfieldvet.com.au', '0894531290', '', '', '', 'http://www.forrestfieldvet.com.au', 'Forrestfield Vet Hospital think of your pet as part of your family, and we know how important that family member is to you. Our focus lies in being a Family Pet Practice that acknowledges the value of your pet as a much loved part of your family, so that when you need veterinary care for that special family member, we’re here to help. That’s what we do, that’s what we care about, and that’s what we’re good at. So when you come to our hospitals you can be assured of the best possible service and care every time. \n\nThe practice was initially established in 1981 at our Forrestfield location and we opened the High Wycombe premises in 1983, so we’ve been serving the vet needs of the local community for over 30 years and have a huge wealth of combined experience from our long term veterinary staff . Our team of dedicated vets and nurses led by Dr Neville Hoes and Dr Gavin Davison, pride ourselves on our high standard of veterinary medicine and surgery, but also on our high level of communication with you, so that not only do we do the best thing for your pet, but that you know what we are doing and why we are doing it. From the initial consultation, to explaining laboratory or Xray results, and at every step along the way, we take the time to explain your pets issues to you so that together, both of us can make the best possible decisions for your pets health.\n\nForrestfield Vet Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Veterinary consultations\n• Vaccinations\n• Sterilisations\n• Microchipping\n• Heartworm testing and prevention\n• General surgery\n• Cruciate ligament repairs\n• Fracture repairs\n• Dental treatment\n• Nail Clipping\n• Flea control and worming products and advice\n• Puppy  Preschool Classes\n• Shampoos, conditioners and coat care products\n• Weight loss advice, programs  and weigh ins\n• Grooming of matted cats\n• Premium Pet foods\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.5],[0.7083333333,0.75]],"0":[[0.375,0.4166666667],[0.7083333333,0.75]]}', '', '', '', '', '', '', 'https://plus.google.com/117356605024452430399/about'),
  (83586, 'adelaide-animal-hospital-83586', 'Adelaide Animal Hospital', '', 'Adelaide Animal Hospital located in Trinity Gardens specialises in after hours services, dental check, puppy preschool, microchipping, weight loss program, behavioural training and more.', 273134, '2015-09-18 04:40:29', '2016-04-15 07:15:20', '', 191, 1784, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 273134, 0, '', 'info@adelaidevet.com.au', '0883641577', '', '', '0883641419', 'http://www.adelaidevet.com.au', 'Adelaide Animal Hospital, Prospect Road Veterinary Clinic, Goodwood Road Veterinary Clinic and Adelaide Hills Animal Hospital are privately owned veterinary practices located in South Australia.\n\nOur hospital facilities are on a par with modern human hospitals, including an X-ray and ultrasound suite, state-of-the-art anaesthetic monitoring, ECG, flexible endoscope for investigating gastrointestinal and respiratory problems, and automatic intravenous fluid pumps for hospitalised animals. This enables us to provide a wide range of services from standard desexing to complex diagnostic investigations, advanced surgery or intensive medical care.\n\nWe aim to set the standard for quality in veterinary healthcare, by providing you and your pets with outstanding service.  We are more than your pet''s hospital. We are their General Practitioner, Dentist, Surgeon, Pharmacist, Paediatrician, Radiologist, Nutritionist, Intensive Care Team, Pet Store, Animal Advice Centre, Emergency Centre and after hours team.\n\nAdelaide Animal Hospital is also one of only 28 veterinary hospitals across Australia to be awarded the status of “Hospital of Excellence” by the Australian Small Animal Veterinary Association. This award is in recognition of the excellent facilities provided at our hospital.\n\nWe also place great importance on continuing education for all vets, nurses and receptionists. All members of our team attend major veterinary conferences throughout Australia each year to ensure our expertise remains up to date, and to keep in touch with specialist colleagues interstate. Our focus allows us to provide the best and most up to date veterinary medicine.\n\nAdelaide Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• After hours service\n• Genetic screening\n• Microchip identification\n• Weight loss clinic\n• Behavioural training\n• Breed identification - DNA analysis\n• Cattery\n• Lost and found services\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.3333333333,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/Adelaide-Animal-Hospitals-1542929435927156/timeline', '', '', '', '', '', 'https://plus.google.com/112326454724248072486/about'),
  (83593, 'green-point-veterinary-hospital-83593', 'Green Point Veterinary Hospital', '', 'Green Point Veterinary Hospital located in Green Point specialises in health checks, vaccinations, radiography, ultrasound, dentistry, parasite control and prevention, surgery, pet insurance and more.', 274456, '2015-09-18 04:40:58', '2016-04-18 23:33:55', '', 191, 1503, 'pet wash\npet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274456, 0, '', 'info@greenpointvets.com.au', '0243693943', '', '', '', 'http://www.greenpointvets.com.au', 'Greenpoint Veterinary Hospital provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt Greenpoint Veterinary Hospital, you’ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines including  brand  new DIGITAL RADIOLOGY and ULTRASOUND    and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs.  WE NOW DO  TIBIAL TUBEROSITY ADVANCEMENTS  - (TTA)   a  superior technique for  large  dog  anterior cruciate rupture repair done by  our  surgical expert  DR INGRID TROMMELMANS.\n\nWe welcome  patients  who  have  no appointment  and   can generally  see  them  speedily  as mostly we have one vet doing appointments and  the  other  vet doing everything else  - however   pets with appointments have preference.\n\nBeing a hospital  however ,we  sometimes have  emergencies which take perference over all  else.\n\nGreenpoint Veterinary Hospital has been an integral part of our local community for  over 20 years. In that time, we’ve helped thousands of our clients cats & dogs, rabbits & guinea pigs, birds, horses and even a few snakes. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.\n\nGreenpoint Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Radiography\n• Ultrasound\n• Dentistry\n• Clinical Pathology\n• Pet Insurance\n• Desexing\n• Ophthalmic \n• Emergency procedures\n• Microchipping\n• Washing and grooming\n• Behavioural advice\n• Nutritional advice\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3541666667,0.5],[0.625,0.7708333333]],"2":[[0.3541666667,0.5],[0.625,0.7708333333]],"3":[[0.3541666667,0.5],[0.625,0.7708333333]],"4":[[0.3541666667,0.5],[0.625,0.7708333333]],"5":[[0.3541666667,0.5],[0.625,0.7708333333]],"6":[[0.3541666667,0.5208333333]],"0":[[0.4166666667,0.5833333333]]}', 'https://www.facebook.com/Green-Point-Veterinary-Hospital-1642999585929584/', '', '', '', '', '', ''),
  (83596, 'liverpool-veterinary-hospital-83596', 'Liverpool Veterinary Hospital', '', 'Liverpool Veterinary Hospital located in Liverpool specialises in general consultation, vaccination, microchipping, desexing, surgical procedures, dentistry, puppy preschool, diagnostic and many more.', 275085, '2015-09-18 04:41:10', '2016-04-21 06:31:04', '', 191, 1220, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 275085, 0, '', 'vets@lvh.com.au', '0296026015', '0296023448', '', '0282129022', 'http://www.lvh.com.au', 'Liverpool Veterinary Hospital is a small animal, family-oriented pet hospital.  The hospital has been servicing the Liverpool area for over 35 years, including the suburbs of: Liverpool, Wattle Grove, Holsworthy, Hammondville, Moorebank and Chipping Norton. \n\nMost of our patients are cats and dogs, but we do see the occasional rabbit, rat, mouse and guinea pig. \n\nOur hospital provides a full pet care service, both medical and surgical, ranging from your pets'' annual vaccinations to orthopaedic surgery. \n\nWe believe that every pet deserves the highest standard of medical care, delivered with respect and compassion.  We use human hospital grade materials in all our procedures, and make every effort to make your pet as happy and comfortable as possible during their stay.\n\nLiverpool Veterinary Hospital  offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General consults\n• Vaccinations, and annual health and wellness examination\n• Microchipping\n• Desexing\n• General and orthopaedic surgery\n• X-ray facilities\n• Dentistry\n• Blood tests, general and in-house pathology, and ECG\n• Puppy preschool\n• Specialist referrals\n• Dietary advice\n• Seniors card and DEFCOM discounts\n• Ultrasound\n\nand more.', 'A', '{"1":[[0.375,0.5],[0.625,0.7916666667]],"2":[[0.375,0.5],[0.625,0.7916666667]],"3":[[0.375,0.5],[0.625,0.7916666667]],"4":[[0.375,0.5],[0.625,0.7916666667]],"5":[[0.375,0.5],[0.625,0.7916666667]],"6":[[0.375,0.5]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/Liverpool-Veterinary-Hospital-126135174109829/', '', '', '', '', '', 'https://plus.google.com/111283248124462980099/posts'),
  (83601, 'waterworks-road-veterinary-surgery-83601', 'Waterworks Road Veterinary Surgery', '', 'Waterworks Road Veterinary Surgery located in Ashgrove specialises in behaviour consultations, dental checks, obedience training, preventative care, rehabilitation, vaccinations and many more', 271333, '2015-09-18 04:41:30', '2016-04-13 01:07:36', '', 191, 2514, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\nveterinary clinic\npets\nvets', 271333, 0, '', 'wwrdvet@bigpond.com', '0733661888', '', '', '', '', 'Waterworks Road Vet Surgery in Ashgrove, QLD is a full service companion animal hospital that has been established for 24 years. It is our commitment to provide quality veterinary care throughout the life of your pet. Our services and facilities are designed to assist in routine preventive care for young, healthy pets; early detection and treatment of disease as your pet ages; and complete medical and surgical care as necessary during his or her lifetime.\n\nWaterworks Road Vet Surgery understands the special role your pet plays in your family and are dedicated to becoming your partner in your pet''s health care. We treat your pet as we would our own. Our goal is to practice the highest quality medicine and surgery with compassion and an emphasis on client education. Our entire healthcare team is committed to providing personal attention to the unique concerns of each individual pet owner.\n\nWaterworks Road Vet Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Behaviour management\n• Dental checks\n• Hospitalisation\n• Obedience training\n• Preventative care\n• Rehabilitation\n• Vaccinations\n• Geriatrics\n• Internal medicine\n• Ophthalmology\n• Orthopaedics\n• Pathology\n• Radiography\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5416666667]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/waterworksrdvet/', '', '', '', '', '', 'https://plus.google.com/108814470346594668189/about'),
  (83607, 'melville-animal-hospital-83607', 'Melville Animal Hospital', '', 'Melville Animal Hospital located in Melville specialises in general consultations, obedience training, grooming, puppy school, exotic pet care services, surgical procedures and many more.', 271744, '2015-09-18 04:41:55', '2016-04-13 23:17:36', '', 191, 2359, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271744, 0, '', 'nurses@melvet.com.au', '0893174177', '', '', '', 'http://www.melvet.com.au', 'Melville Animal Hospital provides a modern, high standard medical & surgical service for your pets in a safe and friendly environment.\n\nFull grooming, puppy classes and cat boarding are also available. We continually update our procedures, working to give you the best understanding of your animals’ needs.\n\nWe are conveniently open 7 days a week 364 days of the year. The only time you won’t be able to reach us is Christmas day when we get to spend some time with our other families.\n\nMelville Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Obedience training\n• Cat boarding\n• Grooming\n• Puppy preschool\n• Exotic pet care\n• Surgical procedure\n\nand more.', 'A', '{"1":[[0.3125,0.7916666667]],"2":[[0.3125,0.7916666667]],"3":[[0.3125,0.7916666667]],"4":[[0.3125,0.7916666667]],"5":[[0.3125,0.7916666667]],"6":[[0.3333333333,0.7083333333]],"0":[[0.375,0.6666666667]]}', 'https://www.facebook.com/melvilleanimalhospital', '', '', '', '', '', ''),
  (83609, 'southcoast-animal-hospital-83609', 'Southcoast Animal Hospital', '', 'Southcoast Animal Hospital located in Port Noarlunga specialises in consultation, microchipping, surgical procedures, radiology, ultrasound, ophthalmology, dentistry, laboratory tests and many more.', 273373, '2015-09-18 04:42:03', '2016-04-15 06:19:30', '', 191, 1831, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 273373, 0, '', 'admin@scah.com.au', '0883844363', '', '', '', 'http://www.scah.com.au', 'Southcoast Animal Hospital started as the Port Noarlunga Veterinary Clinic in 1982. From the cottage at 25 Clarke Street, with Pam’s mother(theatre sister) as nurse, and father (accountant) as book keeper, it has evolved into today’s modern Animal Hospital, with a practice manager, several full time and part time vets, nurses and receptionists.\n\nThe purpose built hospital was completed at 35 Saltfleet Street (across the road from the original premises) in late 2007. It has provided greatly expanded facilities, allowing us to provide many more services.\n\nThe practice and all of the staff are committed to continuing education and applying their knowledge and skills to assist in the care of your animals.\n\nWe are all animal owners and fully understand the human-animal bond and the importance of pets as part of your family.\n\nSouthcoast Animal Hospital aim to enhance animal welfare and well-being through education and by providing quality veterinary services.\n\nOur aim is to work with you to provide the best outcome for you and your pets. We are happy to consider and discuss options, with the animal’s well-being a primary consideration.\n\nSouthcoast Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n♦ Consultations\n♦ Microchipping\n♦ Surgical procedures\n♦ Ophthalmology\n♦ Radiology\n♦ Ultrasound\n♦ Endoscopy\n♦ Dentistry\n♦ Laboratory tests\n♦ Home visits\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.3333333333,0.7083333333]],"0":[[0.375,0.5833333333]]}', 'https://www.facebook.com/SouthcoastAnimalHospital', '', '', '', '', '', ''),
  (83616, 'valley-vet-surgery-mackay-83616', 'Valley Vet Surgery - Mackay', '', 'Valley Vet Surgery located in Mackay specialises in health check, microchipping, vaccination, parasite control and prevention, farm animals and equine services, puppy preschool and many more.', 271061, '2015-09-18 04:42:31', '2016-04-12 07:14:38', '', 191, 2589, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271061, 0, '', 'admin@valleyvet.com.au', '0749513799', '', '', '0749513913', 'http://www.valleyvet.com.au', 'Valley Veterinary Surgery aims to provide a high quality, professional service for both small and large animal clients. We understand the bond between you and your pet and are committed to offering high quality affordable veterinary care with compassion from people who really care. Our staff are an enthusiastic team of vets and nurses all who have a common goal of providing the best possible care for our patients and focusing on the unique concerns of each individual pet owner.\n\nWe pride ourselves on our team selection and use a team approach to problem solving and achieving results. This ensures you always receive the best possible advice and pet care from people who really care. We are constantly upgrading our skills and knowledge and know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nValley Veterinary Surgery understand that animals don''t get sick or injured between 9am and 5pm on weekdays which is why we have a strong commitment to afterhours service. We are here when you need us.\n\nValley Veterinary Surgery  has been an integral part of our local community for years. Being so strongly integrated with our local community is important to us and our clients. Our clients know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our friendly veterinary team. Valley Veterinary Surgery provides family-style care for you and your pets, where modern-day medicine meets traditional "old fashioned" quality service.\n\nWe look forward to caring for you and your pets\n\nValley Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health check\n• Microchipping\n• Pet behavioural advice\n• Vaccination\n• Pet insurance\n• Parasite control and prevention\n• Farm animals and equine services\n• Ultrasound\n• Dentistry\n• Desexing\n• Radiography\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Valley-Vet-Surgery-398142953544020/', '', '', '', '', '', ''),
  (83618, 'gloucester-veterinary-hospital-83618', 'Gloucester Veterinary Hospital', '', 'Gloucester Veterinary Hospital located in Gloucester specialises in vaccinations, desexing, dental care, microchipping services, ultrasound, x-rays, radiology, large animal and equine services & more.', 274092, '2015-09-18 04:42:39', '2016-04-18 05:58:08', '', 191, 1614, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 274092, 0, '', 'poynting@gloucestervet.com.au', '0265581504', '', '', '', 'http://www.gloucestervet.com.au', 'Gloucester Veterinary Hospital is the first private veterinary practice in Gloucester commenced in 1952. From a practice that serviced 300 dairies by a single practitioner, the practice has expanded to now employing 3 full time veterinarians and 2 full time veterinary nurses as well as a full time practice manager.\n\nWhilst there is still a large component of dairy vet services, the nature of this service has changed from “fire-brigade” to include preventative and herd health medicine as well.\n \nGloucester also has a large number of beef properties which require veterinary assistance as needed or for regular pregnancy testing and bull soundness examinations.\n \nThe pleasure horse/working stockhorse is still a very important species in a rural practice and full ambulatory service is provided.\n \nSurgical and medical services are comprehensively available for companion animals as well and this is now a significant component of the Gloucester Veterinary Hospital business and focus.\n\nOther species attended by the practice include native fauna, birds and sheep, goats and alpacas – in fact, we will endeavour to attend to all animals requiring veterinary care.\n \nGloucester Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Desexing\n• Dentistry\n• Microchipping services\n• Laboratory and Pathology services\n• Radiology\n• Major and minor surgery\n• Pain management\n• Equine dentistry\n• Farm services\n• Hendra vaccinations\n• Pregnancy tests\n\nand more.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.5]]}', '', '', '', '', '', '', ''),
  (83624, 'reynella-veterinary-clinic-83624', 'Reynella Veterinary Clinic', '', 'Reynella Veterinary Clinic located in Morphett Vale specialises in consultations, vaccinations, microchipping, clinical pathology, dental care, preventative medicine, radiography, puppy school & more.', 273206, '2015-09-18 04:43:03', '2016-04-15 07:13:33', '', 191, 1788, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 273206, 0, '', 'info@reynellavetclinic.com.au', '0883823700', '', '', '', 'http://www.reynellavetclinic.com.au', 'Reynella Veterinary Clinic''s  team is dedicated to professional, affordable, and compassionate pet care.\n\nAs a small clinic, locally based on the southern side of Adelaide in Morphett Vale for many years, our client and patient relationships are very important to us. Our Veterinarians and Nurses pride themselves on their thorough and personalised service.\n\nReynella Veterinary Clinic offers care for small animals, particularly dogs and cats and a range of services at an affordable price. Apart from the usual services such as health consultations, diagnostic procedures, surgeries, radiographs and puppy school, our Vet Dr. Chris McIver is AQIS accredited to complete export papers for travelling pets.\n \nIt is important to us provide an excellent service for all stages of your pet''s life to ensure they have a happy and healthy life.\n\nReynella Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccination\n• Microchipping\n• Clinical Pathology\n• Dentistry\n• Preventative care\n• Radiography\n• Ultrasonography\n• Endoscopy\n• Orthopaedic\n• Ophthalmic\n• Puppy preschool\n• Surgical procedures\n• Nutritional advice\n• Nail clipping\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/Reynella-Veterinary-Clinic-133937796804129/', '', '', '', '', '', 'https://plus.google.com/106251008992269736359/about');
