  (83628, 'keen-street-veterinary-clinic-83628', 'Keen Street Veterinary Clinic', '', 'Keen Street Veterinary Clinic located in Lismore specialises in advanced surgical procedures, complete companion animal care, dentistry, grooming, microchipping, livestock services and many more.', 274774, '2015-09-18 04:43:20', '2016-04-19 03:30:42', '', 191, 1388, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274774, 0, '', 'admin@keenstreetvetclinic.com.au', '0266219811', '', '', '', 'http://www.keenstreetvetclinic.com.au', 'Keen Street Veterinary Clinic is a family orientated clinic located in Lismore. We understand that our pets aren''t just our pets, they are a part of our family. We treat all animals in our clinic as if they are part of our own family, caring for them as we would like our own ''kids'' to be treated.\n\nThe pets we treat are cats, dogs, cattle, sheep, goats, rabbits, birds and more!\n\nKeen Street Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Advanced Surgical Procedures\n• Complete Companion Animal Care\n• Dental Surgery & Preventative Care\n• Geriatric & Senior Health\n• Grooming\n• Livestock Services\n• Medical Diagnostics and Hospitalised Treatment\n• Microchipping\n• Pet Food and Supplies\n• Pregnancy Ultrasonography\n• Emergency Care and Afterhours services\n\nand more.', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3333333333,0.5]],"0":[[0.4166666667,0.4583333333]]}', 'https://www.facebook.com/Keen-Street-Veterinary-Clinic-164306177076396/', '', '', '', '', '', ''),
  (83630, 'greencross-vets-83630', 'Greencross Vets', '', 'Greencross Vets located in Woolloongabba specialises in vaccinations, desexing, dentistry, microchipping, parasite prevention, surgical procedures, laboratory testing, weight loss programs and more.', 273689, '2015-09-18 04:43:28', '2016-04-18 00:20:25', '', 191, 1738, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273689, 0, '', 'info@getwellvet.com.au', '0734353535', '', '', '0734353536', 'http://www.greencrossvet.com.au', 'Greencross Vets practices consist of enthusiastic vets, nurses and receptionists who all have the common goal of providing the best possible care for their patients. \n\nWe are part of a national organisation which means we have more to offer your pet – whatever they need, whenever they need it. Our practices are run and managed by a local team of dedicated animal lovers who are there to help at every step and give you reliable answers and the best solutions for your pet’s individual needs.\n \nGreencross Vets pride themselves on team selection and internal training programs focusing on continuing education. All Greencross Vet clinics follow a strict accreditation program designed to ensure that you and your pet will always receive the highest standard of care and a large range of quality pet health care services.\n\nGreencross Vets is committed to providing you with simple to understand yet comprehensive health care information. We will always provide a secure and safe environment for your loved one. We approach the care and wellbeing of your pet as if they were our own. We invest ourselves emotionally as well as professionally so you can be assured that your pet is in the best of hands.\n\nAll Greencross Vet practices offer a comprehensive range of professional veterinary services to cater for all your pet care needs utilising the latest diagnostic equipment. Our practices offer a comprehensive aray of professional veterinary services to cater for all your pet care needs utilising the latest diagnostic equipment. This ensures you will receive a timely and accurate diagnosis and your veterinarian can outline the best treatment plan for your pet all on the one premises.\n \nAlong with regular veterinary exams, there are vital steps in safeguarding your pet’s health. At Greencross Vets we have health care programs tailored to your pet’s needs. Besides giving your pet a comprehensive physical examination, we''re also interested in its behaviours, distant medical and dietary history, and its environment including diet, emotional stresses, and other factors.\n \nOur practices are some of the most advanced practices in the veterinary industry and are well equipped to provide the best in medical care and diagnostic testing. All Greencross practices have access to some of the most advanced diagnostic equipment which include; ultrasound, endoscopic tests and respiratory monitors for safe monitoring of your pets anaesthetic just to name a few.  ', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.625]]}', 'https://www.facebook.com/GreencrossVets', '', '', '', '', '', 'https://plus.google.com/+GreencrossVetsAustralia/about'),
  (83635, 'warwick-vet-clinic-83635', 'Warwick Vet Clinic', '', 'Warwick Vet Clinic located in Warwick specialises in emergency care services, routine vaccinations, reproduction and management, dentistry, digital radiography, farm animal services and much more.', 271311, '2015-09-18 04:43:48', '2016-04-13 00:53:58', '', 191, 2517, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271311, 0, '', 'info@warwickvet.com.au', '0746611105', '', '', '0746615799', 'http://www.warwickvet.com.au', 'Warwick Vet Clinic understands our job is to provide the best veterinary care when you need it the most – when you’re animal is sick or injured. \n\nFor over 60 years we have been providing professional animal care. With the latest digital x-rays, ultrasound equipment, endoscopes, motorised dental gear and blood analysing machines the Warwick Vet Clinic are leaders in providing modern, reliable and friendly service for both small animal and large medical and surgical procedures.\n\nWarwick Vet Clinic have a range of pet insurance plans and offer CreditCare - a flexible payment plan, specifically designed for healthcare expenses, that makes it easier for you and your family to get the treatment or procedures you want and need (subject to approval).  Seniors and Carer card holders are eligible to a 10% discount off the full price off professional fees and over the counter (non ethical) supplies.  \n\nWarwick Vet Clinic provides expert care every day, all year around – we’re here for you when you need help the most. Our services include:\n\n• General veterinary care\n• Husbandry advice\n• Large animal ambulatory vet service\n• On-farm and stud visits\n• Dedicated horse facility at Morgan Park (located at the Polocrosse grounds)\n• Products and services for pets and livestock\n\nand many more.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.5]]}', '', '', '', '', '', '', ''),
  (83637, 'southern-animal-hospital-83637', 'Southern Animal Hospital', '', 'Southern Animal Hospital located in Morphett Vale specialises in vaccination, desexing, microchipping, parasite control and prevention, weight loss clinics, puppy preschool, grooming and many more.', 273315, '2015-09-18 04:43:56', '2016-04-15 05:47:10', '', 191, 1852, 'pet care\nveterinary surgeons\npet grooming\nanimal hospital\npets\nvets', 273315, 0, '', 'phil@southvet.com.au', '0883823666', '', '', '', 'http://www.southvet.com.au/index.html', 'Southern Animal Hospital''s motto is to provide the very best veterinary care to our clients - of the quality that we would expect for our own pets. We treat you with the respect required to gain the trust needed to look after your furry family members.\n\nWe also aim to provide a one stop service for all of your pet''s needs, in every stage of life - from their first weeks as puppies and kittens, through to their advanced years.\n\nWe have a large range of pet foods, nutritional treats, all types of harnesses, collars, leads, beds and accessories.\n\nWe take care of everything from regular health checks and vaccinations, to advanced emergency and critical care medicine and surgery, through to ultrasound, digital x-rays, in house laboratory testing, key hole surgery, arthroscopy, orthopaedic and soft tissue surgery, dental care, and cancer therapy.\n\nWe can accomodate your pets when you are on holiday, at our boarding facilities at Marion Animal Hospital, and Plympton Veterinary Clinic.\nWe can provide full grooming and bathing services at our Seaford Clinic, and Plympton Veterinary Clinic.\n\nWe are happy to see and look after exotic and unusual pets and carry a range of products for reptiles and birds.\n\nIn addition we provide free emergency, veterinary and aftercare for injured wildlife (including koalas), at our new wildlife rehabilitation hospital on Anzac Highway as part of our commitment to the Adelaide community.\nWe also actively participate in the cat adoption programme rehoming healthy kittens and cats at all four clinics.\n\nSouthern Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccination\n• Desexing\n• Microchipping\n• Parasite control and prevention\n• After hours service\n• Dentistry\n• Surgical procedures\n• Ultrasonography\n• Radiography\n• Weight loss clinic\n• Puppy preschool\n• Dog grooming\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.3541666667,0.7083333333]],"0":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/Southern-Animal-Hospital-564649230247823/', '', '', '', '', '', ''),
  (83638, 'yanchep-veterinary-clinic-animal-hospital-83638', 'Yanchep Veterinary Clinic & Animal Hospital', '', 'Yanchep Veterinary Clinic & Animal Hospital located in Yanchep specialises in vaccinations, skin problems treatment, hydrobaths, weight clinic and advice, microchipping, hospitalisation and more.', 272456, '2015-09-18 04:44:00', '2016-04-14 07:00:01', '', 191, 2185, 'pet wash\npet care\nveterinary surgeons\nanimal hospital\nveterinary clinic\npets\nvets', 272456, 0, '', 'yanchepvet@live.com', '0895612438', '', '', '', 'http://www.yanchepvet.com.au', 'Yanchep Veterinary Clinic & Animal Hospital understands that pets are part of your family, and that’s why we strive to provide the best possible veterinary services and pet wellness plans for you!\n\nOf course, we love pets and we are here for you and your animal companions. With full hospital and medical services for all small animals we offer professional health care and veterinary services. We are as passionate about pets as you are.\n\nAt the Yanchep Veterinary Clinic & Animal Hospital our veterinarians have years of experience in medicine and surgery and dentistry. Being located away from the metropolitan area, we have invested in excellent xray, ultrasound and laboratory equipment. We can do full blood testing in a matter of minutes and discuss the results with you at your appointment. Our in house equipment rivals many metro vet hospitals.\n\nWe offer specialised and tailored senior pet care programs, to ensure your pets stay healthy and happy as they move on in years. Older pets are a real focus for us. We take great pride in the way we care for your pets as they age. Our focussed arthritis care program is giving hundreds of older pets new life, as well as a spring in their step.\n\nDr Sam Sorensen offers acupuncture for pets, an especially helpful treatment for older pets with aches and pains.\n\nWe also offer a free dental check program, available for any dog or cat. With frequent check ups and on going care, dental problems and bad breath can be a thing of the past.\n\nHealthy puppies and kittens under a year of age are eligible for a month of free pet insurance through Petplan. No obligation and completely free of charge.\n\nOur association with a local dog trainer means we can direct you to services for dog training, behavioural help and puppy pre school. Our vets are passionate about pet care and meet or exceed the AVA requirements for continuing education and professional development.\n\nYanchep Veterinary Clinic & Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Skin problem treatment\n• Hydrobath\n• Vaccinations\n• Microchipping\n• Acupuncture\n• Ultrasound\n• X-rays\n• Surgical procedures\n• Hospitalisation \n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.375,0.5416666667]]}', 'https://www.facebook.com/Yanchep-Veterinary-Clinic-Animal-Hospital-178638825483289/', '', '', '', '', '', ''),
  (83639, 'hume-equine-centre-83639', 'Hume Equine Centre', '', 'Hume Equine Centre located in Albury North specialises in parasite prevention, microchipping, dentistry, weight management, surgical procedures, laboratory tests, reproduction services and many more.', 274594, '2015-09-18 04:44:04', '2016-04-19 01:23:26', '', 191, 1457, 'pet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274594, 0, '', 'admin@humeequinecentre.com.au', '0260402397', '', '', '', 'http://www.humeequinecentre.com.au', 'Hume Equine Centre was established in 1993 by Dr Bob Fielding  is a well-equipped Equine Hospital located in the heart of the Albury - Wodonga horse industry.\n\nWith modern equipment and purpose-built, quality facilities and experienced staff, we are committed to providing a high standard of veterinary care and advice for your horse or pony.\n\nAt the Hume Equine Centre, we offer you knowledge and expertise on a broad range of veterinary services designed to provide a high level of care for your horse or pony.\n\nWith our experienced veterinary surgeons, nursing staff, and a modern well equipped clinic, we can look after your horses'' general health, provide emergency care, nutritional advice and a common sense, professional approach to the day to day management of problems as they arise. \n\nHume Equine Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Parasite control and prevention\n• Microchipping\n• Dentistry\n• Weight management advice\n• Surgical procedure\n• Laboratory tests\n• Reproduction service\n• Diagnostic imaging\n\nand more.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/humeequinecentre', '', '', '', '', '', ''),
  (83643, 'clare-valley-veterinary-services-83643', 'Clare Valley Veterinary Services', '', 'Clare Valley Veterinary Services located in Clare specialises in consultation, surgical procedures, hospital patient care, emergency care services, large animal and equine care services and many more.', 272780, '2015-09-18 04:44:20', '2016-04-14 23:44:35', '', 191, 2081, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 272780, 0, '', 'clare@cvvs.com.au', '0888422822', '', '', '', 'http://www.cvvs.com.au', 'Clare Valley Veterinary Services has cared for pets and production animals throughout the Mid North of South Australia for more than a decade.\n\nIts current owners, Dr Louise Lehmann and husband Jason, took over the Clare clinic on April Fool''s Day in 2007 and a month earlier, set up the Jamestown clinic, servicing clients as far as the Flinders Ranges.\n\nDespite its inauspicious starting date, CVVS has thrived under the Lehmann''s watch, growing to three full time veterinarians, four full-time veterinary nurses and two part-time nurses working between the two clinics.\n\nIt is a genuine mixed practice, caring for 65% small animals and 35% large animals. The team treats an array of animals, including cats, dogs, guinea pigs, rabbits, horses, cows, sheep, alpacas, pigs and goats. It also provides free assistance to injured wildlife brought into the clinic.\n\nAs a rural practice, Clare Valley Veterinary Services is proud to offer a full range of services from vaccinations and desexing to orthopaedic surgery, in-house blood testing, ultrasounds and digital x-rays. This one-stop-shop facility means you avoid the hassle of travelling for your pet''s treatment.\n\nClare Valley Veterinary Services provides a 24 hour emergency service, 365 days of the year and also opens its Clare clinic on Saturday mornings.\n\nWhen you get to know the Clare Valley Veterinary Services team, you''ll learn that each staff member has a natural affection for animals, many with their own brood of pets at home. Their aim is to provide the best level of care for your animal and they look forward to getting to know you and your animal over your pet''s lifetime.\n\nClare Valley Veterinary Services offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vets on call 24 hours a day, 7 days a week, for emergencies\n• Digital Xray Processing (allows us to e-mail specialist surgeons / refer cases if required)\n• Saturday morning clinic\n• Puppy pre-schools\n• Grooming services\n• In house blood testing\n• Ultrasound equipment for small animal cases and large animal reproduction\n• Johnes and Brucellosis accredited veterinarians\n• Herd health programs\n• Bovine, equine, camelid and canine breeding services\n\nand more.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.4583333333]]}', 'https://www.facebook.com/Clare-Valley-Veterinary-Services-1462809754013234', '', '', '', '', '', ''),
  (83654, 'maclean-veterinary-clinic-83654', 'Maclean Veterinary Clinic', '', 'Maclean Veterinary Clinic located in Maclean specialises in health checks, vaccinations, surgical procedure, dentistry, radiology, microchipping, desexing, livestock and exotic pet care and more.', 275103, '2015-09-18 04:45:05', '2016-04-21 06:41:07', '', 191, 1215, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 275103, 0, '', 'clinic@macleanvet.com.au', '0266452864', '', '0408662753', '0266453658', 'http://www.macleanvet.com.au', 'Maclean Veterinary Clinic, with its sister clinic, Yamba Veterinary Clinic, is dedicated to the health care of pets in the region. With a dedicated team of experienced staff our aim is to create a partnership with our clients and their four-legged family members to maintain well-being and support in times of ill-health.\n\nMaclean Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks & Vaccinations\n• Soft tissue & orthopaedic surgery\n• Internal medicine\n• Dentistry\n• X-ray/radiology\n• Pathology\n• Microchipping & Desexing\n• Hospital care\n• Livestock & exotic species consultations\n• In-house laboratory\n• Hydrobaths (including a full range of medicated shampoos)\n• Clipping & grooming\n• Manicure/pedicure\n• Free weight management consultations\n• Nutritional advice\n• Free parasite checks\n• Puppy kind\n\nand more.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.4791666667]]}', 'https://www.facebook.com/MacleanVet', '', '', '', '', '', 'https://plus.google.com/113446178719152552650/about'),
  (83655, 'sanford-veterinary-clinic-83655', 'Sanford Veterinary Clinic', '', 'Sanford Veterinary Clinic located in Geraldton specialises in consultations, in-house laboratory services, surgical procedures, x-rays, ultrasound, weight loss program, dentistry and many more.', 271934, '2015-09-18 04:45:09', '2016-04-14 02:04:12', '', 191, 2263, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271934, 0, '', 'reception@sanfordvet.com.au', '0899211797', '', '', '0899642116', 'http://www.sanfordvet.com.au', 'Sanford Veterinary Clinic is the longest established animal hospital in the Midwest.   Sanford''s long history of excellent care and patient satisfaction is due to to our welcoming, caring and experienced approach to your pets health. We stress the need for preventative care and early diagnostic testing, and provide interventional medicine, surgery and emergency care.\n\nSanford Veterinary Clinic seeks to set a high standard for excellent veterinary medicine and compassionate care. Our highly-skilled veterinarians and staff members all cooperate and work together toward one common goal: the well-being of your pet.\n\nAlong with providing the best medical care for your pet, Sanford Veterinary Clinic wants to educate pet owners on how to best care for their pets outside the hospital.\n\nSanford Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Full in-house laboratory services\n• Soft tissue surgery\n• Orthopaedic surgery\n• Digital x-rays\n• Ultrasound\n• Weight loss program\n• Dentistry\n• Home euthanasia\n• Pet insurance\n• Cat adoption\n• Emergency care\n• After hours\n\nand more.', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Sanford-Veterinary-Clinic-115063331850251/?fref=ts', '', '', '', '', '', ''),
  (83657, 'zillmere-veterinary-surgery-83657', 'Zillmere Veterinary Surgery', '', 'Zillmere Veterinary Surgery located in Zillmere  specialises in diagnostic and therapeutic service, surgical procedure, radiology, microchipping, dentistry, dietary counselling, lab tests & many more.', 271557, '2015-09-18 04:45:17', '2016-04-13 03:57:59', '', 191, 2443, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 271557, 0, '', 'zillmere@nvcvets.com.au', '0738652020', '', '', '', 'http://www.zillmerevet.com', 'Zillmere Veterinary Surgery understands the special role your pet plays in your family and are dedicated to becoming your partner in your pet''s health care. We treat your pet as we would our own.\n\nOur goal is to practice the highest quality medicine, surgery and preventative healthcare, and to practice this with compassion and an emphasis on providing education to all pet owners. Our entire healthcare team is committed to providing personal attention to the unique concerns of each individual pet owner, and to providing care for our pet owners as well as for our pets.\n\nZillmere Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Laboratory tests\n• Surgical procedure\n• Dentistry\n• Dental X-rays\n• Radiology\n• Microchipping\n• Nutritional advice\n• Photonic therapy\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Zillmere-Veterinary-Surgery-133919177970/', '', '', '', '', '', ''),
  (83667, 'pets-and-their-people-83667', 'Pets and their People', '', 'Pets and their People located in Fulham Gardens specialises in health checks, puppy preschool, vaccinations, consultations, dental services, arthritis management, in-house laboratory and many more.', 273673, '2015-09-18 04:45:57', '2016-04-17 23:42:58', '', 191, 1743, '', 273673, 0, '', 'inquiries@petsandtheirpeople.com.au', '0883555475', '', '', '', 'http://www.petsandtheirpeople.com.au', 'Pets and their People is a team founded by Alan Dalgarno, Veronica Wah Day and Peter Hangartner. Since 1998 we have been progressively caring for your pets at the Unley, Fulham Gardens and Black Forest Veterinary Surgeries.\n\nIn 2013 Pets and their People was created …we recognise you and your pet share a unique bond.\n\nAs pet owners the bond we share with our pets has the potential to greatly enhance our lives, bringing joy and companionship into our lives, creating strong social and community networks, enhancing physical and mental health and well being. Many of us would never be without our pets.\n\nWe see our role as providing opportunities to maintain and optimise your relationship with your pet. Starting with offering the highest standards of veterinary care and striving to be great communicators then tailoring the care that we provide to suit your individual needs.\n\nTogether with our great team, our mission is to continue to care for you and your pets to enhance your lives together.\n\nWe have three Adelaide vet surgery locations: Fulham Gardens Vet Surgery in Adelaide''s western suburbs, Unley Vet and Black Forest Vet Surgeries in Adelaide''s inner eastern and southern suburbs.\n\nFacilities and equipment are merely part of the foundation of what we do… continuing education and continually analysing what and why we do things combined with the resources provided by a diverse group of professionals sharing a common set of values help us move steadily towards our vision.\n\nPets and their People offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Puppy preschool\n• Consultations\n• Dental service\n• Emergency and critical care\n• Arthritis mangement\n• Animal acupuncutre\n• Geriatric care\n• In-house laboratory\n• Imaging x-rays\n• Ultrasound\n\nand more.', 'A', '{"1":[[0.3333333333,0.875]],"2":[[0.3333333333,0.875]],"3":[[0.3333333333,0.875]],"4":[[0.3333333333,0.875]],"5":[[0.3333333333,0.875]],"6":[[0.3333333333,0.7083333333]],"0":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/Pets-and-their-People-1475996085994572/', '', '', '', '', '', ''),
  (83668, 'glenhaven-veterinary-hospital-83668', 'Glenhaven Veterinary Hospital', '', 'Glenhaven Veterinary Hospital located in Glenhaven specialises in health checks, vaccination, parasite control and prevention, dentistry, radiography, ultrasonography, desexing and many more.', 274068, '2015-09-18 04:46:01', '2016-04-18 05:45:33', '', 191, 1622, 'veterinary surgeons\npet care\ndog grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274068, 0, 'Opposite Flower Power', 'info@glenhavenvet.com.au', '0298946344', '', '', '', 'http://www.glenhavenvet.com.au', 'Glenhaven Veterinary Hospital provides modern, professional and affordable health care for your pets. We have been providing excellence in care for pets and their owners from our hospitals for over 24 years. Our aim is to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and are avid animal lovers.\n\nOur vets have over eighty years of experience in treating dogs and cats, as well as a wide range of animals. We consult with each other on the more challenging cases, and happily rely on each other''s skills to ensure the best possible care for your pets. We all really enjoy coming to work each day, so our hospitals are a happy environment in which your pets, and you, will feel at ease. Our friendly vets and nurses aim to make your visit a truly pleasant experience.\n\nAt Glenhaven Veterinary Hospital, you’ll receive sound advice. We''ll provide you with a clear explanation of the relevant health care issues and treatment options. We know that you want to understand what is wrong with your pet in easy to comprehend language. We will get to the bottom of the problem, but not baffle you with science! With good advice and professional recommendations, you’ll be well equipped to make the best decisions for your pet.\n\nGlenhaven Veterinary Hospital give back to the community and to animals that cannot care for themselves. We have been providing pro bono wildlife care for nearly 25 years - sometimes to 3 or more animals a day, supporting WIRES and Sydney Metropolitan Wildlife Service. We rehome many animals. Each of us has at least one rescue animal (Gordon and Helen have seven!)\n\nOur vets, male and female, are all different - we are really happy to make ourselves available to you, so you can consult with the vet you wish. We know that with confidence in us, comes a better care for your pets. Each vet is very skilled in general care, surgery and medicine. Additionally, we each have special areas of interest, so we can use all our experience together to get the best possible outcome for your pets. Please see "Meet our Staff" for more details on each of us. \n\nGlenhaven Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccinations\n• Parasite control and prevention\n• Dentistry\n• In-house laboratory testing\n• Desexing\n• Orthopaedic\n• Microchipping\n• Grooming\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5],[0.7083333333,0.75]]}', 'https://www.facebook.com/gwhvh/', '', '', '', '', '', 'https://plus.google.com/113800552066655541716/about'),
  (83672, 'karrinyup-small-animal-hospital-83672', 'Karrinyup Small Animal Hospital', '', 'Karrinyup Small Animal Hospital located in Gwelup specialises in consultations, surgery, dentistry, blood testing, blood pressure testing, microchipping, desexing operations, puppy classes and more.', 271623, '2015-09-18 04:46:17', '2016-04-13 06:19:17', '', 191, 2406, 'pet wash\npet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271623, 0, '', 'vet@ksah.com.au', '0894474644', '', '', '', 'http://www.ksah.com.au', 'Karrinyup Small Animal Hospital (KSAH) was established in 1982 and ever since then we pride ourselves in providing quality veterinary care for your pets from birth to their twilight years.\n\nWe are a full service hospital with fully equipped facilities to offer high quality preventative, diagnostic, surgical and dental care.  To ensure we provide the latest in modern medicine and surgical techniques our vets regularly undertake continuing education and training. We are also proud to have a fully qualified and caring veterinary nursing team who make your pet''s stay with us pleasant.\n\nKarrinyup Small Animal Hospital recognise the importance of your pet within your family and we strive to provide the individual care and attention they need to enjoy a long, happy and healthy life. \n\nWe believe in preventing health problems before they start and we offer preventive health care plans that will maintain your pet’s health and wellbeing as well as to minimise the lifetime cost of care.\n\nWe look forward to welcoming you and your special family member to our clinic and to serve you for many years to come.\n\nKarrinyup Small Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgery\n• Dentistry\n• Vaccinations\n• Blood testing\n• Blood pressure testing\n• Dedicated oxygen cage\n• Microchipping\n• Desexing operations\n• Free puppy classes\n• Xrays\n• Boarding cattery\n• Orthopaedic surgery\n• Hydrobaths/Shampoo\n• Boarding cattery\n\nand more.', 'A', '{"1":[[0.3125,0.7916666667]],"2":[[0.3125,0.7916666667]],"3":[[0.3125,0.7916666667]],"4":[[0.3125,0.7916666667]],"5":[[0.3125,0.7916666667]],"6":[[0.3333333333,0.6666666667]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/KarrinyupSmallAnimalHospital/', '', '', '', '', '', ''),
  (83687, 'kingscliff-veterinary-clinic-83687', 'Kingscliff Veterinary Clinic', '', 'Kingscliff Veterinary Clinic located in Chinderah specialises in general medicine, surgical procedures, dental care, radiology, ultrasound, in-house laboratory testing, microchipping and many more.', 274838, '2015-09-18 04:47:18', '2016-04-19 05:53:43', '', 191, 1359, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274838, 0, '', '', '0266741916', '', '', '', 'http://www.kingscliffvet.com.au', 'Kingscliff Veterinary Clinic have been serving the Kingscliff region for close to 20 years. There is a strong tradition of friendly family pet health care at both practices. The reason each practice has been successful is the attention to high quality medicine and surgery. The vets and nurses are honest, caring and hard working. Everyone’s goal is to keep your pet healthy and bring them back to good health when unwell.\n\nKingscliff Veterinary Clinic have a commitment to maintaining our hospitals in a clean and modern presentation. Our equipment is updated and improved through regular financial reinvestment. This allows us to offer you the best care for your pet that we can.\n\nWe enjoy being a part of the local community and we consider ourselves privileged when you chose us to take care of your much loved family pet.\n\nKingscliff Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Complete physical exams\n• General medicine\n• Surgical procedure\n• Dental care\n• Radiology\n• Ultrasound\n• In-house laboratory testing\n• Microchipping\n• Vaccinations\n• Parasite control and prevention\n• Puppy preschool\n• Behaviour management\n\nand many more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/greenwaydriveandkingscliffvets/?fref=ts', '', '', '', '', '', 'https://plus.google.com/117819770249292542844/about'),
  (83689, 'tugun-veterinary-surgery-83689', 'Tugun Veterinary Surgery', '', 'Tugun Veterinary Surgery located in Tugun specialises in acupuncture, advanced surgical procedures, behaviour consultations, dentistry, diagnostic services, exotic pet care, microchipping and more.', 271029, '2015-09-18 04:47:26', '2016-04-12 06:53:17', '', 191, 2597, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 271029, 0, '', 'info@tugunvets.com.au', '0755341928', '', '', '0755210039', 'http://www.tugunvets.com.au', '', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.3541666667,0.4583333333]]}', 'https://www.facebook.com/TugunVets/timeline', '', '', '', '', '', 'https://plus.google.com/114871091684583830071/about'),
  (83693, 'port-road-west-croydon-veterinary-clinic-83693', 'Port Road West Croydon Veterinary Clinic', '', 'Port Road West Croydon Veterinary Clinic located in West Croydon specialises in surgical procedures, dentistry, pharmacy, radiology and more.', 273102, '2015-09-18 04:47:42', '2016-04-15 03:02:41', '', 191, 1910, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273102, 0, '', '', '0883400388', '', '', '', 'http://www.portroadvet.com.au', 'Port Road West Croydon Veterinary Clinic''s aim is to not only provide excellent medical and surgical care, but also to maintain a close relationship with you. We have a small dedicated staff who want to know about the needs of you and your pet. You won''t see a different face every time you visit.\n\nWe take extra time. Although most practices offer 10 to 15 minute consultations, our regular consultation is 20 minutes to ensure that your pet can have a thorough examination. We can then determine the most appropriate treatment.\n\nPort Road West Croydon Vet provides excellent Vet services to Croydon, Hindmarsh, Brompton, Bowden, Welland, Allenby Gardens, Beverley, Thebarton, Torrensville, Underdale, Findon, Dudley Park, Ridleyton, Ferryden Park, Woodville, Cheltenham, Albert Park and Royal Park in Adelaide.\n\nPort Road West Croydon Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgical procedures\n• Pharmacy\n• Radiology\n• Dentistry\n• X-rays\n• Ultrasound\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.5]]}', 'https://www.facebook.com/PortRoadVet', '', '', '', '', '', 'https://plus.google.com/117552553146307329172/about'),
  (83695, 'hartley-veterinary-and-animal-centre-83695', 'Hartley Veterinary and Animal Centre', '', 'Hartley Veterinary and Animal Centre located in Little Hartley specialises in health checks, vaccinations, parasite control and prevention, microchipping, dentistry, radiography, surgery and more.', 274552, '2015-09-18 04:47:50', '2016-04-19 00:55:59', '', 191, 1470, 'pet wash\npet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274552, 0, '', 'hartleyvet@outlook.com', '0263552272', '', '', '', 'http://www.hartleyvetcentre.com.au', 'Hartley Veterinary and Animal Centre provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and are avid animal lovers.\n\nAt Hartley Veterinary and Animal Centre, you’ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet at the next scheduled visit.\n\nHartley Veterinary and Animal Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Microchipping\n• Dentistry\n• Radiography\n• Ultrasonography\n• Clinical Pathology\n• Pet Insurance\n• Surgical procedures\n• Boarding advice\n• Behavioural advice\n• Nutritional advice\n• Washing and grooming\n\nand more', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Hartley-Veterinary-Animal-Centre-63-552-272-1442828452692151/', '', '', '', '', '', 'https://plus.google.com/115135381511867577354/about'),
  (83701, 'wilston-vet-83701', 'Wilston Vet', '', 'Wilston Vet located in Windsor specialises in advanced surgical procedures, house calls, dentistry, acupuncture, vaccinations, grooming and hydrobath, microchipping, puppy preschool and many more.', 271407, '2015-09-18 04:48:14', '2016-04-13 02:06:21', '', 191, 2492, 'pet wash\npet care\nveterinary surgeons\nveterinary clinic\npet shops\npets\nvets\ndog walking', 271407, 0, '', 'info@wilstonvet.com.au', '0733573882', '', '', '', 'http://www.wilstonvet.com.au', 'Wilston Vet opened in 2003, and our wish was to provide the local inner north Brisbane community with a warm, caring and friendly veterinary practice. We hope that you come and visit us with your pets to experience our service and join our extended family. You and your furry friends are our passion here at Wilston Vet. Our promise to you is that we will treat your pet as if it were our own and if they could talk we are sure they would agree.\n\nHere at Wilston Vet we strive to offer our patients, your pets, the highest quality of veterinary care available whilst treating them with the compassion and respect they deserve. Your furry friend will benefit from our state of the art equipment as well as enjoy the quality care from a team of highly trained professionals. We have in-house blood analysis machines, microscopes, ECG, a digital x-ray machine, an ultrasonic dental scaler and polisher, a digital dental x-ray machine, comprehensive anaesthetic monitoring devices, blood pressure machines,  a tonometer and intravenous infusion pumps. We have a dedicated cat hospital ward so our feline friends do not become unduly stressed by their canine counterparts! Our surgery is fully computerised enabling your pets’ records to be accessed at the touch of a button. Your sick or injured pet will feel safe and comfortable with us.\n\nOur consultation rooms are clean and welcoming. Your pet will not feel like the room is a typical “hospital” type of room, but more like a room in their own home. We also go to great efforts to avoid the waiting room, consult rooms and treatment rooms smelling like a hospital. The scent of an aromatherapy oil burner wafts through the surgery as well as calming pheremones from “Feliway”  diffusers to put your pet at ease.\n\nWilston Vet services all inner Brisbane suburbs including Wilston, Windsor, Grange, Lutwyche, Herston, Spring Hill, Kelvin Grove, Newmarket, Teneriffe, The Valley, Gordon Park, Wooloowin, Clayfield and Kalinga. We also have many clients who come from across the river to see us or from the Western Brisbane suburbs as we are conveniently located close to the Inner City Bypass exit as well as the Clem 7 Tunnel.\n\nWilston Vet offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgical procedure\n• Dentistry\n• Dog training\n• House calls\n• Acupuncture\n• Vaccinations\n• Grooming and Hydrobath\n• Puppy preschool\n• MIcrochipping\n• Pet foods\n• End of life service \n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/wilstonvet', '', '', '', '', '', ''),
  (83702, 'lachlan-valley-veterinary-clinic-83702', 'Lachlan Valley Veterinary Clinic', '', 'Lachlan Valley Veterinary Clinic located in Forbes specialises in health checks, vaccination, microchipping, parasite control and prevention, dentistry, surgery, farm animal services and many more.', 274901, '2015-09-18 04:48:18', '2016-04-19 06:28:48', '', 191, 1340, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274901, 0, '', 'lachlanvalleyvet@hotmail.com', '0268511100', '', '', '0268511505', 'http://www.lachlanvalleyvet.com.au', 'Lachlan Valley Veterinary Clinic in Forbes provides a professional veterinary service for all pets and livestock in Forbes and surrounding areas.\n\nLachlan Valley Veterinary Clinic will fully supported you with sound advice first and foremost. With knowledge and advice gained from the combined years of experience of our staff, you will be well equipped to make the best ongoing health care decisions for your animal(s).\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores as well as vehicles out on the road, we provide on-the-spot assistance for nearly all animal health and medical needs. \n\nLachlan Valley Veterinary Clinic has been serving the local Forbes community for many years. In that time, we’ve helped thousands of our clients animals. Being so strongly integrated with our local Forbes community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best of hands with our team.\n\nLachlan Valley Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Health checks\n• Microchipping\n• Parasite control and prevention\n• Dentistry\n• Radiography\n• Ultrasonography\n• Pet Insurance\n• Desexing\n• Emergency surgical procedures\n• Farm animal and livestock services\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.3541666667,0.5]]}', '', '', '', '', '', '', 'https://plus.google.com/111862226150134473886/about'),
  (83705, 'equine-veterinary-dental-services-83705', 'Equine Veterinary & Dental Services', '', 'Equine Veterinary & Dental Services located in Clarenza specialises in dentistry, castrations, digital x-rays, endoscopy, foot balance problems, skin tumour treatments, lameness work-ups and more.', 273759, '2015-09-18 04:48:30', '2016-04-18 01:44:54', '', 191, 1716, 'veterinary surgeons\nanimal hospital\nvets', 273759, 0, '', 'vets@evds.net.au', '0266424700', '', '', '0266428564', 'http://www.evds.net.au', 'Equine Veterinary & Dental Services vets are committed to every aspect of keeping your horses healthy. You can trust Equine Veterinary & Dental Services to deliver the best results, every time.\n\nAt Equine Veterinary & Dental Services, we work as a team and strive to please our clients through meeting their individual needs as best we can. We want to help our clients to help their horses! \n\nWe treat every horse and owner as an individual — with respect, honesty and willingness to go the extra mile. \n\nOur ultimate goal is to reliably help our clients to prevent diseases and minimise the stress of emergencies with their horses. \n\nEach of our vets and staff members own horses and have competed in horse sports, so we all know how much dedication and energy is required to own and train horses. With that, we have a unique level of respect, connection and admiration for our clients, who all work so hard to be able to live their dreams of owning and playing with these awesome animals. \n\nOur three equine vets have special interests in equine dentistry, lameness, internal medicine and reproduction and have invested in the best equipment and training available. With this, we strive to offer clients maximum value for money through efficiency and thoroughness. \n\nWe are only too happy to perform procedures or attend to problems outside of the mouth whilst examining each dental patient. Thus we practice a holistic style of equine veterinary medicine. Focus on constant and never ending improvement means we regularly attend post graduate training courses. As well as improving our own skills and knowledge, we aim to pass on this new knowledge to our clients.\n\nEquine Veterinary & Dental Services offers a comprehensive range of veterinary and pet health-related services, including:\n\n• dentistry\n• stud work including ultrasound scanning, infertility investigations & treatments, flushing, semen collection etc\n• castrations\n• tendon scanning with ultrasound\n• digital x-rays — superior quality to old film xrays and you can see the xray image within seconds on the farm!\n• endoscopy — scoping the airways etc\n• lameness work-ups\n• vaccinations\n• parasite control programs\n• insurance examinations\n• breed certification and DNA/blood typing\n• freeze branding\n• electrolyte drenches\n• IV drips for performance horses\n• foot balance problems\n\nand many more', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', '');
