  (83711, 'para-hills-veterinary-clinic-83711', 'Para Hills Veterinary Clinic', '', 'Para Hills Veterinary Clinic located in Para Hills specialises in allergies and skin problems treatment, diagnostic services, dentistry,puppy preschool, boarding and grooming, emergency care and more.', 272946, '2015-09-18 04:48:54', '2016-04-15 01:48:23', '', 191, 1972, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 272946, 0, '', 'info@parahillsvet.com.au', '0882584838', '', '', '', 'http://www.parahillsvet.com.au', 'Para Hills Veterinary Clinic is owned by Dr. Trudy Seidel. Since taking over the practice in 2007, Dr. Seidel has introduced many changes, including comprehensive pain relief protocols for all patients undergoing surgery, and invested in state-of-the-art technology for dental procedures, radiology, laboratory testing, anaesthetic monitoring and blood pressure. She is committed to serving the local community and providing pet owners like you with high-quality, affordable and personalized pet care.\n\nAt Para Hills Veterinary Clinic every patient and client is important to us. You are not just a name on a schedule or a file – you are a member of the community we serve, an individual with valued expectations, and a person who loves your pet. When you bring your beloved companion to our practice, you are being cared for by a family-owned and operated clinic, not a large, impersonal chain. We take the time to get to know you and create a personalized wellness plan for your pet based on his or her unique needs. We''re here for both of you at every stage of your relationship.\n\nYou can help ensure a lifetime of wellness for your pet with Para Hill Veterinary Clinic''s customized pet wellness care, which includes comprehensive examinations, vaccinations, preventive treatments and dental care. Identifying issues before they become serious is both the key to long-term good health and to keeping the lifetime cost of care as low as possible.\n\nAlong with our advanced conventional care, we also offer your pet acupuncture, an alternative, holistic approach that can restore the body''s balance and treat a range of problems without drugs.\n\nPara Hills Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Pet Wellness services\n• Health care services\n• Diagnostic services\n• Pet owner services\n• Surgical procedures\n• Pet dental care\n• Alternative healing\n• Boarding and grooming\n• Puppy preschool\n• Emergency services\n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/parahillsvet', 'https://twitter.com/ParaHillsVet', '', '', '', '', 'https://plus.google.com/102224208221195098420/about?hl=en'),
  (83714, 'elanora-veterinary-clinic-83714', 'Elanora Veterinary Clinic', '', 'Elanora Veterinary Clinic located in Elanora Heights specialises in vaccinations, preventative health care, parasite control, desexing, dental services, general anaesthesia and surgery and many more.', 219973, '2015-09-18 04:49:06', '2016-04-18 01:12:44', '', 191, 1728, 'pet care\ndog grooming\npet grooming\nanimal hospital\nveterinary clinic\npets\nvets', 219973, 0, 'Shop 2', 'elanoravet@bigpond.com', '0299706647', '', '', '0299705653', 'http://www.elanoravet.webs.com', 'Elanora Veterinary Clinic is a small animal practice offering friendly, professional care and advice for you and your furry friends.\n\nWe are located at 53 Kalang Road in the Elanora Heights Shopping Village, just off Powderworks Road.\n\nOur staff are a friendly team of animal lovers who are committed to helping pet owners provide the best possible care for their pets.\n\nElanora Veterinary Clinic is a general practice clinic offering friendly, personal care for your furry friends. We see cats and dogs of all shapes and sizes, as well as birds, rabbits, guinea pigs, ferrets and rats. Our services include:\n\n• Annual vaccinations and preventative health care\n• Parasite control (fleas, ticks, worms etc.)\n• Desexing\n• Dental Work\n• General anaesthesia and surgery\n• Dermatology\n• Acupuncture\n• Radiology\n• Cat grooming\n\nand more.', 'A', '{"1":[[0.3541666667,0.4583333333],[0.6666666667,0.7708333333]],"2":[[0.3541666667,0.4583333333],[0.6666666667,0.7708333333]],"3":[[0.3541666667,0.4583333333],[0.6666666667,0.7708333333]],"4":[[0.3541666667,0.4583333333],[0.6666666667,0.7708333333]],"5":[[0.3541666667,0.4583333333],[0.6666666667,0.7708333333]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/elanoravetclinic', '', '', '', '', '', ''),
  (83715, 'macquarie-animal-hospital-83715', 'Macquarie Animal Hospital', '', 'Macquarie Animal Hospital located in Campbelltown specialises in desexing, vaccinations, heartworm prevention, dental care, obesity management, parasite control and prevention and many more.', 275225, '2015-09-18 04:49:10', '2016-04-22 00:21:02', '', 191, 1162, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 275225, 0, '', 'enquiries@macquarieanimalhospital.com.au', '0246254518', '', '', '', 'http://www.macquarieanimalhospital.com.au', 'Macquarie Animal Hospital''s philosophy is pretty simple. We strive to provide the very best in patient care. However, at all times we are sensitive to the wishes of you, our client. We believe that this involves providing you with all of the options available for your pet.\n\nMacquarie Animal Hospital has been in operation since around 1971. The practice has been located in Queen St. Campbelltown for all of this time. Macquarie Animal Hospital is currently owned by Dr Shane Sullivan, who bought the practice from Dr Jim Driver in July 2005.\n\nDr Driver is one of the original Campbelltown Vets and is a distinguished member of the Veterinary profession. Dr Sullivan has felt privileged to "inherit" such a fine practice and is proud to be a Veterinarian in Campbelltown.\n\nWe at Macquarie Animal Hospital have always prided ourselves on personal care and attention to our clients, as well as our patients. We enjoy our work and value the patronage of our clients - as well as the antics of their furry friends.\n\nMacquarie Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Desexing\n• Vaccination\n• Heartworm prevention\n• Dental care\n• Obesity management\n• Parasite control and prevention\n• Arthritis management\n• Radiology\n• Anaesthesia\n\nand more.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', '', '', '', '', '', '', 'https://plus.google.com/113049073962071886509/about'),
  (83718, 'kirrawee-veterinary-hospital-83718', 'Kirrawee Veterinary Hospital', '', 'Kirrawee Veterinary Hospital located in Kirrawee  specialises in acupuncture, wildlife and exotic pet care, dermatology, ultrasound, radiology, surgery, behaviour management and many more.', 274867, '2015-09-18 04:49:22', '2016-04-19 06:11:11', '', 191, 1352, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 274867, 0, '', 'myvet@bigpond.net.au', '0295216422', '', '', '0295453174', 'http://www.kirraweevet.com.au', 'Kirrawee Veterinary Hospital was founded in 1976 by a team of veterinary surgeons and physicians committed to excellence in pet care. Our goal is to deliver the highest standard of veterinary medicine and surgery  to our patients. We are sensitive to the care and concern that each owner has for his or her pet. We serve the needs of our clients and their pets with our team of experienced veterinarians and nurses who aim to keep your pet healthy and you smiling. Our hospital was designed as a veterinary surgery by an architect, has the latest state-of-the-art equipment, provides an emergency service, and is open every day of the year.\n\nOur veterinary and nursing staff are trained in the most current medical and surgical procedures, attend the latest veterinary seminars and conferences, communicate with veterinary specialists and meet regularly to discuss and implement new treatments, ideas, and procedures to keep your pet happy and healthy. \n\nThe professional excellence of our veterinarians and nursing staff, combined with the newest medical and surgical equipment and advanced medical and surgical techniques, assures the best health care for your pet.\n\nKirrawee Veterinary Hospital has received numerous awards for excellence including:\n\nNominated yearly since 1998 for the small business of the year in the pet care category.\n\nSutherland Shire small business award: 1998, 1999, 2000, 2002, 2009, 2012, 2013.\n\nSutherland Shire business of the year award: 2012.\n\nASAVA Hospital of excellence award 2000 to 2016.\n\nKirrawee Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Acupuncture\n• Wildlife and exotic animal care\n• Dermatology\n• Oncology\n• Behavioural medicine\n• Ophthalmology\n• Radiology\n• Ultrasound\n• Surgical procedure\n• Intensive care\n\nand more.', 'A', '{"1":[[0.2916666667,0.8333333333]],"2":[[0.2916666667,0.8333333333]],"3":[[0.2916666667,0.8333333333]],"4":[[0.2916666667,0.8333333333]],"5":[[0.2916666667,0.8333333333]],"6":[[0.2916666667,0.7916666667]],"0":[[0.2916666667,0.7916666667]]}', 'https://www.facebook.com/KirraweeVetHospital', '', '', '', '', '', 'https://plus.google.com/101828120106365630505/about'),
  (83720, 'high-wycombe-vet-hospital-83720', 'High Wycombe Vet Hospital', '', 'High Wycombe Veterinary Hospital located in High Wycombe specialises in surgical procedures, x-rays, laboratory tests, hospitalistaion, dental treatment, microchipping and many more.', 271593, '2015-09-18 04:49:30', '2016-04-13 05:38:20', '', 191, 2420, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npet shops\npets\nvets', 271593, 0, '', 'reception@highwycombevet.com.au', '0894546915', '', '', '', 'http://www.highwycombevet.com.au', 'High Wycombe Vet Hospital think of your pet as part of your family, and we know how important that family member is to you. Our focus lies in being a Family Pet Practice that acknowledges the value of your pet as a much loved part of your family, so that when you need veterinary care for that special family member, we’re here to help. That’s what we do, that’s what we care about, and that’s what we’re good at. So when you come to our hospitals you can be assured of the best possible service and care every time. \n\nThe practice was initially established in 1981 at our Forrestfield location and we opened the High Wycombe premises in 1983, so we’ve been serving the vet needs of the local community for over 30 years and have a huge wealth of combined experience from our long term veterinary staff . Our team of dedicated vets and nurses led by Dr Neville Hoes and Dr Gavin Davison, pride ourselves on our high standard of veterinary medicine and surgery, but also on our high level of communication with you, so that not only do we do the best thing for your pet, but that you know what we are doing and why we are doing it. From the initial consultation, to explaining laboratory or Xray results, and at every step along the way, we take the time to explain your pets issues to you so that together, both of us can make the best possible decisions for your pets health.\n\nHigh Wycombe Vet Hospital offers a comprehensive range of veterinary and pet health-related services, including: \n\n• Veterinary consultations\n• Vaccinations\n• Sterilisations\n• Microchipping\n• Heartworm testing and prevention\n• General surgery\n• Cruciate ligament repairs\n• Fracture repairs\n• Dental treatment\n• Nail Clipping\n• Puppy Preschool Classes\n• Flea control and worming products and advice\n• Weight loss advice , programs and weigh ins\n• Shampoos, conditioners and coat care products\n• Grooming of matted cats\n• Premium Pet foods\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.5]],"0":[[0.5,0.5416666667]]}', '', '', '', '', '', '', 'https://plus.google.com/116283295260999148317/about'),
  (83722, 'northfield-veterinary-clinic-83722', 'Northfield Veterinary Clinic', '', 'Northfield Veterinary Clinic located in Northfield specialises in surgical procedure, consultations, vaccinations, behaviour and training advice, puppy school, aged pet care, dentistry and many more.', 272906, '2015-09-18 04:49:38', '2016-04-15 01:23:17', '', 191, 2015, 'pet care\nveterinary surgeons\nveterinary clinic\npet shops\npets\nvets', 272906, 0, '', 'admin@northfieldvetclinic.com.au', '0882626325', '', '', '', 'http://www.northfieldvetclinic.com.au', 'Northfield Veterinary Clinic are dedicated to the restoration and maintenance of the health of pets because we believe in the enormous benefit that animals bring to our lives. Vets, nurses and receptionists all have the same goal - a happy, healthy life for the pets in our care. We view ourselves as part of the pets extended family and we treat the animals that visit us as if they are our own - with love, compassion and care.\n\nWe encourage pet owners to adopt a healthy lifestyle for their pets including natural, balanced nutrition, exercise, behavioural enrichment and preventive health care. We utilise a whole-of-lifestyle approach in our veterinary practice to keep pets in good health and ensure a long, active and happy life.\n\nAt Northfield Veterinary Clinic we pride ourselves on our skill, experience and training - and on our inter-personal skills. Vets and nurses are highly valued contributors to our clinic and we provide a friendly and supportive work place to make the clinic an enjoyable place to be in for staff and for our clients. Importantly, this also ensures stability of staffing, which means that our clients know they will see the same trusted faces each time they visit the clinic.\n\nWe service the Inner North of Adelaide including the following suburbs: Northfield, Pooraka, Ingle Farm, Clearview, Walkley Heights, Blair Athol, Enfield, Northgate, Mawson Lakes, Manningham, Valley View, Broadview, Kilburn, Klemzig, Gepps Cross, Gilles Plains, Hillcrest, Oakden.\n\nNorthfield Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• consultations\n• vaccinations (3 year vaccines are given where appropriate)\n• surgery\n• behaviour and training advice\n• puppy school\n• dietary advice\n• aged pet care\n• radiology\n• dentistry\n• laboratory testing\n• ultrasound (a specialist visits the clinic)\n• preventive treatments (e.g. fleas, heartworm, gut worms, shampoos, etc.)\n• natural foods, good quality pet foods, training treats, etc.\n• accessories (e.g. leads, collars, carry cases, etc.)\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.4583333333]]}', '', '', '', '', '', '', 'https://plus.google.com/115865884883730224117/about'),
  (83724, 'south-burnett-veterinary-services-murgon-83724', 'South Burnett Veterinary Services - Murgon', '', 'South Burnett Veterinary Services located in Murgon specialises in health checks, vaccination, parasite control and prevention, dentistry, ultrasonography, radiography, surgery and many more.', 271565, '2015-09-18 04:49:46', '2016-04-13 05:17:24', '', 191, 2436, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 271565, 0, '', 'info@sbvets.com.au', '0741681277', '', '', '', 'http://www.sbvets.com.au', 'South Burnett Veterinary Services - Murgon Clinic provides professional, caring and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt South Burnett Veterinary Services - Murgon Clinic, you’ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical range we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit at South Burnett Vets Murgon, Kingaroy or Wondai.\n\nSouth Burnett Veterinary Services as been an integral part of our local community for 27 years. In that time, we’ve helped thousands of our clients cats & dogs, guinea pigs, birds, horses, cattle and even a few alpacas. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.\n\nSouth Burnett Veterinary Services - Murgon Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Dentistry\n• Ultrasonography\n• Radiography\n• Clinical Pathology\n• Desexing\n• Orthopaedic\n• Emergency procedure\n• Microchipping\n• Grooming and Hydrobath\n• Behavioural advice\n• Large animal service\n\nand more.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3541666667,0.4791666667]]}', 'https://www.facebook.com/South-Burnett-Veterinary-Services-241795839352835/', '', '', '', '', '', ''),
  (83727, 'east-port-veterinary-hospital-83727', 'East Port Veterinary Hospital', '', 'East Port Veterinary Hospital located in Port Macquarie specialises in vaccinations, desexing, heartworm prevention, weight loss programs, blood screening, nutrition advice, geriatric care and more.', 273695, '2015-09-18 04:49:58', '2016-04-18 00:38:53', '', 191, 1736, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 273695, 0, '', 'info@eastportvet.com', '0265835677', '', '', '', 'http://www.eastportvet.com', 'East Port Veterinary Hospital consists of seven veterinarians who are supported by eight dedicated nurses, veterinary receptionist, practice manager, pet groomer and hospital attendant.\n\nWe believe in working together, in alignment with our shared values, to provide you with excellent customer service and the latest in veterinary medicine.\n\nOur practice is fully computerised with the latest software to allow ready access to your pet’s medical records.\n\nOur state-of-the-art facilities allow us to provide complete health care for your family including preventative health care programs, general anaesthesia, radiology procedures, soft tissue & orthopaedic surgeries.\n\nEast Port Veterinary Hospital boasts recovery & intensive care, general, isolation & dog wards. We are very proud of our hospital so please call in and take a guided tour! Our staff would be more than happy to show you around.\n\nAt East Port Veterinary Hospital, our staff are always looking at ways to improve our care standards through continuing education. We also have a heavy focus on upholding the highest standards of health care within the veterinary industry.\n\nEast Port Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Desexing\n• Heartworm prevention\n• Weight loss program\n• Blood screening\n• Nutrition advice\n• Senior health programs\n• Complete flea and tick control\n• Puppy preschool\n• House calls\n• Dental service\n• Digital radiology\n• Ultrasonography\n• Stem cell therapy\n• Laboratory services\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/EastPortVet/', 'https://twitter.com/eastportvet', '', '', '', '', 'https://plus.google.com/109060305420143493667/about'),
  (83733, 'mosman-park-veterinary-hospital-83733', 'Mosman Park Veterinary Hospital', '', 'Mosman Park Veterinary Hospital located in Mosman Park specialises in surgical procedure, hospitalisation, laboratory tests, diagnostic imaging, boarding, emergency care services and many more.', 271750, '2015-09-18 04:50:22', '2016-04-13 23:30:48', '', 191, 2353, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271750, 0, '', 'admin@mosmanparkvet.com.au', '0893832285', '', '', '0893834107', 'http://www.mosmanparkvet.com.au', 'Mosman Park Veterinary Hospital  provides a highly skilled team of professionals and staff who are committed to the health and welfare of our patients and the prosperity of our clients, whilst constantly rising to the challenge of a continually changing environment. We care about you, your animals and your future.\n\nMosman Park Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Puppy preschool\n• Cat and dog boarding\n• Cat adoption\n• Emergency care services\n• Lost and found\n• Surgical procedures\n• Hospitalisation\n• Laboratory tests\n• Diagnostic imaging\n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.3333333333,0.625]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/MosmanParkVeterinaryHospital/timeline', '', '', '', '', '', ''),
  (83742, 'macarthur-veterinary-group-camden-clinic-83742', 'Macarthur Veterinary Group - Camden Clinic', '', 'Macarthur Veterinary Group - Camden Clinic located in Camden specialises in 24 hours emergency services, surgical procedure, wildlife and rescue, pet insurance, boarding, lost and found and more.', 222112, '2015-09-18 04:50:58', '2016-04-22 00:11:42', '', 191, 1166, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 222112, 0, '', 'camden@macarthurvet.com.au', '0246557664', '', '', '0246554139', 'http://www.macarthurvet.com.au/ContactUs/Camden/tabid/24089/Default.aspx#.VmfF-dIrK70', 'Macarthur Veterinary Group - Camden Clinic provide a full range of veterinary services for dogs and cats as well as birds, rabbits, ferrets, rats, mice etc. Our approach to the care of your pet is preventative health care - to ensure they remain in excellent health.\n\nIf you live in the Macarthur or greater Campbelltown regions rest assured your family pet is in the safe hands of our experienced, professional team. Your pet will receive the best possible care, so they live a long, happy, healthy life.\n\nSince our humble beginnings in the early 1990’s Macarthur Veterinary Group has been expanded to include four clinics – at Bradbury, Camden, Mt. Annan and Gregory Hills, all of which are A class hospitals. View our Opening Hours. Our veterinary team numbers over 15 with over 20 support staff, all motivated by their love of animals to care for your family pet as if it was their own.\n\nOur team is committed to high quality healthcare, veterinary medicine and surgery. To ensure this consistent high quality service we support every team members'' participation in ongoing education and external courses to constantly update their skills.\n\nMacarthur Veterinary Group - Camden Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Annual health checks\n• Vaccinations\n• Parasite control and prevention\n• Microchipping\n• Surgical procedures\n• Specialist referrals\n• Dental care\n• Senior pet care\n• Dietary advice\n• Boarding\n• Grooming\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7916666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.5]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/macarthurvet/timeline', '', '', '', '', '', 'https://plus.google.com/118387199392247579167/about'),
  (83743, 'king-street-veterinary-hospital-83743', 'King Street Veterinary Hospital', '', 'King Street Veterinary Hospital located in Murwillumbah specialises in consultations, surgical procedures, x-rays, ultrasound, pet dentistry, emergency care services, home visits and many more.', 274828, '2015-09-18 04:51:02', '2016-04-19 05:42:51', '', 191, 1362, 'pet wash\npet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274828, 0, '', 'kingsvet@tpg.com.au', '0266724322', '', '', '0266728192', 'http://www.kingstvets.com.au', 'King Street Veterinary Hospital strives to set the standard for quality in veterinary health care by providing you and your pets with outstanding service. Situated in Murwillumbah, NSW, our practitioners and staff pride themselves on delivering professional vet services to you and your pets.\n\nWe are much more than general practitioners but a fully equipped veterinary hospital. Some of our facilities include surgery, radiology, ultrasonography, dentistry and an in house laboratory.\n\nKing Street Veterinary Hospital offers a wide range of professional services for your pet. We are there to help you all the way from handy advice, training and care for your pets to more specialized hospital vet care.\n\nThe King Street Veterinary Hospital is the only veterinary hospital in Murwillumbah and provides pet services and products to a wide area from the coastal strip of Kingscliff through to Pottsville and inland to and including Nimbin.\n\nKing Street Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgery\n• X-rays\n• Ultrasound\n• Dentistry\n• Radiology\n• In-house laboratory\n• Home visits\n• Wildlife care\n• Exotic pet care\n• Desexing\n• Microchipping\n• Grooming and hydrobath\n• Puppy preschool\n• Senior pet care\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.72916