  (83747, 'the-lake-veterinary-hospital-83747', 'The Lake Veterinary Hospital', '', 'The Lake Veterinary Hospital located in Belmont specialises in surgical procedures, dental care, prevaentative health care, behaviour training, grooming and more.', 274911, '2015-09-18 04:51:19', '2016-04-19 06:40:40', '', 191, 1332, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 274911, 0, '', 'lakevet@lakevet.com.au', '0249459677', '', '', '', 'http://www.lakevet.com.au', 'The Lake Veterinary Hospital offers a very wide range of services, the latest technology and a wide range of equipment to cover most veterinary needs, plus access to specialists if required, and the combined experience of eight veterinarians with over 150 years of experience between them.\n\nLake Veterinary Hospitals’ three practices work closely together with a shared computer database and by sharing resources and equipment we are able to provide a very high standard of professional care.\n\nThe Lake Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgery\n• Intensive care\n• General anaesthetics\n• Dentistry\n• Radiography\n• Endoscopy\n• Desexing\n• Oncology\n• Microchipping\n• Ultrasound\n• Electrocardiography\n• Preventative health care\n• Behaviour training\n• Grooming\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3541666667,0.5]]}', 'https://www.facebook.com/lakevet', '', '', '', '', '', ''),
  (83752, 'goulburn-veterinary-clinic-83752', 'Goulburn Veterinary Clinic', '', 'Goulburn Veterinary Clinic located in Goulburn specialises in health checks, vaccination, dental care, parasite control and prevention, desexing, microchipping, boarding advice and many more.', 274156, '2015-09-18 04:51:39', '2016-04-18 06:28:50', '', 191, 1596, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274156, 0, '', 'mail@goulburnvetclinic.com.au', '0248221533', '', '', '', 'http://www.goulburnvetclinic.com.au', 'Goulburn Veterinary Clinic provides modern, professional and affordable health care for your pets. Our aim is to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff of of respected veterinarians and nurses are all passionate about pets and avid animal lovers.\n \nAt Goulburn Veterinary Clinic, we will support you and your pet with the best and most up-to-date advice that we can give you. We know that helping our clients starts with providing a good understanding of health care issues as well as treatment and preventative options. With good advice and professional recommendations, we think you’ll be well equipped to make the best ongoing health care decisions for your pets. We firmly believe that all animals deserve equal care and attention.   \n \nWith fully equipped examination rooms, diagnostic machines and a comprehensive pharmacy we can provide on-the-spot assistance for nearly all pet health, medical and surgical needs. We also have a web of supporting veterinary specialists to whom we can refer to and although we do offer a 24 hour emergency service we also have the back-up of an after-hours emergency clinic in the Animal Emergency Centre Canberra.\n\nGoulburn Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Dental care\n• Surgical procedures\n• Microchipping\n• Boarding\n\nand more.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/goulburnvetclinic/', '', '', '', '', '', ''),
  (83754, 'riverland-veterinary-practice-83754', 'Riverland Veterinary Practice', '', 'Riverland Veterinary Practice located in Berri specialises in consulations, parasite control and prevention, dietary advice, surgical procedures and many more.', 273265, '2015-09-18 04:51:47', '2016-04-15 05:13:49', '', 191, 1868, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273265, 0, '', 'riverlandvet@rivvet.com.au', '0885821222', '', '', '', 'http://www.riverlandvet.com.au', 'Riverland Veterinary Practice understand what an important role our pets play in our lives.  We are therefore committed to providing outstanding care to all of our patients.\n\nIt is our goal to maintain and encourage the "Human-Companion Animal Bond" that so many of us are privileged to share.\n\nRiverland Veterinary Practice offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• After Hours Emergency Service\n• Advanced diagnostics including ultrasound, endoscopy and digital xrays\n• Dental Procedures\n• Orthopaedic prodedures (e.g. fracture repair, cruciate ligament repair)\n• Surgery (emergency and routine procedures)\n• In-house labartory tests (e.g. blood samples, urinalysis, SNAP tests)\n• House calls\n• Puppy clasess\n• A range of premium products including food, flea and worming\n• Wide range of premium food products, toys and many items for treatment of fleas, worms, ticks etc\n', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.5208333333]]}', 'https://www.facebook.com/RiverlandVeterinaryPractice', '', '', '', '', '', ''),
  (83760, 'payneham-veterinary-centre-83760', 'Payneham Veterinary Centre', '', 'Payneham Veterinary Centre located in Payneham specialises in boarding, in-house laboratory, radiology, cancer treatments, pet products, dentistry, surgery, weight control management and many more.', 273042, '2015-09-18 04:52:11', '2016-04-15 02:26:48', '', 191, 1943, 'pet care\nveterinary surgeons\nveterinary hospital\npet shops\npets\nvets', 273042, 0, '', 'admin@paynehamvetcentre.com.au', '0883620831', '', '', '0883628340', 'http://www.paynehamvetcentre.com.au', 'Payneham Veterinary Centre has been part of the local community for many years. Originally called the Avenue Road Veterinary Clinic the practice was a large animal practice located on Avenue road in the middle of farm land! From its inception in the fifties, the practice became ever more small animal focused, as houses grew around it. Kylie moved the practice to our present location in 2001.\n\nToday Payneham Veterinary Centre prides itself in delivering excellent care for your pets, in a friendly environment, where we like to get to know our clients and patients personally.\n\nOur guiding principles are straight forward - to provide the best possible veterinary care, by providing you with the information needed to make informed decisions.\n\nPayneham Veterinary Centre believes that prevention is better than cure, and insist that every member of the clinic is continually updating their knowledge. This will ensure you are offered only the best possible advice.\n\nPlease feel free to contact us, or drop in, if you would like more information about your pet, or our practice.\n\nPayneham Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Boarding\n• In house laboratory\n• Radiology\n• Cancer treatments\n• Diets\n• Free dietary advice\n• Pet products\n• Dentistry\n• Pre-anaesthetic blood tests\n• Surgery\n• Weight control\n• Cat boarding facilities\n\nand more.', 'A', '{"