  (83762, 'warwick-town-country-vets-83762', 'Warwick Town & Country Vets', '', 'Warwick Town & Country Vets located in Warwick specialises in dental checks, hospitalisation, nursing care, nutrition counselling, obedience training, preventative medicine and many more.', 271299, '2015-09-18 04:52:19', '2016-04-13 00:43:13', '', 191, 2524, 'pet wash\npet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 271299, 0, '', 'info@warwicktownandcountryvets.com', '0746611132', '', '', '', '', '', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/warwicktownandcountryvets/', '', '', '', '', '', ''),
  (83764, 'warnbro-veterinary-hospital-83764', 'Warnbro Veterinary Hospital', '', '', 272366, '2015-09-18 04:52:27', '2016-04-14 06:35:11', '', 191, 2200, 'veterinary hospital\npets\nvets', 272366, 0, '', 'vetmanager@bigpond.com', '0895931797', '', '', '', '', '', 'A', '{"1":[[0.3541666667,0.7708333333]],"2":[[0.3541666667,0.7708333333]],"3":[[0.3541666667,0.7708333333]],"4":[[0.3541666667,0.7708333333]],"5":[[0.3541666667,0.7708333333]],"6":[[0.3541666667,0.7708333333]],"0":[[0.3541666667,0.7708333333]]}', 'https://www.facebook.com/Warnbro-Veterinary-Hospital-442313862447515/', '', '', '', '', '', 'https://plus.google.com/114658426125755095792/about'),
  (83765, 'kingsley-veterinary-hospital-83765', 'Kingsley Veterinary Hospital', '', 'Kingsley Veterinary Hospital located in Kingsley specialises in consultations, surgical procedure, dental procedures, laboratory tests, radiology and more.', 271639, '2015-09-18 04:52:31', '2016-04-13 06:35:39', '', 191, 2397, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271639, 0, '', 'kingsleyvet@gmail.com', '0894096855', '', '', '', 'http://www.kingsleyvet.com', 'Kingsley Veterinary Hospital''s staff are all animal lovers and between us care for pets ranging from ferrets to a Great Dane and bouncing puppies to wise old geriatrics! Yet we also realise that our relationship with you , the pets'' owner, is an essential one. We have been present in Kingsley for over 25 years and have a long established bond with the local community and with our clientele. We know that it is important to feel that you have a clinic that you can come to that is familiar and can provide the best quality care. \n\nWe offer both preventative medicine, encouraging routine health checks, as well as surgical facilities and emergency treatment for sick patients. Most treatments can be performed in house to save time, however we also have strong relationships with a number of specialist centres for more complicated procedures. \n\nOur vets are all trained and qualified in Perth, have travelled extensively and have a strong commitment to on-going professional development. We back this up by constantly upgrading our facilities to offer the best levels of care. Our nursing and support staff have been with us for a long time, a reflection of their commitment to the pets of Kingsley and to you their owners.\n\nKingsley Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgery\n• Dental procedures\n• Emergency care\n• Laboratory tests\n• Radiology\n• Pharmacy\n\nand more', 'A', '{"1":[[0.3125,0.7916666667]],"2":[[0.3125,0.7916666667]],"3":[[0.3125,0.7916666667]],"4":[[0.3125,0.7916666667]],"5":[[0.3125,0.7916666667]],"6":[[0.3333333333,0.5208333333]]}', 'https://www.facebook.com/Kingsley-Veterinary-Hospital-853187788068122/', '', '', '', '', '', ''),
  (83780, 'killara-veterinary-hospital-83780', 'Killara Veterinary Hospital', '', 'Killara Veterinary Hospital located in Killara specialises in general consultation, surgical procedures, desexing, vaccination, skin disease treatment, parasite control and prevention and many more.', 0, '2015-09-18 04:53:32', '2016-04-19 05:22:11', '', 191, 1372, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 0, 0, '', 'drmkalil@hotmail.com', '0294994900', '', '', '', '', '', 'A', '{"1":[[0.3541666667,0.7708333333]],"2":[[0.3541666667,0.7708333333]],"3":[[0.3541666667,0.7708333333]],"4":[[0.3541666667,0.7708333333]],"5":[[0.3541666667,0.7708333333]],"6":[[0.3541666667,0.6458333333]]}', '', '', '', '', '', '', 'https://plus.google.com/118057166078278616813/about'),
  (83788, 'third-avenue-veterinary-surgery-83788', 'Third Avenue Veterinary Surgery', '', 'Third Avenue Veterinary Surgery located in Sandgate specialises in small animal veterinary medicine, surgical procedures, digital radiographic imaging, dentistry, microchipping and many more.', 270863, '2015-09-18 04:54:04', '2016-04-12 05:27:16', '', 191, 2663, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 270863, 0, '', 'info@tavs.com.au', '0738693347', '', '', '', 'http://www.tavs.com.au', 'Third Avenue Veterinary Surgery have a modern, fully equipped veterinary surgery, providing everything from routine health care such as vaccinations, through to managing complex illnesses. Our surgery is equipped with full dental and surgical facilities as well as in-house laboratory and radiology capabilities.\n\nThe staff at Third Avenue Veterinary Surgery at Sandgate 4017 are committed to a practice that focuses on providing high quality and compassionate care for its patients, and a welcoming and accessible environment for their human friends.\n\nThe clinic consults closely with specialists in all aspects of medicine and surgery so far as to offer optimum health care recommendations for all our patients, servicing Sandgate, Brighton, Deagon, Shorncliffe, Bracken Ridge, Woody Point, Clontarf, Fitzgibbon, Griffin, Taigum, Boondall, Banyo, Nudgee, Redcliffe, Scarborough, Newport, Kippa-Ring and other neighbouring suburbs.\n\nThird Avenue Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n♦ Soft tissue surgery\n♦ Orthopaedic surgery\n♦ Small animal veterinary medicine\n♦ Digital radiographic imaging\n♦ Hospitalisation facilities\n♦ Specialist referral\n♦ Dentistry\n♦ Pharmacy\n♦ In-house pathology and blood analysis facilities\n♦ In-house cytology for assessment of lumps, skin and ears\n♦ Senior pet care programs\n♦ Preventative health care programs\n♦ Vaccinations\n♦ Microchipping\n♦ Pet care products\n♦ Preparation of pets for export overseas \n\nand more.', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/tavs14/', '', '', '', '', '', 'https://plus.google.com/105808646969864973038/photos'),
  (83792, 'pet-universe-veterinary-centre-83792', 'Pet Universe Veterinary Centre', '', 'Pet Universe Veterinary Centre located in Manningham specialises in vaccinations, desexing, microchipping, weight loss program, routine and advanced surgery, intensive pet care, puppy school and more.', 273072, '2015-09-18 04:54:20', '2016-04-15 02:49:26', '', 191, 1921, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 273072, 0, '', 'petuniversevet@gmail.com', '0882664666', '', '', '0882664611', 'http://www.petuniverse.com.au', 'Pet Universe Veterinary Centre is a family-run veterinary clinic that has been operating for over 10 years in Adelaide’s northern suburbs.\n\nOur vet centre is friendly, caring and professional, helping to ease your pet’s fears – and your own.  On top of excellent veterinary care, we also provide relaxing background music, gentle handling, an optimum pain-relief policy and lots of treats & fuss!\n\nPet Universe Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Desexing\n• Microchipping\n• Routine & advanced surgery\n• Routine & advanced medicine\n• Routine & advanced dentistry\n• Intensive care facilities\n• In-house flexible fibre-optic endoscopy, ultrasound & ECG\n• In-house laboratory\n• Skin Allergy Clinic\n• Second Opinion Service (we can obtain pet records from previous practice)\n• GP Referral Service (practice referrals from all over South Australia)\n• Acupuncture\n• Stem cell therapy\n• Behavioural counselling\n• Cat & dog clipping & grooming\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.5416666667]],"0":[[0.4166666667,0.6875]]}', 'https://www.facebook.com/Pet-Universe-117779078266601/', 'https://twitter.com/PetUniverse01', '', '', '', '', 'https://plus.google.com/117447465198982683257/about'),
  (83797, 'holden-hill-vet-clinic-83797', 'Holden Hill Vet Clinic', '', 'Holden Hill Vet Clinic located in Holden Hill specialises in vaccinations, nutritional advice, parasite prevention, micro chipping, dentistry, weight loss program, surgical procedures and many more.', 272766, '2015-09-18 04:54:41', '2016-04-14 23:27:01', '', 191, 2085, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272766, 0, '', 'holdenhillvet@optusnet.com.au', '0883692299', '', '', '', 'http://www.theholdenhillvet.com.au', 'Holden Hill Vet Clinic have been working to create a friendly, family practice for over ten years.. With the support of a friendly and well trained nursing team we have achieved our major goal - to practice high quality veterinary medicine without losing touch with our clients.\n\nWe feel very lucky to be in a profession where we can bring our love of animals to work with us every day. \n\nThe clinic provides a full range of medical and diagnostic services for small animals, including digital Xray, ultrasound and dental facilities - we manage to fit a lot into a small building! We deal with a full spectrum of animal health problems, from skin complaints to bone surgery, and we are happy to see birds, rabbits and pocket pets as well as dogs and cats.\n\nHolden Hill Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccination\n• Nutritional advice\n• Microchipping\n• Parasite control and prevention\n• Microchipping\n• Weight loss program\n• Surgical procedure\n• Laboratory tests\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/HoldenHillVet/', '', '', '', '', '', ''),
  (83800, 'edgeworth-animal-medical-centre-83800', 'Edgeworth Animal Medical Centre', '', 'Edgeworth Animal Medical Centre located in Edgeworth specialises in surgery, radiology, laboratory, dentistry, wellness and vaccinations, exotic pet care, puppy preschool and many more.', 273711, '2015-09-18 04:54:53', '2016-04-18 01:04:56', '', 191, 1730, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 273711, 0, '', 'info@edgeworthanimalmedical.com.au', '0249581800', '', '', '0249581900', 'http://edgeworthanimalmedical.com.au', 'Edgeworth Animal Medical Centre is an owner operated three vet practice, established in February 2014.\n\nKimberley, Nicole and Perin met while studying Veterinary Science through the University of Sydney and had an ambitious dream of one day opening a practice together. After nine years working on three different continents, the girls all came to work in Newcastle and planning for Edgeworth Animal Medical Centre commenced.\n\nOpening the doors on a custom fitted and well equipped hospital was a proud day, but watching the business grow and getting to know our clients, their pets and families has been much more rewarding. Each partner brings different experiences and interests to business, allowing the hospital to offer a comprehensive veterinary service for family pets throughout their lives.\n\nOur staff offer a significant level of expertise and interest in exotic pets (birds, reptiles, rabbits, guinea pigs and rodents) which is supported with specialised equipment, medication and accommodation for these species.\n\nEdgeworth Animal Medical Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgery\n• Radiology\n• Laboratory\n• Dentistry\n• Hospitalisation\n• Wellness and vaccinations\n• Exotic pet care\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3541666667,0.7708333333]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7708333333]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5208333333]],"0":[[0.625,0.7083333333]]}', 'https://www.facebook.com/edgeworthanimalmedicalcentre', '', '', '', '', '', 'https://plus.google.com/102140070085385522990/about');
