  (83801, 'strathpine-veterinary-surgery-83801', 'Strathpine Veterinary Surgery', '', 'Strathpine Veterinary Surgery located in Lawnton specialises in general health checks, vaccinations, parasite control and prevention, surgery, radiology, dental care, puppy preschool and many more.', 270619, '2015-09-18 04:54:57', '2016-04-12 01:59:04', '', 191, 2739, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 270619, 0, '', 'admin@strathpinevet.net.au', '0732855211', '', '', '', 'http://www.strathpinevet.com.au', 'Strathpine Veterinary Surgery is a small, locally operated and family-run business in Lawnton, providing a broad range of general veterinary care. Our speciality is preventative healthcare to keep your pet happy and healthy. We want to do everything we can to ensure your family gets to spend quality time in the company of your beloved pet.\n\nHere at Strathpine Veterinary Surgery, we pride ourselves on giving your pet the best possible care. We understand that a pet is not just an animal, but a very special member of your family. Our medical team members are not only highly-qualified vets but animal lovers too! We are always happy to discuss your pet''s needs in plain English and provide a warm and friendly environment for your best friend.\n\nOur veterinary services in Lawnton have deep roots within our local community. We always like to see animals we have treated again, as we are firm believers in the importance of health maintenance. For example, regular toenail clipping, flea and de-worming treatments can all help to prevent more serious health issues for your pet in later life. We can also advise you on the most appropriate natural diet regime for your animal. As with humans, good nutrition is crucial for ensuring good health for your pet.\n\nEveryone here at Strathpine Veterinary Surgery strives to ensure that our vet services for Lawnton are of the highest standards. We invest in a continuous professional development programme to keep our knowledge and skills up-to-date. Our goal is to provide your pet with the good bill of health they deserve.\n\nStrathpine Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks and vaccinations\n• Nail clipping\n• Flea, tick and other parasite protection\n• Surgery (de-sexing and routine procedures)\n• X-rays\n• Radiology\n• Dental care\n• Pathology lab tests\n• Puppy pre-school\n• Training advice\n• Natural pet care\n• Dietary advice\n\nand more.', 'A', '{"1":[[0.3333333333,0.7708333333]],"2":[[0.3333333333,0.7708333333]],"3":[[0.3333333333,0.7708333333]],"4":[[0.3333333333,0.7708333333]],"5":[[0.3333333333,0.7708333333]],"6":[[0.3541666667,0.5833333333]]}', '', '', '', '', '', '', 'https://plus.google.com/100818467747465047070/about'),
  (83803, 'hurlstone-park-veterinary-hospital-83803', 'Hurlstone Park Veterinary Hospital', '', 'Hurlstone Park Veterinary Hospital located in Dulwich Hill specialises in surgical procedures, diagnostic pathology, dentistry, radiology, acupuncture, puppy training, vaccinations and many more.', 274620, '2015-09-18 04:55:05', '2016-04-19 01:38:08', '', 191, 1453, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 274620, 0, '', 'hpvets@optusnet.com.au', '0295584181', '', '', '0295589483', 'http://www.hurlstoneparkveterinaryhospital.com.au', 'Hurlstone Park Veterinary Hospital love caring for your pets. Our dedicated, highly trained staff are committed to the health and happiness of your special friend. Our aim is to ensure that you receive the highest quality veterinary health care and advice. At our veterinary hospital we strive to promote a warm, friendly environment for you and your special pets.\n\nWe are fortunate to have keen, experienced, and dedicated staff working here. Our team of vets include: Michael Kidd, Belinda Cheung, Ben Rochester, Amelia Fung, Susan McLeish, Edelicia Lopez, Lydia Brichta and Di Sparshott. \n\nTo assist our team of vets we have a well trained and enthusiastic team of veterinary nurses including: Louise Bray, Tara Gedra, Lana Mansour, and Amanda Luksich. All four are fully qualified, achieving their Certificate IV in Veterinary Nursing from TAFE after 3 years of training. They combine their innate love of animals with their professional ability to ensure the safety, comfort and welfare of our clients valuable pets.\n\nHurlstone Park Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgical procedures\n• Diagnostic Pathology services\n• External laboratory\n• Hospitalisation\n• Dentistry\n• Referral to specialist veterinarians\n• Radiology\n• Acupuncture\n• Puppy training\n• Microchipping\n• Vaccination\n• Dietary advice\n• Nutritional advice\n• Geriatric care\n• Boarding\n\nand more.', 'A', '{"1":[[0.3958333333,0.5],[0.625,0.6666666667],[0.75,0.8125]],"2":[[0.3958333333,0.5],[0.625,0.6666666667],[0.75,0.8125]],"3":[[0.3958333333,0.5],[0.625,0.6666666667],[0.75,0.8125]],"4":[[0.3958333333,0.5],[0.625,0.6666666667],[0.75,0.8125]],"5":[[0.3958333333,0.5],[0.625,0.6666666667],[0.75,0.8125]],"6":[[0.3958333333,0.5]],"0":[[0.3958333333,0.5]]}', 'https://www.facebook.com/Hurlstoneparkvet', '', '', '', '', '', 'https://plus.google.com/+DulwichhillvetAu/about'),
  (83804, 'hamilton-veterinary-clinic-83804', 'Hamilton Veterinary Clinic', '', 'Hamilton Veterinary Clinic located in Hamilton specialises in boarding, desexing, dentistry, ultrasound, digital x-ray, surgical procedure, oncology, puppy preschool and many more.', 274522, '2015-09-18 04:55:09', '2016-04-19 00:36:03', '', 191, 1479, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274522, 0, '', 'admin@hamiltonvet.com.au', '0240361316', '0249696852', '', '', 'http://www.hamiltonvet.com.au', 'Hamilton Veterinary Clinic offers a comprehensive range of pet care including veterinary services, pet boarding, dog and cat grooming, puppy training as well as nutrition and a wide range of product support for your pet.\n\nWe are open and available to care for your pet 7 days a week all year round! We also offer an after hours service during the week till 10pm!\n\nHamilton Vet Clinic’s motto is “Passionate Pet People” and our large team of dedicated staff are enthusiastic in delivering the highest quality of modern veterinary care to your beloved pets.\n\nChris McClelland is the owner and practicing senior veterinarian of Hamilton Veterinary Clinic and has been caring for pets of the Newcastle region for over 30 years. HVC has been established now for over 22 years and Chris is closely supported by our dedicated team and is the driving force behind our pursuit to achieve outstanding client and patient service standards.\n\nHamilton Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Boarding\n• Desexing\n• Dentistry\n• Ultrasound\n• Digital X-ray\n• Chemotherapy\n• Surgical procedure\n• Puppy preschool\n• Puppy and kitten care\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3541666667,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/pages/Hamilton-Veterinary-Clinic/172988536079854', '', '', '', '', '', 'https://plus.google.com/102218476353338763537/about'),
  (83805, 'rose-park-vet-83805', 'Rose Park Vet', '', 'Rose Park Vet located in Rose Park specialises in health checks, emergency care, parasite control, pharmacy, surgical procedure, dentistry, radiology, laboratory tests, microchipping and many more.', 273279, '2015-09-18 04:55:13', '2016-04-15 07:11:47', '', 191, 1790, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 273279, 0, '', 'office@roseparkvet.com.au', '0883644200', '', '', '0883644250', 'http://www.roseparkvet.com.au', 'Rose Park Vet''s team are passionate about pets and recognise the value of your pet to your family unit.\n\nRose Park Vet consider it a privilege to be a part of this family pet bond and are committed to providing the highest quality veterinary care in a professional, comfortable and caring environment.\n\nAs well as treating the sick and injured, we place equal importance on preventative health care, to ensure that you and your pet enjoy many happy, healthy years together.\n\nRose Park Vet offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• General care\n• Vaccinations\n• Seniors checks\n• Emergency Care\n• Parasite Control \n• Pharmacy\n• Desexing\n• Soft Tissue surgery\n• Lump removals\n• Abdominal surgery\n• Orthopaedic surgery\n• Dentistry\n• Radiology\n• Laboratory testing\n• Microchipping \n• Puppy Preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/roseparkvet', '', '', '', '', '', 'https://plus.google.com/106081482080731049120/about'),
  (83806, 'padbury-vet-clinic-83806', 'Padbury Vet Clinic', '', 'Padbury Vet Clinic located in Padbury specialises in advanced surgical procedures, behaviour consultations, boarding, complete companion animal care, dentistry, diagnostic service and many more.', 271788, '2015-09-18 04:55:17', '2016-04-14 00:27:51', '', 191, 2331, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271788, 0, '', 'padburyvetclinic@aapt.net.au', '0893078811', '', '', '0893078818', '', '', 'A', '{"1":[[0.3541666667,0.7916666667]],"2":[[0.3541666667,0.7916666667]],"3":[[0.3541666667,0.7916666667]],"4":[[0.3541666667,0.7916666667]],"5":[[0.3541666667,0.7916666667]],"6":[[0.375,0.5833333333]]}', '', '', '', '', '', '', ''),
  (83807, 'macarthur-veterinary-group-bradbury-clinic-83807', 'Macarthur Veterinary Group - Bradbury Clinic', '', 'Macarthur Veterinary Group - Bradbury Clinic located in Bradbury specialises in 24 hours emergency services, surgical procedure, wildlife and rescue, pet insurance, boarding, lost and found and more.', 222084, '2015-09-18 04:55:21', '2016-04-22 00:11:11', '', 191, 1169, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 222084, 0, '', 'bradbury@macarthurvet.com.au', '0246271333', '', '', '0246273301', 'http://www.macarthurvet.com.au/ContactUs/Bradbury/tabid/24087/Default.aspx#.VmfEt9IrK71', 'Macarthur Veterinary Group - Bradbury Clinic provide a full range of veterinary services for dogs and cats as well as birds, rabbits, ferrets, rats, mice etc. Our approach to the care of your pet is preventative health care - to ensure they remain in excellent health.\n\nIf you live in the Macarthur or greater Campbelltown regions rest assured your family pet is in the safe hands of our experienced, professional team. Your pet will receive the best possible care, so they live a long, happy, healthy life.\n\nSince our humble beginnings in the early 1990’s Macarthur Veterinary Group has been expanded to include four clinics – at Bradbury, Camden, Mt. Annan and Gregory Hills, all of which are A class hospitals. View our Opening Hours. Our veterinary team numbers over 15 with over 20 support staff, all motivated by their love of animals to care for your family pet as if it was their own.\n\nOur team is committed to high quality healthcare, veterinary medicine and surgery. To ensure this consistent high quality service we support every team members'' participation in ongoing education and external courses to constantly update their skills.\n\nMacarthur Veterinary Group - Bradbury Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Annual health checks\n• Vaccinations\n• Parasite control and prevention\n• Microchipping\n• Surgical procedures\n• Specialist referrals\n• Dental care\n• Senior pet care\n• Dietary advice\n• Boarding\n• Grooming\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3541666667,0.7916666667]],"2":[[0.3541666667,0.7916666667]],"3":[[0.3541666667,0.7916666667]],"4":[[0.3541666667,0.7916666667]],"5":[[0.3541666667,0.7916666667]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/macarthurvet/timeline', '', '', '', '', '', 'https://plus.google.com/115031380323464793244/about'),
  (83823, 'mt-lawley-inglewood-vet-centre-83823', 'Mt Lawley & Inglewood Vet Centre', '', 'Mt Lawley & Inglewood Vet Centre located in Inglewood specialises in health checks, vaccinations, parasite control and prevention, dentistry, radiography, ultrasonography, surgical procedure and more.', 271762, '2015-09-18 04:56:25', '2016-04-13 23:42:24', '', 191, 2347, 'pet care\nveterinary surgeons\npet grooming\nanimal hospital\npets\nvets', 271762, 0, '', 'contact@yourpetsvet.com.au', '0892713671', '', '', '', 'http://www.yourpetsvet.com.au', 'Mt Lawley & Inglewood Vet Centre provides professional and gold standard health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt the Mt Lawley & Inglewood Vet Centre, you’ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped medical and surgical facilities, diagnostic machines and pharmacy we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nOur fully-equipped veterinary hospital has been caring for the local community for over 20 years, providing a variety of services to our family of clients, including canine, feline, and exotic animal medicine, surgery and dental care.The Mt Lawley Vet Clinic on Railway Parade was first acquired by Dr Scott Read in 1992 . Inglewood Vet Centre was set-up subsequently as a branch clinic. Both practices rapidly expanded and eventually were merged in 1999 and the practice moved to its current purpose-built veterinary premises at the corner of Beaufort Street and Central Avenue in Inglewood.\n\nOur veterinarians are continually researching and educating ourselves on the latest advancements in veterinary medicine to benefit our patients and we are committed to providing your pet with the highest standards of veterinary care. Our hospital utilizes the expertise of our veterinarians and well-trained nurses in conjunction with veterinary specialists and consultants to offer the most up-to-date, caring and compassionate veterinary medical care possible for our clients and pets. Our staff includes four full-time veterinarians, a support team of veterinary nurses, and a practice manager.\n\nMt Lawley & Inglewood Vet Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Parasite control and prevention\n• Dentistry\n• Radiography\n• Ultrasonography\n• Clinical Pathology\n• Pet insurance\n• Surgery\n• Behaviour advice\n• Grooming service\n\nand many more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/yourpetsvet', '', '', '', '', '', ''),
  (83825, 'lismore-central-vet-hospital-83825', 'Lismore Central Vet Hospital', '', 'Lismore Central Vet Hospital located in Lismore specialises in advanced surgical procedures, behaviour consultations, complete companion animal care, dentistry, exotic pet care, diagnostics and more.', 0, '2015-09-18 04:56:33', '2016-04-21 06:14:41', '', 191, 1240, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 0, 0, '', 'admin@lismorecentralvet.com.au', '0266220044', '', '', '0266220160', '', '', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3541666667,0.5]],"0":[[0.375,0.4166666667]]}', 'https://www.facebook.com/LismoreCentralVeterinaryHospital/', '', '', '', '', '', ''),
  (83827, 'naracoorte-penola-veterinary-centres-83827', 'Naracoorte & Penola Veterinary Centres', '', 'Naracoorte & Penola Veterinary Centres located in both Naracoorte & Penola specialises in parasite control, vaccination, 24 hour emergency services, pet grooming, puppy preschool and many more.', 272876, '2015-09-18 04:56:41', '2016-04-15 00:59:42', '', 191, 2036, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 272876, 0, '', 'vets@npvet.com.au', '0887621955', '', '', '0887620055', 'http://www.npvet.com.au', 'Naracoorte and Penola Veterinary Centres strives to offer a friendly, caring and professional service whilst providing the highest quality in Veterinary Medical Care for all types of animals, both large and small.\n\nNaracoorte & Penola Veterinary Centres offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Parasite Control\n• Vaccination\n• Desexing\n• Blood Testing\n• Investigation and treatment for lameness problems including fracture repair, hip and knee problems.\n• Hospital facilities including seperate cat and dog wards\n• Diagnostic imaging including endoscopy, ultrasound and x-rays.\n• Behavioural problems\n• 24 hour emergency service\n• Dentistry\n• Allergy control\n• Pet Grooming\n• Puppy Pre-School\n• Equine services\n• Production animal services\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/npvet/', '', '', '', '', '', ''),
  (83829, 'riverton-rossmoyne-vet-hospital-83829', 'Riverton Rossmoyne Vet Hospital', '', 'Riverton Rossmoyne Vet Hospital located in Riverton specialises in consultations, preventative health care, microchipping, surgical procedures, digital radiography, puppy class and many more.', 271888, '2015-09-18 04:56:49', '2016-04-14 01:39:11', '', 191, 2277, 'pet care\nveterinary surgeons\nveterinary hospital\npet shops\npets\nvets', 271888, 0, '', 'rivervet@westnet.com.au', '0894573409', '0894572460', '', '', 'http://www.rivertonvet.com.au', 'Riverton Rossmoyne Vet Hospital is a long established veterinary practice in Perth treating many pets including dogs, cats, birds, rabbits, mice and guinea pigs. For many people, their pet is their best friend. So understandably you want the best care possible for your beloved pet.\n\nOur friendly and experienced staff will give your pet the attention they deserve, ensuring the finest in veterinary care.\n\nWe are conveniently located in Riverton on the corner of Vahland Avenue and High Road and have ample shady parking available. This makes us easily accessible for clients living in Riverton, Rossmoyne, Willetton, Shelley, Wilson, Lynwood, Parkwood, Bull Creek and surrounding suburbs.\n\nRiverton Rossmoyne Vet Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Parasite control\n• Microchipping\n• Emergency care services\n• Desexing\n• Orthopaedic surgery\n• Dentistry\n• Digital radiography\n• Puppy classes\n• Weight loss programs\n\nand more.', 'A', '{"1":[[0.3125,0.7916666667]],"2":[[0.3125,0.7916666667]],"3":[[0.3125,0.7916666667]],"4":[[0.3125,0.7916666667]],"5":[[0.3125,0.7916666667]],"6":[[0.3541666667,0.625]],"0":[[0.3958333333,0.5]]}', 'https://www.facebook.com/rivertonrossmoynevet/', '', '', '', '', '', ''),
  (83832, 'jonora-animal-hospital-83832', 'Jonora Animal Hospital', '', 'Jonora Animal Hospital located in North Richmond specialises in digital radiography, ultrasound, ECG, dentistry, blood tests, laser therapy and more.', 274712, '2015-09-18 04:57:01', '2016-04-19 02:36:28', '', 191, 1423, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 274712, 0, '', '', '0245797155', '', '', '', 'http://www.jonoravet.com.au/', 'Jonora Animal Hospital provides a local, modern, professional,and compassionate approach to veterinary medicine and surgery. Our clients come from all over The Hawkesbury including the Kurrajong, Grose Vale, Bowen Mountain, North Richmond, Kurmond, Bilpin, Glossodia, Freemans Reach, Wilberforce and Ebenezer areas. \n\nJonora Animal Hospital''s aim is to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff of veterinary surgeons and nurses are all passionate about pets and are avid animal lovers. With 5 veterinary surgeons on staff we are able to offer a level of clinical excellence second to none. Starting in 2013 we will have visiting specialists for referral cases to save you a long trip into the city. In 2014, we were awarded the ''Hawkesbury Local Business Award''  for ''Outstanding Pet Care''.\n\nJonora Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Emergency care service\n• Puppy preschool\n• Pet boarding\n• Digital radiography\n• Ultrasound\n• ECG\n• Dentistry\n• Blood tests\n• Laser therapy\n\nand more.', 'A', '{"1":[[0.3125,0.7708333333]],"2":[[0.3125,0.7708333333]],"3":[[0.3125,0.7708333333]],"4":[[0.3125,0.7708333333]],"5":[[0.3125,0.7708333333]]}', 'https://www.facebook.com/Jonora-Animal-Hospital-347187392029472/?fref=ts', '', '', '', '', '', 'https://plus.google.com/106428722116213248558/about'),
  (83835, 'carina-veterinary-clinic-83835', 'Carina Veterinary Clinic', '', 'Carina Veterinary Clinic located in Carina specialises in vaccinations, heartworm prevention, flea and tick control, quality diets, geriatric pet care, desexing, house calls, surgery and many more.', 271193, '2015-09-18 04:57:13', '2016-04-12 23:37:12', '', 191, 2557, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 271193, 0, '', 'carina@southsidevet.com.au', '0733988229', '', '', '', 'http://www.southsidevet.com.au', 'Carina Veterinary Clinic have been well established for over 30 years and serve our community in the south-eastern suburbs of the beautiful sub-tropical city of Brisbane, Queensland. The current principal Peter Kitchen has been with this veterinary practice for more than 30 years, and is well supported by other caring and skilled veterinarians. The original practice was set up by Dr Gerald Whitwell who retired in July 2007. \n\nCarina Veterinary Clinic pride ourselves on retaining a skilled and dedicated team of vets and nurses for the long term. This enables us to develop a friendly and lasting working relationship with our clients and patients. Many of our staff have already or are approaching 15 years service with our practice. Both our Clinics have been regularly nominated for yearly local business awards. Many generations of family pets have passed through our clinics and we have sustained memorable relationships with them and always strove to deliver happy, healthy and long lifetimes to them all. Our mission, to the best of our ability,  is to deliver the highest quality and the longest quantity of life to the patients in our care. This focuses on a 3 sided partnership between the Pet , the Owner/Carer and the Veterinarian. Our veterinarians and our nurses regularly attend seminars, conferences and training courses to keep their skill and knowledge base up to date with all the latest developments in the veterinary field.\n\nCarina Veterinary Clinic provides an excellent range of skills and expertise with more than 55 hours of access to our services each week at each clinic. The veterinarians are ably supported by a dedicated and friendly group of qualified and trainee veterinary nurses. This completes an enthusiastic team of caring individuals who strive to give you excellent and personal service. After Hour Emergencies are referred to the Animal Emergency Services at Underwood.\n\nCarina Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Parasite control and prevention\n• Quality diets and pet care advice\n• Geriatric pet care\n• Desexing\n• House calls\n• Surgical procedures\n• Microchipping\n• Pathology services\n• Puppy preschool\n• Dentistry\n• Diagnostics\n• Washing and grooming \n\nand more.', 'A', '{"1":[[0.3541666667,0.4375],[0.625,0.7916666667]],"2":[[0.3541666667,0.4375],[0.625,0.7916666667]],"3":[[0.3541666667,0.4375],[0.625,0.7916666667]],"4":[[0.3541666667,0.4375],[0.625,0.7916666667]],"5":[[0.3541666667,0.4375],[0.625,0.7916666667]],"6":[[0.3541666667,0.5416666667]]}', 'https://www.facebook.com/Carina-and-Holland-Park-Veterinary-Clinics-219337084757891/', '', '', '', '', '', ''),
  (83842, 'rockingham-veterinary-clinic-83842', 'Rockingham Veterinary Clinic', '', 'Rockingham Veterinary Clinic located in Rockingham specialises in consultations, surgical procedures, hospital care, preventative health care, microchipping, laboratory testing and many more.', 271916, '2015-09-18 04:57:38', '2016-04-14 01:52:21', '', 191, 2271, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271916, 0, '', 'enquiries@rockinghamvet.com.au', '0895271797', '', '', '0895286910', 'http://www.rockinghamvet.com.au', 'Rockingham Veterinary Clinic endeavors to provide a high quality, personal veterinary service. We aim always to treat your pet with respect, compassion and care. We make sure your pet’s visit or stay with us is comfortable and pleasant. \n\nWe believe that it is important to continue to develop our skills and knowledge, so we can provide quality care. \n\nWe pride ourselves on our strong relationships with our clients, and we recognize and value the bond between you and your pets. We consider it a privilege that you entrust us to care for your pets.  We hope you will make us a regular part of your pets’ well-being!\n\nRockingham Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Hospital care\n• Surgical procedures\n• Preventative health care\n• Microchipping\n• Laboratory testing\n• Digital x-rays\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.5416666667]],"0":[[0.375,0.4583333333]]}', 'https://www.facebook.com/Rockingham-Veterinary-Clinic-364675093546451/', '', '', '', '', '', ''),
  (83850, 'walter-st-veterinary-clinic-83850', 'Walter St Veterinary Clinic', '', 'Walter St Veterinary Clinic located in Boonah specialises in pet nutrition advice, behaviour advice, vaccinations, dentistry, speys and castrations, hospital care, intensive care and many more.', 271283, '2015-09-18 04:58:10', '2016-04-13 00:34:41', '', 191, 2530, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary clinic\npet shops\npets\nvets', 271283, 0, '', 'ann@boonahvet.com.au', '0754634646', '', '', '', 'http://www.boonahvet.com.au', 'Walter St Veterinary Clinic led by Dr Ann Williams BVSc has been a vet for over 20 years, and although she previously has worked with both small and large animals she now focuses solely on small or companion animals.  Ann lives in the local area and has two cats, two dogs and several chooks of her own.  While she enjoys most aspects of veterinary work her special interests include feline medicine and greyhound medicine.\n\nWalter St Vet Clinic is a companion animal vet clinic servicing Boonah and the surrounding district.\n\nWalter St Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultation\n• Vaccination\n• Pet nutrition advice\n• Behaviour advice\n• Dentistry\n• General anaesthesia\n• Soft tissue surgery\n• Speys and castrations\n• Blood tests\n• Radiology\n• Hospital care\n• Intensive care\n• Pet merchandise\n• Hydrobath \n• Grooming\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.4583333333]]}', 'https://www.facebook.com/walter.st.vet/', '', '', '', '', '', 'https://plus.google.com/111707926420115929724/about'),
  (83851, 'morphettville-veterinary-clinic-83851', 'Morphettville Veterinary Clinic', '', 'Morphettville Veterinary Clinic located in Glengowrie specialises in medical consultations, radiology, orthopaedics, surgical procedure and more.', 272816, '2015-09-18 04:58:14', '2016-04-15 00:28:36', '', 191, 2064, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272816, 0, '', 'Morphvc@gmail.com', '0882948444', '', '', '', 'http://www.morphettvillevetclinic.com.au', 'Morphettville Veterinary Clinic established in 1987. Our team of vets and nurses are ready to look after your pets health and needs. Located across from Morphettville Race Course. Specialise in dogs and cats. Our services include Medicine, Radiology and Orthopaedics.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', '', '', '', '', '', '', ''),
  (83855, 'wanneroo-veterinary-hospital-83855', 'Wanneroo Veterinary Hospital', '', 'Wanneroo Veterinary Hospital located in Wanneroo specialises in consultations, surgical procedure, sterilisations, vaccinations, digital radiography and many more.', 272334, '2015-09-18 04:58:29', '2016-04-14 06:23:37', '', 191, 2210, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 272334, 0, '', 'info@wanneroovet.com.au', '0894051122', '', '', '', 'http://www.wanneroovet.com.au', 'Wanneroo Veterinary Hospital is an all-purpose Family Practice, providing care and support for companion animals and their owners. \n\nWanneroo Veterinary Hospital – a name synonymous with quality, passionate and experienced veterinary care, serving the pets and their owners of the Northern Suburbs for over 30 years! Our practice has grown from humble beginnings in the 1970’s to the large, modern hospital where we are situated today.\n\nWanneroo Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Surgery\n• Desexing\n• Vaccinations\n• Digital Radiography\n\nand more.', 'A', '{"1":[[0.3125,0.7708333333]],"2":[[0.3125,0.7708333333]],"3":[[0.3125,0.7708333333]],"4":[[0.3125,0.7708333333]],"5":[[0.3125,0.7708333333]],"6":[[0.3333333333,0.5208333333]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/WannerooVeterinaryHospital', '', '', '', '', '', ''),
  (83858, 'enfield-veterinary-hospital-83858', 'Enfield Veterinary Hospital', '', 'Enfield Veterinary Hospital located in Enfield specialises in vaccination, surgery, dentistry, diagnostic imaging, pathology, chemotherapy, grooming, acupuncture, microchipping and many more.', 273729, '2015-09-18 04:58:45', '2016-04-18 01:26:31', '', 191, 1724, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 273729, 0, '', 'enfieldvet@bigpond.com.au', '0297473999', '', '', '', 'http://www.enfieldvethospital.com.au', 'Enfield Veterinary Hospital has been serving the pet community for longer than any other vet in the South West of Sydney including the suburbs of Enfield, Strathfield, Homebush, Burwood, Croydon, Croydon Park, Concord, Ashfield, Belfield, Campsie, Greenacre and the surrounding areas of the greater Inner West of Sydney. We have been part of the local landscape for almost 40 years. One of our partners, Dr Catherine Brett, has been caring for pets of the community for over 20 years.\n\nOver this extensive period, we have established what the people and the pets of our area want and need when it comes to excellence in animal care.\n\nAll of the vets at Enfield Veterinary Hospital have undertaken post-graduate training in a variety of fields to keep at the forefront of veterinary medicine and surgery. You can be assured that the advice you receive is offering your pet the best chance of a healthy, long and fun-filled life.\n\nVeterinary services include, vet consultations, vaccinations and annual health checks, AQIS Accreditation for pet travel & export, general pet surgery, desexing, anaesthetic monitoring, digital radiology, ultrasonography, pathology, dentistry, grooming, chemotherapy, acupuncture, puppy preschool, pet boarding and more.\n\nOur history is long but our hospital knows how to evolve with the times. At Enfield Veterinary Hospital our staff provide the highest quality diagnostic, surgical and medical care for pets while at the same time focusing on client communication and education.\n\nIt is sometimes thought that all vet hospitals are the same, offering the same services and experiences. However, this is not always true. Enfield Veterinary Hospital strives to offer an honest, ethical and gold standard veterinary services to our patients. We also want our clients feel consulted and communicated with throughout. At Enfield Veterinary Hospital we want you to feel involved in the care of your pets.\n\nEnfield Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccination\n• Surgery\n• Dentistry\n• Diagnostic imaging\n• Pathology\n• Chemotherapy\n• Grooming\n• Acupuncture\n• Microchipping\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.8125]],"2":[[0.3333333333,0.8125]],"3":[[0.3333333333,0.8125]],"4":[[0.3333333333,0.8125]],"5":[[0.3333333333,0.8125]],"6":[[0.3333333333,0.6666666667]],"0":[[0.3541666667,0.5833333333]]}', 'https://www.facebook.com/EnfieldVeterinaryHospital', '', '', '', '', '', 'https://plus.google.com/113609412196616912045/about'),
  (83859, 'nedlands-veterinary-centre-83859', 'Nedlands Veterinary Centre', '', 'Nedlands Veterinary Centre located in Nedlands specialises in behaviour consultations, dental checks, preventative medicine, dermatology, geriatrics, radiology, orthopaedics and many more.', 271780, '2015-09-18 04:58:46', '2016-04-14 00:20:39', '', 191, 2335, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271780, 0, '', 'nedlandsvet@iinet.net.au', '0893863169', '', '', '', '', 'Nedlands Veterinary Centre is a family friendly centre for all your dogs, cats and small creatures veterinary needs. Friendly helpful staff with many years experience will be able to answer your queries & questions.\n\nNedlands Veterinary Centre catering for small animals. We offer grooming, puppy classes, dietary information. Our staff proudly treats our clients pets as as if they are our own.\n\nNedlands Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Behaviour consultation\n• Dental checks\n• Vaccinations\n• Dermatology\n• Geriatrics\n• Radiology\n• Surgery\n• Ultrasonography\n• Acupuncture\n• Dentistry\n• Microchipping\n• Puppy classes\n\nand many more', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.625]]}', 'https://www.facebook.com/Nedlands-Veterinary-Centre-519279314787689/timeline', '', '', '', '', '', 'https://plus.google.com/112914968654012180631/about'),
  (83861, 'kulnura-veterinary-clinic-83861', 'Kulnura Veterinary Clinic', '', 'Kulnura Veterinary Clinic located in Kulnura specialises in consultations, house calls, ultrasound, radiography, desexing, dentistry, intensive care, microchipping, vaccinations and many more.', 274879, '2015-09-18 04:58:54', '2016-04-19 06:19:42', '', 191, 1347, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274879, 0, '', 'info@kulnuravet.com', '0243761401', '', '0429785212', '', 'http://www.kulnuravet.com', 'Kulnura Veterinary Clinic treat your pets as if they were our own. We understand that you want your pet to be happy and healthy so we are  available to help with your pets general health and any concerns you may have.\n\nOur friendly veterinary team are available to offer the best possible care and support to you and your pets. \n\nKulnura Veterinary Clinic treat your family including dogs, cats and other furry friends such as rabbits, guinea pigs, rats, mice and birds. We also see horses!\n\nWe provide a house and farm call service, which  includes  helping out mares with breeding reproductive difficulties or visiting your beloved pet in their own environment.\n\nKulnura Veterinary Clinic started as a mobile practice in 1999 to meet the growing demands for a local vet. Within a short space of time the need for a fully equipped clinic became apparent, and the clinic was built by Dr Anna Pillich.\n\nKulnura Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• House calls\n• Ultrasound\n• Radiography\n• Desexing\n• Dentistry\n• Pathology\n• Intensive care\n• Microchipping\n• Vaccinations\n• Dietary advice\n• Surgery\n• Parasite control and prevention\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/KulnuraVetClinic', '', '', '', '', '', 'https://plus.google.com/113493841183511947189/about'),
  (83864, 'southern-downs-veterinary-services-83864', 'Southern Downs Veterinary Services', '', 'Southern Downs Veterinary Services located in Stanthorpe specialises in vaccinations, pregnancy testing, dentistry, microchipping, house calls, heartworm prevention and many more.', 270517, '2015-09-18 04:59:06', '2016-04-12 00:26:36', '', 191, 2766, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 270517, 0, '', '', '0746811838', '', '', '', 'http://stanthorpevet.com.au', 'Southern Downs Veterinary Services  provides fantastic,  modern facilities to ensure your pet gets the very best of care.  We also like to make sure you are comfortable in our new waiting room.  There is also a fantastic backyard with a play area for dogs and seats under our shady trees.\n\nSouthern Downs Veterinary Services cares for patients from all over the Granite Belt and Southern Downs Region including Stanthorpe, Wallangarra, Dalveen, Amiens, Warwick, Liston, Tenterfield, Ballandean and Texas. Situated in a convenient location in High Street, Stanthorpe, we’re easy to find. We also do home visits for those who find it difficult to get their pet to the vet as well as farm visits for our larger equine and production animal patients.\n\nWe enjoy caring for all of your animals including dogs, cats, cattle, horses, alpacas, rats, chickens, turkeys, guinea pigs, goats, pigs, birds and more.\n\nSouthern Downs Veterinary Services offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Dermatology\n• Orthopedic surgery\n• Soft tissue surgery\n• Radiography\n• Consultations\n• Vaccinations\n• Desexing\n• Dentistry\n• Pregnancy testing \n\nand many more.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/Southern-Downs-Veterinary-Services-132160566864490/', '', '', '', '', '', 'https://plus.google.com/110450751359632918491/about'),
  (83871, 'great-western-animal-hospital-83871', 'Great Western Animal Hospital', '', 'Great Western Animal Hospital located in Wentworthville specialises in consultations, vaccinations, desexing, microchipping, dentistry, parasite control and prevention, surgery, acupuncture and more.', 220319, '2015-09-18 04:59:34', '2016-04-18 06:48:38', '', 191, 1580, 'veterinary surgeons\npet care\ndog grooming\nanimal hospital\nveterinary hospital\npets\nvets', 220319, 0, '', 'greatvet@gmail.com', '0296319322', '', '', '', 'http://www.greatwesternanimalhospital.com.au', 'Great Western Animal Hospital knows how important it is that your 4 legged family member receives the best possible care and attention.\n\nWhether you visit us for your pet’s annual health check and vaccination or if in the unfortunate circumstance that they are unwell or injured you can be rest assured that we will treat them as one of our own.\n\nOur veterinary team are friendly and approachable and realise how important good communication and client education is. We take the time to be thorough, treat every patient as an individual and work with you to achieve the best possible outcome for your pet.\n\nGreat Western Animal Hospital offers a large range of professional services and advice ranging from flea and worming programs to management of difficult conditions such as cardiac disease, diabetes and cancer therapy. Our hospital is fully equipped with diagnostic and surgical facilities and we can perform high quality soft tissue and orthopaedic surgery.\n\nWe also offer on-site boarding for cats and a house call and patient transportation service.\n\nGreat Western Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Desexing\n• Microchipping\n• Flea control\n• Worming\n• Dentistry\n• Treatment for illness or injury\n• Diagnostics\n• Surgery\n• Veterinary Acupuncture\n• House Calls\n• In-house Boarding\n• Puppy Preschool\n• Cat Adoption\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.3333333333,0.5833333333]],"0":[[0.3333333333,0.5]]}', 'https://www.facebook.com/greatwesternanimalhospital/?fref=ts', '', '', '', '', '', 'https://plus.google.com/+GreatWesternAnimalHospitalPendleHill/about'),
  (83872, 'dr-david-lindsay-animal-chiropractor-83872', 'Dr  David Lindsay Animal Chiropractor', '', 'Dr David Lindsay''s clinic located in Blackwood specialises in animal chiropractic, surgical procedure, dentistry, diagnostics, desexing and more. ', 272754, '2015-09-18 04:59:38', '2016-04-14 23:14:43', '', 191, 2091, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272754, 0, 'Shop 9', 'david@adelaidechirovet.com.au', '0419553330', '', '', '', 'http://www.adelaidechirovet.com', 'Dr David Lindsay, As a conventional veterinary surgeon I do not set out to claim that I can treat medical cases with chiropractic. However, I often feel that through chiropractic therapy I can improve the sense of well being in pets with medical or surgical conditions. It is a similar effect to having a massage or a warm bath when we are feeling off colour.\n\nThe chiropractic philosophy basically says that because all cells and tissues in the body (with the possible exception of blood cells) are in contact with nerve fibres and through them the central nervous system (the spinal chord and the brain), if the nervous system is disrupted the target organs and cells may also dysfunction.\n\nNerves carry messages from the brain to target organs, and conversely from organs to the brain.\nThose nerves must pass through small canals between the vertebrae. When the spine moves the vertebrae massage the nerves and that helps to keep them in a healthy state. If two vertebrae become locked the nerve passing between them is poorly massaged and messages can be obstructed. Then the brain and target cells may fail to communicate.\n\nFrom head to pelvis there are about 143 joints in the spine. Chiropractic treatments aim to optimise nervous activity by eliminating situations which compromise movement of any one of the joints in the spinal column.\n\nSometimes health practitioners become very involved in ongoing cases and it can be difficult "to see the wood from the trees".Then an alternative opinion is often helpful.\n\nSometimes a chiropractor can resolve an unresponsive medical problem and sometimes a conventional medical practitioner will resolve an unresponsive chiropractic problem. When this happens it is not that one is right and one is wrong it is just that by changing the perspective of examination and knowledge another light shines upon the problem.\n\nDr David Lindsay offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Animal Chiropractic\n• Surgery\n• Desexing\n• Specialists referral \n• Dentistry\n\nand more', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]]}', '', '', '', '', '', '', ''),
  (83878, 'ulysses-veterinary-clinic-cairns-83878', 'Ulysses Veterinary Clinic Cairns', '', 'Ulysses Veterinary Clinic Cairns located in Stratford specialises in preventative medicine, parasite control and prevention, radiography, ultrasonography, clinical pathology, surgery and many more.', 271041, '2015-09-18 05:00:03', '2016-04-12 07:03:56', '', 191, 2593, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271041, 0, '', 'ulyssesvets@gmail.com', '0740551100', '', '', '', 'http://www.vetscairns.com.au', 'At the Ulysses Veterinary Clinic Cairns (formerly the Airport Veterinary Surgery), we understand your pets are a part of your family. That''s why we do everything possible to maintain your pet''s health and wellbeing. We always treat our patients as individuals and like to get to know their unique personalities. \n\nBased in Stratford on the corner of Johnston and Arnold Streets (right before Jonssons Farmers Market), we provide high quality veterinary care and great personalised service in a friendly professional manner.\n\nSince 1980, the Ulysses Veterinary Clinic Cairns has been at the forefront of quality veterinary care in Cairns. Vets Demian Bullock, Beau Quaid, Carol Esson and Karen Wilson have continued building the surgery into a vibrant, friendly practice.\n\nThe practice is equipped with modern medical equipment including an in-house pathology system, the latest digital x-ray and dental equipment, ultrasound and advanced anaesthetics to ensure the best care for your pet. \n\nUlysses Veterinary Clinic Cairns offers a comprehensive range of veterinary and pet health-related services, including:\n\n♦ Vaccination\n♦ Parasite control and prevention\n♦ Annual health check\n♦ Radiography\n♦ Ultrasonography\n♦ Clinical Pathology\n♦ Pet Insurance\n♦ Desexing\n♦ Orthopaedic\n♦ Ophthalmic\n♦ Microchipping\n♦ Behavioural advice\n♦ Nutritional advice\n♦ Boarding\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Ulysses-Vet-Clinic-Cairns-215930311796315/?ref=bookmarks', '', '', '', '', '', '');
