  (83885, 'torenbeek-veterinary-clinic-83885', 'Torenbeek Veterinary Clinic', '', 'Torenbeek Veterinary Clinic located in North Rockhampton specialises in routine check-ups, dentistry, after hours services, vaccinations, desexing, medical imaging, wellness assessments and many more.', 270925, '2015-09-18 05:00:31', '2016-04-12 06:00:09', '', 191, 2629, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 270925, 0, '', 'vets@torenbeekvetclinic.com.au', '0749282593', '', '', '0749268804', 'http://www.torenbeekvetclinic.com.au', 'Torenbeek Vet Clinic is a busy small animal clinic with over 60 years combined veterinary experience.\n\nThe clinic has been assisting Central Queensland pets and their owners since 2004 and is jointly owned by Lester Torenbeek and Terry Fisher.\n\nTorenbeek Vet Clinic offers a wide range of medical and surgical skills to ensure your pet receives the best in veterinary care, products and services.\n\nAt Torenbeek Vet Clinic we have a compassionate and caring team. We routinely attend Specialist conferences and we are always furthering our knowledge by attending education programs and keeping up to date with the most recent medical and surgical advances. At the Torenbeek Vet Clinic, we will provide the best possible care for your pets.\n\nTorenbeek Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Dentistry\n• Emergency care services\n• Vaccinations\n• Desexing\n• X-rays\n• Ultrasounds\n• Endoscopies\n• Radiology examinations\n• Wellness assessments\n• Surgical procedures\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Torenbeek-Vet-Clinic-473585249489294/?fref=ts&ref=br_tf', '', '', '', '', '', ''),
  (83888, 'fremantle-vet-hospital-83888', 'Fremantle Vet Hospital', '', 'Fremantle Vet Hospital located in Fremantle specialises in advanced surgical procedures, behaviour consultations, boarding, complete companion animal care, dentistry, diagnostic services and more.', 271615, '2015-09-18 05:00:43', '2016-04-13 06:01:19', '', 191, 2410, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271615, 0, '', 'fremantlevet@westnet.com.au', '0893191878', '', '', '0893191373', 'http://www.mvol.com.au/fremantlevet.aspx', '', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5416666667]],"0":[[0.375,0.4583333333]]}', '', '', '', '', '', '', 'https://plus.google.com/100097589082213471646/about'),
  (83903, 'kellyville-veterinary-clinic-83903', 'Kellyville Veterinary Clinic', '', 'Kellyville Veterinary Clinic located in Kellyville specialises in consultations, vaccination, ultrasound, radiography, general surgery, microchipping, grooming, skin problems treatment and many more.', 274804, '2015-09-18 05:01:43', '2016-04-19 05:15:18', '', 191, 1374, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 274804, 0, '', '', '0296291860', '', '', '', 'http://www.kellyvillevetclinic.com.au', '', 'A', '{"1":[[0.3333333333,0.5],[0.625,0.7916666667]],"2":[[0.3333333333,0.5],[0.625,0.7916666667]],"3":[[0.3333333333,0.5],[0.625,0.7916666667]],"4":[[0.3333333333,0.5],[0.625,0.7916666667]],"5":[[0.3333333333,0.5],[0.625,0.7916666667]],"6":[[0.3333333333,0.5]],"0":[[0.375,0.4166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/113557556623472869172/about'),
  (83905, 'eye-clinic-for-animals-83905', 'Eye Clinic for Animals', '', 'Eye Clinic for Animals located in Crows Nest specialises in eye inflammation, glaucoma, feline herpes virus infection, eyelid abnormalities, eye removal surgery, blindness, cataracts and many more.', 273791, '2015-09-18 05:01:51', '2016-04-18 02:04:25', '', 191, 1703, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 273791, 0, '', 'info@eyeclinicforanimals.com.au', '0294364884', '', '', '0299065710', 'http://www.eyeclinicforanimals.com.au', 'Eye Clinic for Animals is a specialist ophthalmology practice providing the highest professional level of care for our patients. Established in 1982 ECA now has 3 highly trained and experienced partners:\n\nJEFFREY S SMITH\nBVSC, FACVSC, DACVO\n\nJeff graduated from Sydney University in 1970 and after 3 years in general practice completed a residency in Veterinary and Comparative Ophthalmology at Cornell University and was granted Diplomate status of the American College of Veterinary Ophthalmologists in 1977. \n\nReturning to Australia in 1978 Jeff gained Membership of the Australian College of Veterinary Scientists in Canine Medicine and in 1983 become a Fellow of the ACVSc in Veterinary Ophthalmology.\n\nCAMERON J G WHITTAKER\nBVSC, MACVSC, DVCS, DACVO\n\nCameron graduated from Sydney University in 1989. After spending time in mixed animal practice he completed an internship at Sydney University in 1992 and the following year commenced a residency in Veterinary Ophthalmology at the University of Florida and was granted Diplomate status of the American College of Veterinary Ophthalmologists in 1996. He then worked at the Ohio State University as a visiting Assistant Professor before returning to Australia in 1997 to join Eye Clinic for Animals and providing specialist ophthalmology services to both small and large animals in Sydney and regional areas of NSW. Cameron also has served the NSW Division of the AVA and currently provides medicine and surgery lectures and practical sessions to Sydney University students. He voluntarily provides services to wildlife at both Sydney and Western Plains Zoos. Cameron has a special interest in cataract surgery, glaucoma, corneal medicine and surgery, retinal surgery and exotic animal ophthalmology.\n\nKELLY CARUSO\nBSC, VMD, DACVO\n\nKelly graduated from the University of Pennsylvania with a Doctorate of Veterinary Medicine in 1997 after completing a Bachelor of Science in Biology from St Joseph’s University in Philadelphia. She then completed internships in Equine Medicine and Surgery, Small Animal Medicine and Surgery, Ophthalmology and Emergency Medicine and Critical Care. Kelly then completed a residency under the tutelage of Professor Seth Koch – one of the founding members of the American College of Veterinary Ophthalmologists – and was granted Membership of that body in 2007.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (83906, 'total-care-pets-vets-83906', 'Total Care Pets & Vets', '', 'Total Care Pets & Vets located in Dalby specialises in preventative care, emergency services, x-ray, ultrasound, pathology, pet products and many more.', 270973, '2015-09-18 05:01:55', '2016-04-12 06:22:39', '', 191, 2616, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\nveterinary clinic\npet shops\npets\nvets', 270973, 0, '', 'tcvets@bigpond.net.au', '0746696800', '0746698888', '', '', 'http://www.tcvets.com.au', 'Total Care Pets & Vets is a complete health centre combining a modern, well equipped veterinary hospital with a comprehensive grooming service and large pet warehouse. We are able to offer right advice on all your pet’s health, grooming and training needs.\n\nThe Total Care Pets & Vets team has more than 60 years combined experience in large and small animal care. Our team frequently attends courses, seminars and conferences to remain up to date on current knowledge in preventive medicine and treatments.\n\nOur knowledgeable staff are also able to give you the best advice on our range of quality pet products. Now it is easy for you to care for your pet.\n\nDesigned and built specifically to cater for your pet’s needs, our modern veterinary hospital offers the highest standard of care in a clean and friendly environment.\n\nOur experienced team of veterinarians and qualified veterinary nurses are specialists in emergency and preventative care.\n\nWe recommend regular check-ups to ensure we identify any problems as early as possible and improve the chances of recovery.\n\nTotal Care Pets & Vets offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Dental Care\n• Surgery\n• Digital X-Ray\n• Ultra Sound\n• In-house pathology\n• Grooming\n• Pet supplies\n• Naturopathic\n• Nutrition advice\n\nand more.', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/pages/Total-Care-Vets-and-Pets/304132929607773', '', '', '', '', '', 'https://plus.google.com/112976807986496710943/about'),
  (83907, 'leeton-veterinary-hospital-83907', 'Leeton Veterinary Hospital', '', 'Leeton Veterinary Hospital located in Leeton specialises in vaccinations, desexing, parasite control, microchipping, wellness programs, weight loss programs, chemotherapy, dental care and many more.', 274944, '2015-09-18 05:01:59', '2016-04-19 07:06:27', '', 191, 1317, 'pet wash\npet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 274944, 0, 'Farm 441', 'epractice@provet.com.au', '0269533111', '', '', '0269532793', 'http://www.leetonvet.com.au', 'Leeton Veterinary Hospital is a modern, well equipped veterinary practice committed to patient advocacy and total patient care for companion, recreational and farm animals. Leeton Veterinary Hospital provides veterinary care to clients in the Leeton, Narrandera, Griffith & Murrumbidgee Shires. At Leeton Vets, we are absolutely committed to offering the best in animal health and wellbeing.\n\nLeeton Veterinary Hospital is a rural mixed practice that has been in operation for over 50 years in Leeton, servicing many species including dogs, cats, rabbits, birds, horses, cattle, sheep, pigs, alpacas and Australian native wildlife.\n\nLeeton Veterinary Hospital is situated in the heart of the Murrumbidgee Irrigation Area in the Western Riverina of NSW, and is approximately 6 hours from Sydney and 5 hours from Melbourne.\n\nAs well as consulting times & surgery for companion animals and horses and farm visits for horses and production animals, we offer & provide a 24 hour, 7 day emergency service, 365 days a year.\n\nOur team at Leeton Vets understands the special bond that exists between people and their pets. Our team at Leeton Veterinary Hospital pledge to provide our community with the highest quality of veterinary medicine and surgical care. This care is provided by a well trained team in a well equipped facility at Leeton Veterinary Hospital and where necessary, by referral to well respected referral centres.\n\nLeeton Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Desexing\n• Parasite control\n• Microchipping\n• Wellness programs\n• Weight loss programs\n• Bi-Annual health checks\n• Chemotherapy\n• In-house blood collection & analysis\n• Dental services\n• Comprehensive radiology & ultrasound facilities\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/leetonvet/', '', '', '', '', '', 'https://plus.google.com/109797275080767651672/about'),
  (83909, 'forest-animal-hospital-24-7-83909', 'Forest Animal Hospital 24/7', '', 'Forest Animal Hospital 24/7 located in Forestville specialises in routine health checks, vaccinations, routine surgery, desexing, laboratory facilities, diagnostic imaging, grooming and many more.', 218858, '2015-09-18 05:02:08', '2016-04-18 03:09:52', '', 191, 1674, 'veterinary surgeons\npet care\ndog grooming\npet grooming\nanimal hospital\nveterinary hospital\nveterinary clinic\npets\nvets', 218858, 0, 'Cnr Warringah Rd & Ferguson St', 'forestvets@gmail.com', '0294514840', '', '', '', 'http://forestanimalhospital247.com.au', 'Forest Animal Hospital 24/7 have been open 24 hours a day for over twenty years. Most of the pet owners of the Northern Beaches and the upper North Shore have had reason, at some time over the last two decades to come to the spiky roofed building on the corner of Warringah Road and Starkey Street for emergency care.  \n\nUntil recently the day and night  services were operated by two separate veterinary practices. But on the 14th of March 2014 Forest Animal Hospital became the 24 hour a day managers of the Vet Practice that never closes.  On that day we changed our name to FOREST ANIMAL HOSPITAL 24/7 to reflect our new status.\n\nWe are happy, at any time of the day or night to help with the care of your pets, whether they are injured or just feeling poorly.\n\nForest Animal Hospital 24/7 offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Routine health checks\n• Vaccinations for dogs, cats and rabbits\n• Microchipping\n• Routine surgery and desexing for dogs, cats, rabbits and ferrets\n• Medicine\n• Comprehensive laboratory facilities - internal and external\n• Diagnostic imaging including digital radiology, ultrasound and dental radiology\n• Puppy Preschool \n• Dental Programme\n• Senior Pet Programme\n• Weight Loss Programme\n• Grooming/clipping\n• General behavior advice\n• Emergency treatment of wildlife\n\nand more.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/Forest-Animal-Hospital-247-318003661588011/', '', '', '', '', '', 'https://plus.google.com/102170497874209935430/about'),
  (83915, 'western-suburbs-veterinary-clinic-83915', 'Western Suburbs Veterinary Clinic', '', 'Western Suburbs Veterinary Clinic located in Kirwan specialises in emergency care services, consultations, diagnostic imaging, endoscopy, microchipping, pathology, end of life services and many more.', 271355, '2015-09-18 05:02:32', '2016-04-13 01:20:25', '', 191, 2506, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 271355, 0, '', 'staff@wsvc.com.au', '0747734111', '', '', '0747231043', 'http://www.westernsuburbsvetclinic.com.au', 'Western Suburbs Veterinary Clinic is a locally owned Townsville veterinary clinic established in 1982 and has been continually upgraded to provide comprehensive clinical and diagnostic services and quality continuity of care.\n\nWestern Suburbs Veterinary Clinic provide emergency and routine small animal services in Townsville and promote best advice and treatment for your pets with compassion and good humour.\n\nOur team of dedicated vets and nurses understand, support and help sustain the important bond between people and their pet animals.\n\nWestern Suburbs Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Puppy School / Puppy Classes\n• Consultations\n• Vaccinations\n• Surgery - general, soft tissue, orthopaedic & specialist ophthalmic\n• Dental services\n• Endoscopy\n• Microchipping\n• Laboratory in-house\n• Ambulance Service\n• Animal Behaviour\n• Final Care\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/WesternSuburbsVetClinic', 'https://twitter.com/vettownsville', '', '', '', '', 'https://plus.google.com/115362388235550812163/about'),
  (83919, 'vets4pets-83919', 'Vets4Pets', '', 'Vets4Pets located in Wynn Vale specialises in veterinary services including 24 hour emergency care, dental care, vaccination, preventative medicine, surgical procedures, microchipping and many more.', 273681, '2015-09-18 05:02:48', '2016-04-18 00:00:34', '', 191, 1741, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 273681, 0, '', 'admin@vets4pets.com.au', '0882893722', '', '', '', 'http://www.vets4pets.com.au', 'Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaide''s Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\n\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\n\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaedic surgery etc), special equipment or even hospitalisation, your case manager draws upon the extensive skills and facilities of the Vets4Pets Group.\n\nTo facilitate the smooth operations of the practices our Practice manager Carole Benassy is responsible for keeping everything running. Carole has been with the practice since January 2000 and is responsible for liaising between vets and nurses, practice operations, nurse training and management of practice accounts.\n\nVets4Pets offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Heartworm prevention\n• Intestinal worming\n• Flea treatment\n• Nutritional advice\n• Dental care\n• Surgery\n• Ultrasound\n• X-rays\n• Skin disease treatment\n• Behavioural advice\n• Microchipping\n• Pet insurance\n• Boarding\n\nand more.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/vets4petssa', '', '', '', '', '', 'https://plus.google.com/104325051547812476033/posts'),
  (83920, 'kanwal-veterinary-hospital-83920', 'Kanwal Veterinary Hospital', '', 'Kanwal Veterinary Hospital located in Kanwal specialises in consultations, vaccinations, microchipping, dentistry, pathology, surgical procedures, diagnostic imaging, puppy preschool and many more.', 274738, '2015-09-18 05:02:52', '2016-04-19 02:55:34', '', 191, 1409, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 274738, 0, '', 'kanwalvet@kanwalvet.com.au', '0243922088', '', '', '', 'http://www.kanwalvet.com.au', 'Kanwal Veterinary Hospital is your friendly family vet providing expert care for your pets on the Central Coast.\n\nOur vet hospital has been providing veterinary care for the cats, dogs and rabbits of the northern Central Coast of NSW, stretching from Wyong to Doyalson and Toukley to Charmhaven.\n\nKanwal Veterinary Hospital was established  in 1977. It quickly expanded to become a mixed practice with 2 veterinarians dealing mainly with small animals.\n\nDr Chris Jamieson purchased the small animal part of the practice in 1987 and has been providing veterinary care for the pet population of the northern Central Coast stretching from Wyong to Doyalson and Toukley to Charmhaven.\n\nOver the years there have been a number of veterinary associates all providing the friendly advice and family atmosphere for which the practice has become known.\n\nDr Bruce Krumm joined the team as a partner in 2011 and looks forward to helping the practice grow.\n\nKanwal Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Consultations\n• Vaccinations\n• Microchipping\n• Dentistry\n• Pathology\n• Surgery\n• Diagnostic imaging\n• House visits\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.375,0.4791666667],[0.625,0.7291666667]],"2":[[0.375,0.4791666667],[0.625,0.7291666667]],"3":[[0.375,0.4791666667],[0.625,0.7291666667]],"4":[[0.375,0.4791666667],[0.625,0.7291666667]],"5":[[0.375,0.4791666667],[0.625,0.7291666667]],"6":[[0.375,0.5]],"0":[[0.4166666667,0.4583333333]]}', 'https://www.facebook.com/kanwalvet/', '', '', '', '', '', 'https://plus.google.com/108892251349622199682/about'),
  (83926, 'greenhills-veterinary-hospital-83926', 'Greenhills Veterinary Hospital', '', 'Greenhills Veterinary Hospital located in East Maitland specialises in pet dentistry, surgical procedures, ultrasound, x-rays, intensive pet care, cardiology, clinical pathology, grooming and more.', 274470, '2015-09-18 05:03:16', '2016-04-18 23:44:43', '', 191, 1499, 'pet care\nveterinary surgeons\npet grooming\nanimal hospital\nveterinary hospital\npets\nvets', 274470, 0, '', 'enquiries@greenhillsvet.com.au', '0249341900', '', '', '0249336481', 'http://www.greenhillsvet.com.au', 'Greenhills Veterinary Hospital''s aim is to provide you with a personal and comprehensive range of Veterinary services and supplies to cater for all your pet''s needs.\n\nOne of our main areas of emphasis is an on-going preventative medicine program for our patients. Modern Veterinary medicine allows us to use knowledge & skills to prevent illness, disease and suffering - this is the principle aim of our practice. We will provide you with information sheets, informative dvd''s and books to help you in the management of any illness, convalescence after surgery and in the maintenance of your pet''s good health.\n\nGreenhills Veterinary Hospital has a dedicated ongoing commitment to staff training ensuring we always offer the best of care available.\n\nTAFE & University of students - with state of the art facilities and staff expertise we are a model hospital for TAFE veterinary nursing students. We are also a training partner for University of Sydney and Queensland final year veterinary students.\n\nGreenhills Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Surgical procedure\n• Dentistry\n• Ultrasound\n• X-ray\n• Intensive care\n• Cardiology\n• Pathology\n• Grooming\n• Doggy Day Spa\n• House calls\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.3333333333,0.7083333333]],"0":[[0.375,0.6666666667]]}', 'https://www.facebook.com/Greenhills-Veterinary-Hospitals-185859214771732/', '', '', '', '', '', ''),
  (83927, 'cherry-court-vet-clinic-83927', 'Cherry Court Vet Clinic', '', 'Cherry Court Vet Clinic located in Morley specialises in health checks, vaccinations, dental health, blood test, senior pet health and many more.', 272292, '2015-09-18 05:03:20', '2016-04-14 06:15:46', '', 191, 2217, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272292, 0, '', '', '0893781133', '', '', '', 'http://cherrycourtvet.com.au/', 'Cherry Court Vet Clinic''s team are all passionate about what they do and love doing so!\n\nTogether we offer a professional veterinary service with great care and compassion.  We always aim to exceed expectations and ensure your pet’s stay in hospital is enjoyable and their day filled with lost of cuddles, love and fun.  We treat all our patients like we do our own pets and believe in effective communication and offering all treatment options when talking to clients.\n\nWe are a very open hospital encouraging pet owners to come and see what we do behind the scenes, visit their pet while in our care and view our facilities and equipment.  Although a highly professional hospital we put a lot of heart into our job to ensure a homely and safe feel for both our patients and their owners.\n\nCherry Court Vet Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• After hours emergency\n• Dentistry\n• Desexing\n• Deworming\n• Vaccination\n• Fleas and tricks control\n• Heartworm prevention\n• Microchipping\n• Pet behaviour classes\n• Pet insurance\n• Surgery\n• Puppy classes\n• Radiography\n\nand more.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.5416666667]]}', 'https://www.facebook.com/Cherrycourtvetclinic', '', '', '', '', '', ''),
  (83929, 'meadows-veterinary-centre-83929', 'Meadows Veterinary Centre', '', 'Meadows Veterinary Centre located in Meadows specialises in boarding, equine artificial insemination, dentistry, in-house laboratory, microchipping, grooming, senior pet care and many more.', 272802, '2015-09-18 05:03:24', '2016-04-15 00:19:13', '', 191, 2073, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 272802, 0, '', 'admin@meadowsvet.com.au', '0883883455', '', '', '0883883001', 'http://www.meadowsvet.com.au', 'Meadows Veterinary Centre is a mixed animal practice providing professional, friendly, care and service for all species of animals from pets such as cats, dogs, rabbits and guinea pigs through to horses, cattle, alpacas, goats and sheep. We also treat a wide variety of wildlife too. Our clients and patients are based throughout the Adelaide Hills and southern suburbs of Adelaide.\n\nOur veterinarians, nurses and support staff are a compassionate, dedicated, well trained team who take a genuine interest in the health of all pets, farm animals and wildlife. Our team has a wide range of special interests including equine dentistry, equine artificial insemination with both frozen and chilled semen, small animal medicine and surgery, animal behaviour, wildlife as well as cattle health and reproduction.\n\nMeadows Veterinary Centre''s premises are new and purpose built providing great facilities and up to date equipment. We offer a comprehensive range of preventative health programs as well as full diagnostic and surgical procedures. We also offer a large range of pet care products, premium diets as well as professional pet grooming and cat boarding in specially designed facilities. We also offer a 24 hour emergency service.\n\nMeadows Veterinary Centre constantly strive to provide the very best in care and service to all of our clients and all of their animals at all times!\n\nMeadows Veterinary Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Boarding\n• Equine Artificial Insemination\n• Equine Dentistry\n• Equine Prepurchase\n• In-house laboratory\n• Microchipping\n• Pet grooming\n• Senior pet care\n\nand more.\n\n', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.3541666667,0.5]]}', 'https://www.facebook.com/MeadowsVetCentre', '', '', '', '', '', ''),
  (83952, 'macarthur-veterinary-group-mt-annan-clinic-83952', 'Macarthur Veterinary Group - Mt Annan Clinic', '', 'Macarthur Veterinary Group - Mt Annan Clinic located in Mt Annan specialises in 24 hours emergency services, surgical procedure, wildlife and rescue, pet insurance, boarding, lost and found and more.', 222046, '2015-09-18 05:04:56', '2016-04-21 23:38:12', '', 191, 1178, 'pet care\nveterinary surgeons\npet grooming\nveterinary clinic\npets\nvets', 222046, 0, 'Shop 17', 'mtannan@macarthurvet.com.au', '0246477722', '', '', '0246475700', 'http://www.macarthurvet.com.au', 'Macarthur Veterinary Group - Mt Annan Clinic provide a full range of veterinary services for dogs and cats as well as birds, rabbits, ferrets, rats, mice etc. Our approach to the care of your pet is preventative health care - to ensure they remain in excellent health.\n\nIf you live in the Macarthur or greater Campbelltown regions rest assured your family pet is in the safe hands of our experienced, professional team. Your pet will receive the best possible care, so they live a long, happy, healthy life.\n\nSince our humble beginnings in the early 1990’s Macarthur Veterinary Group has been expanded to include four clinics – at Bradbury, Camden, Mt. Annan and Gregory Hills, all of which are A class hospitals. View our Opening Hours. Our veterinary team numbers over 15 with over 20 support staff, all motivated by their love of animals to care for your family pet as if it was their own.\n\nOur team is committed to high quality healthcare, veterinary medicine and surgery. To ensure this consistent high quality service we support every team members'' participation in ongoing education and external courses to constantly update their skills.\n\nMacarthur Veterinary Group - Mt Annan Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Annual health checks\n• Vaccinations\n• Parasite control and prevention\n• Microchipping\n• Surgical procedures\n• Specialist referrals\n• Dental care\n• Senior pet care\n• Dietary advice\n• Boarding\n• Grooming\n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7916666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/macarthurvet/', '', '', '', '', '', 'https://plus.google.com/114105801680751696783/about'),
  (83955, 'redlynch-valley-vets-83955', 'Redlynch Valley Vets', '', 'Redlynch Valley Vets located in Redlynch specialises in general care, surgery, dentistry, dermatology, geriatrics, acupuncture, preventative treatments, immunology and many more.', 270399, '2015-09-18 05:05:08', '2016-04-11 23:07:03', '', 191, 2803, 'pet care\nveterinary surgeons\nveterinary hospital\nveterinary clinic\npets\nvets', 270399, 0, '', 'rvvet@bigpond.net.au', '0740393800', '', '', '', 'http://www.redlynchvalleyvets.net.au', 'Redlynch Valley Vets has grown to become one of the most reliable and sought-after animal clinics in the area since 2006. We’re a well-staffed, well-equipped and brilliantly enthusiastic veterinary practice, and we’ve got the facilities to treat animals from all corners of the natural world. From cats to parrots, dogs to geckos and hamsters to salamanders, we’re passionate about doing everything we can for every single pet that comes in to see us.\n\nOur huge range of animal care services means that, no matter what might ail your pet, there’s always something we can do for them. All you need to do is pay us a visit, and we’ll have you and your best friend strolling, swimming or flying out the door in no time, healthy as the day they were born. \n\nRedlynch Valley Vets offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General care\n• Surgery\n• Dentistry\n• Dermatology\n• Geriatrics\n• Pathology\n• Ophthalmology\n• Orthopaedics\n• Acupuncture\n• Chiropracty\n• Animal behavioural help\n• Paediatrics\n• Obstetrics\n• Gynaecology\n• Oncology\n• Cardiology\n• Dietetics\n• Preventative treatments\n• Immunology \n', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.375,0.5]]}', '', '', '', '', '', '', ''),
  (83957, 'sinnamon-park-vet-and-pet-emporium-83957', 'Sinnamon Park Vet and Pet Emporium', '', 'Sinnamon Park Vet and Pet Emporium located in Jindalee specialises in emergency services, neutering and surgery, dentistry, vaccinations, grooming, microchipping laboratory tests and many more.', 270475, '2015-09-18 05:05:16', '2016-04-11 23:54:35', '', 191, 2782, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npet shops\npets\nvets', 270475, 0, 'Shop 23 Homemaker City', 'vets@sinnamonvetandpet.com.au', '0733765633', '', '', '0733762285', 'http://www.sinnamonvetandpet.com.au', 'Sinnamon Park Vet and Pet Emporium was established at the Homemaker Centre, Jindalee in 2003 by Dr Scott Snellgrove and Dr Gerry King.\n\nIn 2005 the surgery relocated inside the Centre also adding a petshop to become Sinnamon Park Vet and Pet Emporium.\n\nThe petshop provides a selection of quality, effective and road-tested products along with expert professional advice. Combining many years of Veterinary experience both within Australia and abroad with a wide range of services, we aim to provide a comprehensive yet caring\none-stop facility.\n\nIn 2008 Dr Snellgrove took over ownership of the practice as Dr King semi-retired to concentrate on other Veterinary interests. Our aim is provide an integrative approach toward medicine combining standard medical and surgical therapies with nutritional, acupuncture or herbal options where appropriate.\n\nSinnamon Park Vet and Pet Emporium offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Emergency\n• Grooming\n• Microchipping\n• Neutering and surgery\n• Dentistry\n• Vaccinations\n• Diagnostics\n• Laboratory tests\n• Preschool and behavioural advice\n• Euthanasia\n\nand more.', 'A', '{"1":[[0.3333333333,0.4583333333],[0.6458333333,0.75]],"2":[[0.3333333333,0.4583333333],[0.6458333333,0.75]],"3":[[0.3333333333,0.4583333333],[0.6458333333,0.75]],"4":[[0.3333333333,0.4583333333],[0.6458333333,0.75]],"5":[[0.3333333333,0.4583333333],[0.6458333333,0.75]],"6":[[0.375,0.6041666667]]}', 'https://www.facebook.com/Sinnamon-Park-Vet-and-Pet-Emporium-159413784112076/', '', '', '', '', '', 'https://plus.google.com/100783746715348023031/about'),
  (83960, 'smithfield-veterinary-services-83960', 'Smithfield Veterinary Services', '', 'Smithfield Veterinary Services located in Smithfield specialises in vaccinations, consultations, dental care, preventative medicine, cardiac assessment, desexing and many more.', 270499, '2015-09-18 05:05:28', '2016-04-12 00:11:23', '', 191, 2777, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 270499, 0, 'Shop 4', 'djmvds@bigpond.com', '0740381666', '', '', '', 'http://www.smithfieldveterinaryservices.com.au', 'Smithfield Veterinary Services is a state-of-the-art clinic dedicated to providing the very best care to animals for miles around since 2012. Very few things in life mean as much to us as the pets we keep, after all. \n\nWhen there’s a problem, they deserve nothing but the same level of expert treatment as you’d expect for any other member of the family. That’s our most basic guiding principle here at Smithfield Veterinary Services, and we stop at nothing to uphold it.\n\nWhatever your best friend needs, we’ll do everything in our power to get them well again. We do everything from routine check-ups to surgical procedures, and even have the option of an all-natural treatment plan for those seeking less-invasive medical care. \n\nNeedless to say, it’s entirely up to you (and your pet, of course). Whatever you decide, it’s our pleasure to get your furry friend back on all four paws.\n\nAt Smithfield Veterinary Services, our expertly-trained staff are completely dedicated to helping your pet along the road back to vitality. We’re able to provide a huge range of medical services, and one of our main goals is to keep everything as affordable as possible. We’ll keep you completely informed every step of the way, and the final say in every decision will always be yours.\n\nWe always encourage regular check-ups here at Smithfield, and not just because we love seeing you and your pets so much! It’s very important to touch base regularly for tests and preventative measures. The earlier we catch something, the more effectively we can treat it, and there’s no better way to solve a problem than to stop it from happening in the first place. \n\nSmithfield Veterinary Services offers a comprehensive range of veterinary and pet health-related services, including: \n\n• Vaccinations for dogs, cats and rabbits\n• Dietary and nutritional advice, education and planning\n• Dental care (this one’s vital for the more venerable pets)\n• Preventative measures against potentially dangerous parasites, such as fleas and worms\n• Cardiac assessment\n• Access to a high-tech lab for conducting all sorts of tests, including blood, urine, ultrasound and radiology\n• De-sexing\n• De-worming\n• Dental care\n• BAER hearing tests\n• Stem sell treatment for joints and tendons\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.5416666667]]}', '', '', '', '', '', '', ''),
  (83963, 'wide-bay-veterinary-surgery-83963', 'Wide Bay Veterinary Surgery', '', 'Wide Bay Veterinary Surgery located in Pialba specialises in health checks, vaccinations, flea and tick control, microchipping, dentistry, radiography, clinical pathology, surgery and many more.', 271381, '2015-09-18 05:05:40', '2016-04-13 01:47:54', '', 191, 2498, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271381, 0, 'Melory Place', '', '0741244874', '', '', '', 'http://www.widebayvets.com.au', 'Wide Bay Veterinary Surgery provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarian are all passionate about pets and avid animal lovers.\n\nAt Wide Bay Veterinary Surgery, you’ll be fully supported with sound advice first and foremost. We know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you’ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and a pharmaceutical store we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at your next scheduled visit.\n\nWide Bay Veterinary Surgery has been an integral part of our local community for years. In that time, we’ve helped thousands of our clients cats & dogs, guinea pigs and even rats. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.\n\nWide Bay Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Health checks\n• Vaccination\n• Flea and tick control\n• Microchipping\n• Dentistry\n• Radiography\n• Clinical Pathology\n• Blood tests\n• Pet insurance\n• Desexing\n• Orthopaedic\n• Ophthalmic\n• Emergency procedures\n• Arthritis management\n• Behavioural advice\n• Nutritional advice\n• Grooming \n• Puppy preschool\n\nand more.', 'A', '{"1":[[0.3333333333,0.7291666667]],"2":[[0.3333333333,0.7291666667]],"3":[[0.3333333333,0.7291666667]],"4":[[0.3333333333,0.7291666667]],"5":[[0.3333333333,0.7291666667]],"6":[[0.3541666667,0.4791666667]]}', 'https://www.facebook.com/Wide-Bay-Vet-Surgery-133899426663560/?fref=ts', '', '', '', '', '', ''),
  (83973, 'littlehampton-veterinary-clinic-83973', 'Littlehampton Veterinary Clinic', '', 'Littlehampton Veterinary Clinic locate in Littlehampton specialises in dentistry, acupuncture, nutrition advice, vaccinations, speys and castrations, general wellness checks, puppy preschool and more.', 272834, '2015-09-18 05:06:20', '2016-04-15 00:39:49', '', 191, 2053, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 272834, 0, '', 'littlehamptonvet@bigpond.com', '0883983988', '', '', '0883983998', 'http://littlehamptonvet.com.au/', 'Littlehampton Veterinary Clinic have been in Littlehampton, in the Mt Barker District Council area, for 10 years. The majority of our clients are from the local area, although many are located all around the Adelaide area. We even have one client that comes from Cooper Pedy for his dog’s heart treatment!\n\nWe offer a wide range of services including emergency medical and surgical care. If your pet becomes acutely ill or is injured, we have a state of the art blood testing machine and X-ray equipment that can help our staff to correctly assess your cats or dog’s medical status and treat them appropriately in minutes.\n\nLittlehampton Veterinary Clinic specialise in treating complex medical and surgical cases. Dr. Catherine Motter, the owner and head veterinarian of the practice specialises in diagnosing and treating serious medical conditions that can affect cats and dogs. She also loves teaching clients about how to feed their pets a nutritious diet that doesn’t cost the earth, thus improving their quality and quantity of life. Catherine is a true animal lover and has devoted her life to her clients and their pets.\n\nCatherine is supported by an amazing staff. Jo Meerbach has been head nurse for over six years. Her tremendous sense of humour, warm heart and breadth of knowledge about veterinary medicine is inspiring to all our clients. Grace Haydon and Lana McCreight are both highly competent nurses with a deep love of animals and compassion for people.\n\nLittlehampton Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Dentistry\n• Acupuncutre\n• Nutrition advice\n• Wildlife care\n• Vaccinations\n• Speys and castrations\n• General wellness checks\n• Preventative care\n• Intensive care facilities\n• Weight monitoring\n• Puppy preschool\n• X-ray facilities\n• In-house laboratory testing\n• Surgical procedures\n\nand more.', 'A', '{"1":[[0.3541666667,0.75]],"2":[[0.3541666667,0.75]],"3":[[0.3541666667,0.75]],"4":[[0.3541666667,0.75]],"5":[[0.3541666667,0.75]],"6":[[0.3541666667,0.5416666667]]}', 'https://www.facebook.com/littlehamptonveterinaryclinic/', '', '', '', '', '', ''),
  (83978, 'marmion-vet-centre-83978', 'Marmion Vet Centre', '', 'Marmion Vet Centre located in Marmion specialises in vaccinations, worming and flea treatments, heartworm prevention, home euthanasia, microchipping, radiology, dentistry and many more.', 271734, '2015-09-18 05:06:40', '2016-04-13 23:07:44', '', 191, 2363, 'pet care\nveterinary surgeons\nveterinary hospital\npets\nvets', 271734, 0, 'Suite 9', 'marmionvetcentre@bigpond.com', '0892430688', '', '', '', 'http://www.marmionvetcentre.com.au', 'Marmion Vet Centre is an independent clinic providing an experienced, personal service to our clients and their pets. We understand that pets are part of the family so as well as providing professional and experienced veterinary care, we also pride ourselves on providing a personal service.\n \nWe are open six days a week for consultations and surgeries are performed Monday to Friday. \n \nWe have a modern, well-equipped surgery at our clinic which includes facilities for radiology, pathology, animal dentistry.  We also have a full team of nurses who, alongside the vets, care for our patients in our hospital.\n\nMarmion Vet Centre offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations\n• Worming and flea treatments\n• Heartworm prevention\n• Home euthanasia\n• Microchipping\n• Pathology\n• Radiology\n• Dentistry\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/113832260246098982288/about'),
  (83982, 'port-kennedy-veterinary-hospital-83982', 'Port Kennedy Veterinary Hospital', '', 'Port Kennedy Veterinary Hospital located in Port Kennedy specialises in surgical procedures, senior pet health check, weight loss program, puppy preschool, grooming, diagnostics and many more.', 271824, '2015-09-18 05:06:57', '2016-04-14 00:59:55', '', 191, 2312, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 271824, 0, 'Unit 1', 'admin@portkennedyvet.com.au', '0865555149', '', '', '0895246626', 'http://www.portkennedyvet.com.au', 'Port Kennedy Veterinary Hospital led by Dr David Hoare, a small one vet practice into the bustling seven vet and eighteen support staff practice we have today. Throughout this period many changes have taken place, including the purchase of the neighbouring property in 2004, combining the two premises and effectively doubling the size of the practice. Since that time we have evolved to provide the local community with an exceptional clinical facility, with access to some of the latest technologies that veterinary medicine has to offer.\n\nAll the staff at Port Kennedy Veterinary Hospital value the opportunity to provide support to the next generation of veterinarians and veterinary nurses, by providing multiple work experience placements throughout the year. In fact you may get the opportunity to see this training process in action, as many of the veterinary students shadow our clinicians during the consultation process, gaining valuable exposure to the ‘real life’ skills needed to become a successful veterinarian.\n\n2011 was World Veterinary Year celebrating 250 years since the establishment of the very first veterinary school. To honour this milestone, we have taken the opportunity to provide some of our own educational support to the community with nurses, Meg and Laura-Lee and Dr Maggs Horsley visiting local primary schools to talk about healthy pets. We feel privileged to be a part of such a diverse and rewarding industry and look forward to being actively involved in the community in the future.\n\nAt our core, the team at Port Kennedy Veterinary Hospital understand, value and respect the very special nature of the human-animal bond and dedicate ourselves daily to the alleviation of pain and suffering and restoration of health with the aim of achieving quality of life for your closest friends.\n\nPort Kennedy Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• General health checks\n• Vaccinations\n• Desexing\n• Dentistry\n• Digital radiography\n• Surgical procedures\n• In-house laboratory testing\n• Weight loss program\n• Puppy preschool\n• Pet grooming services\n\nand more.\n', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]],"6":[[0.2916666667,0.7083333333]],"0":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/PortKennedyVeterinaryHospital', '', '', '', '', '', ''),
  (83984, 'vital-vet-animal-hospital-83984', 'Vital Vet Animal Hospital', '', 'Vital Vet Animal Hospital located in Ellenbrook specialises in radiology, pathology, surgical procedures, dentistry, weight management plan, hydrobathing, microchipping and many more.', 272236, '2015-09-18 05:07:05', '2016-04-14 05:47:21', '', 191, 2229, 'pet wash\npet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 272236, 0, 'Unit 1A', 'vitalvet@bigpond.com', '0862967711', '', '', '0862967755', 'http://www.vitalvet.com.au', 'Vital Vet Animal Hospital is a young veterinary hospital located in the growing suburb of Ellenbrook, Western Australia.\n\nAlong with providing pet care for dogs, cats and small animals in Ellenbrook – We also service provide top vet care for surrounding suburbs including The Vines, Henley Brook, Aveley, Baskerville, Upper Swan, Bullsbrook, Whiteman, Whiteman Edge, Brigadoon and The Swan Valley.\n\nEven if you live outside of these areas, please get in contact to arrange an appointment.\n\nWishing you a healthy and happy pet.\n\nVital Vet Animal Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Radiology\n• Pathology\n• Surgical procedures\n• Dentistry\n• Weight Management Program\n• Hydrobathing\n• Microchipping\n• Castration\n• Sterilisation\n• Vaccination\n• X-rays\n• Blood test\n• Puppy school\n\nand more.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/VitalVetAnimalHospital', '', '', '', '', '', ''),
  (83986, 'my-best-friend-veterinary-centre-83986', 'My Best Friend Veterinary Centre', '', 'My Best Friend Veterinary Centre located in Leederville specialises in acupuncture, advanced surgical procedures, behaviour consultations, boarding, complete companio animal care and many more.', 271770, '2015-09-18 05:07:13', '2016-04-13 23:51:36', '', 191, 2343, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271770, 0, 'Unit 3', 'welcomemybestfriendvet@iinet.net.au', '0892278666', '0892040400', '', '0892278668', 'http://mvol.com.au/MyBestFriendVets.aspx', '', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.7916666667]],"4":[[0.3333333333,0.7916666667]],"5":[[0.3333333333,0.7916666667]],"6":[[0.3333333333,0.6666666667]]}', '', '', '', '', '', '', '');
