  (83988, 'irrawang-veterinary-hospital-83988', 'Irrawang Veterinary Hospital', '', 'Irrawang Veterinary Hospital located in Raymond Terrace specialises in diagnostic and therapeutic services, surgical services, anaesthesia, internal medicine consultation, radiology, dentistry & more.', 274644, '2015-09-18 05:07:21', '2016-04-19 01:58:47', '', 191, 1444, 'pet care\nveterinary surgeons\npet grooming\nveterinary hospital\npets\nvets', 274644, 0, 'Unit 3', 'reception@irrawangvet.com.au', '0249871898', '', '', '', 'http://www.irrawangvet.com.au', 'Irrawang Veterinary Hospital is a well-established, full-service, small animal veterinary hospital providing comprehensive medical, surgical and dental care.\n\nPrincipal Veterinarian Dale purchased the Irrawang practice in 1998 and later founded the Thornton branch in 2002. We mainly provide care to small animals, including pocket pets. We started with 2 employees and currently have 15 team members.\n\nIrrawang Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Diagnostic and therapeutic services\n• Surgical services\n• Anaesthesia\n• Internal medicine consultations\n• Radiology services\n• Electrocardiography services\n• Dentistry\n• Laboratory\n• Microchipping\n• Parasite control and prevention\n• Behavioural counselling\n• Grooming\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.7708333333]],"5":[[0.3333333333,0.75]],"6":[[0.3333333333,0.5208333333]]}', 'https://www.facebook.com/Irrawang-Thornton-Veterinary-Hospitals-297842318584/', '', '', '', '', '', ''),
  (83992, 'ingleburn-veterinary-hospital-83992', 'Ingleburn Veterinary Hospital', '', 'Ingleburn Veterinary Hospital located in Ingleburn specialises in vaccinations, parasite control and prevention, desexing, arthritis management, weight management, emergency services and many more.', 274630, '2015-09-18 05:07:37', '2016-04-19 01:48:33', '', 191, 1448, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 274630, 0, 'Unit 4', 'mail@ingleburnvet.com.au', '0298291947', '', '', '', 'http://www.ingleburnvet.com.au', 'Ingleburn Veterinary Hospital are committed to providing high quality health care for family pets. We are on the corner of Williamson Road and Noonan Road (enter via Noonan Road) on the industrial side of Ingleburn. From Ingleburn, head North up Cumberland Road and turn Left at the big round-a-bout onto Henderson Road. This will take you over the railway line. At the second round-a-bout, turn left onto Williamson Road. Noonan Road is the first left.\n\nWe currently have a team of 9 veterinarians and 11 nurses and lay staff. Further information about our staff can be found on our staff pages.\n\nAll of our staff are well-trained and dedicated to providing the highest quality care to you and your pets. Continuing education ensures that we stay up-to-date with the latest advances in veterinary medicine and all aspects of pet care.\n\nIngleburn Veterinary Hospital meets the highest registration standards set by the Veterinary Practitioners Board of New South Wales. It was purpose-built (not converted from a shop or house) to provide the best possible facilities.\n\nIngleburn Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Emergency services\n• Consultations\n• Puppy preschool\n• Boarding\n• Surgical procedures\n• Diagnostic services\n• Microchipping\n• House calls\n• Wildlife care services\n\nand more.', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.7083333333]],"0":[[0.4166666667,0.5]]}', 'https://www.facebook.com/ingleburnvet/', '', '', '', '', '', 'https://plus.google.com/112932952802083325733/about'),
  (83995, 'greenway-drive-veterinary-clinic-83995', 'Greenway Drive Veterinary Clinic', '', 'Greenway Drive Veterinary Clinic located in Tweed Heads South specialises in complete physical exams, general medicine, surgical procedures, dental care, radiology, laboratory testing and many more.', 274486, '2015-09-18 05:07:49', '2016-04-18 23:57:46', '', 191, 1496, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 274486, 0, 'Unit 7', 'admin@greenwaydrvet.com.au', '0755248111', '', '', '0755248799', 'http://www.greenwaydrvet.com.au', 'Greenway Drive Veterinary Clinic have been serving the Tweed Heads area for close to 20 years. There is a strong tradition of friendly family pet health care at both practices. The reason each practice has been successful is the attention to high quality medicine and surgery. The vets and nurses are honest, caring and hard working. Everyone’s goal is to keep your pet healthy and bring them back to good health when unwell.\n\nGreenway Drive Veterinary Clinic have a commitment to maintaining our hospitals in a clean and modern presentation. Our equipment is updated and improved through regular financial reinvestment. This allows us to offer you the best care for your pet that we can.\n\nWe enjoy being a part of the local community and we consider ourselves privileged when you chose us to take care of your much loved family pet.\n\nGreenway Drive Veterinary Clinic offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Complete physical exams\n• General medicine\n• Surgery\n• Dental care\n• Radiology\n• Ultrasound\n• In-hospital laboratory testing\n• Microchipping\n• Vaccinations\n• Yearly heartworm injection\n• Flea and tick control\n• Puppy preschool\n• Behaviour management\n\nand more.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/greenwaydriveandkingscliffvets/', '', '', '', '', '', ''),
  (87822, 'caparezza-espresso-87822', 'Caparezza Espresso', '', 'Caparezza Espresso located in  Adelaide sepecialises in Breakfast, Lunch, Coffee and Drinks.', 274192, '2015-10-02 05:42:31', '2016-04-18 06:42:51', '', 191, 1588, '', 274192, 0, '', 'espresso@caparezza.com.au', '0882216202', '', '', '', 'http://www.caparezza.com.au', 'Caparezza Espresso opened its doors on March 30, 2012. Initially serving espresso coffee, pastries, panino and Italian sodas within months it was obvious that we had outgrown our premesis. \n\nCaparezza Espresso decided to expand into the adjoining tenancy also expanding our food offering with the addition of our traditional home cooked pasta dishes, antipasti platters and daily specials that have been in our family for all of our lives.\n\nQuality espresso, house made panini, home-made pasta and mouth watering pastries. Also serving italian wines, italian artisan beers & italian cocktails.\n\nWe at Caparezza Espresso Bar make it our mission to source the best quality ingredients and products available in Adelaide and Australia for our coffee, our panini and our pastries. We offer a fantastic selection of coffee blends, a great selection of gourmet panini and piadina. Our pastries are sourced from several of Adelaide''s finest patisseries with only one thing in mind, absolute quality. There is no compromise when it comes to sweets you either satisfy or you don''t, and ours do! From our almond croissants, chocolate filled pastries, divine tarts, pana cotta or tiramisu and the little things like our traditional biscotti and macarons we hit the mark everytime. Apart from all of that, we have an ever changing selection of pizzette, frittata, bruschetta and all things made in the european fashion.', 'A', '{"1":[[0.25,0.6666666667]],"2":[[0.25,0.6666666667]],"3":[[0.25,0.6666666667]],"4":[[0.25,0.6666666667]],"5":[[0.25,0.6666666667]],"6":[[0.2916666667,0.625]]}', 'https://www.facebook.com/CaparezzaEspressoBar', 'https://twitter.com/caparezzaesp', '', '', '', '', ''),
  (87832, 'chocolatree-87832', 'Chocolatree', '', 'Chocolatree located in North Adelaide specialises in Lunch, Dinner, Coffee and Drinks.', 274256, '2015-10-02 05:43:07', '2016-04-18 07:08:35', '', 191, 1568, '', 274256, 0, '', 'chocolatree@live.com.au', '0883670443', '', '', '', 'http://www.chocolatree.net', 'Chocolatree is a chocolate & dessert café established in the heart of North Adelaide as a café specializing in the use of refined cocoa in both chocolates & desserts.\n\nChocolatree offers quality coffee, decadent desserts and handmade Belgian chocolates from the finest ingredients and great combination of fresh fruits and flavors. Come in for a coffee, lunch, dinner or dessert and enjoy the wide variety of creative dishes that we have on offer.\n\nChocolatree has a huge range of warm & cold yummy Desserts, Macarons as well as handmade & molded chocolates. All our desserts & cakes are made with the finest ingredients. We have all your traditional favourites and some of Chocolatree''s exclusives.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0]],"6":[[0.4166666667,0]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/chocolatreenorthadelaide', '', '', '', '', '', ''),
  (87875, 'fair-espresso-87875', 'Fair Espresso', '', 'Fair Espresso located in Adelaide specialises in Breakfast, Brunch, Vegan and Vegetarian.', 274296, '2015-10-02 05:45:39', '2016-04-18 07:31:40', '', 191, 1557, '', 274296, 0, '', 'info@fairespresso.com.au', '0882215566', '', '', '', 'http://www.fairespresso.com.au', 'Fair Espresso is a team of passionate baristas and foodies, hoping to make a positive difference to the world by supporting the Fairtrade movement. We love making good coffee, using the freshest organic beans and organic milk (Mmmm)… and we can all feel good about the fact that the farmers on the other end who have worked hard to grow and harvest these precious beans, have been given a fair go!\n\nRose and Matt Lazarus began Fair Espresso as there was a demand for better coffee at South Australian events. They began trading in 2009 from a single coffee cart at Adelaide events and markets. The business continued to grow and they began trading with more coffee vans at many of the state’s largest events including the Royal Adelaide Show, Clipsal 500, the Tour Down Under, AFL football games, Adelaide International 3 Day Event and many more.\n\nThe demand for their amazing coffee and fantastic service pushed them to open their first espresso bar in James Place, Adelaide. The iconic espresso bar has won many awards in the last few years including ‘Fairtrade Café of the Year’ for 2013 for its commitment to supporting Fairtrade farmers and Bean Hunter’s ‘Top Cafes in Adelaide’ for their dedication to great coffee.\n\nFair Espresso has become famous for their organic produce, alternative milk range (soy, oat, almond, rice, coconut, lactose free), and the vegetarian and vegan menu options.\n\nCome and say hello to the friendly team today and try their extensive range of Fairtrade coffee, teas, cakes, organic juices, iced drinks and delicious breakfast and lunch menu!', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/FairEspresso', 'https://twitter.com/FairEspresso', '', '', '', '', ''),
  (87882, 'freestyle-espresso-87882', 'Freestyle Espresso', '', '', 272386, '2015-10-02 05:46:04', '2016-04-14 06:47:03', '', 191, 2193, '', 272386, 0, '', 'hello@freestyle-espresso.com.au', '0396964396', '', '', '', 'http://www.freestyle-espresso.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/FreestyleEspresso', 'https://twitter.com/freestylemelb', '', '', '', '', 'https://plus.google.com/101458319233995786250/about'),
  (87884, 'galleon-cafe-87884', 'Galleon Cafe', '', '', 0, '2015-10-02 05:46:11', '2016-04-14 07:08:47', '', 191, 2179, '', 0, 0, '', 'galleon.cafe@optusnet.com.au', '0395348934', '', '', '', 'http://galleoncafe.com.au', '', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.2083333333]],"4":[[0.2916666667,0.2083333333]],"5":[[0.2916666667,0.7083333333]],"6":[[0.2916666667,0.7083333333]],"0":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/Galleon-Cafe-142200179158789', '', '', '', '', '', ''),
  (87885, 'gardenworld-licenced-cafe-87885', 'Gardenworld Licenced Cafe', '', 'Gardenworld Licenced Cafe located in Braeside specialises in cakes, scones, muffins and biscuits, all-day breakfasts, hot and cold lunches, expertly brewed coffee and a wide tea.', 272460, '2015-10-02 05:46:15', '2016-04-14 07:02:25', '', 191, 2183, '', 272460, 0, '', 'danimc@netspace.net.au', '0397691019', '', '', '0397691030', 'http://www.gardenworldcafe.com.au', 'The management team at Gardenworld Licenced Cafe are focused on providing you with a destination where you can enjoy a casual dining experience in a relaxed and friendly environment.\n\nThe renovated indoor and outdoor areas and our licensed bar creates the perfect setting to enjoy breakfast, lunch, tea or coffee or a glass of wine with your friends.\n\nThe updated menu of Gardenworld Licenced Cafe offers a tempting variety of cakes, savouries and beverages, plus a wide selection of dishes for breakfast and lunch.\n\nGardenworld Licenced Cafe can take the hard work out of planning your next function or business meeting with our range of catering options and settings to suit your event. Ask us to tailor a menu to suit your needs and budget. Gift vouchers are available.\n\nGardenworld Licenced Cafe is available to cater for functions from gatherings, business meetings, social events, breakfasts and cocktail parties. We would love to hear about your next function catering needs.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (87888, 'ginger-s-coffee-studio-87888', 'Ginger''s Coffee Studio', '', 'Ginger''s Coffee Studio located in Goodwood specialises in Breakfast, Brunch, Burgers, Diners, Coffee, Drinks and Vegetarian cuisine.', 274342, '2015-10-02 05:46:25', '2016-04-18 07:58:00', '', 191, 1542, '', 274342, 0, '', 'ginger@gingerscoffeestudio.com.au', '0870732361', '', '', '', 'http://www.gingerscoffeestudio.com.au', 'Ginger''s Coffee Studio is a 70''s inspired coffee shop of excellence and attached Vintage Lounge Bar.\n\nGinger''s Coffee Studio is a place to sip the best single origin coffees, boutique beers, fine wines all delivered to you by our passionate Barista''s, to order the best breakfast, lunches and more in town. Bring a friend, meet a friend or make a friend - can''t wait to see you at Gingers!\n\nGinger''s Coffee Studio offer services for Walk-Ins, Good For Groups, Good For Kids, Take Out, Catering and Waiter Service.\n\nGinger''s Coffee Studio located in Goodwood specialises in Breakfast, Brunch, Burgers, Diners, Coffee, Drinks and Vegetarian cuisine.', 'A', '{"1":[[0.3125,0.6666666667]],"2":[[0.3125,0.6666666667]],"3":[[0.3125,0.6666666667]],"4":[[0.3125,0.6666666667]],"5":[[0.3125,0.6666666667]],"6":[[0.3333333333,0.6666666667]],"0":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/GingersCoffeeStudio', '', '', '', '', '', ''),
  (87893, 'grainhouse-bakery-cafe-87893', 'Grainhouse Bakery Cafe', '', 'Grainhouse Bakery Cafe located in Thebarton specialises in ', 274376, '2015-10-02 05:46:43', '2016-04-18 08:18:25', '', 191, 1536, '', 274376, 0, '', 'orders@grainhousebakery.com.au', '0883541112', '', '', '', 'http://grainhouse.com.au', 'Grainhouse Bakery Cafe established in 2000 is a South Australian family owned business which offers the best pie''s and pasty''s in town supplied by our own ''Grainhouse Wholefood Bakery''\n\nWith a big and efficient car park right out the front come down and check out our massive variety of Sandwiches, Baguettes, Wraps, Croissants, Pies, Pasties and our Bain Marie always has the tastiest hot asian & mediterranean dishes made daily.\n\nGrainhouse Bakery Cafe also take alot of pride into the quality of our COFFEE, ground daily on premesis we ensure your ''cuppa'' is exactly what you desire! whether it be a Cappucino, Latte`, Chai or even a hot chocolate or a green tea, whatever you want the bet is we have it and perfect it!\n\nCatering for corporate events or lunches is our specialty! no Job too big or small!\n\nCome in and meet the friendly girls in the Grainhouse Bakery Cafe and have a feed we guarentee will not disappoint! \n\nJust off Port Road at thebarton 5 minutes from the CBD\n', 'A', '{"1":[[0.25,0.6666666667]],"2":[[0.25,0.6666666667]],"3":[[0.25,0.6666666667]],"4":[[0.25,0.6666666667]],"5":[[0.25,0.6666666667]],"6":[[0.2916666667,0.625]]}', 'https://www.facebook.com/The-Grainhouse-Cafe-257404684282265', '', '', '', '', '', ''),
  (87894, 'grange-jetty-cafe-87894', 'Grange Jetty Cafe', '', 'Grange Jetty Cafe located in Grange specialises in Pizza, Pasta, Seafood, Steak -Italian and Meditteranean Cafe Menu.', 274396, '2015-10-02 05:46:47', '2016-04-18 08:30:28', '', 191, 1528, '', 274396, 0, '', 'grangejettycafe@hotmail.com', '0882350822', '', '', '', 'http://www.grangejettykiosk.com.au', 'Set on the beautiful sand dunes of one of the most popular beaches in Adelaide, The Grange Jetty Cafe offers spectacular views, friendly hospitality and serves up great coffee that is hard to stop at just one. The wide range of gelati and cakes will make it quite a hard decision for dessert but you can always come back and try them all.  \n\nCome in and try the popular but classic, fish and chips and salt and pepper squid salad that showcase the finest in seafood. The tasty gourmet pizzas and 350 gram rib eye steaks are to die for . \n\nThere is never a shortage of smiles and family feel with Phil and Marwan working alongside the staff to make it a great place for a casual meal or a place to meet friends for coffee and cake. There is also never a dull moment down at Grange, as it a popular stop over for international tourists , weddings and the frequent weather reports .\n\nGrange Jetty Cafe is Fully licensed and equipped with air-conditioning for the blazing summer heat and heaters for the cool chill of winter. Being only 15 minutes away from the city, we are a hotspot for local celebrities and football stars that enjoy coming for a meal and coffee. So, come down to the Grange Jetty Cafe and soak in the atmosphere while watching the sunset over the ocean.', 'A', '{"1":[[0.3333333333,0.9166666667]],"2":[[0.3333333333,0.9166666667]],"3":[[0.3333333333,0.9166666667]],"4":[[0.3333333333,0.9166666667]],"5":[[0.3333333333,0.9166666667]],"6":[[0.3333333333,0.9166666667]],"0":[[0.3333333333,0.9166666667]]}', 'https://www.facebook.com/GrangeJettyCafe', '', '', '', '', '', ''),
  (87895, 'green-orange-cafe-87895', 'Green Orange Cafe', '', '', 272525, '2015-10-02 05:46:50', '2016-04-14 07:17:10', '', 191, 2171, '', 272525, 0, '', 'cafe@greenorange.com.au', '0394575922', '', '', '', 'http://www.greenorange.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/greenorange.com.au', '', '', '', '', '', ''),
  (87896, 'gridlock-coffee-87896', 'Gridlock Coffee', '', 'Gridlock Coffee located in Heidelberg West specialises in Coffee.', 272579, '2015-10-02 05:46:54', '2016-04-14 07:32:01', '', 191, 2165, '', 272579, 0, '', 'info@gridlockcoffee.com.au', '0394599333', '', '', '', 'http://www.gridlockcoffee.com.au', 'At Gridlock Coffee Roasters, we continuously scour the globe for the finest seasonal green beans to create an unforgettable cup of coffee for you to enjoy.\n\nHead Roaster, Con Haralambopoulos, is a highly acclaimed champion barista with a long list of competition titles to his name, including World Latte Art Champion, with much of his success accredited to using his very own hand crafted blends.\n\nChoosing quality beans from around the world is what Gridlock Coffee is all about.\n\nFamily owned and based in Melbourne – we ship our wholesale and retail beans to all parts of Australia.\n\nGridlock Coffee''s blends and single origins can be found in many quality cafes and corporate offices and are favoured by home baristas.\n\nJoin us on our coffee journey as we pursue excellence in every aspect of roasting, and explore the best the world has to offer.', 'A', '{"1":[[0.25,0.6666666667]],"2":[[0.25,0.6666666667]],"3":[[0.25,0.6666666667]],"4":[[0.25,0.6666666667]],"5":[[0.25,0.6666666667]],"6":[[0.2916666667,0.625]]}', 'https://www.facebook.com/GridlockCoffee', 'https://twitter.com/Gridlock_Coffee', '', '', '', 'https://www.pinterest.com/GridlockCoffee/', 'https://plus.google.com/110878467147207537918/about'),
  (87920, 'juliana-s-cafe-87920', 'Juliana''s Cafe', '', 'Juliana''s Cafe located in Coburg specialises in breakfast, vegetarian food, sandwiches and coffee. ', 272669, '2015-10-02 05:48:19', '2016-04-14 08:39:49', '', 191, 2134, '', 272669, 0, '', 'info@jujuespresso.com.au', '0393863680', '', '', '', 'http://julianascafe.com.au', 'Juliana''s Cafe is an unpretentious eat in and takeaway cafe based in Coburg, Victoria. \n\nJuliana''s Cafe serve fresh, home-cooked meals including all-day breakfasts, vegetarian Indian food and freshly made sandwiches. We also serve delicious coffee.\n\nEnjoy Juliana''s Cafe''s all day breakfast inclusive of Bacon, eggs, toast, coffee, and orange juice, Vegetarian omelette, toast, orange juice and coffee, French toast served with maple syrup, orange juice and coffee, Pancakes, orange juice and coffee\n\nAll styles of coffee (including Chai Latte), Indian Masal Chai, Milkshakes, Freshly squeezed juice, Special Cake slice, Muffin, Banana Bread, Donut are available. ', 'A', '{"1":[[0.3125,0.8125]],"2":[[0.3125,0.8125]],"3":[[0.3125,0.8125]],"4":[[0.3125,0.8125]],"5":[[0.3125,0.8125]],"6":[[0.3541666667,0.7083333333]],"0":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/Julianas-Cafe-127340420661938', '', '', '', '', '', 'https://plus.google.com/+JulianasCafeAu/posts'),
  (87924, 'karulo-cafe-87924', 'Karulo Cafe', '', '', 272673, '2015-10-02 05:48:33', '2016-04-14 08:43:24', '', 191, 2128, '', 272673, 0, '', 'info@karulo.com.au', '0393262212', '', '', '', 'http://www.karulo.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/Karulo-Cafe-607668182601312', '', '', '', '', '', ''),
  (87929, 'latte-cartelle-coffee-drive-thru-87929', 'Latte Cartelle Coffee Drive Thru', '', 'Latte Cartelle Coffee Drive Thru  located in Mulgrave specialises in Coffee Drive Thru.', 272697, '2015-10-02 05:48:51', '2016-04-14 09:14:07', '', 191, 2123, '', 272697, 0, '', 'info@lattecartelle.com.au', '1300783342', '', '', '', 'http://www.lattecartelle.com.au', 'Latte Cartelle Coffee Drive Thru is the coffee drive-thru choice for coffee lovers on the go. \n\nLatte Cartelle Coffee Drive Thru have highly skilled baristas, a delicious range of food and drinks and, of course, our Latte Cartelle Signature Blend. In fact the only thing missing from a café experience is the café.\n\nWhere did it all begin? Back in 2004 we die-hard coffee lovers realised that premium coffee didn''t have to be enjoyed in cafés. We wanted to bring freshly roasted coffee to people on the road. The concept of Latte Cartelle Coffee Drive Thru was born.\n\nThe first Latte Cartelle Coffee Drive Thru was launched in the Melbourne suburb of Elsternwick, and was such a runaway success that we soon opened our second store. Since 2009 we have opened two more stores including our first coffee drive thru franchise site, with new sites set to open around Australia.\n\nWe''re obviously doing something right with so many of our customers returning at least once a day to get their coffee prepared just the way they like it.\n\nWe think the success of Latte Cartelle Coffee Drive Thru is a combination of our convenient locations and friendly service – and the best coffee in town.', 'A', '{"1":[[0.2291666667,0.5416666667]],"2":[[0.2291666667,0.5416666667]],"3":[[0.2291666667,0.5416666667]],"4":[[0.2291666667,0.5416666667]],"5":[[0.2291666667,0.5416666667]],"6":[[0.25,0.5]]}', 'https://www.facebook.com/lattecartelle', '', '', '', '', '', 'https://plus.google.com/101546843654385495197/about'),
  (87939, 'love-on-cafe-deli-87939', 'Love On Cafe & Deli', '', 'Love On Cafe & Deli located in Mile End specialises in drinks, coffee, breakfast and lunch.', 274410, '2015-10-02 05:49:26', '2016-04-18 08:45:33', '', 191, 1522, '', 274410, 0, '', 'loveoncafe@gmail.com', '0882345935', '', '', '', 'http://www.loveoncafe.com.au', 'The flavor characteristics of a coffee bean are heavily influenced by where that bean is grown. Love On Cafe & Deli''s Generic coffee beans are grown in Brisbane and freshly roasted as we needed throughout the week. While it is common for different beans from different regions to be blended, only single blends can give you the complete experience of a region. Usually, Love On Cafe & Deli is able to stock such single origins throughout the year.\n\n An odd, contradictory gem of a cafe. We are called ''Loveon'' and frequented by (albeit presentable) hippies, yet cynical urbanites feel oddly at ease. It''s family-friendly, with a wall full of children''s drawings, yet the children themselves aren''t particularly obnoxious (hippie children are more chilled than regular children, discuss). Love On Cafe & Deli''s menu is wholesome and ethically sound, yet hearty and unpretentious. \n\n​Dessert is something sometimes customers give much attention on it, Love On Cafe & Deli make some taste regard this section that will bring you again just like its do when love is on !​', 'A', '{"1":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]],"6":[[0.2916666667,0.7083333333]],"0":[[0.2916666667,0.7083333333]]}', '', '', '', '', '', '', ''),
  (87942, 'mahalia-coffee-87942', 'Mahalia Coffee', '', 'Mahalia Coffee located in Robe specialises in Coffee and Drinks.', 274426, '2015-10-02 05:49:37', '2016-04-18 09:02:46', '', 191, 1518, '', 274426, 0, '', 'mahalia@mahaliacoffee.com.au', '0887682778', '', '', '0887682413', 'http://www.mahaliacoffee.com.au', 'There are few things in human history that have availed themselves to the expression of the soul and passions of the mind like coffee. Warm companion to the sharpest wits who have pondered our greatest awakenings in thought and deed. Revolution and social reinvention in smoky Parisian Café. Powerful intrigue and splendor in Viennese soiree. Intrepid cultural collision in art deco African cities.\n\nThe heart of most City, Town or Village throughout the world affords us a place were the spirit of the human condition flows and interacts with a buzzing vitality of contemporary vigor. Coffee has never, since its marriage to the human mind, been anywhere else but at the vanguard of our expression. This is the inspiration that drives Mahalia Coffee. A connection not only to the lively world of coffee connoisseurs but also the exotic passions of the lands where it grows and the rich histories it has infused.\n\nThe core philosophies of Mahalia Coffee are the pursuit of perfection and variety in flavour through the natural intrinsic flavours of coffee. We use no artificial flavour enhancers or additions. Each coffee origin used in our blends is chosen for its own integral flavour qualities and sourced from the entire global coffee farm. There is no compromise in the pursuit of perfect diversified flavour with our sources embracing all doctrines within the industry, rainforest alliance, fair trade, organics, shade grown, Swiss water method, or none of the above. And from all coffee growing countries including Australia. In short, if it tastes good, it''s in! Mahalia Coffee is and intends to remain an epicurean roasting house. Focusing on quality rather than quantity, and flavour over cost.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.7083333333]],"0":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/mahaliacoffee', 'https://twitter.com/mahaliacoffee', '', '', '', '', ''),
  (87945, 'manoli-s-mezes-mediterranean-cafe-87945', 'Manoli''s Mezes Mediterranean Cafe', '', '', 0, '2015-10-02 05:49:48', '2016-04-19 03:29:27', '', 191, 1390, '', 0, 0, '', 'mickeysmail@adopt.net.au', '0881863944', '', '', '', 'http://www.eatoutadelaide.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', '', '', '', '', '', '', ''),
  (87947, 'mart-130-cafe-87947', 'Mart 130 Cafe', '', 'Mart 130 Cafe located in Middle Park specialises in breakfast, lunch, coffee and drinks.', 272862, '2015-10-02 05:49:55', '2016-04-15 00:56:17', '', 191, 2038, '', 272862, 0, '', 'mart130cafe@gmail.com', '0396908831', '', '', '', 'http://www.mart130cafe.com.au', 'Mart 130 Cafe located in the heart of Middle Park, this quaint and cosy old station building has been converted into a modern cafe, offering a sensational breakfast / lunch menu. Either sit inside or outside on the open, heated deck, looking over Albert Park Lake. \n\nMart 130 Cafe offers a contemporary take on the standard breakfast menu and is known internationally for its Corn Fritters and eggs numbered 1 throughout to 5. Mart 130 Cafe''s vibrant buzzing atmosphere creates the perfect place for a lazy weekend brunch with friends or a weekday meal.', 'A', '{"1":[[0.3125,0.625]],"2":[[0.3125,0.625]],"3":[[0.3125,0.625]],"4":[[0.3125,0.625]],"5":[[0.3125,0.625]],"6":[[0.3125,0.625]],"0":[[0.3125,0.625]]}', '', '', '', '', '', '', 'https://plus.google.com/+Mart130MiddlePark/about'),
  (87952, 'meeting-hub-cafe-87952', 'Meeting Hub Cafe', '', '', 0, '2015-10-02 05:50:13', '2016-04-15 01:10:07', '', 191, 2024, '', 0, 0, '', 'meetinghubcafe@gmail.com', '0385285440', '', '', '', 'http://www.meetinghubcafe.com', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/meetinghubcafe', '', '', '', '', '', 'https://plus.google.com/109085931807537556541/about'),
  (87955, 'mocha-jo-s-cafe-bar-87955', 'Mocha Jo''s Cafe Bar', '', 'Mocha Jo''s Cafe Bar located in Glen Waverley specialises in Breakfast, Lunch, Dinner, Coffee and Drinks.', 272912, '2015-10-02 05:50:23', '2016-04-15 01:24:59', '', 191, 2011, '', 272912, 0, '', 'info@mochajos.com.au', '0395608444', '', '', '', 'http://www.mochajos.com.au', 'For more than 12 years Mocha Jo''s Cafe Bar has been proud to call itself ‘a home away from home’ for both locals and visitors to the area. With the Novotel and Village cinema complex development in the late 90’s, the previously sombre suburb of Glen Waverley was re-incarnated. This gave birth to the idea of a much needed, comfortable, friendly place to have good coffee and quality breakfast, lunch or dinner in an atmosphere designed for meeting friends, and making them.\n\nAfter many rigorous months of planning, Mocha Jo''s Cafe Bar was born on Mothers Day in the year 2000. Locals immediately welcomed their latest neighbour and quickly made the new corner favourite a suburban landmark. True to its calling, Mocha Jo’s has upheld its passion for providing good quality product and service while keeping up with a decade of change in the bustling suburb of Glen Waverley and its surrounds.\n\nA visit to Mocha Jo''s Cafe Bar, re-confirms an atmosphere that is a true reflection of our people and we are forever grateful to our invaluable, loyal customers who have also become our friends.', 'A', '{"1":[[0.2708333333,0.9791666667]],"2":[[0.2708333333,0.9791666667]],"3":[[0.2708333333,0.9791666667]],"4":[[0.2708333333,0.9791666667]],"5":[[0.2708333333,0.9791666667]],"6":[[0.2916666667,0.9791666667]],"0":[[0.2916666667,0.9791666667]]}', 'https://www.facebook.com/mochasglenwaverley', '', '', '', '', '', ''),
