  (87966, 'p-g-bakery-cafe-87966', 'P&G Bakery Cafe', '', 'P&G Bakery Cafe located in Geelong specilises in Breakfast, Lunch, Coffee and Drinks.', 272944, '2015-10-02 05:51:02', '2016-04-15 01:36:22', '', 191, 1976, '', 272944, 0, '', 'pfieldy@optusnet.com.au', '0352290029', '', '', '', 'http://www.pgbakerycafe.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/pgbakerycafe/', '', '', '', '', '', ''),
  (87968, 'pavilion-cafe-bar-87968', 'Pavilion Cafe & Bar', '', 'Pavilion Cafe & Bar located in Warrnambool specialises in Breakfast, Lunch, Coffee and Drinks.', 272948, '2015-10-02 05:51:09', '2016-04-15 01:50:13', '', 191, 1968, '', 272948, 0, '', 'contact@pavilion.net.au', '0355611551', '', '', '', 'http://www.pavilion.net.au', 'The Pavilion Café & Bar offers great coffee, breakfast and lunch 7 days a week from 8am – 5pm.\n\nThe Pavilion is also available for special events, functions and parties – including weddings.\n\nIt is hard to imagine a more spectacular setting for your next function or wedding than the Pavilion Café & Bar. Located at Warrnambool’s Breakwater with unsurpassed views of Lady Bay, the Merri River, Middle Islands and the Southern Ocean, the Pavilion Cafe & Bar offers a unique, stylish and superb setting for your special event.\n\nWith an extensive deck area, contemporary decor along and a fully glazed aspect from all indoor areas, the Pavilion is a truly unique venue that is sure to impress you and your guests, whatever the occasion.\n\nWe, at the Pavilion Cafe & Bar, enjoy and look forward to taking care of all your needs right from initial planning stages through to the brilliant and successful completion of your special event.\n\nThe Pavilion Cafe & Bar offers exclusive use of either the upstairs or downstairs function spaces, both with outdoor decking areas.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3333333333,0.7083333333]],"0":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/Pavilion-cafe-bar-226280594052287/', '', '', '', '', '', ''),
  (87974, 'port-xpresso-cafe-87974', 'Port Xpresso Cafe', '', '', 273002, '2015-10-02 05:51:31', '2016-04-15 02:04:26', '', 191, 1956, '', 273002, 0, '', 'info@portxpresso.com', '0396452225', '', '', '', 'http://www.portxpresso.com', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', '', '', '', '', '', '', ''),
  (87978, 'public-caffe-87978', 'Public Caffe', '', 'Public Caffe located in Adelaide specailises in Breakfast, Lunch, Coffee and Drinks.', 274556, '2015-10-02 05:51:45', '2016-04-19 00:57:28', '', 191, 1468, '', 274556, 0, '', 'info@publiccbd.com.au', '0882318151', '', '', '', 'http://www.publiccbd.com.au', 'PUBLIC is a caffé, bar and function space located on Franklin Street, a short distance from Adelaide’s Victoria Square and CBD. \n\nPublic Caffe''s style is an eclectic mix of ‘old and new’, inspired by the theme of public spaces, such as old railway stations & grand libraries. PUBLIC is a destination eatery for the quick lunch or the lingering foodie. \n\nBegin your day with an outstanding coffee and gourmet breakfast from 7am. You can have our Kangaroo Island eggs as you like with Hamlet''s bacon and a side of smashed avocado or order our spicy tomato eggs. Something sweet is also on offer such as our Vanilla Brioche French Toast. For lunch, Public Caffe offer a full kitchen menu starting with snacks such as duck pancakes and chargrilled prawns to something bigger such as our range of house made pastas. Public Caffe also offer an awesome wagyu beef burger as well as our beautiful mains. For the on-the-go items we have gourmet rolls, and freshly house made salads. All of our desserts and pastries are made by our in-house pastry chef. \n\nSharing food with another human being is an intimate act & one that should not be indulged in lightly” M F K Fisher.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.9166666667]],"6":[[0.2916666667,0.7083333333]],"0":[[0.3333333333,0.5833333333]]}', 'https://www.facebook.com/publicCBD', 'https://twitter.com/publiccbd', '', '', '', '', ''),
  (87981, 'quali-t-teahouse-87981', 'Quali-T Teahouse', '', '', 273074, '2015-10-02 05:51:56', '2016-04-15 02:47:24', '', 191, 1929, '', 273074, 0, '', 'jun@qualitteahouse.com.au', '0398270588', '', '', '', 'http://www.QualiTTeahouse.com.au', '', 'A', '{"2":[[0.4583333333,0.75]],"3":[[0.4583333333,0.75]],"4":[[0.4583333333,0.75]],"5":[[0.4583333333,0.75]],"6":[[0.4583333333,0.75]],"0":[[0.4583333333,0.75]]}', '', '', '', '', '', '', ''),
  (87985, 'red-square-cafe-87985', 'Red Square Cafe', '', 'Red Square Cafe located in Cambridge specialises in breakfast, lunch, salad, burger, coffee and drinks.', 274746, '2015-10-02 05:52:10', '2016-04-19 02:53:28', '', 191, 1412, '', 274746, 0, '', 'manager@redsquarecafe.com.au', '0362485755', '', '', '', 'http://www.redsquarecafe.com.au', 'Red Square Cafe is a favourite meeting place for many all around the Hobart area.\n\nModern and quirky, spacious yet still cosy.  We constantly surprise our guests with our fun casual dining menu and outstanding specialty coffee offerings.\n\nWe are very family friendly.  With a secure gated playground for children and kids food and drinks menus, we continually prove our commitment to making Red Square Cafe the place for families to come together and share a meal.\n\nRed Square Cafe is Fully Licensed, open 7 days a week and breakfast is served all day... What more could you want? \n\nOur team eats, sleeps and makes coffee.  Red Square Cafe is obsess over every detail to makes sure that what ends up in the cup makes you smile.  In addition to our delicious house blend, we feature a hand picked rotating list of single origin, micro-lot and single estate coffees.  There''s always an excuse to stop by for coffee as if you really ever needed one\n\n', 'A', '{"1":[[0.3333333333,0.6666666667]],"2":[[0.3333333333,0.6666666667]],"3":[[0.3333333333,0.6666666667]],"4":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.6666666667]],"6":[[0.375,0.6666666667]],"0":[[0.375,0.6666666667]]}', 'https://www.facebook.com/redsquarecafetas', '', '', '', '', '', ''),
  (87987, 'rhapsody-s-cafe-87987', 'Rhapsody''s Cafe', '', 'Rhapsody''s Cafe located in Carlton North specialises in breakfast, lunch and drinks. ', 273198, '2015-10-02 05:52:17', '2016-04-15 03:38:07', '', 191, 1881, '', 273198, 0, '', 'info@rhapsodyscafe.com.au', '0393815573', '', '', '', 'http://www.rhapsodyscafe.com.au', 'Formerly two on Rathdowne, we took over the premises and established Rhapsody''s Cafe as a family business. Being new to Melbourne from Zambia, we bring with us the warm African ambiance, with a touch of our Greek background hospitality.\n\nRhapsody''s Cafe daily house baked cakes and slices and house cooked meals are fresh and tasty and our friendly, warm atmosphere will have you coming again and again. \n\nBreakfast menu running all day a selection of toasties, beef, chicken, lamb pies, fresh salads, light healthy lunches, cakes and pastries.\n\nRhapsody''s Cafe is a newly opened family and pet  friendly Cafe,  situated at the bottom end of Rathdowne Street in the quaint Rathdowne Village. We focus on great coffees, delicious freshly baked in house, cakes and pastries, and tasty light lunches.\n\nWe provide breakfast all day, and offer gluten free and vegetarian options.\n\n', 'A', '{"1":[[0.3333333333,0.6666666667]],"2":[[0.3333333333,0.6666666667]],"3":[[0.3333333333,0.6666666667]],"4":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.6666666667]],"6":[[0.3333333333,0.6666666667]],"0":[[0.375,0.6666666667]]}', 'https://www.facebook.com/rhapsodyscafemelbourne', '', '', '', '', '', 'https://plus.google.com/+RhapsodysCafeCarltonNorth/posts'),
  (87991, 'rivers-cafe-providore-87991', 'Rivers Cafe & Providore', '', 'Rivers Cafe & Providore located in Yarrambat specialises in breakfast or lunch or just relax with a coffee, delicious meal, dessert or sweet treats.', 273218, '2015-10-02 05:52:31', '2016-04-15 03:55:23', '', 191, 1876, '', 273218, 0, '', 'cafe@riversofyarrambat.com', '0394363210', '', '', '', 'http://www.riverscafe.com', 'Rivers Cafe & Providore invite you to discover all the wonderful things that we have to offer at our unique ''Lifestyle Centre''.\n\nRivers Cafe & Providore  opened in 1995 by Ian and Merilyn''s daughter Karen.  It built its reputation on a solid offer of fine foods and service and is recognised nationally as a leader amongst garden centre cafes.\n\nDine in our Rivers Cafe for breakfast or lunch or just relax with a coffee. Take home a delicious meal, dessert or sweet treat for you and your family from our Providore. Book your next special birthday, celebration or corporate event in one of our stunning Function and Event spaces or just come in to relax and ponder the many things that Rivers Cafe & Providore have on offer.', 'A', '{"1":[[0.3541666667,0.6875]],"2":[[0.3541666667,0.6875]],"3":[[0.3541666667,0.6875]],"4":[[0.3541666667,0.6875]],"5":[[0.3541666667,0.6875]],"6":[[0.3541666667,0.7083333333]],"0":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/RiversYarrambat', 'https://twitter.com/riversyarrambat', '', '', '', 'https://www.pinterest.com/riversyarrambat/', ''),
  (87997, 'sandbar-beach-cafe-87997', 'Sandbar Beach Cafe', '', '', 0, '2015-10-02 05:52:52', '2016-04-15 05:42:30', '', 191, 1856, '', 0, 0, '', 'info@sandbarbeachcafe.com.au', '0396966334', '', '', '', 'http://www.sandbarbeachcafe.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/SandbarBeachCafe', '', '', '', '', '', 'https://plus.google.com/104619290134328682843/about'),
  (88013, 'stickybeaks-playground-cafe-88013', 'Stickybeaks Playground Cafe', '', 'Stickybeaks Playground Cafe located in Perth specialises in breakfast, lunch, coffee and drinks.', 273793, '2015-10-02 05:53:53', '2016-04-18 02:03:29', '', 191, 1705, '', 273793, 0, '', 'roystickybeaks@bigpond.com', '0894814990', '', '', '', 'http://www.stickybeaksplayground.com.au', 'At Stickybeaks Playground Cafe, we pride ourselves on great customer service. All of our staff are experienced in the hospitality industry and know how to make a perfect cup of coffee. We make sure you get your food and drinks quickly and piping hot. Whether you''re on the run, or coming in to relax for a while, you''ll be impressed by the professional service at our restaurant café in West Perth.\n\nAt our friendly and relaxed restaurant café in West Perth, we always have the freshest coffee right when you want it. Stickybeaks Playground Cafe is conveniently located for you to pop by any time. Our friendly atmosphere will have everyone feeling relaxed. Drop in and see for yourself!\n\nStickybeaks Playground Cafe use only the highest quality beans that are certified fair trade produce. That means that not only are you getting the most delicious, smooth and rich blend, but you know that you are supporting sustainable practices that enrich the lives of the coffee producers.\n\nStickybeaks Playground Cafe uses only the best quality ingredients. That''s why you can be sure that all of our beverages and appetisers are healthy and delicious. You''ll be able to taste the difference. Our coffee is smooth and our pastries are fantastic. We know that you''ll love everything on the menu! We look forward to seeing the smile on your face the next time you visit our restaurant café in West Perth.', 'A', '{"1":[[0.3333333333,0.6666666667]],"2":[[0.3333333333,0.6666666667]],"3":[[0.3333333333,0.6666666667]],"4":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.6666666667]],"6":[[0.3333333333,0.6666666667]],"0":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/stickybeaksplaygroundcafe', '', '', '', '', '', ''),
  (88019, 'sunrise-cafe-88019', 'Sunrise Cafe', '', 'Sunrise Cafe located in Coolum specialises in breakfast, lunch, dinner and drinks.', 271792, '2015-10-02 05:54:17', '2016-04-14 00:40:43', '', 191, 2323, '', 271792, 0, '', 'info@sunrisecoolum.com.au', '0754717477', '', '', '', 'http://www.sunrisecoolum.com.au', 'Imagine starting a lazy weekend overlooking a beautiful beach as the sun slowly rises for the start of another perfect day, while you enjoy a great cup of coffee and a scrumptious breakfast with the waves crashing on the beach in the foreground.\n \nIf this sounds picture-perfect to you then Sunrise cafe and restaurant at Coolum Beach on the Sunshine Coast is the place for you!\n \n \nSunrise Cafe is located on the ground floor of The Beach Retreat Resort on David Low Way at Coolum Beach.\n \nThe restaurant is open for Breakfast, lunch and Dinner. It is the perfect place to stop in for a great coffee, a bite to eat or an ice cold beer, whilst enjoying the fantastic views of Coolum''s famous beach.\n\nSunrise Cafe also caters for functions including birthdays and business lunches.', 'A', '{"3":[[0.2916666667,0.875]],"4":[[0.2916666667,0.875]],"5":[[0.2916666667,0.875]],"6":[[0.2916666667,0.875]],"0":[[0.2916666667,0.875]]}', 'https://www.facebook.com/Sunrise-Cafe-Bar-Restaurant-100707803331144/', '', '', '', '', '', ''),
  (88026, 'tea-pot-cafe-88026', 'Tea Pot Cafe', '', 'Tea Pot Cafe located in Eltham specialises in breakfast, lunch, sandwiches and dessert.', 273397, '2015-10-02 05:54:45', '2016-04-15 06:32:04', '', 191, 1822, '', 273397, 0, '', 'bennychung3223@hotmail.com', '0394312611', '', '', '', 'http://teapotcafe.weebly.com', 'If you''re looking for a cafe to catch up with friends in or want to read a book in a quiet relaxed atmosphere then The Tea Pot Cafe @ Eltham Library is a right place for you\n\n Eltham is a north-eastern suburb to head to if you want a dose of the country without leaving Melbourne. Tea Pot Cafe is a Cafe and Restaurant for Breakfast and Lunch and its located next to the Eltham Library complex making the most of the winding veranda. The seating on the balcony overlooks the nearby Alistor Knox park and Shillinglaw Cottage and you feel suspended in the bush setting. \n\nIt is a great option if you''re walking your dog in the nearby parks and need to stop for refreshments, or alternatively it makes a convenient location for lunch or coffee break during an all day study session at the library.\n\nIt is also a wheely access which is easier for them to sit outside or inside the cafe to enjoy our meals. Tea Pot Cafe is available in booking for catering, function, lunch, and breakfasts.', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"5":[[0.375,0.6666666667]],"6":[[0.375,0.6666666667]],"0":[[0.375,0.6666666667]]}', '', '', '', '', '', '', '');
