  (88030, 'the-chocolate-cottage-88030', 'The Chocolate Cottage', '', 'The Chocolate Cottage located in Highfields specialises in breakfast, coffee, drinks and Chocolates.', 271896, '2015-10-02 05:55:01', '2016-04-14 01:45:07', '', 191, 2273, '', 271896, 0, '', 'thechocolatecottage@bigpond.com', '0746308729', '', '', '', 'http://www.chocolatecottage.com.au', 'The Chocolate Cottage situated on a grassy acreage overlooking unsurpassed views of the Toowoomba Range, the cafe has plenty of room for the family with shaded outdoor seating and warm indoor dining around a fireplace throughout winter.\n\nThe handpainted chairs, colourful décor and quirky giftware provides a perfect environment to indulge in our handmade chocolates, award winning cuisine and Lavazza coffee\n\nThe Chocolate Cottage and Café has a mantra that our love of food is served on every plate presented to our guests. We always use fresh local produce wherever possible and all meals are prepared in-house which has led to us winning numerous awards over the years from the Restaurant and Catering Association. Our innovative menu provides guests with our signature dishes as well as creative specials which change weekly. There are vegetarian and children''s options available as well as an extensive gluten-free and breakfast menu.\n\nThe Chocolate Cottage is a fully licensed venue with a good selection of local and imported wines and beers.\n\n', 'A', '{"1":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.3541666667,0.7083333333]],"0":[[0.3541666667,0.7083333333]]}', '', '', '', '', '', '', ''),
  (88040, 'the-hot-rock-cafe-88040', 'The Hot Rock Cafe', '', 'The Hot Rock Cafe located in Wannanup specialises in breakfast, lunch, kids meals, and drinks.', 273817, '2015-10-02 05:55:41', '2016-04-18 02:26:04', '', 191, 1694, '', 273817, 0, '', 'vagavao@hotmail.com', '0895344144', '', '', '', 'http://hotrockcafe.com.au/', 'The Hot Rock Cafe have brought together an excellent and dedicated staff culminating from decades of hard work and experience to open a restaurant that not only everyone can enjoy, but a fine restaurant we can be most proud of.\n\nThe Hot Rock Cafe''s years of experience have taught us how to listen to the needs of our customers, to help us provide them with a dining experience that they will remember and be anxious to tell all their friends and family where their next great meal should be.\n\nThe Hot Rock Cafe main goal is Good Service, Excellent Food, and a Delightful Atmosphere.\n\nSee if you can be first to spot the many dolphins that cruise up and down The Cut. Or just relax and enjoy the incredible views from your table.\n\nThe Hot Rock Cafe love kids! And we know a good meal with the entire family is important. Plan a luncheon or meeting while the children have fun.', 'A', '{"1":[[0.4166666667,0.625]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.3958333333,0.9166666667]],"0":[[0.3958333333,0.9166666667]]}', '', '', '', '', '', '', ''),
  (88042, 'the-lovebird-cafe-88042', 'The Lovebird Cafe', '', 'The Lovebird Cafe located in Armadale specialises in breakfast, lunch and drinks.', 273434, '2015-10-02 05:55:49', '2016-04-15 06:46:48', '', 191, 1812, '', 273434, 0, '', 'info@thelovebird.com.au', '0399953661', '', '', '', 'http://www.thelovebird.com.au', 'After years of creating a prodigious coffee and dining experience, the innovative ‘Lovebirds’ have soared away to a new nesting ground. The new owners of The Lovebird Cafe whom prefer to keep themselves anonymous have no problem in boasting about their proficient coffee and food background. Being avid coffee consumers for over a decade they both aim to provide their patrons with a remarkable dining experience in a great atmosphere.\n\n“Melbourne’s café culture is constantly growing and the number options that customers have accessible is endless, here at The Lovebird Cafe we aim to provide the gratification that you get from home style cooking whilst adding our own little concoctions and flavors that will appeal to even the fussiest of eaters. As one of the most renowned journalists, Dorothy Day once said – Food for the body is not enough, there must be food for the soul”\n\nThe Lovebird Cafe''s catering menus deliver gorgeous foods no matter what the occasion or size of the function. Whether it''s a conference with VIP guests or a cocktail party in your home, you can be assured that your guests will be talking about our food for a long time to come.', 'A', '{"1":[[0.25,0.6666666667]],"2":[[0.25,0.6666666667]],"3":[[0.25,0.6666666667]],"4":[[0.25,0.6666666667]],"5":[[0.25,0.6666666667]],"6":[[0.2916666667,0.625]]}', '', 'https://twitter.com/thelovebirdcafe', '', '', '', 'https://www.pinterest.com/thelovebirdcafe/', ''),
  (88043, 'the-metz-cafe-88043', 'The Metz Cafe', '', 'The Metz Cafe located in Launceston specialises in lunch, dinner, pizza, dessert and drinks.', 274766, '2015-10-02 05:55:53', '2016-04-19 03:14:56', '', 191, 1401, '', 274766, 0, '', 'info@metzcafebar.com.au', '0363317277', '', '', '', 'http://www.metzcafebar.com.au', 'The Metz Cafe Bar Launceston offers a relaxed dining atmosphere with exceptional service and restaurant quality meals, the Metz café bar is renowned for their Wood Fired Pizzas (dine in and take-away), and extensive al a cart menu with something to appeal to all tastes.\n\nThe Metz Cafe is open for Lunch and Dinner 7 days a week, and serve meals all day, everyday, from our All Day menu. Children''s menu also available.\n\nEnjoy a cold drink in our huge Alfresco area in Summer, or curl up on one of our lounges in Winter to enjoy a coffee and cake. Our Wine list hosts a range of the best Tasmanian, Australian and International wines, and is complemented by local and imported beers, and cocktails for those after something a little special.\n\nThe Metz Cafe will provide an outstanding experience to all cutomers. Whether dining, enjoying a drink outside or dancing to live music, our customers will enjoy the pleasant surroundings that the Metz has to offer.', 'A', '{"1":[[0.4583333333,0.9375]],"2":[[0.4583333333,0.9375]],"3":[[0.4583333333,0.9375]],"4":[[0.4583333333,0.9375]],"5":[[0.4583333333,0.9375]],"6":[[0.4583333333,0.9375]],"0":[[0.4583333333,0.9375]]}', 'https://www.facebook.com/The-Metz-Cafe-Bar-360011608740', '', '', '', '', '', 'https://plus.google.com/+THEMetzCafeBarLaunceston/about'),
  (88044, 'the-nook-caffe-88044', 'The Nook Caffe', '', 'The Nook Caffe located in Jindalee specialises in Breakfast, Lunch, Dinner, Coffee and Drinks.', 272082, '2015-10-02 05:55:57', '2016-04-14 03:31:27', '', 191, 2243, '', 272082, 0, '', 'pam@thenook.net.au', '0737157772', '', '', '', 'http://www.thenook.net.au', 'The Nook Caffe offers an award winning dining experience in the heart of the Centenary Suburbs of Brisbane, with an emphasis on warm and endearing hospitality.\n\nWith a focus on true expression of varietal, regional and vintage, our highly acclaimed list offers quality point of difference products matched with outstanding value for money. Not too mention an enviable selection of boutique beers! Watch out for our new draught beer bar in the coming month''s\n\nYou can pre order your takeaway coffee on your way to work at The Nook Caffe.\n\nThe Nook Caffe offer services like Reservations, Walk-Ins Welcome, Good For Groups, Good For Kids, Catering, Waiter Service and Outdoor Seating.\n\nClassy dining destination with an acclaimed wine list, imaginative cakes and Modern Australian food.', 'A', '{"1":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333]],"2":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333]],"3":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333]],"4":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333]],"5":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333],[0.75,0.9166666667]],"6":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333],[0.75,0.9166666667]],"0":[[0.2916666667,0.4583333333],[0.4791666667,0.5833333333]]}', 'https://www.facebook.com/thenookcafferestaurant/', '', '', '', '', '', 'https://plus.google.com/118428265146180499318/about'),
  (88046, 'the-reading-room-cafe-88046', 'The Reading Room Cafe', '', 'The Reading Room Cafe located in Footscray specialises in bread, pancakes, beverages and tea.', 273468, '2015-10-02 05:56:05', '2016-04-15 07:02:29', '', 191, 1802, '', 273468, 0, '', 'info@readingroomcafe.com.au', '0399194091', '', '', '', 'http://www.readingroomcafe.com.au', 'The Reading Room Cafe located in Footscray specialises in bread, pancakes, beverages and tea.\n\nEnjoy the Freshly baked croissant or gourmet muffin proudly made by The Reading Room Cafe''s kitchen.\n\nReading Room Cafe''s Toast banana bread served with butter, Toast sourdough bread served with avocado, finished with feta cheese\nand a lemon wedge, Thick pancakes topped with fresh banana and drizzled with maple syrup and berry syrup, Two slices of toast sourdough bread served with your choice of creamyscrambled, poached or fried eggs with a generous side of smoked bacon and more.\n\n\n', 'A', '{"1":[[0.3125,0.6875]],"2":[[0.3125,0.6875]],"3":[[0.3125,0.6875]],"4":[[0.3125,0.6875]],"5":[[0.3125,0.6875]],"6":[[0.3541666667,0.6041666667]],"0":[[0.375,0.6041666667]]}', '', '', '', '', '', '', 'https://plus.google.com/115390128427396041149/posts'),
  (88047, 'the-ripple-swirl-cafe-88047', 'The Ripple & Swirl Cafe', '', 'The Ripple & Swirl Cafe loated in Christies Beach specialises in breakfast, lunch and drinks.', 274628, '2015-10-02 05:56:09', '2016-04-19 01:46:34', '', 191, 1450, '', 274628, 0, '', 'info@therippleandswirlcafe.com.au', '0881866005', '', '', '', 'http://www.therippleandswirlcafe.com.au', 'Hi & Welcome to The Ripple & Swirl Cafe. We are your local cafe and coffee place on the Esplanade at Christies Beach.\n\nThe Ripple & Swirl Cafe has something for everyone, whether you’re on the run or want to sit and enjoy a coffee, meal or even a glass of wine with family or friends overlooking our great ocean views, we cater for all. Including, All day Breakfast Menu, Childrens menu and Icecream range to please all.\n\n If you would like to use the Ripple & Swirl Cafe for your next event please call and discuss all your options with one of our friendly team members.\n\nWe look forward to seeing you and providing you with great service, food and beverages not to mention the breath taking sea views of Christies Beach and Port Noarlunga.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3333333333,0.7083333333]],"0":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/The-Ripple-Swirl-Cafe-183485705024855', '', '', '', '', '', ''),
  (88048, 'the-river-cafe-beauty-point-88048', 'The River Cafe Beauty Point', '', '', 274776, '2015-10-02 05:56:13', '2016-04-19 03:18:27', '', 191, 1396, '', 274776, 0, '', 'info@therivercafe.com.au', '0363834099', '', '', '', 'http://www.therivercafe.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/therivercafebp', '', '', '', '', '', ''),
  (88050, 'the-waterfront-cafe-88050', 'The Waterfront Cafe', '', 'The Waterfront Cafe located in Mindarie specialises in Breakfast, Lunch, Dinner, Coffee and Drinks.', 273887, '2015-10-02 05:56:20', '2016-04-18 03:08:32', '', 191, 1676, '', 273887, 0, '', 'info@thewaterfrontcafe.com.au', '0894068814', '', '', '', 'http://www.thewaterfrontcafe.com.au', 'Welcome to the Waterfront Cafe and Restaurant, we serve fresh cooked Mediterranean and European cuisine in a family friendly venue.\n\nMany of the dishes on The Waterfront Cafe''s menu use ingredients sourced from local growers and suppliers. We value the quality of our products and will always choose best quality over price.\n\nEverything in The Waterfront Cafe is cooked fresh to order and can be cooked to your preference.\n\nOur baristas are all fully trained to make you the perfect coffee and are as excited and enthusiastic to make your beverage as you will be to enjoy it\n\nLunch is a very casual affair served from 12 every day offering freshly prepared mussels, grills, pastas, risotto, sandwiches, great salads and fantastic meals.\n\nThe Waterfront Cafe serve  great coffee and wonderful homemade cakes.\n\nTo keep it fair and give everyone a chance to get a table we have decided not to take bookings for Saturday and Sunday breakfast, so its first come first served.\n\nOur service is friendly and light hearted, we smile and we chat and above all we make sure you are having a great time.', 'A', '{"1":[[0.3333333333,0.625]],"2":[[0.3333333333,0.625]],"3":[[0.3333333333,0.625]],"4":[[0.3333333333,0.625]],"5":[[0.3333333333,0.625],[0.75,0.9166666667]],"6":[[0.3333333333,0.7083333333],[0.75,0.9166666667]],"0":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/waterfrontcafemindarie', '', '', '', '', '', ''),
  (88058, 'tin-shed-cafe-88058', 'Tin Shed Cafe', '', 'Tin Shed Cafe located in Mclaren Vale specialises in breakfast, lunch, pizza, dinner and drinks.', 274646, '2015-10-02 05:56:51', '2016-04-19 02:01:48', '', 191, 1442, '', 274646, 0, '', 'tinshed@tinshedcafe.com.au', '0883237343', '', '', '', 'http://tinshedcafe.com.au', 'At Tin Shed Cafe, we stock a wide range of regional, Australian, and international beer and wine, as well as soft drinks and fruit juices.\n\nTin Shed Cafe''s delicious pizzas are made 100% from scratch from our hand-made sauce to hand-tossed dough to the finest toppings.\n\nVisit us today and try the famous Spicy Texas Burger, Texas BBQ chicken wings, and our Tin Shed Cafe salsa and dipping sauces.\n\nCome in from the cold and try the Tin Shed Cafe''s special Butter chicken with jasmine rice and house made garlic naan bread. Yum! Also try our potato chorizo and bacon soup on a cold winter night. Or you can drop in and enjoy our irresistible Southern Fried Chicken!', 'A', '{"1":[[0.3333333333,0.4791666667],[0.5,0.6666666667]],"2":[[0.3333333333,0.4791666667],[0.5,0.6666666667]],"3":[[0.3333333333,0.4791666667],[0.5,0.6666666667]],"4":[[0.3333333333,0.4791666667],[0.5,0.6666666667]],"5":[[0.3333333333,0.4791666667],[0.5,0.6666666667]],"6":[[0.3333333333,0.4791666667],[0.5,0.6666666667],[0.75,0.875]],"0":[[0.3333333333,0.4791666667],[0.5,0.6666666667],[0.75,0.875]]}', 'https://www.facebook.com/Tin-Shed-Cafe-297846866344', '', '', '', '', '', 'https://plus.google.com/100577342834705171365/posts'),
  (88060, 'toby-s-estate-coffee-tea-88060', 'Toby''s Estate Coffee & Tea', '', 'Toby''s Estate Coffee & Tea located in Melbourne specialises in coffee roasting.', 273508, '2015-10-02 05:57:04', '2016-04-15 07:31:21', '', 191, 1774, '', 273508, 0, '', 'info@tobysestate.com.au', '0399394578', '', '', '', 'http://www.tobysestate.com.au', 'Toby''s Estate Coffee & Tea''s specialty coffee roasters. We don''t just like coffee, we love and live for coffee. Every minute of every day.\n\nCome in to one of our signature cafes owned and operated by Toby''s Estate Coffee & Tea to enjoy the ultimate coffee experience. Find us in Chippendale, Woolloomooloo, Brisbane and Melbourne. Explore our local Australian cafes or see what’s brewing at Toby''s Estate Coffee & Tea in Singapore and New York.\n\nSituated in Flinders Lane in the bustling CBD, our Melbourne café is flooded with beautiful light. Toby''s Estate Coffee & Tea serve our signature blends alongside some remarkable single origins which change regularly. Inspired by local produce, our kitchen also produces a delicious selection of Breakfast, Lunch & light snack options, making it the perfect place to escape during a busy working week.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]],"6":[[0.3333333333,0.625]]}', 'https://www.facebook.com/tobysestateaustralia', '', '', '', '', '', ''),
  (88061, 'tootsies-cafe-88061', 'Tootsies Cafe', '', '', 0, '2015-10-02 05:57:07', '2016-04-15 07:34:26', '', 191, 1773, '', 0, 0, '', 'tootsiescafe@gmail.com', '0438366843', '', '', '', 'http://www.tootsiescafe.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', '', '', '', '', '', '', ''),
  (88062, 'topiary-tea-house-88062', 'Topiary Tea House', '', 'Topiary Tea House located in Tea Tree Gully specailses in Breakfast, Lunch, Dinner and Coffee.', 274682, '2015-10-02 05:57:11', '2016-04-19 02:14:00', '', 191, 1431, '', 274682, 0, '', 'enquires@thetopiarycafe.com.au', '0882630818', '', '', '', 'http://thetopiarycafe.com.au', 'The Location is something that brings hundreds of visitors a week to Topiary Tea House. Situated at the foot hills within the stunning grounds of Newman''s Nursery, the outdoor area features a sandstone alfresco dining area with a flowering wisteria arbour, lush edible garden, and views of some of the magnificent display gardens, all of which change with the seasons.\n\nThe Food that is prepared and served at Topiary Tea House is made with respect. The breads and scones are baked daily to ensure the freshest possible product and whatever we can’t pick from our edible garden or surrounds is sourced locally. The food sounds simple but time is taken to develop each menu item from scratch, searching, testing and developing recipes and methods that push the boundaries and fit in with the setting that we’re blessed with. Check the top of our ‘menu’ page for a list of our house made items.\n\nThe Beverages are individually selected to offer the best local items that are on offer. Topiary Tea House''s blend of Rio coffee is roasted in Stepney and served at it’s peak in the restaurant accompanied by Tweedvale milk from Lobethal. Our range of soft drinks from Bickfords are made in Adelaide and our juice is freshly squeezed in Lobethal and contains no preservatives.\n\nOur wines are selected from some of the best South Australia has to offer and our beers are brewed all over Adelaide.  ', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"4":[[0.375,0.6666666667]],"5":[[0.375,0.6666666667]],"6":[[0.375,0.6666666667],[0.7708333333,0.9583333333]],"0":[[0.375,0.6666666667]]}', 'https://www.facebook.com/thetopiarycafeAU/', 'https://twitter.com/TheTopiaryCafe', '', '', '', '', 'https://plus.google.com/107776952463408585314/about'),
  (88067, 'trocadero-cafe-88067', 'Trocadero Cafe', '', 'Trocadero Cafe located in Hobart specialises in coffee,  dessert, breakfast and drinks.', 274784, '2015-10-02 05:57:30', '2016-04-19 03:26:11', '', 191, 1394, '', 274784, 0, '', 'aliyoussef2008@hotmail.com', '0362242186', '', '', '', 'http://www.trocaderocafe.com.au', 'Trocadero Cafe''s piping hot coffee is sure to give you a burst of energy. But if you''re looking to chill out instead, we have a wide range of soothing teas or refreshing juices.\nWe also offer a selection of hot and cold savoury dishes that are a wonder on the palate. If you have a sweet tooth, our array of cakes and biscuits are sure to please.\n\nAt our intimate coffee place in Hobart, Trocadero Cafe have something to please everyone.\n\nTrocadero Cafe provides a cosy atmosphere and great coffee in Hobart. We will ensure you feel at home and are always treated as a welcome guest. Our professional, friendly staff serve every cup of coffee and delicious snack with a smile. We are your local coffee place with a difference - a friendly, warm and inviting space to relax with some friends, catch up on the latest gossip, or simply enjoy a comfortable seat in a wonderful atmosphere.', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', '', '', '', '', '', '', ''),
  (88069, 'two-monks-cafe-88069', 'Two Monks Cafe', '', '', 273530, '2015-10-02 05:57:38', '2016-04-15 07:49:47', '', 191, 1766, '', 273530, 0, '', 'twomonkscafe@hotmail.com', '0399397197', '', '', '', 'http://www.twomonkscafe.com.au', '', 'A', '{"1":[[0.25,0.666666]],"2":[[0.25,0.666666]],"3":[[0.25,0.666666]],"4":[[0.25,0.666666]],"5":[[0.25,0.666666]],"6":[[0.2916666,0.625]]}', 'https://www.facebook.com/twomonkscafe', '', '', '', '', '', ''),
  (88071, 'un-caffe-bar-88071', 'Un Caffe Bar', '', 'Un Caffe Bar located in Windsor Gardens specialises in Breakfast, Lunch, Dinner, Coffee and Drinks.', 274702, '2015-10-02 05:57:46', '2016-04-19 02:24:33', '', 191, 1430, '', 274702, 0, '', 'info@uncaffebar.com', '1300122333', '', '', '', 'http://www.uncaffebar.com', 'Un Caffe Bar has been operating since 2003 and now thanks to the support of our loyal customers we operate in 3 locations throughout Adelaide.\n\nUn Caffe Bar is serious about coffee and our simple focus is on delivering a perfect cup each and every time. Our coffee is roasted to our own recipe here in Adelaide – remember coffee is a food, the fresher it is the better it is.\n\nUn Caffe Bar''s offering is modern European, with an emphasis on ‘fresh’; our gourmet sandwiches, rolls etc are made fresh each and every day. We bake our own croissants and pastries on premise each morning to ensure that our customers only get freshly made items.', 'A', '{"1":[[0.2708333333,0.9166666667]],"2":[[0.2708333333,0.9166666667]],"3":[[0.2708333333,0.9166666667]],"4":[[0.2708333333,0.9166666667]],"5":[[0.2708333333,0.9583333333]],"6":[[0.2708333333,0.9583333333]],"0":[[0.2708333333,0.9166666667]]}', 'https://www.facebook.com/uncaffe', '', '', '', '', '', ''),
  (88081, 'williams-bar-cafe-88081', 'Williams Bar &Cafe', '', 'Williams Bar &Cafe located in Melbourne specialises in breakfast, lunch, dinner and drinks.', 273556, '2015-10-02 05:58:27', '2016-04-15 08:33:37', '', 191, 1757, '', 273556, 0, '', 'williams@clarionsuitesgateway.com.au', '61392968850', '', '', '', 'http://www.clarionsuitesgateway.com.au', 'Inviting and comfortable in style, William’s Bar & Café offers a sumptuous buffet breakfast, Express Lunch and a modern Australian a la carte menu for dinner. Open 7 days a week (closed Sunday for dinner). Public Holidays; Open for Breakfast 7am – 11am, Closed for Lunch and Dinner, room service is available for all in-house guests.\n\nWilliams Bar &Cafe in Melbourne CBD also offers a fine selection of Australian and international wines and beers.\n\nHappy Hour, Monday and Friday from 5:30pm to 7:30pm.\n\nWilliam’s Bar & Café is now offering a new Breakfast Menu seven days a week, along with an extensive Brunch Menu exclusive to the weekends.\n\nLunch is still available Monday – Friday and includes a complimentary beverage (limited selection).', 'A', '{"1":[[0.25,0.6666666667]],"2":[[0.25,0.6666666667]],"3":[[0.25,0.6666666667]],"4":[[0.25,0.6666666667]],"5":[[0.25,0.6666666667]],"6":[[0.2916666667,0.625]]}', 'https://www.facebook.com/ClarionGateway/', 'https://www.facebook.com/ClarionGateway/', '', '', '', '', ''),
  (88084, 'wooden-squirrel-cafe-88084', 'Wooden Squirrel Cafe', '', 'Wooden Squirrel Cafe located in Bairnsdale specialises in breakfast, lunch, drinks, burgers and sandwiches.', 273703, '2015-10-02 05:58:39', '2016-04-18 00:53:28', '', 191, 1732, '', 273703, 0, '', 'thewoodensquirrel@yahoo.com', '0351523198', '', '', '', 'http://www.thewoodensquirrel.com.au', 'Fiona and Jason are passionate about good food, good coffee and good times. The Wooden Squirrel is their opportunity to share these with you.\n\nWooden Squirrel Cafe is open for breakfast and lunch every day. Serving homemade pies, pasties, soup, curries, pasta, wraps and foccacias. We also offer an à la carte menu, including seafood, lamb, Waygu beef, vegetarian dishes, pastas, risottos and more.\n\nVisit the Wooden Squirrel Cafe located in Bairnsdale and enjoy our breakfast menu, lunch menu, different variety of drinks, burgers and sandwiches.', 'A', '{"1":[[0.3333333333,0.6666666667]],"2":[[0.3333333333,0.6666666667]],"3":[[0.3333333333,0.6666666667]],"4":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.6666666667]],"6":[[0.3333333333,0.625]],"0":[[0.375,0.5833333333]]}', 'https://www.facebook.com/thewoodensquirrel', '', '', '', '', '', ''),
  (88085, 'woogi-espresso-88085', 'Woogi Espresso', '', 'Woogi Espresso located in Perth specialises in Breakfast, Lunch and Coffee.', 273951, '2015-10-02 05:58:43', '2016-04-18 03:47:34', '', 191, 1649, '', 273951, 0, '', 'woogicentral@woogiespresso.com.au', '0892213864', '', '', '', 'http://www.woogiespresso.com.au', 'Quirky small foot print alfresco cafe with unique take away option, great coffee and amazing customer service at Woogi Espresso.\n\nEnjoy the Woogi Espresso''s great Coffee "Or its free" Simple tasty food, World Famous Woogi Puff.\n\nWoogi Espresso takes Reservations, Walk-Ins Welcome, Good For Groups, Take Out, Delivery and Catering\n\nHave you met our Bacon & Egg Panini with homemade Woogi Relish yet? It''s dying to meat you! only available at Woogi@Bonissimo. We have over 50 different varieties in our roll repertoire so come down to Woogi today for our AWESOME special! ', 'A', '{"1":[[0.3125,0.625]],"2":[[0.3125,0.625]],"3":[[0.3125,0.625]],"4":[[0.3125,0.625]],"5":[[0.3125,0.625]]}', 'https://www.facebook.com/woogiespresso', '', '', '', '', '', 'https://plus.google.com/109197780026367230304/about'),
  (88091, 'ziggy-s-cafe-88091', 'Ziggy''s Cafe', '', 'Ziggy''s Cafe is located in Mildura specialises in breakfast, lunch, finger food and drinks.', 273731, '2015-10-02 05:59:05', '2016-04-18 01:28:22', '', 191, 1722, '', 273731, 0, '', 'info@ziggyscafe.com.au', '0418560986', '', '', '', 'http://www.ziggyscafe.com.au', 'Ziggy’s Cafe is owned and operated by Trevor and Debbie Milton\nand Head Chef Ashleigh Milton. With many years of experience in the hospitality industry the Milton family work hard to provide their valued customers with quality dining and service and they look forward to your next Ziggy’s experience.\n\nZiggy’s Cafe invite’s you to enjoy breakfast, brunch and lunch in our newly refurbished and stylish café.\n\nCentrally located at 145 Eighth Street Mildura, Ziggy’s Cafe is the perfect place for casual dining, corporate breakfast meetings and small functions. We also offer all occasion catering, specialising in buffet breakfasts, finger foods, gourmet BBQ’s, sensational roasts and celebrations, let us tailor a menu for any occasion.\n\nAt Ziggy’s Cafe we offer a huge variety of quality dining and value for money catering to suit any occasion.\n\nOur centrally located café is ideal for breakfast, brunch, lunch, finger food and corporate gatherings with selections to tantalize any taste bud.\n\nLet us come to you for your next function with our specialty menus at very competitive rates or alternatively utilize our café for a private function.\n', 'A', '{"1":[[0.3333333333,0.6875]],"2":[[0.3333333333,0.6875]],"3":[[0.3333333333,0.6875]],"4":[[0.3333333333,0.6875]],"5":[[0.3333333333,0.6875]],"6":[[0.3333333333,0.5833333333]],"0":[[0.375,0.5833333333]]}', 'https://www.facebook.com/ZiggysCafeMildura', '', '', '', '', '', ''),
  (88167, 'wests-nelson-bay-diggers-88167', 'Wests Nelson Bay Diggers', '', 'Wests Nelson Bay Diggers located in Nelson Bay offers variety of entertainment and dining including Bay Brasserie, Bay Cafe or Bay Diner. Also several bars indorr playland health club and more.', 270821, '2015-10-02 06:30:23', '2016-04-12 03:48:54', '', 191, 2677, 'rsl club', 270821, 0, '', 'info@westsnewcastle.com.au', '0249811344', '', '', '0249841676', 'http://www.westsnewcastle.com.au/bars/nelson-bay-diggers/bay-brasserie-bar-0', 'Wests Nelson Bay Diggers club operated from the current site from 1966 and in 1982, the Memorial Club expressed the wish to purchase the premises from the RSL Sub-Branch. Negotiations were finalised in January 1986 and the Club was then owned by the members.\n\nWith various stakeholders over the ensuing years the Club has grown to be a substantial business in the Port Stephens employing locals and giving back to the local community.\n\nIn 2008, after completing substantial renovations, the Board of the Club asked for amalgamation due to the rising cost of debt.  Western Suburbs (N’cle) Leagues Club formulated a plan to turn the business around and develop this substantial resource for the community.\n\nWith another round of renovations the Club provides outstanding features and the future is looking bright.  Entertainment is provided each weekend, Club regular offerings including bingo, housie and raffles are drawing daily crowds to the venue.  The function facilities are the largest on the Port Stephens peninsular.   ', 'A', '{"1":[[0.375,0.0208333333]],"2":[[0.375,0.0208333333]],"3":[[0.375,0.0208333333]],"4":[[0.375,0.0208333333]],"5":[[0.375,0.1041666667]],"6":[[0.375,0.0833333333]],"0":[[0.375,0.0833333333]]}', '', '', '', '', '', '', 'https://plus.google.com/115402714777480770604/about'),
  (89297, 'homemakers-furniture-89297', 'Homemakers Furniture', '', 'Homemakers Furniture is located in Wonthaggi providing range of furniture, fabric and leather lounge with competitive franchise pricing.', 185918, '2015-10-11 23:17:16', '2016-04-14 08:42:39', '', 191, 2130, 'sofas\nlivingroom furniture\noutdoor  furniture\ndinning furniture\noffice furniture', 185918, 0, '', 'rigbyhomemakers@bigpond.com', '0356725906', '', '', '', 'http://rigby.homemakersfurniture.com.au', 'Homemakers Furniture Ltd is a limited public company owned entirely by its members, all of whom are independent owner operators. Members enjoy the support from head office and the security offered by an established market leader, while remaining the "boss".\n\nFrom our inception as a buying group of Independent Furniture Retailers over 60 years ago, we have jealously guarded our basic philosophy of bringing marketing and buying power to our members whist maintaining retailer independence. The retailer who owns the store, also runs the store and is part of the local community, bringing local community, interest, knowledge and commitment to their market.\n\nStarting out as Newfurn furniture in 1958 and with a change of name to First Choice Furniture in 1995, Homemakers Furniture was officially formed in January 2002. With stores located in Victoria, Tasmania, New South Wales, ACT, South Australia and Western Australia, Homemakers is Australia''s biggest independent furniture buying group in the country.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.5833333333]]}', 'https://www.facebook.com/homemakersfurnitureaustralia', '', '', '', '', '', 'https://plus.google.com/116648519133129930353/about'),
  (89931, 'johnson-couzins-89931', 'Johnson & Couzins', '', 'Johnson & Couzins help Aussies take indoor-outdoor flow to the next level with Australia''s first retractable louvres, state-of-the-art parasol umbrellas and canopy awnings.', 271669, '2015-10-18 22:42:53', '2016-04-13 06:51:31', '', 191, 2394, 'decor', 271669, 0, '', 'shaun@johnsonandcouzins.com', '0407720470', '', '', '', 'http://www.johnsonandcouzins.com.au', 'Johnson & Couzins are proud to be in it for the long haul - we have been ''the name in shade since 1866''. Based in the main centres of both Australia and New Zealand, we offer more licensee opportunities throughout the world due to rapid growth. \n\nJohnson & Couzins have the answer to all your residential and commercial shade demands, ranging from large parasol umbrellas  and waterproof shade sails to fully automatic opening louvre roofs and canopy awnings. We are renowned for our comprehensive and outstanding customer service which includes free measure and quote, design and manufacture through to installation. \n\nWe design and manufacture most of our products in house and custom-design shade solutions to your specific needs. Constantly developing new products, we offer the very latest in design and quality and always stay at the forefront of our market, setting shade trends. Our latest innovation is the ultra-modern Concertina Louvre, Australasia''s first fully retractable roof louvre system. \n\nJohnson & Couzins also make a vast range of custom canvas and PVC designs for various markets such as restaurants, trucking and the manufacturing industry. ', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', '', '', '', '', '', '', ''),
  (89942, 'lavish-abode-89942', 'Lavish Abode', '', 'Lavish Abode is a home decor, gift and interiors store located in Lilydale, providing wide variety of products encompassing a range of styles.', 272242, '2015-10-18 22:43:32', '2016-04-14 05:46:37', '', 191, 2231, 'furniture\ndecor\nhome appliances\nrugs\nlighting\ntableware\ncarpets', 272242, 0, '', 'admin@lavishabode.com.au', '0397387788', '', '', '', 'http://www.lavishabode.com.au', 'Lavish Abode is a quirky little retail store located in Lilydale on the outskirts of Melbourne near the Yarra Valley. The shop opened in November 2011 after Nikki and Caroline finally decided to make their 15 year old dream a reality. After meeting through work almost 20 years prior and becoming great friends we''d always wanted to open a shop called Lavish, originally the idea was for a florist and home decor shop in the inner city, but with 6 children between us and other commitments opening closer to home and not having the extended hours of a florist was more realistic. We also noted that there was a definite need for a shop like ours in the area, with nowhere to go to get on trend home decor and gifts locally we often travelled into the inner city ourselves to get the goodies we wanted for our own homes.\n\nAnd so Lavish Abode was born, a bit of the inner city in the outer suburbs! An eclectic mix of provincial, industrial, modern, vintage and eco style for your abode. Our style changes with the trends, but we always make sure that we have something for everyone whether your home is more classical and timeless or bang on trend, we love that our styles are different too, which allows us to mix it up! The shop is ever changing, our displays don''t stay the same for long and our customers and the local community love our large window displays.', 'A', '{"1":[[0.3958333333,0.7083333333]],"2":[[0.3958333333,0.7083333333]],"3":[[0.3958333333,0.7083333333]],"4":[[0.3958333333,0.7083333333]],"5":[[0.3958333333,0.7083333333]],"6":[[0.3958333333,0.5625]]}', 'https://www.facebook.com/LavishAbode/', '', '', '', '', '', 'https://plus.google.com/110349114044513785094/about'),
  (89944, 'lavolve-89944', 'LaVolve', '', 'LaVolve is located in Canterbury offering wide range of gifts and homeware including bed and bath, Manchester, fashion, home decor and many more.', 272274, '2015-10-18 22:43:39', '2016-04-14 05:58:28', '', 191, 2223, 'bed and bath\nmanchester and bedding\ndecor\nhome appliances\nkitchen appliances\nrugs\nlighting\ntableware\ncarpets', 272274, 0, '', 'info@lavolve.com.au', '0398360021', '', '', '', 'http://www.lavolve.com.au', 'La Volve - The essence of loving you and your home. Surround yourself with unique, quirky, beautiful objects that capture your desires, aspirations, and individual style.\n\nLa Volve provides Gift and Homewares including - Jewellery, Bags, Scarves, bodycare, candles, Gifts, Diffusers, Kitchen, Bathroom, Laundry, Kids, Photo Frames, Outdoors, Stationery, Books, Christmas, Easter, Cushions, Throws, Pots, Vases, Urns.', 'A', '{"1":[[0.3958333333,0.7291666667]],"2":[[0.3958333333,0.7291666667]],"3":[[0.3958333333,0.7291666667]],"4":[[0.3958333333,0.7291666667]],"5":[[0.3958333333,0.7291666667]],"6":[[0.3958333333,0.7291666667]]}', 'https://www.facebook.com/lavolve/', '', '', '', '', '', ''),
  (89945, 'libby-lou-89945', 'Libby Lou', '', 'Libby Lou is located in Ferntree Gully providing a large selection of Furniture, Homewares and everything to turn your house into a home.', 272324, '2015-10-18 22:43:42', '2016-04-14 06:18:26', '', 191, 2214, 'furniture\ndecor\nkitchen appliances\ntableware\nkitchen and cookware', 272324, 0, '', '', '0397560100', '', '', '', 'http://www.libbylou.com.au', 'Libby Lou is located in Ferntree Gully providing a large selection of Furniture, Homewares and everything to turn your house into a home.\n\nLibby Lou offers:\n\n-Candleware\n-Cushions\n-Entertaining\n-Furniture\n-Kitchen\n-Gifts\n-Homewares\n-Storage\n-Wall Decor\n\n', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.4166666667,0.6666666667]]}', '', '', '', '', '', '', ''),
  (89950, 'local-home-improvements-89950', 'Local Home Improvements', '', 'Local Home Improvements is located in Delacombe providing range of products including roofing, windows, doors and screen, carports and many more.', 272360, '2015-10-18 22:44:00', '2016-04-14 06:29:40', '', 191, 2206, 'home appliances', 272360, 0, '', 'info@localhomeimprovements.com.au', '0353361077', '', '', '', 'http://www.localhomeimprovements.com.au', 'With a choice of Australian Made products, made specifically for Australian conditions, we supply both BHP Colorbond® Roofing and Gerard® Roofing Systems.\n\nLocal Home Improvements have the ONLY machine in the area that can be taken ON-SITE to cut Ogee® Guttering or Aluminium and Steel Weatherboards to exact size, avoiding joins.\n\nProducts we supply include:\n\n-Aluminium (longside) & Colorbond® Guttering\n-Aluminium & Steel longside Weatherboards\n-Vinyl Weatherboards\n-Twin Rib Cladding Board\n-Carports\n-Extensions\n-Patios\n-Roofing - All Types\n-SolarSpan® Insulated Roofing Panels\n-Windows, Doors & Screens', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', '', '', '', '', '', '', ''),
  (89953, 'love-luvo-89953', 'Love Luvo', '', 'Love Luvo is located in Seddon, providing range of locally manufactures products including bed and bath body care, home decor, gift cards and stationery and homewares.', 272378, '2015-10-18 22:44:11', '2016-04-14 06:39:55', '', 191, 2198, 'furniture\nbed and bath\ndecor\nhome appliances', 272378, 0, '', '', '0393961822', '', '', '', 'http://www.loveluvo.com.au', 'LoveLuvo was launched in 2010 as the second social enterprise established by WCIG. Based in the leafy suburb of Seddon, LoveLuvo is a retail concept store with a homely, modern feel. When you walk through the glass-fronted door, the first thing that greets you is the delicious array of smells and colours.\n\nAt LoveLuvo we cheerfully provide good old-fashioned customer service and a great selection of environmentally-friendly products for your home and body.\n\nLoveLuvo offers an ever-widening range of locally manufactured products made only from the highest quality ingredients – safe for your whole family. Whether you’re after great environmentally-friendly cleaning products or delectably luxurious treats for your body, you’re sure to find what you need at LoveLuvo.', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.4166666667,0.7083333333]],"0":[[0.4166666667,0.625]]}', 'https://www.facebook.com/LoveLuvo/', '', '', '', '', '', ''),
  (89956, 'maison-bleue-89956', 'Maison Bleue', '', 'Maison Bleue is a boutique French styled retail store located in Willoughby offering an array of french and european styled furniture together with homeware, lighting, decorative item, gifts and more.', 273807, '2015-10-18 22:44:21', '2016-04-18 02:07:42', '', 191, 1701, 'furniture\ndecor\nhome appliances\nlighting\ntableware\ncarpets\nsofas', 273807, 0, '', 'info@maisonbleue.com.au', '0299675611', '', '', '', 'http://www.maisonbleue.com.au', 'Visit Maison Bleue and experience our beautiful array of French and European styled furniture together with home wares, decorative items, lighting, gifts and more. From the elegance of French glassware and dinnerware, to fine tapestries and accessories for your home, we hope that you can find something of interest. Our friendly staff is always happy to see you and assist with any enquiries, or advice you may need. \n\nMaison Bleue offers an Interior Decorating service, with services from complete in-house decorating consulting to colour consulting, and also window covering solutions, as well as custom made furniture. ', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/Maison-Bleue-558562064201383/', '', '', '', '', '', 'https://www.google.com/maps/place/Maison+Bleue/data=!4m2!3m1!1s0x6b12aecd9c7aed2b:0x60f912a19f143c0f?gl=PH&hl=en'),
  (89957, 'maison-montage-89957', 'Maison Montage', '', 'Maison Montage is well established as Leura’s leading homewares store offering a gorgeous and eclectic range of products sourced from around the world.', 273823, '2015-10-18 22:44:25', '2016-04-18 02:22:19', '', 191, 1696, 'furniture\nbed and bath\nmanchester and bedding\ncookware\ndecor\nhome appliances\nkitchen appliances\nlighting\ncarpets\nkitchen and cookware', 273823, 0, '', 'maisonmontage@bigpond.com', '0247843400', '', '', '', 'http://www.maisonmontage.com.au', 'Maison Montage is well established as Leura’s leading homewares store offering a gorgeous and eclectic range of products sourced from around the world.\n\nMaison Montage collection has been carefully selected to create an inspirational shopping experience... from our sumptuous range of table and bed linens, co-ordinated throws and cushions, lamps, European china and glassware to our exquisite nightwear, handbags, jewellery and treasures for baby, you will discover something truly individual.\n\nMaison Montage also specialises in niche fragrances from the most world’s most luxurious and exclusive perfume houses. Our beautiful range of home fragrances, candles and toiletries will inspire the senses and nurture the soul.', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.4166666667,0.7083333333]],"0":[[0.4166666667,0.6666666667]]}', '', '', '', '', '', '', ''),
  (89960, 'marta-mikey-imports-exports-89960', 'Marta Mikey Imports & Exports', '', 'Marta Mikey Imports & Exports is one of the leading homeware & giftware wholesalers in Melbourne, supplying exclusive gift items, craft products & designer homewares to retailers all over the country.', 245399, '2015-10-18 22:44:35', '2016-04-14 06:49:06', '', 191, 2191, 'furniture\ndecor', 245399, 0, '', '', '0395839699', '', '', '', 'http://www.martamikey.com.au', 'Marta Mikey Imports & Exports is one of the leading homeware and giftware wholesalers in Melbourne, supplying exclusive gift items, craft products and designer homewares to retailers all over the country.\n\nWe believe in offering the products that are not just best, but also\n\n•    Always new\n•    Always different\n•    Always gorgeous\n•    Always at low wholesale prices\n•    A truly irresistible combination!\n\nWhether you are looking for birthday gifts or craft supplies online, we are the best option to consider. You can get the best wholesale gift supplies and online homewares in Australia, only at Marta Mikey\n\n\nWe are experts in sourcing and delivering a variety of products from homewares furniture in Melbourne to decorative accessories and affordable giftware. At Marta Mikey, we supply the widest range of hot selling products ranging from affordable wholesale homewares online to decorative giftware and craft supplies.\n\nWe believe in providing our customers with something new always. That makes us constantly update our giftware range including furniture and furnishings, candle holders, garden statues, jewellery and other products.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Marta-Mikey-ImportsExports-Aust-Pty-Ltd-323312714427860/', 'https://twitter.com/martamikey1', '', '', '', '', 'https://plus.google.com/107070685834087605089/about'),
  (89967, 'mud-australia-fitzroy-89967', 'Mud Australia - Fitzroy', '', 'mud australia is a homeware design and porcelain collection company located in Fitzroy.', 272494, '2015-10-18 22:45:00', '2016-04-14 07:04:15', '', 191, 2181, 'cookware\ndecor\nhome appliances\nkitchen appliances\ntableware', 272494, 0, '', 'fitzroy@mudaustralia.com', '0394195161', '', '', '', 'http://www.mudaustralia.com', 'mud australia was founded in 1994. The porcelain range, designed by Shelley Simpson, combines hand made processes, clean lines, colour palette and functionality. The end result is a product that neatly intersects a minimalist aesthetic with an artisan finish. Our porcelain happily fits in any interior, providing a timeless alternative to mass produced ceramic design.\n\nAs a small business we strongly believe in the global values of craft and community. We actively build relationships with the people who buy, use and love our product.\n\nOur retail stores present all products exclusively on the Vitsœ 606 Universal Shelving System, the iconic furniture range designed by Dieter Rams.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/mud.australia/', '', '', '', '', '', ''),
  (89970, 'my-dezign-exteriors-89970', 'My Dezign Exteriors', '', 'My Dezign Exteriors is located in Ashford, specialising in home improvements primarily using stel including vrandahs, patios, pergolas, screens, decking, awnings, shutters, sheds and many more.', 271693, '2015-10-18 22:45:11', '2016-04-13 07:16:54', '', 191, 2382, 'decor', 271693, 0, '', 'admin@mydezignexteriors.com.au', '0417050770', '', '', '', 'http://www.mydezignexteriors.com.au', 'My Dezign Exteriors offers you a complete design consultation service from concept to completion, looking after you every step of the way. Covering every detail to ensure your design is perfectly suited to YOUR needs and requirements\n\nQuality Home improvements begin with great understanding of your needs and requirements and using a design flair for capturing the advantages of the position and unique features that will enhance your exterior living area.\n\nUsing only quality materials will ensure your complete satisfaction and offer you the greatest value overall.\n\nMy Dezign Exteriors offer not only this but outstanding professional service, competitive prices and the personal care and attention you deserve.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.4166666667,0.6666666667]],"0":[[0.4583333333,0.6666666667]]}', 'https://www.facebook.com/MyDezignExteriors', 'https://twitter.com/DesignbyBill', 'https://www.linkedin.com/company/3137229?trk=prof-exp-company-name', '', '', '', 'https://plus.google.com/+MydezignexteriorsAu/posts'),
  (89972, 'note-to-self-89972', 'Note to Self', '', 'Note to Self is located in Epping offering an interesting mix of French style furniture, seasonal homewares, gifts and unusual vintage curiosities. ', 273903, '2015-10-18 22:45:18', '2016-04-18 03:13:16', '', 191, 1672, 'furniture\nbed and bath\ncookware\ndecor\nhome appliances\nkitchen appliances\nlighting\ntableware\nantiques', 273903, 0, '', 'info@notetoselfepping.com.au', '0298685033', '', '', '', 'http://www.notetoselfepping.com.au', 'Note to Self offers an eclectic mix of French inspired furniture, seasonal home wares and unique vintage curiosities. A range of handmade gifts is designed in store, from gorgeous silk items to "one off" feature cushions using vintage fabrics and trims.\n\nNote to Self is a place where you know you will be able to find the perfect gift (or a little something for yourself!), a shop where you always feel welcome to browse without pressure to purchase, and a place where you will return again and again and that you can''t wait to tell your friends about. Complimentary giftwrapping and corporate orders are a pleasure.', 'A', '{"1":[[0.4166666667,0.7291666667]],"2":[[0.4166666667,0.7291666667]],"3":[[0.4166666667,0.7291666667]],"4":[[0.4166666667,0.7291666667]],"5":[[0.4166666667,0.7291666667]],"6":[[0.375,0.5833333333]]}', 'https://www.facebook.com/notetoselfepping/', '', '', '', '', '', ''),
