  (89979, 'once-homewares-89979', 'Once Homewares', '', 'Once Homewares is providing range of quality products including cookware, kitchen appliances, dining and many more.', 274012, '2015-10-18 22:45:43', '2016-04-18 05:12:54', '', 191, 1637, 'cookware\nkitchen appliances\ntableware\nkitchen and cookware', 274012, 0, '', 'info@oncehomewares.com', '0242578726', '', '', '', 'http://www.oncehomewares.com', 'Once Homewares is Australian owned, we provide outstanding quality products that you only need to buy once, and they will last the rest of your life! We are so confident with our products that we give them an unconditional lifetime guarantee. ', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/oncehomewaresaustralia/timeline?ref=page_internal', '', '', '', '', '', ''),
  (89983, 'papaya-89983', 'Papaya', '', 'Papaya is a synergy between the unspoiled beauty of raw materials and the understated clarity of contemporary design located in Leichhardt.', 274066, '2015-10-18 22:45:57', '2016-04-18 05:40:34', '', 191, 1624, 'furniture\nbed and bath\nmanchester and bedding\ndecor\nhome appliances\nlighting\ntableware\ncarpets\nsofas', 274066, 0, '', 'clearance@papaya.com.au', '0285717700', '', '', '', 'http://www.papaya.com.au', 'Papaya Simply beautiful homewares drawn from nature, creating a harmonious fusion between the unspoiled beauty of raw materials and the understated clarity of contemporary design. \n\nFrom smooth, lustrous wood to sleek hand-blown glass; from finely textured woven materials to satiny luminescent stone, all products bear the signature of beautiful materials coupled with fine design - simply beautiful.\n', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/papayahomeware?ref=hl', '', '', '', '', '', ''),
  (89984, 'pappa-sven-89984', 'Pappa Sven', '', 'Pappa Sven is an authentic Scandinavian homeware store located in Parry Street, Newcastle West, providing an array of furniture, home decor,  cushions, tableware, bags, clothing and many more.', 274100, '2015-10-18 22:46:01', '2016-04-18 05:56:21', '', 191, 1616, 'furniture\nbed and bath\nmanchester and bedding\ndecor\nhome appliances\nlighting\ntableware\ncarpets', 274100, 0, '', 'info@pappasven.com.au', '0416333346', '', '', '', 'http://www.pappasven.com.au', 'Pappa Sven spent a year living in Skellefteå, which is a small town just below the Arctic Circle in Sweden. It was truly an experience of a lifetime and something that our family will cherish forever.  I immediately fell in love with not just the Scandinavian design and homewares but also the beautiful natural environment, artisan culture and wonderfully peaceful existence. I quickly realised that I wanted to somehow bring this home with me and share a part of this with Newcastle, and other Australians.\n\nPappa Sven is committed to meeting the needs of our customers so please contact us directly if there is something you are looking for!', 'A', '{"3":[[0.3958333333,0.6041666667]],"4":[[0.3958333333,0.7291666667]],"5":[[0.3958333333,0.6041666667]],"6":[[0.3958333333,0.6041666667]]}', 'https://www.facebook.com/pappasvens/', '', '', '', '', '', 'https://www.google.com/maps/place/Pappa+Sven/@-32.927886,151.7569683,17z/data=!3m1!4b1!4m2!3m1!1s0x6b73144587091b81:0x65ca19a8e806fbe5?hl=en'),
  (89985, 'archer-development-89985', 'Archer Development', '', 'Archer Developments has the expertise and experience in building, rebuild, subdivide your land in the bayside areato ensure your project succeeds with less stress and more benefit.', 272595, '2015-10-18 22:46:04', '2016-04-14 07:39:43', '', 191, 2163, 'house renovation\nbuilding design', 272595, 0, '', 'paul.walters@archerdevelopments.com.au', '1300462724', '', '', '', 'http://www.archerdevelopments.com.au', 'At Archer Developments we have a dedicated approach to each and every one of our clients. Our proud reputation depends on our expertise, operational performance, project delivery and strong health, safety and environmental credentials.\n\nFor more than a decade we have served a multitude of satisfied clients and Archer Developments is committed to continuing its outstanding customer service. We pride ourselves on our attention to detail and unequivocal after sales service. With Archer Developments warranties, the service continues well beyond the construction process and if future difficulties should arise one of our dedicated staff will assist you.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', '', '', '', '', '', '', ''),
  (89987, 'phillip-lea-89987', 'Phillip & Lea', '', 'Phillip & Lea is located in Trentham, providing range f products and tools for the cook, gardener, hunter & forager, baker & patissier, preserver and charcutier & salumi maker.', 272623, '2015-10-18 22:46:11', '2016-04-14 07:50:37', '', 191, 2155, 'furniture\ncookware\nhome appliances\nkitchen appliances\nkitchen and cookware', 272623, 0, '', 'info@phillipandlea.com.au', '0390118433', '', '', '', 'http://www.phillipandlea.com.au', 'Phillip & Lea believes that home cookery has its beginnings in the patch, field, orchard, forest, wilderness & waterway. Our focus is the implements & tools for growing, hunting, foraging and harvesting ingredients, as well as the implements and tools for cooking and preserving them.\n\nPhillip & Lea selects the tools and implements it stocks based on the type of materials used, their design and functionality, the heritage and craftsmanship of the maker, the provenance of the manufacturing and aesthetic. The implements and tools selected have innate durability, specificity of function and availability of dimensions to suit your need and person – all essential for a lifetime of use. It should also be stated that these fetching implements and tools are worthy of pride of place in your kitchen and shed.', 'A', '{"5":[[0.4583333333,0.6666666667]],"6":[[0.4166666667,0.6666666667]],"0":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/phillipandlea', '', '', '', '', '', 'https://plus.google.com/+PhillipandleaAu/posts'),
  (89993, 'raw-decor-89993', 'Raw Decor', '', 'Raw Decor is a leading  home decorating and gift shop in Albert Park, offering a wide range of home furniture, home decorative item, wall decor, kitchenware, rugs and skulls.', 272667, '2015-10-18 22:46:33', '2016-04-14 08:27:18', '', 191, 2136, 'furniture\nmanchester and bedding\ncookware\ndecor\nhome appliances\nrugs\nlighting\ntableware\nsofas', 272667, 0, '', 'info@rawdecor.com', '0396459305', '', '', '', 'http://www.rawdecor.com', 'Raw Decor is birthed from a genuine love for beautiful and unique home styling. It is a mix of tribal elegance and traditional craftsmanship to produce unique homewares and furniture for our customers space.\n\nWe have a mixture of Raw Decor exclusive designed products combined with products sourced from other select talented designers and manufactures. We take great pride in providing our customers with a variety of eye catching homewares and furniture, that follow the principles of using raw and natural materials. ', 'A', '{"2":[[0.5,0.7083333333]],"3":[[0.5,0.7083333333]],"4":[[0.5,0.7083333333]],"5":[[0.5,0.7083333333]],"6":[[0.5,0.7083333333]],"0":[[0.5,0.7083333333]]}', 'https://www.facebook.com/rawdecorau/', '', '', '', '', '', 'https://plus.google.com/109636835579628702925/posts'),
  (89998, 'red-works-89998', 'Red Works', '', 'Red Works is located in Paddington, Specialising in Interiors, Fashion & Gifts. We love to help you make yourself & your home feel & look beautiful.', 273339, '2015-10-18 22:46:50', '2016-04-15 05:56:59', '', 191, 1850, 'furniture\ndecor\nhome appliances\nsofas', 273339, 0, '', 'sales@redworks.com.au', '0738764288', '', '', '', 'http://www.redworks.com.au', 'Red Works aim is to help our customers to spoil themselves, their friends and their home though our innovative mix of unique and high quality clothing, bags, jewellery, gifts, homewares, furniture, window coverings, decorator accessories, lamps, art and our exceptional interior decorating service. For over 11 years, Red Works has been leaders in service, style and quality in the interiors, fashion and gifts industry in Brisbane and indeed Australia.\n\nRed Works value quality, innovation and design, and our product mix has been sourced from the best Australian and International ranges. Our customers needs, wants and lusts are always at the forefront of our mind when buying, so you can be assured that at Red Works you will find your one-stop-shop where you are always guaranteed to find the best of everything.', 'A', '{"1":[[0.3958333333,0.7291666667]],"2":[[0.3958333333,0.7291666667]],"3":[[0.3958333333,0.7291666667]],"4":[[0.3958333333,0.7291666667]],"5":[[0.3958333333,0.7291666667]],"6":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/redworkspaddington', 'https://twitter.com/RedWorksPadding', '', '', '', 'https://www.pinterest.com/redworks/', ''),
  (90002, 'rustic-heart-90002', 'Rustic Heart', '', 'Rustic Heart is a family run homeware store located in Surrey Hills offering a unique range of décor for the home and hard to find present for friends and loved ones. ', 272695, '2015-10-18 22:47:05', '2016-04-14 08:57:08', '', 191, 2124, 'bed and bath\ndecor\nhome appliances\nlighting', 272695, 0, '', 'info@rusticheart.com.au', '0390773339', '', '', '', 'http://www.rusticheart.com.au', 'Rustic Heart loves to mix muted colours and elegant designs to create a distinctive look that is both timeless and effortlessly elegant. Neutral tones and natural materials abound, making it easy to choose pieces that work well together, and will instantly feel at home in any setting.\n\nRustic Heart believes that your home should be a tranquil, relaxing retreat from the outside world, and we strive to find pieces with a story to tell, creating things that you’ll enjoy for years to come.\n\nWe pride ourselves on our service, and we’re only ever a phone call (or mouse-click) away. Whether you shop online, or visit us in Surrey Hills, we hope you’ll enjoy the time you spend with us.\n\n ', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.625]]}', 'https://www.facebook.com/Rustic-Heart-302610639895317/', '', '', '', '', '', 'https://plus.google.com/100231544091246518438/posts'),
  (90003, 'sampan-gifts-homewares-90003', 'Sampan Gifts & Homewares', '', 'Sampan is located in Rowville, specialises in handmade gifts from Fair Trade and Ethical organisations in SE Asia and India made from natural, recycled or renewable resources.', 274146, '2015-10-18 22:47:08', '2016-04-18 06:15:42', '', 191, 1606, 'decor\nhome appliances\nlighting\nkitchen and cookware', 274146, 0, '', 'info@sampan.com.au', '0450180473', '', '', '', 'http://www.sampan.com.au', 'Sampan specialises in Ethical, Eco-friendly and Exclusive gifts and homewares from the South East Asia and India.\n\nAll our products are handmade from natural, recycled or renewable resources. For us sustainability is not just about what we take from the earth or return to it, it is a philosophy on how we conduct our business, right down to re-using packaging when shipping customer orders.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/sampangiftsandhomewares', '', '', '', '', '', ''),
  (90009, 'the-shelley-panton-store-90009', 'The Shelley Panton Store', '', 'The Shelley Panton Store is a functioning pottery studio & retail store based in Prahran.  providing a handcrafted tableware & production pottery with extensive range of quality functional home goods.', 272978, '2015-10-18 22:47:29', '2016-04-15 01:53:56', '', 191, 1966, 'furniture\nmanchester and bedding\ncookware\ndecor\nhome appliances\nkitchen appliances\nlighting\ntableware\nkitchen and cookware', 272978, 0, '', 'shop@shelleypanton.com', '0395339003', '', '', '', 'http://shop.shelleypanton.com', 'The Shelley Panton Store is a functioning pottery studio and retail store based in the inner city of Melbourne.  Alongside handcrafted tableware and production pottery, you''ll find an extensive range of quality functional home goods.\n\nWith a background in food, interiors and events, plus a passion for pottery, wood, textiles, photography, and anything handmade, Shelley build a foundation for her pottery and create a hub for other things she loves working with.\n', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.7291666667]],"0":[[0.4166666667,0.7291666667]]}', 'https://www.facebook.com/shelleypantonstudio', 'https://twitter.com/shelleypanton', '', '', '', 'https://www.pinterest.com/shelleypanton/', 'https://www.google.com/maps/place/Shelley+Panton/data=!4m2!3m1!1s0x6ad6682becc84175:0x4a809327faea0c5f?gl=PH&hl=en'),
  (90019, 'start-2-finish-resolutions-90019', 'Start 2 Finish Resolutions', '', 'Start 2 Finish Resolutions is a family owned and operated business in Rivervale specialising in renovating Kitchens, Bathrooms and laundries.', 271707, '2015-10-18 22:48:05', '2016-04-13 08:30:47', '', 191, 2377, 'bathroom renovation\nkitchen renovation\nlaundry renovation\nkitchen remodeling\nbathroom remodeling\nbathroom showroom\nkitchen showroom', 271707, 0, '', 'info@start2finishresolutions.com.au', '0411445662', '', '', '', 'http://www.start2finishresolutions.com.au', 'Start 2 Finish Resolutions have over 25 years combined experience in the renovation industry. We are Members of HIA and MBA you can be assured of quality workmanship.\n\nStart 2 Finish Resolutions takes the stress out of renovating. We will design, manage, organise and coordinate every renovation detail from Start to Finish achieving outstanding results for our customers every time.\n\nWe have every aspect of your renovation covered; our professional team includes – Carpenters, tilers, plumbers, electricians, cabinet makers, ceiling fixers, plasterers, designers, painters, glass fabricator, solid surface and engineered stone suppliers.', 'A', '{"1":[[0.3958333333,0.6875]],"2":[[0.3958333333,0.6875]],"3":[[0.3958333333,0.6875]],"4":[[0.3958333333,0.6875]],"5":[[0.3958333333,0.6875]]}', 'https://www.facebook.com/start2finishresolutions', '', '', '', '', '', 'https://plus.google.com/u/0/103770358783054820147/posts'),
  (90020, 'stone-interiors-90020', 'Stone Interiors', '', 'Stone interiors is located in Campbellfield with over 20 years of experience specialising in the manufacture of all Marble ,Granite & Quartz surfaces to Kitchens & Vanity bench tops.', 273020, '2015-10-18 22:48:08', '2016-04-15 02:11:38', '', 191, 1951, 'bathroom and kitchen tiling', 273020, 0, '', 'stoneinteriors1@optusnet.com.au', '0394622098', '', '', '', 'http://www.stoneinteriors.net.au', 'At Stone Interiors we provide an elegant,durable finish we have become renowned for the high quality which offers the level of versatility required for customised projects, we work alongside with your specified interior designer and communicate with your Cabinet maker and Architect or Builder to make sure that what you have asked for you will get the first time around.\n\nOur craftsmanship is to creat a long lasting effect of supreme quality,to make sure you get the stone satisfaction you are after.\n\nWith 20 years of craft on our hands working with Marble & Granite stones we specialize in the manufacture of  stoneworks from kitchen bench tops, vanities, spa surrounds, fire places, from manufacturing to installation for both the Commercial and Domestic markets .', 'A', '{"1":[[0.3333333333,0.6666666667]],"2":[[0.3333333333,0.6666666667]],"3":[[0.3333333333,0.6666666667]],"4":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.6666666667]],"0":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/www.stoneinteriors.net.au/', '', '', '', '', '', ''),
  (90021, 'strawberry-bend-90021', 'Strawberry Bend', '', 'Strawberry Bend is located in Emerald, offering range of homewares and gifts that is perfect for your home.', 273052, '2015-10-18 22:48:12', '2016-04-15 02:29:35', '', 191, 1942, 'furniture\ndecor\nhome appliances', 273052, 0, '', 'janine@strawberrybend.com.au', '408308195', '', '', '', 'http://www.strawberrybend.com.au', 'Strawberry Bend offers tastefully selected Homeware and Gifts to bring out the heart in your home.  Everyone should be surrounded by the things they love - Family, Friends and Beautiful things.  If you have been searching for the right piece for a special place in your home - you''ve come to the right place.  Inside or outside Strawberry Bend has interesting pieces to bring out the best in your home.  ', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/StrawberryBend/', '', '', '', '', '', ''),
  (90022, 'suncoast-enclosures-90022', 'Suncoast Enclosures', '', 'Suncoast Enclosures is a family run business located in Burleigh Heads providing a range of products and services to suit any style or budget.', 273506, '2015-10-18 22:48:16', '2016-04-15 07:25:45', '', 191, 1781, 'commercial roofing\nindustrial roofing\ndomestic roofing', 273506, 0, '', 'sales@suncoastenclosures.net.au', '1300075653', '', '', '', 'http://www.suncoastenclosures.net.au', 'Suncoast Enclosures began in Sydney in 1983 with the vision of creating better outdoor living spaces for our customers. From humble beginnings with our first project being a screened deck enclosure that backed onto a bush reserve, thirty years on we now have an expanded product range that meets the wider requirements of architects, builders and household customers providing modern and bespoke designed enclosures, sunrooms, conservatories, pool enclosures, glass vision walls and retractable glass roofs.\n\nWe aim to use our superior knowledge and products to provide a custom designed solution that enhances the liveability of any outdoor space for our customers. We will provide a bespoke design concept to each project giving our customers a tailored product that is unique to their space and environment. We aspire to be customer focussed in all stages within the project build, working alongside our customers in transforming their vision into a unique and beautiful structure that well surpasses industry standards. We aim to uphold our reputation for quality that extends across 3 countries and more the 30 years of operation; a reputation we live by.\n', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/Suncoast-Enclosures-1501574423430547/', '', '', '', '', '', 'https://plus.google.com/103962590302052941878/about'),
  (90024, 'superior-screens-90024', 'Superior Screens', '', 'Superior Screens is Australia’s premier supplier of COLORBOND steel & aluminium balustrade, fencing, gates, privacy and shade products.', 273526, '2015-10-18 22:48:23', '2016-04-15 07:39:03', '', 191, 1770, 'shutters\nblinds\nscreens\nfolding closures', 273526, 0, '', 'info@superiorscreens.com.au', '1300766799', '', '', '', 'http://www.superiorscreens.com.au', 'Superior Screens has grown since opening in 2001 to become one of Australia’s largest and most reputable suppliers of COLORBOND® steel and Aluminium shade, fencing, gates and privacy screens for residential and commercial properties.\n\nWe specialise in manufacturing an extensive range of COLORBOND® steel and Aluminium fixed and adjustable louvres, plantation shutters, lattice and slatting products to provide innovative privacy, security and shade solutions for homeowners, home renovators, architects, project builders, property developers, commercial and industrial property owners as well as councils.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/SuperiorScreensAustralia/', '', '', '', '', '', ''),
  (90025, 'the-boroughs-store-90025', 'The Boroughs Store', '', 'The Boroughs Store is a local freindly shop located in Brunswick east, providing range of porducts including accessories, apparel, homewares and many more.', 273096, '2015-10-18 22:48:26', '2016-04-15 02:52:21', '', 191, 1919, 'furniture\nbed and bath\nmanchester and bedding\ndecor\nhome appliances\nlighting\nkitchen and cookware\nsofas', 273096, 0, '', 'info@theboroughs.co', '0393881618', '', '', '', 'http://www.theboroughs.co', 'The Boroughs in East Brunswick, Melbourne is a little local store. \nWe stock a carefully curated range of mostly Australian made products some from friends just around the corner and some further afield.\n\nThe Boroughs Store believes in actively participating in community. Our core values beyond our support for art and design, are for freedom of speech, equality, sustainability, access to education and care for the vulnerable.  \n\n ', 'A', '{"1":[[0.4166666667,0.75]],"2":[[0.4166666667,0.75]],"3":[[0.4166666667,0.75]],"4":[[0.4166666667,0.75]],"5":[[0.4166666667,0.75]],"6":[[0.4166666667,0.7083333333]],"0":[[0.4166666667,0.7083333333]]}', 'https://www.facebook.com/FiveBoroughs3057/', '', '', '', '', '', ''),
  (90026, 'the-collective-store-90026', 'The Collective Store', '', 'The Collective Store is located in Wynnum,  offering customers a unique shopping experience by providing high-quality handmade articles directly from talented, original makers.', 273566, '2015-10-18 22:48:30', '2016-04-15 08:34:32', '', 191, 1755, 'furniture\ndecor\nhome appliances', 273566, 0, '', 'info@thecollectivestore.com.au', '0731294606', '', '', '', 'http://www.thecollectivestore.com.au', 'The Collective Store brings Australia’s independent artists, designers and craftspeople a fresh, contemporary boutique where they can exhibit and sell their work; whilst offering customers a unique shopping experience by providing high-quality handmade articles directly from talented, original makers.\n\nInstore you will find items as diverse as the people who made them. From an elegant pair of hand-crafted silver earrings to a funky sock-monkey to hand-blended chai tea, there’s always something new and interesting to be found at The Collective Store.\n\nThe Collective Store also offer fun and engaging artist-led workshops for adults and children in our purpose built ''Making Space''. Come and learn a new skill and make new crafty friends!', 'A', '{"1":[[0.3958333333,0.7083333333]],"2":[[0.3958333333,0.7083333333]],"3":[[0.3958333333,0.7083333333]],"4":[[0.3958333333,0.7083333333]],"5":[[0.3958333333,0.7083333333]],"6":[[0.3958333333,0.5833333333]]}', 'https://www.facebook.com/TheCollectiveStore/', '', '', '', '', '', ''),
  (90027, 'the-home-interior-90027', 'The Home Interior', '', 'The Home Interior is located in the heart of Nelson Bay, offering sophisticated homewares, \nfurniture & gifts for your lifestyle.', 274250, '2015-10-18 22:48:33', '2016-04-18 07:01:56', '', 191, 1572, 'furniture\nbed and bath\nmanchester and bedding\ndecor\nhome appliances\nlighting\nsofas', 274250, 0, '', 'sales@thehomeinterior.com', '0249844888', '', '', '', 'http://www.thehomeinterior.com.au', 'The Home Interior opened its doors in September 2013 as a sister store to Homebody with the vision to offer beautiful furniture and homewares that inspire and delight. With a love for being at home, owners Josie and Paul created ''The Home Interior'' to invite others to do the same. "We spend so much of our time in our homes, it is important that we love that space" says Josie. "We want people to walk into our store and feel at home. The smells, the ambience, a motivation to create a space at home they can absolutely love being in"\n \nLocated in beautiful Nelson Bay on the east coast of New South Wales, The Home Interior reflects this coastal living combined with country, hamptons and other timeless design elements. Products are sourced from around the world, chosen for their high quality. The range includes homewares, candles, rugs, prints, lighting, books and furniture. Everything to make your house a home.\n \nThe Home Interior also offers home styling as well as a cafe serving breakfast, lunch, coffee and cake. We welcome you to an extended and relaxed experience. Shop and dine', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/thehomeinteriornelsonbay/', '', '', '', '', '', ''),
  (90028, 'the-house-of-elliot-90028', 'The House of Elliot', '', '', 0, '2015-10-18 22:48:37', '2016-04-13 07:44:15', '', 191, 2379, '', 0, 0, '', 'info@thehouseofelliot.com.au', '0885541958', '', '', '', '', '', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666]]}', '', '', '', '', '', '', ''),
  (90034, 'thesupercool-90034', 'TheSuperCool', '', 'TheSuperCool is an emporium that goes to the people, with an eclectic mix of everyday objects from around the globe located in South Melbourne.', 273172, '2015-10-18 22:48:58', '2016-04-15 03:19:59', '', 191, 1891, 'furniture\ndecor\nhome appliances\nkitchen appliances\nlighting\ntableware\nsofas', 273172, 0, '', '', '0401673544', '', '', '', 'http://thesupercool.com', 'TheSuperCool sell stationary, design books, posters, kids toys, homewares, gifts and vintage collectables with an industrial, nostalgic feel and influenced by fashion, pop culture and the creative industries. TheSuperCool has hand selected everyday objects from local and international artists to bring a unique edit.', 'A', '{"3":[[0.3333333333,0.6666666667]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3333333333,0.6666666667]],"0":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/TheSuperCool-298699333475444/', 'https://twitter.com/TheSuperCools', '', '', '', 'https://www.pinterest.com/thesupercool/', ''),
  (90036, 'tricon-developments-90036', 'Tricon Developments', '', 'Tricon Developments Pty Ltd is a building company specialising in high end Architectural construction and commercial challenges located in Cabarita.', 274294, '2015-10-18 22:49:05', '2016-04-18 07:25:32', '', 191, 1559, 'residential building\nengineering consultant\ninterior design\narchitectural design', 274294, 0, '', 'glenn@tricondevelopments.com.au', '0297363655', '', '', '', 'http://www.tricondevelopments.com.au', 'Tricon Developments is a wholly owned Australian Company based in NSW with our head office located at Cabarita. The company was established in 2001 and we soon became the principal builder of many architecturally designed luxury houses.\n\nAt Tricon Developments we are not your average builder. We understand all aspects of the building process. Our experienced and highly creative staff are committed to providing stress free quality outcomes and focus heavily on the finer details. From small renovations through to executive level homes and commercial works, Tricon Developments apply individual delivery techniques to meet each unique project. Safety, compliance and quality are at the forefront of our process at all times.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/Tricondevelopments', '', '', '', '', '', 'https://plus.google.com/109718056894036905137/about'),
  (90039, 'twig-feather-90039', 'Twig & Feather', '', 'Twig & Feather is a modern, country style home and living store located in Cobargo featuring natural handmade candles, affordable gifts and homewares, and that something special for you.', 274316, '2015-10-18 22:49:16', '2016-04-18 07:40:54', '', 191, 1555, 'furniture\nbed and bath\ndecor\nhome appliances\nlighting\nkitchen and cookware', 274316, 0, '', 'info@twigandfeather.com.au', '0264936552', '', '', '', 'http://www.twigandfeather.com.au', 'Twig & Feather is a country style home and living store in Cobargo, featuring my own handmade natural candles, and reed fragrance diffusers to fill your home with wonderful scents.\n\nTwig & Feather''s homewares and gifts are affordable, practical or a little bit luxurious, and that little bit different. ', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.3958333333,0.6666666667]],"0":[[0.4166666667,0.625]]}', 'https://www.facebook.com/twigandfeather.australia/timeline', '', '', '', '', '', 'https://www.google.com/maps/place/Twig+%26+Feather/data=!4m2!3m1!1s0x6b3e76ff38e2a4e7:0x9142b4c3dc5cae2a?gl=PH&hl=en'),
  (90040, 'twig-moss-90040', 'Twig & Moss', '', 'Twig & Moss brings together a range of art and homewares that have a sense of whimsy inspired by nature. We have an eclectic mix of designed and hand-crafted pieces.', 274336, '2015-10-18 22:49:19', '2016-04-18 07:52:06', '', 191, 1544, 'furniture\nmanchester and bedding\ndecor\nhome appliances\ntableware\ncarpets', 274336, 0, '', 'twigandmoss@gmail.com', '0427975275', '', '', '', 'http://www.twigandmoss.com.au', 'twig & moss is a concept store that brings together a range of products that have a sense of whimsy inspired by nature. We have a beautiful mix of designed and handcrafted pieces from Australia and around the world that have been made with love and respect for people and the environment.\n\nOur shop is raw bespoke living with the aim to create an alternative option for those wishing to escape the mass-made culture and seeking something that is unique.\n\ntwig & moss'' style embraces raw, rustic simplicity mixed with our own uniqueness. We are all about individuality far away from mass produced fads. We can help you with colour, styling and design.', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.4166666667,0.625]]}', 'https://www.facebook.com/TwigandMoss', 'https://twitter.com/twigandmoss', '', '', '', 'https://www.pinterest.com/twigandmoss/', 'https://plus.google.com/112968535212203931237'),
  (90042, 'twine-home-store-90042', 'Twine Home Store', '', 'Twine Home Store is located in the historic village of Wollombi with variety of products including home decor, gifts, homeware, women''s clothing and many more.', 274364, '2015-10-18 22:49:27', '2016-04-18 08:05:27', '', 191, 1540, 'furniture\nbed and bath\ncookware\ndecor\ntableware\nkitchen and cookware', 274364, 0, '', 'info@twinehomestore.net.au', '0414665189', '', '', '', 'http://www.twinehomestore.net.au', 'Twine Home Store is located in the historic village of Wollombi in NSW Hunter Valley. The store is stocked with a wide variety of locally and internationally sourced finds, the majority of which are sustainably or fair trade made.\n\nWe stock brands including: Apple Green Duck, Atolyia, Down to the Woods, Eb & Ive / Isle of Mine, Fragonard Perfumes, Have you met Miss Jones, Kate and Kate Blankets, Laguna Lavender, Nana Huchy, OB Designs, Peachy by Lark, Redecker brushes and dusters, The Dharma Door, Wonki Ware.', 'A', '{"4":[[0.4166666667,0.5833333333]],"5":[[0.4166666667,0.5833333333]],"6":[[0.4166666667,0.625]],"0":[[0.4166666667,0.625]]}', 'https://www.facebook.com/twinehomestore/', '', '', '', '', 'https://www.pinterest.com/twinehomestore/', 'https://plus.google.com/116990900252793218353/about'),
  (90045, 'urban-art-decor-90045', 'Urban Art & Decor', '', 'Urban Arts & Decor is located in Hillarys offering a beautiful, unique decor and furniture for your home. URBAN stock many exclusive ranges including wall art, furniture.', 271726, '2015-10-18 22:49:37', '2016-04-13 09:10:38', '', 191, 2369, 'furniture\ndecor\nhome appliances\nantiques\nsofas', 271726, 0, 'Hillarys Boat Harbour', 'info@urbanart.net.au', '0892469791', '', '', '', 'http://www.urbanart.net.au', 'URBAN ART & DECOR offers a beautiful, unique decor and furniture for your home. Urban stock stock an extensive range of high quality items for your home. We specialise in and supply, furniture, including consoles, coffee, end, lamp and dining tables, dining chairs, wall art, canvases, oil paintings, metal wall art, framed prints, wall plaque, discs, shadow boxes, mirrors, vases, candleholders, plates, bowls, figurines, statues, sculptures, abstract art, photo frames, decorative dishes, cushions, runners, throws, floor and table lamps, ceiling lights, chandeliers, flowers, sectional/modular leather sofas. We source exquisite products that are brought together to create beautiful and imaginative interiors. A visit to one of our stores will not disappoint.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Urban-Brands-133649196650745/', '', '', '', '', '', ''),
  (90048, 'vergola-90048', 'Vergola', '', 'Vergola is located in Terrey Hills, the world''s first complete opening roof system, creates the ultimate outdoor environment all year round.', 274424, '2015-10-18 22:49:48', '2016-04-18 08:48:48', '', 191, 1520, 'roof repairs\ncommercial roofing\ndomestic roofing', 274424, 0, '', 'admin@vergolansw.com.au', '0294503300', '', '', '', 'http://www.vergolansw.com.au/', 'Vergola, the world''s first complete opening roof system, creates the ultimate outdoor environment all year round.\n\nWith the Vergola louvre roofing system you can control sunlight and airflow - just perfect as the ultimate opening roof system for outdoor entertaining.\n\nThe energy-efficient Vergola not only saves you money, it can also add value to your home or business. Our outdoor roofing systems are custom made to suit a wide range of commercial and residential applications.\n\nThe Vergola system is custom made to suit a wide variety of residential and commercial outdoor requirements.\n\nVergola allows you to adjust your outdoor covers to suit the weather and enhance your lifestyle all year round.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.5]]}', 'https://www.facebook.com/vergolansw', '', '', '', '', '', ''),
  (90051, 'vividshop-90051', 'VividShop', '', 'Vividshop is a highly visible homewares, clothing and accessories boutique that has traded since establishment in 1999. Located in the character-filled retail area of Surry Hills, Sydney.', 274438, '2015-10-18 22:49:59', '2016-04-18 09:10:02', '', 191, 1516, 'furniture\nmanchester and bedding\ndecor\nhome appliances', 274438, 0, '', 'info@vividshop.com.au', '0283991210', '', '', '', 'http://www.vividshop.com.au', 'Vividshop is a highly visible homeware, clothing and accessories boutique that has traded since established in 1999 by mother and daughter team, Denise and Sami, with decades of experience in the fashion and design industry.\n\nVividshop is located in the character-filled retail area of Surry Hills, Sydney, and within the leading fashion and homewares precinct, Vividshop projects a strong street identity and is well-known, and well-regarded, by the local community. Likewise we have a loyal, Sydney-wide client base, and Vividshop is a long-standing favourite of magazine editors and stylists looking for new and exciting editorial product. \n\nOur merchandising is fun and colourful, in striking contrast to the stark, spacious shop space, and our products are typically vivacious and feminine, with a strong bohemian flavor. The online store was added to the business in 2006, selling a selection of the collection, and more items are being added every week.', 'A', '{"1":[[0.3958333333,0.75]],"2":[[0.3958333333,0.75]],"3":[[0.3958333333,0.75]],"4":[[0.3958333333,0.7916666667]],"5":[[0.3958333333,0.75]],"6":[[0.3958333333,0.7083333333]],"0":[[0.4375,0.7083333333]]}', 'https://www.facebook.com/vividshop', 'https://twitter.com/vividshopSydney', '', '', '', 'https://www.pinterest.com/VividshopSydney/', 'https://plus.google.com/u/0/105346868243795256133/posts'),
  (91554, 'nsw-leagues-club-91554', 'NSW Leagues Club', '', 'NSW Leagues Club located in the heart of the CBD offers a relaxed friendly atmosphere and value for money. Enjoy a drink from one of our 4 bars or dine in our Thai Restaurant or Bistro.', 200147, '2015-11-05 02:52:13', '2016-04-12 06:49:51', '', 191, 2601, 'leagues club', 200147, 0, '', 'admin@nswleagues.com.au', '0292322611', '', '', '', 'http://www.nswleaguesclub.com.au/', 'NSW Leagues'' Club is the ideal spot to catch up with friends - have a drink in any of 4 Bars including Level One Cocktail Bar, or dine in the Bistro or Thai Restaurant. NSW Leagues'' Club can also host your upcoming function with a capacity for 15 to 300 people. The club boasts a bottle shop, 2 outdoor areas and Headquarters Fitness Centre, with computerised equipment, group classes and massage room. The Travelodge, situated above the club, has 85 rooms and makes NSW Leagues a great base for your next event in Sydney.\n\nFOOD AND BEVERAGE - \nBistro on Phillip is open daily for breakfast, lunch and dinner, serving affordable meals ranging from burgers through to char-grilled dishes. Mondays to Wednesdays $10 steak & chips are available for lunch and dinner. \n\nThai on 1 opens daily for lunch and also dinner on Wednesday and Thursday nights from 5.30pm. It is another handy option for the city folk, serving affordable and authentic Thai food in a comfortable atmosphere. Thai on 1 serves great fresh stir fries, curries and noodle dishes from $11.90. Try the $10 meal deal for lunch or dinner on Thursdays. Maybe reward your staff with the daily group banquet menus from just $20 per person. \n\nLevel One Bar is a sophisticated lounge bar with a choice of well priced cocktails and tap beer. The Elizabeth and Phillip Street bars service the bistro and lounge areas and here you can watch live sporting action on the big screens whilst enjoying a drink in air conditioned comfort.\n\nFUNCTION FACILITIES - There are two levels of function rooms to choose from and they are available 7 days a week with seating for up to 300 people. Conferences, product launches, cocktail parties, trivia nights and weddings are all catered for with a variety of food and beverage packages. The Travelodge, adjacent to the club, makes this an ideal venue when choosing your next event in Sydney. Interstate and intrastate conference delegates have book quality accommodation in the heart of the Sydney CBD.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9583333333]],"6":[[0.5,0.8333333333]],"0":[[0.5,0.7916666667]]}', 'https://www.facebook.com/NSW-LEAGUES-CLUB-316304277135/', 'https://twitter.com/NSWLeaguesClub', '', '', '', '', 'https://plus.google.com/107860998129390498527/about'),
  (91558, 'eastern-suburbs-leagues-club-91558', 'Eastern Suburbs Leagues Club', '', 'Eastern Suburbs Leagues Club is located in the heart of Bondi Junction, we’re the proud home of the mighty Sydney Roosters. Come along & enjoy our great Restaurants, Bars, Café, Entertainment & more.', 268868, '2015-11-05 03:07:21', '2016-04-14 01:37:44', '', 191, 2279, 'leagues club\nsports club\nsocial club', 268868, 0, '', 'info@eastsgroup.com.au', '0293863200', '', '', '0293877779', 'http://www.eastleaguesclub.com.au/1', 'Eastern Suburbs Leagues Club is in the heart of Bondi Junction, around 15-20 minutes drive from Sydney''s CBD. It is easily reached by public transport.\n\nDESCRIPTION - The proud home of the Sydney Roosters offers the best in restaurants, bars and entertainment.\n\nFOOD AND BEVERAGE - Easts Leagues Club has opened up an exciting new Italian Restuarant and Bar. The Italian Kitchen serves delicious traditional Italian meals and is a great place to dine and meet with family and friends. The large drink menu will ensure you find the perfect drink to accompany your meal or your night out. Italian Kitchen Restaurant is open daily except Monday for lunch and dinner. The Italian Kitchen Bar is open 7 days a week from 11am till late with a bar food menu available. \n\nThe Bondi Tram Cafe makes great coffee and a fantastic range of healthy sandwiches, freshly squeezed juices and other delicious treats. It is open daily and offers some great midweek lunch specials.\n\nEastern Treasures Seafood Restaurant serves authentic Chinese and Seafood cuisine and a daily yum cha menu. It is open daily except Monday for lunch, and daily except Sunday and Monday for dinner.\n\nKro Bar is Easts Leagues Club''s entertainment destination. By day enjoy a quiet drink in a relaxing atmosphere, participate in a game of bingo or try your luck in one of the many raffles. At night be treated with Happy Hour, live bands and other great entertainment such as karaoke and trivia and check out all the sporting action here in Kro Bar. A snack menu is available in Kro Bar.\n\nFUNCTION FACILITIES - Easts Function Centre has 2 rooms and offers versatile facilities. The lavish Harbour Terrace boasts a timber desk, Harbour Bridge glimpses and a capacity for 150 guests. It is perfect for weddings, reunions, birthdays and seminars. The larger Bondi Room seats up to 320 guests and can also be divided into 4 smaller rooms. Skilled chefs have created a variety of function menus which you can match with your choice of beverages. Leading edge technology can provide the best in mood and acoustics.', 'A', '{"1":[[0.375,0.25]],"2":[[0.375,0.25]],"3":[[0.375,0.25]],"4":[[0.375,0.25]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.25]]}', 'https://www.facebook.com/Easts-Bondi-Leagues-Club-357027454360893/timeline', '', '', '', '', '', 'https://plus.google.com/109978603992764667720/about'),
  (91563, 'the-juniors-91563', 'The Juniors', '', 'The Juniors located in Kingsford is the home of llve entertainment with a great selection of restaurants, bars plus a fitness centre and swimming pool. We have everything to offer at The Juniors!', 200245, '2015-11-05 03:21:39', '2016-04-14 08:43:52', '', 191, 2126, 'sports club', 200245, 0, '', 'facebook@thejuniors.com.au', '0293497555', '', '', '0293445226', 'https://www.thejuniors.com.au/', 'The Juniors club  facilities are endless, for both young and old. It is renowned for its entertainment, providing a stellar program of shows featuring the best local and international artists in the state-of-the-art showroom. Outside the main entertainment room - the Wintle Room - the new Level 2 Lounge allows patrons to relax in style and enjoy a beverage before events. Three restaurants and a cafe cater for all tastes with quality affordable menus. The gymnasium includes squash courts and an indoor heated pool. Members can also enjoy the use of a selection of accommodation on the Central and North Coast, as well as Una Voce Resort on the Hawkesbury River.\n\nFOOD AND BEVERAGE - Enjoy authentic Chinese cuisine, a la carte dining, and fresh seafood at The Juniors. Sundeck Brasserie is open daily for lunch and dinner, providing a varied menu including seafood, steak, salad, daily specials and more. The Imperial Peking Chinese Restaurant is open daily for lunch and dinner with yum cha also available during lunch. Mike’s Seafood Grill & Bar restaurant is open Wednesday to Sunday (exc Saturday) for lunch, and Wednesday to Sunday for dinner. Great specials are always on offer!\n\nFUNCTION FACILITIES - The newly refurbished Games Room is the largest function space, catering for up to 500 guests cocktail style. The Sundeck Glass Room is perfect for smaller groups of 60 for a sit-down dinner.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/thejuniorskingsford/timeline', 'https://twitter.com/thejuniors_558', '', '', '', '', 'https://plus.google.com/116802801232046387162/about'),
  (91569, 'norths-leagues-club-91569', 'Norths Leagues Club', '', 'Norths Leagues Club located in Cammeray offers a mouth-watering new food available at the Norths Pantry, enjoy a coffee and pastry at NORTHS Café, a great selection of wines at Norths.', 200319, '2015-11-05 03:42:54', '2016-04-15 01:01:20', '', 191, 2032, 'leagues club', 200319, 0, '', 'member.info@norths.com.au', '0292453000', '', '', '', 'http://www.norths.com.au/', 'Norths Leagues Club has many facilities available, 2 dining choices, 2 modern bar areas including the TAB Sportsbar, perfect for meeting up with friends and colleagues. \n\nFOOD AND BEVERAGE - There are fabulous dining choices at Norths.\n\nNorths Cafe is open from 10am till late every day and provides casual style meals, cakes, pastries and a wide selection of coffees.\n\nNorths Pizzeria is now open serving mouthwatering pizzas. Open daily for lunch 12noon-2pm and dinner 5.30pm-9pm. \n\nNorths NEW platinum ClubTAB - Equipped with everything a standard agency TAB has and more. It offers patrons full bar access, food facilities in close proximity plus over 28 LCD TV and a huge 60" race TV to catch all the live sports action. Choose an appetising snack or meal from an array of gourmet pizzas and breads, authentic style pastas, fresh salads, burgers, steak sandwiches and snacks plus premium coffees. \n\nAmber Lounge and Jackson''s Bar offer contemporary and stylish surroundings, perfect for an evening with friends. The Fusion Bar is hot new place blending fashionable undercover and open-air spaces, making it ideal for mixing and relaxing with friends, perhaps with a cocktail, glass of wine or tap beer. \n\nFUNCTION FACILITIES - Norths has a selection of function rooms to suit every requirement, from a small meeting/gathering of 12 persons to a wedding, special occasion, conference or product launch for 530 people. The Celebrity Room has the largest capacity of 530, the Kamaraigal Room is ideal for cocktail parties, seminars, and birthday parties up to 110 guests and the McKinnon Room is ideal for private dinners and conferences, comfortably accommodating 30 guests.', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0833333333]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.1458333333]],"6":[[0.4166666667,0.1458333333]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/northsleagues/', 'https://twitter.com/northscammeray', 'https://www.linkedin.com/company/norths-group', '', '', '', 'https://plus.google.com/112546985710190457177'),
  (91573, 'manly-leagues-club-91573', 'Manly Leagues Club', '', 'Manly Leagues Club located in Brookvale is the home of the mighty Sea Eagles, Manly has the Lyons Den catering for the sports fanatic and the Sea Eagles Lounge Bar offering a more relaxed atmosphere.', 270105, '2015-11-05 04:00:07', '2016-04-15 00:32:07', '', 191, 2057, 'leagues club\nsports club', 270105, 0, '', 'reception@seaeagles.com.au', '0299396722', '', '', '0299050787', 'http://www.seaeagles.com.au/', 'Manly Leagues Club is the home of the mighty Sea Eagles, the club is one of the leading clubs in the area and has over 22,000 members.\n\nFOOD AND BEVERAGE - Cafe Manly is situated on the ground floor and is open from 9.30am till late 7 days. Brasserie 563 offers light meals and a la carte lunch and dinner daily. Eat Me, a whole new dining experience, is open daily for lunch or dinner and is located on the 1st floor. Legends Sports Bar is the place to be for all your sporting needs with TAB, Fox Sports Sky channel, & Keno. Live music is featured every Friday and Saturday plus a cabaret show on Saturday evenings. There is also an ATM facility and a great cocktail bar. \n\nFUNCTION FACILITIES - There are four versatile function rooms, catering for small parties to lavish events. The Auditorium can seat up to 450 guests banquet style or 750 theatre style. The Peninsular Room caters for gatherings of up to 120 banquet style, an is suitable for weddings, seminars and cocktail parties. Legends Conference Room and Eagles Nest will seat 20-30 people, making them ideal for conferences or training workshops.', 'A', '{"1":[[0.375,0.0416666667]],"2":[[0.375,0.0416666667]],"3":[[0.375,0.0833333333]],"4":[[0.375,0.0833333333]],"5":[[0.375,0.1666666667]],"6":[[0.375,0.1666666667]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/ManlySeaEagles/timeline', 'https://twitter.com/seaeagles', '', '', '', '', 'https://plus.google.com/105730812465455583703/about');
INSERT INTO `tbl_entity_organization` (`id`, `friendly_url`, `name`, `alternate_name`, `description`, `image_id`, `enter_time`, `update_time`, `abn`, `account_id`, `place_id`, `keywords`, `logo_id`, `banner_id`, `address_additional_info`, `email`, `telephone`, `alternate_telephone`, `mobile`, `fax_number`, `website_url`, `content`, `status`, `hours_work`, `facebook_link`, `twitter_link`, `linkedin_link`, `youtube_link`, `blog_link`, `pinterest_link`, `googleplus_link`) VALUES
  (91575, 'wenty-leagues-club-91575', 'Wenty Leagues Club', '', 'Wenty Leagues Club is located at Wentworthville and offer a wide range of function services. Wenty Leagues Club offer training, cocktail functions, birthdays, engagements and more.', 200419, '2015-11-05 05:10:16', '2016-04-26 02:26:01', '', 191, 786, 'leagues club', 200419, 0, '', 'info@wentyleagues.com.au', '0288689200', '', '', '', 'http://www.wentyleagues.com.au/', 'The early pioneers of Wenty Leagues had tremendous vision even though they certainly lacked capital! Capital was accrued from Members’ subscription fees, raffles, beer tickets, first try scorer etc. plus a loan from the local Bank of New South Wales guaranteed by Millers’ Brewery.\n\nFinally land was purchased on September 25, 1959 and it was then the real work started.\nThe first application for a Liquor License was made in July, 1960 with 211 Members and these Members have been regarded by previous Board of Directors as the Foundation Members. However, the original 46 of September 1958 are considered the “Original Foundation Members or Foundation Life Members”.\n\nThe most positive step towards the building of a Club commenced during 1956 when the General Committee of the Rugby League Football Club resolved that the office bearers at that time would make up the Committee to form a Leagues Club.\n\nAs an immediate means of raising finance it was resolved that Foundation Life Membership for a subscription of Ten Pounds ($20.00) would be offered. Barry Moulds, Jim Docking and Wally Webster placed 10 Pound notes on the table which meant that the Leagues Club was up and running.', 'A', '{"1":[[0.375,0.1666666667]],"2":[[0.375,0.1666666667]],"3":[[0.375,0.1666666667]],"4":[[0.375,0.1666666667]],"5":[[0.375,0.25]],"6":[[0.3333333333,0.25]],"0":[[0.3333333333,0.1666666667]]}', 'https://www.facebook.com/wentyleagues/timeline', '', 'https://www.linkedin.com/company/wentworthville-leagues-club', '', '', '', 'https://plus.google.com/+WentyleaguesAus/videos'),
  (91586, 'canterbury-league-club-91586', 'Canterbury League Club', '', 'Canterbury League Club, situated in Belmore, is one of Sydney’s premier hospitality destinations with 5 Star amenities. It offers 3 restaurants 4 bars, a state-of-the-art health club and much more.', 200583, '2015-11-05 06:04:14', '2016-04-13 06:19:48', '', 191, 2404, 'leagues club\nsocial club', 200583, 0, '', 'info@canterbury.com.au', '0297047777', '', '', '0297408676', 'http://www.canterbury.com.au/', 'Canterbury League Club is impressive club with three fabulous restaurants, two coffee shops, a range of bars, an extensive Health Club, full function facilities, a Showroom and an extensive entertainment program. Recently renovated with stunning indoor and outdoor water features.\n\nFOOD AND BEVERAGE - Restaurants include The Banyan Brasserie, geared to casual dining, with an accent on families. It offers made to order meals as well as a quick service menu and also has bonus midweek specials in particular themes.\n\nThe Dynasty Chinese Restaurant offers authentic Asian menus, and provides Yum Cha as an option from 11am daily (10am on Sundays). \n\nFlame Bar and Restaurant, an exotic addition to the Canterbury range of amenities, was recently judged the best club restaurant in NSW at the Clubs NSW Awards for Excellence. Flame Bar and Restaurant is situated in the exotically renovated "old club", offering an indoor-outdoor experience that truly takes club life to a new level. \n\nThe Banyan Tree Coffee Shop is open 24 hours a day, every day, serving Doewe Egberts coffee and delightful pastries.\n\nFlame Coffee Shop also serves gourmet coffee and fresh continental delicacies in an intimate atmosphere with views of the water feature.\n\nFUNCTIONS - Canterbury Leagues Club offers amongst the most comprehensive features of any function venue in Sydney with a series of venues to cater for weddings, awards ceremonies, receptions, parties, conferences, dinners, meetings or training seminars. The club can accommodate groups from 20 to more than 200, and offers a range of excellent menus to provide a quality function at an affordable price.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/canterburyleaguesclub/', 'https://twitter.com/Canterbury_LC/', 'https://www.linkedin.com/company/canterbury-league-club', '', '', '', 'https://plus.google.com/111012585908590020183/about'),
  (91596, 'sharkies-leagues-club-91596', 'Sharkies Leagues Club', '', 'Sharkies Leagues Club is located at Cronulla and offers wide range of food choices, function, entertainment & more.', 200704, '2015-11-05 06:36:49', '2016-05-01 23:44:50', '', 191, 2302, 'leagues club\nsports club', 200704, 0, '', 'reception@sharks.com.au', '0295230222', '', '', '', 'http://sharkies.com.au/', 'A PAST TO BE PROUD OF AND A FUTURE TO LOOK FORWARD TO.\n\nThe Cronulla-Sutherland Sharks entered the elite NSWRL competition in 1967, playing their first game against the Eastern Suburbs Roosters at the Sydney Showground in Moore Park.\n\nIt was a match won by the Sharks and marked the beginnings of a club now recognised and respected throughout the sporting world.\n\nThe Sharks haven’t yet managed to raise the premiership trophy in triumph, but it hasn’t been for a lack of trying. Three times they have contested First Grade Grand Finals and on numerous other occasions have threatened a premiership breakthrough, while the Sharks Amco Cup triumph in 1979 stands tall as a significant achievement during what was a successful era at the club.\n\nWe are delighted to have the opportunity to present our  Events packages to you. Our events staffing team are of  the highest possible standard ensuring that your special  occasion, whether it be a birthday, engagement party, anniversary or christening is an outstanding success.\n\nFunction rooms are available seven days a week with rooms  to cater for 10 – 800 guests and providing services for  breakfast, lunch or dinner.', 'A', '{"1":[[0.4166666667,0.5]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0833333333]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.5]]}', 'https://www.facebook.com/SharkiesLeagues', 'https://twitter.com/Sharksleagues', 'https://www.linkedin.com/company/cronulla-sharks-football-club', '', '', '', 'https://plus.google.com/109514944711704366381/about'),
  (91601, 'central-coast-leagues-club-91601', 'Central Coast Leagues Club', '', 'Central Coast Leagues Club located at Gosford provides dining, beverage, entertainment, function areas, sporting and gaming facilities to it''s members and guests.', 200782, '2015-11-05 06:57:26', '2016-05-01 23:07:38', '', 191, 1984, 'leagues club\nsocial club', 200782, 0, '', 'reception@cclc.com.au', '0243259888', '', '', '', 'http://www.cclc.com.au/', 'Central Coast Leagues Club overlooks Brisbane water and boasts 5 bars serving fine wines, great beers, sports entertainment and live music.\n\nThere is an array of casual dining options including Star Bistro, Star Buffet, Star Cafe, Yume Teppanyaki Restaurant and the Peking Garden Chinese Restaurant which are all popular. The largest function room can cater for up 1000 people and there is a choice of smaller options.\n\nFOOD AND BEVERAGE\nCafé Central – is open daily from 9.00am and sells everything from great coffee and snacks to main meals.\n\nStar Buffet Family Restaurant – arguably the best ‘all you can eat’ experience with selections including seafood, carvery, asian meals, salads, desserts and much more. Open seven days for lunch and dinner.\n\nYume Japanese Teppanyaki - watch talented chefs perform their culinary skills before you. (Closed Mondays).\n\nPeking Garden Chinese Restaurant - One of the best Chinese restaurants on the Coast, with an all you eat buffet on Sundays.\n\nBlue Water Terrace - Newly opened and boasting great views over Brisbane Water, offers outdoor dining, modern Australian cuisine with an emphasis on seafood, 2 bars and live music on Sundays.\n\nFUNCTION FACILITIES - The Central Coast Leagues Convention Centre is a multi purpose exhibit and convention facility with a service culture dedicated to making every moment count. Four function areas cater for groups of 20 to 1000 guests, with a choice of menu and beverage packages.', 'A', '{"1":[[0.375,0.125]],"2":[[0.375,0.125]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.125]],"6":[[0.375,0.125]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/Central-Coast-Leagues-Club-140575858418/timeline', 'https://twitter.com/CCLeagues', '', '', '', '', 'https://plus.google.com/+centralcoastleaguesclub/about'),
  (91605, 'entrance-leagues-club-91605', 'Entrance Leagues Club', '', 'Entrance Leagues Club located in Bateau Bay provide modern sports & social lounges, brasserie, coffee shop, live entertainment & outdoor terraces, make this club a haven for locals and visitors. ', 200836, '2015-11-05 07:12:01', '2016-04-28 05:36:56', '', 191, 113, 'leagues club', 200836, 0, '', 'admin@telclub.com.au', '0243343233', '', '', '', 'http://www.telclub.com.au/', 'The Entrance Leagues Club is situated on the scenic Central Coast just 5 minutes from The Entrance town centre and adjacent to Bay Village Shopping Centre, Bateau Bay. The Entrance is around 90 minute drive from Sydney''s CBD.\n\nDESCRIPTION - The Club offers outstanding facilities for all occasions specialising in quality food, functions and entertainment. Recently completed extensions and refurbishments provide a relaxing and fresh venue for all members and guests.\n\nFOOD AND BEVERAGE - Friendly dining at the Bayside Brasserie, open daily for lunch and dinner, providing quality meals at affordable prices. Relax and enjoy a delicious Cappuccino, Cafe Latte or Hot Chocolate and dessert from the wide selection The Bayside Coffee Shoppe has to offer. The cafe is open from 10am till 9pm.\n\nFUNCTION FACILITIES - The function rooms can cater or any event, from 21st''s to weddings and conferences. The professional function staff can arrange menus, themes, decorations or any aspect to make your event successful.', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9583333333]],"4":[[0.375,1]],"5":[[0.375,0.0833333333]],"6":[[0.375,0.0416666667]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/The-Entrance-Leagues-Club-167604026586310/', '', 'https://www.linkedin.com/company/the-entrance-leagues-club-limited', '', '', '', 'https://plus.google.com/107220792549301136799/about'),
  (91608, 'wests-new-lambton-91608', 'Wests New Lambton', '', 'Wests New Lambton boasts over 15 restaurants, bars and cafes, a 136-room 4 1/2 star hotel, live entertainment venues and a state of the art health centre', 200878, '2015-11-05 07:24:07', '2016-04-15 01:33:14', '', 191, 1979, 'leagues club', 200878, 0, '', 'info@westsnewcastle.com.au', '0249351200', '', '', '0249351477', 'http://www.westsnewcastle.com.au/', 'Wests New Lambton is part of the mighty Wests Group and is one of the largest clubs in the state. It believes in supporting local tourism, and has built a 4.5* motel- the Executive Inn which is popular with both tourist and business travellers. With the vast facilities offered at this fine club and quality accommodation, Wests has no doubt established itself as a focal point and destination in the Hunter region.\n\nFOOD AND BEVERAGE - \n\nHobarts has brought club dining to a new level, with a revamped menu, stunning decor and new winelist. Open Friday and Saturday evenings, this is where you can bring one(or a few) special guests to impress. \n\nBrasserie 88 is quality bistro style dining with a delicious and varied menu including steaks, seafood, salads and more. It is open daily from 4pm-11pm.\n\nEmerald Gardens showcases a world of exotic Asian cuisine. Open nightly from 5.30pm-9.30pm.\n\nThe Food Court is popular with families, offering dishes ranging from laksas and pastas to roasts. Open daily for lunch from 11.30am-2.30pm and dinner from 5pm-9pm.\n\nThe Coffee Shop offers coffee and light snacks, open from 9am-5.30am. The Patisserie offers gourmet sandwiches and cakes, open from 10am-9.30pm.\n\nBreakfast on the Terrace is a perfect start to a working day, or relaxing weekend. Open Monday to Friday 6.30am-9.30am and weekends 7am-10am.\n\nFUNCTION FACILITIES - Wests Convention Centre is one of the premier event spaces in the Hunter Region, with specific areas designed to cater for all manner of functions. Five well appointed function rooms cater for up to 1000 people, with flexible set-ups and breakout areas. The Starlight Room boasts a state-of-the art audio visual system, impressive live performance staging and three giant screens. In addition, there is a large terrace with a pleasant outlook over two pools'' and leading onto 2 other function areas. Weddings are also a speciality, catering for 50 to 700 guests. The dedicated events team at Wests will design and assist you with every aspect of your celebration or corporate event. With a 4.5* hotel on site, Wests has your event all wrapped up!', 'A', '{"1":[[0.375,0.1666666667]],"2":[[0.375,0.1666666667]],"3":[[0.375,0.1666666667]],"4":[[0.375,0.1666666667]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.1666666667]]}', 'https://www.facebook.com/westsnewcastle', '', '', '', '', '', 'https://plus.google.com/106534605903963699434/about'),
  (91615, 'wests-illawarra-91615', 'Wests Illawarra', '', 'Wests Illawarra features members and guests modern facilities like Bar, Gaming, Leagues Club, Community Club, Events, Functions, Catering, Buffet, Brasserie.', 200964, '2015-11-05 07:51:29', '2016-05-02 03:18:11', '', 191, 1825, 'leagues club', 200964, 0, '', 'wslc@wslc.com.au', '0242711155', '', '', '', 'http://www.westsillawarra.com.au/', 'Wests Illawarra is a fantastic venue to enjoy a day or night out with friends with a variety of entertainment, great dining facilities and an amazing atmosphere! Wests Illawarra is the place to be!\n\nFOOD AND BEVERAGE – You are going to love your new dining option at Wests! A delicious contemporary menu includes starters like chilli salt squid, fresh salads, homemade schnitzel, gourmet burgers, pastas, pizzas and daily chef specials. The very popular Buffetpalace offers you a variety that is sure to please! The menu includes a selection of Australian, Asian and European cuisines. \n\nFUNCTION FACILITIES - \nLet the friendly and professional team organise your next special event allowing you to relax and celebrate in style. From birthdays and engagements to social parties and presentation nights, the facilities and experienced planning can ensure your guests are set for a fun and memorable experience', 'A', '{"1":[[0.375,0.25]],"2":[[0.375,0.25]],"3":[[0.375,0.25]],"4":[[0.375,0.25]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.25]]}', 'https://www.facebook.com/westsillawarraleaguesclub', 'https://twitter.com/westsillawarra', 'https://www.linkedin.com/company/wests-illawarra', '', '', '', 'https://plus.google.com/104748188837809902585/about'),
  (91627, 'illawarra-leagues-club-91627', 'Illawarra Leagues Club', '', 'Illawarra Leagues Club is a  great place to meet with friends and enjoy a relaxing lunch or dinner in our Bistro or Coffee Shop or just to have a few drinks while watching our weekly entertainment.', 272750, '2015-11-06 00:06:59', '2016-04-14 23:05:44', '', 191, 2094, 'leagues club', 272750, 0, '', 'enquiries@illawarraleaguesclub.com.au', '0242294611', '', '', '0242294142', 'http://www.illawarraleaguesclub.com.au/', 'Illawarra Leagues is the second oldest leagues club in the world, a fact that all those associated with the club are especially proud of. Visitors are welcome to use its cafe, bistro and bar.\n\nFOOD AND BEVERAGE - The Cafe is open daily for lunch and dinner, serving roast dinners, pies, pastries and daily specials. The Bistro serves more substantial cuisine, with affordable meals featuring seafood, meats and salads.\n\nFUNCTION FACILITIES - The Orchid Room is perfect for weddings, conferences and parties, seating 250 guests. It features its own dance floor, full bar service and a selection of food and beverage packages.', 'A', '{"1":[[0.3958333333,0.9166666667]],"2":[[0.3958333333,0.9583333333]],"3":[[0.3958333333,1]],"4":[[0.3958333333,1]],"5":[[0.3958333333,1]],"6":[[0.3958333333,1]],"0":[[0.3958333333,0.9166666667]]}', 'https://www.facebook.com/Illawarraleaguesclub/timeline', '', '', '', '', '', 'https://plus.google.com/109631886324195305965/about'),
  (91632, 'kiama-leagues-club-91632', 'Kiama Leagues Club', '', 'Kiama Leagues Club located in Kiama is a family and friendly club with a comfortable sports bar and all the facilities for the punter. ', 272760, '2015-11-06 00:39:33', '2016-04-14 23:14:42', '', 191, 2092, 'leagues club', 272760, 0, '', 'admin@kiamaleagues.com.au', '0242321777', '', '', '', 'http://www.kiamaleagues.com.au/', 'Kiama Leagues Club is in the pretty seaside town of Kiama on the NSW South Coast. Kiama is around 2 hours drive from Sydney. It is a short drive from Wollongong, and can also can be reached by a scenic coastal rail trip from Sydney.\n\nDESCRIPTION - Located right in the centre of this picturesque village, is the Kiama Leagues Club. Visitors are welcome, especially those on holiday, with their families. \n\nFOOD AND BEVERAGE - Sails Family Bistro is open daily for lunch and dinner, serving the favourites plus a good selection of children''s meals. The Sportmans Bar also provides light meals during bar hours.\n\nFUNCTION FACILITIES - The largest function room will hold up to 200 guests and has its own bathrooms, kitchen and bar. The smaller two will hold up to 40 for a smaller function and 12 for a boardroom. All catering is provided by the club at reasonable prices.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.0625]],"6":[[0.4166666667,0.0625]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/Kiama-Leagues-Club-108164989251580/', '', '', '', '', '', 'https://plus.google.com/113230152045138066696/about'),
  (91635, 'western-suburbs-league-club-91635', 'Western Suburbs League Club', '', 'Western Suburbs League Club Campbelltown is a family friendly club that offers a range of live entertainment, promotions, competitions, dining options and events.', 276284, '2015-11-06 00:54:02', '2016-04-27 01:14:32', '', 191, 552, 'leagues club', 276284, 0, '', 'info@westslc.com.au', '0246284188', '', '', '0246286401', 'http://www.westslc.com.au/', 'Western Suburbs League Club Campbelltown''s beginning in 1970, has evolved into a leading venue in the Greater South West of Sydney, providing members and visitors with gold class facilities. The Club boasts three restaurants, several bars, five outdoor terraces, coffee shops, and even an ice cream and lolly shop to keep the kids (and big kids) happy. Bambu Lounge and Dining (authentic Thai Cuisine) offers live entertainment on Fridays and Saturdays whilst the Bambu Sports Lounge provides the best in sport viewing, ideal for catching up on your favourite sports and having a flutter. Wests frequently provides great live shows upstairs in the auditorium. \n\nThere is a range of function rooms that can cater for all types of gatherings and functions.\n\nFancy a game of tennis? Wests Tennis Club, located next to Wests, has courts for hire, coaching, and plenty of competitions to suit all levels. Western Suburbs League Club also proudly offers the nearby Camden Lakeside Country Club and Camden Valley Country Club, as part of our expanding group and services to guests.\n\nFOOD AND BEVERAGE\nChilli Chill Bambu Restaurant - Serving some of the best Thai cuisine in the region with a la carte as well as banquet menus, and the popular Sunday Yum Cha. \n\nThe Bistro - Enjoy Stonegrill* (method of cooking food on hot volcanic stones) steaks, seafood, roasts, wok meals, salads and mouth watering desserts, every day for lunch and dinner. \n\nChinese @ the Tennis Club - Pop into the Tennis Club for your favourite Chinese dish - at ridiculously low prices. There are also two great coffee shops in Wests located at the Bistro and Bambu Lounge and Dining. Here you will find excellent coffee, hot mouth-watering food and tasty treats.\n\nBambu Lounge and Cockatil Bar is the premier place to meet friends before or after dinner, watch sport, dance and enjoy live entertainment. Aside from the lavish Bambu cocktail bar, Wests has a range of other bars to service patrons throughout the Club. \n\nCheck ''Club specials and events'' below for upcoming and exciting events and specials at Wests Campbelltown.\n\nFUNCTION FACILITIES\nWests can cater for all types of functions, including weddings, school formals and corporate events. A range of rooms mean that Wests can cater for intimate gatherings through to large events for up to 750 people.', 'A', '{"1":[[0.3958333333,0.1666666667]],"2":[[0.3958333333,0.1666666667]],"3":[[0.3958333333,0.1666666667]],"4":[[0.3958333333,0.1666666667]],"5":[[0.3958333333,0.1666666667]],"6":[[0.375,0.25]],"0":[[0.375,0.25]]}', 'https://www.facebook.com/WestsLeagues', 'https://twitter.com/WestsClub', '', '', '', 'https://www.pinterest.com/westsleagues/', 'https://plus.google.com/103394557477376065903/about'),
  (91638, 'queanbeyan-leagues-club-91638', 'Queanbeyan Leagues Club', '', 'Queanbeyan Leagues Club is part of the Canberra Raiders Group. Our club features cafe, bars and facilities and also we''re home of the Canberra Raiders.', 201362, '2015-11-06 01:16:07', '2016-04-15 02:05:26', '', 191, 1954, 'leagues club', 201362, 0, '', 'paul@qlc.com.au', '0262972511', '', '', '0262971527', 'http://www.qlc.com.au/', 'The Queanbeyan Leagues Club was founded in 1963. At the time gaming machines were not legal in the ACT so the QLC became the venue in the region.\n\nIn December 1972 the Queanbeyan Leagues Club was burnt to the ground and was rebuilt a year later. As a part of the redevelopment, the famous "Blue Room" was built. The Blue Room became the place to go in the region with its silver service dining and musical entertainment.\n\nAlso rebuilt was the QLC''s auditorium, which brought headline acts to Queanbeyan including the Delltones and Johnny O''Keefe.\n\nQueanbeyan Leagues Club is part of the Canberra Raiders group. It has recently been renovated and expanded, having taken over the next door premises.\n\nFOOD AND BEVERAGE – The Blue q Café is open daily for lunch and dinner with a varied and affordable menu and the only river view in town, framed by its two storey windows. The Blue q Bar offers fine sports entertainment from its two big screens, and a dance floor for the evenings, whilst the funky and quieter Lounge Bar is perfect for a ‘catch up’ with friends. The club offers 2 heated outdoor terraces.\n\nFUNCTION FACILITIES - The new Entertainment Lounge can host small functions for up to 100 cocktail or 50 sit down.', 'A', '{"1":[[0.375,0.25]],"2":[[0.375,0.25]],"3":[[0.375,0.25]],"4":[[0.375,0.25]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.1666666667]]}', '', '', '', '', '', '', 'https://plus.google.com/100118300674749464294/about'),
  (91642, 'penrith-panthers-91642', 'Penrith Panthers', '', 'Penrith Panthers world of Entertainment is one of the largest and most exciting clubs in Australia. Offering a superb choice of restaurants, leisure activities, world-class entertainment and bars.', 201412, '2015-11-06 01:33:03', '2016-05-02 05:13:15', '', 191, 1990, 'leagues club', 201412, 0, '', 'information@panthers.com.au', '0247205555', '', '', '', 'http://www.panthers.com.au/', 'The Panthers Group is one of the largest group of clubs in NSW, comprising of 7 licensed venues and the Penrith Panthers NRL team.\n\nThe Panthers Group is creating “your world of entertainment” through multiple leisure, lifestyle and hospitality experiences for not only greater western Sydney but regional NSW.\n\nWith a combined membership of more than 170,000, each club provides a wide range of activities for members, their families and guests.\n\nPenrith Panthers is currently undergoing a major redevelopment, and similar projects are envisaged for the other precincts that host Panthers venues.\n\nThe Group currently employs almost 1000 staff.\n\nThe Panthers Group takes pride in our position as a community owned organisation. The contribution that a registered club plays in its community varies, but we’re proud that the profits of the Panthers Group provide improved facilities or benefits for our members and our communities including our ‘Panthers on the Prowl’ Community Development Foundation.', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/penrithpanthers/timeline', 'https://twitter.com/PenrithPanthers', 'https://www.linkedin.com/company/penrith-panthers', '', '', '', 'https://plus.google.com/117580942873778071750/about'),
  (91644, 'panthers-north-richmond-91644', 'Panthers North Richmond', '', 'Panthers North Richmond is located at North Richmond and provide functions to formal dinners, seminars and barbeques, weddings and special birthday celebrations.', 276148, '2015-11-06 01:46:01', '2016-04-26 07:30:09', '', 191, 652, 'leagues club', 276148, 0, '', 'information.northrichmond@panthers.com.au', '0245605000', '', '', '', 'http://northrichmond.panthers.com.au/', 'Located in the heart of the Hawkesbury Valley, Panthers North Richmond features a small Club atmosphere with big Club facilities.\n\nCatch up with family and friends, enjoy a bite to eat at Flavours Café, take some time on your own to relax with a drink, enjoy our Free Wifi or join us for bingo, trivia or raffles – you’ll find everything you’re looking for with a beautiful Blue Mountains backdrop, including:\n\nFlavours Bistro – Open from 11:30am all day for lunch & dinner until late (closing time at managements’ discretion). We can also host catered functions, special bus group menu’s & have daily blackboard specials. View our full menu here\n\nTab – Enjoy our full tab facilities right next to the main bar,  Sky 1 & 2 channels, Eureka & EBT terminals to place your bets & 8 tv’s displaying races, results & market movers.\n\nEntertainment – Free live music every Friday & Saturday night – Check out the Entertainment Tab for more upcoming acts.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0625]],"6":[[0.4166666667,0.0625]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/northrichmondpanthers/timeline', '', '', '', '', '', 'https://plus.google.com/110803234118565080355/about'),
  (91648, 'broncos-leagues-club-91648', 'Broncos Leagues Club', '', 'Broncos Leagues Club located in Red Hill is the home of 40,000 members,  and six time premiers the Brisbane Broncos. Enjoy our meals, entertainment, gaming, functions and many more.', 201486, '2015-11-06 02:08:15', '2016-04-13 05:16:32', '', 191, 2439, 'leagues club', 201486, 0, '', 'info@broncosleagues.com.au', '0738589000', '', '', '', 'http://broncosleagues.com.au/', 'Broncos Leagues Club offers an exciting atmosphere, with pokies, football games, bars, dining and TAB all on offer under the one roof. And, who knows, you might even meet a Broncos team member on your next visit. \n\nFOOD AND BEVERAGE - Steak night on Monday is popular with the locals – especially those who love a pint and a punt. Throughout the rest of the week affordable buffets prevail and the Saturday and Sunday champagne breakfasts are a popular mainstay. The restaurant offers seafood, steak and chicken dishes, as well as entrees such as Oysters Kilpatrick from the Players Bar and Grill menu. This is good value, classic club grub at its best. Broncos Leagues Club is famous for its buffets available 7 days for lunch & dinner, especially their seafood buffet. Players Buffet & Grill also boasts a great a la carte menu.\n\nFUNCTION FACILITIES – Brisbane League Club is a multipurpose venue which offers the best in entertainment, dining, and gaming under one roof. With a reputation for excellence it makes the ideal venue to hold your next cocktail party or conference. Broncos Leagues Club offers many top class facilities, expert event solutions, experienced staff who will assist with organising your awards ceremony, boardroom meeting, celebratory event, expo or wedding. With a convenient location and ample parking it is an ideal function centre.', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/BroncosLeaguesClub/timeline', 'https://twitter.com/BroncosLeagues', '', '', '', 'https://www.pinterest.com/broncosleagues/', 'https://plus.google.com/115792822982527460737/about'),
  (91650, 'easts-leagues-club-91650', 'Easts Leagues Club', '', 'Easts Leagues Club located in Coorparoo provides unbeatable service to patrons throughout all aspects of the Club. We cater all your celebrations with our award winning function room the Diamond Room.', 201516, '2015-11-06 02:16:38', '2016-04-14 05:56:06', '', 191, 2227, 'leagues club', 201516, 0, '', 'reception@eastsleagues.com.au', '0733978885', '', '', '0738472158', 'http://eastsleagues.com.au/', 'Easts Leagues Club was incorporated in 1974 with an objective to foster rugby league as well as provide a sporting club for its members. Over the past 30 years the club has undergone many changes and experienced enormous growth. Now with over 25,000 members, Easts Leagues Club boasts a place in the Clubs Queensland Hall of Fame for winning the Best Gaming Venue award three years running.\n\nFOOD AND BEVERAGE - Open for lunch and dinner 7 days, Drysdales offers diners a new alfresco dining option, with a covered outdoor area boasting modern styling and decor which has increased Drysdales Brasserie’s seat numbers. Drysdales offers daily meal deals and dessert specials. Delicious senior’s lunches are on offer for as little as $6.90 and range from crunchy crumbed fish to roast of the day. On Friday and Saturday nights a $20.90 reef and beef option is available, with a choice of succulent rump steak or mouth-watering eye fillet, accompanied by crumbed calamari or prawn skewers. On the a la carte menu choices range from pastas, salads and steak sandwiches to chicken and beef options, with a full children’s menu as well. Easts Leagues Club is a great choice for the whole family and is well-equipped for functions, too. \n\nFUNCTION FACILITIES - Easts Leagues Club caters for all types of functions from weddings to product launches, birthdays to seminars, engagement parties to training sessions.', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/EastsLeaguesClub/timeline', 'https://twitter.com/EastsLeagues', '', '', '', '', 'https://plus.google.com/105165035677579886904/about'),
  (91654, 'wynnum-manly-leagues-club-91654', 'Wynnum Manly Leagues Club', '', 'Wynnum Manly Leagues Club Brisbane is not-for-profit and we offer our local community an extensive range of benefits. Live Shows and Entertainment, Live Football Games, Restaurant, Bar & Gaming Room.', 201564, '2015-11-06 02:33:26', '2016-04-15 01:38:08', '', 191, 1974, 'leagues club', 201564, 0, '', 'enquiries@wmlc.com.au', '0739067800', '', '', '', 'http://www.wynnummanlyleagues.com.au/', 'Wynnum Manly Leagues Club has been serving the community since 1972. Just a short drive away from the bustle of the city you’ll enjoy the relaxed environment of the Bayside area and friendliness of Wynnum Manly Leagues Club. It offers exceptional entertainment and dining in addition to premier function facilities, gaming and keno.\n\nFOOD AND BEVERAGE – The Club is well known throughout Brisbane for the high quality of its food at affordable prices. The family will never tire of the clubs constantly changing menus. There is a coffee shop, Bistro, bottle shop with extensive range of wines and beers, and the popular Friday night buffet where you can enjoy an extensive range of mouth watering hot and cold dishes, including fresh prawns.\n\nFUNCTION FACILITIES - Catering for small and large groups, fully air conditioned and bar facilities available, the Wynnum Manly Leagues Club creates a fantastic location for corporate functions in Brisbane.', 'A', '{"1":[[0.3958333333,1]],"2":[[0.3958333333,1]],"3":[[0.3958333333,1]],"4":[[0.3958333333,1]],"5":[[0.3958333333,1]],"6":[[0.3958333333,1]],"0":[[0.3958333333,1]]}', 'https://www.facebook.com/LeaguesClub/timeline', 'https://twitter.com/WynManlyLeagues', 'https://www.linkedin.com/company/wynnum-manly-leagues-club-ltd', '', '', 'https://www.pinterest.com/wynnummanlylc/', 'https://plus.google.com/104845616017802788929/about'),
  (91660, 'cowboys-leagues-club-91660', 'Cowboys Leagues Club', '', 'Cowboys Leagues Club is the home of the North Queensland Cowboys and also to Match Restaurant & Grill, Pizazz Cafe, Next Lounge Bar, Sidelines Sports Bar and the Utopia Gaming Lounge and more.', 201650, '2015-11-06 03:05:23', '2016-04-14 01:09:23', '', 191, 2308, 'leagues club\nsocial club', 201650, 0, '', 'info@cowboysleagues.com.au', '0747248000', '', '', '0747243144', 'http://www.cowboysleagues.com.au/', 'Cowboys Leagues Club is located in the heart of the Townsville CBD. The club is situated in close proximity to several hotel and apartment complexes.\n\nDESCRIPTION - Cowboys League Club offers the best value and services in a first class, well presented and maintained facility. Members can enjoy weekly entertainment every Friday and Saturday night. There is also a wide range of live music - from easy listening to celebrating with popular DJs after every Cowboys home game.\n\nFOOD AND BEVERAGE - The club caters for everyone with facilities including a coffee shop, lounge bar, gaming lounge and Club Bistro. Enjoy anything from quick bite to eat from the all day snack menu to a sumptuous dinner at the Club Bistro.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.375,0.0833333333]],"3":[[0.4166666667,0.0833333333]],"4":[[0.375,0.0833333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.375,1]]}', 'https://www.facebook.com/Cowboys-Leagues-Club-121054157907699/', 'https://twitter.com/cowboysleagues', 'https://www.linkedin.com/company/cowboys-leagues-club', '', '', '', 'https://plus.google.com/105217372185215964759/about'),
  (92038, 'ashfield-rsl-club-92038', 'Ashfield RSL Club', '', 'Ashfield RSL Club is the place to be when grabbing a quick cold beer at the Casino Bar, or a dinner in Lucky Buffet Restaurant or experience the great catering services in one of our Function Rooms.', 201852, '2015-11-06 05:30:05', '2016-04-26 01:27:21', '', 191, 816, 'rsl club', 201852, 0, '', 'office@ashfieldrsl.com.au', '0297979036', '', '', '0297979036', 'http://www.ashfieldrsl.com.au', 'In 1918 some of the local men returning from World War I banded together and began holding meetings in a building situated on the open air skating rink in Liverpool Road, Ashfield, where the Ashfield public school now stands.\n\nAs the members attending these meetings grew, it was necessary to find larger accommodation.\n\nThe members of the School of Arts offered a room above the Library and the meetings were held there until 1945.\n\nAs men returned from World War II, the membership increased further and the School of Arts room became too small for further meetings.\n\nOver the years, funds had been raised and the purchase of a building of their own was possible with some help from the bank. Therefore the first stage of our present building was completed in 1955.\n\nOn the 12th march 1955, an official opening ceremony was held and the new building began occupancy.\n\nLater in 1955, the Ashfield Sub-Branch Club was officially formed and an application for a Club license was made and later granted by the Licensing Court. The first licensee was George Constable.\n\nBy 1958 it became apparent that the current premises were too small once again, so plans were drawn up and with the aid of a bank loan and a loan of $40,000 from Sub-Branch savings, extensions were completed and officially opened on 3rd February, 1962.\n\nOn 14th November, 1972, the Club was incorporated as a Company Limited by Guarantee.\n\nIn 1981 major extensions were completed and the addition of a Bistro, Dinning Room and new Foyer, again improved trading.\n\nFurther renovations were completed in 1990,  in 1992 and again  in 2011, when extensions were made to the rear or southern side of the premises, and the addition of a new alfresco gaming and smoking area, thus resulting in today’s modern and attractive club.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,0.0416666667]],"4":[[0.375,0.0416666667]],"5":[[0.375,0.1666666667]],"6":[[0.375,0.1666666667]],"0":[[0.375,1]]}', 'https://www.facebook.com/AshfieldRSL/', 'https://twitter.com/ashrsl', 'https://www.linkedin.com/company/ashfield-rsl', '', '', '', ''),
  (92233, 'cabra-vale-diggers-club-92233', 'Cabra - Vale Diggers Club', '', 'Cabra-Vale Diggers Club is the ideal venue for your next business event, for meetings, conferences, seminars, product launches and exhibitions with a variety of meeting & conference rooms to choose.', 202008, '2015-11-06 06:33:30', '2016-04-13 05:43:17', '', 191, 2418, 'rsl club', 202008, 0, '', 'mail@cabravale.com', '0297273600', '', '', '0297277864', 'http://www.cabravale.com', 'Cabra - Vale Diggers Club has been the friendly venue for people of all ages across Sydney''s vibrant South West to meet, relax and enjoy life.\n\nFOOD – Tantalising culinary creations are available every day of the week for breakfast, lunch, dinner and in-between at The Bartley Grill | Noodle Bar | Pizza Bar and The Parkview coffee lounge. Drop in for a quick snack or stay for a sumptuous meal.\n\nFUN – Catch up with family, friends and work mates any day of the week at one of our 8 bars or in the private lounge or outdoor courtyard. Fun Member promotions, TAB, snooker, table tennis. So many choices. Whatever the reason we are the friendliest place to meet.\n\nENTERTAINMENT – Free live entertainment, popular shows celebrating music through the ages, karaoke, talent quest and more.\n\nCelebrate weddings, receptions, birthdays, anniversaries, reunions, school graduations or club presentations at our spacious full-service function rooms.\n\nCabra-Vale Diggers Club has a rich history and a culturally diverse membership which contributes to our dynamic Club experience. There’s something for everyone. And, our friendly staff are committed to ensuring that every visit is a memorable experience.\n\nOur modern and spacious facility is located at Canley Vale, adjacent to major transport links, and close to Cabramatta and Liverpool. It features plenty of secure off-street parking and is served by a free courtesy bus which operates 7 days a week.\n\nWe have a special affection for our local community which is why we support 81 not for profit organisations from sporting clubs to aged care.', 'A', '{"1":[[0.3958333333,0.125]],"2":[[0.3958333333,0.125]],"3":[[0.3958333333,0.125]],"4":[[0.3958333333,0.125]],"5":[[0.375,0.2083333333]],"6":[[0.3958333333,0.2083333333]],"0":[[0.3958333333,0.125]]}', 'https://www.facebook.com/cabravalediggers', 'https://twitter.com/CVDiggers', 'https://www.linkedin.com/company/cabra-vale-diggers', '', '', '', 'https://plus.google.com/116447179383975300277/about'),
  (92235, 'ran-sailing-association-ransa-92235', 'RAN Sailing Association (RANSA)', '', 'RAN Sailing Association is located  at Darling Point. Members may use the premises, on arrangement, for private functions, including the Rushcutters Room which seats sixty and the new undercover area.', 274054, '2015-11-06 06:35:30', '2016-04-18 05:38:54', '', 191, 1626, 'sailing club', 274054, 0, '', 'ransa@bigpond.com', '293639939', '', '', '0293630352', 'http://www.ransa.com.au', 'Background\n\nThe Royal Australian Naval Sailing Association exists to encourage sailing within the Navy. We were originally established as the Australia Station of the Royal Naval Sailing Association in 1947, but in 1966, with the blessing RNSA, were launched in our own right as RANSA. RANSA has had a continuing history of involvement in the local Sydney sailing scene ever since. \n\nRANSA has a busy racing schedule throughout the year, including a Winter Point Score Series on Saturdays, a Midweek Series on Wednesday afternoons, and a Friday Twilight Series during the summer months. Additionally RANSA is a keen supporter of Navy sailing activities. Social events are also regular items on our calendar. Monthly "theme" dinner nights and after race barbeques are very popular, as are weekend cruises and annual "Pirate''s Day".\n\nMembership\nMembership is open to all serving and retired Naval personnel, and Service membership is open to serving and retired Army and Air Force personnel. A category of membership for non-service personnel is also available.\n\nFacilities\nMembers may use the premises, on arrangement, for private functions, including the Rushcutters Room which seats sixty and the new undercover area. A slipway is available to members, rated to 4 tonnes, at a nominal fee. Moorings are available at very competitive rates. Their numbers are limited however and, dependant on availability, preference is given to current serving members in the RAN. \n\nThose who do not own their own boat and wish to sail are encouraged to come down the club on race days and usually there will be a place on a members boat. RANSA runs primarily on a volunteer basis. Members are asked to do occasional bar duties and provide assistance where possible. This proves to be a great way to get to know members!\n\nFuture\nRANSA will continue its commitment to encourage sailing throughout the Navy and its involvement in the Sydney Racing Calendar.', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"4":[[0.375,0.6666666667]]}', '', '', '', '', '', '', 'https://plus.google.com/105815048798206959774/about'),
  (92334, 'campbelltown-rsl-club-92334', 'Campbelltown RSL Club ', '', 'Campbelltown RSL Club features facilities such as a modern and contemporary atmosphere and design, as well as sizzling new bars and and restaurants. You''ll feel right at home with us!', 202036, '2015-11-06 06:46:23', '2016-04-26 03:35:30', '', 191, 716, 'rsl club', 202036, 0, '', 'information@campbelltownrsl.com.au', '0246251408', '', '', '', 'http://www.campbelltownrsl.com.au', 'SINCE 1957 CAMPBELLTOWN RSL CLUB HAS BEEN THE FRIENDLY VENUE FOR PEOPLE OF ALL AGES ACROSS SYDNEY’S VIBRANT MACARTHUR REGION TO MEET, RELAX AND ENJOY LIFE.\n\nFOOD - Tantalising culinary creations are available every day of the week for breakfast, lunch, dinner and in-between to suit everyone’s tastes. Drop in to the modern Oxley Grill, Star Buffet and Arie Bar & Cafe for a quick snack or stay for a sumptuous meal.\n\nFUN - Catch up with family, friends and work mates any day of the week at one of our 5 bars or the outdoor alfresco courtyard. Fun Member promotions, TAB, Keno, snooker. So many choices. Whatever the reason we are the friendliest place to meet right in the heart of Campbelltown.\n\nENTERTAINMENT - Free live entertainment, popular shows celebrating music through the ages, karaoke, talent quest and more.\n\nCelebrate weddings, receptions, birthdays, anniversaries, reunions, school graduations or club presentations at our spacious full-service function rooms.\n\nCampbelltown RSL Club has a rich history and a diversity of members of all ages which contributes to our dynamic Club experience. There’s something for everyone. And, our friendly staff are committed to ensuring that every visit is a memorable experience.\n\nWe are very easy to find. Our modern, comfortable and spacious facility (come and experience our spectacular ‘make over’!) is located in the heart of Campbelltown adjacent to major transport links. It features plenty of secure off-street parking and is served by a free courtesy bus which operates 7 days a week.\n\nWe have a special affection for our local community which is why we support many not for profit organisations.', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.125]]}', 'https://www.facebook.com/campbelltownrsl', 'https://twitter.com/CampbelltownRSL', '', '', '', '', 'https://plus.google.com/111096258223075196460/about'),
  (92339, 'castle-hill-rsl-club-92339', 'Castle Hill RSL Club', '', 'Castle Hill RSL Club is located at Castle Hill and provide good facilities like dining & bars, cafe, rib factory and more.', 276162, '2015-11-06 07:11:51', '2016-04-26 08:04:50', '', 191, 621, 'rsl club', 276162, 0, '', 'info@castlehillrsl.com.au', '0288584800', '', '', '0288584811', 'http://www.castlehillrsl.com.au', 'Castle Hill RSL is committed to the highest level in sustainability practices and ongoing management with sustainable practices underpinning our ongoing strategic development and operation.\n\nOur commitment to sport is well known in the Hills with our sponsorship support for Soccer, Athletics, Junior League, Rugby Union and Netball.\n\nThe club also have a large number of members representing the club by weekly participation in sports which include soccer, cricket, badminton, swimming and tae kwon do. These activities are an important part of our activities and we enjoy incredible success with many zone, state and national representative. The amazing activity has to be gymnastics with over 1,100 registered participants ranging from Kindy Gym and our Recreational programs through to our elite program with National representatives.', 'A', '{"1":[[0.4166666667,0.0833333333]],"2":[[0.4166666667,0.0833333333]],"3":[[0.4166666667,0.0833333333]],"4":[[0.4166666667,0.1041666667]],"5":[[0.4166666667,0.1458333333]],"6":[[0.4166666667,0.1458333333]],"0":[[0.4166666667,0.0833333333]]}', 'https://www.facebook.com/castlehillrsl/timeline', 'https://twitter.com/castlehillrsl', '', '', '', '', 'https://plus.google.com/117427613204071142614/about'),
  (92343, 'fairfield-rsl-club-92343', 'Fairfield RSL Club', '', 'Fairfield RSL has invested large amounts of time and energy into developing one of Sydney’s best conference and events facilities. We also cater for large corporate events or host high profile artist.', 202166, '2015-11-06 07:37:18', '2016-04-26 06:22:09', '', 191, 672, 'rsl club\nsocial club', 202166, 0, '', 'info@fairfieldrsl.com.au', '0297275000', '', '', '0297279718', 'http://www.fairfieldrsl.com.au', 'Fairfield RSL could be best described as an urban resort located in the south west of Sydney just 45 minutes from Sydney CBD. The property has a boutique five star fit out with award winning designer furniture and fittings. Our venue’s colour pallette is one of warm, earthy overtones with contemporary art fittings, water features and the natural touch of fresh, floral designs at every turn. \n\nFairfield RSL has invested large amounts of time and energy into developing one of Sydney’s best conference and events facilities. Our large ballroom can also cater for large corporate events or host high profile recording artists. All in all our aim was to make our property a destination point by creating an atmosphere of elegance and luxury.\n\nFairfield RSL provides a number of different travel options to members and their guests. The most popular option is our free courtesy bus that travels along a number of specified routes on selected days during the week. We also operate ''The Flying Dragon Shuttle Service'' which is an express shuttle from Cabramatta. If you would prefer something more sophisticated Fairfield RSL also provides a limousine service on Saturday evenings from 6:00pm\n\n', 'A', '{"1":[[0.375,0.1666666667]],"2":[[0.375,0.1666666667]],"3":[[0.375,0.1666666667]],"4":[[0.375,0.1666666667]],"5":[[0.375,0.1666666667]],"6":[[0.375,0.1666666667]],"0":[[0.375,0.1666666667]]}', '', '', '', '', '', '', 'https://plus.google.com/112480060627207293024/about');
INSERT INTO `tbl_entity_organization` (`id`, `friendly_url`, `name`, `alternate_name`, `description`, `image_id`, `enter_time`, `update_time`, `abn`, `account_id`, `place_id`, `keywords`, `logo_id`, `banner_id`, `address_additional_info`, `email`, `telephone`, `alternate_telephone`, `mobile`, `fax_number`, `website_url`, `content`, `status`, `hours_work`, `facebook_link`, `twitter_link`, `linkedin_link`, `youtube_link`, `blog_link`, `pinterest_link`, `googleplus_link`) VALUES
  (92365, 'club-willoughby-92365', 'Club Willoughby', '', 'Club Willoughby is located in the heart of Sydney''s North Shore. Boasting an intimate Club Lounge with TAB, Keno, 3 Snooker Tables. Club Willoughby has something for everyone.', 202507, '2015-11-09 02:50:53', '2016-04-26 00:55:30', '', 191, 836, 'rsl club', 202507, 0, '', 'general@clubwilloughby.com.au', '0294115333', '', '', '', 'http://www.clubwilloughby.com.au', 'Club Willoughby is a Community and Ex-Service Club located in the heart of Sydney''s lower North Shore. There is parking for well over 180 vehicles. Boasting an intimate Club Lounge a modern restaurant with alfresco facilities, Our four function rooms contain the latest in equipment and we are very competitive in our pricing.\n\nClub Willoughby has something for everyone, including Friday entertainment every week commencing Friday 14th August 2015\nClub Willoughby is very mindful of its roots and tradition as and Ex-Service Club and is looking forward continuing that tradition in April of each year. \n\nWe have a number of large Screen TV’s and projectors for our members and their guests to catch all their favourite sporting events. Thursday and Friday night raffles, really see the place jumping.\n\nTrivia night every Tuesday has a very strong following, while Poker on Thursday and Sunday continues to attract large groups.\n\nWhatever you fancy, Club Willoughby situated on the corner of Crabbes Avenue and Penshurst St North Willoughby is very accessible by motor vehicle and public transport. ', 'A', '{"1":[[0.4375,0.9375]],"2":[[0.4375,0.9375]],"3":[[0.4375,0.9375]],"4":[[0.4375,1]],"5":[[0.4375,1]],"6":[[0.4166666667,0.4791666667]],"0":[[0.5,0.8541666667]]}', 'https://www.facebook.com/ClubWilloughby/timeline', '', '', '', '', '', ''),
  (92387, 'hornsby-rsl-club-92387', 'Hornsby RSL Club', '', 'Hornsby RSL Club features level one with a large open floor alfresco dining area, the Courtyard which provides quintessential modern Australian favourites and Sports Bar that offers a range of games.', 202915, '2015-11-09 06:24:40', '2016-04-28 02:00:53', '', 191, 212, 'rsl club\nsocial club', 202915, 0, '', 'info@hornsbyrsl.com.au', '0294777777', '', '', '', 'http://www.hornsbyrsl.com.au', 'Hornsby RSL is taking you to a whole new level of entertainment. Our goal of consistently offering fresh facilities has created a sought after location.\n\nDining\nLevel One offers a large open floor alfresco dining area.  The menu is widely popular offering a selection of tapas to share or mains and desserts. Enjoy these delicious treats in this urban escape. \n\nLevel One also showcases an international wine list, ciders and an array of boutique and craft beers on tap. For the more exotic tastes, a large selection of cocktails are available.\n\nSPORTS BAR\nA traditional Sports Bar that offers a range of games such as Pool, Snooker, Table Tennis, Darts and a fully equipped TAB.\n\nRelax in front of one of the many big screen and cheer on your team. If your into sports, take a look at our Sports Bar Located on the lower Ground Floor.\n\nSHOWROOM BAR\nThe Showroom Bar is open for all major Events and Shows, such as world class comedian Jimeoin and Aussie rockers Grinspoon.\n\nTickets are available at the Club. We also hold a range of special annual events such as Melbourne Cup Day Luncheon, Christmas Day Lunch and of course Anzac Day. with a wide range of Shows & Events you are guaranteed a great night of entertainment.', 'A', '{"1":[[0.3958333333,0.0416666667]],"2":[[0.3958333333,0.0416666667]],"3":[[0.3958333333,0.0833333333]],"4":[[0.3958333333,0.0833333333]],"5":[[0.3958333333,0.1666666667]],"6":[[0.3958333333,0.1458333333]],"0":[[0.3958333333,0.0416666667]]}', 'https://www.facebook.com/HornsbyRSLClub/', 'https://twitter.com/HornsbyRSL', '', '', '', '', 'https://plus.google.com/106188488360566064585/about'),
  (92392, 'kingsgrove-rsl-club-ltd-92392', 'Kingsgrove RSL Club Ltd', '', 'Kingsgrove RSL can accommodate any type of events like Birthdays, Corporate meetings and weddings. We have everything you need from audio visual equipment to overhead projector. Our menu is superb.', 203013, '2015-11-09 07:07:53', '2016-04-14 23:22:49', '', 191, 2087, 'rsl club\nsocial club', 203013, 0, '', 'marketing@katoombarsl.com.au', '0293361500', '', '', '', 'http://www.kingsgroversl.com.au', 'Kingsgrove RSL Club supports a wide range of community groups, charities, schools and sporting organisations through the Clubs NSW Community Grants.\n\nThe Community Grants scheme is designed for registered clubs in NSW to contribute to the provision of services for the local communities.\n\nKingsgrove RSL Club’s contribution for category 1 and categorty 2 Grants totalled over $130,000. This is great proof of the valuable contributions Clubs provide to our local community along with the great work that all the various organisations do.\n\nKingsgrove RSL Club is also very proud of our association with the Kingsgrove Community Aid Centre.\n\nBirthdays\nTake the hassle out of parties.\nHere at the Kingsgrove RSL we can accommodate for any type of birthday large or small, with a variety of function rooms available holding up to 300 people.\n\nWe can tailor make your special day perfectly to your requirements, whether it’s a full Al La Carte menu for that special occasion, a buffet or even casual finger food for that friendly get together.\n\nWe can help decorate your room to a theme or colour, offer audio visual equipment for photos and slide shows and assist with your entertainment needs for a DJ or a band.\n\nCorporate Meetings\nTo better suit your seminar or training function, why not get out of the office.\nOur extensive trading hours enable us to suit any busy schedule. Being centrally located to public transport and ample parking facilities, we can accommodate all your needs including audio visual equipment, laptop computer, lectern and stationary for 10 – 300 people.\n\nOur menus offers your choice of light refreshments, morning tea, lunch or dinner and are adaptable to suit any budget, with full bar facilities available.\n\nWeddings\nHere at Kingsgrove RSL Club we understand the enormous task that lays ahead in planning a wedding or engagement.\n\nWhy not allow us to help with the arrangements. We can offer seating for up to 300 guest, table setting, chair covers, candelabras, flowers, red carpet, photographers and an array of entertainment including live bands, D.J’s and MC’s.\n\nOur menu planning is second to none to accommodate all your tastes including an extensive wine selection to ensure a perfect occasion on all levels.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/KingsgroveRSL', '', 'https://www.linkedin.com/company/kingsgrove-rsl-club', '', '', '', 'https://plus.google.com/116311643632322448866/about'),
  (92394, 'kirribilli-club-92394', 'Kirribilli Club', '', 'Kirribilli Club located in the heart of Lavender Bay, offers a unique experience overlooking one of the world’s most beautiful harbours.', 203043, '2015-11-09 07:23:48', '2016-04-28 02:05:42', '', 191, 205, 'rsl club', 203043, 0, '', 'info@kirribilliclub.com.au', '0299552245', '', '', '0299553755', 'http://www.kirribilliclub.com.au', 'Kirribilli Club was founded in 1946 by the Kirribilli\nEx-Servicemen’s Sub Branch which was given it’s charter in 1943. It was founded with the purpose of being a community club serving Australian Defence Force personnel and their families local to the Kirribilli / Milsons Point area. It’s initial location was Cnr Alfred and Glen Street, Milsons Point but the venue was updated to it’s new address in Cliff Street in 1967. Recently the venue was raised and the club shut down for the three years of construction reopening in 2007 in it’s current form at 11 Harbourview Crescent, Lavender Bay.\n\nThe Kirribilli Ex-Services Club is a community focused venue with a proud history and a strong emphasis on providing quality customer service and facilities to it’s broad membership and customer base. \n\nAs The Club has recently formalised the amalgamation process with The North Sydney Anzac Club, it looks to continue the traditions on which it was formed in a modern and progressive environment.\n\nKirribilli Ex Services Club (Kirribilli Club) and Kirribilli RSL Sub branch both recognise the importance of maintaining the ANZAC tradition in the local North Sydney area. The club is an innovative leader in that it’s key strategic focus lies with its Functions and Events business. The Club recognises the diversity of markets that it services and puts resources in place to ensure successful delivery to those stakeholders. ', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/Kirribilli-Club-13268652419/?fref=ts', 'https://twitter.com/kirribilliclub', 'https://www.linkedin.com/company/kirribilli-club', '', '', '', 'https://plus.google.com/112432224568061275623/about'),
  (92395, 'merrylands-rsl-club-92395', 'Merrylands RSL Club', '', 'Merrylands RSL Club is a premier location for horse racing and sports betting, tipping, NRL, AFL, cricket, soccer, rugby betting, Online betting terminals, fixed and tote odds.', 203069, '2015-11-09 07:33:56', '2016-04-26 23:16:30', '', 191, 607, 'rsl club', 203069, 0, '', 'enquiries@mrsl.com.au', '0288687777', '', '', '', 'http://www.merrylandsrsl.com.au', 'Our Club:\nMerrylands RSL is a club which strives to serve and satisfy our Members through our commitment to customer satisfaction.\n\nOur Staff:\nMerrylands RSL regards our staff as one of its most important assets. We not only foster leadership, but also teamwork.\nOur personnel are professionals whose entrepreneurial skills not only ensure they strive for customer satisfaction but also personal integrity.\n\nOur Commitments:\n•  We will focus our efforts on satisfying our customers’ needs.\n•  We will create a friendly work environment for our people.\n•  We will always conduct our business activities in a professional responsible manner.\n\nOur Ambition:\nTo always be the first choice of the Greater Western community in Club recreation and entertainment, by being a respected member of the Holroyd community.\n \nWork Place Gender Equality Act:\nIn accordance with the requirements of the Workplace Gender Equality Act 2012 (Act), we would like to inform you that Merrylands RSL lodged its annual compliance report with the Workplace Gender Equality Agency (Agency).', 'A', '{"1":[[0.3958333333,0.1666666667]],"2":[[0.3958333333,0.1666666667]],"3":[[0.3958333333,0.1666666667]],"4":[[0.3958333333,0.1666666667]],"5":[[0.3958333333,0.75]],"6":[[0.3958333333,0.75]],"0":[[0.3958333333,0.1666666667]]}', '', 'https://twitter.com/MerrylandsRSL?ref_src=twsrc%5Etfw', '', '', '', '', 'https://plus.google.com/104695080178162005258/about'),
  (92397, 'mortdale-rsl-community-club-92397', 'Mortdale RSL Community Club', '', 'Mortdale RSL Club is in the heart of Mortdale, close to public transport. We provide Restaurant, Function Room, Bingo, TAB, KENO, Live Music and Poker & much more. Come on in and see us Its YOUR Club.', 203089, '2015-11-09 07:45:31', '2016-04-26 00:08:03', '', 191, 865, 'rsl club', 203089, 0, '', 'info@mortdalersl.com.au', '0295803649', '', '', '', 'http://www.mortdalersl.com.au', 'Welcome to the Mortdale RSL Community Club\nMortdale RSL’s aim is to be the leading Club in customer service, offering members and their guests a safe and friendly environment to relax in and that members and the community are made to feel special and want to come back to and be a part of.\n\nThe Club is located in Mortdale, New South Wales - Australia, just 30 minutes south of Sydney in Macquarie Place.\n\nMembers and their guests are most welcome in our licensed Club where you can enjoy the facilities in comfort.\n\nThe Mortdale RSL Community Club Coffee Shop is the perfect place to relax and enjoy a cup of tea or freshly ground coffee, superb light snacks, sandwiches and biscuits. Our Coffee Shop is ''children friendly'', seven days a week up to 9.00pm.\n\nDress Regulations apply on the Club premises, fashion of the day and all Club Patrons must be clean, neat and tidy. Offensive dress is not permitted.\n \nManagement reserves the right to refuse admission to anyone who, in its'' opinion, is not suitably groomed or attired.\n \nMortdale RSL Club provides complete access for members and guests with a disability, including ramps and and two internal lifts.\n \nWe also provide FREE Wi Fi access at the Club. See us at Reception for further information, next time you visit us.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/mortdalersl', '', '', '', '', '', 'https://plus.google.com/100850790119632163800/about'),
  (92399, 'mounties-group-92399', 'Mounties Group ', '', 'The Mounties Group is dedicated to making it memorable for members and guests with two health club and holiday resorts, we offer a range of entertainment, leisure and lifestyle options.', 203121, '2015-11-09 07:57:21', '2016-04-26 23:21:29', '', 191, 600, 'sports club\nsocial club', 203121, 0, '', 'info@mountiesgroup.com.au', '0298223555', '', '', '', 'http://www.mounties.com.au/', 'Mounties Group can proudly boast the 2009, 2007 & 2006 ClubsNSW Large Club of the Year. Mounties is also one of the biggest clubs in Australia, located just five minutes from Liverpool in Sydney’s south-west.\n\nWe’re all about making it memorable for you.  That’s our brand promise and that’s what you can expect when you visit.  A memorable time out.\n\nSo what else makes Mounties so good?  Aside from fabulous service, we’ve got 15 bars, four restaurants, three outdoor terraces, a world class health club – Ignite Health & Fitness, free door to door courtesy buses, live entertainment Thursday through Sunday including live shows every Saturday night, Latin and Asian bands plus the usual club offerings such as TAB, Keno, raffles and bingo.\n\nFor the kids, there is free entertainment every school holidays and a cool family entertainment arcade – Kaos and a children’s supervised play centre – Mounties Minis.\n\nOn the sporting and community front, Mounties is a huge supporter.  We have 39 sub-clubs from cricket, footy, netball through to euchre, swimming and bowls.  Over $5 million each year is donated to provide sports facilities and to sponsor sporting and community groups, including local schools, Telstra Childflight that transports critically ill children, ethnic groups and aged care.\n', 'A', '{"1":[[0.375,0.125]],"2":[[0.375,0.125]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.2083333333]],"6":[[0.375,0.2083333333]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/MountiesClub/', '', 'https://www.linkedin.com/company/mounties-group', '', '', '', 'https://plus.google.com/104776381391524515856/posts'),
  (92401, 'narrabeen-rsl-club-92401', 'Narrabeen RSL Club', '', 'Narrabeen RSL Club is offering variety range of live entertainment including raffles, live music with exciting menus on our restaurant Laguna Grill serving American, Mexica, Australian Cuisine.', 203147, '2015-11-09 08:03:15', '2016-04-28 05:59:34', '', 191, 94, 'rsl club\nbowling club', 203147, 0, '', 'info@narrabeenrsl.com.au', '0299138016', '', '', '', 'http://www.narrabeenrsl.com.au', 'The Narrabeen RSL Club, has been servicing and supporting the Northern Beaches of Sydney for over 50 years. The Narrabeen RSL Club is situated in the heart of the Northern Beaches, Sydney, approximately 15km north of Manly. Traveling north along Pittwater Road through Narrabeen and over the bridge at Narrabeen Lake will bring you to Nareen Parade, a left turn will only leave a kilometre to our front door.\n\nThe Narrabeen RSL Club specialises in barefoot bowls on the beaches! Get a group together and have fun playing Barefoot Bowls. Great for Birthdays, Corporate Events and Christmas Parties.\n\n', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/NarrabeenRSL/', '', '', '', '', '', 'https://plus.google.com/113074195118796179276/about'),
  (92410, 'penrith-rsl-club-92410', 'Penrith RSL Club', '', 'Penrith RSL Club has live FREE entertainment, Star Buffet, Maze Cafe, fantastic giveaways, Bingo, Cash Housie, Raffles, Kidz events and much much more.', 203370, '2015-11-10 01:22:59', '2016-04-27 02:23:16', '', 191, 485, 'rsl club\nsocial club', 203370, 0, '', 'info@penrithrsl.com.au', '0247285200', '', '', '', 'http://www.penrithrsl.com.au', 'Penrith RSL is located in the heart of bustling Penrith, at the foot of the beautiful Blue Mountains. As we continue to grow and expand, we are proud to be the leading leisure and entertainment venue in the Nepean area.\n\nPenrith RSL is located in the heart of Penrith, at the foot of the beautiful Blue Mountains. As we continue to grow and expand, we are proud to be the leading leisure and entertainment venue in the Nepean area. With great weekly promotions, free entertainment every weekend, fantastic bars and dining options, Penrith RSL is a venue for the whole family!', 'A', '{"1":[[0.375,0.125]],"2":[[0.375,0.125]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/penrithrsl?_rdr=p', 'https://twitter.com/penrithrsl', 'https://www.linkedin.com/company/penrith-rsl-club-ltd-', '', '', '', 'https://plus.google.com/+penrithrsl/about'),
  (92414, 'pittwater-rsl-club-92414', 'Pittwater RSL Club', '', 'Pittwater RSL Club is located at Mona Vale and cater cocktail party, special birthday, corporate function, wedding, seminar,\npresentation or even a wake.', 203440, '2015-11-10 01:44:03', '2016-04-27 02:10:59', '', 191, 504, 'rsl club', 203440, 0, '', 'info@pittwaterrsl.com.au', '0299973833', '', '', '', 'http://www.pittwaterrsl.com.au', 'Pittwater RSL Club is a Community RSL Club offering 3 different styles of dining - the Peninsula Grill, Tuscan Terrace Pizzeria & Foley''s Cafe. \n\nPittwater RSL Club have big shows in the Audi & special kid''s entertainment once a month. \n\nPittwater RSL Club can offer flexible options for functions, 3 outdoor terraces, live entertainment weekly on Fri, Sat & Sunday. Poker on 4 nights a week, a Sports Bar, big screens showing all major sporting events & lots of Sub Clubs, including Lawn Bowls, Fishing, Golf, Snooker, etc.\n\nPittwater RSL Club have parking onsite for over 400 cars.\n\nPittwater RSL Club take pride in our reputation for listening to our customers and catering for their specific needs and requirements, however unusual. Our flexibility ensures that your function will be a success for both you and your guests. You can relax, knowing we have every detail covered.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/PittwterRSLClub', 'https://twitter.com/RslPittwater', '', '', '', '', 'https://plus.google.com/106704742038267860113/about'),
  (92429, 'tradies-92429', 'Tradies', '', 'Tradies Social club located at Gymea features facilities such as a contemporary foyer, an inviting cafe with alfresco dining, a second floor extension and NSW’s largest endota day spa.', 203834, '2015-11-10 03:47:19', '2016-04-26 01:08:58', '', 191, 824, 'social club', 203834, 0, '', 'marketing@tradies.com.au', '0295249135', '', '', '', 'http://www.tradies.com.au', 'For over 50 years, Tradies has been an important pillar in our local community, not only providing monetary support for community organisations and sporting groups but also as a venue for members and guests to come together, relax and enjoy themselves.\n\nTradies is a values-based organisation that strives to achieve best practice in community service, customer service, hospitality and employment across both our venues at Gymea and Caringbah. Our management and frontline operations are guided by our seven organisational values: Human Dignity, Synergy/Teamwork, Education/Knowledge, Innovation/Adaptability, Accountability, Productivity and Sustainability.\n\nIn 2011/2012, Tradies undertook the largest renovations in the Club’s history; extending the physical premises at Gymea to include a contemporary foyer, an inviting cafe with alfresco dining, a second floor extension and NSW’s largest endota day spa.\nTradies prides itself on our extensive community engagement and commitment to continually improving our facilities and services for our members and guests.', 'A', '{"1":[[0.3333333333,0.1666666667]],"2":[[0.3333333333,0.1666666667]],"3":[[0.3333333333,0.1666666667]],"4":[[0.3333333333,0.1666666667]],"5":[[0.3333333333,0.25]],"6":[[0.25,0.25]],"0":[[0.25,0.1666666667]]}', 'https://www.facebook.com/Tradies', 'https://twitter.com/Tradiesclub', 'https://www.linkedin.com/company/tradies', '', '', '', 'https://plus.google.com/117990909622714480002/about'),
  (92430, 'windsor-rsl-club-92430', 'Windsor RSL Club', '', 'Windsor RSL offers a relaxed, friendly atmosphere and comfortable environment for all members and guests.\n', 203876, '2015-11-10 03:58:45', '2016-04-26 08:02:04', '', 191, 623, 'rsl club', 203876, 0, '', 'enquiries@windsorrsl.com.au', '0245876900', '', '', '', 'http://www.windsorrsl.com.au', 'Windsor RSL Club offers the most exciting entertainment and food in the Hawkesbury. From Easy Lanes paddock to plate inspired menu and delicious cocktails and craft beer selection to Fork Brasserie’s mouth-watering menu and Café Latte’s coffee and cakes, Windsor RSL is the perfect place to relax with family or catch up with friends. With bingo Monday – Friday, NPL Poker and Cash Housie running weekly in addition to our jam packed entertainment calendar there is something for everyone!', 'A', '{"1":[[0.4166666667,0.1666666667]],"2":[[0.4166666667,0.1666666667]],"3":[[0.4166666667,0.1666666667]],"4":[[0.4166666667,0.1666666667]],"5":[[0.4166666667,0.1666666667]],"6":[[0.4166666667,0.1666666667]],"0":[[0.4166666667,0.1666666667]]}', 'https://www.facebook.com/windsorrsl', '', '', '', '', '', 'https://plus.google.com/101773716692422605076/about'),
  (92443, 'arana-leagues-club-92443', 'Arana Leagues Club', '', 'Arana Leagues Club is a community Club with alfresco dining, bistro, Kick Bar & Grill, functions & events, live music, amusement, TAB, gaming & kids club.', 204302, '2015-11-10 06:58:44', '2016-04-13 03:08:43', '', 191, 2467, 'leagues club\nsocial club', 204302, 0, '', 'info@aranaleagues.com.au', '0733541333', '', '', '', 'http://www.aranaleagues.com.au', 'Arana Leagues Club (ALC) is a large not-for-profit Community Club based in Keperra, in Brisbane’s Northern suburbs. Boasting 2 dining areas, 212 gaming machines, a fully supervised Kids Room, TAB, 5 bars and 2 function rooms. ALC is considered to be a leading entertainment venue in Brisbane’s North.\n\nThe history of our club is rich. On Australia Day 1969 a group of parents rallied together and founded the West Arana Hills Junior Rugby Leagues Club. In 1972 with assistance from the Brisbane City Council they relocated to their current address of Dawson Parade, Keperra. This area was a vacant cow paddock at the time. Two years later after lots of fundraising, hard work and effort from the supporting community construction began on the Arana Leagues Clubhouse.\n\nMany years on, in 1994, and after further fundraising,\n\n“Both Football and Leagues Clubs were started, built and annually improved by hardworking, dedicated people of the community. These people had a dream and a vision to see their club as one of the biggest and best sports and social clubs to not only develop youth in sport, but to support the local community. Built by the Community – For the Community best describes why the Arana Leagues Club still exists today.”assistance from community groups and organisations and the much needed community backing, Arana expanded and upgraded to the current Club that stands today. The Football Club relocated its Clubhouse to a standalone building along side the main Club but their union today still stands strong.', 'A', '{"1":[[0.375,1]],"2":[[0.375,1]],"3":[[0.375,0.0416666667]],"4":[[0.375,0.0416666667]],"5":[[0.375,0.125]],"6":[[0.375,0.125]],"0":[[0.3541666667,1]]}', 'https://www.facebook.com/Arana.Leagues.Club', 'https://twitter.com/AranaLClub', '', '', '', '', 'https://plus.google.com/100651583304972056753/about'),
  (92455, 'bankstown-sports-club-92455', 'Bankstown Sports Club', '', 'Bankstown Sports Club is located at Bankstown. Facilities includes 8 restaurants, 8 bars, 13 event spaces, Australia’s biggest indoor children''s playground and line-up of live shows.', 204534, '2015-11-10 08:05:36', '2016-05-02 03:58:56', '', 191, 2445, 'leagues club\nsports club', 204534, 0, 'P.O. Box 213 ', '', '0297229888', '', '', '0297229840', 'http://www.bankstownsports.com.au', 'Bankstown Sports Club has over 65,000 members, BSC is more than a club, it’s an old friend, a haven and a place for fun, enjoyment and relaxation.\n\nTo new visitors to the club, it’s a pleasant surprise. Why? Because Bankstown Sports Club likes to do things differently and has set itself apart for many years with its friendly staff, its unique decor, its great food options and its terrific range of entertainment.\n\nBankstown Sports Club is also a committed supporter of the local community and all club profits go towards the improvement of the club and the local community.\n\nIn so many ways, the club supports deserving community groups. It starts with support of about 47 local sporting clubs (about 8000 people in all), then there is the ClubGRANTS scheme which provides substantial financial assistance every year to a wide range of groups. The club also provides venues free of charge for community meetings, conferences and concerts, and it manages and maintains the Dunc Gray Velodrome.\n\nBankstown Sports Club’s family of venues includes Bankstown Sports Bowls, Birrong Sports and Baulkham Hills Sports Club.\n\nBankstown Sports directly employs 500 staff and provides or supports indirect employment to many other people through its business associates, contractors, suppliers and builders.\n\nThe club is constantly moving forward, renovating, developing and providing something new for its members.', 'A', '{"1":[[0.375,0.25]],"2":[[0.375,0.25]],"3":[[0.375,0.25]],"4":[[0.375,0.25]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.25]]}', 'https://www.facebook.com/BankstownSports', '', '', '', '', '', 'https://plus.google.com/108186993313940800002/about'),
  (92456, 'blacktown-workers-club-92456', 'Blacktown Workers Club', '', 'Blacktown Workers Club members enjoys membership at three great Clubs for the price of one and Sporting facilities and Sub Clubs with Great sports lounge, Snooker, Darts, Indoor Bowls & table tennis.', 204570, '2015-11-10 08:16:58', '2016-04-13 05:13:34', '', 191, 2441, 'leagues club\nsports club\nsocial club', 204570, 0, '', 'bwc@bwcl.com.au', '0298300600', '', '', '', 'http://www.workersclub.com.au', 'By any measure, the story of Blacktown Workers Club is a proud record of achievement. Its continuing success is a result of its strong relationship to its members and the community from which it has grown and its relevance and value as a recreational, sporting, entertainment and social icon in Sydney’s burgeoning west.\n\nFrom very humble beginnings to one of the largest and most successful venues in Sydney, the Blacktown Workers Club possesses a strong philosophy on stability and progress and prides itself on maintaining a true sense of community. Featuring five floors of sporting and health facilities, four restaurants , multiple function rooms, a showroom, a great selection of sub and sporting clubs and a host of other facilities for its members, the Blacktown Workers Club is the entertainment and leisure capital of Western Sydney.\n\nWorkers Sports Club\nThe way a team plays as a whole determines its success. And the Blacktown Workers Sports Club reflects the qualities of a successful sporting team: passionate, dedicated and determined. Passionate about sport and it''s role in the community; dedicated to supporting members and affiliated sporting bodies with excellent services and facilities; and determined at maintaining a high level of success.\n\nOpened in December 1998, Workers Sports is a modern and functional venue featuring a Sports Bar and Lounge, International Buffet, Coffee Shop, and a popular outdoor area. The Club is located on the H.E. Laybutt Reserve, adjacent to the renowned sporting complex which features two soccer fields, two rugby league fields/cricket ovals, two bowling greens, five all weather tennis courts and a baseball diamond. The H.E. Laybutt Sporting complex is home to many of our affiliated sporting teams and sub-clubs, boasting some 7,000 sportsmen and women, seniors and juniors.\n\nWe welcome you to the club and look forward to sharing the success!', 'A', '{"1":[[0.375,0.125]],"2":[[0.375,0.125]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.125]],"6":[[0.375,0.125]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/Blacktown-Workers-Club-194071653968817/timeline', '', '', '', '', '', 'https://plus.google.com/106993999598683201023/about'),
  (92460, 'cabramatta-rugby-leagues-club-92460', 'Cabramatta Rugby Leagues Club', '', 'Cabramatta Rugby Leagues Club features facilities for approximately 700 cars, 6 leased factory outlets and a rapidly growing licensed Club.', 204654, '2015-11-10 08:37:48', '2016-04-13 05:33:42', '', 191, 2427, 'leagues club\nsocial club', 204654, 0, '', 'amcdonnell@cabramattarlc.com.au', '0297278788', '', '', '', 'http://www.cabramattarlc.com.au', 'Cabramatta Rugby Leagues Club is located at 24 Sussex Street Cabramatta. The Club site boasts two of the districts premier rugby league fields, car parking facilities for approximately 700 cars, 6 leased factory outlets and a rapidly growing licensed Club. Some of our facilities include…\n\nBOB JACK BAR The Club’s true ‘Sports’ bar featuring  2 huge plasma’s, TAB information and betting terminal and comfortable seating for approximately 100 people. This picturesque Lounge overlooks two of the Clubs sporting fields, and has its own smoking breakout directly attached.\n\nTAB SPORTS BAR:\nBe apart of the action whether at the track or on the sporting field in our truly interactive TAB. Search for the odds, place a bet or just sit back and relax as we show you all of the major sporting events on in the World today.\n\nCASINO LOUNGE:\nHaving undergone renovations in the past year it''s fast becoming centre stage for the Club. The Casino Lounge offers a stylish modern décor  area for you to enjoy all of the Club’s raffles, promotions and free entertainment.\n\nOUTDOOR CASINO TERRACE:\nThis truly unique and extremely exquisite Outdoor Casino Terrace is one of a kind offering patrons the opportunity to enjoy outdoor hospitality right here at Cabramatta. Our Oasis Garden settings, toppled with modern outdoor furniture and entertainment options make this a must for any person seeking fresh air.\n\nCLUB SHOWROOM:\nThe facility has the capability to seat over 250 people. This intimate but elegant Auditorium is a must for any function or Wedding. Already home to Queen Bee, Karaoke and various Club Shows, the Showroom boasts sound and lighting facilities second to none. Call reception today to enquire about holding your next event right here.\n\nGYMNASIUM & BOXING GYM:\nBoasting Running Machines, rowers, bikes, free weights and pressure resistance machinery, the Gymnasium is not the glitz and glamour that you have come to expect from Cabramatta, but it certainly is the place to be when doing the hard yards and getting fit. Constructed to service the Clubs growing list of football players.\n\nNEW ERA STADIUM CORPORATE LOUNGE:\nNestled neatly above the New Era Stadium, the Corporate Lounge is the ideal way to spend the weekend watching all of the action as it unfolds. Feel apart of the action as our fully glassed facilities enable you to follow the players through the warm up on the rear fields before seeing them in action on the main field. You will be amazed.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/Cabramatta-Rugby-League-Club-166685480051662/', '', '', '', '', '', 'https://plus.google.com/109298742466500490999/about'),
  (92463, 'canada-bay-club-92463', 'Canada Bay Club', '', 'Canada Bay Club has a range of facilities catering for all age groups and prides itself on being a family friendly venue. We have 3 function rooms catering from 3 to 300 people and over 200 car space.', 204732, '2015-11-10 23:49:04', '2016-04-28 00:14:55', '', 191, 279, 'leagues club\nsocial club', 204732, 0, 'PO Box 85 ', 'enquiries@canadabayclub.com.au', '0297134322', '', '', '0297121591', 'http://www.canadabayclub.com.au', 'The Canada Bay Club, located at 4 William Street, Five Dock has been part of the local community for over 40 years.\n\nOver this time the club has been a proud supporter of local schools, sporting and community groups plus a meeting place for our members and their guests.\n\nThe club has a range of facilities catering for all age groups and prides itself on being a family friendly venue. The Canada Bay Club takes pride in providing a world class venue for our members and guests.\n\nFunctions\nThe Canada Bay Club, located in the Inner West of Sydney specialises in functions. From parties to weddings and everything inbetween. We have 3 function rooms catering from 3 to 300 people and over 200 car spaces for guests. Our function centre has a fantastic choice of menus available and a private bar in each of our 3 rooms. Our functions team strives to provide a world class experience for each and every function held in our venue.             \n\nThe Canada Bay Club has never looked better with extensive refurbishment of the lower level of the club providing a warm and welcoming environment. We now have a much larger lounge area with plenty of large flat screen TVs to suit everyone''s viewing needs, a new Wall of Wine in the Brasserie and an amazing new show stopper foyer.\n\nWe look forward to welcoming you to our new look club! ', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/Canada-Bay-Club-277608601296/', '', '', '', '', '', ''),
  (92464, 'carina-leagues-club-92464', 'Carina Leagues Club', '', 'Carina Leagues Club offers members with modern facilities such as Gaming Area, Kitchen and Bistro, Members Area, Function Rooms, Childrens Playroom, a Sportsmans Bar with Club TAB, Sportsbet and Keno.', 204738, '2015-11-11 00:07:03', '2016-04-13 06:24:43', '', 191, 2401, 'leagues club', 204738, 0, '', 'marketing@carinaleagues.com.au', '0738439200', '', '', '', 'http://www.carinaleaguesclub.com.au', 'Carina Leagues Club commenced from humble beginnings in October 1970 in the lower ground floor section of Chadwick Hall. Trading was under a Sporting Licence which permitted the sale of alcohol only while sport was being played. The Club was granted a Liquor Licence on the 22nd October 1971 and was the first club in Queensland granted trading hours from 10:00am to 11:00pm. Since this time, strong patronage and support has seen the Club continue to grow and improve our facilities.\n\nOver the last 20 years, the Club has trebled in size. This has delivered our members and visitors more modern facilities including a dedicated Gaming Area, Kitchen and Bistro, Members Area, Function Rooms, Childrens Playroom, and a Sportsmans Bar with Club TAB, Sportsbet, Keno, Pool Tables and a Darts Room and an Outdoor Courtyard. The Club also boasts a large, landscaped carpark with full lighting and plenty of room.\n\nClub Objectives\nAs the Club continues to grow we hope to add more and more great facilities for you, our Members. Carina Leagues Club is a community Club and a few of the many objectives in our charter for which the Club was established are:\n\nprovide for Members and Members’ Guests a Club with the usual facilities;\nprovide foster support and encourage the aims and objectives of Carina Junior Rugby League Football Club and all matters pertaining thereto; and\nto assist by financial, or by other means, any or all organisations which are devoted to fostering youth welfare facilities for youngsters and underprivileged and handicapped children, relieving poverty and hardship and preventing juvenile delinquency.', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.125]]}', 'https://www.facebook.com/CarinaLeagues/', 'https://twitter.com/CarinaLeagues', '', '', '', '', 'https://plus.google.com/102431208046894270699/about'),
  (92465, 'casino-rsm-club-92465', 'Casino RSM Club', '', 'The Casino Returned Servicemen''s Memorial Club is the leading community organisation in the Richmond Valley. The club offers amazing facilities for functions, dining and entertainment functions.', 204744, '2015-11-11 00:19:00', '2016-04-13 22:58:07', '', 191, 2367, 'leagues club', 204744, 0, '', 'admin@casinorsm.com.au', '0266621666', '', '', '', 'http://casinorsm.com.au', 'Welcome to Casino RSM Club.\n\nThe Casino Returned Servicemen’s Memorial (RSM) Club is the leading community organisation in the Richmond Valley. Located in the heart of Casino the Club offers amazing facilities for functions, dining and entertainment and is dedicated to the cultural, sporting and social development of the people of Casino and the Richmond Valley.\n\nTAB & Keno\nWatch all the race action live in the cool, comfortable surrounds of the Star Sports Lounge.\n\nKids Club\nCasino RSM has an all new Kids’ Club with activities and games such as a TV and Playstation.\n\nCourtesy Bus\nFree pick-ups and drop offs are available Wednesday to Saturday from 5pm.\n\nBottleshop\nCall into the Casino RSM bottleshop for this month’s budget busting specials.\n\nFunctions\nFrom small celebrations to large functions and receptions, Casino RSM has a variety of rooms to suit any occasion.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,1]],"5":[[0.375,0.0416666667]],"6":[[0.375,0.0416666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/thecasinorsm', 'https://twitter.com/casinorsm', '', '', '', '', 'https://plus.google.com/114669965501074106347/about'),
  (92466, 'central-charlestown-leagues-club-92466', 'Central Charlestown Leagues Club', '', 'Central Charlestown Leagues Club is home to the enormously popular bistro and the venue is ideal for weddings, parties or functions.', 204750, '2015-11-11 00:49:33', '2016-04-13 23:07:48', '', 191, 2361, 'leagues club\nsocial club', 204750, 0, '', 'cleagues@bigpond.net.au', '0249436622', '', '', '', 'http://www.centralleagues.com.au', 'Home to Central Newcastle League & located two minutes from Charlestown Square, Central Charlestown Leagues Club is located conveniently for Newcastle & Lake Macquarie residents & visitors to the area.\n\nThe enormously popular bistro is open 7 days a week for lunch & dinner, & the venue is ideal for weddings, parties or functions.\n\nCafe Central Bistro\nCafe Central Bistro has it all.  Conveniently opened 7 days a week it provides diners with a variety of meal options.\n\nDiners can choose from the traditional Bistro menu or tempt their taste buds with the Al-a-carte menu. Bistro menu changes weekly, however the chef is mindful of the all time favourites.\n\nCafe Central Bistro has a veggie and salad bar which continues to be a winner with all regular diners and for the members and visitors who need a quick and easy meal ''club grub'' is available all day.\n\nSo for convenience, choice and value for money, you cannot go past Cafe Central Bistro....\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/CentralLeagues', 'https://twitter.com/centralleagues', '', '', '', '', 'https://plus.google.com/107633054240823465945/about'),
  (92469, 'club-central-hurstville-92469', 'Club Central Hurstville', '', 'Club Central Hurstville is located at Hurtsville and can cater to your every need offering excellent food and service & the best in event services like weddings and more.', 204766, '2015-11-11 01:07:33', '2016-05-01 23:22:10', '', 191, 2351, 'leagues club\nsocial club', 204766, 0, '', 'enquiries@icc.org.au', '0295703355', '', '', '0295704040', 'http://clubcentralhurstville.com.au/', 'WELCOME TO CLUB CENTRAL EVENTS\n\nAt Club Central Events we are dedicated to cater to your every need offering excellent food and service. Offering the best in event services including weddings, corporate events, formals, cultural events, Christmas celebrations and many more.\n\nAcross Two venues consisting of Gandangara Function Centre located in Menai & Biddegal Function Centre located in Hurstville make Club Central Events your South Sydney venue specialist offering a variety of rooms with flexible space.\n\nFrom start to finish, Club Central Hurstville dedicated Events Team will take care of every detail, allowing you to relax and enjoy your event.', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.1666666667]],"6":[[0.4166666667,0.1666666667]],"0":[[0.4166666667,0.125]]}', 'https://www.facebook.com/clubcentralhurstville', 'https://twitter.com/cchurstville', '', '', '', '', 'https://plus.google.com/108564679787222870218/about'),
  (92475, 'collegians-rugby-league-football-club-92475', 'Collegians Rugby League Football Club', '', 'Collegians is a leading the club in the Illawarra area. With three great locations at Wollongong, Balgownie and Figtree, we have something for everyone!', 204804, '2015-11-11 01:31:17', '2016-04-14 00:56:44', '', 191, 2314, 'leagues club\nsports club', 204804, 0, '', 'info@collegians.com.au', '0242297711', '', '', '', 'http://www.collegians.com.au', 'Collegians Rugby League Football Club has been an established and popular club in the Illawarra area for over 50 years. Come in and experience our superior and friendly service whilst enjoying the beautifully designed surroundings. \n\nCollegians members receive a range of benefits including access to our Collies Rewards+ Program and exclusive member only promotions. Your membership will be valid across all three of our clubs at Collegians City, Collegians Balgownie and Red Dog on the Green when you join!\n\nCollies member benefits include:\n\n•  Receive Playsmart Reward Points for every purchase\n•  Use Playsmart Rewards Points to pay for purchases throughout clubs\n•  Enter members only promotions\n•  Receive member only discount promotional coupons\n•  Gain entry to all Collegians clubs without signing in\n•  Transfer Playsmart Rewards points for use at various partner business\n•  Sign in your guests ', 'A', '{"1":[[0.3958333333,0.1666666667]],"2":[[0.3958333333,0.1666666667]],"3":[[0.3958333333,0.1666666667]],"4":[[0.3958333333,0.1666666667]],"5":[[0.3958333333,0.25]],"6":[[0.3958333333,0.25]],"0":[[0.3958333333,0.1666666667]]}', 'https://www.facebook.com/Collegiansrlfc', '', '', '', '', '', 'https://plus.google.com/112228933141913164176/about'),
  (92479, 'corrimal-leagues-club-92479', 'Corrimal Leagues Club', '', 'Corrimal Leagues Club is located at Corrimal and offers a premium range of beers, spirits and cocktails, live entertainment, big screens as well as regular raffles and promotions.', 204854, '2015-11-11 01:47:07', '2016-04-28 00:39:55', '', 191, 266, 'leagues club\nsocial club', 204854, 0, '', 'information@corrimalleaguesclub.com.au', '0242848222', '', '', '', 'http://www.corrimalleagues.com.au', 'Corrimal Leagues Club has a proud history spanning well over 50 years. Since opening at its present site, the Club has been committed to bringing excellence in dining and entertainment to Corrimal.\n\nThe basis of the formation of the Leagues Club began with a group of Sunday morning drinkers, mainly supporters and football officials who met in a corrugated tin shed at the Coke Works on Sunday mornings. As numbers grew, that shifted to Ziems Park dressing shed.\n\nWith a premium range of beers, spirits and cocktails, live entertainment, big screens as well as regular raffles and promotions, socialising at Corrimal Leagues Club is the perfect way to catch up with friends in a relaxing and enjoyable environment.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/corrimal.leagues', '', 'https://www.linkedin.com/company/corrimal-leagues-club', '', '', '', 'https://plus.google.com/100525932969624897994/about'),
  (92481, 'dapto-leagues-club-92481', 'Dapto Leagues Club', '', 'Dapto Leagues Club is located at Dapto and offer the BEST food in the area and we will not be surpassed. Great staff, great food and our function rooms can cater all your occasions.', 204858, '2015-11-11 02:00:18', '2016-04-28 01:03:26', '', 191, 247, 'leagues club\nsocial club', 204858, 0, 'Cnr Station St & Bong Bong Rd', 'info@daptoleagues.com.au', '0242611333', '', '', '', 'http://www.daptoleagues.com.au', 'Dapto Leagues Club is the leading venues in quality hospitality and customer service, financially secure and socially responsible.\n\nThe clubs strategic objectives short and long term are focused on achieving the clubs Vision.\n\nDapto Leagues Club will continue to demonstrate financial discipline and to incrementally improve EBITDARD, will implement the master plan for both sites and introduce facilities and services that cater for the members and future members of a growing Dapto Community.\n\nDapto Leagues Club will continue to invest in its people and aspire to be an employer of choice, to develop a service culture based on accountability and performance, adaptable to change.\n\nThe Governing body will strive for industry best practice and to implement a Corporate Governance framework which is transparent  and acknowledges the Clubs Corporate Social responsibilities.', 'A', '{"1":[[0.375,0.125]],"2":[[0.375,0.125]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.125]],"6":[[0.375,0.125]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/daptoleagues/timeline', '', 'https://www.linkedin.com/company/dapto-leagues-club-ltd', '', '', '', 'https://plus.google.com/111764850327293145851/about');
INSERT INTO `tbl_entity_organization` (`id`, `friendly_url`, `name`, `alternate_name`, `description`, `image_id`, `enter_time`, `update_time`, `abn`, `account_id`, `place_id`, `keywords`, `logo_id`, `banner_id`, `address_additional_info`, `email`, `telephone`, `alternate_telephone`, `mobile`, `fax_number`, `website_url`, `content`, `status`, `hours_work`, `facebook_link`, `twitter_link`, `linkedin_link`, `youtube_link`, `blog_link`, `pinterest_link`, `googleplus_link`) VALUES
  (92488, 'goulburn-workers-club-92488', 'Goulburn Workers Club', '', 'Goulburn Workers Club located in Goulburn provides members and guests a wide range of services including 3 bars, TAB, players lounge and storage, kid''s play area and many more.', 204930, '2015-11-11 02:29:14', '2016-04-27 08:50:42', '', 191, 310, 'leagues club\nsocial club', 204930, 0, '', 'enquiries@goulburnworkers.com.au', '0248213355', '', '', '', 'http://www.goulburnworkers.com.au', 'Goulburn Workers Club is located in the heart of Goulburn’s CBD at McKell Place, Goulburn Workers has been apart of the community since 1959.\n\nAs well as having a proud and rich history, Goulburn Workers is now a vibrant modern club boasting facilities that rival most city cousins.\n\nYou’ll be spoilt for choice with the dining options and entertainment.\n\nEnjoy everything Goulburn Workers has to offer in unmatched customer comfort.\n\nAt Goulburn Workers we understand that every function is special & different. We pride ourselves on providing you with a variety of packages to suit every budget. Our aim is excellence in food, superiority in service whilst delivering creative and flexible solutions. The professionalism and dedication of our team will ensure your event is one to remember. \n\nOur venue offers a variety of fantastic spaces with the ability to host from small to large groups. We cater for all occasions such as weddings, conferences, corporate meetings or that special anniversary or birthday.  \n\nPlease do not hesitate to contact our Functions Manager for assistance in arranging your event.', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/GoulburnWorkers', 'https://twitter.com/GlbnWorkersClub', '', '', '', '', 'https://plus.google.com/110596890680536396680/about'),
  (92490, 'greenbank-rsl-92490', 'Greenbank RSL', '', 'Greenbank RSL offers dynamic gaming areas, world class live entertainment, exhilarating membership draws, exciting raffles, spectacular gaming promotions and more.', 204946, '2015-11-11 02:38:26', '2016-04-14 07:49:26', '', 191, 2158, 'rsl club', 204946, 0, '', 'sevans@greenbankrsl.com.au', '0738007746', '', '', '', 'http://www.greenbankrsl.com.au', 'Greenbank RSL Services Club Inc (Greenbank RSL) has been developed from a compact brick clubhouse in 1991 to one of Queensland’s leading Club, voted 2007 QUEENSLAND CLUB OF THE YEAR!\n\nThe foundation of Greenbank RSL was its commitment to returned serviceman and women. Greenbank RSL and its closely affiliated Sub Branch provide an extensive range of services to its returned and ex-service men and women and their families. With two dedicated Welfare Officers, services provided include hospital visits, assistance with disabilities, pension advisory services, assistance with funeral arrangements and home maintenance.\n\nGreenbank RSL is the recognised leader in the Queensland Club Industry. The Club has been awarded the major award in each category by Clubs Queensland and in 2001 was inducted into the Hall of Fame. In 2010 the Club was also inducted into the Quest Newspaper Gold Hall of Fame.\n\nGreenbank RSL offers some of Brisbane’s most cosmopolitan dining. Greenbank RSL boasts restaurants and a café offering an incredible variety of cuisines and atmospheres. From fresh seafood and alfresco dining to a la carte dining, there is a wide variety under one roof.\n\nGreenbank RSL was the first Club in Queensland to:\n\n• Actively adopt and implement a Responsible Service of Gaming policy,\n\n• Initiate and manage a Funds Management Program,\n\n• Establish a Corporate Liquor business unit,\n\n• Undertake an aggressive Smoking Management Strategy,\n\n• Provide assistance to community groups accessing the Community Benefits fund,\n\n• Devise a school based traineeship program,\n\n• Introduce a Seniors Club to provide a social environment for our Senior Citizens,\n\n• Establish an annual overseas scholarship program also known as Staff Bursary.', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.125]]}', 'https://www.facebook.com/GreenbankRSL/timeline', 'https://twitter.com/GreenbankRSL', '', '', '', '', 'https://plus.google.com/+GreenbankRSLHillcrest/about'),
  (92492, 'griffith-leagues-club-92492', 'Griffith Leagues Club', '', 'Griffith Leagues Club welcomes you to come in and have your next function with us. Our club features 2 fully licensed function rooms for all your occasions such as weddings, birthdays, wakes and more.', 204976, '2015-11-11 02:56:35', '2016-04-14 22:50:12', '', 191, 2101, 'leagues club', 204976, 0, '', 'admin@griffithleagues.com.au', '0269624577', '', '', '', 'http://www.griffithleagues.com.au/', 'Griffith Leagues Club Member Benefits\n\nAs a valued Griffith Leagues Club member, you''re entitled to these outstanding benefits:\n\n■    Entry into the Club and the ability to sign in guests\n■    Entry in exclusive Member promotions\n■    10% OFF all Meals in the Southside Bistro.\n■    Access to the courtesy bus service for you and your guests \n■    Redeem points for all Taxi vouchers. Conditions apply\n\nFunctions\nThe Griffith Leagues Club welcomes you to come in and have your next function with us.\n\nThe Griffith Leagues club features a 2 fully licensed function rooms which can accommodate as many as 300 people depending on room set up. We cater for groups large & small, sit down meals or simple finger food options.\n\nEvents that we have hosted at the Leagues Club include but are not limited to:\n\n•   Weddings\n•   Engagement Parties\n•   Birthdays & Anniversaries\n•   Baby Showers\n•   Wakes\n•   Seminars\n•   Training Days\n•   Christmas Parties\n•   Exhibitions & Product Launches\n•   AGM''s\n•   Property & Residential Auctions\n\nConferences\nThe Griffith Leagues Club is a great place to hold that special event, business conference or group meeting. With two different function rooms to choose from and wireless broadband & projectors provided on demand, there is sure to be something to suit your event.\n\nOur function team here at Griffith Leagues will work with you personally to ensure your event meets all expectations.\n\nThe room hire charges are subject to price variations and can be configured to suit your requirements.\n\nAlso included in this charge are: TV/Video, Screen, Data Projector Whiteboard, Flipchart and paper, Microphone, Lectern, Overhead Projector.', 'A', '{"1":[[0.4166666667,0.9375]],"2":[[0.4166666667,0.9375]],"3":[[0.4166666667,0.9375]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,0.0208333333]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/griffithleaguesclub/timeline', '', '', '', '', '', 'https://plus.google.com/110558435728856921052/about'),
  (92495, 'guildford-leagues-club-92495', 'Guildford Leagues Club', '', 'Guildford Leagues Club is located at McCredie Park, Tamplin Road Guildford. Our facilities include bon appétit restaurant, we have Keno, great Tab facilities an outdoor area and friendly staff. ', 205000, '2015-11-11 03:04:39', '2016-04-22 08:12:22', '', 191, 909, 'leagues club\nsports club', 205000, 0, '', 'winners@guildfordleagues.com.au', '0297801333', '', '', '', 'http://www.guildfordleagues.com.au/', 'Guildford Leagues Club started with a meeting held among local footballers in the 1920''s. This union of players strengthened both on and off the field, and the desire to have a permanent home for the club, resulted in a licence being applied for and granted in 1956. Since then the club has undergone major building programs improving and enlarging the club to its present size. A wider range of facilities for the over 15,000 members is now offered. \n\nThe Directors and Management Team of the club are actively involved in planning for the clubs future.\n\n\nMEMBER BENEFITS – FULL MEMBERS\n\n· Up to 10% off drinks purchased from the bar\n\n· Meal discounts in Bon Appetit Restaurant from Member discounts valid Monday to Sunday Lunch and Monday to Thursday dinner\n\n· Entry to club (without having to sign in)\n\n\n* Discounts on Members Monthly Bus Trips\n\n* Exclusive entry into club promotions\n\n* Ability to stand + vote for the Board of Directors\n\n* Access to all sporting intra clubs, player + committee\n\n* Birthday Offers in your birthday month', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.1666666667]],"6":[[0.4166666667,0.1666666667]],"0":[[0.4166666667,0.125]]}', 'https://www.facebook.com/Guildford-Leagues-Club-173975472632417/timeline', 'https://twitter.com/guildfordleague', 'https://www.linkedin.com/company/guildford-leagues-club', '', '', '', 'https://plus.google.com/114787330969563791024/about'),
  (92508, 'port-kembla-leagues-club-92508', 'Port Kembla Leagues Club ', '', 'Port Kembla Leagues, the ideal place to hold your function. We ensure your function is successful, as our staff work with you to plan every detail. Our club features squash court and gym.', 205134, '2015-11-11 03:56:58', '2016-04-15 01:55:21', '', 191, 1964, 'leagues club', 205134, 0, '', 'picard.aus@gmail.com', '0242751222', '', '', '', 'http://www.liverpoolcatholic.com.au', 'Port Kembla Leagues Club is the ideal place to hold your next function. Our Club stands out as the “Pearl” of Port Kembla.\n\nWe ensure your function is successful, as our staff work with you to plan every detail. You are invited to tell us what you need to satisfy your requirements.\n\nOur four or three function rooms can accommodate from 10 to 400 people.\n\nWhen enquiring about the Wentworth Room, the Auditorium or Boardroom your caterer will advise you of the best options available for your:\n\n•  Christenings\n•  Parties\n•  Weddings\n•  Corporate/community events\n•  Seminars\n•  Conferences\n•  Reunions\n•  Meetings\n\nConferences\nEquipment Available:\n\n•  Overhead projector and screen\n•  DVD player and monitor\n•  Data projector\n•  Flip Charts\n•  Whiteboard\n•  PA, sound systems and microphones\n•  Fax and photocopying facilities', 'A', '{"1":[[0.4166666667,0.9375]],"2":[[0.4166666667,0.9375]],"3":[[0.4166666667,0.9375]],"4":[[0.4166666667,0.9375]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/portleaguesclub/', '', '', '', '', '', 'https://plus.google.com/105465333276500039937/about'),
  (92525, 'revesby-workers-club-92525', 'Revesby Workers Club', '', 'Revesby Workers Club is an industry-leading organisation that offers valuable and superior services to both the local and wider community.', 205298, '2015-11-11 06:00:32', '2016-04-14 01:55:17', '', 191, 2267, 'leagues club', 205298, 0, '', 'mail@rwc.org.au', '0297722100', '', '', '', 'http://www.rwc.org.au', 'Revesby Workers’ Club is one of Sydney’s premiere leisure, dining and entertainment venues.\n\nWe pride ourselves on excellent customer service and will always go out of our way to make your visit a memorable experience.\n\nThe story of Revesby Workers’ Club is like no other in Australian licensed club history.\n\nThis fact is clearly evident as you take the journey through Gary Lester’s history of the Club, True to Our Traditions.\n\nGary Lester’s history of Revesby Workers’ Club tells of the colourful 50-year journey started by a small group of persistent local men who simply wanted to socialise with their wives.\n\nFrom it’s humble beginnings, Revesby Workers’ Club has achieved great status as one of the country’s most prominent and successful clubs.\n\nThis history is beautifully illustrated with photographs that tell of the Club’s turbulent, triumphant and often touching, past.', 'A', '{"1":[[0.375,0.25]],"2":[[0.375,0.25]],"3":[[0.375,0.25]],"4":[[0.375,0.25]],"5":[[0.375,0.25]],"6":[[0.375,0.25]],"0":[[0.375,0.25]]}', 'https://www.facebook.com/RevesbyWorkersClub', '', '', '', '', '', 'https://plus.google.com/115580842353941661640/about'),
  (92530, 'ryde-eastwood-leagues-club-92530', 'Ryde Eastwood Leagues Club', '', 'Ryde Eastwood Leagues Club is a premier location for horse racing and sports betting, tipping, NRL, AFL, cricket, soccer, rugby betting. Online betting terminals, fixed and tote odds.', 205332, '2015-11-11 06:15:30', '2016-04-15 02:36:44', '', 191, 1936, 'leagues club', 205332, 0, '', 'socialnetworks@releagues.com.au', '0298072444', '', '', '', 'http://www.releagues.com.au', 'In 1963 ten men joined together to form the Ryde-Eastwood District Rugby League Football Club, their aspiration to field a football team in first division and to build up support within the community. It wasn’t long before it was realised that to compete at that level would require the support of a licensed club and thus also in 1963 Ryde-Eastwood Leagues Club was formed.\n \nAfter securing a lease on premises in Ryedale Rd owned by Simpson Pope Washing Machines, and previously the home of the Holeproof women’s apparel factory, the board decided to apply for a liquor licence. With opposition from local hotels, the Club’s application was rejected twice, and the process of applying for a licence took nearly seven years.\n\nOver the years the Club has strengthened its affiliations with the local community supporting many different sporting groups and local charities. The spirit of friendship, support and determination that brought this club into being in 1963 continues today.\n\nRyde-Eastwood Leagues Club is your one-stop leisure venue. \n\nOur facilities include:\n\n- Three excellent eateries including an Al fresco dining area. Plus the new Golden \nHawk Chinese restaurant on the first floor of the Club.\n- State of the art fitness and swim school facilities \n- Travel agent (fully accredited)\n- Hairdresser\n- Fully equipped function centre\n- TAB facilities\n- New Sports lounge opening soon and a variety of bars\n- Fortnightly auditorium show entertainment\n- Lounge entertainment\n- Regular weekly raffles and promotions\n- Bingo\n- Free monthly movie screenings plus $1 Kids'' holiday movies\n- Line Dancing\n- Ceroq dance classes\n- FREE Wireless Internet access\n- Holiday units for members to book\n- A variety of active sub-clubs', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/rydeeastwoodleagues', '', '', '', '', '', 'https://plus.google.com/102672617142405572162/about'),
  (92540, 'south-newcastle-rugby-league-club-92540', 'South Newcastle Rugby League Club', '', 'South Newcastle Rugby League Club is the ideal place to celebrate your next function with four well appointed rooms capable of holding functions for 10 to 350 guests for all occasions & celebrations.', 205412, '2015-11-11 06:43:28', '2016-04-15 02:41:44', '', 191, 1931, 'leagues club', 205412, 0, '', 'enquiries@southleagues.com.au', '0249631120', '', '', '', 'http://www.southleagues.com.au', 'South Newcastle Rugby League Club is conveniently located in Merewether, Newcastle, just minutes from some of Australia’s most beautiful beaches and a short distance from the centre of town. South Newcastle Rugby League Club is an intimate, contemporary club with a great atmosphere and first class service. Come in and relax, unwind and recharge.\n\nOur club features Bar, Dining, Gaming - such as TAB & KENO and Functions.\n\nSouths is conveniently located in Merewether, Newcastle, just minutes from the centre of town and within walking distance from the city’s most famous beaches.\nIt is the ideal place to celebrate your next function with four well appointed rooms capable of holding functions for 10 to 350 guests.\n\nCatering for all types of corporate and personal events including conferences, weddings, birthdays, engagement parties, school formals, graduation balls, Christmas parties, reunions, retirements and farewells. Our dedicated functions team will take the headache out of organising your next event!\n\nFunction styles include stand-up, cocktail, sit down set menu, banquet and carvery. Our extensive and flexible food and beverage package’s are available to suit all requirements and budgets, or if you’re after something in particular we can tailor something especially for you.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/souths.merewether', '', '', '', '', '', 'https://plus.google.com/111252137824196758490/about'),
  (92545, 'southern-suburbs-football-club-92545', 'Southern Suburbs Football Club', '', 'Southern Suburbs Football Club is here for you to enjoy. Our clubs are not-for-profit organisations that focus on creating, nurturing & developing our environments for you to enjoy even more. Ven', 205442, '2015-11-11 06:54:04', '2016-04-15 03:13:28', '', 191, 1896, 'leagues club\nbowling club\nsports club', 205442, 0, '', 'reception@southsmackay.com.au', '0749572166', '', '', '', 'http://www.southsmackay.com.au', 'Souths Leagues Club is situated at 181 Milton Street Mackay adjacent to Mackay Airport and is also close to Nebo Road and only 2 kilometres from the city heart. The club is centred in Mackay’s sporting hub with Soccer,Hockey, Rugby League, Basketball, Tennis and Cricket facilities all in close proximity.\n\nSouths Leagues Club began in 1955. From its original 1000 members in its first trading year the club now boasts over 13,000 registered members and now has two facilities, including Souths Suburban Bowls Club on the corner of Adrian and Field Streets, Mackay. The club has been at its current site since 1971 and has now grown to provide 136 poker machines, Tab and Keno, 3 bars, coffee shop, bistro and function facilities and employ over 100 staff at two venues.\n\nIn 2007 the Leagues Club and Suburban Men’s Bowls Club amalgamated to form Souths Suburban Bowls Club and now provide a modern Bowls Club with 2 greens including 1 green that is covered. In 2015 the club underwent a 2.5million dollar renovation upgrading the Club to include 43pokie machines, functions room, board room, outdoor deck, bistro and bar.\n\nSporting wise, the club fields 17 Junior rugby league teams under the umbrella of South’s Junior Rugby League as well as 3 Senior teams. Both establishments have had a history of success, with the senior organisation arguably the most dominant team in the local competition. Each organisation has their own home ground, with the Seniors at Shark Park and the Juniors at Abbott Park.\n\nWhen you walk into a Souths establishment, the first thing you will feel is welcome. Welcome to enjoy all that Souths has to offer. What ever you’re here for, you’re welcome…', 'A', '{"1":[[0.375,1]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,1]],"5":[[0.375,0.0833333333]],"6":[[0.375,0.0833333333]],"0":[[0.375,1]]}', 'https://www.facebook.com/SouthsLeaguesClub/', 'https://twitter.com/souths_mackay', 'https://www.linkedin.com/company/souths-mackay', '', '', '', 'https://plus.google.com/114423036171157966111/about'),
  (92584, 'woonona-bulli-rsl-club-92584', 'Woonona Bulli RSL Club', '', 'Woonona Bulli RSL Club located in Woonona can tailor a function package to suit any occasion. We can organise the perfect wedding, birthday, Christmas party or any other special event.', 205809, '2015-11-11 23:53:29', '2016-05-02 03:43:27', '', 191, 2476, 'rsl club\nsocial club', 205809, 0, '', 'info@wbrsl.com.au', '0242841577', '', '', '', 'http://www.wbrsl.com.au', 'Woonona Bulli RSL Club has an association responsible for monitoring and supporting local sport.\n\nThis committee is called the Woonona Bulli RSL Sports Council.\n\nThere is a raft of sporting clubs being sponsored by the Sports Council. These include both senior and junior sports. Some of the sports involved include  Soccer, Rugby Union, Rugby League, Baseball, Cricket, Pony, Netball, AFL , Little Athletics, Dancing, Bowls, and many more.\n\n The Sports Council raises it funds via the raffle on Wednesday nights and allocates funding annually to local sporting groups to assist them in administration, uniforms and other expenses that arise when teams take the field.  Come on along and support the raffle - as all proceeds go back to the community.\n\n ', 'A', '{"1":[[0.3958333333,1]],"2":[[0.3958333333,1]],"3":[[0.3958333333,0.0416666667]],"4":[[0.3958333333,0.0416666667]],"5":[[0.3958333333,0.0833333333]],"6":[[0.3958333333,0.0833333333]],"0":[[0.3958333333,1]]}', 'https://www.facebook.com/woononabullirsl/?fref=ts', 'https://twitter.com/woononabullirsl', '', '', '', '', 'https://plus.google.com/108659273906522088010/about'),
  (94201, 'erina-heights-veterinary-hospital-94201', 'Erina Heights Veterinary Hospital', '', 'Erina Heights Veterinary Hospital located in Wamberal specialises in digital radiology, ultrasound, videoscopy, ophthalmoscopy, anaesthesia and surgery, dental services, flea and tick control & more.', 222508, '2015-12-04 06:03:24', '2016-04-18 01:51:28', '', 191, 1709, 'pet care\nveterinary surgeons\nanimal hospital\nveterinary hospital\npets\nvets', 222508, 0, '', '', '0243845888', '', '', '', 'http://www.erinaheightsvet.com.au/', 'Erina Heights Veterinary Hospital are committed to enhancing that bond by improving the duration and quality of your pets life. We provide high quality diagnostic, medical and surgical care of pets by a commitment to ongoing continuing professional development of both vets and our nursing staff.\n\nErina Heights Veterinary Hospital aims to be compassionate and gentle when caring for your pet. Keep your pet comfortable and in minimal pain when in our care. Keep you informed at all times of your pets progress, and to fully involve you in the decision-making process.\n\nErina Heights Veterinary Hospital offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Blood Analyser\n• Radiology\n• Ultrasound\n• Videoscopy\n• Ophthalmoscopy Unit\n• Anaesthesia\n• Flea and Tick Control\n• Dental\n\nand more.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]],"6":[[0.375,0.5]],"0":[[0.375,0.5]]}', 'https://www.facebook.com/ErinaHeightsVet/timeline', '', '', '', '', '', 'https://plus.google.com/117110333406197905835/about'),
  (103733, 'valiant-hire-103733', 'Valiant Hire', '', 'Valiant Hire is Australia’s leading specialist in office, event and residential furniture rental, with an unsurpassed reputation for excellent service and the largest range of quality furniture.', 238174, '2016-01-21 05:08:51', '2016-04-26 15:06:47', '14097542491', 713, 617, 'furniture', 238174, 0, '', 'hire@valiant.com.au', '0296904000', '', '0419263040', '', 'http://valiant.com.au/', 'With over 50 years experience in the furniture industry, Valiant Hire has developed its business to service a number of different areas of the furniture hire market. We have specialised divisions covering Residential Hire (Property Styling & Relocations), Exhibition/Events Hire and Office Furniture Hire. We cover event hire, property styling and office furniture rental in Melbourne, Brisbane, Sydney and surrounding areas including Canberra, Sunshine Coast, Geelong, Bellarine Peninsula and the Mornington Peninsula.\n\nBeing the largest furniture hire company in Australia, Valiant Hire operates in Sydney, Brisbane and Melbourne and services the regional areas surrounding these capital cities. For long term projects we are able to venture even further.\n\nWe are constantly updating our products, which are manufactured both locally and overseas. As a service based company, we thrive on working towards understanding the varying requirements of our clients so as to respond with the best solutions for your office, property or event styling needs.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Valiant.com.au/', 'https://twitter.com/valiantHire1', 'https://www.linkedin.com/company/valiant-hire', '', '', 'https://www.pinterest.com/valianthire/pop-furniture-event-hire-collection/', 'https://plus.google.com/112862773177530633349/about'),
  (104957, 'the-rugby-club-sydney-104957', 'The Rugby Club Sydney', '', 'The Rugby Club Sydney caters to functions & meetings, whether it is 1 person holding a video conference, 200 people having a cocktail party, or anything in between, we cater to your individual needs.', 253140, '2016-03-03 00:38:48', '2016-04-14 08:16:18', '', 191, 2141, 'sports club\nsocial club', 253140, 0, '', 'admin@rugbyclub.com.au', '0292473344', '', '', '0292413590', 'http://www.rugbyclub.com.au/', 'The Rugby Club Sydney is the place to come to get your Rugby fix!\n\nBut more than that, we are one of the few city based Registered Clubs left, where everyone 18 years and older is welcome. Centrally located close to Circular Quay buses, trains and ferries and the historic Rocks, the Rugby Club serves craft, premium and local beers, boasts an extensive wine list and provides dynamic and modern cuisine, prepared by our Clubs NSW Chef’s Table finalist Chefs.\n\nWe are still open at RUGBY PLACE, SYDNEY, where we have always been. We recently sold the property and will eventually move into new premises, however we continue our usual trade as normal at our usual home.\n\nRecently refurbished over four levels, we have the “World Cup Bar” with memorabilia and 4 large screen LCD TVs, an outdoor beer garden with lounges, large LCD screen TVs and heaters..\n\nThe “Waratah Lounge” is a brasserie and function room that can seat 120, while the “Wallaby Restaurant” seats 90. The “Barbarian Room” is also a function room and museum and was where the Rugby World Cup and Super Rugby and Tri Nations competitions were born!', 'A', '{"1":[[0.4583333333,0.8541666667]],"2":[[0.4583333333,0.8541666667]],"3":[[0.4583333333,0.8541666667]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]]}', 'https://www.facebook.com/RugbyClubSydney', 'https://twitter.com/SydneyRugbyClub', '', '', '', '', 'https://plus.google.com/+TheRugbyClubSydney/about'),
  (104962, '99-on-york-104962', '99 on York', '', '99 on York located at Sydney features 4 bars, an upmarket Chinese restaurant, mid-week buffet luncheon, cafe, Zabou Bar & Lounge, live entertainment and the York Conference & Function Centre.', 253256, '2016-03-03 01:56:03', '2016-04-27 02:00:33', '', 191, 512, 'social club', 253256, 0, '', 'info@99onyork.com.au', '0292901155', '', '', '0292997539', 'http://www.99onyork.com.au/', 'The Bowlers’ Club of NSW is a registered club located on York Street in the Sydney CBD. The Bowlers'' Club of NSW was established in 1958 and was granted a provisional liquor license that same year. The Club was originally located at the northern end of Clarence Street and relocated to its current York Street premises in 1971. The Club was incorporated in 1972, and the 1st Annual General Meeting was held in 1973.\n\nIn order to better position itself and to become more of an iconic venue, in 2010 the Club changed its name to 99 ON YORK.\n\nThe York Conference and Function Centre\n\nThe experience of a successful function is all in the service, quality, and detail provided.  The York Conference and Function Centre offers you a contemporary, reliable and value added function option, right in the heart of the city.\n\nWe understand the importance of all occasions and can tailor a suitable, cost effective solution based on your specific requirements.\n\nOur team are available to assist in organising your event whether it''s a product launch, corporate training, seminar, meeting or team building day.\n\nCatering can be arranged according to your requirements from breakfasts, morning teas or lunches to a cocktail party or dinner following your conference.\n\nOur suites can be configured into conference, boardroom, theatre, cabaret, cafe,\nu-shape, classroom or banquet setup.  We also offer audiovisual services to compliment your events needs.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4583333333,0.0416666667]],"0":[[0.4583333333,0.8125]]}', 'https://www.facebook.com/99onyorksydney/', '', '', '', '', '', 'https://plus.google.com/107822690620881524310/about'),
  (105009, 'the-boathouse-on-blackwattle-bay-105009', 'The Boathouse on Blackwattle Bay', '', 'The Boathouse is one of Australia''s leading restaurants. Enjoy our daily menu with a focus on Australia''s finest seafood, or simply share a plate of oysters at The Boathouse Bar. ', 254548, '2016-03-04 05:52:57', '2016-04-22 05:54:42', '', 191, 1010, '', 254548, 0, '', 'fish@boathouse.net.au', '0295189011', '', '', '0295189098', 'http://www.boathouse.net.au/', 'The Boathouse on Blackwattle Bay\nWe love all good food. But we are especially passionate about Australia’s wonderful array of local fish and seafood, freshly caught every day. Oysters are one of our obsessions.\n\nAnd, while you are exploring our daily menus or simply sharing a plate of oysters in our Bar, you will also enjoy magical views across Blackwattle Bay to the Anzac Bridge and Sydney Fish Market from our historic boathouse home.  You might even spot a few Sydney rowers gliding by.\n\nIt takes just 10 minutes drive from the City centre, or a water taxi ride to our front door, to experience this spectacular flip side view of our amazing city. It gets better year by year. We’ve been enjoying it for 18 years, so far!\n\nWe love seafood but we also offer delicious options for meat-lovers and vegetarians. Our menu changes daily and focuses on seasonal produce, always super fresh, of course!\n\nTry our oyster tasting plate with around 12 different varieties each day. Also watch out for dates of our oyster-tasting masterclasses during the year.', 'A', '{"2":[[0.75,0.9583333333]],"3":[[0.75,0.9583333333]],"4":[[0.75,0.9583333333]],"5":[[0.5,0.625],[0.75,0.9583333333]],"6":[[0.5,0.625],[0.75,0.9583333333]],"0":[[0.5,0.625],[0.75,0.9583333333]]}', 'https://www.facebook.com/boathouseonblackwattlebay', 'https://twitter.com/BoathouseSydney', 'https://www.linkedin.com/company/the-boathouse-on-blackwattle-bay', '', '', 'https://www.pinterest.com/boathousesydney', 'https://plus.google.com/+TheBoathouseonBlackwattleBayGlebe/about'),
  (105950, 'goddess-glow-105950', 'Goddess Glow', '', 'Goddess Glow is located at East Tamworth and specialises in beauty services. Goddess Glow Hair extensions, waxing, tinting, spray tans and specialising in wedding hair and makeup.', 0, '2016-03-08 03:51:54', '2016-04-14 00:49:15', '', 191, 2320, 'beauty salon\nhairdresser\nmassage', 0, 0, '', '', '267662239', '', '', '', '', '', 'A', '{"2":[[0.375,0.8125]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.8125]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.5416666667]]}', '', '', '', '', '', '', ''),
  (106129, '1326-urban-hair-106129', '1326 Urban Hair', '', '1326 Urban Hair is located at Tea Tree Gully and specialises in hair services. 1326 Urban Hair offer hair cutting, hair styling, hair colouring, hair extensions and many more.', 0, '2016-03-08 04:04:36', '2016-04-14 02:14:28', '', 191, 2256, 'hair salon\nhairdresser', 0, 0, '', '', '0882651326', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.7083333333]],"6":[[0.3333333333,0.7083333333]]}', '', '', '', '', '', '', ''),
  (106897, 'portfolio-hair-106897', 'Portfolio Hair', '', 'Portfolio Hair is located at Crowns Nest and specialises in hair services. Portfolio Hair offer colour, cut, styling, hair straightening and many more.', 256532, '2016-03-09 07:02:26', '2016-04-13 02:31:25', '', 191, 2480, 'hair salon\nhairdresser', 256532, 0, '', 'crowsnest@portfoliohair.com.au', '0299013331', '', '', '', 'http://portfoliohair.com.au/', 'Awarded for its expert vision and fashion forward approach to colour and styling, the team at Portfolio Hair are dedicated to sharing their in-depth knowledge of individual and specific hair needs, and delivering fashion forward looks that equally consider natural features and lifestyle.\n\nOur staff at Portfolio Hair are extensively trained, not only in hairdressing but also customer service - we believe they go hand in hand. We expect the best from our staff and in return they can give the best service to our clients.\n\nOur dedication, expertise and exceptional attention to detail has lead us to achieve great success in our industry, winning the Trend Vision Australian Title in 2010 and being National finalists again in 2011. The win in 2010 resulted in a trip to Paris to compete against other finalists from around the world. This has only spurred on the team to set their sights higher, with the team creating their own trend collections every year\n\nPortfolio Hair''s Services:\n• Colour\n• Cut\n• Styling\n• Hair Extension\n• Hair Straightening\n', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.8333333333]],"4":[[0.375,0.875]],"5":[[0.375,0.75]],"6":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/portfoliohairgroup', '', '', '', '', '', 'https://plus.google.com/100825824819182615722/about'),
  (107082, 'courgette-107082', 'Courgette', '', 'Courgette is one of Canberra’s most gorgeous restaurants. Courgette is a seriously luxurious restaurant known for its sophisticated ambience.', 257834, '2016-03-13 23:51:37', '2016-04-22 03:51:13', '', 191, 1032, 'international cuisine\nfine dining', 257834, 0, '', 'info@courgette.com.au', '0262474042', '', '', '0262470887', 'http://www.courgette.com.au/', 'About Courgette Restaurant\n\nAwarded one hat status by the Sydney Morning Herald 2012, 2013 & 2014/15 Courgette is one of Canberra’s most gorgeous restaurants. Owned by celebrated chef, James Mussillon, Courgette is the ideal choice for an occasion that requires everything to be perfect.\n\nCourgette is a seriously luxurious restaurant known for its sophisticated ambience. Lounge like chairs invite diners to settle in and savour both the food and the setting at their own unhurried pace.\n\nIntimate dining is available in the private rooms, The Boardroom and the Cellar.', 'A', '{"1":[[0.5,0.625],[0.75,0.9583333333]],"2":[[0.5,0.625],[0.75,0.9583333333]],"3":[[0.5,0.625],[0.75,0.9583333333]],"4":[[0.5,0.625],[0.75,0.9583333333]],"5":[[0.5,0.625],[0.75,0.9583333333]],"6":[[0.5,0.625],[0.75,0.9583333333]]}', '', 'https://twitter.com/courgetteact', '', '', '', '', ''),
  (107101, 'waters-edge-107101', 'Waters Edge', '', 'Waters Edge Restaurant''s  food is experimental Modern European-Australian, and ranges from the simplest of fare to the most challengingly complex.', 257982, '2016-03-14 02:45:38', '2016-04-22 02:07:45', '', 191, 1122, 'international cuisine', 257982, 0, '', 'info@watersedgecanberra.com.au', '0262735066', '', '', '0262735177', 'http://watersedgecanberra.com.au/', 'Water’s edge is one Canberra’s most respected restaurants and the fourth venture of European trained-chef James Mussillon. Established in 2008, Water’s edge continues to flourish.\n\nWater''s Edge interior is simply this: luxury executed with the restraint that accompanies the impeccable taste. The high ceilings, clean tones, plush chairs and white linen tables invite you to sit back and truly embrace the dining experience. The comfortable level space boasts a lovely water views overlooking the lake. \n\nWater''s Edge service is professional, friendly and unobtrusive. An extended wine list has been carefully selected to complement the culinary style; ensuring a beautiful crafted food and wine experience.\n\nWater''s Edge food is experimental Modern European-Australian, and ranges from the simplest of fare to the most challengingly complex, making Water’s edge loved equally  by gourmands with a penchant for the complex and by fresh-foodophiles who thrive on nothing more than the best quality local produce well presented. The menus reflect the use of seasonal produce, both familiar and rare.\n\nJames mussillon, creative and passionate brigade. His philosophy is “to understand and respect the produce and the flavours will speak for themselves”.\n\n', 'A', '{"3":[[0.5,0.625],[0.7708333333,0.9583333333]],"4":[[0.5,0.625],[0.7708333333,0.9583333333]],"5":[[0.5,0.625],[0.7708333333,0.9583333333]],"6":[[0.5,0.625],[0.7708333333,0.9583333333]],"0":[[0.5,0.625],[0.7708333333,0.9583333333]]}', '', '', '', '', '', '', ''),
  (107216, 'temporada-107216', 'Temporada', '', 'Temporada at  Canberra is not a Spanish restaurant - they just thought the name sounded good and felt that it reflected the Spanish way.', 258952, '2016-03-17 03:46:00', '2016-04-22 02:50:57', '', 191, 1083, 'catering\nbuffet\ntake away\ninternational cuisine\nfine dining', 258952, 0, '', 'info@temporada.com.au', '0262496683', '', '', '', 'http://www.temporada.com.au/', ' A casual bar and eatery that is open all through the day from 7.30am - late on weekdays. Saturday from 5pm. Now open for coffee and breakfast on weekdays!\n\nTemporada is a partnership between between Ben Willis of Aubergine Restaurant and his sous chef, Chris Darragh. Meaning ''the best of the season'''' in Spanish, Ben and Chris opened Temporada together as owners with Chris running the kitchen. \n\nTemporada isn''t a Spanish restaurant - they just thought the name sounded good and felt that it reflected the Spanish way of thinking, cooking and eating that they wanted to bring into the space.\n\nThe menu changes regularly and focuses on organic produce from local growers and super fresh seafood like oysters, clams, mussels, with plenty of things coming off a wood grill.', 'A', '{"1":[[0.3125,0.9166666667]],"2":[[0.3125,0.9166666667]],"3":[[0.3125,0.9166666667]],"4":[[0.3125,0.9166666667]],"5":[[0.3125,0.9166666667]],"6":[[0.7083333333,0.9166666667]]}', 'https://www.facebook.com/temporadacanberra', 'https://twitter.com/temporada1', '', '', '', '', ''),
  (107235, 'pialligo-estate-107235', 'Pialligo Estate', '', 'A sensational new food, wine, and lifestyle destination, tucked in a rural setting, at Pialligo Farmhouse, Canberra. The Farmhouse Restaurant overlooks our own grape vines, fruit orchard,etc.', 259047, '2016-03-17 05:50:13', '2016-04-22 03:48:51', '', 191, 1034, 'catering\nbuffet\nfine dining', 259047, 0, '', 'gm@pialligo.estate', '0262476060', '', '', '', 'http://www.thepialligoestate.com.au/', 'A sensational new food, wine, and lifestyle destination, tucked in a rural setting, minutes from Canberra’s airport and 8 minutes from Canberra’s CBD. Pialligo Estate, set on 86 acres with river frontage to the Molonglo, was originally Canberra’s market garden dating back to the 1820’s. \n\nWe are driven by the concept of paddock to plate. At Pialligo Estate, our diners can see the working farm where their food comes from.\nThe Farmhouse Restaurant overlooks our own grape vines, fruit orchard, market gardens, olive grove, and the historical smokehouse.', 'A', '{"3":[[0.75,0.9166666667]],"4":[[0.5,0.625],[0.75,0.9166666667]],"5":[[0.5,0.625],[0.75,0.9166666667]],"6":[[0.5,0.625],[0.75,0.9166666667]],"0":[[0.5,0.625]]}', 'https://www.facebook.com/PialligoEstate', 'https://twitter.com/pialligoestate', '', '', '', '', 'https://plus.google.com/+ThepialligoestateAu/posts'),
  (107250, 'cupitt-107250', 'Cupitt', '', 'Cupitt''s is dedicated in being the best food and wine experience on the South Coast.  The menu focuses on local produce matched with local wine and beer. ', 259147, '2016-03-17 06:34:40', '2016-04-22 07:50:59', '', 191, 923, '', 259147, 0, '', 'info@cupitt.com.au', '0244557888', '', '', '', 'http://cupittwines.com.au/', 'Family, wine, food, history. Cupitt’s Winery was born of passion and the Cupitt family remains dedicated to providing the best wine and food experience on the NSW South Coast.\n\nRosie and Griff Cupitt bought 193-acre Washburton Farm in 2003, with an eye to running a small cattle farm. Rosie, a trained horticulturalist had built on her love of gardens by beginning a degree in viticulture, and then moving into viticulture and wine-making. She decided she’d like a small vineyard and winery. The couple decided that they would both follow their passions at Washburton Farm, and Cupitt’s Winery was born. Today, the vineyard grows Semillon, Sauvignon and Verdelho grapes, while the farm specialises in Black Angus Cattle, and the herbs and vegetables used in Cupitt’s Kitchen.\n\nThe restaurant began as a small addition to help introduce their wines to people, however with a focus on local food and the culinary talents of Head Chef Russell Chinn the popularity of the restaurant has exceeded expectations. A visit to Cupitt’s Kitchen has become one of the must do options for foodies when visiting the regions.\n\nRosie and Griff’s passion for food and wine was passed down to their sons, Wally and Tom Cupitt, who now make the wine. Libby Cupitt, formally a town planner, joined the team with Tom and is the restaurant manager and events coordinator.\n\nToday, Cupitt’s Winery regularly wins awards for both its hand-crafted wines and the fresh, innovative food served at Cupitt’s Kitchen. Visit to taste award-winning wines, learn about the winemaking process, enjoy a special dining experience, sample local produce, and take in the extraordinary country views.', 'A', '{"3":[[0.5,0.5833333333]],"4":[[0.5,0.5833333333]],"5":[[0.5,0.5833333333],[0.75,0.8541666667]],"6":[[0.5,0.5833333333],[0.75,0.8541666667]],"0":[[0.5,0.6041666667]]}', 'https://www.facebook.com/cupittswinery', 'https://twitter.com/cupittwines', '', '', '', '', 'https://plus.google.com/115696084916860539790/about'),
  (107255, 'les-bistronomes-107255', 'Les Bistronomes', '', 'Les Bistronomes at Braddong serves casual French bistro focusing on seasonal ingredients. The restaurant is led by multi awards executive head chef Clement Chauvin & French BP Sommelier Abel Bariller', 259181, '2016-03-17 06:59:24', '2016-04-21 23:59:51', '', 191, 1173, 'catering\nbuffet\ntake away\ninternational cuisine\nfine dining', 259181, 0, 'Corner of Mort & Elouera Street ', 'lesbistronomes.act@gmail.com', '0262488119', '', '', '', 'http://www.lesbistronomes.net/', 'Les Bistronomes has a bit of Paris in Canberra. French bistronomical restaurant focusing on fresh and seasonal produce\n\nSmart casual French bistro focusing on seasonal ingredients. The restaurant is led by multi awards executive head chef Clement Chauvin & French BP Sommelier Abel Bariller\n\nFrench cuisine served in a relaxed, exposed-brick bistro with plush striped chairs and a courtyard', 'A', '{"2":[[0.5,0.5833333333],[0.75,0.8958333333]],"3":[[0.5,0.5833333333],[0.75,0.8958333333]],"4":[[0.5,0.5833333333],[0.75,0.8958333333]],"5":[[0.5,0.5833333333],[0.75,0.8958333333]],"6":[[0.5,0.5833333333],[0.75,0.8958333333]]}', 'https://www.facebook.com/LesBistronomes', 'https://twitter.com/actbistronomes', '', '', '', '', 'https://plus.google.com/104007429627820837051/about'),
  (107256, 'akiba-107256', 'Akiba', '', 'AKIBA at Canberra is inspired by the informal and exciting atmosphere of the great food halls or dining rooms that you find throughout the Asia-Pacific region.', 259191, '2016-03-17 07:37:33', '2016-04-21 23:23:45', '', 191, 1180, 'catering\nbuffet\ntake away\ninternational cuisine\nfine dining', 259191, 0, '', 'info@akiba.com.au', '0261620602', '', '', '', 'http://www.akiba.com.au/', 'AKIBA is inspired by the informal and exciting atmosphere of the great food halls or dining rooms that you find throughout the Asia-Pacific region. The food falls somewhere between Asian barbecue, raw bar and modern day Dim Sum, the cocktails are contemporary and creative without any played out prohibition or Mad Men references. \n\nAKIBA delivers a service style that is casual, relaxed and fun while still delivering an excellent product that is full of flavour. The design of the venue is very inviting with both the bar and the kitchen opened up to the floor so that the bartenders and chef can really be a part of every guest’s experience.\n\nOwner operators, the brothers Pete and Mike Harrington, are keen on delivering a world-class level of service and ambience and their track record is good. Between them they have worked at Tetsuya’s, Aria, Forty One, Bel Mondo, Cadmus and Star Anise amongst others. With them will be GM Thomas Weis, who has managed Icebergs, Bambini Trust, Prospero Group and Pendolino. \n\nThe restaurant will also have access to its own farm along with the brothers’ other much-lauded Canberra restaurant, Sage. The team is excited about creating a space that is exciting not just for Canberra but all of Australia; it is an approachable social hub rather than just a restaurant or bar.', 'A', '{"1":[[0.3125,0.4375],[0.4791666667,0.625],[0.7291666667,0.9375]],"2":[[0.3125,0.4375],[0.4791666667,0.625],[0.7291666667,0.9375]],"3":[[0.3125,0.4375],[0.4791666667,0.625],[0.7291666667,0.9375]],"4":[[0.3125,0.4375],[0.4791666667,0.625],[0.7291666667,0.9375]],"5":[[0.3125,0.4375],[0.4791666667,0.625],[0.7291666667,0.9375]],"6":[[0.4583333333,0.625],[0.7291666667,0.9375]],"0":[[0.4583333333,0.625],[0.7291666667,0.9375]]}', 'https://www.facebook.com/Akibacbr', '', '', '', '', '', 'https://plus.google.com/112129055929802203549/about'),
  (107348, 'wharf-rd-restaurant-bar-107348', 'Wharf Rd Restaurant & Bar', '', 'Wharf Rd. at Nowra Modern Cuisine Dishes creates fresh with an edge of smokey flavour thanks to our custom-built South American-style barbecue.', 259755, '2016-03-18 07:21:26', '2016-04-22 05:27:56', '', 191, 1022, 'catering\nbuffet\ntake away\ninternational cuisine', 259755, 0, '', 'enquiries@wharfrd.com.au', '0244226651', '', '', '', 'http://wharfrd.com.au/', 'Wharf Rd. is an expression of what living in or travelling to the south coast of New South Wales is all about – a relaxed atmosphere and a cracking view to be shared with friends and family, with simple, delicious food and great wine.\n\nYou won’t find a fine dining experience here. Wharf Rd is more about a relaxed, modern approach to food, presented in an inviting environment. Whether you’re a local, or just visiting the area, Wharf Rd is a destination dedicated to approachable, contemporary dining.\n\nSeating 130 customers, the space houses a bar, perfect for dropping in for a bite to eat and a glass of locally brewed craft beer, while the dining room provides a picturesque backdrop for a long, lazy lunches and dinners. For events and special occasions, Wharf Rd is fitted out with two private dining rooms, while the main dining space that opens up to the pristine Shoalhaven waterfront.\n\nKeeping true to Campbell’s commitment to seasonal, local and sustainable produce, the menu presents fresh local seafood as well as Wagyu beef and alpaca from nearby farms, dry-aged on premises in a custom Himalayan salt brick cool room. Carnivorous jewels will be cooked on a custom built South American-style parrila barbeque, Wharf Rd’s pride and joy.', 'A', '{"2":[[0.5,0.6666666667],[0.25,0.9166666667]],"3":[[0.5,0.6666666667],[0.25,0.9166666667]],"4":[[0.5,0.6666666667],[0.25,0.9166666667]],"5":[[0.5,0.6666666667],[0.25,0.9166666667]],"6":[[0.5,0.6666666667],[0.25,0.9166666667]],"0":[[0.4791666667,0.6666666667]]}', 'https://www.facebook.com/WharfRd/', '', '', '', '', '', ''),
  (107462, 'yellow-107462', 'Yellow', '', 'Yellow at Potts Point is a modern bistro inspired by the bistronomy movement that has liberated Paris and parts of Europe. We serve great food in a relaxed and informal atmosphere.', 260390, '2016-03-21 08:00:59', '2016-04-22 07:26:59', '', 191, 947, 'vegetarian restaurant\ncatering\nbuffet\ntake away\ninternational cuisine\nfine dining', 260390, 0, '', 'info@yellowsydney.com.au', '0293322344', '', '', '', 'http://www.yellowsydney.com.au/', 'Yellow at Potts Point is a modern bistro inspired by the bistronomy movement that has liberated Paris and parts of Europe. We serve great food in a relaxed and informal atmosphere.\n\nYellow can host your function at the restaurant, and tailor a menu with wines to match. The restaurant has a capacity of 60 people seated and up to 75 people standing. Protein menu options are available on request, as well as full vegetarian.\n\nOwners, Chef Brent Savage and Sommelier Nick Hildebrandt have been inspired by the European dining scene that has given birth to a new way of eating – contemporary food and wine served in an informal atmosphere at affordable prices. Opening 7 nights a week, with Breakfast/Brunch offered on weekends, Yellow has hosted Potts Point locals, visitors and groups for events and functions since opening in 2013.', 'A', '{"1":[[0.75,0.5]],"2":[[0.75,0.5]],"3":[[0.75,0.5]],"4":[[0.75,0.5]],"5":[[0.75,0.5]],"6":[[0.3333333333,0.625],[0.75,0.5]],"0":[[0.3333333333,0.625],[0.75,0.5]]}', 'https://www.facebook.com/yellowsydney', 'https://twitter.com/yellow_sydney', '', '', '', '', '');
