  (108210, 'tattersall-s-club-108210', 'Tattersall''s Club', '', 'Tattersall''s Club located in Brisbane it offers all the elegance and style in traditional and historical surrounds and is committed to excellence in all its facilities and service. ', 265519, '2016-04-04 07:57:14', '2016-04-14 08:40:27', '', 191, 2132, 'rsl club\nsports club\nsocial club', 265519, 0, '', '', '0733318888', '', '', '0732213913', 'http://tattersallsclub.com.au/', 'Tattersall’s Club was founded in 1865 by a group of gentlemen who were prominent in both business and in the thoroughbred horseracing industry in Queensland. The Club derives its name from Tattersall''s, the London horse auction mart and “subscription rooms” founded in 1776.\n\nFor almost 150 years Tattersall’s Club has been associated with the growth of Brisbane and Club Membership now spans all the professions, government, commerce and sports.\n\nIn 1997 the Club’s redevelopment was completed to include the Healy Room fine dining restaurant, Tattersall’s Function Centre catering for up to 300 patrons, 18 Accommodation suites, fully equipped Gymnasium, 25 metre indoor heated swimming pool, Library, Business Centre and administration offices.\n', 'A', '{"1":[[0.375,1]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,1]],"5":[[0.375,1]],"6":[[0.375,1]],"0":[[0.375,1]]}', 'https://www.facebook.com/TattersallsRacingClub/', '', 'https://www.linkedin.com/company/tattersall''s-club', '', '', '', ''),
  (108289, 'auburn-tennis-club-108289', 'Auburn Tennis Club ', '', 'Auburn Tennis and Recreation Club located in Auburn is a great place for meal terrific coffee and relaxation while watching the tennis or any other sport featured in their large TV screen. ', 266829, '2016-04-06 03:54:00', '2016-04-26 02:02:26', '', 191, 802, 'sports club\nsocial club', 266829, 0, '', 'info@auburntennisclub.com.au', '0296463736', '', '', '0296499589', 'http://www.auburntennisclub.com.au/', 'Auburn Tennis and Recreation Club provide products and experiences that our members and guests can be proud of. We provide up to date facilities for everyone to enjoy.\n \nThere is plenty of off-street parking available for everyone and our club is a great place to sit and relax while watching the tennis, or indeed any other sport featured on our large screen TVs. You can also enjoy a great meal, terrific coffee or yummy dessert at our famous Tennis View Bistro and Brasserie. Our outdoor areas are comfortable and inviting and just right for that catch up with family and friends. We are open for business from 10am every day of the year apart from Christmas Day.\n\nMembership of this fabulous club costs just $2.20 per year, so what are you waiting for? \nCome and see us now!', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Auburn-Tennis-Club-401558279903639/', '', '', '', '', '', 'https://plus.google.com/103061384982990586618/about'),
  (108293, 'balgowlah-golf-club-108293', 'Balgowlah Golf Club', '', 'Balgowlah Golf Club is one of Sydney’s best kept golfing secrets located in Balgowlah. Have a round of golf or an affordable meal while enjoying the relaxing sorrounding of the club.  ', 266873, '2016-04-06 05:25:03', '2016-04-28 07:21:14', '', 191, 36, 'golf club', 266873, 0, '', 'info@balgowlahgolfclub.com.au', '0299481900', '', '', '', 'http://www.balgowlahgolfclub.com.au/', 'Balgowlah Golf Club located only 25 minutes from the CBD and at the gateway to the Peninsula, we invite you to visit our beautiful 9-hole course for social or competition golf.\n\nSocial golf tee times are available daily and can be booked on-line or via the Pro Shop.\n\nMembers of other golf clubs (with official AGU handicaps) are invited to play in any of our weekly open competitions. Simply call the pro shop to register.\n\nBalgowlah Golf Club welcomes Social and Corporate groups and would be pleased to discuss your needs.\n\nPlease join us for a game and make the most of our clubhouse facilities.\n\nWe hope to see you soon!', 'A', '{"1":[[0.4583333333,0.7708333333]],"2":[[0.4583333333,0.7708333333]],"3":[[0.4583333333,0.7708333333]],"4":[[0.4583333333,0.7708333333]],"5":[[0.4583333333,0.7708333333]],"6":[[0.4583333333,0.7708333333]],"0":[[0.4583333333,0.7708333333]]}', 'https://www.facebook.com/BalgowlahGolfClub/info/?tab=overview', '', '', '', '', '', 'https://plus.google.com/114982240854797085283/about'),
  (108299, 'batemans-bay-soldiers-clubs-108299', 'Batemans Bay Soldiers Clubs', '', 'Batemans Bay Soldiers Clubs located in Batemans Bay is a  premier location for horse racing and sports betting, tipping, NRL, AFL, and many more.', 266967, '2016-04-06 06:15:33', '2016-04-12 06:10:52', '', 191, 2623, 'sports club\nsocial club', 266967, 0, 'PO BOX 916', '', '0244724117', '', '', '0244725955', 'http://www.baysoldiers.com.au/', 'Batemans Bay Soldiers’ Club, located on the beautiful NSW South Coast offer visitors to our Club everything from quality dining at our restaurant and bistro, a perfect venue for your wedding receiption or big event and the latest in live entertainment. \n\nWe welcome visitors to the beautiful Batemans Bay area.  You''ll find us on Beach Road in the centre of town. We offer all the visitor could desire in entertainment whilst here.  Fine eating at our restaurant and our popular bistro, the latest and quality live entertainment are all on the cards for you!\n\nHere at the Batemans Bay Soldiers Club we strive to provide members and guests with the best facilities possible.\n\nSome of our fantastic facilities include:\n\n• Esplanade Motor Inn\n• Sports and Club lounge\n• Bistro\n• Auditorium\n• Two convenient, fully stocked bars\n• Child-minding services\n• Club Hairdressing Salon\n• Free WiFi\n\nWe invite you to take a look around the site and discover what the Batemans Bay Soldiers Club has to offer you.', 'A', '{"1":[[0.4583333333,1]],"2":[[0.4583333333,1]],"3":[[0.4583333333,1]],"4":[[0.4583333333,1]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,1]]}', 'https://www.facebook.com/bay.soldiers/', '', 'https://www.linkedin.com/company/batemans-bay-soldiers-club', '', '', '', 'https://plus.google.com/104049584033756556013/about'),
  (108302, 'bathurst-rsl-club-108302', 'Bathurst RSL Club', '', 'Bathurst RSL Club located in Bathurst provide its members and guests a variety of services and facilities including live entertainment, dining, bars, function areas, weekly events and many more.', 267005, '2016-04-06 06:32:02', '2016-04-27 06:45:26', '', 191, 363, 'rsl club\nsocial club', 267005, 0, '', 'info@bathurstrsl.com.au', '0263332999', '', '', '0263312338', 'http://www.bathurstrsl.com.au/', 'Bathurst RSL Club is an integral part of the Bathurst community. With more than 12,000 members, we are a social hub where people can gather for a wonderful meal and great entertainment in a warm and friendly environment. We’re very proud of our exceptional service to our members and the community and we are committed to making everyone who walks through our doors feel welcome. With thousands of dollars donated each year to local sporting clubs, arts organisations, events and charities, the Bathurst RSL really is the heart of the community.\n\nBathurst RSL Club is a perfect place to meet with family and friends for a light snack or a more substantial meal. Our freshly prepared, made to order, affordable Bistro menu includes all your favourites like daily roasts, fish & chips, gourmet pies & cooked to order steaks not to mention our gluten free options. Our desserts are very popular, so make sure you leave some room! All meals are available for takeaway.\n\nEnjoy a freshly ground coffee with one of our fabulous array of desserts. With a great selection of light meal options, our burgers & made to order sandwiches are very popular.  All meals are available for takeaway.\n', 'A', '{"1":[[0.375,1]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,0.0416666667]],"5":[[0.375,0.0416666667]],"6":[[0.375,0.0416666667]],"0":[[0.375,1]]}', '', '', 'https://www.linkedin.com/company/bathurst-rsl-club', '', '', '', 'https://plus.google.com/106212319232443616714/about'),
  (108352, 'callala-rsl-country-club-108352', 'Callala RSL Country Club', '', 'Callala RSL Country Club located in Callala beach is a fully licensed club with fantastic facilities of golf & bowls, fantastic food at our Beachside bistro & accomodation of warm, friendly staff.', 267536, '2016-04-07 02:04:05', '2016-04-13 00:41:41', '', 191, 2526, 'rsl club\nsports club', 267536, 0, '', 'callalarsl@gmail.com', '0244465313', '', '', '0244465764', 'http://www.callalarslcountryclub.com/', 'Callala RSL Country Club began some changes to become a newer, refreshed club for our members and guests to enjoy a variety of Entertainment, Food & Beverages.\n\nOur members will still be able to swipe their cards and enjoy all the added extras that our members are entitled to, and our guests are always more than welcome to enjoy all of our facilities.\n\nWe look forward to growing with you as our community and look forward to seeing Callala RSL Country Club develop to its full potential over the coming months.\n\nCallala Beachside Bistro\n \nThe brand new Callala Beachside Bistro at the Callala RSL Country Club is open for business. Join us and experience the new taste sensation everyone is talking about. The Callala Beachside Bistro offers a relaxed dining experience with fresh contempoary Aussie Food. Offering locals and visitors alike the very best in south coast casual dining. Great service with a smile awaits you.\n \nCallala Beachside Bistro is the ideal venue for catching up with friends day or night in a comfortable and friendly environment.\nWe''re open from 10am till late from Monday through to Sunday and offer a large selection of light meals, hot and cold beverages and delicious sweets.\n\nFunctions\n\nLarge scale events or small intimate gatherings, our Professional Coordinators at Callala RSL Country Club are here to help. With such a special function centre there is no where quite like it!\nCatering to your needs, our qualified Function coordinators are here to help you plan every step of the way, whether it be a wedding, trade expo or party! From 60 to 250 guests, our customer service focused staff are here to assist.\nCallala RSL Country Club''s Beachside Function Centre has held a range of different events, including dinner shows, charity balls, weddings, expo’s and parties of all varieties!', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', '', 'https://twitter.com/Callala_RSL_CC', '', '', '', '', ''),
  (108388, 'club-central-menai-108388', 'Club Central Menai', '', 'Club Central Menai can cater to your every need offering excellent food and service and the best in event services like weddings, corporate events, cultural events, Christmas celebrations and more.', 267994, '2016-04-07 06:29:51', '2016-04-13 23:24:55', '', 191, 2355, 'social club', 267994, 0, '', 'enquiries@clubcentralmenai.com.au', '0295321800', '', '', '', 'http://clubcentralmenai.com.au/', 'Club Central Menai strive to be a leader in the hospitality industry by exceeding customer expectations in everything we do. To provide facilities, service and value that leads to a positive experience and to support the communities in which we are established.\n\nIllawarra Catholic Club first opened its doors in 1962 on the corner of Crofts Avenue and Diments Lane with 500 members. Based on a charter of like-minded people banding together to provide an essential community facility, the club quickly grew to become a key feature within the St George area.\n\nAs membership grew, so did the needs for bigger premises. The Illawarra Catholic Club then moved to to Woodville Street in 1970. The opening was quite the event.\n\nThe club has long been an important part of the St George community. Apart from providing premier entertainment facilities, Illawarra Catholic Club has over the years provided a base for countless sporting groups from netball to indoor bowls. It also annually contributes funds to many charity and community groups who work tirelessly within the community.\n\nIn 1997 Illawarra Catholic Club opened Club Menai and once again provided the then emerging community with a much-needed focal point. In fact, only weeks after opening the Club Menai soon found itself a refuge for the many families devastated by the 1997 fires in the area. Club Menai remains very much a part of the Menai area today.\n\nAnd so, in 2009, as testament to the Club’s pioneers and those who have supported the club’s growth since the 60’s, the Board, Management and everyone involved was proud to introduce the new and exciting Club Central Hurstville.\n\nThe new $44 million development is the cornerstone of the club’s move forward to provide a sound financial basis to ensure it can carry on the tradition and goals of the founding members.\n\nClub Central Menai has undergone a $12 million refurbishment and is now a modern and stylish venue. Members of Club Central now have access to two sensational venues and can enjoy facilities second to none.\n\nWe invite you to be a part of something truly special.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/clubcentralmenai', 'https://twitter.com/ccmenai', 'https://www.linkedin.com/company/club-central-menai', '', '', '', ''),
  (108393, 'club-liverpool-108393', 'Club Liverpool', '', 'Club Liverpool located in Liverpool offers great food, fun, entertainment and a  place to sit back and relax.  We also offer Outdoor TAB and Keno facilities.', 268098, '2016-04-07 07:23:28', '2016-04-26 06:48:34', '', 191, 661, 'rsl club', 268098, 0, '', '', '0298224555', '', '', '', 'http://www.clubliverpool.com.au/', 'Club Liverpool is located in the heart of the Liverpool CBD with entry via George Street or the Macquarie Street mall.\n\nMembers parking is available and we are close to public transport so it is the ideal spot to catch up with friends.\n \nDine in the 2170 Bar and Grill open 7 Days for Lunch and Dinner as well as serving a Snack Menu throughout the whole day or the Koffee Lounge which is open 7 Days per week until late.\n \nEnjoy a drink in one of our Bars or Lounge areas whilst you relax with friends or catch up in the Macquarie Lounge offering Outdoor TAB and Keno facilities. Club Liverpool offers plenty of Entertainment - Live Guitar Soloist Ever Friday in the 2170 Lounge, Rock n Roll Saturday nights on the 4th Saturday of every month, Variety Day Show concerts, Members Rewards Parties, Monthly Members Draw and Weekly Raffles, plus plenty more..\n \nAre you planning a Function, Event or just need a Room to hold a meeting - Club Liverpool can tailor a package to suit your needs.\n \nIf you are looking for friendly, affordable, comfortable and relaxed, then Club Liverpool is the place to be.\n ', 'A', '{"1":[[0.3958333333,0.125]],"2":[[0.3958333333,0.125]],"3":[[0.3958333333,0.125]],"4":[[0.3958333333,0.125]],"5":[[0.3958333333,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.125]]}', '', '', '', '', '', '', 'https://plus.google.com/108317258276124675910/about'),
  (108418, 'cronulla-rsl-108418', 'Cronulla RSL', '', 'Cronulla RSL located in Cronulla provide the highest standard of recreational and social amenities that are enjoyable, attractive and relevant to its members and a safe and friendly environment.', 268464, '2016-04-08 01:35:35', '2016-05-02 06:02:41', '', 191, 1598, 'rsl club', 268464, 0, '', 'info@cronullarsl.com.au', '0295236833', '', '', '0295239211', 'http://www.cronullarsl.com.au/', 'Cronulla RSL Memorial Club, is a provider of hospitality and community services in the registered clubs industry. We acknowledge our heritage and foundation by the ex-servicemen and women who created this great club from humble beginnings in 1944.\n\n Cronulla RSL aims to consistently provide, at the highest standard, a range of recreational and social amenities that are attractive, enjoyable and relevant to our members in a safe and friendly environment. The guiding principles of the board are integrity and responsible governance in all matters.\n\nAt present, the Club has two Function Rooms available - both of which overlook the Gerrale St Bowling Green and cater for a maximum standing capacity of 100 guests. \n\nRoom inspections are welcome during Club Trading Hours - simply visit the reception desk on arrival and they will direct you through.\n\nThe Main Bar is located on level 3, and services the Watergrill Brasserie and Sunroom.\n\nShowcasing picturesque views of the entire Bate Bay, the Main Bar is THE best place to relax and have a good time in the Shire.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0208333333]],"6":[[0.4166666667,0.0208333333]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/cronullarsl/info/?tab=page_info', 'https://twitter.com/cronullarsl', '', '', '', '', 'https://plus.google.com/107080556526480491374/about'),
  (108425, 'walgett-rsl-club-108425', 'Walgett RSL Club', '', 'Walgett RSL Club located in Walgett provide its guests and members a variety of services and facilities including bingo, raffles, dining, function rooms and many more.', 276578, '2016-04-08 02:12:51', '2016-04-27 06:16:16', '', 191, 387, 'rsl club', 276578, 0, '', 'info@walgettrsl.com.au', '0268281183', '', '', '0268281932', 'http://walgettrsl.com.au/', 'Walgett RSL Memorial Club is a successful Club in NSW’s far west. The Club serves 1200 members and provides all the facilities expected of a Club of this size, including Twin Rivers Bistro, Bar and lounge areas including a beer garden.\n\nThe Club also operates a 24 room motel that was acquired in December 2013.\n\nThe Club supports many local groups through donations and in-kind support. During the last Club Grants period the Walgett RSL Memorial Club donated over $40,000, well above what is required of us under this scheme.\n\nWalgett RSL Club thrive on delivering great functions and experiences for all our guests, offering a range of great food options of which we will personally cater to meet all your needs. Our Events Planners will always strive to work with and for you, on top of adding that extra flair, ensuring that you are always satisfied with the work that we do for you.\nWhatever your function may be, we are here to make your celebration one to remember. \n\nThe Walgett RSL Club knows the importance of having a great night with the ones you love, so let us do the hard work while you make the most of your night.\n\nSo all you need to do is pick the date, time and area, and let us work our magic!', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.75]]}', 'https://www.facebook.com/WalgettRSLClub/', '', '', '', '', '', ''),
  (108427, 'cruising-yacht-club-of-australia-108427', 'Cruising Yacht Club of Australia', '', 'Cruising Yacht Club of Australia located in Darling Point is one of the premiere Yacht clubs that caters to its members with a diverse range of sporting and social interests.', 274044, '2016-04-08 02:16:21', '2016-04-18 05:29:18', '', 191, 1630, 'sailing club', 274044, 0, '', 'cyca@cyca.com.au', '0282927800', '', '', '0293639745', 'http://www.cyca.com.au/', 'Cruising Yacht Club of Australia was established in 1944 and over the years has become Australia''s leading exponent of ocean racing and sea safety. Its race management expertise is often called upon for other international sailing events such as the Olympics and round-the-world races.\n\nThe CYCA caters for the most passionate ocean racer to the social sailor with a full calendar of mid-week summer twilight and weekend offshore racing and Sunday winter racing.\n\nThe original marina and clubhouse is long gone and in its place is a brand new floating marina and world-class yacht club that offers five-star function rooms, alfreso dining on the deck, and all the support services a boat owner needs.\n\nMembers and visitors to the CYCA enjoy being part of an active club in a superb location with state-of-the-art facilities and an international reputation that attracts yachts and crews from all over the world for the climax of the sailing calendar and one of Australia''s greatest sporting icons - the Rolex Sydney Hobart Yacht Race.\n\n\n\n\n', 'A', '{"1":[[0.3333333333,0.9166666667]],"2":[[0.3333333333,0.9166666667]],"3":[[0.3333333333,0.9166666667]],"4":[[0.3333333333,0.9166666667]],"5":[[0.3333333333,0.9166666667]],"6":[[0.3333333333,0.9166666667]],"0":[[0.3333333333,0.9166666667]]}', 'https://www.facebook.com/CruisingYachtClubOfAustralia', 'https://twitter.com/yachtingaus', 'https://www.linkedin.com/company/cruising-yacht-club-australia', '', '', '', ''),
  (108433, 'armidale-ex-services-memorial-club-108433', 'Armidale Ex-Services Memorial Club', '', 'Armidale SerVies provides a great range of entertainment, dining and function options including Dining facilities, Bars and functions rooms for Weddings, Events and Corporate meetings.', 268640, '2016-04-08 02:46:34', '2016-04-18 23:34:23', '', 191, 1501, 'rsl club', 268640, 0, '', 'office@armidaleservies.com.au', '0267760800', '', '', '0267760890', 'http://www.armidaleservies.com.au/', 'The Armidale Ex-Services Memorial Club’s history extends back to the end of World War I, when the Armidale Sub-Branch of the RSL had its headquarters in the Soldiers Room at the Literary Institute that was built by voluntary subscription.\n\nAt the end of WWII, the Ex-Servicemen’s organised strength was divided between the RSL and the Legion of Ex-Servicemen and Women.  RSL Members decided by national ballot that membership should be restricted to those who had served overseas. Legion membership was open to all Ex-Service personnel regardless of their place of service. It was the Legion, which acquired the Club premises in Armidale. The building was largely derelict and known as the “old steam laundry”.\n\nIn 1953, the Armidale Ex-Services Memorial Club was founded at a public meeting of Ex-Servicemen attended by about 150 people. On July 18, 1953, members of the Legion Branch decided to transfer the premises to the newly formed Club. However, it was not until January 1953 that the actual transfer of the premises’ title was effected. At the Annual General Meeting of 1953, the Club had a total of 153 persons.\n\nThe premises were well over 100 years old and had operated as Richardson’s Flour Mill, a skating rink, a dance palais and a laundry. The Club also had a large debt to pay and was only able to carry on through guarantors and credit from business houses.\n\nThe Club traded for several years without a liquor licence until 1955 when the first liquor licence was granted and extensions were made to the Club. Further extensions and renovations occurred in 1958, 1960, 1963, 1972, 1979, 1996,  2008 – 2010 and most recently 2015. The Club now offers the Mill Bistro for our members dining pleasure, a multi-purpose Auditorium (seating capacity 800), a variety of Meeting and Function Rooms, Sports Lounge with full TAB and Keno facilities plus two Snooker tables & Dartboards, Main Lounge with weekly Raffles, Members Draw & Promotions plus a Coffee Lounge.\n\nThe Club also provides men and women bowls facilities and a synthetic bowling green. The Club also owns the property on which the Belgrave Twin Cinema operates and Hobbit Preschool & Child Care Centre, in Martin Street.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/ArmidaleServiesClub', '', '', '', '', '', 'https://plus.google.com/111997446597952573848/about'),
  (108435, 'glen-innes-district-services-club-108435', 'Glen Innes & District Services Club', '', 'Glen Innes & District Services Club located in Glen Innes provide its guests and members a wide range of services and facilities including dining, entertainment, function areas, bingo, poker and more.', 268676, '2016-04-08 02:56:27', '2016-04-27 00:39:05', '', 191, 561, 'rsl club\nsocial club', 268676, 0, '', 'pat@giservices.com.au', '0267321355', '', '', '0267324205', 'http://giservices.com.au/', 'Glen Innes & District Services Club was created at the end of 1947. The first Clubhouse was a Nissan hut. The rent was 10 shillings a week.\n\nThe Club got a liquor licence in 1948 and Tooth and Company allotted 4 firkins (9 gallon kegs) and 16 5-gallon kegs per month for the Club’s 72 members.\n\nGlen Innes & District Services Club didn’t get a permanent home until 1955, when a new building was constructed on the corner of Bourke and East Avenue (now the Salvation Army Church).\n\nThe combination of a sparkling new clubhouse and greater availability of merchandise post war saw the Club go from strength to strength. Membership numbers increased. Ladies nights were introduced. More entertainment and sporting facilities were added. In fact, by 1963, the Club was beginning to outgrow its home.\n\nArchitects were called in to investigate expansion of the Club’s building. However, it was discovered that the foundations could support a second storey – and adjacent land was deemed too expensive.\n\nBy 1965, Glen Innes & District Services Club had bought two properties at the corner of Grey and Lang Streets and construction started on a new, larger clubhouse.\nAlso in 1965, the Club introduced afternoon entertainment and free dinner for the town’s old aged pensioners every 3 months. This was a big hit and by 1970, 200 pensioners were being entertained each quarter.\n\nGlen Innes & District Services Club has now been a part of Glen Innes life for 47 years. It employs 38 locals and is the social hub of the town.', 'A', '{"1":[[0.4375,0.9375]],"2":[[0.4375,0.9375]],"3":[[0.4375,0.9375]],"4":[[0.4166666667,0.9375]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4375,0.9166666667]]}', 'https://www.facebook.com/GlenInnesServicesClub', '', '', '', '', '', ''),
  (108442, 'gunnedah-services-bowling-club-108442', 'Gunnedah Services & Bowling Club', '', 'Gunnedah Services & Bowling Club has a full club facilities and a staff social club which is fully functioned by a committee of staff only. Facilities includes Pool Tables, Juke Box & function centre.', 268766, '2016-04-08 03:31:37', '2016-04-22 08:15:02', '', 191, 904, 'rsl club\nbowling club\nsports club', 268766, 0, 'PO Box 160', 'info@gunnedahservicesclub.com.au', '0267420400', '', '', '0267422140', 'http://www.gunnedahservicesclub.com.au/', 'Gunnedah Services & Bowling Club''s aim is to be identified as a outstanding hospitality venue through our Customer C.O.U.R.T.E.S.Y Program.\n\n•  CARE – The need to be concerned & willing\n•  OBLIGING – Kind, Friendly & Polite\n•  UNITY – To work together as a whole|\n•  RESPONSIBLE – Capable of taking control\n•  TRUSTWORTHY – Able to be reliable & depended on\n•  EFFORT – To make an attempt\n•  SERVICE – Provide assistance\n•  YIELD – To be prosperous & productive\n\nIt is our goal to offer the best possible service and satisfaction to every member & their guest.  As you would be aware, its easy to get a customer into the club but harder to get them to come back.  There’s really only one secret in excellent customer service – That’s the Staff!!\n\nIn taking care of our customer C.O.U.R.T.E.S.Y program it will ensure our goal is reached and that this club continues to increase its profitability each year –\nCOURTESY IS A MARK OF PROFESSIONALISM AND SOMETHING WE EXPECT OF OUR STAFF.\n\nIf our customer is made welcome as they make their way into the club, maybe being greeted by name from those staff members who know that person, the first stage of our mission is complete.\n\nMake it a habit every day to compliment a customer or notice something about them, an individual who gets treated especially well, will remember. The power of a smile and a friendly helpful manner leaves a positive, lasting impression.\n\nFACILITIES\nRelax in country style. A licensed club with good entertainment, good country food and good country company. With new renovations and extensions just completed, our club is a perfect place to meet for social gatherings, relax with a drink and enjoy our facilities.\n\nFacilities include: ATM, Darts, Disabled Access, Pool Tables, Juke Box, Takeaways, Outdoor BBQ Area, Keno, Fox Sport, Sky/Austar, TAB, Lawn Bowls, Restaurant, Coffee Shop, Function Centre, Courtesy Bus, Friendly Staff, Outside Smoking Areas.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/GunnedahServicesBowlingClub', '', '', '', '', '', 'https://plus.google.com/107452689406651369719/about'),
  (108446, 'quirindi-rsl-club-108446', 'Quirindi RSL Club', '', 'Quirindi RSL Club located in Quirindi provide its guests and members a wide range of services and facilities including live entertainment, poker, raffles, bingo, social golf, dining and many more.', 276398, '2016-04-08 03:50:59', '2016-04-27 02:22:39', '', 191, 487, 'rsl club', 276398, 0, '', 'info@quirindirsl.com.au', '0267461566', '', '', '0267462695', 'http://www.quirindirsl.com.au/', 'Quirindi RSL has been serving the local community for many years and continues to thrive with ongoing committments to members, guests and the local community. We offer a large range of services including live entertainment, superb food at the Station 88 bistro, Keno and TAB, Badge drawers, Golf club membership and the best function facilities in town.\n\nWe have served a large number of satisfied customers in that time, each new job is special to us, and we would love to hear how we can help you.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Quirindi-RSL-Club-675566072471474/', '', '', '', '', '', ''),
  (108447, 'elanora-country-club-108447', 'Elanora Country Club', '', 'Elanora Country Club located in Elanora Heights is a place for relaxation, game of golf along with its beautiful location. The club is a wonderful location for weddings and social functions.', 268834, '2016-04-08 03:52:30', '2016-04-28 01:23:53', '', 191, 233, 'golf club\nsocial club', 268834, 0, '', 'ecc@elanoracc.com.au', '0299137336', '', '', '0299131255', 'http://www.elanoracc.com.au/cms/', 'Elanora Country Club was formed on 19th October 1928 when the first meeting of the Committee took place. The first nine holes were opened on 29th May 1929 and the second nine in 1930.\n\n Elanora was developed as a Country Club with social and recreational facilities but golf was to provide the main sporting interest. As part of a real estate development it was anticipated that many members would choose to live nearby so as to enjoy the facilities of the Club especially in their retirement.\n\nThe Pro Shop is a full-service facility featuring all you would expect. Golf clubs, bags, shoes, rain wear, golf accessories and gifts are also available. A full range of club repair services including re-gripping, refinishing and re-shafting are also available.\n\nElanora Country Club is a wonderful location for weddings and social functions and maintains a reputation for fine dining with commitment to quality. Groups of all sizes are welcome, private parties, special occasions, birthdays, anniversaries, engagements and weddings. \n\nMembers and their families are an integral part of the day-to-day life of Elanora and our friendly staff will ensure every event is tailored to meet with individual requirements. Innovative dining options and an extensive wine list all blend seamlessly with superb views and a magnificant surrounding to provide something special.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/elanoracc', '', '', '', '', 'https://plus.google.com/115845728241909794039/about'),
  (108494, 'woodburn-evans-head-rsl-club-108494', 'Woodburn Evans Head RSL Club', '', 'Woodburn Evans Head RSL Club located in Evans Head provide its members and guests a variety of services and facilities including TAB & Keno, bar, restaurant, holiday units and many more.', 269667, '2016-04-11 01:56:22', '2016-04-26 23:22:36', '', 191, 598, 'rsl club\nsocial club', 269667, 0, '', 'admin@woodburnevansheadrsl.com.au', '0266824282', '0266824179', '', '', 'http://www.woodburnevansheadrsl.com.au/', 'Woodburn Evans Head RSL Club is situated on the banks of the beautiful Evans River in Northern NSW. Being just over 700km from Sydney and approx 240km from Brisbane makes Evans Head the ideal choice for your next holiday.\n\nWith its Temperate climate and its laid back life style, Evans Head truly is a hidden paradise.\n\nThe RSL Club is also the perfect venue for all functions, weddings are a specialty with a huge room downstairs with fully equipped bar facilities. Full catering services are available at reasonable prices, so book early for that special day.\n\nUpstairs floor to ceiling glass windows overlook the Evans River, large LCD TV''s for your viewing pleasure, free pool tables, Keno, TAB, great food, always nibbles on the bar, Great beer and spirits ensures a very laid back day.\n\nThe huge Auditorium downstairs with FULL bar facilities available for all your needs from a birthday party to an official dinner. We will look after you.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.375,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/woodburnevansheadrsl', '', 'https://www.linkedin.com/company/woodburn-evans-head-rsl-club', '', '', '', 'https://plus.google.com/101983982698125638343/about'),
  (108497, 'kareela-golf-social-club-108497', 'Kareela Golf & Social Club', '', 'Kareela Golf & Social Club located in Kareela is an ideal location for golf, functions or just for relaxation, whether it’s live entertainment, a meal, or poker you''re after we have you catered for.', 269683, '2016-04-11 02:40:17', '2016-04-25 23:00:32', '', 191, 888, 'golf club\nsocial club', 269683, 0, '', 'socialmedia@kareelagolf.com.au', '0295215555', '', '', '', 'http://www.kareelagolf.com.au/', 'Kareela Golf & Social Club started in the late 1960''s as Salisbury Golf Club. It was originally a nine hole course that officially opened in September of 1970 by Councillor A.T. Gietzett. The second nine holes were opened on July 4th 1971 by the then Minister for Lands the Honourable T.L. Lewis. A membership to that initial club was $30 joining fee and $15 annually. A significant feature of that course was that not a single tree was removed in it’s design.\n\nCharitable organisations we have supported in recent years have differed slightly as we have undertaken several major projects for particular charities. The most recent being the urgent construction work at Como Pre-school that enabled the centre to keep operating.\n\nKareela Golf Club is positioned in the leafy Sutherland Shire suburb of Kareela.\nSituated on the corner of the Princes Highway & Bates Drive we represent the first major stop on visiting the Shire when it comes to food, fun, entertainment and atmosphere.\n\nOur picturesque but challenging course offers a great day out for the pro, the amateur or even the first time golfer. Follow up your round with a stop in our friendly and relaxing state of the art clubhouse with exceptional food at LT''s Bar & Grill, a fun and relaxing main lounge and bar, and full gaming and TAB facilities.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.3958333333,1]],"0":[[0.3958333333,0.9166666667]]}', 'https://www.facebook.com/kareelagolf', 'https://twitter.com/KareelaGolfClub', '', '', '', 'https://www.pinterest.com/kareelagolf/', 'https://plus.google.com/109129927698183431565/about'),
  (108502, 'davistown-rsl-club-108502', 'Davistown RSL Club', '', 'Davistown RSL Club is located at Davistown and offer a range of excellent options from Set Menus, Buffets and Platters. Perfect venue for weddings, receptions, ceremonies, parties and more.', 269733, '2016-04-11 02:58:09', '2016-04-26 03:16:04', '', 191, 728, 'rsl club\nsocial club', 269733, 0, '', 'reception@davistownrsl.com.au', '0243630199', '', '', '', 'http://www.davistownrsl.com.au/', 'Davistown RSL Club have a great range of beers available on tap and over the counter. With a wine and spirits selection to suit any occasion and the kids will love our slushies. Choose between comfy lounge seating or bar and table seating. Our newly refurbished TAB has two terminals with stool seating and LCD flat screen televisions.\n\nDavistown RSL Club have two picturesque bowling greens on site for both Men’s and Ladies bows. Whether it’s for club competitions, corporate bowls or simply a social roll up Davistown RSL Club work together with its Bowling Club to cater for any and all of your bowling requirements.\n\nEnjoy the fresh air and views outside under our shade umbrellas on the terrace. Watch the kids from the terrace in the playground, or enjoy drinks with friends and family or opt to dine outside. We have a large terrace area with a dedicated non – smoking section as well.\n\nDavistown RSL Club''s newly refurbished Broadwater Brasserie and dining room overlooks our backyard and the foreshore of Brisbane Waters. Our menu will entice your taste buds with quality restaurant style dishes as well as a daily specials selection, something for the whole family including the kids.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,1]],"6":[[0.3541666667,1]],"0":[[0.3541666667,0.9166666667]]}', 'https://www.facebook.com/DavistownRSLClub/', 'https://twitter.com/davistownrsl', '', '', '', '', ''),
  (108520, 'leura-golf-club-108520', 'Leura Golf Club', '', 'Leura Golf Club located in Leura provide its guests and members a wide range of services and facilities including bistro, pro shop, social golf, competitive golf and many more.', 276929, '2016-04-11 05:34:09', '2016-04-28 03:00:07', '', 191, 177, 'golf club', 276929, 0, '', 'admin@leuragolfclub.com.au', '0247850035', '', '', '0247843355', 'http://www.leuragolfclub.com.au/', 'Leura Golf Club has been to the fore of golf in the Blue Mountains since it opened officially on 29th November 1902 with 9 holes on the Fitzroy Street site. It was one of the early non-city courses.\n\nCome and experience why for over 100 years Leura Golf Club has been the number one destination for golfers visiting the beautiful Blue Mountains. The course itself is perched above the Jamison valley that is also home to the world famous Three Sisters. \n\nGolfers are confronted with breathtaking views that reach as far south as the Southern Highlands. Inside the club house exists a warm and friendly atmosphere with a beautifully renovated restaurant and Bar guests can relax by the fire or take in the mountain fresh air on our large deck.\n\nWhether you are visiting the Blue Mountains for a romantic weekend away or stealing away from the hustle and bustle of the city you must make Leura Golf Club your number one destination for excellent food and drink as well as a stunning 18 hole golf course that will challenge even the most experienced golfers. ', 'A', '{"1":[[0.2916666667,0.9166666667]],"2":[[0.2916666667,0.9166666667]],"3":[[0.2916666667,0.9166666667]],"4":[[0.2916666667,0.9166666667]],"5":[[0.2916666667,0.9166666667]],"6":[[0.2916666667,0.9166666667]],"0":[[0.2916666667,0.9166666667]]}', 'https://www.facebook.com/leuragolfclub', 'https://twitter.com/leuragolf', 'https://www.linkedin.com/company/leura-golf-club', '', '', '', 'https://plus.google.com/116068143875663799730/about'),
  (108538, 'mingara-recreation-club-108538', 'Mingara Recreation Club', '', 'Mingara Recreation Club located in Tumbi Umbi is Central Coast''s favorite club to relax, play and indulge. Enjoy the services in our restaurants, cafes, bars, events, live music, fitness and more.', 270269, '2016-04-11 08:12:16', '2016-04-28 06:22:09', '', 191, 70, 'social club', 270269, 0, 'Mingara Drive', 'enquiries@mingara.com.au', '0243497799', '', '', '0243497800', 'http://www.mingara.com.au/', 'Mingara Recreation Club was formed back in 1971 by a neighbourhood of people in Berkeley Vale who reached out to each other. They reached out in mateship for support and great times.\n\nMeetings and fundraising activities continued in local community halls for approximately 2 years, when an application was made for some land in Adelaide Street, Tumbi Umbi. The land was granted and the club of now 200 members purchased some ex-Army Huts to create the first clubhouse.\n\nIn October 2012, Mingara was successful in another amalgamation with The Gordon Rugby Club at Chatswood. Re-branded and freshly renovated, Pearl Club Chatswood is an intimate, boutique style club in the Mandarin Centre, at the heart of a bustling Chatswood. Pearl offers members an ideal place to relax and indulge and discover new rewards and entertainment. \n\nToday, Mingara Leisure Group is the social and sporting hub for over 45,000 members on the Central Coast, Port Macquarie, Chatswood and Canterbury communities. \n\nIn addition to our wonderful facilities, we support over 200 sporting, health, education, welfare and sporting groups and contribute over $1 million every year to support these organisations and live our vision.\n', 'A', '{"1":[[0.3333333333,0.125]],"2":[[0.3333333333,0.125]],"3":[[0.3333333333,0.125]],"4":[[0.3333333333,0.125]],"5":[[0.3333333333,0.75]],"6":[[0.3541666667,0.75]],"0":[[0.3333333333,0.125]]}', 'https://www.facebook.com/mingaraclub/', 'https://twitter.com/MingaraClub', '', '', '', '', 'https://plus.google.com/108817694867677436172/about'),
  (108541, 'bronzed-brazilian-108541', 'Bronzed Brazilian ', '', 'Brisbane''s Best Beauty Salon for Men & Women -  IPL & Waxing Specialists. Award winning Spray Tanning- Lash extensions-Beautiful brows & Facials with results. Fantastic location with easy parking   ', 273660, '2016-04-11 09:20:22', '2016-04-17 19:42:02', '99160328343', 653, 1748, 'beauty salon\nlaser clinic\nmassage\nbeauty therapy\nskin care', 273660, 273661, '953 Wynnum Rd', 'cannonhill@bronzedbrazilian.com.au', '0738998549', '', '0421443991', '', 'http://bronzedbrazilian.com.au/', 'Bronzed Brazilian -  treating clients for over 10 years we are mulit-award winning salon located conveniently on Wynnum Rd (opp Pine & Bamboo restaurant) est 2005.\nOur aim is to bring together fabulous therapists committed to giving you a first class service not only the first time but every time.\n\nWe are family owned business who Specialise in IPL hair removal, waxing,  microdermabrasion, IPL photo rejuvenation, oxygen facials, clinical skin peels.\n\nBrazilian waxing for guys & girls, lash extensions silk & mink , brow shaping, waxing & tinting, beautiful body treatments and massage, ear candling,  pre birth waxing,  great disabled access and parking at front our clients never have to walk through a shopping centre after your beauty or spray tan treatments! \n\nWe cater for Girls, Guys, Seniors & Teens \n\nStockists of Aspect , ASAP, Sun Fx , St Tropez , Waterlily & Caron to name a few, so come in we would love to meet you. \n\n\n', 'A', '{"2":[[0.375,0.8333333333]],"3":[[0.375,0.8541666667]],"4":[[0.375,0.8541666667]],"5":[[0.375,0.75]],"6":[[0.3333333333,0.5833333333]]}', '', '', '', '', '', '', ''),
  (108542, 'wallsend-diggers-108542', 'Wallsend Diggers', '', 'Wallsend Diggers located at Tyrrell St offers club members great facilities like Diggers Function Centre, HD Sports Bar, Kids Playland and many more benefits like courtesy bus and discounts.', 270393, '2016-04-11 22:55:51', '2016-04-11 23:00:09', '', 191, 2807, 'rsl club\nleagues club\nsocial club', 270393, 0, '', 'marketing@wallsenddiggers.com.au', '0249517000', '', '', '', 'http://www.wallsenddiggers.com.au/', 'Wallsend Diggers Function Centre Cater to all your function needs....\n\nWeddings\nSelect from a wide variety of packages to meet your needs. We have an assortment of menu packages to choose from and can assist you with beverages, music, decorations and any other special requirements to make your day the very best.\n\nFunctions\nThe Club can offer a variety of packages to suit just about everyone. With lift facilities, stage, sound, lighting, dance floor and security patrolled carpark.\n\nConferences\nConferences, Meetings and Training Seminars. We have the perfect setting with 2 separate rooms, TV, DVD and video equipment, large screens with full audio, overhead projector, whiteboard, powerpoint presentations, full bar facilities, fully air conditioned and disabled access.\n\nFor more information call us on (02) 4951 7000.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.3333333333,0.9166666667]]}', 'https://www.facebook.com/Wallsend-Diggers-169431493125734/', '', 'https://www.linkedin.com/company/wallsend-diggers', '', '', '', ''),
  (108544, 'wangi-rsl-club-108544', 'Wangi RSL Club', '', 'At Wangi RSL we offer one of the best atmospheres in the Hunter Valley and that is the beautiful lake Macquarie. Our facilities are perfect for any functions your family may celebrate.', 270411, '2016-04-11 23:12:14', '2016-04-11 23:14:09', '', 191, 2801, 'rsl club\nsailing club\nsocial club', 270411, 0, '', '', '0249751433', '', '', '', 'http://www.wangirsl.com.au/', 'At Wangi RSL we offer one of the best atmospheres in the Hunter Valley and that is the beautiful lake Macquarie. The rest of our club is a traditional small community atmosphere giving our clients a chance to dress the room exactly how they want.\n\nWe provide many contacts with event professionals that specialise in transforming plain auditoriums into something spectacular.\n\nOur function room rates will will really impress you with their value for money…Call our function co-ordinator to book a consultation on how we can help you with your next event.\n\nWith just a little imagination witness the amazing transformation of our delightful lakeside club into a fairyland of lace and atmosphere.\n\nWe partner with some of the Hunter Valleys best event companies to dress your function into the exact theme your looking for.\n\nCater your event with our in house menu or outsource to one of our partners for a specific theme of cuisine.\n\nLearn To Sail\nThe Club holds Learn to Sail classes for junior sailors which normally start in October and run through to Christmas. In addition to sailors bringing along their own boats, the Club also has a number of boats (Lasers & Sabots) for use during the Learn to Sail program.\n\nMember Benefits\nBecome a member and enjoy so many benefits every time you visit the club.\n•  Just by swiping your members card when you arrive you go into the $500 Bunnings Voucher Draw.\n•  Members Badge Draw Every Wednesday, Friday & Sunday where you could walk away with $1000 just for being in the club.\n•  Members Happy hour on Mon & Wed 11:00am  Tue, Wed, Thur, Fri 5:00pm.\n•  Members Free Raffle Mon & Wed at 12:00pm', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/wangiwangirsl/', '', '', '', '', '', '');
