  (108545, 'sunshine-beach-veterinary-surgery-108545', 'Sunshine Beach Veterinary Surgery', '', 'Sunshine Beach Veterinary Surgery located in Sunshine Beach specialiases in preventative medicine, surgical procedure, laboratory tests and many more.', 270417, '2016-04-11 23:16:05', '2016-04-11 23:17:02', '', 191, 2799, 'pet care\nveterinary surgeons\nveterinary clinic\npets\nvets', 270417, 0, '', 'pjrickford@bigpond.com', '0754474569', '', '', '', 'http://www.sunshinebeachvet.com.au/', 'Sunshine Beach Veterinary Surgery has been proudly owned and run as a family operated business for the past 23 years by Dr Peter Rickford.  As a sole practitioner you are guaranteed personal service every time.  We have convenient dedicated parking at our entrance behind the Sunshine Beach shops and well spaced appointments to reduce any waiting time.  Our facilities are modern and comprehensive for all your pets diagnostic, medical and surgical needs and of course we carry a range of pet products and dietary food.  Our strong ties to the local community are also reflected in our desexing programs for approved applicants in conjunction with Noosa Lions Club and the National Desexing Network and our general competitive and realistic approach to costs.  Dr Peter Rickford has also undergone further training in export accreditation enabling him to help prepare your pet for overseas travel.\n\nSunshine Beach Veterinary Surgery offers a comprehensive range of veterinary and pet health-related services, including:\n\n• Vaccinations and protection from parasites\n• Surgery including desexing\n• Lab testing for disease diagnosis\n• Nutritional care and pet accessories\n• Pet Export Specialist', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108547, 'club-wyong-rsl-108547', 'Club Wyong RSL', '', 'Club Wyong RSL is located at Wyong and offer birthdays & private celebrations, corporate events or conferences, engagement or wedding parties, wakes, charity events & fundraisers.', 270425, '2016-04-11 23:20:02', '2016-04-26 03:07:40', '', 191, 732, 'rsl club\nbowling club\nsocial club', 270425, 0, 'Cnr Anzac Ave & Margaret St', 'enquiries@clubwyong.com.au', '0243597444', '', '', '0243512331', 'http://www.wyongrsl.com.au/', 'Club Wyong RSL was established in the 1950’s on its current site on the corner of Anzac Avenue and Margaret St as the Wyong RSL Club. \n\nThe Club provides a focal point for the area providing weekly activities, live entertainment, function facilities and a la carte restaurant.\n\nYou’ll find all the information you need right here including the latest promotions, upcoming entertainment as well as our club services and opening times.\n\nOur Services and Facilities\n- Meals at the Pioneers Family Restaurant\n- Keno Facilities \n- TAB facilities \n- Sky Racing \n- Foxtel \n- Bingo \n- Raffles \n\nMuch more exciting entertainment the whole family', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/clubwyongrsl/', 'https://twitter.com/ClubWyong', '', '', '', '', 'https://plus.google.com/110577733529998120874/about'),
  (108548, 'club-mudgee-108548', 'Club Mudgee', '', 'Club Mudgee located in Mudge provide its guests and members a wide range of services and facilities including bistro, wine bar, deli, bowls, function areas and many more.', 270443, '2016-04-11 23:32:31', '2016-04-28 05:20:34', '', 191, 124, 'rsl club\nbowling club\nsocial club', 270443, 0, '', 'info@clubmudgee.com.au', '0263721922', '', '', '0263724037', 'http://www.clubmudgee.com.au/', 'Club Mudgee is centrally located in the heart of Mudgee’s Central Business District on the corner of Perry and Mortimer Streets Mudgee. Club Mudgee proudly boasts that it''s “the place to be”. It''s Mudgee’s number one entertainment complex. Offering two bars, bistro, alfresco terrace, three function rooms, endless entertainment and promotions. – it really is Mudgee’s “place to be”.\n\nJoin our Club and you can enjoy the benefits of membership including entry into promotions, rewards programs, discounted prices on your food and beverage purchases and access to other great incentives available from time to time.\n\nClub Mudgee prides itself on providing their members and guests with a variety of “Whats on Events” includes Poker, Bingo , Bowls, Entertainment, Darts, Pool, Snooker, Raffles & Draws. Local & Sydney based live acts frequent the lounge bar every Fiday & Saturday night with free live shows in the Lounge bar from 8PM.\n\nClub Mudgee has two bowling greens which are used for play, the green-keeper puts a great deal of work into maintaining our greens so please play on them with care. Men''s, Ladies and mixed bowls are played at the Club on a regular basis\n\nClub Mudgee prides itself on welcoming families to the newly built children’s play room situated in the 99 on Mortimer bistro. Equipped with up-to date technology including 3 Playstation docks with games that are updated regularly, ABC for kids, CTV, Chalk Board, Books and soft play toys for all kids 2-13 years.\n\nClub Mudgee sees itself as an integral part of the local community being closely intertwined with a large variety of sporting and community organisations, it takes this role very seriously. Club Mudgee offers a range of facilities such as:\n\n•  Bowls\n•  Bistro\n•  Bingo\n•  Keno\n•  TAB\n•  Pool Table\n•  Darts\n•  Functions\n•  Poker\n•  Raffles\n•  Jukebox\n•  Snooker', 'A', '{"1":[[0.3958333333,0.9166666667]],"2":[[0.3958333333,0.9375]],"3":[[0.3958333333,0.9583333333]],"4":[[0.3958333333,0.9791666667]],"5":[[0.3958333333,0.0416666667]],"6":[[0.3958333333,0.0416666667]],"0":[[0.3958333333,0.9166666667]]}', 'https://www.facebook.com/clubmudgee/', 'https://twitter.com/clubmudgee', '', '', '', '', 'https://plus.google.com/114393313539162906571/about'),
  (108549, 'mink-hair-beauty-108549', 'Mink Hair & Beauty', '', 'Mink Hair & Beauty is located at Wagga Wagga and specialises in hair and beauty services. Mink Hair & Beauty offer hair cutting, hair colouring, hair styling and many more.', 270449, '2016-04-11 23:34:04', '2016-04-11 23:38:52', '', 191, 2793, 'beauty salon\nhair salon', 270449, 0, '', 'info@minkhairandbeauty.com.au', '0269251234', '', '', '', 'http://www.minkhairandbeauty.com.au/', 'Mink Hair & Beauty invites you to enter their salon and become the focus of their attention. Mink Hair & Beauty pride themselves on offering the highest level of hairdressing, beauty treatments and professional advice in a relaxed and comfortable atmosphere.\n\nMINK hair & beauty offers a quality standard of service whilst maintaining our commitment to the latest fashion trends in hair and ever evolving beauty treatments. Established in 2006, MINK maintains a "value for money" approach while delivering a unique and personal standard of service.\n\nWe consider a client of MINK hair & beauty is a client of our entire team - please feel free to request any one of our qualified stylists to look after your hair requirements. We completely understand if you feel like a change or your regular stylist is already booked, in fact we encourage you to experience as many of our different stylists talents as you desire!\n\nBeauty Services:\n• Facial Treatments\n• Specialised Skin Treatment Facials\n• Skin Rejuvenation\n• Essential Eyes\n• Hair Removal\n• Waxing\n• Hands & Feet\n• Tanning\n• Make-up\n• Body Treatments\n\nHair Services:\n• Hair Cutting\n• Styling & Design\n• Colour\n• Hair Treatments', 'A', '{"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.7291666667]],"6":[[0.3333333333,0.5833333333]]}', '', '', '', '', '', '', 'https://plus.google.com/+MinkHairBeautyTurveyPark/about'),
  (108550, 'condobolin-rsl-club-108550', 'Condobolin RSL Club', '', 'Condobolin RSL Club facilities include TAB, Keno, Sky & Fox channels, all for your enjoyment. Our first class Bistro offers a comprehensive menu to cater for lunch & dinner. ', 270461, '2016-04-11 23:42:50', '2016-04-11 23:44:39', '', 191, 2789, 'rsl club\nsocial club', 270461, 0, '', 'events@condobolinrslclub.com.au', '0268952113', '', '', '0268953418', 'http://www.condobolinrsl.com.au/', 'Welcome to Condobolin RSL Club. Our personalised service and extensive facilities will ensure your visit is one to remember. Our facilities include TAB, Keno, Sky & Fox channels, all for your enjoyment.\n\nOur first class Bistro offers a comprehensive menu to cater for lunch & dinner. Why not book your next function at Condobolin RSL! We cater for small and large groups & guarantee to make that special occasion one to remember.\n\nWe also provide a courtesy bus service to our Members, so join today & be rewarded.\n\nFunctions\nYou can meet in style at the Condobolin RSL Club conference centre. Our professional standards will guarantee a smoothly run conference in a relaxed atmosphere. Celebrate a life''s special moment & impress your family & friends by holding your special celebration in our well appointed rooms.\n\nLet our experienced function & catering team make your day everything you dreamed it to be. We have two comfortable meeting rooms to choose from, blue room or board room; both are air-conditioned & heated, with all facilities available such as white boards, projector screens etc.\n\nOur spacious open plan Auditorium is perfect for formal or informal receptions. This room boasts air conditioning, bar, elevated stage, large dance floor. This room can comfortably accommodate up to 350 seated guests.\n\nEntertainment\nOne of our entertainment lounges is located on the ground floor and is a hive of activity.\n\nPromotions such as Bingo & meat raffles are conducted on a regular basis.\n\nThe entertainment lounge boasts entertainment every weekend providing a diverse range of FREE Entertainment for members & guests.\n\nKick up your heels & dance the night away or settle in for a relaxed get together with friends. Australian top acts are regularly staged in the Club’s auditorium.', 'A', '{"1":[[0.4375,0.9166666667]],"2":[[0.4375,0.9166666667]],"3":[[0.4375,0.9583333333]],"4":[[0.4375,0.9583333333]],"5":[[0.4375,0.0416666667]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Condobolin-Rsl-Club-1126498927381567/', '', '', '', '', '', 'https://plus.google.com/101620216662329621926/about'),
  (108551, 'mhs-hair-studio-108551', 'MHS Hair Studio', '', 'MHS Hair Studio is located at Sunbury, Victoria and specialises in hair services. MHS Hair Studio offer hair cutting, hair styling, hair colouring and many more.', 270463, '2016-04-11 23:43:04', '2016-04-11 23:44:52', '', 191, 2787, 'hair salon\nhairdresser', 270463, 0, '', '', '0397404899', '', '', '', '', '', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.7291666667]],"6":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/mhshairstudio', '', '', '', '', '', 'https://plus.google.com/104865808937724687255/about'),
  (108554, 'lvrs-hair-salon-108554', 'LVRS Hair Salon', '', 'LVRS Hair Salon is located at South Yarra and specialises in hair services. LVRS Hair Salon offer hair styling, hair cutting, hair colouring, treatments and many more.', 270493, '2016-04-12 00:00:03', '2016-04-12 00:02:15', '', 191, 2780, 'hair salon\nhairdresser', 270493, 0, '', 'lvrshairsalon@gmail.com', '0398048117', '', '', '', '', 'Contemporary and minimal in its form, conveniently located just off Chapel Street, the LVRS experience is defined by its welcoming and positive vibe.\n\nAt LVRS Hair Salon we cater to an eclectic mix of people whose requests are as diverse as their personalities.\n\nLVRS Hair Salon draw our inspiration from travel, the fashion and art worlds and most importantly from people watching. This helps us cultivate an edge to ensure that our work is constantly changing and fresher than the rest.\n\nLVRS Hair Salon is directed by innovative hair stylist and colourist, Meika Khong. Meika has 9 years experience in the industry working for and managing some of Melbourne''s most iconic salons.\n\nThrough her progressive haircuts and experimentation of the colour palette, Meika will ensure your style is unique to you.', 'A', '{"2":[[0.4583333333,0.7916666667]],"3":[[0.4583333333,0.8333333333]],"4":[[0.4583333333,0.8333333333]],"5":[[0.4583333333,0.7916666667]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/lvrshairsalon', '', '', '', '', '', 'https://plus.google.com/101022096754596978459/about'),
  (108556, 'gulgong-rsl-club-108556', 'Gulgong RSL Club', '', 'Gulgong RSL Club & Andy''s Family Restaurant provides Catering, Venue Hire & Marquee available for weddings, parties, functions, conferences, meetings, training rooms.', 270515, '2016-04-12 00:15:10', '2016-04-12 00:15:53', '', 191, 2770, 'rsl club', 270515, 0, '', '', '0263741310', '', '', '', 'http://www.gulgongrsl.com.au/', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', '', 'https://twitter.com/gulgongrsl', 'https://www.linkedin.com/company/gulgong-rsl-club', '', '', '', ''),
  (108558, 'narromine-united-services-memorial-club-108558', 'Narromine United Services Memorial Club', '', 'Narromine United Services Memorial Club facilities includes conference rooms for up to 250 people perfect for any functions to celebrate, private bar facilities, cocktail lounge, Pool tables and more.', 270529, '2016-04-12 00:29:29', '2016-04-12 00:33:21', '', 191, 2764, 'rsl club\nsocial club', 270529, 0, '', '', '0268894288', '', '', '', 'http://www.narromineusmc.com.au/', 'The United Services Memorial Club was built at Narromine in 1947. USMC can comfortably accommodate a total of 800 guests. 300 guests downstairs 2 x 250 patrons upstairs.\n\nRamp access from both the street and ramp access to the entrance of the club are available.  Elderly and Disabled bathroom amenities are available on the ground floor next to reception.\n\nThe Narromine USMC has a large variety of facilities to make your visit a comfortable, entertaining experience. With our weekly activities, events, restaurant, live entertainment and TAB there is no shortage of things to do. \n\nAre you are looking for somewhere out of the heat for a cool refreshing drink or have a hot tip on the track ? Maybe you just need a cappuccino from the cafe or indulge in a delicious meal from The Flight Deck. There is something at the club for the whole family to do.\n\nFacilities Includes:\n•  4 function or 6 Meeting conference rooms configured to your requirements.\n•  Facilities for 10 - 250 people\n•  in each of the function rooms.\n•  Private Bar facilities available\n•  Cocktail Lounge\n•  Disabled toilets available\n•  Access ramps\n•  Live Entertainment\n•  Pool Tables\n•  Enclosed outdoor smoking areas.\n•  Bingo, Keno, Tab, Trackside,\n•  All modern conference and meetings facilities,with audio visual equipment and projectors.\n•  Full bar service available\n•  Full catering or for any occasion, tailored to your requirements\n•  Self Catering also available.\n•  Reasonable room hire costs\n•  Conveniently located in central Narromine.\n', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4166666667,0.9375]],"6":[[0.4166666667,0.9375]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (108559, 'solitude-beauty-and-wellbeing-108559', 'Solitude Beauty and Wellbeing', '', 'Solitude Beauty and Wellbeing is located at Maffra, Victoria and specialises in beauty services. Solitude Beauty and Wellbeing offer laser hair removal, skin rejuvenation, manicure and many more.', 270531, '2016-04-12 00:31:11', '2016-04-12 00:33:26', '', 191, 2763, 'nail salon\nlaser clinic\npedicure\nbeauty therapy', 270531, 0, '', 'solitudebeautyandwellbeing@gmail.com', '0351411466', '', '', '', '', '', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.8333333333]],"3":[[0.375,0.75]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.75]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/solitudebeauty', '', '', '', '', '', ''),
  (108561, 'vivid-hair-design-108561', 'Vivid Hair Design', '', 'Vivid Hair Design is located at Glen Waverly and specialises in hair services. Vivid Hair Design offer hair design, hair styling, hair cutting and hair colouring.', 270555, '2016-04-12 00:51:24', '2016-04-12 00:55:50', '', 191, 2757, 'hair salon\nhairdresser', 270555, 0, '', '', '0398031510', '', '', '', '', '', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.75]],"6":[[0.375,0.5833333333]]}', 'https://www.facebook.com/vividhairglenwaverley', '', '', '', '', '', 'https://plus.google.com/113405767965013756912/about'),
  (108562, 'orange-ex-services-club-108562', 'Orange Ex-Services'' Club', '', 'Orange Ex-Services'' Club located in Orange provide its guests and members a wide range of services and facilities including pool and leisure, tennis complex, bowling greens, dining and many more.', 270557, '2016-04-12 00:51:46', '2016-04-28 06:15:24', '', 191, 72, 'rsl club\nbowling club\nsocial club', 270557, 0, '', 'enquiries@oesc.com.au', '0263622666', '', '', '0263613916', 'http://www.oesc.com.au/', 'Orange Ex-Services’ Club''s philosophy is a simple one, our club, our community, our commitment. This commitment to empathy and compassion is supported by implementing socially responsible and sustainable business practices. On behalf of the Board of Directors, management and staff I would like to welcome you and I invite you to visit our Club and hope you enjoy all that the Club has to offer!”\n\nOrange Ex-Services'' Club''s mission is to be the leading club in the Central West of NSW, committed to the delivery of excellence in customer service and facilities for the benefit of our members and community in a responsible, professional and sustainable manner.', 'A', '{"1":[[0.3541666667,0.9791666667]],"2":[[0.3541666667,0.9791666667]],"3":[[0.3541666667,1]],"4":[[0.3541666667,0.0833333333]],"5":[[0.3541666667,0.0833333333]],"6":[[0.3541666667,0.0833333333]],"0":[[0.3541666667,1]]}', 'https://www.facebook.com/orangeexservicesclub', '', '', '', '', '', 'https://plus.google.com/109942729532857482415/about'),
  (108563, 'parkes-services-club-108563', 'Parkes Services Club', '', 'Parkes Services Club ffer professional service, flexible menus, competitive prices and a perfect venue for your important functions. We offer facilities for all types of events.', 270573, '2016-04-12 00:58:33', '2016-04-12 01:00:49', '', 191, 2753, 'rsl club\nsocial club', 270573, 0, '', 'parkesservicesclub@bigpond.com', '0268621966', '', '', '0268621955', 'http://www.parkesservicesclub.com.au/', 'Welcome To The Parkes Services Club\n\nWhether you are planning a wedding, a corporate event, a casual meal or get-together with friends & family, the Parkes Services Club is the place for you.  We can offer professional service, flexible menus, competitive prices and a perfect venue for your important functions. We offer facilities for all types of events.  Our flexible function space can cater for small meetings to large seminars or weddings of over 300 guests. \n\nThe Parkes Services Club offers facilities for all types of events. Our flexible function space can cater for small meetings to large seminars of over 300 guests.  Our corporate clients find these venues suitable for meetings training courses, cocktail functions and product launches. Our venue is also popular for private functions including weddings, birthdays, engagements, presentations and fundraising events.\n \nThe Dining by the Park Bistro is open for lunch and dinner providing meals to tempt the taste buds from our black board daily specials to our extensive Club Menu.  We also cater for special dietary requirements.  We also have a special menu for the kids and families are always welcome!\n \nJust behind the Club’s main bar is the TAB with its own private smoking area for those punters who can enjoy a cigarette without missing their race.  The TAB boasts a self serve terminal that provides all the latest information that any punter requires.\n \nThe Club provides free parking with two large car parks at the rear of the building.  Both car parks have entry and exit access making them ideal for coaches.\n \nWe are located across from scenic Cooke Park and are within walking distance to a number of Motels and the Railway Station.\n \nEnjoy premium service from our dedicated and friendly staff whilst you entertain in stylish surroundings.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/parkesservicesclub', '', 'https://www.linkedin.com/company/parkes-services-club', '', '', '', 'https://plus.google.com/u/0/101227768797408057408/about'),
  (108566, 'marzi-hairdressing-108566', 'Marzi Hairdressing', '', 'Marzi Hairdressing is located at Oakleigh and specialises in hair services. Marzi Hairdressing offer hair cutting, hair styling, hairdressing and hair colouring.', 270599, '2016-04-12 01:34:05', '2016-04-12 01:36:28', '', 191, 2745, 'hair salon\nhairdresser', 270599, 0, '', '', '0395698265', '', '', '', '', '', 'A', '{"2":[[0.4166666667,0.75]],"3":[[0.4166666667,0.75]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.7916666667]],"6":[[0.3541666667,0.6666666667]]}', 'https://www.facebook.com/Marzi-Hairdressing-212233572131192', '', '', '', '', '', ''),
