  (108569, 'sp-salon-108569', 'SP Salon', '', 'SP Salon is located at Malvern East and specialises in hair services. SP Salon offer hair cutting, hair colouring, hair styling, hair extensions and many more.', 270613, '2016-04-12 01:52:04', '2016-04-12 01:53:45', '', 191, 2741, 'hair salon\nhairdresser', 270613, 0, '', 'spsalonhair@gmail.com', '0398869496', '', '', '', '', '', 'A', '{"2":[[0.4166666667,0.75]],"3":[[0.4166666667,0.75]],"4":[[0.4166666667,0.8333333333]],"5":[[0.4166666667,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/SP-Salon-177337825609665', '', '', '', '', '', ''),
  (108570, 'republika-salon-108570', 'Republika Salon', '', 'Republika Salon is located at Bentleigh East. Republika Salon caters to all your hair and beauty needs. Using certified organic products to leave your hair and body gorgeous and stress free', 270631, '2016-04-12 02:06:29', '2016-04-12 02:09:49', '', 191, 2735, 'hair salon\nhairdresser', 270631, 0, '', '', '0395701234', '', '', '', 'http://www.republikasalon.com/', 'Republika Salon was born due to a lack of natural and organic salons available to people like me & you!\n\nAt Republika Salon we commit to providing unparalleled excellence in service and products. Using only natural and organic products with zero useless substances in a relaxed and pampering environment. Republika Salon- for the people who care about their hair.\n\nRepublika Salon will style you, primp you, preen you with the latest hair colours & cuts.\n\nRepublika Salon won''t have you subjected to all the harsh chemicals that are usually so common within hair salons!\n\nRepublika Salon Services:\n• Restyle Cut & Blow Wave\n• Hair Up\n• Blow Wave\n• Men''s Style Cut\n• Colour\n• Toner\n• Styling', 'A', '{"2":[[0.4166666667,0.7291666667]],"3":[[0.4166666667,0.8333333333]],"4":[[0.4166666667,0.8541666667]],"5":[[0.4166666667,0.7291666667]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/republikasalon', 'https://twitter.com/rachies_711', '', '', '', '', ''),
  (108571, 'wellington-soldiers-memorial-club-108571', 'Wellington Soldiers Memorial Club', '', ' Wellington Soldiers Club is a modern Indoor Sports Complex with squash courts, sauna rooms and all indoor sports facilities including a modern gym. It is a popular facility for our members & guests.', 270639, '2016-04-12 02:17:43', '2016-04-12 02:20:11', '', 191, 2733, 'rsl club\nsocial club', 270639, 0, '', 'admin@wellingtonsoldiers.com', '0268452877', '', '', '', 'http://www.wellingtonsoldiers.com.au/', 'The Wellington Soldiers Club was formed on the 29th of November 1947 when a small group of Returned Servicemen met at the School of Arts building in Swift Street with the idea of forming a Club to cater for the needs of Ex-Servicemen and their families. The Club used the School of Arts building until 1961, when they moved into the present Club in Arthur Street.\n\nThe Club caters for all the people of Wellington, as well as the out of town guests. It is the social centre of our town and is the meeting place for the young and not so young.\n\nAdjoining the Club is a modern Indoor Sports Complex with squash courts, sauna rooms and all indoor sports facilities including a modern gym. It is a popular facility for our members and the general public.\n\nSo when in Wellington come and enjoy the friendly service and country hospitality. From Its internationally renowned Limestone Caves, to its friendly and hospitable atmosphere, Wellington is a town with so much to offer.', 'A', '{"1":[[0.4166666667,0.8958333333]],"2":[[0.4166666667,0.8958333333]],"3":[[0.4166666667,0.8958333333]],"4":[[0.4166666667,0.8958333333]],"5":[[0.4166666667,0.8958333333]],"6":[[0.4166666667,0.8958333333]],"0":[[0.4166666667,0.8958333333]]}', 'https://www.facebook.com/WellingtonSoldiersMemorialClub', '', '', '', '', '', ''),
  (108572, 'mooney-mooney-club-108572', 'Mooney Mooney Club', '', 'Mooney Mooney Club nestled on the shores of the Hawkesbury River is a perfect place to celebrate your special occasion or enjoy a mid-weak meal or laze away in an elegant atmosphere. ', 270641, '2016-04-12 02:20:48', '2016-04-28 03:20:02', '', 191, 156, 'social club', 270641, 0, '', 'mmreception@rwc.org.au', '0299859244', '', '', '', 'http://www.mooneymooneyclub.com.au/', 'The Mooney Mooney Club was established in 1971 and in February 2003 went into voluntary administration. A General Meeting was held in April 2003 where members voted overwhelmingly in favour of amalgamation, and on the 1st April 2004, the Mooney Mooney Club became part of the Revesby Workers’ Group.\n\n2007 saw a major $2.5m redevelopment of the Club, followed by more renovations in 2011 to make Mooney Mooney the destination it is today.\n\nNestled on the shores of the Hawkesbury River, with views across to Brooklyn, you’ll find the tranquil setting of Mooney Mooney Club. Kick back on our large open-air balconies and enjoy the idyllic riverside location.\n\nApart from its serene waterside setting, Mooney Mooney Club is best known for its restaurant Coastal Dining – the perfect place to celebrate a special occasion, enjoy a mid-week meal or laze away a Sunday afternoon in an elegant yet relaxed atmosphere.\n\nThe Club’s other facilities include a lounge area with bar meals and snacks, kids playground, lawn bowls and even a courtesy bus to get you here and home again.\n\nThe Club also boast its own wharf facilities so patrons can take full advantage of this cruising mecca and call in by boat for lunch, dinner and drinks or even stock up on takeaway food and beverage supplies.', 'A', '{"1":[[0.4583333333,0.875]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4583333333,0.875]]}', '', '', 'https://www.linkedin.com/company/mooney-mooney-club', '', '', '', ''),
  (108573, 'silk-hair-body-108573', 'Silk Hair & Body', '', 'Silk Hair and Body is located at Mount Waverly and specialises in hair and body services. Silk Hair and Body offer styling, colour, spray tan and many more.', 270653, '2016-04-12 02:24:29', '2016-04-12 02:27:04', '', 191, 2729, 'hair salon\nbeauty therapy', 270653, 0, '', 'silk@silksalon.com.au', '0398882408', '', '', '', 'http://www.silksalon.com.au/', 'Our philosophy at Silk Hair and Body is about looking after you, ensuring your visit is a calming indulgence from your everyday activities. We are dedicated to providing excellence in all our services with superior personalised service.\n\nSilk Hair and Body''s professional team share immense knowledge in the hair & beauty industry, to give you skilled expertise for today’s lifestyles.\n\nSilk Hair and Body is a Joico colour boutique salon and embraces “The Art of Healthy Hair”.\n\nTo ensure your visit is complete visit our Beauty Therapist Gina Morgan of "Your Look Starts With Me" in her newly refurbished beauty rooms at Silk.\n\nSilk Hair and Body Services:\n• Spray Tan \n• Waxing\n• Tinting\n• Cut & Blow Wave\n• Formal Up\n• Treatment &Toner\n• Colour Correction\n• Hair Extensions\n• Foil Design\n• Hair Straightening', 'A', '{"2":[[0.3958333333,0.7916666667]],"3":[[0.3958333333,0.7083333333]],"4":[[0.3958333333,0.875]],"5":[[0.3958333333,0.75]],"6":[[0.3541666667,0.6666666667]]}', 'https://www.facebook.com/Silk-Hair-and-Body-144142188961903', '', '', '', '', '', ''),
  (108574, 'adelong-services-citizens-bowling-club-108574', 'Adelong Services & Citizens Bowling Club', '', 'Here at Adelong Services and Citizens and Bowling club, we have a Chinese Restaurant. We can also cater for any type of functions such as birthday, weddings, seminars and trainings.', 0, '2016-04-12 02:27:09', '2016-04-18 07:20:24', '', 191, 1563, 'rsl club\nsocial club', 0, 0, '', '', '0269462163', '', '0407242752', '0269462445', 'http://www.adelongservicesclub.com.au/', 'The name Adelong was taken from an Aboriginal language and means "along the way". Many European explorers passed through Adelong in its early days, but the town didn''t really come alive until gold was discovered in large quantities in 1857.\n\nThis unique heritage-listed township has a rich gold mining past. Over 25 tonnes of gold was mined from 1857 to the close of the mine in 1914. Stroll along tree lined streets and enjoy the country village lifestyle and warm hospitality. Visit the galleries, gift emporium, old wares and antique shops. Take tea in leafy garden settings, and dine in style in heritage-listed buildings.\n\nThe famous Adelong Falls, with its rich gold-mining past, is an ideal spot to have a leisurely picnic or to explore the unique surrounding area.\n\nAdelong''s importance in Australia''s early mining history has been recognised by the National Trust of Australia with a large section of the main street as well as a number of impressive early buildings being classified.', 'A', '{"2":[[0.5,0.5833333333],[0.75,0.875]],"3":[[0.5,0.5833333333],[0.75,0.875]],"4":[[0.5,0.5833333333],[0.75,0.875]],"5":[[0.5,0.5833333333],[0.75,0.875]],"6":[[0.5,0.5833333333],[0.75,0.875]],"0":[[0.5,0.5833333333],[0.75,0.875]]}', '', '', '', '', '', '', ''),
  (108575, 'salon-vogue-108575', 'Salon Vogue', '', 'Salon Vogue is located at Werribee and specialises in hair and beauty services. Salon Vogue offer hair cutting, hair styling, hair colouring, balayage and many more.', 270673, '2016-04-12 02:34:41', '2016-04-12 02:35:41', '', 191, 2727, 'beauty salon\nhair salon\nhairdresser', 270673, 0, '', '', '0397411319', '', '', '', '', '', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.75]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/Salon-Vogue-Hair-130252397012744', '', '', '', '', '', 'https://plus.google.com/103149789999878644134/about'),
  (108577, 'hay-services-club-108577', 'Hay Services Club ', '', 'Hay Services Club at Murray Street. Come and enjoy a beer or a coffee at our friendly club. Try your luck with some keno. We would love to see you there!', 0, '2016-04-12 02:42:33', '2016-04-12 02:44:12', '', 191, 2719, 'rsl club\nsocial club', 0, 0, '', '', '0269931206', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/HAY-Services-CLUB-576546495789587', '', '', '', '', '', ''),
  (108578, 'sapphire-essence-108578', 'Sapphire Essence', '', 'Sapphire Essence is located Docklands and specialises in hair and beauty services. Sapphire Essence offer hair styling, hair cutting, hair colour and many more.', 270717, '2016-04-12 02:51:23', '2016-04-12 02:53:47', '', 191, 2710, 'beauty salon\nhair salon', 270717, 0, '', 'salon@sapphireessence.com.au', '0396024026', '', '', '', 'http://www.sapphireessence.com.au/', 'Sapphire Essence is the newest, trendiest Hair styling business situated within the docklands. Style is our middle name and colour is our forte. \n\nSapphire Essence now have so much more to spoil you with. This studio caters to both women and men and features designer styles and cuts, the latest colour tends and treatments to keep your hair vibrant and beautiful. You can now come to one place to get yourself looking the part close to your working environment. Look your best for that corporate meeting or function. Have the chance to be catered to while you relax to our soothing jazz music with a glass of bubbles in your hand, all part of the service. \n\nFor the men who wish to impress, come in to see Sapphire Essence for a style, cut and wash, you may choose to have a head massage while your at it. Look and feel brand new when you leave our salon. The new products we use are the best in the world, voted by thousands of salon customers around the globe. Come on in and experience for your self the decadence of a true salon excursion.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/SapphireEssence', '', '', '', '', 'https://www.pinterest.com/sapphireessence/', 'https://plus.google.com/105162418743692288312/about'),
  (108579, 'junee-ex-services-memorial-club-108579', 'Junee Ex- Services Memorial Club', '', 'Junee Ex- Services Memorial Club provides an ideal venue for all types of functions. With four function rooms we can cater for your wedding, conference or private party.', 270719, '2016-04-12 02:51:30', '2016-04-12 02:53:26', '', 191, 2712, 'rsl club\nsocial club', 270719, 0, '', 'jemc@jemc.com.au', '0269241577', '', '', '0269241600', 'http://www.juneeexservices.com/', 'The Perfect Venue for Every Occassion\n \nThe Junee Ex- Services Memorial Club provides an ideal venue for all types of functions. With four function rooms we can cater for your wedding, conference or private party. We pride ourselves on making your function a special and memorable event for all.\n\nEnjoy your favourite tunes every Friday night with free live entertainment playing in the Main Bar. \n\nLunch and Dinner specials available throughout the week.  Taking the family out for dinner has never been so affordable.\n\nThe Junee Ex- Services Club has activities to suit every age group; lawn bowls, darts and snooker are just a few of the many options we provide to members.  We guarantee, there''s something for everyone.\n\nMembers are eligible to receive discounted prices on drinks, room hire, shows and more!\n\nLet us be the first venue you contact for:\n \n•  Birthday parties\n•  Weddings\n•  Christenings\n•  Wakes\n•  Seminars\n•  Meetings \n•  Training Days\n•  Presentation nights\n•  Sporting dinners\n•  Christmas parties\n•  Conferences\n•  Graduation balls\n•  Debutant balls\n•  Private dinners/lunches\n•  School formals\n•  Theme Nights\n•  Retirement dinners\n•  Farewell Dinners\n ', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/JuneeExServicesClub/', '', '', '', '', '', ''),
  (108580, 'leeton-soldiers-club-108580', 'Leeton Soldiers Club', '', 'Leeton Soldiers Club are able to cater to functions up to 500 people. Perfect venue for Weddings and private functions. We are able to cater for corporate functions and meetings at all levels.', 270731, '2016-04-12 03:04:54', '2016-04-12 03:06:23', '', 191, 2706, 'rsl club\nsocial club', 270731, 0, 'Cnr Acacia & Yanco Ave', 'manager@leetonsoldiers.com.au', '0269533444', '', '', '026953363', 'http://leetonsoldiers.com.au/', 'Leeton Soldiers Club was formed in 1940 by a group of dedicated ex-servicemen. The Club started in humble circumstances in what was formerly the Allanbrook Hospital. All work was done voluntarily in the early days.\n\nIn early 1948 the original building burnt down leaving members without a Club until April 1949 when a new building was constructed in its present position.\n\nSince then our Club has grown in strength and size. We are now a modern, well-appointed Club able to provide Visitors, Members and their Guests with a wide range of facilities.\n\nAlthough we have grown and changed we are proud of our heritage and uphold the traditions of our RSL past.\n\nThe Leeton Soldiers Club are able to cater to functions up to 500 people. The Stan Axtill Centre is the perfect venue for Weddings and private functions. Separate from the main building the Axtill Centre seats up to 150.It has separate catering facilities, has a fully stocked and serviced bar. Rental on all function facilities includes the provision of staff.\n\nThe Regency Room is ideal for smaller functions and meetings up to 50. Catering can be arranged in-house and bar service is provided. Rapps is a great function room, able to seat 120. Rapps has a DJ System and fully stocked and serviced bar. Ideal for medium sized functions, Rapps is the perfect party venue.\n\nThe Clubs Auditorium is situated adjacent to Rapps. With a seating capacity of 500, the Auditorium is a fantastic place for larger functions. Once again full bar and catering facilities are provided in-house. The Auditorium has been the venue for many visiting performers, comedians, politicians etc. We are able to cater for corporate functions and meetings at all levels.\n\nFunctions\nThe Leeton Soldiers Club can cater for a variety of functions including 21st birthdays, wedding anniversaries, birthday parties, kids parties, presentation nights, graduations, gala dinners and reunions. We offer a range of decor and catering options to suit any budget or style.\n\nFor more information on functions please contact The Club on (02) 6953 3444 or email info@leetonsoldiers.com.au\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Leeton-Soldiers-Club-229538810168/', 'https://twitter.com/leetonsoldiers', 'https://www.linkedin.com/in/leeton-soldiers-club-4718445a', '', '', '', 'https://plus.google.com/101729249155891607370/posts'),
  (108581, 'mosman-rowers-108581', 'Mosman Rowers', '', 'Mosman Rowers is a prime heritage waterfront location in Mosman bay offering modern stylish cuisine in the Member’s Bar on ground floor, Italian restaurant excellent meeting room and many more.', 270737, '2016-04-12 03:06:38', '2016-04-12 03:10:54', '', 191, 2704, 'social club', 270737, 0, '', 'info@mosmanrowers.com.au', '0299537966', '', '', '', 'http://mosmanrowers.com.au/', 'Mosman Rowers offer modern stylish cuisine in the Member’s Bar on ground floor. The Italian restaurant Presso La Baia is open for dinner Monday to Friday from 6pm, breakfast and brunch on weekends from 8am and for function bookings every day of the week by appointment. We also have an excellent meeting room for discrete business or board meetings, for a nominal fee you can host your meetings at one of Sydney’s best waterfront locations.\n\nCome to the Mosman Rowers and relax by the water.  With its lovely balcony vista overlooking the bay the Mosman Rowers boasts a prime heritage waterfront location just a short ferry ride from Circular Quay\n\nOur club promotes family and community values, and as such there are no poker machines on premises which means you are more than welcome to bring your kids along. We have handmade Gelato now from Gelato Cart too – so it is the perfect spot to drop in to with the kids.\n\nWe have a courtesy bus that is available to pick you up and drop you home to any local destination. We run the courtesy bus every evening, but should you wish to be picked up to come down to the Club please book the day before. A $5 donation to the Clubs Building Fund is appropriate.\n\nAnyone can come to the Club, you do not need to be a member. Simply sign in at the bar on arrival. We love new members too, simply go to the Membership Page and sign up. Membership entitles you to a 10% discount of food and beverages at every visit, on presentation of your membership card.  You are also then eligible to win the Member’s Badge Draw and you will receive vouchers to use at the Club.\n', 'A', '{"1":[[0.4583333333,0.875]],"2":[[0.4583333333,0.875]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/MosmanRowersAtMosmanBay', 'https://twitter.com/MosmanRowersLtd', 'https://www.linkedin.com/company/mosman-rowers', '', '', '', ''),
  (108582, 'myabi-hair-design-108582', 'Myabi Hair Design', '', 'Myabi Hair Design is located at Dinner Plain and specialises in hair services. Myabi Hair Design offer hair cutting, hair styling, hair design and many more.', 270753, '2016-04-12 03:12:21', '2016-04-12 03:15:11', '', 191, 2698, 'beauty salon\nhair salon', 270753, 0, '', 'info@myabi.com.au', '0351508805', '', '', '', 'http://www.myabi.com.au/', 'At Myabi Hair Design we strive to not only make you look beautiful but feel beautiful with genuine care and professionalism. In the world of beauty the journey is as important as the end result, so we pursue the artistic challenge to perfect your look every single time. By choosing to work with Aveda, we are helping to sustain our beauty industry with a company that cares for the well being of you and the world.\n\nMyabi Hair Design''s philosophy is customised creativity with a boutique one on one experience. Our innovative stylist will create a look that caters for you and your lifestyle. After a thorough consultation, enjoy a complimentary sensory journey using natural essential oils and a stress-relieving head and shoulder massage before your service.\n\nMyabi Hair Design''s pampering salon services that combine beauty, well being for both men and women and the respect of the environment. Myabi offers you everything in the way of modern hair styling and relaxation.\n\nMyabi Hair Design Services:\n• Hair cut & styling \n• Hair treatment \n• Hair Colour \n• Aveda facials \n• Makeup\n• Wedding Services\n• Tinting', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/MyabiHairDesign', '', '', '', '', '', ''),
  (108583, 'narrandera-ex-servicemen-s-club-108583', 'Narrandera Ex-Servicemen''s Club', '', 'Narrandera Ex-Servicemen''s Club has great facilities such as 3 Function rooms for Parties and Weddings. TAB, Keno, Poker on Friday night''s, Club Bingo twice a week and a full room of Gaming Machines.', 270765, '2016-04-12 03:16:17', '2016-04-12 03:17:48', '', 191, 2696, 'rsl club\nsocial club', 270765, 0, '', '', '0269591266', '', '', '', 'http://www.narranderaexies.com.au/', 'The facilities are Excellent at the Narrandera Ex-Servicemen''s Club.  This Club is the Best in town and can cater for all types of Functions like Weddings, Parties, Balls, Dances, in the 3 spacious venues within the Club.\n \nGreat Club with all you could ask for, cold beer, great wine list, top Bistro for many events that you may require, 3 Function rooms for Parties and Weddings. TAB, Keno, Poker on Friday night’s, Club Bingo twice a week.\n\nThe three main function rooms have seating for smaller functions of 50 up to 400 in the Auditorium.  Catering is available in all our Functions Rooms.\n\nWe are the No 1 Corporate function venue in Narrandera providing a range of services including data projectors and Wifi.\n\nEXCellent Food and Services\nThe food is Excellent at Exies. Our Chef Jessy and his team will cook to order from a large and diverse menu. Modern cuisine prepared by skilled chefs plus lots of your favourites to choose from as well as some new and exciting dishes to tickle your tastebuds.\n\nEXCellent Facilities\nWe are the No 1 Corporate function venue in Narrandera providing a range of services including 3 main function rooms, data projectors and unlimited WiFi. Call in today to see our newly renovated JB Driscoll Function Room or call Sarah on 6959 1266.\n\nEXCellent Entertainment\nThe entertainment is Excellent at the Exies. Free live entertainment every Saturday Night with some great shows coming up.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/Narrandera-Exies-550199445014993/', '', '', '', '', '', 'https://plus.google.com/103536946968580703394/about'),
  (108585, 'tarcutta-rsl-and-citizens-club-108585', 'Tarcutta RSL and Citizens Club', '', 'Tarcutta R.S.L. & Citizens Club has a very spacious dining room, social room, billiard room, poker machines, bowling green and a squash court and available for special functions, meetings and events.', 0, '2016-04-12 03:24:19', '2016-04-12 03:25:14', '', 191, 2693, 'rsl club\nsocial club', 0, 0, '', '', '0269287109', '', '', '', 'http://www.tarcutta.com.au/rsl-citizens-club/', 'The Tarcutta R.S.L. & Citizens Club a social gathering place for the locals and an excellent venue for travellers.  It is operated by the local community and has a very spacious dining room, social room, billiard room, poker machines, bowling green and a squash court.\n\nFriday night is raffle night and many of the town folk come to enjoy a social evening and try their luck.\n\nMeals are available on Friday nights, and are renowned for being the best Chinese Meals on the Hume.\n\nThe Club is available for special functions, meetings and events.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/tarcutta.rsl', '', '', '', '', '', 'https://plus.google.com/101721161931845922786/about');
