  (108586, 'chambre-luxe-organic-hair-beauty-108586', 'Chambre Luxe Organic Hair & Beauty', '', 'Chambre Luxe Organic Hair & Beauty is located at Essendon and specialises in hair and beauty services. Chambre Luxe Organic Hair & Beauty  offer makeup, hair styling, hair cutting, hair extensions.', 270785, '2016-04-12 03:28:19', '2016-04-12 03:30:07', '', 191, 2687, 'beauty salon\nhair salon\nnail salon\npedicure', 270785, 0, '', 'chambreluxe101@hotmail.com', '0393757018', '', '', '', 'http://www.hair-salon-essendon.com/', 'Welcome to Chambre Luxe Organic Hair & Beauty in Essendon (just minutes from Essendon train station), indulge yourself in our salon with our professional hair stylists as you receive the best inspiring and dedicated hair and beauty service available. \n\nAt Chambre’ Luxe Organic Hair & Beauty we guarantee you a smile, a relaxing environment, the highest quality of treatments and a hygienically clean salon. \n\nChambre Luxe Organic Hair & Beauty promise: we will only recommend you products that will benefit your skin and hair. We offer a full range of Natural/Organic Hair Services. We will never compromise your health, using only the best natural alternatives delivering outstanding results. Guaranteed!\n\nHair Services:\n• Hair Cuts for Ladies, Men and Children\n• Blow Wave\n• Hair Extensions\n• Hair Tint\n• Hair Foil\n• Hair Treatments\n• Spray Tanning\n\nBeauty Services:\n• Waxing for Female and Male\n• Facial\n• Eye Lash Extension\n• Lash & Brow \n• Massage\n• Nail Bar\n• Detox Wrap\n• Makeup', 'A', '{"1":[[0.3958333333,0.7291666667]],"2":[[0.3958333333,0.8333333333]],"4":[[0.3958333333,0.8333333333]],"5":[[0.3958333333,0.7291666667]],"6":[[0.3333333333,0.6458333333]]}', 'https://www.facebook.com/ChambreLuxeHairAndBeauty', '', '', '', '', '', 'https://plus.google.com/111998261753494265954/posts'),
  (108587, 'temora-ex-services-memorial-club-108587', 'Temora Ex-Services Memorial Club', '', 'Temora Ex-Services Club is able to cater for your conferences, functions or venues, whatever size it may be. From a small meeting to a large conference. Facilities includes Bistro, Bar and TAB lounge.', 270799, '2016-04-12 03:33:57', '2016-04-12 03:35:53', '', 191, 2685, 'rsl club\nbowling club\nsports club\nsocial club', 270799, 0, '', 'admin@temoraexservices.com.au', '0269774177', '', '', '0269780', 'http://temoraexservices.com.au/', 'The first Ex-Services club was initially formed prior to the 1950′s. The club met regularly where the Waratah Café is currently situated in Hoskins Street, Temora. Unfortunately, in those days it was difficult to obtain a liquor license which left the Club no option but to close down.\n\nThen on 14th August 1955, a meeting was called to reform the Club, with a view to obtain a liquor license. The president of the then RSL Sub-Branch in Temora chaired the meeting with 17 members present. That day it was moved and passed that the Club reform and the first committee was formed.\n\nIn December of 1956, a liquor license was finally obtained and the Club’s committee arranged to borrow six Poker Machines from another club in Wagga Wagga, just in time for Christmas. Needless to say, there was cause for much celebration and the beer flowed freely during the festive season!\n\nFrom that time on the Temora Ex-Services Memorial Club has steadily grown in it’s membership numbers and has gone from strength to strength within our small community.\n\nThroughout the years the Club has always held a strong position in Temora and has endeavored to support our town by sponsoring many sporting clubs and social groups, as well as striving to become Temora’s leading entertainment venue.\n\nCurrently the Temora Ex-Services Memorial Club maintains four function rooms and three commercial kitchens which are utilized by the Club and many members of the Temora and district’s community. We also run a number of social activities such as the Friday evening Golden Gifts and the Tuesday Club Draws, which are enjoyed by many members and visitors alike.\n\nThe Ex-Services Bowling Green is also very popular with those who enjoy it’s facilities, and many patrons like to relax to a quiet drink in one of the many bars Temora Ex-Services Club has.', 'A', '{"1":[[0.4166666667,0.9791666667]],"2":[[0.4166666667,0.9791666667]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/temoraexservices/', '', '', '', '', '', ''),
  (108589, 'narooma-golf-club-108589', 'Narooma Golf Club', '', 'Narooma Golf Club is located at Narooma and provide the perfect venue for business meetings, luncheons, training days or conferences.', 270835, '2016-04-12 03:59:21', '2016-04-27 05:31:18', '', 191, 419, 'golf club', 270835, 0, '', 'enquiries@naroomagolf.com.au', '0244762522', '', '', '0244762016', 'http://www.naroomagolf.com.au/', 'Narooma Golf Club clubhouse features some of the most spectacular views in Australia.”Breathtaking scenery and dramatic golf – these words encapsulate what Narooma Golf Club has to offer.”\n\nOur modern facilities, unique location and stunning ocean combine to make the Narooma Golf Club the perfect venue for the perfect coastal wedding – or any other functions, meetings, training days or conferences.\n\nA range of versatile function rooms are available and the award-winning catering department have a wide array of menus for your perusal. And our function coordinator is on hand every step of the way to make your wedding or function as successful and stress free as possible.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Narooma-Golf-Club-180743556287/', 'https://twitter.com/naroomagolfclub', 'https://www.linkedin.com/company/narooma-golf-club', '', '', '', 'https://plus.google.com/110773606363003100801/about'),
  (108591, 'narooma-sporting-services-club-group-108591', 'Narooma Sporting & Services Club Group', '', 'Narooma Sporting & Services Club Group incorporates the Club Dalmeny and Club Narooma. These clubs offer superb choice in dining, sporting & entertainment facilities on the South Coast.', 270855, '2016-04-12 05:19:59', '2016-04-12 05:25:51', '', 191, 2665, 'sports club', 270855, 0, '', 'reception@naroomaclub.net.au', '0244762135', '', '', '0244761486', 'http://www.clubnarooma.com/', 'Narooma Sporting & Services Club Group incorporates Club Narooma and Club Dalmeny. These two great Clubs offer superb choice in dining, sporting and entertainment facilities on the south coast.\n\nDining & Functions \n• Terrace Bar & Grill Menus @ Club Narooma\n• Lake View Grill Menus @ Club Dalmeny\n• Function Menus', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Club-Narooma-149593361830992/', '', '', '', '', '', 'https://plus.google.com/106393325500801243930/about'),
  (108593, 'serene-hair-and-beauty-lounge-108593', 'Serene Hair and Beauty Lounge', '', 'Serene Hair and Beauty Lounge is located at Kensington Park and specialises in hair and beauty services. Serene Hair and Beauty Lounge offer waxing, pedicure, tanning and makeup.', 270877, '2016-04-12 05:30:57', '2016-04-12 05:33:54', '', 191, 2646, 'beauty salon\nhair salon', 270877, 0, '', 'serenehairandbeauty@gmail.com', '0883333626', '', '', '', '', 'Rachael and Jessica are two very experienced and passionate people who have come together to create a professional intimate experience in a happy up to date environment. Serene Hair and Beauty Lounge offer the latest trends from current colours and styles, with all your beauty needs and an array of advanced services such as \n\n• 100% human Hair extensions \n• Permanent makeup \n• IPL laser hair removal. \n\nSerene Hair and Beauty Lounge really are your ‘one stop shop’. Stoking the No.1 selling professional skin care dermalogica along with the reputable Wella professional’s hair care we have all your treatment solutions.\n\nSerene hair and beauty lounge offers a luxury experience with quality furnishing; enjoy a massage with our fully reclining hair basin and spa pedicure chairs. Have a moment to yourself with a good coffee and up to date magazines. With a touch of old world and new ideas we hope you feel as at home as we do. ', 'A', '{"2":[[0.375,0.7083333333]],"3":[[0.375,0.875]],"4":[[0.375,0.7708333333]],"5":[[0.375,0.7083333333]],"6":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/newnamecoming', '', '', '', '', '', 'https://plus.google.com/106986104422244764612/about'),
  (108596, 'naturally-red-hair-beauty-108596', 'Naturally Red Hair & Beauty', '', 'Naturally Red Hair & Beauty is located at Angaston and specialises in hair ang beauty services. Naturally Red Hair & Beauty offer hair cut, makeup, spray tan, nails and many more.', 270915, '2016-04-12 05:42:40', '2016-04-12 05:45:07', '', 191, 2636, 'beauty salon\nhair salon', 270915, 0, '', 'naturallyred@bigpond.com', '0885643646', '', '', '', '', 'Naturally Red Hair & Beauty is not just your ordinary hair and beauty salon! \n\nAt Naturally Red Hair & Beauty you will find friendly helpful staff, Happy to guide you or be guided by you to achieve your look. \n\nNaturally Red Hair & Beauty is a family salon that caters for Men, Women and Children, \nNaturally Red has an excellent reputation for Weddings and Formals, catering for hair, makeup, nails and spray tans. Making the time leading up to and your special day, hassle free and one to remember.\n\nOur beauty room caters for all your beauty needs, from waxing, massage, make up, spray tans, facials, manicures, pedicures, shellac nails and more.\n\nWe use and recommend NAK hair products, Australian made and paraben and sulphate free. we also stock Grace cosmetics, natural and botanical Australian made skin care, Vani T mineral make up, Grace designer Jewellery, Cloud nine Straighteners, and Tilley soy way candles and reed diffusers.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.8333333333]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.7291666667]],"6":[[0.3333333333,0.5]]}', 'https://www.facebook.com/Naturally-Red-Hair-Beauty-232222920121233', '', '', '', '', '', 'https://plus.google.com/113105975040410764159/about'),
  (108597, 'nailin-beauty-108597', 'Nailin Beauty', '', 'Nailin Beauty is located Victor Harbor and specialises in nail and beauty services. Nailin Beauty offer manicure, pedicure, acrylic, waxing, tinting, facial and many more.', 270927, '2016-04-12 05:54:38', '2016-04-12 05:57:24', '', 191, 2634, 'beauty salon\nnail salon\npedicure\nmassage', 270927, 0, '', '', '0432399046', '', '', '', 'http://www.nailinbeauty.com.au/', 'Welcome to Nailin'' Beauty. Your one stop shop for all your beauty needs.\n \nNailin'' Beauty provide impeccable customer service, top-notch talent and a comfortable, beautiful and friendly environment. We encourage potential clients to come in and meet our amazing team anytime during business hours. At Nailin'' Beauty we offer affordable elegance at its best!\n\nNailin'' Beauty pride ourselves in delivering professional services using the highest quality products on the market to maximise treatment benefits. Our therapists are highly trained with years of experience in the beauty industry.\n\nNailin'' Beauty has been up and running for 6 years now, continuing to build and grow with amazing clientele.\n \nServices:\n• Manicure\n• Pedicure\n• Acrylic Nails\n• Spray Tanning\n• Facials\n• Waxing\n• Massage', 'A', '{"1":[[0.4166666667,0.7083333333]],"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.7083333333]],"5":[[0.4166666667,0.7083333333]],"6":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/yougotnailed/', '', '', '', '', '', ''),
  (108598, 'national-press-club-108598', 'National Press Club', '', 'National Press Club located Barton is  a prestigious venue for events and functions such as boardroom dinners, cocktail parties, weddings, awards and celebrations.', 270939, '2016-04-12 05:57:56', '2016-04-12 06:01:40', '', 191, 2628, '', 270939, 0, '', 'npc@npc.org.au', '0261212199', '', '', '0261212188', 'http://www.npc.org.au/', ' National Press Club is an icon, an institution that reaches the influencers and decision makers of Australia; be they Federal or State Parliamentarians, political advisors, Government Heads of Departments, diplomatic community, academia, legal, health and other professions, journalists including the Federal Parliamentary Press Gallery or thinking Australians many of whom are leaders in their own communities.\nThe televised lunchtime Westpac National Press Club Addresses are held usually on Wednesdays with additional speakers featured on other days of the week.\n\nSpeakers such has political leaders, ministers, scientists, entrepreneurs, thought leaders and forums provoke thought and inspire.\n\nThe National Press Club is a prestigious venue for events and functions such as boardroom dinners, cocktail parties, weddings, awards and celebrations.\n\nOur award winning Column Restaurant continues to provide diners with premium contemporary Australian Cuisine. The menu changes seasonally and the chef gains inspiration from the available local produce.\n\nThe National Press Club has been featuring some of Australia’s best live music on Thursday and Friday nights for members and guests for some time in the Club Lounge.', 'A', '{"1":[[0.4583333333,0.9583333333]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,0.9583333333]]}', 'https://www.facebook.com/NationalPressClubofAustralia', 'https://twitter.com/pressclubaust', '', '', '', '', 'https://plus.google.com/110486404326169221668/about'),
  (108599, 'yanco-all-servicemen-s-club-108599', 'Yanco All-Servicemen''s Club', '', 'Yanco All-Servicemen''s Club facilities includes restaurant, Keno, TAB, Gaming and always available for function bookings for any celebration such as weddings, graduation, birthdays and more.', 270941, '2016-04-12 05:59:14', '2016-04-12 06:00:08', '', 191, 2630, 'rsl club\nsocial club', 270941, 0, 'PO Box 23', 'yancoclub@bigpond.com.au', '0269557106', '', '', '0269557290', 'http://www.yancoclub.com/', 'A Brief History of Yanco All Servicemen''s Club\n \nIn 1945, while many Servicemen were home on Christmas leave the opportunity was taken to discuss the formation of an ex-servicemen''s club in Yanco. Consequently a meeting was held at the Yanco Hall on Thursday, 3rd January, 1946. It was moved by Mac Waring & seconded by W. Jones that a club be formed to be known as Yanco All Servicemen''s Club.\n\nThe Club as it stands today occupies the original site which was a garage owned by Tom MacPharland. MacPharland sold the garage to the club after the club had leased the garage for two years for the sum of 400 pounds.\nTwo Years later the club was extended by purchasing an army hut that had been used as an army post office in Narrandera during the war.\n \nLater as membership increases the hut was demolished and concrete walls erected.  The roof was extended the full length of the land as it is today.  In 1958 the building was modernised and extended with the foundation stone being laid by then governor of NSW Sir John Northcott.  The building was officially opened by Colonel Ramsey. In 1963 after the Club decided to accept women as associate members, a second storey was added to the club building which incorporated a ladies lounge, auditorium and a dining room.\n\nDining Room\nIt''s the finest dining in town, you will find our venue the perfect atmosphere whatever the occasion. With value for money & the friendly service that we pride\nourselves on here at the friendly club. With both flexible chinese & australian cuisine, whatever your taste we are sure to satisfy the taste buds.\n \nWeddings\nMake your Special Day.. Absolutely Magic..!\n\nOn one of the most important days of your life, you want everything to fall right into place.  With every aspect of your day covered at our club from the atmosphere to the food and wine. Also the comfort of your guests, let us take the hassle out so you are free to enjoy your day.\n\nWe can assist you also in every area of your wedding day from seating arrangements, flowers, decor. We have the experience to pay attention to that finer detail that makes your day extra special. So whether it is small and intimate or a wedding with up to 200 people we have you covered.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/YancoClub/', '', '', '', '', '', ''),
  (108600, 'reclaiming-beauty-108600', 'Reclaiming Beauty', '', 'Reclaiming Beauty is about helping you find inner balance, peace, health and happiness. Reclaiming Beauty also offers a wide range of beauty treatments to help you feel great on the outside too.', 270959, '2016-04-12 06:01:39', '2016-04-12 06:04:55', '92687425892', 657, 2627, 'beauty salon\nnail salon\npedicure\nmassage\nbeauty therapy\nskin care', 270959, 0, '', 'info@reclaiming-beauty.com', '0415436005', '', '', '', 'http://www.reclaiming-beauty.com', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.5833333333]]}', 'https://www.facebook.com/reclaimingbeautymelbourne', '', '', '', '', '', ''),
  (108603, 'bombala-rsl-club-108603', 'Bombala RSL Club', '', 'Bombala RSL Club is the hub of the town providing services such as: Dining, TAB, Keno, Entertainment, Lawn Bowls, Bingo, Poker, Function Facilities and a BBQ Area to mention a few.', 276590, '2016-04-12 06:26:56', '2016-04-27 06:16:39', '', 191, 385, 'rsl club\nsocial club', 276590, 0, '', 'bombalarsl@bigpond.com', '0264583017', '', '', '0264583935', 'http://www.bombalarsl.com.au/', 'Bombala RSL Club is nestled between the Far South Coast and the Snowfields of New South Wales as well as Australia''s Capital, Canberra.\n\nOur unique location offers opportunities to view platypus in their natural habitat, experience old growth forests, temporate rainforests or try a spot of fly fishing as well as a myriad of other outdoor activities.\n\nOur Club is the hub of the town providing services such as: Dining, TAB, Keno, Entertainment, Lawn Bowls, Bingo, Poker, Function Facilities, Disabled Access and Toilet Facilities and a BBQ Area to mention a few.\n\nWe look forward to your visiting our Club and our region.\n\nFunction Area Type:\n•  Celebrations\n•  Weddings\n•  Corporate Events\n\nThe Club, along with head Chef, Jono Kidman, are well equiped to meet all your function needs.\n\nWeddings, birthdays, corporate events, meetings and trainings can all be accommodated with several menu choices for all budgets.\n\nPhone or call into the Club to discuss your next function and how we can help you make it a success.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9375]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.0208333333]],"5":[[0.4166666667,0.0208333333]],"6":[[0.4166666667,0.0208333333]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/Bombala-RSL-Club-162473627102858/', '', '', '', '', '', 'https://plus.google.com/105799951413026180059/about'),
  (108604, 'classique-hair-designs-108604', 'Classique Hair Designs', '', 'Classique Hair Designs is located and Seacliff and specialises in hair services. Classique Hair Designs offer hair cutting, hair styling, hair colouring, hair design and many more.', 0, '2016-04-12 06:28:43', '2016-04-12 06:31:24', '', 191, 2614, 'hair salon\nhairdresser', 0, 0, '', 'classiquehair@live.com.au', '0882962989', '', '', '', '', 'Our aim at Classsique Hair Design is to provide you with best quality hair care possible.\n\nClassique Hair Designs use and recommend only the best professional products available. \n\nThe staff at Classique Hair Design is very passionate all priding themselves in the latest cutting and colouring techniques. If you have any questions or concerns about your hair don''t hesitate to come in and a have a chat.\n\nClassique Hair Designs Services:\n• Hair Cutting\n• Hair Styling\n• Hair Colouring\n• Hair Design\n• Hair Extensions', 'A', '{"2":[[0.375,0.875]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.3541666667,0.6041666667]]}', 'https://www.facebook.com/classiquehair.com.au', '', '', '', '', '', 'https://plus.google.com/113442906357950009384/about'),
  (108606, 'goulburn-soldiers-club-108606', 'Goulburn Soldiers Club', '', 'Goulburn Soldiers Club is the premier venue in Goulburn for recreation and entertainment in a well appointed environment. Facilities includes TAB betting, Keno, indoor and outdoor lounge areas.', 271049, '2016-04-12 07:07:59', '2016-04-12 07:15:21', '', 191, 2587, 'rsl club\nsocial club', 271049, 0, '', 'info@goulburnsoldiers.com.au', '0248213300', '', '', '0248221107', 'http://goulburnsoldiers.com.au/', 'Goulburn Soldiers Club is the premier venue in Goulburn for recreation and entertainment in a well appointed environment, centrally located opposite the beautiful Belmore Park with ample parking at the door and disabled access available from the rear carpark entrance.\nCome on in and enjoy a beverage with friends in one of our many indoor and outdoor lounge areas, take advantage of our range of TAB betting facilities within the private betting lounge or play a game of Keno.\n\nBorrow some ques & balls from the cashier & catch up with friends over a friendly game of snooker or simply relax in our Sports Lounge while watching your favourite sports on our huge 3m x 3m BIG Screen TV.\n\nLive entertainment can be enjoyed every Saturday night in the Parkside Lounge from 8.30pm and the Soldiers Travel Club offers great deals for popular stage shows & concerts. Weekly raffles are held every Monday, Thursday, Friday & Sunday.\n\nEnjoy dining in Diggers by the Park Brasserie with great views over Belmore Park while the children play in the enclosed play room, Diggers are open daily for lunch & dinner. Visit Puffin on the Park Coffee Shop for a lighter snack or a great hot beverage with Puffins famous fresh lamingtons & cakes, open daily from 10am.\n\nWe have several function rooms to choose from and can cater for committee meetings, seminars, conferences, private dinner parties, family celebrations and weddings.\n\nChildren are always welcome at the Soldiers, accompanied by an adult, children are allowed to frequent our Parkside Lounge until 10pm daily.\n\nCome on in and join today, membership is only $3 and you can take full advantage of our great facilities, live entertainment, rewards and weekly raffles.\n\nWe provide great service to our members and their guests with a range of facilities to make your visit to our Club an enjoyable experience.\n\n \n\n– Free Wi-Fi & Internet service\n– Free mobile device chargers\n– Baby change stations\n– Disabled access and amenities\n– ATM and EFTPOS facilities available\n– Club Keno & TAB facilities\n– Pit Stop Gift Card terminal\n– Bottle shop sales available over Sports Bar before 10pm\n– Big screen TV’s and a huge 3m x 3m TV in Sports Lounge\n– Private Snooker Room\n– Private TAB Lounge\n– Four Outdoor Terraces\n– Seven Function Rooms\n– Seminar & Conference Facilities\n– Puffin on the Park Coffee Shop\n– Diggers by the Park Brasserie, accommodating Coach & Group Bookings', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,0.0208333333]],"6":[[0.4166666667,0.0208333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/goulburnsoldiersclub/', '', 'https://www.linkedin.com/company/goulburn-soldiers-club', '', '', '', ''),
  (108608, 'oaks-golf-country-club-108608', 'Oaks Golf & Country Club', '', 'Oaks Golf & Country Club located in Cesssnock is the home of the Jack Newton International & Jack Newton Classic. The club offers function centre, venue for conferences, weddings and many more.', 271105, '2016-04-12 08:13:56', '2016-04-12 08:18:13', '', 191, 2579, 'golf club', 271105, 0, '', '', '0249901633', '', '', '', 'http://the-oaks-cessnock.au-golf.net/', 'Oaks Golf & Country Club is situated in the heart of the Hunter Valley wine country.\n\nIt is the home of the Jack Newton International & the Jack Newton Junior Classic.\nA fully licensed clubhouse overlooks this magnificent 18 hole golf course. 5,932 m (men) 5,271 (women) par 72 course, slightly undulating with water carries.\n\nThere is also one of the finest bowling greens in the District for the enjoyment of bowlers. \n\nThe Function Centre is a popular venue for conferences, weddings and other special events.\n\n\n\n\n\n\n\n\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108610, 'queensland-cricketer-s-club-108610', 'Queensland Cricketer''s Club', '', 'Queensland Cricketer''s Club located in East Brisbane is Australia''s greatest stadium club experience offering membership for corporates, individuals & families. ', 271125, '2016-04-12 08:53:03', '2016-04-12 08:55:04', '', 191, 2575, 'sports club', 271125, 0, '', '', '0738964533', '', '', '', 'http://qldcricketersclub.com.au/', 'Queensland Cricketer''s Club has been the premier place in Brisbane for lovers of sport to unite. The place to enjoy cricket, AFL, unbeatable views and a great social environment.\n\nIt all started with a group called the ‘Ginger Group’ who were members of the Queensland Cricket Association Executive.\n\nThe ‘Ginger Group’ hatched a plan over drinks at the Brisbane Hotel in Wharf Street to create a licensed club for like-minded people with a mutual love of Cricket.\n\nA committee was formed and the Queensland Cricketers’ Club journey began.\n\nKey players included Clem Jones, who became Lord Mayor of Brisbane two years later, Norm McMahon, later Chairman of the Queensland Cricket Association, Roy Richards and Frank Malone.\n\nThey needed 300 members to form under the prevailing liquor licensing laws. The quota was easily reached and on October 29, 1959 the Queensland Cricketers’ Club was launched.\n\nToday’s stunning premises on level three of the northern stand have housed the Club ever since. Sports fans have witnessed incredible action over the years from our exclusive stadium seats and fully glass-fronted facilities. Our breathtaking views have seen us become the most unique function venue around the Brisbane CBD. Our prestigious Sir restaurant hosts the best fine dining in Brisbane.\n\nIt started with cricket, but grew to so much more. Today, it’s just not cricket… it’s Australia’s premier business and leisure club.\n\nJoin now and you will become part of the story: part of this great legacy of Queensland.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]]}', 'https://www.facebook.com/qldcricketersclub', 'https://twitter.com/QLDCricketersCl', 'https://www.linkedin.com/company/queensland-cricketers''-club', '', '', '', ''),
  (108613, 'green-skip-bins-adelaide-108613', 'Green Skip Bins Adelaide', '', 'Are you looking for <A href="http://greenskipbinsadelaide.com.au/" title="skip bins Adelaide"><b>skip bins Adelaide</b></a>? GreenSkipbinsAdelaide has been offering same-day service for many years. ', 0, '2016-04-12 13:07:36', '2016-04-12 13:07:36', '65137254552', 661, 2572, 'house cleaning', 0, 271145, '', 'geenskipbinsadelaide2015@gmail.com', '0882803318', '', '', '', 'http://greenskipbinsadelaide.com.au/', 'Are you looking for skip bins in Adelaide? GreenSkipbinsAdelaide has been offering same-day service for many years. Skip Bins in Adelaide are available in different sizes. Some of the bins are used for residential and commercial purposes while the others are employed for industrial purposes.', 'A', '', '', '', '', '', '', '', ''),
  (108614, 'jim-s-mowing-108614', 'Jim’s Mowing', '', 'Jim’s Mowing, we provide a wide range of gardening service to make sure the outside space is kept pleasant and sharp all year-round.', 271147, '2016-04-12 17:14:27', '2016-04-12 17:16:32', '32367906316', 662, 2570, 'lawn cutting\nlandscaping and paving\ngarden supplies', 271147, 0, '', 'jimsmowingaustralia@gmail.com', '0361131546', '', '', '', 'http://jimsmowing.net/service/vic/gardening-cranbourne', 'Jim’s Mowing, we provide a wide range of gardening service to make sure the outside space is kept pleasant and sharp all year-round. Our fully trained and skilled garden professionals have the tools and knowledge to fully maintain all aspects of the commercial or domestic garden.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/JimsMowingAU', '', '', '', '', '', ''),
  (108616, 'gundagai-district-services-club-108616', 'Gundagai District Services Club', '', 'Gundagai District Services Club located in Gundagai provide its guests and members a wide range of services and facilities including dining, function areas, golf, bowls and many more.', 271161, '2016-04-12 23:10:51', '2016-05-02 03:59:54', '', 191, 906, 'rsl club\nsocial club', 271161, 0, '', 'admin@gundagaiservicesclub.com.au', '0269441355', '', '', '0269441323', 'http://www.gundagaiservicesclub.com.au/', 'The Gundagai District Services Club is a great destination for locals and visitors to our town. We offer the perfect place to relax with friends or family, and our sporting facilities are of the calibre usually found in much larger country towns.\n\nThe Club provides members and our guests with a top class 18 hole Bidgee Banks Golf Course, two bowling greens as well as artificial turf tennis courts, and squash courts for hire.\n\nGundagai is situated on the Hume Highway only 1.5 hours from Canberra, less than 4 hours drive from Sydney and a comfortable 5 hours from Melbourne. Plenty of accommodation options in our town are within a short walk of the Club.\n\nThe Gundagai Services Club offers several options for those looking for a private or corporate function venue.\n\nThe main function area can operate as one large room or two separate rooms. These areas are ideal for weddings and functions for groups like schools and sporting groups, comfortably catering for up to 150 people.\n\nOur separate Sports Club is another venue option we can offer.\n\nThe Club offers a range of excellent cuisine options to suit the occasion. The caterers who run our popular Parkview on Sheridan Restaurant will discuss your needs and can provide a full range of options from finger food or buffets through to a full, formal three-course dinner.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/GundagaiServicesClub/', '', 'https://www.linkedin.com/company/gundagai-district-services-club', '', '', '', 'https://plus.google.com/102631391040216954290/about'),
  (108617, 'beyond-beautiful-style-lounge-108617', 'Beyond Beautiful Style Lounge', '', 'Beyond Beautiful Style Lounge is located at McLaren Vale and specialises in hair services. Beyond Beautiful Style Lounge offer hair cutting, hair styling, hair colouring and many more.', 271167, '2016-04-12 23:14:01', '2016-04-12 23:15:22', '', 191, 2565, 'hair salon\nhairdresser', 271167, 0, '', 'beyondbeautiful01@gmail.com', '0883238324', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Beyond-Beautiful-Style-Lounge-137451996265494', '', '', '', '', '', ''),
  (108618, 'queanbeyan-rsl-memorial-bowling-club-108618', 'Queanbeyan RSL Memorial Bowling Club', '', 'Queanbeyan RSL Memorial Bowling Club conveniently located just on the edge of town. The club provides facilities including Keno, Tab, poker machine facilities and many more. ', 271175, '2016-04-12 23:23:55', '2016-04-28 03:58:24', '', 191, 132, 'rsl club\nbowling club\nsocial club', 271175, 0, 'P.O Box 388', 'marta@qbnrslbowl.com.au', '0262972344', '', '', '0262996225', 'http://www.qrslm.bowls.com.au/', 'Queanbeyan RSL Memorial Bowling Club is a medium size club\nwith a big heart serving the residents of Queanbeyan\n\nBowling\nThe BOWLS PROGRAM offers Competition and Social Bowls, and other Club Competitions.\n\nWeddings & Functions\nOur spacious function area can cater for over 100 seated guests. Our General Manager Marta Kavas, Bistro Owner Eleanor and the friendly staff are sure to be able to tailor a package that will be perfect for you. Table and bar services are available and there is ample parking. Barefoot bowls is available, details are under the "Functions" tab. All you need to do is sit back and enjoy the food and the atmosphere. For a Wedding Reception, party or special event simply email or phone us today.\n\nDining\nThe Brasserie which offers delicious chinese & Australian meals & is open for lunch & dinner 6 days a week. With lunches specials & daily Chef''s Specials every night. The bistro is closed monday day, but offers $11.00 chicken schnitzels from 6pm!\n\nEntertainment\nOur regular entertainment schedule of great live music, poker nights, raffles, and pool comps.', 'A', '{"1":[[0.4166666667,0.8958333333]],"2":[[0.4166666667,1]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.8958333333]]}', 'https://www.facebook.com/qbnrslbowl', '', '', '', '', '', 'https://plus.google.com/113495500015175797582/about'),
  (108619, 'sunbar-108619', 'Sunbar', '', 'Sunbar is located at Mawson Lakes and specialises in body and beauty services. Sunbar offer tanning, waxing, massage and many more.', 271187, '2016-04-12 23:27:10', '2016-04-12 23:29:31', '', 191, 2561, 'beauty salon\nmassage\nbeauty therapy\nskin care', 271187, 0, '', 'contact@sunbartanningstudio.com.au', '0883597337', '', '', '', 'http://www.sunbartanningstudio.com.au/', 'Sunbar was founded in 2005 and we are Adelaide''s premier spray tan salon. We have searched worldwide to offer you the most advanced technology and the finest products for your spray tan. This, combined with our tailored approach and professional staff, ensures you have the perfect spray tan experience and a stunning result each and every time.\n\nAt Sunbar we strive to offer you the very best personalised service with expert advice on how to improve and enhance your best features. If you’re after Adelaide’s best and most natural looking spray tan, killer Hollywood eyebrows or luscious flirty lashes, it’s time to talk to the friendly team at Sunbar!\n\nBut there''s a whole lot more to Sunbar than providing Adelaide''s best spray tan! We can create a new you by enhancing your best features in our BrowBar, giving you killer Hollywood eyebrows and luscious flirty lashes. ', 'A', '{"1":[[0.4166666667,0.7916666667]],"2":[[0.4166666667,0.7916666667]],"3":[[0.4166666667,0.7916666667]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.8333333333]],"6":[[0.4166666667,0.5833333333]]}', 'https://www.facebook.com/Sunbar-Mawson-Lakes-192547134146188', '', '', '', '', '', 'https://plus.google.com/118176216582716413552/about'),
  (108620, 'young-services-club-108620', 'Young Services Club', '', 'Young Services Club can cater for all your events including conferences - large and small, weddings, parties, anything! Young Services Club also create accommodation at Young Federation Motor Inn. ', 271195, '2016-04-12 23:34:33', '2016-04-12 23:36:12', '', 191, 2559, 'rsl club\nsocial club', 271195, 0, '', 'info@youngservicesclub.com.au', '0263821944', '', '', '0263824565', 'http://www.youngservicesclub.com.au/', 'The Young Services Club is Young''s premier entertainment venue. With local bands, members draws, jackpots and visiting artists performing regularly, Young Services Club is the place to be when visiting the Cherry Capital. Young Services has function and conference facilities, a Bistro that serves delicious meals 7 days a week and a childrens play area that lets parents relax in the Clubs modern facilities.\n\nFunctions & Events at Young Services Club\nYoung Services Club can cater for all your events including conferences - large and small, weddings, parties, anything! Young Services Club can create a package including accommodation at the beautiful Young Federation Motor Inn. The Young Federation Motor Inn offers you 4 star luxury accommodation right in the heart of Young.\n\nThe Young Services Club is a great place to hold that special event, group meeting or conference. With three different function rooms to choose from, all with broadband, there is sure to be a room to suit your event. Our experienced team will cater to your requirements, whether it be food, decorating or help in planning.\n\nThe Auditorium\nThe Auditorium is the largest of our function rooms, it is suitable for events such as Balls, Presentation Dinners, Weddings & has a large dance floor, it’s own private bar and large stage to accommodate your entertainment.', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9583333333]],"5":[[0.375,0.9583333333]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/youngservicesclub', '', '', '', '', '', ''),
  (108621, 'mawson-lakes-hair-and-beauty-108621', 'Mawson Lakes Hair and Beauty', '', 'Mawson Lakes Hair and Beauty is located at Mawson Lakes and specialises in hair and beauty services. Mawson Lakes Hair and Beauty offer hair cutting, styling and many more.', 271207, '2016-04-12 23:36:20', '2016-04-12 23:37:49', '', 191, 2555, 'beauty salon\nhair salon\nhairdresser', 271207, 0, '', '', '0883598736', '', '', '', '', 'At Mawson Lakes Hair and Beauty we have a dedicated team of Hairdressers and Therapists who’s aim is for you to look and feel amazing! \n\nOur trained Hairdressers deliver great services and have extensive knowledge in the latest colours and styles. \n\nOur team will give you the best advice on how to look after your hair when styling and between visits. \n\nMawson Lakes Hair and Beauty also offer a wide range of Beauty Treatments customized to each individual. Our Experienced Therapists will look after all your beauty and skincare desires focusing on skin health and results.\n\nMawson Lakes Hair and Beauty is proud to use and stock Australian made Products such as JUUCE, PURE, FIX, SOUL BOTANICALS, OPI AVOJUCIE and MODEL ROCK LASHES. We work with Dermalogica to achieve skin health and results within the beauty treatment rooms!\n\nMawson Lakes Hair & Beauty Clinic offer a wide range of Hair & Beauty Services. Specialising in Waxing/Tanning & Ladies/Mens Hairdressing.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.8541666667]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/mawsonlakeshairandbeautyclinic', '', '', '', '', '', 'https://plus.google.com/101159912696801280553/about'),
  (108622, 'balranald-ex-servicemen-s-memorial-club-108622', 'Balranald Ex-Servicemen’s Memorial Club', '', 'Balranald Ex-Servicemen’s Memorial Club is a Not-for-Profit organization set up for Returned, Ex-Service, Serving & local community men and women. Facilities includes Coffee Lounge, Pool Table & more.', 271215, '2016-04-12 23:44:02', '2016-04-12 23:46:10', '', 191, 2553, 'rsl club\nsocial club', 271215, 0, 'PO Box 21', 'club@balranaldclub.com.au', '0350201205', '', '', '0350201183', 'http://www.balranaldclub.com.au/', 'The Balranald Ex-Servicemen’s Memorial Club is a Not-for-Profit organization set up for Returned, Ex-Service, Serving & local community men and women.  The Club is currently using and trading under the name of Balranald Club.\n\nWe pride ourselves on our clean facilities and friendly staff whom are always willing to lend a helping hand.\n\nIn 1952 we were first established as a registered club and started off with a very limited number of members but we have grown to over 1200 members today.\n\nThe club was opened on the 17th January, 1955 as a licensed club with Ron Blake as the Secretary Manager.  Those original foundation committee members could not have foreseen the development that was to occur in the ensuing fifty odd years to the wonderful club it is today.  Many extensions, alterations and improvements have been carried out by the Directors over the years since the official opening such as a modern ladies lounge opened in 1969 (now a cozy coffee lounge & seating area), a bowling green in 1973, and a club auditorium in 1975  just to name a few.\n\nOnce considered the end of the line, Balranald now is a stopping place on the Sturt Highway, that forms the direct link between Sydney and Adelaide.  Many travellers find the town ideal for an overnight (or longer) stay to refresh themselves at the Club with a magnificent meal, refreshing drinks and just a great place to unwind in and enjoy the many facilities on offer at the local Club.\n\nFirst settled in the 1840s on the site of a fording place of the Murrumbidgee River Balranald gained importance during the river-boat days as a service port for the wool industry.\n\nBalranald and the Club now services the surrounding grain, sheep, cattle and viticulture industries. Apart from the areas grazed, the country around contains mallee, rosewood and belah woodland and contrasts with the closer settled Victorian side of the Murray River.\n\nThe Bend, on the Murrumbidgee River, has shady parking and a swimming spot with picnic tables, boat launching ramps and toilets.  The main recreation ground in town, Greenham Park in We Street, caters for football, soccer, cricket, rugby, hockey, basketball, netball, tennis and horse-racing with many of these organisations receiving assistance in one form or another from the Club.   Adjacent to this ground is a three-pool swimming complex and golf course.   Other facilities provided in the town include showers, toilets and parking areas.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/clubbalranald', '', '', '', '', '', ''),
  (108623, 'deniliquin-rsl-club-108623', 'Deniliquin RSL Club', '', 'Deniliquin RSL Club located in Deniliquin provides its guests and members a wide range of services and facilities including live entertainment, dining, function areas and many more.', 271227, '2016-04-12 23:55:08', '2016-05-02 02:21:53', '', 191, 2549, 'rsl club\nsocial club', 271227, 0, '', 'denirsl@deniliquinrsl.com', '0358811455', '', '', '0358814147', 'http://www.deniliquinrsl.com/', 'Deniliquin RSL Club takes care of your function for you, we provide you with:\n\n•  Dedicated & professional staff\n•  A full catering service and menu & beverage options to suit your taste & budget\n•  Full technical & stage facilities\n•  3 functions rooms for the small groups up to 90 Guests then the Dunlop room which caters for up to 350 guests.\n\nFunction Rooms\n\nDunlop Room - Hold up to 500 people, theatre, cocktail/banquet styles with technical/business facilities. The auditorium is very large and spacious with a stage and dance floor. This room is perfect for weddings or that very large seminar or meeting.\n\nMountbatten Room - Hold up to 100 people, theatre, classroom, cockail/banquet styles with technical/business facilities. The Mountbatten room can be spit into two smaller rooms. It is suited to smaller weddings or seminars and gives the more personal feel.\n\nGallery Room - Perfect for parties, weddings, anniversaries or small to medium functions. Can hold up to 100 on both levels – 50 on bottom level.\n\nEnjoy the Club facilities for: \n\n•  Birthdays \n•  Private dinners/lunches \n•  Press conferences\n•  Christenings\n•  Product launches\n•  Themed special events\n•  Christmas parties\n•  School formals\n•  Trade shows\n•  Conferences\n•  Sporting dinners\n•  Retirement dinners\n•  Graduation balls\n•  Seminars\n•  Wakes\n•  Debutant balls\n•  Team building days\n•  Expos\n•  Presentation nights\n•  Meetings\n•  Weddings\n', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]]}', 'https://www.facebook.com/deniliquinrslclub/', '', 'https://www.linkedin.com/company/deniliquin-rsl-club', '', '', '', ''),
  (108624, 'noir-blanc-108624', 'Noir Blanc', '', 'Noir Blanc is located at Strathpine and specilises in hair and beauty services. Noir Blanc offer hair styling, colouring, cutting, makeup and many more.', 0, '2016-04-12 23:55:12', '2016-04-12 23:57:10', '', 191, 2547, 'beauty salon\nhair salon', 0, 0, '', 'contactatnoirblanc@gmail.com', '0466616937', '', '', '', '', 'Noir Blanc is a hair, beauty & tanning salon. Specialist in each field offer amazing service at great prices\n\nNoir Blanc started as Sun Perfect 5 years ago. The past 12 months we have expanded to include Hair & Beauty. \n\nAll our products have been stringently researched to ensure we have the best products for our customers and our brands include De Lorenzo and Youngblood. \n\nNoir Blanc''s goal is to ensure every customer receives amazing service at an extremely affordable rate.\n\nNoir Blanc Services:\n• Hair Styling\n• Hair Cutting\n• Hair Colouring\n• Makeup\n• Treatments', 'A', '{"1":[[0.4166666667,0.7916666667]],"2":[[0.4166666667,0.7916666667]],"3":[[0.3541666667,0.7916666667]],"4":[[0.3541666667,0.8333333333]],"5":[[0.3541666667,0.8333333333]],"6":[[0.3541666667,0.6458333333]]}', 'https://www.facebook.com/SunPerfectSprayTansandBeauty', '', '', '', '', '', ''),
  (108625, 'emerald-cut-loose-108625', 'Emerald Cut Loose', '', '', 0, '2016-04-13 00:02:02', '2016-04-13 00:03:52', '', 191, 2544, 'beauty salon\nhair salon', 0, 0, '', '', '0749822454', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/EmeraldCutloose', '', '', '', '', '', ''),
  (108626, 'finley-returned-soldiers-club-108626', 'Finley Returned Soldiers Club', '', 'Finley Returned Soldiers Club offers a range of recreational facilities for our guests and members. There''s always poker, bingo, keno, TAB or raffles, so that everyone can join and enjoy their time. ', 271247, '2016-04-13 00:04:17', '2016-04-13 00:05:12', '', 191, 2542, 'rsl club\nsocial club', 271247, 0, '63-67 Tocumwal St', 'admin@finleyrsc.com.au', '0488000366', '', '', '0358833038', 'http://finleyrsc.com.au/', 'Since 1955, Finley Returned Soldiers Club has been offering one of the most relaxing atmospheres and a wide range of recreational facilities for our guests and members. There’s always something on at the club, be it poker, bingo, keno, TAB or raffles, so that everyone can join and enjoy their time. \n\nWe are open from daily from 10.30 am, with our bistro open for lunch and Dinner.  Try our famous Stonegrill menu with your fresh meal served on a super-heated volcanic stone, which locks in all the natural juices and enhances the flavour of the food.  \n\nFor birthdays, weddings and meetings, we also offer 6 fully facilitated conference rooms for 20-350 delegates.\n\nOur mission\nFor the last sixty years, we have strived to serve the community with a consistent standard of service and the best country hospitality.\n\nOur wide range of recreational facilities promise you good times with friends and family, and our signature Stonegrill menu is sure to impress!', 'A', '{"1":[[0.4375,0.9375]],"2":[[0.4375,0.9375]],"3":[[0.4375,0.9375]],"4":[[0.4375,0.9375]],"5":[[0.4375,0.9583333333]],"6":[[0.4375,0.9583333333]],"0":[[0.4375,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/103114918744358608248/about');
