  (108627, 'moama-rsl-club-108627', 'Moama RSL Club', '', 'Moama RSL located in Moama provides its guests and members a wide range of services and facilities including dining, bar, entertainment, function areas and many more.', 271257, '2016-04-13 00:14:24', '2016-05-02 02:30:34', '', 191, 2538, 'rsl club\nsocial club', 271257, 0, 'Merool Lane', 'enquiries@moamarsl.com.au', '0354826677', '', '', '', 'http://www.moamarsl.com.au/', 'Moama RSL is your complete venue for fun, relaxation and good times. Established in 1990, the club is renowned by locals and visitors as the best value Club in town.\n\nMoama RSL is a fantastic venue for meals, entertainment and functions. Open 7 days a week from 10am until late.\n\nRelax over a  meal inside Suvla Bay Bistro or opt to dine in our al fresco areas.  Kids can enjoy our spacious playground which is adjacent to the dining area.\n\nCorvettes Cafe has the coffee, cold drinks, savoury platters, delicious cakes, slices and kid’s treats to satisfy any need.\n\nExperience our TAB Sports Lounge which has a 103inch screen and airs all major sporting events throughout the year.\n\nMoama RSL also has a selection of 3 function areas: Anzac Terrace, Fromelles and Dardanelles.\n\nRegular live entertainment and ticketed shows.\n\nBoasting friendly, quality service our club facilities ensure there really is something for everyone!', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/Moama-RSL-116996165020514/', 'https://twitter.com/moamarsl', '', '', '', '', ''),
  (108629, 'ed-hope-hair-108629', 'Ed Hope Hair', '', 'Ed Hope Hair is located at Paddington and specialises in hari services. Ed Hope Hair offer hair cutting, hair styling, hair colouring, extensions and many more.', 271277, '2016-04-13 00:27:59', '2016-04-13 00:29:10', '', 191, 2532, 'hair salon\nhairdresser', 271277, 0, '', 'edhopehair@gmail.com', '0733670252', '', '', '', '', 'Ed Hope Hair is one of the newest hair salons in the Paddington area. This independent, dynamic and creative hair salon is situated in a prime location on the very popular Latrobe Terrace. \n\nEd Hope Hair opens it''s doors to everyone looking for hair-happiness. \n\nEd Hope Hair has it''s scissors sharpened for your next appointment!\n\nServices:\n• Hair Cutting\n• Hair Styling\n• Hair Colouring\n• Hair Extensions\n• Treatments\n', 'A', '{"1":[[0.5,0.7916666667]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.7083333333]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.7083333333]],"6":[[0.3333333333,0.6666666667]]}', 'https://www.facebook.com/edhopehair', '', '', '', '', '', ''),
  (108630, 'bomaderry-rsl-club-108630', 'Bomaderry RSL Club ', '', 'Bomaderry RSL Club Ltd offers members functions rooms for weddings, conferences or any celebrations that can accommodate for up to 400 people.', 277211, '2016-04-13 00:32:47', '2016-04-28 06:37:17', '', 191, 58, 'rsl club\nleagues club\nsocial club', 277211, 0, '', 'general@bomaderryrsl.com.au', '0244214888', '', '', '0244233360', 'http://www.bomaderryrsl.com.au/', 'Bomaderry RSL Club ''s Functions area type :\n\n•  Celebrations\n•  Weddings\n•  Corporate Events\n\n* 3 Function Rooms available accommodating 10 to 400 people\n\n* Numerous packages available\n\n* Weddings, conferences, celebrations\n\n* Nominal hall hire will apply\n\n ', 'A', '{"1":[[0.5,0.9166666667]],"2":[[0.5,0.9166666667]],"3":[[0.5,0.9166666667]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.5,0.9166666667]]}', 'https://www.facebook.com/Bomaderry-RSL-Club-306602192807269/', '', 'https://www.linkedin.com/company/bomaderry-rsl-club-ltd', '', '', '', ''),
  (108631, 'chairisma-boutique-hair-108631', 'Chairisma Boutique Hair', '', 'Chairisma Boutique Hair is located at Manly and specialises in hair services. Chairisma Boutique Hair offer hair cutting, hair styling, hairdressing, hair colour and many more.', 271293, '2016-04-13 00:38:47', '2016-04-13 00:40:22', '', 191, 2528, 'hair salon\nhairdresser', 271293, 0, '', 'chairisma@outlook.com', '0733933633', '', '', '', '', 'Chairisma Boutique Hair is a Salon dedicated to a culture of excellence in making you look and feel fabulous! We listen! Internationally Trained, Professional Hairdressing.\n\nChairisma Boutique Hair Mission:\nEvery day we are committed to going the extra mile to provide our clients with the Ultimate Salon Experience.\n\nChairisma Boutique Hair Vision:\nOur Vision is to be regarded as a leader in Customer Service and Style Innovation.\n\nChairisma Boutique Hair Services:\n• Hair Cutting\n• Styling\n• Colouring\n• Hair Extensions\n• Hairdressing', 'A', '{"2":[[0.3958333333,0.7083333333]],"3":[[0.3958333333,0.7083333333]],"4":[[0.3958333333,0.7083333333]],"5":[[0.3958333333,0.7083333333]],"6":[[0.3541666667,0.6875]]}', 'https://www.facebook.com/ChairismaBoutiqueHair', '', '', '', '', '', 'https://plus.google.com/107510012410592249605/about'),
  (108633, 'the-ivy-room-108633', 'The Ivy Room', '', 'The Ivy Room is located at Cairns and specialises in hair services. The Ivy Room offer hair cutting, hair styling, hair colouring, treatments and many more.', 271321, '2016-04-13 00:53:52', '2016-04-13 00:56:19', '', 191, 2516, 'hair salon\nhairdresser', 271321, 0, '', 'theivyroomcairns@yahoo.com.au', '0740332791', '', '', '', '', 'The Ivy Room is located at Cairns founded by Ben Oxlade.\n\nMy name is Ben. I am the owner of The Ivy Room. I have 16 years experience in the hairdressing industry, a Masters in Colour and a Masters in Retail. I was trained in Adelaide by South Australian Hairdresser of the Year Paul Dare. I am proficient in all aspects of hairdressing. Since completing my 4 yr apprenticeship I have completed many courses with Wella and Redken to constantly update my skill set.\n\nI pride myself on my work believing I am only as good as the work I have just created.\n\nI listen to clients needs and together we work on creating something that is both practical and beautiful.', 'A', '{"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.875]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/theivyroomcairns', '', '', '', '', '', ''),
  (108634, 'city-diggers-wollongong-108634', 'City Diggers Wollongong ', '', 'City Diggers prides itself on high standards of customer service, providing first class cuisine and entertainment for all. We offer a range of function venue options for all occasions. ', 271327, '2016-04-13 00:57:22', '2016-04-28 08:57:18', '', 191, 6, 'rsl club\nsocial club', 271327, 0, 'Church St & Burelli St', '', '0242288522', '', '', '0242264442', 'http://www.citydiggers.com.au/', 'City Diggers Wollongong is located right in the heart of Wollongong City and is only a short stroll to the city’s main shopping precinct, many restaurants, cinemas, WIN Entertainment Centre, Illawarra Performing Arts Centre and Wollongong’s famous beaches.\n\nCity Diggers prides itself on high standards of customer service, providing first class cuisine and entertainment for all. So call in for a meal or a drink prior to going out or catching a show or just drop in for a coffee during the day whilst shopping.\n\nThank you for considering City Diggers venue for your special event. Located in the heart of Wollongong’s business district and nightlife hub, we are in the perfect position to house your event.\n\nWe offer a range of venue options, from the grand ‘Owen Room’ which is perfect for a formal event, to smaller spaces for that intimate event or our very popular ‘Balcony Bar’ which is ideal for a relaxed party.\n\nWe take great pride in offering quality service and a variety of catering menus at a cost effective price. Our menu selection is designed to suit a broad range of tastes and styles, ranging from canapés to set course and buffet options. Our Head Chef is happy to personally tailor menus to suit your needs and our competitively priced wine list is designed to suit all budgets.\n\nCity Diggers Bistro & Cafe is now under the leadership of our resident Head Chef, Bec Cryer, whose passion is fresh local produce and bright flavours. We have been so impressed with her work, she’s now running the show. Drop in and check out her Autumn menu & weekly specials for some mouth watering fare.\n\nThe Bistro is the ideal place for a quick lunch or dinner or book in for a party with friends.', 'A', '{"1":[[0.3958333333,0.9375]],"2":[[0.3958333333,0.9375]],"3":[[0.3958333333,0.9375]],"4":[[0.3958333333,0.9583333333]],"5":[[0.3958333333,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/citydiggers/', 'https://twitter.com/citydiggers', '', '', '', '', 'https://plus.google.com/116130955595211561502/about'),
  (108636, 'corrimal-rsl-memorial-club-108636', 'Corrimal RSL Memorial Club', '', 'Corrimal RSL Memorial Club features a Keno, TAB, Bar, Bistro (Jaffa by Rob and Allen), modern gaming facilities and a car park which accommodates 70 vehicles. Our Function rooms can cater 150 people.', 271347, '2016-04-13 01:08:46', '2016-04-13 01:10:40', '', 191, 2510, 'rsl club\nsocial club', 271347, 0, '', 'admin@corrimalrsl.com.au', '0242844055', '', '', '0242852188', 'http://corrimalrsl.com.au/', 'Welcome to the Corrimal RSL Memorial Club website\n\nWhether it’s great food, good fun, entertainment or just a place to sit back and relax, why not visit us at Corrimal RSL.\n\nFeatures\nThe club has all the normal features of a club, Keno, TAB, modern gaming facilities and a car park which accommodates 70 vehicles.\n\nThere is also a bus stop at the front door or you may prefer the option of the club’s brand new 14 seat courtesy bus which operates in a 5 kilometre radius.\n\nFunctions\nFor any parties or functions there is an auditorium available which seats 120 in comfort and space, and one of the club’s best features is the staff, they are great.\n\nMuseum\nThe Sub-Branch boasts one of the best museums outside of Sydney with an extensive collection of memorabilia dating from the Boer War up to the present time.\n\nThe main museum room features a talking display which will take you around the room and explain the history of the exhibits, this is very popular with schools.\n\n ', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/corrimalrslclub/', '', '', '', '', '', 'https://plus.google.com/100920864192465493050/about'),
