  (108641, 'moss-vale-services-club-108641', 'Moss Vale Services Club', '', 'Moss Vale Services Club features TAB sportsbet, tipping, NRL, AFL, cricket, soccer, rugby betting, online betting terminals, fixed and tote odds. Our Function rooms cater all your family celebrations.', 276995, '2016-04-13 01:39:27', '2016-04-28 03:15:49', '', 191, 166, 'rsl club\nsocial club', 276995, 0, 'Cnr Argyle St & Yarrawa Street', 'admin@mvsclub.com.au', '0248681557', '', '', '0248691351', 'http://mvsclub.com.au/', 'Moss Vale Services Club host weekly Members badge draws, along with many raffles, exercise and dance classes, trivia, and other weekly events. While on the last Saturday night of every Month we have Karaoke from 8pm.\n\nThe Prime Grill & Brasserie\nHere we have a Great ranges of meals for the whole Family to choose from.\nWe have Kids meals, Starters, Seafood options, a Roast of the day, A vegetarian pasta, and many Gluten free options to choose from. \n\nWe have a range of rooms and equipment for all your formal function, and meeting needs. With a great span of menus to choose from, all for great prices. \n\nWith 3 Function rooms to choose from and equipment available for hire, we hope to satisfy all your Function needs. We have previously hosted Weddings, Presentations, Christmas parties, a range of meetings, Fundraisers, and many more.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/mossvaleservicesclub/', 'https://twitter.com/mossvaleserclub', '', '', '', '', 'https://plus.google.com/112364211238187063373/about'),
  (108643, 'the-vip-room-108643', 'The VIP Room', '', 'The VIP Room is located at Mooloolaba and specialises in hair colour, designed cuts, wedding services, bridal hair and many more.', 271403, '2016-04-13 01:59:52', '2016-04-13 02:05:05', '', 191, 2494, 'hair salon\nhairdresser', 271403, 0, '', 'info@theviproom.com.au', '0754444505', '', '', '', 'http://theviproom.com.au/', 'The VIP Room established in August 1985 is a unique, boutique styled Hair Salon suituated in Mooloolaba on the beautifull Sunshine Coast QLD, 2 hrs North of Brisbane. Our hairdressers are continually trained in the latest styles and trends. Come in for a consultation. Open by appointment for you.\n\nThe VIP Room specialise in Designer cuts, creative colouring, perming, hair straightening/ relaxation, make-up, weddings,manscaping, basic beauty.\n\nThe VIP Room use and recommend label.m Professional Haircare, UNITE Professional Salon System, Real Men Go 24/7, Pravanna ChromaSilk Colour & EMANI Minerals Makeup.\n\nThe VIP Room is open by appointment for you and one Monday a month for our VIP''s earlier or later on the allocated days to suit your needs.We look forward to meeting you.', 'A', '{"3":[[0.4166666667,0.7708333333]],"4":[[0.4166666667,0.7708333333]],"5":[[0.4166666667,0.7708333333]],"6":[[0.4166666667,0.5416666667]]}', 'https://www.facebook.com/theviprm', 'https://twitter.com/theviproom', '', '', '', '', 'https://plus.google.com/+TheVIPRoomMooloolaba/posts'),
  (108645, 'shoalhaven-ex-servicemen-s-club-108645', 'Shoalhaven Ex-Servicemen''s Club', '', 'Shoalhaven Ex-Servicemen''s Club function room holds up to 120 people and caters for Birthdays, Engagements, Dinners, Social Gatherings for Business Functions.', 271423, '2016-04-13 02:10:53', '2016-04-13 02:13:48', '', 191, 2490, 'rsl club\nsocial club', 271423, 0, '', 'enquiries@exservos.com.au', '0244216855', '', '', '0244216749', 'http://www.exservos.com.au/', 'Function Rooms\nOur Main Club function room holds up to 120 people and caters for Birthdays, Engagements, Dinners, Social Gatherings for Business Functions. Offering a dance floor, full serviced bar and modern presentation equipment. We also have a smaller meeting room for meetings and seminars for up to 20 people. \n\nEntertainment\nThe Shoalhaven Ex-Servicemen’s Club provides Live Entertainment, NPL Poker and Raffles throughout the week.  Come on down to the Club for a great night out, checkout Today’s Events.\n\nDining\nEastern Tiger, an all you can eat spectacular featuring Asian cuisine, a hearty carvery and an all you can eat salad and dessert bar and The Haven Cafe for light meals, sandwiches, burgers and more. \n\nMembership \nBecome a member today and benefit from Rewards Club offering discounts throughout the Shoalhaven and beyond. Get access to our Birthday rewards and Membership Draws worth up to $5000 Cash. We also have Regular Raffles and Poker nights for Members and Guests.\n\n', 'A', '{"1":[[0.4375,0.9375]],"2":[[0.4375,0.9375]],"3":[[0.4375,0.9375]],"4":[[0.4375,0.9375]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4375,0.8958333333]]}', 'https://www.facebook.com/ShoalhavenExservicemensClub', '', '', '', '', '', ''),
  (108646, 'northmead-beauty-therapy-108646', 'Northmead Beauty Therapy', '', 'Northmead Beauty Therapy is located at Northmead and specialises in beauty services. Northmead Beauty Therapy offer waxing, facials, massage, makeup and many more.', 271429, '2016-04-13 02:14:19', '2016-04-13 02:17:10', '', 191, 2488, 'beauty salon\nnail salon\nlaser clinic\npedicure\nmassage\nbeauty therapy\nskin care', 271429, 0, '', 'northmeadbeauty@primusonline.com.au', '0298907444', '', '', '', 'http://www.beauty-salon-parramatta.com/', 'Welcome to Northmead Beauty Therapy, a place where you can be yourself and still be a brand new person! We invite you to place where you can experience professional results, in minimum time! Here at Northmead Beauty Therapy we have several mature, experienced therapists and massage therapist who work at our skin care centre.\n\nUnlike other skin care centres, salons and spas, Northmead Beauty Therapy practice the highest form of team service. This means that the skills of our entire team are available to you. Northmead Beauty Therapy don''t lock you into a single therapist, or keep you on a waiting list. Meeting your service needs and busy schedule is our top priority.\n\nNorthmead Beauty Therapy Services:\n• Microdermabrasion\n• Laser Hair Removal\n• Photorejuvenation\n• Medi-Spa Facials\n• Facial Treatments\n• Skin Solutions\n• Brazilian Waxing\n• Eyelash Extensions\n• Bridal Services\n• Body Treatments\n• Spray Tanning\n• Waxing\n• Massage\n• Make Up\n• Hands and Feet\n• Pamper Parties\n• Face Mapping', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.8333333333]],"4":[[0.375,0.875]],"5":[[0.375,0.75]],"6":[[0.3333333333,0.625]]}', 'https://www.facebook.com/NorthmeadBeauty', 'https://twitter.com/northmeadbeauty/status/168122390910480384', 'https://au.linkedin.com/in/northmead-beauty-therapy-00a1b841', '', '', '', 'https://plus.google.com/113716998378109283338/posts'),
  (108647, 'sussex-inlet-rsl-club-108647', 'Sussex Inlet RSL Club', '', 'Sussex Inlet RSL Club is located at Sussex Inlet and offer a range of sports and social activities, including, Bowls, Snooker, Fishing & much more.', 271439, '2016-04-13 02:18:10', '2016-04-28 03:52:07', '', 191, 138, 'rsl club\nsocial club', 271439, 0, '', 'enquiries@sussexrslclub.net.au', '0244412076', '', '', '0244411646', 'http://www.sussexrslclub.net.au/', 'Welcome to Sussex Inlet RSL Club.\n\nWith both our Club and Shores holiday Units, nestled along the Shores of the Inlet we want you to sit back relax and enjoy the view. Here at the Sussex Inlet RSL Club along with the fantastic service and friendly atmosphere there is something for everyone, from a game of bowls or fishing on our club fishing boat the Rise ‘n Shine to fabulous food and entertainment. \n\nSussex Inlet RSL Club serve fantastic meals for both dinner and lunch with  our Bistro and Restaurant. So come on, sit back, relax and enjoy the view.\n\nCome visit us at the Sussex Inlet RSL Club where we endeavour to provide our members and guests with superior customer service and excellent quality products.\n\n', 'A', '{"1":[[0.3958333333,0.9166666667]],"2":[[0.3958333333,0.9166666667]],"3":[[0.3958333333,0.9166666667]],"4":[[0.3958333333,0.9166666667]],"5":[[0.3958333333,0.9166666667]],"6":[[0.3958333333,0.9166666667]],"0":[[0.3958333333,0.9166666667]]}', 'https://www.facebook.com/Sussex-Inlet-RSL-Club-114739341890977/', '', '', '', '', '', ''),
  (108648, 'body-sanctuary-108648', 'Body Sanctuary', '', 'Body Sanctuary is located at McKinnon and specialises in beauty services. Body Sanctuary offer facial, body and skin treatments.', 271481, '2016-04-13 02:49:12', '2016-04-13 02:52:21', '', 191, 2472, 'beauty salon\nnail salon\npedicure\nmassage\nbeauty therapy\nskin care', 271481, 0, '', 'info@bodysanctuarybeauty.com.au', '0395789831', '', '', '', 'http://bodysanctuarybeauty.com.au/', 'Body Sanctuary located at McKinnon founded by Tanya Curel\n\nTanya Curel has over 18 years'' experience. Body Sanctuary caters for men and women of all ages and we are dedicated experienced beauty therapists who specialise in all things beauty. This includes waxing, spray tans, manicures and pedicures through to facials and body treatments. The salon is elegant and serene and cleanliness and hygiene is our priority.\n\nBody Sanctuary have been part of the McKinnon Community for the past\n13 years. We ensure our clients feel relaxed and reassured that they will be given the first class treatment.\n\nAs award winning skin and tanning experts, Body Sanctuary have performed thousands of  corrective facial treatments, waxing and spray tans. We are about finding the right treatment and experience for each individual client. It is our mission to consistently deliver a tailored aesthetic solution with a unique and personalised experience. We provide a secluded haven with a warm and inviting environment. From the moment you enter, our team ensures a feeling of total comfort, peace and solace.', 'A', '{"2":[[0.4166666667,0.7083333333]],"3":[[0.4166666667,0.75]],"4":[[0.4166666667,0.8541666667]],"5":[[0.4166666667,0.75]],"6":[[0.375,0.625]]}', 'https://www.facebook.com/bodysanctuarymckinnon', '', '', '', '', '', ''),
  (108650, 'alan-buki-hair-108650', 'Alan Buki Hair', '', 'Alan Buki Hair is located at Paddington and specialises in hair services. Alan Buki Hair offer hair styling, colouring, foils, upstyles and many more.', 271499, '2016-04-13 03:08:51', '2016-04-13 03:10:24', '', 191, 2465, 'hair salon\nhairdresser', 271499, 0, '', 'syd@originalsalon.com', '0293613977', '', '', '', 'http://originalsalon.com/', 'Formally known as Atlantis Hair, Original A salon is located at 388 Oxford Street, Paddington. A haven for beauty editors, models, celebrities and creatives offering a boutique salon experience using Original & Mineral stress free hair products.\n\nAlan Buki is the man behind the energy at Alan Buki for O&M.syd. His passion and enthusiasm for both life and hair is infectious and sets the tone in the salon for the Alan Buki team and their clients. Beginning his hairdressing career at 15 in Australia, then trained in London. Early on, he began educating himself outside the usual parameters, with a dream of one day making a difference beyond the aesthetic in the industry.\n\nTwo successful Australian salons and an internationally successful hair care line, Original Mineral, under his belt, he is now realising that dream as he divides his time between tending client and celebrity tresses, and focusing on educating others about career paths and opportunities in the industry. “I believe hairdressing is not just a job, it’s a career, and for those with passion, hairdressing is a passport to create, travel and experience all you want in life.', 'A', '{"2":[[0.375,0.7083333333]],"3":[[0.375,0.8333333333]],"4":[[0.4166666667,0.875]],"5":[[0.375,0.75]],"6":[[0.375,0.75]],"0":[[0.375,0.625]]}', 'https://www.facebook.com/Alan-Buki-for-OMsyd-147379648679212', '', '', '', '', '', 'https://plus.google.com/108249507605775106626/about'),
  (108651, 'radiance-beauty-therapy-108651', 'Radiance Beauty Therapy', '', 'Radiance Beauty Therapy is located at Hastings and specialises in beauty services. Radiance Beauty Therapy offer facials, waxing, massage, body treatments and many more.', 271513, '2016-04-13 03:19:43', '2016-04-13 03:24:05', '', 191, 2461, 'nail salon\npedicure\nmassage\nbeauty therapy', 271513, 0, '', 'info@radiancebeautytherapy.com.au', '0359793311', '', '', '', 'http://www.radiancebeautytherapy.com/', 'Radiance Beauty Salon located in the heart of Hastings, provides beauty treatments to male and female clientele including waxing, facials, massage, body treatments, pedicures, manicures and more.\n\nAt Radiance Beauty Therapy we pride ourselves on exceptional service and offer of a wide range of high quality products and treatments. We encourage both our male and our female clientele to try out all of the treatments on our salon menu.\n\nRadiance Beauty Therapy Services:\n• Hands & Feet\n• Waxing\n• Indulgence\n• Make-up\n• Tinting\n• Spray Tanning\n• Eyelash Extension\n• Massage\n\nTrading Hours:\nMonday: 9am - 5pm\nTuesday: 9am - 5pm\nWednesday: 9am - 5pm\nThursday: 9am - Late by appt\nFriday: 9am - Late by appt\nSaturday: 9am - Booked appts\nSunday: Closed\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.9166666667]]}', 'https://www.facebook.com/Radiance-Beauty-Therapy-478107322230624', '', '', '', '', '', 'https://plus.google.com/117239847377677229038/about'),
  (108652, 'smithton-hair-care-studio-108652', 'Smithton Hair Care Studio', '', 'Smithton Hair Care Studio is located at Smithton and specialises in hair services. Smithton Hair Care Studio offer hair cutting, hair styling, hair colouring and many more.', 271539, '2016-04-13 03:34:43', '2016-04-13 03:36:49', '', 191, 2453, 'hair salon\nhairdresser', 271539, 0, '', 'dhwoodward@southcom.com.au', '0364521695', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/SmithtonHaircareStudio', '', '', '', '', '', ''),
  (108655, 'blues-point-skin-and-beauty-108655', 'Blues Point Skin and Beauty', '', 'Blues Point Skin and Beauty is located at McMahons Point and specialises in skin and beauty services. Blues Point Skin and Beauty offer facials, manicure & pedicure and many more.', 271567, '2016-04-13 05:16:34', '2016-04-13 05:22:03', '', 191, 2431, 'beauty salon\nmassage\nbeauty therapy\nskin care', 271567, 0, '', '', '0299290550', '', '', '', 'http://www.bluespointskinandbeauty.com.au/', 'Blues Point Skin and Beauty located at McMahons Point offers treatments such as LED light therapy, Skin resurfacing peels, Microhydrabrasion, Skin Needling, IPL hair removal and skin rejuvenation as well as other Beauty services and treatments such as waxing, tinting, facials, hand and nail care, body treatments, spray tanning and makeup. \n\nAt Blues Point Skin and Beauty we pride ourselves on using the finest quality products with the latest in "Active Ingredient Technology" to deliver the results that you desire. Therefore we have carefully chosen the finest skincare and make up products in the world today, including Aspect, CosMedix,\nAspect Dr, Payot, SkinMedica and Jane Iredale Mineral makeup.\n\nOur Aestheticians are highly trained and experienced in all services and are guaranteed to make sure your treatment is done to perfection. We pride ourselves on delivering only the latest in aesthetic treatments and offer a 100% money back guarantee on services as we strive for quality, excellence and customer satisfaction. ', 'A', '{"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.75]],"6":[[0.375,0.6875]]}', '', '', '', '', '', '', ''),
  (108660, 'tease-hair-spa-108660', 'Tease Hair & Spa', '', 'Tease Hair & Spa is located at Hobart and specialises in hair and spa services. Tease Hair & Spa offer hair cutting, hair styling, hair colouring and many more.', 271671, '2016-04-13 07:01:36', '2016-04-13 07:03:06', '', 191, 2386, 'spa\nhair salon', 271671, 0, '', 'tease@teasehairandspa.com.au', '0362316899', '', '', '', '', '', 'A', '{"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.75]]}', 'https://www.facebook.com/Tease-Hair-and-Spa-112463405488175', '', '', '', '', '', 'https://plus.google.com/117579994276305227848/about'),
  (108661, 'outdoor-living-direct-pty-ltd-108661', 'Outdoor Living Direct Pty Ltd', '', 'Outdoor Living Direct is Australia''s largest online retailer of high quality European designed outdoor furniture.', 271715, '2016-04-13 08:57:44', '2016-04-13 08:59:26', '19155694465', 665, 2370, '', 271715, 271716, '', 'webmaster@outdoorlivingdirect.com.au', '0395833060', '', '', '', 'http://www.outdoorlivingdirect.com.au', 'Outdoor Living Direct is Australia''s largest online retailer of high quality European designed outdoor furniture. Our outdoor furniture products include patio and balcony furniture, outdoor settings, sunlounges, cube settings, hammocks, pod and rocking chairs, poolside furniture, outdoor bean bags, umbrellas, and more, all in a range of materials including wicker, timber, aluminium and stainless steel.\n\nOur warehouse/showroom facility based in Cheltenham, Victoria, is one of the largest of its kind in the country, meaning that nearly every item in the range is in stock at all times. The showroom is open seven days a week, excluding only Christmas Day, New Year''s Day, Good Friday, Easter Sunday, and ANZAC Day. Alternatively you can browse or buy any of our products from our website at any time of day or night throughout the entire year.\n\nOutdoor Living Direct is a 100% Australian, family owned business, with the highest customer service values and a commitment to the very highest quality products.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/pages/Outdoor-Living-Direct/121377311243718', 'https://twitter.com/outdrlvngdirect', '', '', '', 'https://www.pinterest.com/outdrlvngdir', 'https://plus.google.com/u/0/b/117711924001111852296/+OutdoorlivingdirectAuoutdoorfurniture/about'),
  (108664, 'gardels-skin-and-beauty-108664', 'Gardels Skin and Beauty', '', 'Gardels Skin and Beauty is located at Gympie and specialises in skin and beauty services. Gardels Skin and Beauty offer massage, facials, peels and many more.', 271752, '2016-04-13 23:29:16', '2016-04-13 23:32:21', '', 191, 2349, 'beauty salon\nskin care', 271752, 0, '', '', '0754828033', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.5]]}', '', '', '', '', '', '', 'https://plus.google.com/112863795390917646964/about'),
  (108666, 'hair-de-mon-108666', 'Hair De''mon', '', 'Hair De''mon is located at Miami, Queensland and specialises in hair services. Hair De''mon offer hair cutting, hair styling and many more.', 0, '2016-04-13 23:45:29', '2016-04-13 23:45:29', '', 191, 2345, 'hair salon\nhairdresser', 0, 0, '', 'jennybusby47@gmail.com', '0755352190', '', '', '', '', '', 'A', '', '', '', '', '', '', '', ''),
  (108672, 'perth-veterinary-specialists-108672', 'Perth Veterinary Specialists', '', 'Perth Veterinary Specialists located in Osborne Park specialises in animal emergency care, surgical procedures, digital imaging, oncology and more.', 271790, '2016-04-14 00:34:31', '2016-04-14 00:37:46', '', 191, 2325, 'pet care\nveterinary surgeons\nanimal hospital\npets\nvets', 271790, 0, '', '', '0892040400', '', '', '0892045677', 'http://perthvetspecialists.com.au/', 'Perth Veterinary Specialists is a multidisciplinary referral specialist centre based on the premise of best possible veterinary care for pets. The purpose designed premises offer full diagnostic capabilities including an in-house laboratory and state of the art diagnostic imaging and surgical facilities. Trained and qualified staff provide compassionate supportive care through every stage of your pet’s illness, allowing peace of mind that your pet is in the best possible hands.\n\nWhen an animal is hurt or develops a severe illness, there is often a need for specialised expertise and equipment to properly diagnose the problem and guide appropriate treatment options to achieve the best possible outcome. The specialist veterinarians at Perth Veterinary Specialists form close partnerships with both the pet owner and the referring veterinarian in order to accomplish these goals.\n\nFor consultations with all specialist departments (Internal Medicine, Oncology, Radiology, Surgery, Dermatology) your pet may be seen by a registered specialist, a registrar (specialist training successfully completed, specialist registration pending final examination and assessment by the Australasian Veterinary Boards Council) or a resident (experienced veterinarian undergoing specialist training). Note that as a requirement of their training, the management of EVERY patient seen by a resident is closely supervised by a registered specialist. The hospital also employs interns; these are fully qualified veterinarians but do not have specialist training. They do NOT perform consultations or make decisions on how patients are managed but will assist more senior veterinarians within the hospital.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.75]],"5":[[0.3333333333,0.75]]}', 'https://www.facebook.com/PerthVetSpecialists/', '', '', '', '', '', 'https://plus.google.com/116719722612729250868/about'),
  (108674, 'pure-perfection-day-spa-108674', 'Pure Perfection Day Spa', '', 'Pure Perfection Day Spa is located at Grafton and specialises in body and skin services. Pure Perfection Day Spa offer signature spa, waxing, tinting and makeup.', 0, '2016-04-14 01:03:01', '2016-04-14 01:03:40', '', 191, 2310, 'beauty salon\nbeauty therapy\nskin care', 0, 0, '', '', '0266434567', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108676, 'racv-city-club-108676', 'RACV City Club', '', 'RACV City Club located in Melbourne offers two stunning locations and diverse range of facilities and activities for you, your friends, family and colleagues to enjoy.', 271860, '2016-04-14 01:24:26', '2016-04-14 01:29:27', '', 191, 2291, '', 271860, 0, '', 'clubmembership@racv.com.au', '0399448888', '', '', '', 'http://www.racv.com.au/wps/wcm/connect/club/club-home', 'RACV Club is recognised as one of the finest lifestyle clubs in the world and you''re invited to experience the unique privileges and benefits offered by only one club.\n\nClub members enjoy access to a wonderful range of social, leisure and business facilities.\n\nIn addition, members have the opportunity to take part in member interest groups, attend events and participate in a wide range of activities. Club membership also includes many benefits that form part of being an RACV member, such as discounts at RACV Resorts at Cape Schanck, Cobram, and Inverloch in Victoria, Royal Pines and Noosa in Queensland, and at the RACV Torquay Golf Club.\n\nFurthermore, RACV Club members enjoy discounts and benefits as part of both the Show Your Card and Save and Years of Membership Benefits programs as well as receiving Royal Auto eleven times each year.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/RACVClub/', '', '', '', '', '', 'https://plus.google.com/114146756944366754648/about'),
  (108677, 'goochies-hair-design-108677', 'Goochies Hair Design', '', 'Goochies Hair Design is located at Dubbo and specialises in hair services. Goochies Hair Design offer hair cutting, hair styling, hair colouring, hair design and many more.', 271882, '2016-04-14 01:29:29', '2016-04-14 01:31:34', '', 191, 2289, 'hair salon\nhairdresser', 271882, 0, '', 'goochieshair@gmail.com', '0268826098', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.875]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]],"6":[[0.3333333333,0.625]]}', 'https://www.facebook.com/Goochieshair', '', '', '', '', '', ''),
  (108678, 'redlands-rsl-club-108678', 'Redlands RSL Club', '', 'Redlands RSL Club located in Cleveland is a great place to catch up with friends and family. Redlands RSL has a cafe, function & meeting room facilities, keno,a self serve TAB, kids club and more.', 271898, '2016-04-14 01:40:31', '2016-04-14 02:02:47', '', 191, 2265, 'rsl club', 271898, 0, '', 'info@redlandsrsl.com.au', '0734881199', '', '', '0732863947', 'http://redlandsrsl.com/#about', 'Redlands RSL Club is a family friendly venue that takes pride in our customer service.  Home of the ever popular Sails on Shore Restaurant where you can enjoy chef’s specials from $10 and a delectable a la carte menu 7 days a week, open for lunch and dinner. \n\nBoasting our ever popular sails on shore restaurant, cove cafe, 3 bars, bayside bottleshop, 160 gaming machines, keno and function facilities with ample on site and street parking. You can choose to dine outside on the deck enjoying bay breezes overlooking Raby Bay or inside in airconditioned comfort. Our members are certainly looked after with great promotions and discounts up for grabs.\n\nRedlands RSL Sub Branch is here to service the veteran and ex-service communtiy with plenty of activities and gatherings to attend. Our friendly hard working welfare and pension officers are available 4 days a week to assist you with your needs. \n\nRedlands RSL also has a Library Museum which is open to the public which aims on providing a relaxing atmosphere for Veterans and Ex Servicemen and Women in which they can read the many books available or view the multi media DVD and Videos that are also provided. The facility is available to local schools enabling students to carry out research on Military history of Australia and Allied Forces and to view memorabilia and documents that have been accumulated over the years by veterans and the community.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.3333333333,0.9166666667]]}', 'https://www.facebook.com/RedlandsRSLClub', 'https://twitter.com/redlandsrsl', '', '', '', '', 'https://plus.google.com/109763027011889535368/about'),
  (108685, 'simply-shine-108685', 'Simply Shine', '', 'Simply Shine is located at Tamworth and specialises in hair, beauty and makeup services.', 271946, '2016-04-14 02:02:32', '2016-04-14 02:04:29', '', 191, 2261, 'beauty salon\nhair salon', 271946, 0, '', 'sshine@bigpond.net.au', '0267667466', '', '', '', 'http://www.simplyshinehair.com/', 'Simply Shine’s owners Leasa Turner and Raeleen McGarry opened the salon in 2004, bringing with them a combined total of 64 years of experience in the hair and beauty industry. Before opening, they discussed the goals that they hoped to develop and achieve within their brand, and decided that their mission statement would be: \n\n"Be Bright, Excel, Be Brilliant, Glow,"\nthe very definition of “Shine”. \n\nSimply Shine’s core values and commitment to excellence in service in hair and beauty, teamed with their vast knowledge of the region and its people, has been the cornerstone of their success over the past decade. \n\nHairdressing is at the heart and soul of the services that the Simply Shine offers, however, Simply Shine also has an array of quintessential beauty and make-up services to accompany any hair service you might receive, meaning you’ll leave the salon looking fabulous from head to toe.', 'A', '{"1":[[0.3541666667,0.6666666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.7291666667]],"6":[[0.3333333333,0.5416666667]]}', 'https://www.facebook.com/simplyshinetamworth', '', '', '', '', '', ''),
  (108688, 'royal-geelong-yacht-club-108688', 'Royal Geelong Yacht Club', '', 'Royal Geelong Yacht Club is a family club, ideally located on the city''s award-winning waterfront and within a very short stroll to the Geelong CBD. The club provides lounge, bar and cafe and more. ', 272226, '2016-04-14 05:24:29', '2016-04-14 05:31:04', '', 191, 2235, 'sailing club', 272226, 0, '', 'info@rgyc.com.au', '0352293705', '', '', '0352232768', 'http://www.rgyc.com.au/', 'Royal Geelong Yacht Club is a family club, ideally located on the city''s award-winning waterfront and within a very short stroll to the Geelong CBD. Established in 1854, it is one of few Australian yacht clubs with a royal charter. The club is based on tradition and is dedicated to fostering the love of sailing throughout the community. \n\nRGYC offers a comprehensive sailing program throughout the year for juniors and adults.  Don''t know how to sail, but would love to learn?  RGYC holds a number of different FREE and inexpensive options, which will help you to get started. If you''re an hold hand, the club also offers courses to enhance your sailing skills.\n\nThe club offers ample opportunities for corporate networking - most notably its Wednesday twilight sailing events throughout the summer months. \n\nFriday night is club member night - a good night for members to unwind, prepare for the weekend and have a drink at the "Yachtie".  There are also a number of different social functions held throughout the year, which are designed for members to connect with each other.\n\nRGYC has a number of sailing regattas throughout the year, in particular the Festival of Sails (held over the Australia Day weekend) which is the largest regatta in the Southern Hemisphere. It also has the Wooden Boat Festival, and frequently hosts elite sailing events including national and world titles. In 2015, RGYC hosted the i14 World Championships. All of the club''s events and the sailing program that runs throughout the year wouldn''t happen without its amazing volunteers, whom the club values highly.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/royalgeelongyachtclub/', 'https://twitter.com/rgycsocial', 'https://www.linkedin.com/company/royal-geelong-yacht-club', '', '', '', 'https://plus.google.com/115074272862188587343/posts'),
  (108691, 'royal-motor-yacht-club-broken-bay-108691', 'Royal Motor Yacht Club Broken Bay', '', 'Royal Motor Yacht Club Broken Bay has been operating on the shores of Pittwater since 1926. It is arguably one of the most beautiful boating waterways in the world.', 272250, '2016-04-14 05:52:36', '2016-04-14 05:56:59', '', 191, 2225, 'sailing club', 272250, 0, '', 'info@royalmotor.com.au', '0299975511', '', '', '0299974318', 'http://www.royalmotor.com.au/', 'Royal Motor Yacht Club Broken Bay since 1926 has been operating on the shores of Pittwater. The gateway to Broken Bay and the Hawkesbury River, arguably one of the most beautiful boating waterways in the world.\n\nServing it''s members and the greater boating community, The Royal Motor Yacht Club has built an enviable reputation as one of Australia''s premier boating clubs.\n\nSince its inception back in the 1920’s the Club has undergone many changes, once a small semi-rural establishment that has transformed into a modern facility catering for a diverse community of cruising, sailing, racing, fishing and social events and activities. \n\nA spirit of kinship and camaraderie has always been evident at our club and continues to evolve. We welcome not only those who own a boat but also those who just want to socialise and enjoy the club''s atmosphere. \n\nAll members enjoy the restaurant, bars and heated pool which complements an international class marina facility catering to all sizes of watercraft. With a 100 tonne slipway and a variety of marine trade services on site most boating services are catered for at the club.', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9583333333]],"5":[[0.375,0.9583333333]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/RMYCBB', 'https://twitter.com/royalmotoryacht', '', '', '', '', 'https://plus.google.com/112097439375938520553/posts'),
  (108692, 'maylands-bowling-club-108692', 'Maylands Bowling Club', '', 'Maylands Bowling Club ls located at Maylands and specialises in top quality sporting and recreational facilities.', 0, '2016-04-14 06:03:03', '2016-04-14 06:04:00', '', 191, 2219, 'bowling club', 0, 0, '', '', '0892711377', '', '', '', 'http://www.bridgetown.com.au/', '\n', 'A', '{"2":[[0.6666666667,0.9166666667]],"4":[[0.5,0.75]],"5":[[0.7083333333,0.875]]}', 'http://www.maylandssportsandrecreationclub.com.au/', '', '', '', '', '', 'https://plus.google.com/100794110906881027372/about'),
  (108693, 'royal-motor-yacht-club-nsw-108693', 'Royal Motor Yacht Club NSW', '', 'Royal Motor Yacht Club NSW located in Point Piper  offers luxurious amenities with varied activities & functions that Members and their guests can enjoy. The Club provides gym, function, pool & more.', 272294, '2016-04-14 06:13:20', '2016-04-14 06:19:21', '', 191, 2212, 'sailing club', 272294, 0, '', 'admin@rmycnsw.com.au', '0293276828', '', '', '0293639268', 'http://www.royalmotor.com.au/', 'Royal Motor Yacht Club NSW  is situated on Sydney Harbour, commonly referred to as the most beautiful natural harbour in the world.\n\nIt offers luxurious amenities with varied activities and functions that Members and their guests can enjoy.\n\nThe Club also provides a la carte dining, wedding reception and function facilities, state of the art gym, outdoor barbeque area with children''s playground and a 23 metre swimming pool.\n\nHere at the RMYC, we understand the importance of our Members and their guests and our staff strive to provide professional and friendly service.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/109511964263377570153/about'),
  (108695, 'royal-motor-yacht-club-port-hacking-108695', 'Royal Motor Yacht Club Port Hacking ', '', 'Royal Motor Yacht Club Port Hacking located in Burraneer is a not for profit club that offer a range of facilities including a marina, slipway, dry storage, and casual berthing. ', 272384, '2016-04-14 06:42:37', '2016-04-26 00:39:07', '', 191, 844, 'sailing club', 272384, 0, '', 'admin@rmycph.com.au', '0295239300', '', '', '0295235360', 'http://www.rmycph.com.au/', 'Royal Motor Yacht Club Port Hacking is founded in 1934 is a not for profit club which, over the years, has built a proud and interesting history and relationships which members and the local community.\n\nSituated on Gunnamatta Bay, RMYC Port Hacking has direct access to the waterfront to enhance your life on the water.\n\nWe offer a range of facilities including a marina, slipway, dry storage, and casual berthing. Learn more about our waterfront facilities here.\n\nRMYC Port Hacking runs numerous sub-clubs that support community life on and around the water as well as membership types to suit everyone.\n\nOur location, community spirit, restaurant and bar, and unsurpassed views ensures that our club, your club is a fantastic place to relax, unwind and enjoy all that we have to offer. There’s always something happening at RMYC Port Hacking!', 'A', '{"1":[[0.4583333333,0.9583333333]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,0.9791666667]],"6":[[0.4583333333,0.9791666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/RMYCPORTHACKING/', '', '', '', '', '', 'https://plus.google.com/106644680862983223963/about'),
  (108696, 'yokine-bowling-club-108696', 'Yokine Bowling Club', '', 'Yokine Bowling Club is located at Yokine and specialises in lawn bowling club with affordable venue hire and bar facilities.', 272396, '2016-04-14 06:43:16', '2016-04-14 06:46:20', '', 191, 2195, 'bowling club', 272396, 0, '', 'yok0353@bigpond.net.au', '0894447000', '', '', '', 'http://www.yokine.bowls.com.au/', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/yokinebowlingclub', '', '', '', '', '', '');
