  (108698, 'vicrecyclers-108698', 'VicRecyclers', '', 'VicRecyclers provides FREE tow away service for your old Truck, Ute, Van or Cash for Cars. Get up to $8,999 Cash for Car Removal. Car Removal Melbourne cover most areas and provide quickest services.', 272502, '2016-04-14 07:06:41', '2016-04-14 07:15:00', '48033586776', 669, 2173, 'parts and accessories\ntowing services', 272502, 272503, '', 'admin@vicrecyclers.com.au', '0409526398', '', '', '', 'http://www.vicrecyclers.com.au/', 'VicRecyclers has been established for decades and by buying and selling around 400 cars per month. we have a great idea of what people are looking for from car wrecker and car removal. Over the years we have noticed a change in the way people are disposing of their unwanted cars. In the past most people were happy to part exchange their car whilst buying a new one but recently we have noticed that a lot more people are finding it easier to sell a car for cash and then have the money to buy other things which may be more important in the short term.\n\nThat is why, We at VicRecyclers company have developed a customer friendly and very successful method of helping you sell your car for cash you deserve.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/VicRecyclers', 'https://twitter.com/VicRecyclers', 'https://www.linkedin.com/company/vicrecyclers', '', 'http://www.vicrecyclers.com.au/blogs/', 'https://www.pinterest.com/vicrecyclers/', 'https://plus.google.com/+VicrecyclersAutoWreckers'),
  (108699, 'royal-queensland-yacht-squadron-108699', 'Royal Queensland Yacht Squadron', '', 'Royal Queensland Yacht Squadron located in Manly incorporate the  Manly Marina Motel and 500 plus Marina Berths as well Members Clubhouse, Function Rooms, RQ Bar and Boardwalk Cafe.', 272507, '2016-04-14 07:07:35', '2016-04-14 07:11:43', '', 191, 2177, 'sailing club', 272507, 0, '', 'reception@rqys.com.au', '0733968666', '', '', '', 'http://www.rqys.com.au/', 'Royal Queensland Yacht Squadron was ‘born’ in 1885 when a group of gentlemen interested in water sports formed the Brisbane Sailing Club. Sailing quickly became the prominent sport of the new entity and within a few years competition with the sailors from Sydney had commenced with the inaugural inter-colonial sailing race in 22 Footers.\n\nThe Royal Queensland Yacht Squadron is proud of its enviable record of having been represented in every Australian Olympic team – either as competitor, coach or team manager – since the Melbourne Games of 1956.\n\nThe Royal Queensland Yacht Squadron is Queensland’s oldest and one of the most prestigious recreational boating clubs. It is also unique in the variety of recreational activities catered for within the one club. This web site is intended not only to provide up to date information for our existing members, but also to introduce visitors to our organisation and its facilities, and to convince them that they would feel at home among us.', 'A', '{"1":[[0.6666666667,0.7916666667]],"2":[[0.6666666667,0.7916666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/RQYS.Manly', '', 'https://www.linkedin.com/company/royal-queensland-yacht-squadron', '', '', '', 'https://plus.google.com/101354838867405209002/about'),
  (108701, 'erina-leagues-club-108701', 'Erina Leagues Club', '', 'Erina Leagues Club provides members modern facilities like A modern restaurant, menu and dining experience based on quality and freshness, Alfresco dining and entertainment areas and modern functions.', 272557, '2016-04-14 07:24:41', '2016-04-28 06:01:41', '', 191, 90, 'leagues club\nsports club\nsocial club', 272557, 0, 'PO Box 3020', 'webmaster@erinarlfc.com.au', '0243652233', '', '', '', 'http://erinaleagues.com.au/', 'The new look Erina Leagues Club with customer service second to none, it’s ‘elc – Everyone’s Local Club’\n\nFrom the moment you walk in the door, you’ll sense the friendly atmosphere and enjoy the best facilities and service that you would expect from the Central Coast’s finest club. Erina Leagues Club, which is situated in the heart of the thriving commercial hub of Erina on the beautiful Central Coast of NSW, welcomes you as a member, a guest, or a coach visitor. \n\nWe warmly encourage visitors and holiday-makers to experience the well renowned hospitality at ‘elc’. With our ultra-modern décor and facilities, share a quiet drink with friends in tranquil surrounds, enjoy the ultimate dining experience in our state of the art restaurant or relax with the family on the alfresco dining deck whilst the kids utilise our impressive playgrounds, call into the Sports Lounge to catch all the games on the BIG screens and, then complete your visit with a freshly brewed coffee in our newly refurbished and trendy café, you’ll feel at home. \n\nWe also have convenient, fully accessible facilities that make your stay that much more enjoyable. We offer our members and visitors a personalised experience with each visit and provide the most modern conveniences including:\n\n•  A modern restaurant, menu and dining experience based on quality and freshness\n•  Alfresco dining and entertainment areas\n•  An ultra-modern Cafe with fantastic coffee, light snacks & mouth watering sweets\n•  Funky Bars offering boutique & craft beers and a wide selection of quality wines\n•  Sports Lounge for the adrenalin enthusiast\n•  Family friendly kids soft fall playground areas in a weatherproof, safe and secure location\n•  Modern function and conference facilities with the latest audio visual equipment\n•  Outside barbeque and beer garden area\n•  Courtesy Bus', 'A', '{"1":[[0.4166666667,0.8958333333]],"2":[[0.4166666667,0.8958333333]],"3":[[0.4166666667,0.9375]],"4":[[0.4166666667,0.9375]],"5":[[0.4166666667,0.0208333333]],"6":[[0.4166666667,0.0208333333]],"0":[[0.4166666667,0.8958333333]]}', 'https://www.facebook.com/erinaleaguesclub', '', '', '', '', '', ''),
  (108702, 'royal-victorian-motor-yacht-club-108702', 'Royal Victorian Motor Yacht Club', '', 'Royal Victorian Motor Yacht Club located in Williamstown is one of the oldest Royal Motor Yacht Clubs in Australia, we encourage safe responsible boating and social community participation.', 272597, '2016-04-14 07:39:44', '2016-04-14 07:42:17', '', 191, 2161, 'sailing club', 272597, 0, '', 'admin@rvmyc.com.au', '0393932888', '', '', '', 'http://www.rvmyc.com.au/', 'Royal Victorian Motor Yacht Club  is open to boat owners and non-owners, and provides for both boating and social interests with particular emphasis on family and community involvement.\n\nWe encourage responsible boating and promote good boating courtesy. We are committed to fostering traditional skills in watercaft but are a progressive, dynamic Club with passionate members.\n\nThe RVMYC formed at a gathering at the Port Phillip Club Hotel in Flinders Street Melbourne, three doors from Young and Jacksons on 25 February 1904.\n\nPresent at this meeting were FM Linley, J McQuade, HBarker, C Atkins, E Huon, E James, C James, C Garner, L Garner, F Jackson, F Rayson, G Knott, B Lowther and Capt GM Strong.\n\nIt was resolved by these gentlemen to meet on 4 March for the purpose of forming a Motor Boat Club.\n\nThe Club was first called the Victorian Launch Club, this was later changed to the Victorian Motor Boat Club. The club met for some years at the hotel until new premises were acquired at a site near the present ferry terminal at Princess Bridge Wharf.\n\nThe Port Phillip Hotel served as our Clubrooms till 11 November 1913, when a discussion to have our own rooms at Princess Bridge was agreed.\nIt was resolved to request the City Council to grant us rooms in the vaults at Princess Walk. Number 6 vault was granted to the Club. The first monthly meeting at Princess Walk was held on 1 December, 1913.', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"4":[[0.375,0.6666666667]],"5":[[0.375,0.6666666667]]}', 'https://www.facebook.com/RVMYC-Royal-Victorian-Motor-Yacht-Club-328546770675445/', 'https://twitter.com/RVMYC', '', '', '', '', 'https://plus.google.com/106946602700802941971/about'),
  (108706, 'bayswater-bowling-club-108706', 'Bayswater Bowling Club', '', 'Bayswater Bowls Club is set in beautifully landscaped and colourful garden.The fully licensed modern clubrooms equipped with a spacious kitchen, are capable of seating up to 200 people.', 272746, '2016-04-14 23:03:16', '2016-04-14 23:05:29', '', 191, 2095, 'bowling club', 272746, 0, '', 'club@bayswaterbowlsclub.com', '0397298312', '', '', '', 'http://www.bayswaterbowlsclub.com/', 'First attempts to establish a Bowls Club in Bayswater (in 1981) were largely unsuccessful, but a number of the people involved persisted with the idea, and, following a public meeting attended by more than 100 people, a new committee was formed in 1983 which began negotiations with Knox Council for use of a section of Guy Turner Reserve, which is also home to cricket and tennis clubs.\n \nIn June, 1984, Council approved the erection of a clubhouse, two greens, and associated facilities. Several objections to the project were lodged, which the club successfully fought at the Town Planning Appeals Tribunal.\n\nThe club received a grant and a loan from the Council, used the funds it had raised which has been seriously eroded by the appeals process, and formed a co-operative to borrow the balance.\n\nApart from extensive excavations and the shell of the clubhouse, most of the work was done by members themselves at weekends. Meanwhile, would-be bowlers received tuition at Boronia, and then played in social events wherever we could, while fielding a pennant team as Oakleigh players. Carpet Bowls was played at the Station St Scout Hall and the Senior Citizens’ clubrooms.\n\nWe were granted official membership of the RVBA (the then men’s association) and the VLBA (Ladies) in 1988, when only one green was completed (the one nearest Phyllis Street). The Clubhouse was officially opened by the Mayor of Knox, our local councillor  Marie Wallace, on September 10 prior to the start of the season.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/bayswaterbowlsclubvic/', '', '', '', '', '', 'https://plus.google.com/115247138542008594322/about'),
  (108708, 'mundaring-bowling-club-108708', 'Mundaring Bowling Club', '', 'Welcome to the Mundaring Sporting Club Inc., home to 200 plus members involved in Bowls, Golf , Disc Golf, Rotary, Folks and Blues as well as Auslan teaching.', 272776, '2016-04-14 23:26:47', '2016-04-14 23:29:19', '', 191, 2083, 'bowling club', 272776, 0, '', 'john.doncon@bigpond.com', '0892951109', '', '', '', 'http://www.mundaringsportingclub.com.au/', 'The bowls section has been an integral part of the Mundaring Sporting Club since 1957 when the original Mundaring bowling and golf clubs were combined and relocated to our current facilities in Coolgardie Street.\n\nMundaring Bowling Clube have approximately 100 active bowling members, ladies and men, who participate in both pennants and social/championship events throughout the year.\n\nWhilst primarily a summer sport, we have two recently upgraded, high quality synthetic carpet greens which allow us to bowl all year round with well supported summer and winter programmes. Please refer to our Fixtures and Upcoming Events for details on available bowling activities at the club.\n\nMundaring Bowling Club have a strong contingent of volunteers and sub committees who support our active and unified Bowls Committee.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (108709, 'doubleview-bowling-club-108709', 'Doubleview Bowling Club', '', 'Doubleview Bowling Club is located at Doubleview and specialises in bowling for men and women, sky racing, foxtel and more.', 272788, '2016-04-14 23:48:45', '2016-04-15 00:07:47', '', 191, 2075, 'bowling club', 272788, 0, '', 'dvbowl@bigpond.net.au', '0894464322', '', '', '', 'http://www.doubleview.bowls.com.au/', 'Founded in 1958, The View has been one of the most successful clubs in the state. The Club has maintained its position in the top rank since being named "Club of the Year" in 1991, and this is emphasised by our Men''s Premier League Division winning ten metropolitan premierships.\n\nOur honor roll of champions includes Bowls WA Hall of Fame Inductees Beryl Godrey, Dennis Katunarich, John Rainoldi, Robbie Ball and Lindsay Thorn. The clubs current player list includes several WA representatives both current and past. \n\nNew members and visitors from Australian or overseas bowling clubs are welcome to share the excellent facilities of the Club which apart from three turf greens and one all weather synthetic (carpet) green, include bar and TAB services, well equipped kitchen/dining facilities and a friendly relaxed atmosphere.\n\nThe following details were prepared at the time of the Club''s 50th anniversary in 2008.\n\nOpening Hours:\nMonday: 3pm – 8pm*\nTuesday: 3pm - 9pm*\nWednesday: 3pm - 12pm**\nThursday: 3pm - 12pm**\nFriday: 3pm - 12pm**\nSaturday: 11am - 12pm**\nSunday: 11am - 10pm**\n\n*closing times may vary ** the club reserves the right to close if less than 5 members are present', 'A', '{"1":[[0.625,0.8333333333]],"2":[[0.625,0.875]],"3":[[0.625,1]],"4":[[0.625,1]],"5":[[0.625,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/Doubleview-Bowling-Club-186000678263115', '', '', '', '', '', ''),
  (108710, 'cambridge-bowling-club-108710', 'Cambridge Bowling Club', '', 'The Cambridge Knights have  finished on top of the  Premier League table and  captured the minor  premier title for the first time  in the history of  the Cambridge  Bowling & Recreation Club.', 272810, '2016-04-15 00:22:20', '2016-04-15 00:25:19', '', 191, 2071, 'bowling club', 272810, 0, '', 'cambridgebowlsclub@bigpond.com', '0893873018', '', '', '', 'http://www.cambridgebowlingclub.com.au/', 'The Cambridge Bowling and Recreation Club was formed in 2003 as a result of a merger between Floreat Bowling Club and City Beach Bowling Club.\n\nFloreat Bowling Club was formed in 1954 and City Beach Bowling Club in 1959.\n\nFor various reasons the committees of both clubs decided that in the interests of members a merger between the both clubs was a desirable outcome.\n\nMr Ray Delmenico President of City Beach Bowling Club and Mr Barry Rubie President of Floreat Bowling Club were charged with the task of negotiating with the Town of Cambridge to facilitate the merger on behalf of and for the benefit of present and future members.\n\nThe merger became a reality and the club moved into magnificent new premises with two grass greens and two carpet greens in September 2003.\n\nMr Ray Delmenico was appointed as founding President of Cambridge Bowling and Recreation Club with Mr Barry Rubie Vice President.\n\nThe club has flourished in the ensuing years and has enjoyed success both on the green and as a warm and friendly place for fellowship.\n\nIn 2012 the Cambridge Bowling and Recreation Club created history by winning the Premier League Pennant.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.7916666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.7916666667]],"6":[[0.375,0.7916666667]],"0":[[0.375,0.7916666667]]}', '', '', '', '', '', '', 'https://plus.google.com/117247284334731705563/about'),
  (108711, 'liverpool-catholic-club-108711', 'Liverpool Catholic Club', '', 'Liverpool Catholic Club is a leading organisation that offers a range of quality entertainment, and leisure services. Function Rooms can cater to all your formal banquet or small cocktail parties.', 272812, '2016-04-15 00:24:37', '2016-04-15 00:26:30', '', 191, 2066, 'social club', 272812, 0, '', 'info@liverpoolcatholic.com.au', '0287844878', '', '', '0298213758', 'http://www.liverpoolcatholic.com.au/', 'The Liverpool Catholic Club eam has successfully fulfilled individuals'' private function needs for over 10 years. In November 2001,  a major expansion of facilities was completed including the building of four major new function rooms, two new foyers and surrounding areas. The expansion has resulted in the creation of Western Sydney''s premier function venue.\n\nThe Complex features technologically advanced facilities including new sound and lighting systems that are suitable for the most extravagant function and are certain to astonish both you and your guests.\n\nThe Complex has full catering and bar facilities and can cater for a formal banquet through to a small cocktail function. Our team of talented chefs can create an innovative menu choice to suit individual requirements and budgets. \n\nLocated just five minutes from the M5, the Liverpool Catholic Club is located in the centre South Western Sydney making it central and easy to get to. Ground floor access with no stairs and ample parking mean it''s easy to get settled into your venue.', 'A', '{"1":[[0.4166666667,0.125]],"2":[[0.4166666667,0.125]],"3":[[0.4166666667,0.125]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.375,0.125]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/LiverpoolCatholicClub', '', 'https://www.linkedin.com/company/liverpool-catholic-club', '', '', '', ''),
  (108712, 'cambridge-bowling-club-108712', 'Cambridge Bowling Club', '', 'The Cambridge Knights have  finished on top of the  Premier League table and  captured the minor  premier title for the first time  in the history of  the Cambridge  Bowling & Recreation Club.', 0, '2016-04-15 00:25:49', '2016-04-15 00:25:49', '', 191, 2069, '', 0, 0, '', 'cambridgebowlsclub@bigpond.com', '0893873018', '', '', '', 'http://www.cambridgebowlingclub.com.au/', 'The Cambridge Bowling and Recreation Club was formed in 2003 as a result of a merger between Floreat Bowling Club and City Beach Bowling Club.\n\nFloreat Bowling Club was formed in 1954 and City Beach Bowling Club in 1959.\n\nFor various reasons the committees of both clubs decided that in the interests of members a merger between the both clubs was a desirable outcome.\n\nMr Ray Delmenico President of City Beach Bowling Club and Mr Barry Rubie President of Floreat Bowling Club were charged with the task of negotiating with the Town of Cambridge to facilitate the merger on behalf of and for the benefit of present and future members.\n\nThe merger became a r', 'A', '', '', '', '', '', '', '', 'https://plus.google.com/117247284334731705563/about'),
  (108714, 'soldiers-point-bowling-club-108714', 'Soldiers Point Bowling Club', '', 'Soldiers Point Bowling Club located in Soldiers Point is a perfect location for sports betting, tipping, horse racing, NFL, AFL, soccer, rugby betting and many more.', 272826, '2016-04-15 00:32:07', '2016-04-15 00:35:51', '', 191, 2055, 'bowling club', 272826, 0, '', 'info@soldierspointbc.com.au', '0249827173', '', '', '0249820366', 'http://www.soldierspointbc.com.au/', 'Soldiers Point Bowling Club is the perfect venue for your next function. Our stylish foyer & two function rooms give us the ability to host functions of all sizes.\n\nDINING\n White Sands Bistro is open 7 days with Coffee & Cake from 10am, Lunch from 12-2pm and Dinner from 5:30-8:30pm. A la carte menu & blackboard specials.\n\nFUNCTIONS\n The perfect venue for your next function. With our stylish foyer and two function rooms, we have the ability to host functions of all sizes.\n\nCHILD FRIENDLY\n Adjoining the White Sands Bistro, our undercover play equipment extends to a large and level lawn area.\n\n\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/SoldiersPointBowlingClub', '', 'https://www.linkedin.com/company/soldiers-point-bowling-club-limited', '', '', '', 'https://plus.google.com/107384542446643265445/about'),
  (108715, 'moorebank-sports-club-sporties-108715', 'Moorebank Sports Club - Sporties', '', 'Moorebank Sports Club - Sporties can cater to your next functions for all occasions. Functions includes Brasserie, Alfresco, Auditorium and the Backyard.', 272836, '2016-04-15 00:38:34', '2016-04-15 00:40:28', '', 191, 2050, 'sports club\nsocial club', 272836, 0, '', 'info@moorebanksports.com.au', '0298253300', '', '', '0298253311', 'http://moorebanksports.com.au/', 'Moorebank Sports Club “Sporties” was formed on the 18th February, 1970 to foster junior sport in the Moorebank/Holsworthy/Hammondville area. Three people, Mr Douglas, Mr Hardaker and Mr Logan saw the need for a sporting organisation in the district, which was becoming rapidly populated, this small group and a team of volunteers were pivotal in making the dream come true.\n\nToday the Clubs objectives remain to encourage, foster and promote sport with the function of the board management and staff to serve in the best interests of creating a legacy of strong local sport in the area. As the business has evolved the vision statement has expanded beyond the sporting doctrine to encompass all forms of leisure and to create a unique experience of high quality for all members and guests.\n\nThe Club is located in close proximity to the Holsworthy Army Barracks, Holsworthy Station and an ever growing residential area, where there is a large population of school age children and defence force personnel who live in the immediate area.\n\nDuring 2010-2011 Sporties underwent a major facelift to create what we see today a family friendly, inviting environment that is often called the Hub of the community, offering our members and guests a range of services including 4 Bars, TAB and Keno, bottleshop, 200 seat brasserie and alfresco dining area, supervised occasional children’s play room, lounge areas, numerous outdoor entertainment decks and children’s outdoor play equipment.\n\nOn any given day you will see mum’s and bubs meeting for coffee, families meeting for meals, locals enjoying our free entertainment on Friday and Saturday nights and children having fun in our Manta Ray kids room or on our outdoor play equipment.\n\nWe hope you can come down to Sporties and experience our award winning hospitality.\n\nSee you at the club.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.125]],"0":[[0.3541666667,1]]}', 'https://www.facebook.com/MoorebankSportsClub', '', 'https://www.linkedin.com/company/moorebank-sports-club', '', '', '', 'https://plus.google.com/103795823008598037770/about'),
  (108716, 'merriwa-bowling-club-108716', 'Merriwa Bowling Club', '', 'Merriwa Bowling Club is an offshoot of the retirement village & as such inherits players who have had their prime bowling years or, in a few cases, introduces men & women to the sport fairly.', 0, '2016-04-15 00:43:30', '2016-04-15 00:44:59', '', 191, 2048, 'bowling club', 0, 0, '', 'info@merriwabowls.com.au', '0894003643', '', '', '', 'http://www.merriwabowls.com.au/', 'MERRIWA BOWLING CLUB has been in existence less than 20 years but has picked up nine Pennant flags in that time - not bad for a club whose members have an average age somewhere in the 70s.\n\nThe bowls club is an offshoot of the retirement village and as such inherits players who have had their prime bowling years or, in a few cases, introduces men and women to the sport fairly late in life. Nevertheless it remains a competitive club although the higher echelons of the men’s game are well out of reach.\n\nFive flags have been won by the men’s section - the first seven years after starting Pennant bowls in the 1996/97 season. Having waited for that elusive first flag, they won two in the same season, 2003/04 - Division Three Silver and Division Four Purple, both Thursday competitions.\n\nThe sudden success coincided with the arrival in the village of Lindsay ‘Joe’ Marsh, who had been playing for 40 years with a host of clubs -­ City Beach, Rockingham and Clairmont. Good enough to be a First Division skip, Lindsay has won 16 titles at Merriwa prior to the 2014/15 season, including the men’s singles six times - five in a row from 2007. His run came to an end in 2012 when beaten in the final by current men’s captain, Bob Gillian.\n\nA radio technician in the air force and later proprietor of a small flying school and local newspaper (the Corridor Courier), Lindsay rates his most difficult final opponent Geoff White, who led for him at Clairmont. Geoff is a resident of the Mindarie retirement village, Harbourside, while other Merriwa bowlers are drawn from the RAAFA estate at Cambrei and the Settlers village, a particularly productive source, and a few from the community at large.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/113796194588951825510/about'),
  (108718, 'corrigin-bowling-club-108718', 'Corrigin Bowling Club', '', '', 0, '2016-04-15 00:49:55', '2016-04-15 00:50:26', '', 191, 2042, 'bowling club', 0, 0, '', '', '0890632344', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (108719, 'newcastle-leagues-108719', 'Newcastle Leagues', '', ' Newcastle Leagues Club is the home of the popular “Watermarks” Bistro & Cafe and to the popular entertainment hub “Level One”. We boast the modern facilities and fantastic staff at Newcastle Leagues.', 272864, '2016-04-15 00:52:01', '2016-04-15 00:52:55', '', 191, 2040, 'leagues club', 272864, 0, '', 'reception@newcastleleaguesclub.com.au', '0249293067', '', '', '0249291618', 'http://www.newcastleleaguesclub.com.au/', 'NEWCASTLE LEAGUES CLUB\nRight in the centre of Newcastle City, Newcastle Leagues Club plays host to the greatest food and entertainment in town. Home of the popular “Watermarks” Bistro and Cafe and to the popular entertainment hub “Level One”, Newcastle Leagues Club is a club on the rise. Boasting modern facilities and fantastic staff Newcastle Leagues Club is Newcastle’s best kept secret. \n\nVisit today and find out why!\n\n', 'A', '{"1":[[0.375,0.875]],"2":[[0.375,0.875]],"3":[[0.375,0.875]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.875]],"0":[[0.375,0.8541666667]]}', 'https://www.facebook.com/newcastleleaguesclub', '', '', '', '', '', 'https://plus.google.com/109824836513887838020/about'),
  (108721, 'gosnells-bowling-club-108721', 'Gosnells Bowling Club', '', 'Gosnells Bowling Club have great facilities where you can enjoy either a serious game of pennants, club championships events, social games (including corporate bowls).', 272898, '2016-04-15 01:16:35', '2016-04-15 01:18:43', '', 191, 2017, 'bowling club', 272898, 0, '', 'secretary@gosnellsbc.com.au', '0893982491', '', '', '', 'http://www.gosnells.bowls.com.au/', 'Gosnells Bowling Club have qualified coaches and members are always willing to help promote and encourage new members.\n\nGosnells Bowling Club have great facilities where you can enjoy either a serious game of pennants, club championships events, social games (including corporate bowls) or just enjoy a casual roll up with your friends.\n\nAn excellent entertainment committee promises to present some great social evenings this season.\n\nBingo is played every Tuesday night all year round.\n\nOur bar facilities are run by professional friendly staff with reasonably priced drinks.\n\nEvery Friday evening you can relax with a drink, & choose from an extensive menu from our very popular Kookaburra Café family restaurant.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Gosnells-Bowling-644195799051062', '', '', '', '', '', ''),
  (108722, 'parkes-leagues-club-108722', 'Parkes Leagues Club', '', 'Parkes Leagues Club located in Parkes provides its guests and members a wide range of services and facilities including bistro, festival events, entertainment, function areas and many more.', 272904, '2016-04-15 01:19:34', '2016-04-28 06:46:43', '', 191, 51, 'leagues club', 272904, 0, '', '', '0268621499', '', '', '0268625593', 'http://www.parkesleaguesclub.com.au/', 'Parkes Leagues Club is the biggest and most diverse function centre in Parkes.\n\nOur range of function rooms can be utalised for a quick business meeting, a training session, personal dinners or can host the most prestige black tie ball, conference/seminars or trade shows up to 600 people\n\nOur difference is our personalised service which you will receive from the moment you enquire, the impeccable co-ordination and experience in hosting events and personal touches which will give your event the WOW factor, and all you will need to do is focus on your business at hand.\n\nParkes Leagues Club has multiple function packages which can be tailored to suit you needs. If you would like to enquire about hosting a function at the Parkes Leagues Club please contact us.\n\nParkes Leagues Club Restaurant is open 7 days a week for Lunch and Dinner.\n\nThe Club has an exciting Australian Style Menu, has daily black board specials and a Pensioner''s Menu. The Parkes Leagues Club prides itself by offering delicious al-a-carte meals at a reasonable price. We cater to all dietary requirements and offer an excellent service to all our customers. We also cater to our Pensioner Market by offering a special menu for our elderly clientele.\n\nWe welcome families and offer a Kids Menu for our younger guests.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.4166666667,0.6666666667]],"0":[[0.4166666667,0.6666666667]]}', '', '', '', '', '', '', ''),
  (108723, 'morley-bowling-club-108723', 'Morley Bowling Club', '', '', 272934, '2016-04-15 01:33:04', '2016-04-15 01:34:38', '', 191, 1977, 'bowling club', 272934, 0, '', 'mbc@eftel.net.au', '0892759712', '', '', '', 'http://www.morleybowlingclub.com.au/', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Morley-Bowling-Club-366726586827262', '', '', '', '', '', 'https://plus.google.com/101416492396904635568/about'),
  (108724, 'bassendean-bowling-club-108724', 'Bassendean Bowling Club', '', 'Bassendean Bowling Club is located at Bassendean and specialises in entertainment. Bassendean Bowling Club offer bowls, poker, darts and more.', 272950, '2016-04-15 01:47:11', '2016-04-15 01:48:28', '', 191, 1970, 'bowling club', 272950, 0, '', 'bassendeanbowls@bigpond.com', '0892791877', '', '', '', 'http://www.bassendeanbc.com.au/', 'The Bassendean Bowling Club was formed in 1934. Theirs was the first section completed on the Bassendean Improvement Committee (BIC) Reserve. The following are the minutes of the meeting, convened by Mr R. A. McDonald, Chairman of the Bassendean Roads Board, of gentlemen interested in the formation of a bowling club, held at the Bassendean Town Hall, on October 15th 1934.\n\nOutside the pavilion of the Bassendean Bowling Club is the plaque or emblem of the club. There is quite a story behind the plaque. It was created by Miss G. A. South of Albany. It is a replica of the Broun family''s Coat of Arms and the club''s badge.\nPeter Broun was the first Colonial Secretary in WA and in 1829 he took a grant of 5 000 acres which he named Bassendean and from which the town sprung up.\n\nThe Bassendean Bowling Club adopted the Broun Family''s Coat of Arms as its club badge in order to pay its respects to Mr Peter Broun, the first colonial Secretary of WA, who founded Bassendean in 1829.\n\nThe Coat of Arms heraldic description is, "A Lion rampant holding in his dexter paw a fleur-de-lis." which is substituted by a kitty in the Bassendean Bowling Club badge.', 'A', '{"1":[[0.625,1]],"2":[[0.5,1]],"3":[[0.625,1]],"4":[[0.5,1]],"5":[[0.625,1]],"6":[[0.4583333333,1]],"0":[[0.625,1]]}', '', '', '', '', '', '', ''),
  (108725, 'south-australian-jockey-club-108725', 'South Australian Jockey Club', '', 'South Australian Jockey Club located in Morphettville is South Australia''s largest and premier racing club playing host to 58 days of racing action throughout Morphettville Racecourse.', 272968, '2016-04-15 01:52:03', '2016-04-15 01:56:15', '', 191, 1962, 'social club', 272968, 0, '', 'enquiries@sajc.com.au', '0882950111', '', '', '0882950111', 'http://www.morphettville.com.au/', 'South Australian Jockey Club is proud to be South Australia’s largest, and premier racing club, playing host to 58 days of racing action throughout the year at Morphettville Racecourse. In addition to racing on a weekly basis, Morphettville is a multipurpose venue featuring 22 function rooms able to host events of all occasions 7 days a week. \n\nThe club has a membership of around 2000, 9 Board Members and employs 90 permanent and up to 400 casual staff. These staff are spread throughout administration, catering, ground staff, race day casuals and the Club''s external entertainment venue, The Junction.\n\nMorphettville is situated only 15 minutes from Adelaide''s CBD, and 5 minutes from Glenelg. It features 25 hectares of picturesque gardens, fabulous wetlands and panoramic views of the Adelaide Hills. Our versatile and unique location can accommodate any event limited only by your imagination!\n\nMorphettville is suitable to host Cocktail parties, 21st birthdays, 18th Birthdays, engagement parties, weddings, corporate dinners, conferences, trade shows, product launches, christenings, social club events, quiz nights, dinner dances, festive dinners, themed dinners, EXPOS, car shows, corporate carnivals.\n', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/sajcmorphettville', 'https://twitter.com/SAJockeyClub', 'https://www.linkedin.com/company/south-australian-jockey-club-inc', '', '', 'https://www.pinterest.com/sajockeyclub/', 'https://plus.google.com/109843993545339552055/about'),
  (108726, 'beaumaris-bowling-club-108726', 'Beaumaris Bowling Club', '', 'Beaumaris Bowling Club is located at Beaumaris and specialises in entertainment service.', 272986, '2016-04-15 01:59:01', '2016-04-15 02:00:31', '', 191, 1960, 'bowling club', 272986, 0, '', '', '0395892708', '', '', '', 'http://beaumarisbowls.com.au/', 'The Beaumaris Bowls Club was established in the 1950s. From our humble beginnings of a tin shed and one green, we have evolved to now have a magnificent club house and two good quality greens. We have one grass green and one green with a synthetic surface which allows summer bowls on two greens and the use of one green throughout the winter.\n\nThe Beaumaris Bowls Club is located in Martin St, Beaumaris, Melbourne (Melways ref 86 E8)\n\nIn season 2015-16 the Club will have over 200 members. Regular competitive bowls are offered through four Saturday and four Tuesday pennant teams and a mixed team in the SDELBC night competition. Regular social bowls are also on offer, together with special social days throughout the season.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/beaumarisbowlsVIC', '', '', '', '', '', 'https://plus.google.com/101683831575361845515/about'),
  (108727, 'springwood-sports-club-108727', 'Springwood Sports Club', '', 'Springwood Sports Club located in Springwood offers a brasserie, cafe, functions, weekend entertainment and 2 bowling greens.', 273004, '2016-04-15 02:05:54', '2016-04-15 02:09:34', '', 191, 1952, 'sports club', 273004, 0, '', 'admin@springwoodsports.com.au', '0247511298', '', '', '', 'http://www.springwoodsports.com.au/', 'Springwood Sports Club is located in the heart of the Springwood community, the gateway to the upper Blue Mountains.  It is just an easy 15 minute drive from Penrith and an excellent stopping off point for journeys further into the Mountains.\n \nWe are renowned for our excellent Brasserie which serves lunch and dinner daily and provides a cafe service all day. The Brasserie team pride themselves on their fresh, made to order food.\n \nThe club has a number of outdoor areas including a large deck and terrace where you can enjoy a get-together with friends or family.  In the winter months warm up in front of our cosy fireplace.\n \nMembers and visitors enjoy our live entertainment at weekends and our raffles and promotions throughout the week.\n \nSpringwood Sports Club has flexible function spaces and often hosts weddings, parties and corporate events.\n \nWe also have two bowling greens and visitors are welcome to have a roll-up on bowls days or book a fun session of barefoot bowls.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.3958333333,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Springwood-Sports-Club-195193400499865/', '', '', '', '', '', 'https://plus.google.com/109826143964448173414/about'),
  (108729, 'st-george-motor-boat-club-108729', 'St George Motor Boat Club', '', 'St George Motor Boat Club is located at Sans Souci and offers excellent facilities from dining and catering to reception and conference as well as a new state-of-the-art Marina for boating enthusiast.', 273044, '2016-04-15 02:26:11', '2016-05-02 02:07:24', '', 191, 1923, 'sailing club', 273044, 0, '', 'reception@stgeorgembc.com.au', '0295297276', '', '', '', 'https://stgeorgembc.com.au/', 'St George Motor Boat Club  is a well established and successful Licensed Club serving the Southern Metropolitan Region of Sydney. The Club offers excellent facilities from Dining and Catering to Reception and Conference Venues as well as a new State of the Art Marina for Boating enthusiasts.\n\nThe St. George Motor Boat Club has a long and proud history of continuous progress and development from the 1920’s to the present day.\n\nThe Club continued to prosper, and so great was the enthusiasm and organisation that in the early thirties, in the depth of the Depression, a dinner was held to celebrate the clearing of all debts from the Club books.\n\nClub additions and extensions were added and opened in 1955.\n\nYou are invited to Sydney’s newest state-of-the-art marina.\n\nSt George Motor Boat Club offers:\n\n• Incredible value with berths from $545 per month\n• Only 8 nautical miles from the Heads of Sydney Harbour\n• Ultra modern facilities\n• Secure marina\n• Discounted fuel available 24/7\n• Cheapest slipway in southern Sydney\n• Access to Club cafe, bars, restaurant and entertainment\n• Visitor berths available from $50 per night\n• Book 11 months, get the 12th month FREE', 'A', '{"1":[[0.3541666667,0.6875]],"2":[[0.3541666667,0.6875]],"3":[[0.3541666667,0.6875]],"4":[[0.3541666667,0.6875]],"5":[[0.3541666667,0.6875]],"6":[[0.3541666667,0.6875]],"0":[[0.3541666667,0.6875]]}', 'https://www.facebook.com/MotorBoatClub', 'https://twitter.com/MotorBoatClub', '', '', '', '', 'https://plus.google.com/115408819960521199764/posts'),
  (108731, 'bedford-bowling-club-108731', 'Bedford Bowling Club', '', '', 0, '2016-04-15 02:39:00', '2016-04-15 02:39:29', '', 191, 1934, 'bowling club', 0, 0, '', 'bedfbowl@highway1.com.au', '0893702454', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Bedford-Bowling-Club-162732240410133', '', '', '', '', '', ''),
  (108732, 'st-george-sailing-club-108732', 'St George Sailing Club', '', 'St George Sailing Club located in Sans Souci offers 2 bars, a bistro an Ala carte restaurant, 2 function rooms with a combined seated capacity of up to 300 people, gaming lounge and many more.', 273070, '2016-04-15 02:43:56', '2016-04-15 02:47:37', '', 191, 1925, 'sailing club', 273070, 0, '', 'enquiries@stgeorgesailingclub.com.au', '0295294911', '', '', '0295294207', 'http://www.stgeorgesailingclub.com.au/', 'St George Sailing Club, located on the water''s edge, overlooking the stunning Botany Bay and George''s River.\n\nAt St George Sailing Club, we provide a happy and welcoming sailing environment for people to enjoy both the recreation, and the sport of sailing.\n\nSt. George Sailing Club has a long colourful and successful history of sailing and we hope to continue delivering an exceptional and rewarding sailing experience for a long time to come.\n\nOur facilities include:\n\n• A Family Friendly Bistro\n• Courtesy Bus Available Friday through to Sunday\n• Members Priced Beers 7 days a week\n• Bingo 2 days a week Wednesday/Friday\n• Monster Meat Raffle every Friday night\n• Super Sunday Meat Raffle every Sunday afternoon\n• Keno, TAB, ATM\n• Ample Parking\n• Not to mention... The best view overlooking Botany Bay!!!', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/St-George-Sailing-Club-118204998238176/', '', 'https://www.linkedin.com/company/st-george-sailing-club', '', '', '', 'https://plus.google.com/115110991837883324665/about'),
  (108735, 'st-georges-basin-country-club-108735', 'St Georges Basin Country Club', '', 'St Georges Basin Country Club located in Sanctuary Point is a club that is packed with great entertainment, fine food and courteous and friendly staff.', 273116, '2016-04-15 03:02:41', '2016-04-15 03:04:36', '', 191, 1906, 'sports club', 273116, 0, '', '', '0244430666', '', '', '0244438084', 'http://www.basincountryclub.com.au/', 'St Georges Basin Country Club  is packed with great entertainment, fine food and above all else, courteous and friendly staff.\n\nOur Club boasts a challenging 18 hole golf course, tennis courts and excellent bowling greens.\n\nSt. Georges Basin Country Club is located in Sanctuary Point on the south coast of New South Wales, Australia and is only a short drive from Nowra.\n\nOn your next visit to this beautiful area why not call in and experience the friendly hospitality of the Club for your self.\n\nWe are the entertainment centre of the South Coast with all the big name bands and shows visiting the Club.\n\nOur auditorium with amphitheatre seating and huge stage is a fantastic live show experience.\n\nBe a winner at the TAB in our recently upgraded TAB bar. Plenty of screens to keep you up to date with all the latest from the track.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/StGeorgesBasinCountryClub/?rf=327323677380900', '', '', '', '', '', 'https://plus.google.com/106172420176085269405/about'),
  (108741, 'tuncurry-beach-bowling-club-108741', 'Tuncurry Beach Bowling Club', '', 'Tuncurry Beach Bowling Club is renowned for its hospitality. Whether it’s playing bowls on one of our sensational greens or enjoying the many leisure facilities available at the club you''ll enjoy.', 273214, '2016-04-15 03:51:31', '2016-04-15 03:57:01', '', 191, 1872, 'bowling club', 273214, 0, '', 'reception@tuncurrybowling.com.au', '0265546477', '0265557124', '', '0265545983', 'http://www.tuncurrybeachbowlingclub.com.au/', 'Tuncurry Bowling Club was founded on 28 September 1955 at a meeting of some 50 keen bowlers at the Bellevue Hill Hotel. These men wanted to create a bowling club in their own community as, without a bridge across the entrance to Wallis Lake, it was difficult for them to get to Forster Bowling Club. They enthusiastically invested their savings to ensure their club became a reality and many local people donated their time and resources to help build the first green and clubhouse.\n\nFrom the time of the opening of the first green in 1957 the popularity of Tuncurry Bowling Club grew steadily. Over the years the club experienced a regular increase in members and visitors and became a successful and profitable club, able to provide a range of amenities and social activities for its members. As its finances were secured by the growth in income, the committee confidently embarked on a number of improvements and extensions to the club.\n\nSince its formation, the primary purpose of the Tuncurry Bowling Club was to promote the game of bowls. From the beginning the members took their sport very seriously and set out to be competitive with other clubs in the area, regularly entering and winning Pennants in the district. Over the years the club achieved many local honours and had a number of champion bowlers in its ranks.\n\nTuncurry Bowling Club now has over 8,000 social and bowling members, a large modern club house and three greens. It is amalgamated with Sydney-based St Johns Park Bowling Club which has increased investment in the club and improved the range of services and benefits for members and visitors.\n\nFunction Facilities\nWe offer wedding packages designed to take the stress our of your special day. Our professional team will assist with every detail of your wedding reception including menu design, room set up, decorations, seating arrangements and entertainment. The Showroom is an ideal venue for weddings, birthdays and anniversaries. Our menu suggestions include two or three course meals, buffets and cocktail parties.\n\nCorporate\nThe club is equipped to provide all the necessary tools for a successful conference or business seminar such as screens, white boards, projectors and sound equipment. Packages including meals and beverages are designed with your business needs and budget in mind.\n\nRooms\nThe Showroom seats up to 330 for a wedding or dinner and more for conference style seating. The Board Room is also available for meetings and small seminars.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/TuncurryBowlingClub', '', 'https://www.linkedin.com/company/tuncurry-beach-bowling-club', '', '', '', 'https://plus.google.com/115802195137576952563/about'),
  (108742, 'bunbury-bowling-club-108742', 'Bunbury Bowling Club', '', 'Bunbury Bowling Club is located at Bunbury provide BBQ, birthday parties, corporate functions, wedding receptions, indoor auctions and more.', 273216, '2016-04-15 03:52:23', '2016-04-15 03:55:15', '', 191, 1879, '', 273216, 0, '', '', '0897213291', '', '', '', 'http://www.bunburybowlingclub.org.au/', 'The present Bunbury Bowling Club was started at a meeting in the Bunbury Ambulance Hall on 10th September 1947.\nLocal politician Fred Withers was delegated to negotiate with the Town Council for land on Forrest Avenue.\n\nThree rinks were planted (to couch grass) and a small clubhouse was built of weatherboard with an iron roof. It had one small window and a door. In it were stored the tools required for the green and the ladies had a cutlery and crockery cupboard. The dining room was a bough shed (wooden framed roofed with boughs).\n\nTea was brewed over an open fire and a kerosene tin utilised for washing up, with water boiled in a copper.\n\nPlay commenced in 1947 - as there were just three rinks, play was one way only.\nWooden bowls were used and often when driving, the small disc controlling the bias would fall out, having to be stuck in again.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', '');
