  (108743, 'surfers-paradise-rsl-108743', 'Surfers Paradise RSL', '', 'Surfers Paradise RSL located in Surfers Paradise is one of the original clubs in Gold Coast providing restaurant, bar & function rooms, sports museum TAB, gaming room and many more.', 273220, '2016-04-15 03:53:33', '2016-04-15 03:56:08', '', 191, 1874, 'rsl club', 273220, 0, '', 'info@surfersrsl.com.au', '0755398966', '', '', '0755317083', 'http://www.surfersrsl.com.au/', 'Surfers Paradise RSL has a long history on the Gold Coast. Steeped in tradition, it remains one of the only original Clubs in Surfers Paradise. Today, it proudly boasts almost 5000 financial members, a fabulous Restaurant, Bar & Function Rooms a Sports Museum and a large state of the art TAB and Gaming Room. Taking care of our Members & Guests is of the utmost importance to us as we continue to provide warm service and a safe family environment incorporated with lots of fun, entertainment and fine food for old fashioned prices.\n\nWe have a large collection of Remembrance & Anzac Day Memorabillia for sale including a limited amount of poppy coins. All Memorabillia is available at reception. Private collection war time displays are also viewable throughout the club and we encourage all to browse them.\n\nWhilst we happily welcome visitors, we do encourage you to join our Club so you can take advantage of awesome things like Birthday Vouchers,discounts on your Food & Beverage and chances to win Cash & Prizes. \nMembership is $10 per year or $30 for five years.\n\n\n', 'A', '{"1":[[0.3125,1]],"2":[[0.3125,1]],"3":[[0.3125,1]],"4":[[0.3125,1]],"5":[[0.3125,1]],"6":[[0.3125,1]],"0":[[0.3125,1]]}', 'https://www.facebook.com/surfersrsl/?ref=py_c', 'https://twitter.com/SurfersRSL', '', '', '', '', 'https://plus.google.com/106266880348184663930/about'),
  (108745, 'sydney-rowing-club-108745', 'Sydney Rowing Club', '', 'Sydney Rowing Club located in Abbotsford  aims to be Australia’s best rowing club achieved through the pursuit of excellence & performance at the highest standards.', 273277, '2016-04-15 05:20:20', '2016-04-15 05:23:40', '', 191, 1862, 'social club', 273277, 0, '', '', '0297121199', '', '', '', 'http://www.sydneyrowingclub.com.au/', 'Sydney Rowing Club was established in 1870 and was first located on the site the famous Sydney icon, The Opera House. In 1888 the Club relocated to the western side of Woolloomooloo Bay, between Mrs Macquarie’s Chair and the Domain Baths. It remained at this site until 1947, before moving all activities to its current location in Abbotsford. The property at Abbotsford was purchased back in 1873, which was then known as the Red Cow Inn.\n\nSRC has attracted prestigious members over the years including A.B. “Banjo” Patterson and the first Prime Minister of Australia, Sir Edmund Barton. Recent renovations have re-invented the club and we are proud to be providing award winning bar and dining facilities that fully embrace our magnificent waterfront location. Rowing is and always will be our reason for being. Sydney Rowing Club’s goal is to be Australia’s best rowing club achieved through the pursuit of excellence, performance at the highest standards and the development of strength and quality of character within our members. We wish to build and support high quality programs and facilities that promote access to rowing, excellence in rowing, and use rowing as a means to foster physical activity, health, leadership, and community engagement.\n\nWeddings and Formal Events\n- Formal events including weddings, christenings, birthdays and corporate occassions are our specialty. We offer a choice of two amazing spaces including the Dedes and Wharfside rooms. These fully appointed private rooms provide everything you need for a formal event including your own event co-ordinator, multiple menu choices, spectacular water views and the knowledge and experience of the finer details that will enhance your experience.\n\nThe Lounge\n-Enjoy the sophisticated surrounds as the idylic water views fight for centre stage. The Lounge provides a mix of classic high bench tables and cocktail tables for a more vibrant gathering or sink into an assortment of luxurious armchairs or sumptuous lounges as you enjoy the view and company of good friends.\n\n\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/SydneyRowing/', 'https://twitter.com/sydrowingclub', '', '', '', '', 'https://plus.google.com/116745168317727978026/about'),
  (108749, 'mount-pleasant-bowling-club-108749', 'Mount Pleasant Bowling Club', '', 'Mount Pleasant Bowling Club is located at Ardross and provide corporate functions, office gatherings, team building events, seminars and more.', 273301, '2016-04-15 05:41:11', '2016-04-15 05:44:30', '', 191, 1855, 'bowling club', 273301, 0, '', 'secretary@mtpbc.org.au', '0893644662', '', '', '', 'http://www.mtpbc.org.au/', 'Welcome to the Mount Pleasant Bowling Club\n\nSituated in the heart of the inner suburb of Ardross with first class facilities on and off the bowling green. Here at the Mt Pleasant Bowling Club we have excellent grass and carpet greens for daytime and night-time bowls events.\n\nRecognized as one of the friendliest Clubs South-of-the-Swan-River we value our members, visitors and local businesses. Here you will always get a friendly welcome and enjoy a drink at Club prices.\n\nMount Pleasant Bowling Club offer a wide range of services for both bowlers and non-bowlers, and have indeed a very active social atmosphere at the Club with ongoing social functions regularly offered.\n\nFive Men’s Pennant Divisions on both Saturday and Thursday’s and three Ladies Divisions on Tuesday and Saturday’s have ensured the Club’s continued success on the greens.  With a first class coach and support coaches available for ongoing tuition, why wouldn’t you want to bowl at the Mt Pleasant Bowling Club?\n\nMount Pleasant Bowling Club excellent facilities can cater for any type of function (birthdays, anniversaries) or corporate event/functions.  Corporate bowls is especially popular at the Club.\n\nMount Pleasant Bowling Club has a very strong connection with the local community and believes it is a family oriented Club for all ages.', 'A', '{"1":[[0.5833333333,0.8333333333]],"2":[[0.5416666667,0.8333333333]],"3":[[0.5833333333,0.8333333333]],"4":[[0.5,0.8333333333]],"5":[[0.5833333333,0.9791666667]],"6":[[0.5,0.875]],"0":[[0.5833333333,0.8333333333]]}', 'https://www.facebook.com/Mount-Pleasant-Bowling-Club-139439049462483', '', '', '', '', '', ''),
  (108753, 'toronto-workers-club-108753', 'Toronto Workers Club', '', 'Toronto Workers Club located in Toronto offers members a range of comfortable and moder facilities, delicious dining choices great promotions activities and entertainment. ', 273375, '2016-04-15 06:17:36', '2016-04-15 06:19:40', '', 191, 1829, 'social club', 273375, 0, '', 'enquiries@torontoworkersclub.com.au', '0249592011', '', '', '0249504359', 'http://www.torontoworkers.com.au/', 'Toronto Workers Club is recognised as the premier club in the West Lake Macquarie area. Toronto Workers Club has a long and established history in the local region and has developed strong links with local community, sporting and interest groups.\n\nToronto Workers Club exists for its members and community, hosting a range of comfortable and modern facilities, delicious dining choices and great promotions, activities and entertainment.\n\nIn 2008 Toronto Workers Club amalgamated with Toronto Country Club and is now pleased to offer members\ntwo clubs as part of their valued membership. Located at beautiful Kilaben Bay, Toronto Country Club hosts an 18 hole golf course, pro-shop and fine dining and function facilities.\n\nWhether you are looking to have a game of  bowls, tennis or snooker, have a drink with friends, a family meal, or wanting to enjoy some great entertainment, Toronto Workers Club is the premier choice in the West Lake''s region.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9583333333]],"3":[[0.375,1]],"4":[[0.375,1]],"5":[[0.375,0.0416666667]],"6":[[0.375,0.0416666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/TorontoWorkers', 'https://twitter.com/torontoworkies', 'https://www.linkedin.com/company/toronto-workers-club', '', '', '', 'https://plus.google.com/115083406201802936475/posts'),
  (108754, 'tracy-village-social-and-sports-club-108754', 'Tracy Village Social and Sports Club', '', 'Tracy Village Social and Sports Club located in Wanguri provides many sport and scoial benefits for their members. Tracy Village is the fastest growing Club in Darwin.', 273411, '2016-04-15 06:37:29', '2016-04-15 06:39:46', '', 191, 1814, 'sports club', 273411, 0, '', 'promotions@tracyvillage.com.au', '0889804777', '', '', '0889804777', 'http://www.tracyvillage.com.au/', 'Tracy Village Social and Sports Club located in the the northern suburbs, Tracy Village is the fastest growing Club in Darwin. Proud to be known as one of the Premier Friendly Family Clubs in the NT, we invite locals and visitors to Darwin alike to become members and enjoy the many sport and social benefits our Club provides.\n\n There''s always something happening at Tracy Village. Keep up to date with our upcoming entertainment, events, promotions and development\n\nCLUB FACILITIES INCLUDE:\n\n• Numerous Function areas; Whatever the Occasion; Whatever the Weather!\n• Spacious Lounge Bar for Sport and Entertainment\n• Games Room with 8 Ball, Darts & Jukebox\n• Gaming Lounge with 45 Machines including 4 Jackpot links.\n• NT KENO & TAB with Sky Racing & Fox Sports\n• Bistro & Lounge Serving Lunch & Dinner\n• Playroom for the Kids!\n• Live Music and Dry Season Events\n• Sporting Events Televised on Big Screens \n\nTracy Village holds frequent member promotions which include, Gaming, Food & Beverage specials and our ever popular badge draws and meat tray raffles. Our low drink prices and delicious Bistro meals are unrivalled.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/tracyvillage', '', '', '', '', '', 'https://plus.google.com/118425402780798819899/about'),
  (108757, 'woy-woy-leagues-club-108757', 'Woy Woy Leagues Club ', '', 'Woy Woy Leagues Club features a bright and vibrant café, sleek bistro, 4 bars, 2 function rooms, fantastic sports bar, TAB area, daily promotions and entertainment.', 273436, '2016-04-15 06:44:21', '2016-04-28 03:10:23', '', 191, 169, 'leagues club\nsports club', 273436, 0, '', 'woywoyinfo@eastsgroup.com.au', '0243423366', '', '', '0243443259', 'http://www.woywoyleagues.com.au/', 'WELCOME TO EASTS WOY WOY\n\nSituated 1 hour north of Sydney’s CBD among the lush waterways and sprawling beaches of the sunny Central Coast, Woy Woy Leagues Club caters to all ages. \n\nWith a bright and vibrant café, sleek bistro, 4 bars, 2 function rooms, fantastic sports bar, TAB area, daily promotions and entertainment, Woy Woy Leagues Club has a strong commitment to the local community. \n\nMEMBER BENEFITS\nSome of the many benefits of being an Easts Woy Woy member include:\n \n- $5 bistro voucher upon joining\n- 10% off food\n- Member beverage discounts\n- Member cash promotions\n- Raffles, bingo and trivia\n- Free live music\n- Free courtesy bus\n- 10% off Sydney Roosters merchandise, as well as game day offers\n- Sign in guests\n- Entry all Easts Clubs', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Woy-Woy-Leagues-Club-162183330166/', '', '', '', '', '', 'https://plus.google.com/113562935520714109914/about'),
  (108759, 'the-dickson-tradies-108759', 'The Dickson Tradies', '', 'The Dickson Tradies located in Dickson is one of Canberra''s premier entertainment destinations. The club provides sports bar, lounge bar, giveaways, promotions, and events happening daily.', 273476, '2016-04-15 06:57:41', '2016-04-15 06:57:46', '', 191, 1803, 'social club', 273476, 0, '', 'contactus@thetradies.com.au', '0261625656', '', '', '', 'https://thetradies.com.au/', 'The Dickson Tradies has been a Canberra institution for nearly 50 years and operates licensed community clubs in both Dickson and Woden.\n\nImmensely proud of its history while looking forward to its future, The Tradies is constantly growing and adapting to service the needs of its broadening membership base.\n\nWith the award-winning Quality Hotel Dickson and Quality Hotel Woden adjacent to each respective club, The Tradies provides just about everything its patrons are likely to need in the one location, whether it be a short visit for a meal or a drink, or an extended stay over several days. The Tradies also owns and operates its own fully equipped gymnasium in Dickson, the Northside Fitness Centre.\n\nThe Tradies'' mission is to support the Canberra community and provide modern and progressive clubs with professional staff offering the best in customer service and hospitality, innovative entertainment services, and modern facilities, for our members and their invited guests.', 'A', '{"1":[[0.2708333333,0.1666666667]],"2":[[0.2708333333,0.1666666667]],"3":[[0.2708333333,0.1666666667]],"4":[[0.2708333333,0.1666666667]],"5":[[0.2708333333,0.1666666667]],"6":[[0.3125,0.1666666667]],"0":[[0.3125,0.1666666667]]}', 'https://www.facebook.com/thedicksontradies/', 'https://twitter.com/thetradiesgroup/', '', '', '', '', 'https://plus.google.com/116758043952038246486/about'),
  (108760, 'shelly-beach-golf-club-108760', 'Shelly Beach Golf Club', '', 'Shelly Beach Golf Club offers a wide range of tournaments and competitions organised by the club, whilst our social scene offers something to tempt everyone, from BBQ breakfasts to intimate dining.', 273492, '2016-04-15 07:12:04', '2016-04-28 05:56:32', '', 191, 96, 'golf club', 273492, 0, '', 'kristina@sbgc.com.au', '0243321103', '', '', '', 'http://www.shellybeachgolfclub.com.au/', 'Shelly Beach Golf Club, formerly known as Tuggerah Lakes Golf Club, is located on the New South Wales Central Coast, and is situated at the eastern end of Shelly Beach Road, on the gentle undulating hills overlooking Shelly Beach, a leisurely 40 minute drive from Sydney''s North Shore.\n\nShelly Beach Golf club provides the perfect backdrop for your special occasion with rooms overlooking both beautiful Shelly Beach and our magnificent golf course. Choose between our main function room, sports bar or course (ceremony area) to hold your special occasion.\n\nOur facilities can cater up to 150 guests in style offering a range of menu options to suit your specific requirements.  Our professional functions team is there to help you co-ordinate every aspect of your event.\n\nShelly Beach Golf Club provides members and guests a unique dining experience in our Seaspray Restaurant and Cafe.\n\nEssence Catering under the leadership of Andy Johnson provides a wide array of delectable and mouth-watering menus. One can select from an a la carte menu, daily specials or those special evenings that Andy arranges for the Club’s patrons.\n\nBe sure to show your membership card for your discount and receive your loyalty points.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9375]],"4":[[0.375,0.9375]],"5":[[0.375,1]],"6":[[0.375,1]],"0":[[0.375,0.9375]]}', 'https://www.facebook.com/shellybeachgolfclub/', 'https://twitter.com/shellybeachgolf', '', '', '', '', 'https://plus.google.com/102487132762261989579/about'),
  (108762, 'west-adelaide-football-club-108762', 'West Adelaide Football Club', '', 'West Adelaide Football Club located in Richmond is the home of mighty bloods. Enjoy our comfortable, affordable food and drinks and also take a visit to our bar and bistro.', 273532, '2016-04-15 07:54:25', '2016-04-15 07:55:21', '', 191, 1764, 'sports club', 273532, 0, '', 'general@westadelaidefc.com.au', '0883524022', '', '', '', 'http://westadelaidefc.com.au/', 'West Adelaide Football Club won two parklands premierships prior to 1897 and has since collected nine SANFL League premierships. Added to these highlights are two Champions of Australia titles against Essendon and Carlton, 2 SANFL Cup Premierships 1985 & 1987 and the first SANFL club to win the National Foxtel Cup premiership in 2013. Boasting 14 Magarey Medal winners and 136 State Players, the Bloods also lay claim to some of the greatest names in SA Football history. Club legends like Dick Head, Bruce McGregor, Neil Kerley and Brian Faehse donned the Red and Black.\n\nThen there are the colourful characters like Jack Broadstock and Doug Thomas as well as greats like Fos Williams, Grant Fielke, Tony Modra, Mark Mickan and Shaun Rehn. We have a 4 time Ken Farmer Medallist in Adam Richardson and the club holds the honour of having the first Brownlow Medal winner from SA in Bernie Smith. This award has since been won by Westies Adam Cooney and of course Mark Ricciuto.', 'A', '{"1":[[0.375,0.0833333333]],"2":[[0.375,0.0833333333]],"3":[[0.375,0.0833333333]],"4":[[0.375,0.0833333333]],"5":[[0.375,0.0833333333]],"6":[[0.375,0.0833333333]],"0":[[0.375,0.0833333333]]}', 'https://www.facebook.com/westadelaidefootballclub', 'https://twitter.com/WestAdelaideFC', '', '', '', '', 'https://plus.google.com/110794229107962873282/about'),
  (108764, 'the-westport-club-108764', 'The Westport Club', '', 'The Westport Club located in Port Macquarie is now  the leading entertainment venue and recognised as "Club of the Year" in 2010 and again in 2012. ', 273550, '2016-04-15 08:23:35', '2016-04-15 08:26:13', '', 191, 1759, 'social club', 273550, 0, '', 'enquiries@westportclub.com.au', '0265831499', '', '', '0265836969', 'http://www.thewestportclub.com.au/', 'The Westport Club From the moment you step into The Westport Club, you''ll feel like part of the family! Our friendly team will make you feel at home from the moment you arrive.\n\nRelax with us and enjoy our stunning views of the glorious Hastings River...one of the best views in Port Macquarie.\n\nOur Club offers not only a relaxing atmosphere and friendly service, but delicious meals at our casual dining restaurant Aqua, our own brand of fantastic coffee from Aqua Cafe, live entertainment, exciting promotions, lawn bowls and a professional event centre.\n\nNestled on the banks of the glorious Hastings River, over the years, The Westport Club has been an important part of the social fabric in the Port Macquarie community.\n\nIn its early days, the Grand United Port Macqurie West Bowling Club, as it was known, was formed when a community of gentlemen from the Grand United Order of Oddfellows (GUOOF) or the Lodge as it is more commonly known.\n\nThe growth of the club was considerable and to meet demand, the club opened its first floor extensions in 1980.\n\nA decade on, in 1990, further growth of the club saw additional land purchased adjacent to the Club and more bowling greens erected. The same year an auditorium for 500 was built.', 'A', '{"1":[[0.3541666667,0.125]],"2":[[0.3541666667,0.125]],"3":[[0.3541666667,0.125]],"4":[[0.3541666667,0.125]],"5":[[0.3541666667,0.125]],"6":[[0.3541666667,0.125]],"0":[[0.3541666667,0.125]]}', 'https://www.facebook.com/westportclub/info/?tab=page_info', '', '', '', '', '', ''),
  (108765, 'pantry-of-pappardelle-108765', 'Pantry of Pappardelle', '', 'Pappardelle Pantry is a well familiar name when it comes to providing top quality online pantry pleasures which include gourmet foods, gifts, baskets, hampers, sauces, sweets, truffles and wines etc.', 273588, '2016-04-15 10:50:06', '2016-04-15 10:58:31', '68003786810', 677, 1750, 'italian restaurant\ntake away\nfine dining', 273588, 273612, '', 'ciao@pappardellepantry.com.au', '0289591460', '', '', '', 'http://pappardellepantry.com.au', 'Pappardelle Pantry has created a niche for itself in Australia as far as providing high quality online pantry services like Italian foods, gifts,  truffles, baskets, hampers, sauces, sweets and wines in Sydney is concerned. In the last 25 years, they have acquired a strong customer base. The option of home delivery is the greatest USP of their service.The founders of Pappardelle pantry were inspired by the rich traditions of Italian culinary. The objective of this venture is to offer sumptuous Italian cuisine to the residents of Sydney.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/pappardellepantry', 'https://twitter.com/ppantryonline', '', '', '', '', ''),
  (108768, 'wollongong-golf-club-108768', 'Wollongong Golf Club', '', 'Wollongong Golf Club located in Wollongong combines golf, great food and accommodation all under the one roof. \n', 273783, '2016-04-18 01:51:59', '2016-05-02 03:33:18', '', 191, 1707, 'golf club', 273783, 0, '', 'reception@wollongonggolfclub.com.au', '0242223111', '', '', '0242223100', 'http://www.wollongonggolfclub.com.au/', 'Wollongong Golf Club is only an hour from Sydney, The Wollongong Golf Club is home to a spectacular beachside golf course, a selection of bars and function spaces, offers four star AAA rated accommodation and an award winning restaurant, each with its own stunning views.\n\nEstablished in 1897, a decade before electricity came to the town, the Club has the honour of being one of the oldest in the country.\n\nThe true links style course, plays alongside the beach where members and visitors are welcome to enjoy a round and indulge in one of the most unique experiences that Wollongong has to offer.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Wollongong-Golf-Club-190052511017963/', 'https://twitter.com/wollongonggolfc', '', '', '', '', 'https://plus.google.com/115291469561166691821/about'),
  (108769, 'concord-golf-club-108769', 'Concord Golf Club', '', 'Concord Golf Club located in Concord is one of the most prestigious golf clubs in Sydney and run exclusive events & high quality functions including weddings, birthdays and corporate events.', 273801, '2016-04-18 02:07:13', '2016-04-18 02:09:29', '', 191, 1699, 'golf club', 273801, 0, '', '', '0297436111', '', '', '', 'http://www.concordgolfclub.com.au/cms/', 'Concord Golf Club is established 1899, the Club has hosted a number of championship tournaments including the Australian PGA, NSW Open, ANZ Championship and Australian Women’s Open.\n\nThe clubhouse and gardens provide an intimate and picturesque setting for weddings and functions. The quality of the food and beverage service and the facilities of the club as a wedding venue have been recognised with the ABIA award for best club reception venue in NSW in 2010 and 2011. Flexible facilities are also available for conferences and meetings.\n\nConcord Golf Club provides a popular and highly regarded venue for Corporate Golf Days and events.\n\n', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.3958333333,0.7291666667]]}', 'https://www.facebook.com/ConcordGolfClub', 'https://twitter.com/concordgolfclub', '', '', '', '', 'https://plus.google.com/114284918247435839417/about'),
  (108771, 'concord-rsl-community-club-108771', 'Concord RSL & Community Club', '', 'Concord RSL Bowling Club located in Concord West is a perfect location for horse racing, sports betting, NFL, AFL, soccer, rugby betting, terminals, fixed and more.', 273827, '2016-04-18 02:27:22', '2016-04-28 00:50:33', '', 191, 258, 'rsl club\nbowling club', 273827, 0, 'Nirranda St', 'info@concordrsl.com.au', '0297431308', '', '', '0297431237', 'http://www.clubconcord.com/', 'Concord RSL Bowling Club is a club that provides a great service to all its members and recognises the importance of your membership to the RSL. Our friendly staff offer a great service to all our members and are only too happy to extend what our club has to offer by going that one step further and making each member feel welcome and creating an environment for individuals and families too enjoy.\n\nAs a member of Concord R.S.L you will enjoy the privileges of having joined one of Australia’s oldest and most friendly organisations. We are committed to high quality service. We are an organisation dedicated to honouring those who have served our nation through military service and the belief that the care of veterans and their dependants remain our core role.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/ConcordRSL/', '', '', '', '', '', 'https://plus.google.com/117222233546247752471/about'),
  (108772, 'condong-bowling-club-108772', 'Condong Bowling Club', '', 'Condong Bowling Club located in Condong is " The friendliest little Club on the tweed " offering range of meals at great prices, caters for corporate, social or barefoot bowls events and more.', 273843, '2016-04-18 02:43:33', '2016-04-18 02:44:54', '', 191, 1690, 'bowling club', 273843, 0, '', 'condongbowls@bigpond.com', '0266722238', '', '', '', 'http://www.condongbowlingclub.com.au/', 'Condong Bowling Club is situated in the Tweed Valley opposite the iconic Condong Mill, Condong Bowling Club - just off Tweed Valley Way, is an easy 20 minute drive from Gold Coast Airport, only 27km south of Tweed Heads NSW and 6km north of Murwillumbah NSW.  \n\nWe have 3 greens available and host a range of tournaments throughout the year and we welcome other Clubs to come for a roll-up against our social teams - The Cane Toads and The Galahs . At Condong we can also cater for corporate, social or barefoot bowls events and can tailor a package to suit your needs. If you have never played lawn bowls before our friendly bowlers will be more than happy to show you how.\n\nThe Bistro is open Thursday and Friday nights, from 6pm, offering a range of meals at great prices.\n\nOur function room can comfortably accommodate 150 people for any event you may wish to hold, with plenty of dance floor space and a stage should you require. We can cater a package to suit your individual needs:\n\n• Wedding Receptions, Engagement Parties\n• Birthday Parties\n• Christmas Functions\n• Farewells\n• Seminars, Meetings\n ', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.375,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/Condong-Bowling-Club-173782272706782/info/?tab=overview', '', 'https://www.linkedin.com/company/condong-bowling-club', '', '', '', ''),
  (108773, 'royal-sydney-yacht-squadron-108773', 'Royal Sydney Yacht Squadron', '', 'Royal Sydney Yacht Squadron (RSYS) located at Kirribilli, features function rooms with its spectacular waterfront location overlooking sparkling Sydney Harbour, perfect for your every celebrations.', 273859, '2016-04-18 02:53:17', '2016-04-18 02:55:48', '', 191, 1683, 'sailing club\nsocial club', 273859, 0, '', 'rsys@rsys.com.au', '0299557171', '', '', '0290206230', 'http://www.rsys.com.au/', 'The Royal Sydney Yacht Squadron is a private member sailing club. Located in Kirribilli, Sydney, the Squadron grounds, facilities and services are provided for the enjoyment and utilisation of members and invited guests.\n\nThe Royal Sydney Yacht Squadron is one of Australia''s leading clubs within the sport of sailing and is regarded as the premier yacht club in Australia.\n\nThe clubs racing program and activities extend throughout both summer and winter. Our professional staff ensure that the club''s program is innovative, safe and user orientated. Our racing combines extensive inshore racing as well as a dedicated offshore program. The racing program is open to non members and we welcome visitors whether it be for a casual inshore race or a season pointscore. The summer racing schedule includes twilight racing on Friday evening, Saturday''s classic inshore series and the growing Tuesday ladies twilights.\n \nMembers or visitors of any ability can enjoy the various fleets, divisions, great sailing locations and competition. The club has a wide and varied range of sailing activities available, including training and seminars to increase your skills.\n \nHost Your Function at the Club\nWith its spectacular waterfront location overlooking sparkling Sydney Harbour, the Club can cater for everything from weddings to birthdays, conferences, seminars and Christmas parties.\n\nThere are various rooms and areas at the Club, to accommodate many numbers of guests.\n\n', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/RoyalSydneyYachtSquadron', 'https://twitter.com/RSYS1862', 'https://www.linkedin.com/company/royal-sydney-yacht-squadron', '', '', '', ''),
  (108776, 'coogee-sports-club-108776', 'Coogee Sports Club', '', 'Coogee Sports Club located in Coogee has been a longstanding and proud lawns  clubs for many years now. Coogee Sports Club is a perfect place to spend an afternoon with family and friends.', 273881, '2016-04-18 03:03:06', '2016-04-18 03:05:00', '', 191, 1678, 'bowling club', 273881, 0, '', 'coogeebowls@gmail.com', '0296655782', '', '', '', 'http://www.coogeesportsclub.com/', 'Coogee Sports Club is focused on providing high-quality service and customer satisfaction - we will do everything we can to meet your expectations. We specialise in Group and Corporate Functions with or without lawn bowls. (Previously known as Coogee Bowling Club)\n\nOur facilities are currently undergoing great change, with lawn bowls still a strong part of what we offer at the Bowling Club. As well as providing some of the cheapest drinks in Coogee with happy hour during the week and amazing deals on beer buckets! We have also began to transform our weekend night life by bringing local Bands from Friday to Sunday every week, with some amazing regulars and new talent streaming through our doors, they do not disappoint. With summer coming quickly don''t forget to book some bowling functions with us, as well as our function room for those special events.', 'A', '{"1":[[0.5,0.9166666667]],"2":[[0.5,0.9166666667]],"3":[[0.5,0.9166666667]],"4":[[0.5,0.9166666667]],"5":[[0.5,0.9583333333]],"6":[[0.5,1]],"0":[[0.5,0.9166666667]]}', 'https://www.facebook.com/coogeesportsclub/', '', '', '', '', '', 'https://plus.google.com/105614079817746022521/posts'),
  (108779, 'blues-point-yacht-club-108779', 'Blues Point Yacht Club', '', '', 273913, '2016-04-18 03:19:35', '2016-04-18 03:21:57', '', 191, 1668, 'sailing club', 273913, 0, 'PO Box 7040', '', '0299555803', '', '', '', 'http://www.bpyc.com.au/', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (108780, 'coolamatong-country-club-108780', 'Coolamatong Country Club', '', '', 0, '2016-04-18 03:29:51', '2016-04-18 03:30:01', '', 191, 1657, 'bowling club', 0, 0, '', '', '0264563321', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108781, 'sydney-flying-squadron-108781', 'Sydney Flying Squadron', '', 'Sydney Flying Squadron is located at Kirribilli and provide restaurants, sailing and more.', 273931, '2016-04-18 03:30:59', '2016-04-27 00:55:00', '', 191, 556, 'sailing club\nsocial club', 273931, 0, '', 'info@sydneyflyingsquadron.com.au', '0299558350', '', '', '0299567173', 'http://www.sydneyflyingsquadron.com.au/', 'The Sydney Flying Squadron, affectionately called The Squaddy by its members and locals, is Australia''s oldest open boat sailing club on the shores of Sydney Harbour.\n \nAlso very important to us is having a committed sailing, social and maintenance volunteer base. A small club like ours relies on its members for many skills and we really appreciate all their support. Please email us and let us know if there are any areas in which you can assist us. \n\nSydney Flying Squadron evolved from a group of men owning small boats, 6 footers, 12 footers,14 footers and there were also larger boats 18 foot and above.The designs of the boats were originally based on open work boats. Many people saw skiff racing as a working man''s sport unlike the well to do who sailed expensive yachts.\n\nAt their peak more than 30 18 footers raced each week, followed by crowds of spectators and punters in chartered ferries. Boating in those days attracted as great a following as horseracing did. An egalitarian attitude had existed in sailing. Those who sail open boats were given the opportunity to compete as equals.', 'A', '{"2":[[0.5,0.8958333333]],"3":[[0.5,0.8958333333]],"4":[[0.5,0.8958333333]],"5":[[0.5,0.9166666667]],"6":[[0.5,0.9166666667]],"0":[[0.5,0.9166666667]]}', 'https://www.facebook.com/SydneyFlyingSquadron', '', 'https://www.linkedin.com/company/sydney-flying-squadron-ltd', '', '', '', 'https://plus.google.com/+SydneyFlyingSquadronKirribilli/about'),
  (108784, 'cootamundra-country-club-108784', 'Cootamundra Country Club', '', 'Cootamundra Country Club located in Cootamundra provides golf bowls, croquet, bistro, and entertertaiment and more. Enjoy your visit to our website and hopefully we will see you here.', 273959, '2016-04-18 03:47:15', '2016-04-18 03:48:20', '', 191, 1647, 'bowling club', 273959, 0, '', 'cc-club@bigpond.net.au', '0269422313', '', '', '', 'http://www.cootamundracountryclub.com.au/', 'Cootamundra Country Club is nestled 1 hour off the Hume Freeway. 380km’s south west of Sydney, and 500 km’s North of Melbourne.\n\nWe have a golf course that should be on everyone’s bucket list. Each hole is different, landscapes and views are the best in town. The clubhouse is welcoming and we would like to invite you to come in anytime and say “Gday”.\n\nWe have a beautiful 4 star motel beside us. The Heritage Motel. The Club boasts a magnificent restaurant/bistro.', 'A', '{"1":[[0.25,0.875]],"2":[[0.25,0.875]],"3":[[0.5,0.5833333333],[0.25,0.875]],"4":[[0.5,0.5833333333],[0.25,0.875]],"5":[[0.5,0.5833333333],[0.25,0.875]],"6":[[0.5,0.5833333333],[0.25,0.875]],"0":[[0.5,0.5833333333],[0.25,0.875]]}', 'https://www.facebook.com/Cootamundra-Country-Club-405525736295078/', '', '', '', '', '', 'https://plus.google.com/110044206911237419108/about'),
  (108785, 'balmain-sailing-club-108785', 'Balmain Sailing Club', '', 'Balmain Sailing Club located at Water Street in Balmain, is a friendly community based sailing club with active training, racing, cruising and social programs.', 274018, '2016-04-18 03:59:34', '2016-04-18 05:16:02', '', 191, 1634, 'sailing club', 274018, 0, 'Water Street', 'info@balmainsailingclub.com', '0298102086', '', '', '0298188850', 'http://www.balmainsailingclub.com/', 'The Balmain Sailing Club is a friendly, inclusive sailing club with regular racing, cruising and a sailing school for adults.  The emphasis is on fun and friendly competition in a beautiful waterfront location.\n\nWe welcome sailors of all levels of experience and we are always happy to see new people joining the community and our fantastic team of volunteers.\n\nMembership and Fees\nBecome a Member of the Balmain Sailing Club\n\nA BSC membership automatically gives you membership of Yachting NSW and Yachting Australia, which provides insurance cover under their Sports Accident Insurance Scheme.\n\nYA membership, through an affiliated club such as Balmain Sailing Club, is required under the Racing Rules of Sailing for any crew member participating in more than three races.\n\nMembership to the Balmain Sailing Club has many benefits, including:\n\n• Discounts on Race Fees\n• Membership to Yachting NSW (visit their website for a comprehensive list of benefits)\n• Free Entry to Balmain Sailing Club Education and Training Nights\n• Discounts for Balmain Sailing Club Merchandise\n• Access to the Balmain Sailing Club club-house and waterfront facilities   - including storage of racing dinghies, sails, tender storage and pontoon\n• Connection to a wonderful group of like-minded souls - all interested in sailing and racing\n• Active calendar which includes social and sailing events\n• Presentation Night and Prize Giving.\n• Great opportunities for community-building and volunteering\n\nWe are an inclusive, community-minded club.  We strive to provide a connection between our local community and our club members, many of whom live or work in or near Balmain.  We welcome all new members, their friends and family.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.75]],"0":[[0.375,0.75]]}', 'https://www.facebook.com/BalmainSailingClub', 'https://twitter.com/BalmainSailing', '', '', '', '', 'https://plus.google.com/102416807369887038978/about'),
  (108788, 'cootamundra-ex-servicemens-citizens-memorial-club-108788', 'Cootamundra Ex-Servicemens & Citizens Memorial Club', '', 'Cootamundra Ex-Servicemens & Citizens Memorial Club located in Cootamundra is a social club, bar that provides live entertainment great food and many more. Come visit us .', 273973, '2016-04-18 04:11:37', '2016-04-18 04:15:39', '', 191, 1643, 'social club', 273973, 0, '', 'ceo@cootaclub.com.au', '0269421677', '', '', '', 'http://www.cootaclub.com.au/', 'Cootamundra Ex-Servicemens & Citizens Memorial Club is a premier home for live entertainment and great food. If you have just a few hours to spend, or are planning a short holiday, you will find The Coota Club has all you need and more for a great experience in one of Australia’s friendliest towns.\n\nCricket''s greatest batsman, Sir Donald Bradman was born in Cootamundra, which also boasts the oldest country golf course in NSW.  A friendly town, noted for its hospitality towards visitors, and surrounded by beautiful countryside that makes a visit to Cootamundra a must for nature lovers and those looking for somewhere special to relax.\n\nCootamundra is also an excellent location for your next business conference or seminar. High quality accommodation is available in the town.\n\nOnly 4 hours easy driving from Sydney, Cootamundra is also a major hub for Countrylink trains and buses, and is only an hour from Wagga airport which has frequent flights to Sydney and Melbourn.\n\nDining\n- A real culinary experience await you at The Coota Club! Whether it’s a fabulous steak cooked to order, or what people refer to as the “best Chicken Parmigiana” in the district, our Choices Bistro is rightly proud of its reputation for high quality and value for money meals.\n\nWeddings & Functions\n- Our experience and facilities make The Coota Club the absolutely preferred venue for your Wedding, Party or any get-together. We will work together with you to ensure the success of your important day or event, and you will have your own personal co-ordinator who will discuss and deal with your personal requirements. \n', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/109327292954288565173/about'),
  (108789, 'peter-wynn-s-score-108789', 'Peter Wynn''s Score', '', 'Peter Wynn''s Score is a well established e-commerce website, which have been offering rugby and soccer goods in Australia since 1988, Parramatta.   ', 273983, '2016-04-18 04:57:23', '2016-04-18 05:03:15', '84003430886', 674, 1641, 'leagues club\nsports club', 273983, 273984, '', 'sales@peterwynnscore.com.au', '0298912655', '', '', '', 'http://www.peterwynnscore.com.au', 'Peter Wynn''s Score is a well established e-commerce website, which have been offering rugby and soccer goods in Australia since 1988, Parramatta.   Peter Wynn''s Score is growing rapidly under the leadership of  former rugby player Mr. Peter Wynn and his brother in law Mr. Mark Assef. We offer the best and the biggest collection of rugby goods, which every true sports lover or player will find hard to resist. Every individual in our team work hard to improve your online shopping experience. We make sure that all your online payment transactions made in the favour of peter Wynn''s Score are safe and we do care for your privacy.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.375,0.7083333333]],"0":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/peterwynnscore', 'https://twitter.com/peterwynnscore', '', '', '', 'https://au.pinterest.com/peterwynnscore', ''),
