  (108792, 'corrimal-bowling-club-ltd-108792', 'Corrimal Bowling Club Ltd.', '', 'Corrimal Bowling Club Ltd. located in Corrimal was the first club opened in 1905  and to have had many zone flags in the past years.', 274036, '2016-04-18 05:25:56', '2016-04-28 06:42:05', '', 191, 55, 'bowling club', 274036, 0, '', 'info@corrimalbowlingclub.com.au', '0242844786', '', '', '', 'http://www.corrimalbowlingclub.com.au/', 'Corrimal Bowling Club Ltd. is located in Francis street in Corrimal NSW  the club was first opened in 1905 and is proud to have had many Zone flags in the past years.\n\nWelcome members & guests to and friendly club.\n ', 'A', '{"1":[[0.5,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.875]]}', '', '', 'https://www.linkedin.com/company/corrimal-bowling-club', '', '', '', ''),
  (108793, 'cowra-bowling-and-recreation-club-108793', 'Cowra Bowling and Recreation Club', '', 'Cowra Bowling and Recreation Club located in Cowra is club that cares about community and its members, we are the friendly club.', 274070, '2016-04-18 05:44:30', '2016-04-18 05:45:58', '', 191, 1620, 'bowling club', 274070, 0, '', 'cowrabowly@bigpond.com', '0263413219', '', '', '0263411225', 'http://www.cowrabowlingclub.com.au/', 'Cowra Bowling and Recreation Club supports and practices Responsible Service of Alcohol in accordance with the law.\n\nThe Cowra Bowling and Recreation Club services:\n\n• 2 Function Rooms and Auditorium can cater for weddings or special events\n• 2 Bars\n• TAB and Keno\n• Experienced and Friendly Staff\n• Jack High Family Restaurant Open 7 Days for Lunch and Dinner (Daily Specials)\n• 3 fully maintained Bowling Greens\n• Modern Amenities\n• Air conditioned Comfort\n• Plenty of Customer Parking entry from Brougham St\n• Courtesy Bus runs on Friday and Saturday nights from 4PM for members and their guests', 'A', '{"1":[[0.4166666667,0.8958333333]],"2":[[0.4166666667,0.8958333333]],"3":[[0.4166666667,0.8958333333]],"4":[[0.4166666667,0.8958333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.375,0.8958333333]]}', 'https://www.facebook.com/Cowra-Bowling-Recreation-Club-231170020229378/', '', '', '', '', '', ''),
  (108794, 'crescent-head-country-club-108794', 'Crescent Head Country Club', '', 'Crescent Head Country Club located in Crescent Head offers a a relaxed family atmosphere in the beautiful coastal setting. Enjoy our full TAB facilities, Sky channel, Keno, Club library and many more.', 274106, '2016-04-18 05:59:48', '2016-04-18 06:01:18', '', 191, 1612, 'golf club\nbowling club\nsports club', 274106, 0, '', 'entertainment@chcclub.com.au', '0265660268', '', '', '', 'http://www.chcclub.com.au/', 'Crescent Head Country Club offers a relaxed family atmosphere in a beautiful coastal setting. Enjoy a game of golf whilst watching whales and dolphins frolicking in the water.\n\nOr just sit back relax and enjoy the magnificent views across the manicured golf course and iconic world renowned Crescent Head Beach.\n\nWe pride ourselves on being a safe venue and we have won many awards – particularly in the area of sustainability.\n\nCrescent Head Country Club  was formed in 1956 and commenced trading in 1958.\n\nThe Club is the focal point of the local community and has a proud history of assisting to build and maintain important community infrastructure. The Club is a leader in the local community and has received recognition throughout the Club industry and wider community.\n\nThe Club has a proactive and responsible Board of Directors who continue to preserve the community interests and reputation of the Club.\n\nAs part of the Crescent Head Country Club - featuring Australia''s only accredited six hole golf course, all weather bowling green and two tennis courts – this is the ideal spot for a fun day out with family and friends or sporting group tours.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4166666667,0.9583333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/CrescentHeadCountry/', '', '', '', '', '', 'https://plus.google.com/110082601461568378098/about'),
  (108797, 'cronulla-bowling-club-108797', 'Cronulla Bowling Club', '', 'Cronulla Bowling Club located in Cronulla is your perfect location for entertainment, lawn bowls, fine dining and so much more.', 274140, '2016-04-18 06:14:49', '2016-04-18 06:16:49', '', 191, 1602, 'bowling club', 274140, 0, '', 'admin@clubcronulla.com.au', '0295237113', '', '', '0295231758', 'http://www.cronullabowls.com/', 'Cronulla Bowling Club Club has a great line-up of live entertainment each week for the enjoyment of our members and their guests. \n\nOur Function Room is sure to be the perfect venue to host your special occasion or corporate function. We are proud to have Aaron Wade, Executive Chef of fortyone Dining.\n\nIn 1919 Mr Fred Baker, a Cronulla resident, organised a meeting to form a Bowling Club in the area. Unfortunately, as sufficient water could not be found the project fell through and the sum of £600, which had been collected from local residents to form the Club, had to be returned. As Mr Baker left the district in 1920 and as local residents were still very keen to fulfil what Mr Baker initiated, local real estate agent Mr William Ross Souter was asked to carry on the project. Eventually in 1924, a good supply of fresh water was found in sufficient quantities to sustain a green.  Records show that 10 residents held a meeting for the purpose of forming a bowling club for Cronulla and the final outcome is the thriving Club we know today.\n\n', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/clubcronulla?ref=br_tf', '', '', '', '', '', ''),
  (108798, 'crookwell-rsl-services-club-108798', 'Crookwell RSL Services Club', '', '', 274188, '2016-04-18 06:33:13', '2016-04-27 08:03:00', '', 191, 337, 'bowling club', 274188, 0, '', 'crookwe@bigpond.net.au', '0248321265', '', '', '', '', '', 'A', '{"1":[[0.5,0.9166666667]],"2":[[0.5,0.9166666667]],"3":[[0.5,0.9166666667]],"4":[[0.5,0.9166666667]],"5":[[0.4583333333,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.0833333333]]}', 'https://www.facebook.com/CrookwellRSL/info?tab=page_info', '', '', '', '', '', '');
