  (108800, 'aberdeen-bowling-club-108800', 'Aberdeen Bowling Club', '', 'Aberdeen Bowling Club located at Jefferson Park is a Sport and Recreational Club with great dining like Asian, Thai and Chinese Cuisine and we also cater to most functions in our Auditorium.', 0, '2016-04-18 06:42:37', '2016-04-18 06:45:08', '', 191, 1583, 'golf club', 0, 0, ' Jefferson Park', '', '0265437226', '', '', '', '', 'Welcome to Aberdeen Bowling/Sport and Recreation Club.\n\nWe are a great family friendly club.\n\nWether you''re just passing or planning to stay, come in and have an ice cold beverage. Or why not come have a delicious meal in our Asian Restaurant, we have Chinese and Thai meals. Open from Tuesday through to Sunday night.\n\nWe can cater to most functions in our newly painted Auditorium.\n\nWhy not come and have a game of bowls on our beautiful new bowling green, we can book you in for a social game, or can be booked in for competitions.\n\nWhy not have your social function here!!\n\nHave a day of golf, bowls, tennis, darts, pool or a combination. We have BBQ facilities on site  or we can organise catering for your day.\n\nWe have a juke box on site with music while you while away your afternoon relaxing with your ice cold beverage.\n\nSo next time you''re in the area stop by and say hello......\n', 'A', '{"1":[[0.3333333333,0.9166666667]],"2":[[0.3333333333,0.9166666667]],"3":[[0.3333333333,0.9166666667]],"4":[[0.3333333333,0.9583333333]],"5":[[0.3333333333,1]],"6":[[0.2916666667,1]],"0":[[0.3333333333,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/111630555381118258237/about'),
  (108802, 'aberdeen-rsl-108802', 'Aberdeen RSL', '', '', 0, '2016-04-18 06:48:13', '2016-04-18 06:49:26', '', 191, 1578, 'rsl club', 0, 0, '', '', '0265437141', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Aberdeen-RSL-527362904030853', '', '', '', '', '', ''),
  (108804, 'cudgen-leagues-club-108804', 'Cudgen Leagues Club', '', 'Cudgen Leagues Club located in Kingscliff provides conferences venue, functions, weddings, food and fun by the sea at Kngscliff.', 274240, '2016-04-18 06:58:21', '2016-04-18 07:02:05', '', 191, 1570, 'bowling club', 274240, 0, '', '', '0266741816', '', '', '', 'http://www.cudgenleagues.com.au/', 'Cudgen Leagues Club has grown to become a key organisation on the Tweed Coast. The Cudgen Leagues Club is widely recognised for its support of the local community and sporting teams. A great place to meet friends, host your next function, enjoy quality competitively priced meals or simply relax.\n\nOur team is ready to create an experience you wont forget with a courtesy bus to transport you, 3 fully stocked bars, 3 function rooms that can cater for crowds of 15 to 400, a fully stocked bottle shop at great prices, large TAB area, beer garden, 2 of the best bowling greens in the district, quality rugby league just meters from the back door and Hornets Bistro offering a wide selection of meals at great prices.\n\nCudgen Leagues offers superb views in the main function area making it the perfect spot for weddings, birthday parties, anniversaries or watching the football on game day with service that is second to none.\n\nThe Cudgen Leagues Club team is here for you, here for the community!', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/112217052199608141017/about'),
  (108805, 'adaminaby-bowling-and-sports-club-108805', 'Adaminaby Bowling and Sports Club', '', 'Adaminaby Bowling and Sports Club features Bowls for Ladies and Men, Golf club and a diner at the Bistro.', 274264, '2016-04-18 07:09:33', '2016-04-27 05:12:49', '', 191, 433, 'golf club\nbowling club', 274264, 0, 'PO Box 45', 'adaminabybowls@bigpond.com', '0264542248', '', '', '', 'http://www.adaminabybowlingclub.com/', 'Adaminaby Bowling and Sports Clubis a great place to socalise, entertain, or hold a function. Bring family & friends have a drink or two, enjoy a meal from the Bistro,\nplay a game of pool or just appreciate the view over the greens.\n\nCome and enjoy a casual day on our beautiful bowling greens, or join us for annual membership:\n\nMembership One Year $20 -Three Year $50\n\nBar serving ice cold beers on tap, and a selection of spirits, wine and soft drinks.\n\nOr enjoy testing your skills, and play a round of golf at the Adaminaby Golf Club, found on the left hand side of the Snowy Mountains Highway as you approach Adaminaby (look for the red-roofed clubhouse)!', 'A', '{"1":[[0.6666666667,0.9583333333]],"2":[[0.6666666667,0.9583333333]],"3":[[0.6666666667,0.9583333333]],"4":[[0.6666666667,0.9583333333]],"5":[[0.6666666667,0.9583333333]],"6":[[0.5,0.9583333333]],"0":[[0.5,0.9583333333]]}', 'https://www.facebook.com/adaminabybowlingclub', '', '', '', '', '', ''),
  (108807, 'albion-park-bowling-club-108807', 'Albion Park Bowling Club', '', 'Albion Park Bowling Club & Recreational features Three superb outdoor Bowling Greens, a Multi Purpose Function Lounge and Modern Bistro.', 274298, '2016-04-18 07:29:31', '2016-04-28 06:27:25', '', 191, 64, 'bowling club', 274298, 0, '', 'apbcmr@exemail.com.au', '0242561844', '', '', '0242570129', 'http://www.albionparkbowlo.com.au/', 'Albion Park Bowling Club''s first Club House was constructed in 1953 for the princely sum of eighty pounds was a corrugated iron dwelling that became affectionately known to all and sundry as the "Old Tin Shed"\n\nAs the town continued to grow, so to did the Bowling Club and it was subsequently granted its Liquor Licence in September 1959.\n\nThe completion of a major extension/expansion development program in 2003 which was officially opened on the 25th January 2004, now sees the Albion Park Bowling & Recreation Club rank amongst the best on the South Coast.\n\nThe Club can now fortunately lay claim to having:-\n\n•  Three superb, extremely well maintained outdoor Bowling Greens\n•  A Multi Purpose Function Lounge capable of seating 120 people with its own Bar, Kitchen & Toilet facilities, or with the use of an operable wall can accomodate an additional 50 persons\n•  A modern "Mountain View Bistro" capable of catering for 95 patrons at any one time\n•  A feature of the General Lounge area is the magnificent "Horseshoe" shaped bar\n•  A spacious Bowler''s Lounge\n•  A "Silver Category Class" TAB Venue with numerous large screens and monitors\n•  Dart Boards\n•  Pool Table\n•  Outdoor Smoking Area\n•  Four day a week - Wed, Fri, Sat & Sun, Courtesy Bus Service', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9166666667]],"5":[[0.375,1]],"6":[[0.375,1]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/Albion-Park-Bowling-Club-1505091839721705/', '', '', '', '', '', ''),
  (108810, 'alder-park-bowling-club-108810', 'Alder Park Bowling Club', '', 'Alder Park Bowling Club located at New Lambton features Barefoot bowls & BBQs, as well as TAB, Keno and Pool. Our function rooms can cater all your occasions.', 274354, '2016-04-18 08:02:39', '2016-04-18 08:07:00', '', 191, 1538, 'bowling club\nsocial club', 274354, 0, '', 'secretary@alderparkbowlingclub.com.au', '0249525503', '', '', '0249574148', 'http://www.alderparkbowlingclub.com.au/', 'Alder Park Bowling Club \n\nFree Function Room Hire\nSuitable for all occasions. Corporate events, sporting presentations, engagements and weddings, or a general catch-up with friends!\n\nAuditorium\nSuitable for crowds up to 120 people. Perfect for presentations, birthday parties, engagements and weddings. Television for photos and videos. Ramp access and amenities.\n\nUndercover BBQ area with Adjacent Function Room\nIdeal for smaller gatherings such as birthday parties, corporate meetings and team building, baby showers and bucks/hens shows. Next to green, ideal for barefoot bowls.\n\nConsider us for your next engagement party, wedding, corporate function, birthday party or a catch up with friends.\n\n', 'A', '{"1":[[0.5,0.8333333333]],"2":[[0.5,0.8333333333]],"3":[[0.5,0.8333333333]],"4":[[0.5,0.8958333333]],"5":[[0.5,0.9375]],"6":[[0.4166666667,0.8958333333]],"0":[[0.375,0.8333333333]]}', 'https://www.facebook.com/AlderParkBowlo', '', 'https://www.linkedin.com/company/alder-park-bowling-club', '', '', '', 'https://plus.google.com/105761159777337455734/about'),
  (108814, 'currarong-bowling-recreation-club-108814', 'Currarong Bowling & Recreation Club', '', 'Currarong Bowling & Recreation Club is located at Currarong and offers great meal, cold beverage, lawn bowls, fishing comps, darts, snooker/pool, weekly raffles and many more.', 274358, '2016-04-18 08:05:06', '2016-04-28 00:49:55', '', 191, 260, 'bowling club', 274358, 0, '', 'info@currarongclub.com', '0244483038', '', '', '0244483366', 'http://www.currarongbowlingclub.com.au/', 'Currarong Bowling & Recreation Club''s coastal setting overlooking the Pacific Ocean, makes it the perfect place to live or holiday all year round. \n\nThis small fishing and tourist village is located on the northern edge of Beecroft Peninsular on the border of the pristine Jervis Bay. Just 33kms from Nowra or a short 2.5 hour drive from Sydney on the NSW South Coast, there are protected beaches, Surfing Fishing & Swimming Beaches, and plenty of prime Scuba Diving locations. \n\nAn abundance of native animals, ancient plants and endless walking tracks around the local Currarong area will provide something for everyone.\n\nAfter a busy day exploring all Currarong has to offer, stop in at the Currarong Bowling & Recreation Club, grab a great meal and a cold beverage. \n\nJoin Us for Social Lawn Bowls, Fishing Comps, Darts & Snooker/Pool and the BEST COLD BEER IN TOWN. Come down for the weekly Raffles and become a member to be included in the Members Badge Draws & for other benefits.', 'A', '{"1":[[0.5,0.8333333333]],"2":[[0.5,0.8333333333]],"3":[[0.5,0.8333333333]],"4":[[0.5,0.9166666667]],"5":[[0.5,0.9166666667]],"6":[[0.5,0.9166666667]],"0":[[0.5,0.875]]}', 'https://www.facebook.com/currarongclub/?rf=170896622952425', '', '', '', '', '', 'https://plus.google.com/115908463095556763396/about'),
  (108815, 'dapto-bowling-club-108815', 'Dapto Bowling Club', '', 'Dapto Bowling Club located in Dapto offers different club activities to try in a friendly atmosphere. Enjoy a drink and relax, play bowls, dine in the Huntley Bistro and more. Come visit us.', 274390, '2016-04-18 08:21:19', '2016-04-18 08:24:00', '', 191, 1532, 'bowling club', 274390, 0, '', 'daptobc@bigpond.net.au', '0242611160', '0242611230', '', '0242611235', 'http://www.daptobowlingclub.com.au/', 'Dapto Bowling Club started from humble beginnings and has now been operating for over 50 years. With a hand full of local RSL Sub Branch members attending a meeting in 1947/48 at the A& H Hall at the Dapto Showground the idea was proposed to establish a Bowling Club in the local area. \n\nThe club formally established and trading the membership then went onto stamp their authority in the Illawarra as a force to be reckoned with on the bowling greens. A tradition that continues today in all grades and will no doubt continue into the future. \n\nDapto Bowling Club membership currently stands at 1100 members and will no doubt go beyond this figure with the continuing expansion of the Dapto area.\n\nFacilities have also gained much improvement over the period of time including 3 Greens, 100 seat dining area in the Huntley Bistro, Full TAB and Keno facilities, Outdoor Smoking area, weekly entertainment and promotions, Courtesy bus and much more. \n\nBistro\n- The Huntley Bistro is open six days a week Tuesday - Sunday, with an exciting menu and extra friendly service it''s the place to meet.\n\nBowls\n- Bowls program for Dapto Bowling Club: Monday - greens closed, Tuesday mens social bowls and coaching, Wednesday ladies day, open social bowls, Friday mixed mens bowls, Saturday morning coaching and mens bowls (mufti), Sunday mens social bowls.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/DaptoBowlingClub/', '', '', '', '', '', ''),
  (108818, 'alexandria-erskineville-bowling-club-108818', 'Alexandria Erskineville Bowling Club', '', 'Alexandria Erskineville Bowling Club features a great social game of bowls, barefoot bowls, facilities like the Chinese Bistro, Bingo, Keno, TAB, BBQ and function rooms for all your celebrations.', 274444, '2016-04-18 22:36:22', '2016-04-27 01:15:57', '', 191, 548, 'bowling club', 274444, 0, '', 'info@aebowlingclub.com.au', '0295575749', '', '', '0295171291', 'http://www.aebowlingclub.com.au/', 'Alexandria Erskineville Bowling Club\n\nCome and enjoy a great social game of bowls, whether it be family and friends or a business get-to-gether\n\nFacilities\n\nThe Alexandria Erskineville Bowling Club is one of the premier Bowling Clubs in Sydney \n\n•  Greens\nThree first-class greens are maintained consistently throughout the year...\n\n\n•  Bill''s Chinese Bistro	 \nA Dine-In or Takeaway Chinese Bistro is available to all patrons for lunch and dinner.	 \nLUNCH     Mon to Fri 11am - 2.30pm, Sat & Sun 12 noon - 2.30pm	 \nDINNER    Sat to Weds 5pm - 8.30pm, Thurs & Fri 5pm - 9.30pm,\n\n•  Bingo \nA good, old fashioned game of Bingo is played every week for FREE on Monday at 2pm.\n\n \n•  Keno \nKeno winners on a regular basis  "The greatest numbers game ever"\n\n•  TAB \nA Club isn''t complete without a TAB section, and we have a Losing Ticket Barrel which draws prizes weekly\n\n•  BBQ Area\nDuring particular events the BBQ is fired up and out come the Steaks (Rump), Kebabs & Sausages - all prepared by one of the clubs members. Vege burgers available on request.\n\n•  Stage + Dance Floor \nBands, karaoke, and other music or presentation related events are centred around our stage and dance floor. Especially popular on Friday nights! ', 'A', '{"1":[[0.4583333333,0.8333333333]],"2":[[0.4583333333,0.875]],"3":[[0.4583333333,0.875]],"4":[[0.4583333333,0.875]],"5":[[0.4583333333,1]],"6":[[0.4166666667,0.9791666667]],"0":[[0.375,0.875]]}', 'https://www.facebook.com/Alexandria-Erskineville-Bowling-Club-aka-ERKO-150999984919003/', '', 'https://www.linkedin.com/company/alexandria-erskineville-bowling-club', '', '', '', 'https://plus.google.com/111086514586336298268/about'),
  (108820, 'ardlethan-bowling-recreation-club-108820', 'Ardlethan Bowling & Recreation Club', '', '', 0, '2016-04-18 23:19:31', '2016-05-01 23:50:28', '', 191, 1509, 'bowling club', 0, 0, '', '', '0269782033', '', '', '', '', '', 'A', '{"1":[[0.6666666667,0.8333333333]],"2":[[0.6666666667,0.8333333333]],"3":[[0.5,0.875]],"4":[[0.5,0.875]],"5":[[0.5,0.9166666667]],"6":[[0.5,1]],"0":[[0.5,0.8333333333]]}', 'https://www.facebook.com/ArdlethanBowlingRecreationClub', '', '', '', '', '', ''),
  (108821, 'ariah-park-bowling-club-108821', 'Ariah Park Bowling Club', '', '', 0, '2016-04-18 23:23:22', '2016-04-18 23:23:41', '', 191, 1505, 'bowling club', 0, 0, '', '', '0269741092', '0269741447', '', '', '', '', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.875]],"6":[[0.4166666667,0.875]],"0":[[0.4166666667,0.875]]}', '', '', '', '', '', '', ''),
  (108823, 'dee-why-bowling-and-recreation-club-108823', 'Dee Why Bowling And Recreation Club', '', 'Dee Why Bowling And Recreation Club located in Dee Why offers superb greens with facilities including bbq area, functions for birthday, wakes workplace and many more.', 274478, '2016-04-18 23:48:44', '2016-04-18 23:52:32', '', 191, 1498, 'bowling club', 274478, 0, '', 'DY@DYBOWLING.COM.AU', '0299718781', '', '', '0299814218', 'http://dybowling.com.au/', 'Dee Why Bowling And Recreation Club offers three superb greens with all facilities including bbq area and lights suitable for night time corporate and barefoot bowls.\n\nWe also offer two excellent function rooms. The main area is capable of seating up to 120 people with views over the greens, tailored menu and beverage packages to suit. The lower bar area is suitable for smaller functions such as birthday parties, wakes, workplace christmas or farewell parties of 50 to 80 people.\n\nAnd if you''re local on a thursday or friday night, drop in for a fantastic bistro meal with a variety of quality dishes for the whole family. ', 'A', '{"1":[[0.625,0.8333333333]],"2":[[0.5833333333,0.8333333333]],"3":[[0.5,0.8333333333]],"4":[[0.5833333333,0.9166666667]],"5":[[0.5,0.9583333333]],"6":[[0.4583333333,0.8333333333]],"0":[[0.4583333333,0.8333333333]]}', '', '', '', '', '', '', ''),
  (108824, 'artarmon-bowling-club-108824', 'Artarmon Bowling Club', '', 'Artarmon Bowling Club features 2 bowling greens open for competition or social bowlers,  BBQ that you can use and our bar is always available. We have the facilities to let you enjoy yourself here.', 274494, '2016-04-18 23:56:39', '2016-04-18 23:59:29', '', 191, 1494, 'bowling club\nsocial club', 274494, 0, '', '', '0294195353', '', '0419747779', '', 'http://www.artarmonbowlingclub.com.au/', 'Welcome The Artarmon Bowling Club\n\nBusy working life? Need some time out to recharge? Why not enjoy an afternoon in the sun and join in the craze sweeping Sydney.\n\nThe Artarmon Bowling Club, in a peaceful bushland setting, has two bowling greens open for competition and for social bowlers. There is a barbeque that you can use and our bar can be available. We have the facilities available to let you enjoy yourself here.\n\nFor regular bowlers, please come and jon us for a game of bowls on Wednesdays and Saturdays at 12.30pm.  We have mixed ladies and men games on both days.\n\nArtarmon Bowling Club is also an ideal venue for team building excercise, barbeque or team bowls.  It only takes 15 minutes by train from the City and 5 minutes walk from the Artarmon train station.  We have plenty of parking space at our club.\n\nSo why not come on down. You get some exercise, have a laugh, meet different people and experience something new. For larger groups we can organise various competitions to make it even more interesting.\n\nOur club hall is available for hire either on a long term basis or if you are looking for a venue for your baby’s 1st birthday, your 40th or your grandparent’s 90th birthday parties.\n\nYou are always welcome at the Artarmon Bowling Club.', 'A', '{"3":[[0.4791666667,0.6875]],"6":[[0.4583333333,0.25]]}', 'https://www.facebook.com/Artarmon-Bowling-Club-164643466963729/', '', 'https://www.linkedin.com/company/artarmon-bowling-club', '', '', '', ''),
  (108827, 'delungra-memorial-bowling-recreational-club-108827', 'Delungra Memorial Bowling & Recreational Club', '', 'Delungra Memorial Bowling & Recreational Club is a great place to bring your family and friends for a fantastic meal or a good hard earned beer. The Family Friendly Club. Call in and have a cold one.', 0, '2016-04-19 00:26:49', '2016-04-19 00:27:29', '', 191, 1483, 'bowling club', 0, 0, '', '', '0267248204', '', '', '', '', '', 'A', '{"2":[[0.6666666667,1]],"3":[[0.6666666667,1]],"4":[[0.6666666667,1]],"5":[[0.6666666667,1]],"6":[[0.6666666667,1]]}', 'https://www.facebook.com/Delungra-Memorial-Bowling-and-Recreation-Club-790278467751850/', '', '', '', '', '', ''),
  (108828, 'ashford-memorial-bowling-club-108828', 'Ashford Memorial Bowling Club', '', '', 0, '2016-04-19 00:27:23', '2016-04-19 00:27:55', '', 191, 1481, 'bowling club', 0, 0, '', '', '0267254202', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.875]],"6":[[0.4166666667,0.875]],"0":[[0.4166666667,0.875]]}', '', '', '', '', '', '', ''),
  (108829, 'asquith-bowling-recreation-club-108829', 'Asquith Bowling & Recreation Club', '', 'Asquith Bowling and Recreation Club located at Hornsby features facilities such as Lawn BOwls, Bistro, Tab, Keno, Outdoor smoking area, Coffee shop with free weekly entertainment.', 274528, '2016-04-19 00:38:28', '2016-04-19 00:40:24', '', 191, 1477, 'bowling club', 274528, 0, '', 'info@asquithbowlingclub.com.au', '0294771364', '', '', '0294763764', 'http://asquithbowlingclub.com.au/', 'Welcome to Asquith Bowling & Recreation Club, a small and friendly club where our professional staff will make you feel at home, a club where you can be a name and not just a number.\n\nAsquith Bowling & Recreation Club has it’s origins in 1950, initially to provide a venue for the thriving sport of lawn bowls. Today our Club continues to fulfill that same service, whilst providing a family friendly atmosphere for all members and their guests, and encouraging and supporting a range of amateur sports and community groups.\n\nThe Asquith Progress Association was integral to the development of the first stages of what is today a thriving club, strongly supporting the local community. Our Club is located on a site that was initially part of an orchard, then used as a pottery works, and also served as a camp for displaced migrants after WWII. The site was purchased by Hornsby Shire Council in 1950, and ultimately by Asquith Bowling & Recreation Club in 1998.\n\nFacilities\nWe have 3 excellent bowling greens, and offer a range of services and facilities including Tab, Sky Channel, Fox Sports, keno plus much more. Please take the time to explore our web site for more information on our club.\n\nAsquith Bowling & Recreation Club is proud to be a Club NSW Award winning Club. We are proud to support the Local Community and encourage the development of amateur sport.\n\nWe look forward to seeing you soon!', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/asquithbowlingclub/', '', 'https://www.linkedin.com/company/asquith-bowling-club', '', '', '', ''),
  (108830, 'denistone-sports-club-108830', 'Denistone Sports Club ', '', 'Denistone Sports Club located in Denistone provides recreational facilities for the West Ryde , Denistone , Meadowbank and Eastwood communities.  Come and have a go at Fun Bowls, bring your friends.', 274540, '2016-04-19 00:42:40', '2016-04-19 00:45:23', '', 191, 1474, 'sports club', 274540, 0, '', 'hello@denistonesportsclub.com.au', '0298743650', '', '', '', 'http://www.denistonesportsclub.com.au/', 'Denistone Sports Club is a family friendly club located in Chatham Road at West Ryde.\n\nCome and join us for a delicious meal at our bistro, have a fun filled afternoon playing “Barefoot Bowls” with your friends and family.\n\nPerfect venue for all your functions, no hall hire fee charged.\n\nFUNCTIONS:  \n- When thinking of planning your next event, big or small please consider us to host it for you.\nOur Caterer offers an extensive range of options for you to choose from.\n\nWe can cater for up to 150 people for a sit down meal, buffet style or finger food menu. The choice is yours.\n\nWe can work with you to ensure your function runs smoothly and you have a stress free night.\n\n', 'A', '{"1":[[0.625,0.8333333333]],"2":[[0.625,0.8333333333]],"3":[[0.625,0.875]],"4":[[0.625,0.8333333333]],"5":[[0.5,0.9583333333]],"6":[[0.5,0.9583333333]],"0":[[0.5,0.8333333333]]}', 'https://www.facebook.com/Denistone-Sports-Cub-740377846028113/', '', '', '', '', '', ''),
