  (108833, 'denman-bowling-club-108833', 'Denman Bowling Club', '', 'Denman Bowling Club provides its members and guests access to two grassed bowling greens available all year round. Denman is the perfect place to have a roll up on our grassed green and enjoy a drink.', 274570, '2016-04-19 00:57:10', '2016-04-19 01:00:13', '', 191, 1466, 'bowling club', 274570, 0, '', 'dbc10@bigpond.com', '0265472432', '', '', '', 'http://www.denmanbowlingclub.com/', 'Denman Bowling Club is situated in the beautiful Hunter Valley, is the perfect place to stop, relax, enjoy a quiet drink, experience our beautiful cuisine and perhaps have a game of bowls - we have it all, with small town charm.\n\nDenman Bowling Club is an integral part of the Denman community providing not only superior bowls facilities, entertainment, a restaurant facilities but is also a proud supporter of many groups and associations within the Hunter Valley. \n\nDenman Bowling Club provides its members and guests access to two grassed bowling greens, available all year round.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/denmanbowlingclub/info/?tab=overview', '', '', '', '', '', ''),
