  (108836, 'dora-creek-workers-club-108836', 'Dora Creek Workers Club', '', 'Dora Creek Workers Club located in Dora Creek is  a premiere location for sports betting, horse racing, tipping, cricket  , soccer, online betting and more.', 274606, '2016-04-19 01:25:18', '2016-04-19 01:28:23', '', 191, 1455, 'bowling club', 274606, 0, '', 'dcwc@doracreekworkers.com.au', '0249731499', '', '', '', 'http://doracreekworkers.com.au/', 'Dora Creek Workers Club is known as the ‘Friendly Club’, coming from a fabulous dedicated staff, strong and positive leadership from management and the Board. Courtesy of Arnold Tammekand.\n\nWe have been guided by some of the best architects to keep up with current standards and make this another area as comfortable for the smokers as we have tried in the past for the non smokers. Outdoor heaters will be fitted for the colder months and boasts a comfortable outdoors envioroment with a fountain and fish pond with a decor of plants to set it off.\n\nThis outdoor area has been open since July 2007 with unique cane furniture and electric doors giving the patrons easy access to and from. Since the opening there has been no problems with smokers lighting up in the club as they, along with non smokers, enjoy the outside deck which has been complimented from ', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Dora-Creek-Workers-139076029475701/?rf=178350482321753', '', '', '', '', '', 'https://plus.google.com/104582177646171989898/about'),
