  (108839, 'worrells-solvency-forensic-accountants-108839', 'Worrells Solvency & Forensic Accountants', '', 'Worrells Solvency & Forensic Accountants is a firm located in Canberra, dedicated to solvency management, insolvency administration and forensic investigation.', 274664, '2016-04-19 02:07:57', '2016-04-19 02:10:16', '', 191, 1437, 'auditing', 274664, 0, '', 'canberra@worrells.net.au', '0262876000', '', '', '', 'http://www.worrells.net.au/', 'Worrells Solvency & Forensic Accountants is a specialised accountancy practice focusing on insolvency. We are dedicated to the areas of Solvency Management, Insolvency Administration and Financial Investigation.\n\nOur proprietary technology is unrivalled in our profession. With our twice daily online updates, we provide relevant and comprehensive information in real time on current files. We also provide a wealth of general information and current news impacting on insolvency and fraud issues.\n\nWorrells Solvency & Forensic Accountants knows that dealing with personal or business insolvency can be a very stressful time and the pressure is increased when it becomes difficult to obtain reliable and clear information. We use plain talk, we give straight answers and we get fast results. Communicating directly with partners and staff regarding particular files or obtaining general information and advice has never been easier.\n\nWorrells have now been providing high quality insolvency and related services for over 40 years. We pride ourselves on offering reliable and practical solutions to those burdened with debt. Our large investment in state of the art proprietary software streamlines all functions leading to savings which are passed on by way of competitive pricing.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/WorrellsSolvencyForensicAccountants', 'https://twitter.com/Worrells_Solve', 'https://www.linkedin.com/company/worrells-solvency-&-forensic-accountants', '', '', '', ''),
  (108840, 'ballina-bowling-club-108840', 'Ballina Bowling Club', '', 'Ballina Bowling Club on Cherry Street, Ballina features free entertainment every weekend, outdoor terrace and childrens playground, coffee shop, regular promotions including trivia, raffles and poker.', 274680, '2016-04-19 02:10:04', '2016-04-19 02:13:18', '', 191, 1435, 'bowling club', 274680, 0, '', 'info@cherrystreet.com.au', '0266862811', '0266860842', '', '', 'http://www.cherrystreet.com.au/', 'At the Ballina Bowling Club on Cherry Street, Ballina, we offer our members & guests the very best... free entertainment every weekend, outdoor terrace and childrens playground, coffee shop, regular promotions including trivia, raffles, poker and more...\n\nCherry''s Restaurant offer great food at affordable prices. \n\nCLUB FACILITIES\n•  Three bowling greens & two croquet courts\n•  Covered outdoor entertaining area\n•  Outdoor terrace adjoining our covered children''s playground\n•  Air conditioning\n•  TAB\n•  Keno\n•  ATM', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9375]],"3":[[0.375,0.9375]],"4":[[0.375,0.9375]],"5":[[0.375,1]],"6":[[0.375,1]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/cherrystreetsports/', '', '', '', '', '', 'https://plus.google.com/104228123008838033678/about'),
