  (108846, 'act-for-you-108846', 'Act For You', '', 'Act For You is located in Watson, dedicated to providing a personal service to all individuals and businesses regarding taxation and bookkeeping using up to date software and knowledge sources. ', 274732, '2016-04-19 02:40:30', '2016-04-19 02:42:44', '', 191, 1416, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing', 274732, 0, '', 'roger.grylls@actforyou.com.au', '0262411468', '', '', '', 'http://www.actforyou.net.au/', 'Act For You is dedicated to providing a personal service to all individuals and businesses regarding taxation and bookkeeping using up to date software and knowledge sources.\n\nRoger Grylls is an experienced Chartered Accountant and has worked with many renowned clients. Act For You is the Professional Partner of MYOB and has connections with the whole range of retail software provided by MYOB.\n\nAct For You employ highly professional and expert people from different backgrounds.\n\nWe focus on combining practical experience and continuous learning and training, resulting in highly competent professionals who have sound and technical knowledge of the tax laws. This makes them the best Chartered Accountants in Australia.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Act-For-You-517998664930167/', 'https://twitter.com/ActForYou_AU', 'https://www.linkedin.com/company/act-for-you', '', '', '', 'https://plus.google.com/109390148706688827271/about'),
  (108847, 'dubbo-city-bowling-club-108847', 'Dubbo City Bowling Club', '', 'Dubbo City Bowling Club located in Dubbo is a great country bowling club with great food, great company and cold beer. Also enjoy Thai restaurant " Twilights " stunning food.', 274744, '2016-04-19 02:49:11', '2016-04-19 02:51:13', '', 191, 1414, 'sports club', 274744, 0, '', 'dcbc@dcbc.com.au', '0268823619', '', '', '0268818049', 'http://www.dcbc.com.au/', 'Dubbo City Bowling Club is established in 1904, The Dubbo City Bowling Club can be found in the heart of the city in Victoria Park.\n\nThe entrance to the club is on Wingewarra Street, which is one of the main streets of Dubbo running east-west.\n\nDubbo City Bowling Club has 3 well maintained greens, croquet lawn and a fine Asian style restaurant, Jaya Raya, that serves lunch and dinner.\n\nThe Club is just a short stroll form a number of motels and close to the CBD.\nThe picturesque surrounds of Victoria Park have within its boundaries a state of the art skate park, an Orchid House, children’s playground and Dubbo''s unique cultural centre.\n\nDubbo City Bowling Club with Jaya Raya restaurant are combined to treat you to the best in dining and social experience with the ultimate in Asian dishes from SINGAPORE, CHINA, INDONESIA, MALAYSIA & THAILAND', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9583333333]],"5":[[0.375,0.9583333333]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/dcbclub/', '', '', '', '', '', 'https://plus.google.com/111011018366784428715/about'),
