  (108851, 'dubbo-railway-bowling-club-108851', 'Dubbo Railway Bowling Club', '', 'Dubbo Railway Bowling Club located in Dubbo provides first class facilities including function rooms, 3 bowling greens, TAB, keno pool tables and many more .', 274760, '2016-04-19 03:07:54', '2016-04-19 03:10:03', '', 191, 1403, 'sports club', 274760, 0, '', 'admin@rbcdubbo.com', '0268842044', '', '', '0268841585', 'http://dubborailwaybowlingclub.com.au/', 'Dubbo Railway Bowling Club''s diverse event spaces coupled with our experienced professional staff will ensure your event meets all your requirements. Impeccable coordination, culinary excellence, state-of-the-art technology and that personal touch are our trademark, so you can be rest assured that your event will run efficiently, leaving you free to focus on business at hand or just by simply sitting back and enjoying your function. Both our Functions and Catering Department can readily meet any brief. Whether it''s a corporate function for 70 delegates, an intimate engagement, anniversary or birthday party, or a small business meeting over Morning Tea, Sporties Dubbo will certainly satisfy all your requirements. We look forward to supporting you in planning a successful and memorable event. ', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.8958333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/Sporties-Dubbo-Dubbo-Railway-Bowling-Club-155003617854669/', '', 'https://www.linkedin.com/company/dubbo-railway-bowling-club', '', '', '', 'https://plus.google.com/113381337524990024793/about'),
  (108855, 'dural-country-club-108855', 'Dural Country Club', '', 'Dural Country Club located in Dural is a social & general club that is frequently called the that is not a club because of the atmosphere & ambiance, not being similar to Leagues Clubs and RSL Clubs.', 274792, '2016-04-19 03:32:44', '2016-04-19 03:35:09', '', 191, 1383, 'bowling club\nsocial club', 274792, 0, '', 'info@duralcountryclub.com.au', '0296511600', '', '', '0296514272', 'http://www.duralcountryclub.com.au/', 'Dural Country Club was conceived by a group of Local Businessmen in the early 1960''s. It was supported by many of the local Italian Market Gardeners in the district.\n\n• 1963 they obtained a Liquor Licence.\n• 1965 the first Bowling Green was established.\n\nThe Club began as a small Clubhouse only with voluntary labour. The Club has progressed over the years to the Club we have today. We hope that it has kept with time the growing population and its needs in the district.\n\nBOCCE\nThis Italian/European equivalent of lawn bowls \nis played on a hard sand and marble dust court. \nThe Men''s Club play on Friday night at 8.00pm and \nLadies on Thursday night at 8.00pm\n\nLAWN BOWLS \nOne of the most active sports clubs within the Club. There is plenty of opportunity to play bowls for both men and womenof all ages. We encourage new and young players to join our club\n\nFISHING CLUB \nAll types of fishing are catered for including overnight & outside charters. One Sunday each month. Joining fee is $10.00 and the Committee meets at the Club on Friday \nevening should you require further information. \n\nSOCIAL GOLF \nGames are held one Sunday each month at selected courses. The average cost is $40.00 which covers the cost of golf and prizes. Annual Fee is $30.00 with a $40.00 one off booking guarantee. \n\nSNOOKER CLUB \nMeets every Tuesday & Thursday at 7.30pm \nand new Members are welcome.\n', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/Dural-Country-Club-283755298347088/', '', '', '', '', '', 'https://plus.google.com/109138707142958298965/photos'),
  (108858, 'alliance-accounting-108858', 'Alliance Accounting', '', '', 0, '2016-04-19 05:11:24', '2016-04-19 05:11:46', '', 191, 1378, '', 0, 0, '', '', '0262625755', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108860, 'east-lismore-bowling-club-108860', 'East Lismore Bowling Club', '', 'East Lismore Bowling Club located in Lismore is a great venue for everything,  not only is it a fantastic bowls club, it offers great food and cater for any functions, birthdays, anniversary and more.', 274824, '2016-04-19 05:36:57', '2016-04-19 05:40:37', '', 191, 1366, 'bowling club', 274824, 0, '', 'admin@eastlismorebowlingclub.com.au', '0266215098', '', '', '0266213926', 'http://eastlismorebowlingclub.com.au/', 'East Lismore Bowling Club have bowls to suit everyone:\n\n• Competitions/tournaments\n• Ladies Bowls\n• Club Competition Bowls\n• Social Bowls\n• Barefoot Bowls \n\nWhy not let our team cater for your next function at East Lismore Bowling Club - seating up to 200 guests\n\nWe offer a selection of menus to suit your function needs:\n• finger food or cocktail style\n• sit-down meal or\n• buffet\n\nEnjoy the great facilities at East Lismore Bolwing Club for your next function:\n\n• Birthdays\n• Fundraisers\n• Anniversaries\n• Work functions\n• Family gatherings\n• School functions\n• Christmas parties\n• Bowls tournaments', 'A', '{"1":[[0.5,0.8333333333]],"2":[[0.4166666667,0.8333333333]],"3":[[0.4166666667,0.8333333333]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.9583333333]],"6":[[0.4166666667,1]],"0":[[0.5,0.875]]}', 'https://www.facebook.com/East-Lismore-Bowling-Club-170607266284840/', '', '', '', '', '', ''),
  (108864, 'w-d-financial-services-108864', 'W & D Financial Services', '', 'W & D Financial Services located in Narrabeen specialises in business services, specialist services, tax and audit.', 274852, '2016-04-19 05:58:41', '2016-04-19 06:00:16', '', 191, 1358, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing', 274852, 0, '', 'info@wealthdefinition.com.au', '0289685300', '', '', '0289685399', 'http://www.wdfs.com.au/', 'At W & D Financial Services we aim to provide you with advice when your business needs it, not just when you ask for it. We help you manage every aspect of your business and because we establish a one-on-one relationship with each of our clients, our advice is tailor-made for your business. We''ve also developed our traditional auditing and accounting practices into innovative client-focused services. Our flexibility and adaptability ensure we help you get the best results.\n\nW&D Financial Services was founded after World War II by Mr R.J.G. Willoughby who commenced sole practice in the CBD. He was later joined by Mr D J O’N Dunne and together they built the business.\n\nW&D Financial Services may be classified in relative terms as a medium sized general practice with a depth of professional services. Client contact is with the Engagement Partner on a one on one basis, but the firm as a whole services the client.\n\nThere is a balance of age and experience and the firm endeavours to match compatible people with the individuality of the client and the particular needs of the assignment.\n\nFees are generally time based and scaled however fixed price agreements are now an option available to clients.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108866, 'east-roseville-bowling-club-108866', 'East Roseville Bowling Club', '', 'East Roseville Bowling Club located in Roseville Chase  provide social bowling on Wednesdays and Saturdays plus entry to Pennant and State competitions. ', 274863, '2016-04-19 06:08:18', '2016-04-28 01:08:49', '', 191, 243, 'bowling club', 274863, 0, '', 'info@rosevillebowlingclub.com.au', '0294171502', '', '', '', 'http://rosevillebowlingclub.com.au/', 'East Roseville Bowling Club have 3 superb greens in a delightful garden setting with plenty of car parking.\n\nWe may be hidden away but once you find us you won''t want to bowl anywhere else.\n\nOur Mens and Womens Clubs provide social bowling on Wednesdays and Saturdays plus entry to Pennant and State competitions.\n\n\n• Social bowls all year round\n• Club Championships for all levels\n• Pennant Competition for the serious players\n• Best Carnivals and Tournaments on the North Shore\n 	\n• Barefoot bowling during summer evenings\n• Open days and free coaching for new members\n• Corporate Bowling days\n• Special schools days\n\nSo if you are looking to join a friendly group to get some exercise, try those competitive urges or just have fun in one of the best poker machine free clubs on the North Shore, come along and meet us.', 'A', '{"1":[[0.375,0.875]],"2":[[0.375,0.875]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.875]],"6":[[0.375,0.875]],"0":[[0.375,0.875]]}', '', '', '', '', '', '', ''),
  (108867, 'w-a-kusnierz-associates-108867', 'W.A. Kusnierz & Associates', '', '', 0, '2016-04-19 06:08:32', '2016-04-19 06:08:32', '', 191, 1354, '', 0, 0, '', '', '0733539899', '', '', '', '', '', 'A', '', '', '', '', '', '', '', ''),
  (108872, 'ebp-sports-bowling-club-108872', 'EBP Sports Bowling Club', '', 'EBP Sports Bowling Club is  located a short distance from the RSL in Earlwood. A traditional Chinese Restaurant overlooks our bowling greens and tennis courts, which are all available to everyone.', 274895, '2016-04-19 06:26:07', '2016-04-19 06:27:40', '', 191, 1342, 'bowling club\nsports club', 274895, 0, '', 'mail@ebprsl.com.au', '0297893022', '', '', '', 'http://www.ebprsl.com.au/', 'EBP Sports Bowling Club is located a short distance from EBP RSL in Doris Avenue Earlwood. A traditional Chinese Restaurant overlooks our lawn bowling greens and tennis courts, which are all available to the public and members.\n\nEBP Sports Bowling Club have two quality bowling greens. \n\nNew bowlers are always welcome and free coaching with a qualified coach is available for members. There are Social Days, week day and weekend games.', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,0.9583333333]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9583333333]],"5":[[0.375,0.9583333333]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/ebpsportsbowlingclub/', '', '', '', '', '', 'https://plus.google.com/+EBPSportsEarlwood/about'),
