  (108876, 'eden-fishermen-s-recreation-club-108876', 'Eden Fishermen''s Recreation Club', '', 'Eden Fishermen''s Recreation Club located in Eden  is more than a club, it’s an old friend, a haven and a place for fun, enjoyment and relaxation. ', 274909, '2016-04-19 06:38:27', '2016-04-19 06:40:55', '', 191, 1331, 'golf club\nbowling club\nsports club', 274909, 0, '', 'reception@edenfishermens.com.au', '0264961577', '', '', '0264963328', 'http://www.edenfishermens.com.au/', 'Eden Fishermen''s Recreation Club was formed in 1950 to support the fisher men (and women) in the region and still has strong ties to the community.\n\nThe Eden Fishermen’s Club directly employs approximately 40 staff and provides or supports indirect employment to many other people through its business associates, contractors, suppliers and builders.\n\nThe Eden Gardens Country Club was purchased in 1970, it has an \neighteen hole par 71 golf course, two high quality bowling greens, a fully stocked Professional’s shop, hire carts and equipment, a well stocked bar, Club Keno, conference/function rooms, delicious Chinese-Australian Bistro and relaxing beer garden.\n\nThe club is constantly moving forward, renovating, developing and providing something new for its members.\nHighlights include:\n\n• Host to the ALPG Pro AM\n• Renovations to both the Recreation Club and Eden Gardens Country • Club\n• Improvements to the Golf Course & Bowls Facility\n• The Vong Family Catering Business at the Eden Gardens Country Club,\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Eden-Fishermens-Recreation-Club-206541532690190/', '', '', '', '', '', ''),
