  (108880, 'accounting-leverage-108880', 'Accounting Leverage', '', 'Accounting Leverage is a boutique firm located in West Pymble offering a personal service including business advice and planning and taxation.', 274946, '2016-04-19 07:04:39', '2016-04-19 07:06:19', '', 191, 1319, 'tax services\nbusiness advice and planning\nauditing', 274946, 0, '', '', '0294888715', '', '', '', 'http://www.accountingleverage.com/', 'Accounting Leverage is a ''boutique'' firm offering a personal service to our customers - we are on call full time, but not on the full time payroll.\n\nAccounting Leverage limits the clients we take on, and in that way if we gain you as a client, then you can be guaranteed of always getting our priority attention', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', '');
