  (108881, 'w-griffiths-co-pty-ltd-108881', 'W Griffiths & Co Pty Ltd', '', 'W Griffiths & Co Pty Ltd lcoated in Dural specialises in Accounting, Business Advisory, bookkeeping, finance, payroll and taxation.', 274958, '2016-04-19 07:11:33', '2016-04-19 07:18:36', '', 191, 1313, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing\npayroll', 274958, 0, '', '', '0296512288', '', '', '', 'http://www.wgriffiths.com.au/', 'At W Griffiths & Co Pty Ltd , our philosophy is simple, we want you to get the most out of our expertise.  Therefore, rather than just looking backward (by doing your tax return once a year), we want to look forward by guiding you to make important business decisions.  We’ll make a plan and stand by you in order to achieve your goals. We are more than just your accountant, we are like your external financial controller or independent director.\n\nW Griffiths & Co Pty Ltd are members of CPA, NTAA, Ran-ONE and Hayes Knight Knowledge shop, which means that not only have we reached a specific level of expertise and professionalism, but we also have access to reference libraries, knowledge, information and software that is not readily available to others.\n\nYou will get step by step advice without the confusing jargon or technical accounting terms!\n\nW Griffiths & Co Pty Ltd  want you to succeed, and therefore we give you advice in a language that you understand. The art of being a true expert is giving complex information in a basic, easy to understand way.', 'A', '', '', '', '', '', '', '', ''),
  (108882, 'engadine-bowling-club-108882', 'Engadine Bowling Club', '', 'Engadine Bowling Club is located at Engadine. Whether you are organising a special birthday celebration, Christmas party, or engagement party, look no further than Engadine Bowling Club.', 274961, '2016-04-19 07:17:05', '2016-05-01 23:58:12', '', 191, 1311, 'bowling club\nsocial club', 274961, 0, '', 'info@engadinebowling.com.au', '0295482022', '', '', '0295207155', 'http://www.engadinebowling.com.au/', 'Engadine Bowling Club has spent the past 18 months re-developing and upgrading the club’s facilities for our Members and their Guests. The result that can be seen below, provides a fresh new look venue suitable for a wide range of groups and ages.\n\nHere at Engadine Bowling Club we can cater for all events, from 21st Birthdays to 100th Birthdays, Engagement Parties to Weddings, Team Building to Christmas Parties. Whatever your requirements we are here to assist you in planning a successful event.\n\nNew facilities include Kids Play Room, Coffee Shop, Big Screen Televisions in both lounges, new furniture and upgraded air-conditioning throughout.\n\nWe appreciate the patience shown by our Members and Guests throughout this time, and hope that you all enjoy the facilities that we have provided.\n\nWhether you are organising a special birthday celebration, Christmas party, or engagement party, look no further than Engadine Bowling Club. Known for our seamless event coordination, the excellent service provided by our friendly staff members will create a warm and friendly atmosphere allowing your guests to relax and enjoy themselves.\n\nOur newly renovated Function Room is decorated in whites to match any colour scheme. With ample parking, disabled access, fully air conditioned room and audio visual facilities we can cater for all events.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/engadinebowling/info/?tab=overview', 'https://twitter.com/engadinebowling', '', '', '', '', ''),
