  (108917, 'microcosmic-technologies-pty-ltd-108917', 'Microcosmic Technologies Pty Ltd', '', 'Modern Technology Made Easy!\n\nService, support, repairs, upgrades, new installations - computers, networking, ethernet, NBN, telecommunications, fixed line phones, audio visual, home theatre and more!', 275011, '2016-04-20 05:46:47', '2016-04-20 05:57:03', '88167645936', 690, 1248, 'computer\npcs and laptops\nsoftware\ncomputer accessories and consumables\ncomputer maintenance and repairs\nnetworking and storage\nink and printers\nphone repair\nhifi\nelectronics', 275011, 275038, '', 'info@microcosmic.com.au', '1300701393', '', '0425848575', '', 'https://www.microcosmic.com.au', 'Free yourself from unnecessary stress caused by problems with your home or office technology like computers, the internet, computer networking, telephones, home theatre and audio visual setups, etc. On-site technical support, service, repairs and advice is available in Melbourne for home and office users of many modern technologies. Personal, friendly, quality service from a local small business who is an ACMA Registered Cabler, licensed to perform most types of data and telecommunications cabling work, with endorsements to install and test structured ethernet cabling, optical fibre cabling and coaxial cabling. You''ll receive expert support from a tertiary qualified technician with over 15 years experience, OH&S compliant, full public & products liability insurance, property damage insurance, police and working with children checked, certified first aider and authorised Optus NBN & ULL sub-contractor.\n\nGet help with your technology in Melbourne, Victoria and surrounds. On-site service & support, home or office. Same-day (urgent), after hours & weekend bookings available.\n\nPhone Wayne on 1300 701 393 between 8am and 6pm weekdays or send an email - wayne@microcosmic.com.au\n\nGet ready for the NBN!  Get wired for high speed internet, streaming multimedia, fast transfer of data, cheap sometimes free local and international phone calls.\n\nMicrocosmic Technologies Pty Ltd is an ACMA Registered Cabler based in Brunswick, Melbourne, Australia (TITAB cabler registration # T37528). Network cabling, Ethernet networking, fibre optic cabling, phone cabling, coaxial cabling, wall sockets, phone extensions, data points, extra phone sockets, relocate NBN NTD, move your modem, connect NBN VoIP phone to existing sockets through your house, improve your WiFi, increase download speed & more....\n\nA Smart Wired House enjoys FAST Internet, telecommunications and multimedia via a high speed Ethernet cable network supported by wireless technologies when required.  Guaranteed trouble-free connectivity for years into the future, compliant with Australian Standards for your safety.\n\nWe do computer repair and computer networks, Ethernet, coaxial and fibre optic cable stuff, fixed line telephone systems at home or office (no PABX), home theatre systems, audio visual equipment, digital TV Antenna installation and tuning, 240-volt power point (GPO) installation, split system air-conditioning installation, ADSL2+ Internet fault finding and repair, plus heaps more!!\n\nCall Wayne on 1300701393', 'A', '', 'https://www.facebook.com/microcosmic.technologies/', 'https://twitter.com/smart_wired', 'https://au.linkedin.com/in/microcosmic', '', '', '', ''),
  (108919, 'evans-head-bowling-club-108919', 'Evans Head Bowling Club', '', 'Evans Head Bowling Club located in Evans Head has a wide variety of exciting facilities and features, including a brand new outdoor area and luxury cabin accommodation. Come visit us.', 275054, '2016-04-21 06:15:51', '2016-04-21 06:19:07', '', 191, 1232, 'bowling club', 275054, 0, '', '', '0266824343', '', '', '', 'http://www.evansheadbowls.com.au/', 'Evans Head Bowling Club is described as the Jewel in the Crown of the Richmond Valley. Situated on the North Coast of New South Wales about 700km north of Sydney and 180 km south of Brisbane, the beautiful village boasts long, sweeping stretches of clean beaches and river estuaries. \n\nThe town’s population is approximately 3000; however this increases dramatically during holiday periods. Evans Head is a peaceful coastal fishing village surrounded by National parks and beautiful sandy beaches renowned for great surfing. \n\nActivities available within the town are fishing, swimming, tennis, bowls, cricket, rugby league, rugby union, touch football and surfing. The town offers many picnic areas with various facilities. The Bundjalung National Park surrounds the town and offers scenic walks and the chance to spot some local wildlife.\n\nAppreciate the whole area by driving from the centre of town across the bridge, past the boat harbour, take the ocean drive and enjoy spectacular views from Razorback Lookout which is also ideal for whale watching.\n\nWalk along the training wall to see the dolphins at the river mouth and watch the trawlers as they cross the bar to bring in their bounty of fresh seafood. Evans Head is the ideal place for the family to spend their holidays.\n', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/evansheadbowlo', '', '', '', '', '', 'https://plus.google.com/101798403418628584053/about'),
  (108923, 'accounting-services-tailor-made-108923', 'Accounting Services Tailor Made', '', 'Accounting Services Tailor Made are your local experts providing quality tax and business advice, and Tax Agents \nin Port Macquarie.', 275111, '2016-04-21 06:48:20', '2016-04-21 06:49:39', '', 191, 1213, 'tax services\nbusiness advice and planning\nauditing', 275111, 0, '', '', '0265815454', '', '', '', 'http://www.tax-agents-port-macquarie.websyte.com.au/', 'Accounting Services Tailor Made are your local experts providing quality tax and business advice, and Tax Agents in Port Macquarie and the surrounding areas. We provide tax planning and accounting services to businesses, individuals, companies and trusts.\n\nAccounting Services Tailor Made have been in business since 2001 and are customer focused and committed to providing the best in accounting assistance to our valued clients.\n\nOur Services include:\n\n-Self managed super fund auditors\n-Tax agents\n-Tax advice\n-Business advice\n-Planning advice\n-Accounting services for business and individuals.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/112729524480478970536/about'),
  (108924, 'fairy-meadow-bowling-club-108924', 'Fairy Meadow Bowling Club', '', 'Fairy Meadow Bowling Club located in Fairy Meadow offers all types of functions catered for. Free barefoot bowls and free bbq facilities are also available. Come visit us.\n', 275127, '2016-04-21 06:56:10', '2016-04-21 07:00:46', '', 191, 1209, 'bowling club', 275127, 0, '', '', '0242836300', '', '', '', 'http://www.fairymeadowbowls.com.au/', 'Fairy Meadow Bowling Club offers western meals such as succulent steaks, schnitzels, burgers and tempting seafood dishes. There is also a wide choice of Asian meals including Chinese, Thai, Japanese and Malaysian dishes. Each day there are a number of specials on offer and a value children’s menu which includes an ice cream.\n\nAs well as the many daily specials on offer, there are also the following regular specials…\n\nWe offer our Function Room to you for FREE!! (Note that a refundable bond is required). Not only will we save you money on hire of a venue, but you will also get your drinks at Club prices NOT the inflated price some other venues charge.', 'A', '{"1":[[0.3958333333,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.3958333333,0.875]],"4":[[0.3958333333,0.875]],"5":[[0.3958333333,0.875]],"6":[[0.3958333333,0.9791666667]],"0":[[0.3958333333,0.7916666667]]}', 'https://www.facebook.com/Fairy-Meadow-Bowls-Club-186535788081177/timeline', '', 'https://www.linkedin.com/company/fairy-meadow-bowling-club', '', '', '', 'https://plus.google.com/106836184801844921903/about'),
  (108926, 'fingal-bay-bowls-sports-club-108926', 'Fingal Bay Bowls Sports Club', '', 'Fingal Bay Bowls Sports Club located in Fingal Bay offers range of activities and facilities from, bingo, bowls & raffles to live entertainment, special promotions and accommidation.', 275139, '2016-04-21 07:16:01', '2016-04-21 07:18:32', '', 191, 1207, 'bowling club', 275139, 0, '', 'contact@fingalbaysportsclub.com.au', '0249841244', '', '', '0249811468', 'http://www.fingalbaysportsclub.com.au/', 'Fingal Bay Bowls Sports Club have Men’s, Women’s or Mixed Bowls on most days, 2 great greens, one synthetic and one grass. Phone 02 4984 1244 to book a roll-up with friend’s (packages available).\n\nChildren’s playground area is also available with an outdoor area for parents to sit and enjoy a meal whilst the children play. Children’s party menus available (phone the club for enquiries).\n\nThe Bay Breeze Bistro is Open 7 Days for Lunch & Dinner, offering a wide range of mouth-watering dishes with black board specials daily starting from $10.90.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/fingalbaysportsclub/', '', '', '', '', '', 'https://plus.google.com/110646631168804114002/about'),
