  (108928, 'accrew-accountants-108928', 'Accrew Accountants', '', 'Accrew Accountants is an accountants and bookkeepers based in North West Sydney, committed to partnering with clients in order to reach their tax, financial and business goals.', 275145, '2016-04-21 07:29:53', '2016-04-21 07:30:59', '', 191, 1204, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing', 275145, 0, '', 'rainier@accrew.com.au', '0288146633', '', '', '', 'http://www.accrew.com.au/', 'Accrew Accountants was established in 2002 and are based in Northwest Sydney.  We specialise in tax and management accounting services to small business enterprises, as well as individuals in business and/or employment.\n\nACCREW  is a portmanteau word which means ACcounting CREW.  Aside from tax and accounting services to individuals and small businesses,  we can also provide services in financial control and management\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/accrewtaxaccountants', '', '', '', '', '', 'https://www.google.com/maps/place/Accrew+Accountants/@-33.7294934,150.9321962,17z/data=!3m1!4b1!4m2!3m1!1s0x6b129f48e2c70aeb:0x3383d4e3311a531b?hl=en'),
  (108930, 'forbes-sport-recreation-club-108930', 'Forbes Sport & Recreation Club', '', 'Forbes Sport & Recreation Club located in Forbes is a friendly, community-oriented club located beside the picturesque Lake Forbes. Enjoy our facilities including 3 bowling greens, croquet  and more.', 275157, '2016-04-21 09:11:58', '2016-04-21 09:13:52', '', 191, 1201, 'bowling club', 275157, 0, '', 'forbesports@bigpond.com', '0268521499', '', '', '', 'http://www.forbesbowlingclub.com.au/', 'Forbes Sport & Recreation Club is a friendly, community-oriented club located beside the picturesque Lake Forbes.\nCome in and enjoy our excellent facilities which include three bowling greens, croquet, bar, pool table and bistro. \n\nThe Men''s Bowling Club hosts a very popular Easter Carnival, with the Easter Pairs and Easter Fours being the blue ribbon events. In September the Ben Hall Pairs is contested, with teams coming from all over the state to compete in this prestigious event.\n\nOur lady bowlers host a very successful mini-carnival each year at the beginning of winter. These ladies run a very professional carnival, with emphasis on friends and good times. Ladies from all around the district enjoy the Forbes mini-carnival, with all 3 greens required to cater for the entries.\n\nIf you are looking to practice, or just play with friends, you will be made most welcome.  We can also offer the loan of a set of bowls if required.\n\nNever played bowls before, or want to improve your game? Not a problem, we can offer lessons for any skill level with an experienced coach who will have advice for any game level\n\nOur two function areas are available to cater for your special occasion, whether it be a wedding reception, work event, reunion or party.\n\nEnjoy a relaxed drink from the bar while enjoying our pool table and TAB facilities.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', 'https://www.linkedin.com/company/forbes-sports-&-recreation-club', '', '', '', ''),
  (108931, 'five-dock-rsl-memorial-bowling-club-108931', 'Five Dock RSL Memorial Bowling Club', '', '', 0, '2016-04-21 09:17:53', '2016-04-21 09:18:04', '', 191, 1199, 'rsl club\nbowling club', 0, 0, '', '', '0297139445', '', '', '0297122151', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108933, 'forestville-rsl-club-108933', 'Forestville RSL Club', '', 'Forestville RSL Club located in Forestville is just 10 min away from the glorious beaches. Come along & visit us and enjoy the peaceful atmosphere,  great food & daily activities.', 275165, '2016-04-21 09:31:34', '2016-04-21 09:33:09', '', 191, 1191, 'rsl club', 275165, 0, '', 'contact-us@forestvillersl.com.au', '0294511011', '', '', '0299754571', 'http://www.forestvillersl.com.au/', 'Forestville RSL Club Chaplaincy Program cares for people at their point of need, in a safe environment and with active listening skills. For some, this may be an unexpected time of crisis, they feel they have no control over. For others it may be work or family stresses, loneliness, grief or even having to adjust to a relocation.  No matter what the problem is, having someone else who can empathise with you, most often helps to ease the burden and decision making.\n\nClubsNSW have recognised  the value of a Chaplaincy Program to support its patrons and families, who may be facing crisis situations or difficulties.\n\nForestville RSL Club will now be offering the services of Merrill Wong who has been accredited as a Chaplain with Chaplaincy Australia for several years.\n\nChaplain Merrill Wong has worked in both schools and Aged Care, so is very familiar with the issues of loneliness, ageing, loss and grief as well as those difficulties facing families with school aged children. All problems are made easier when they are shared with someone else and held in confidentiality.\n', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.8958333333]],"6":[[0.4166666667,0.8958333333]],"0":[[0.4791666667,0.875]]}', 'https://www.facebook.com/Forestville-RSL-Club-130106250372586/', '', '', '', '', '', ''),
  (108934, 'engagement-party-venues-melbourne-108934', 'Engagement Party Venues Melbourne', '', ' Looking for one of the best <a href="http://www.prahranhotel.com/engagement-party-venues-melbourne/\n"><b>Engagement Party Venues Melbourne</b></a>? Then, Prahran Hotel is the best place.', 275171, '2016-04-21 12:19:12', '2016-04-21 12:23:45', '65205175859', 694, 1186, '', 275171, 0, '', 'info@prahranhotel.com', '0395292168', '', '', '', 'http://www.prahranhotel.com/engagement-party-venues-melbourne/', 'Welcome to venue world at Prahranhotel.com! We have beautiful, luxurious, classy and spacious <a href="http://www.prahranhotel.com/engagement-party-venues-melbourne/">engagement party venues Melbourne</a> that suits to needs and budget of every individual who is planning to organise a grand engagement party. We are located in the best location and our venues are equipped with world-class amenities from delicious food to array to drinks!! For more information call us on: 0395292168 or send us Email on: info@prahranhotel.com .', 'A', '{"1":[[0.5,0.875]],"2":[[0.5,0.875]],"3":[[0.5,0.875]],"4":[[0.5,0.875]],"5":[[0.5,0.875]],"6":[[0.5,0.875]],"0":[[0.5,0.875]]}', '', '', '', '', '', '', ''),
  (108939, 'joe-s-bar-108939', 'Joe''s Bar', '', 'Joe''s Bar located at Kingston is a place to enjoy a curated wine list, classic cocktails and contemporary Italian cuisine.', 275235, '2016-04-22 00:34:05', '2016-04-22 00:58:05', '', 191, 1157, 'italian restaurant', 275235, 0, '', '', '0261780050', '', '', '', 'http://www.joesateast.com/', 'Joe’s is a small bar celebrating big things.\n\nFine produce, fine wine and family ties. A curious & nocturnal meeting place to enjoy a curated wine list, classic cocktails and contemporary Italian fare.\n\nThe wine list at Joe’s Bar celebrates a passion for wine both local and Italian.  It hopes to provide a mix of easy drinking wines, food wines to match Chef Francesco’s menu and some more daring and sophisticated choices, for those who are true wine lovers at heart.\n\nWe have included some of our thoughts on the wines to help you in your selection and at the same time are really keen to have you share your own tasting notes.\n\nThis buzzy Italian small bar and eatery, located at the East Hotel, is the kind of place you stop by for an aperitivo but end up staying for the evening.\n\nJoe’s… an intimate place to gather, experience and engage.\n\n', 'A', '{"1":[[0.5,0.9583333333]],"2":[[0.5,0.9583333333]],"3":[[0.5,0.9583333333]],"4":[[0.5,0.9583333333]],"5":[[0.5,0.9583333333]],"6":[[0.5,0.9583333333]],"0":[[0.5,0.9583333333]]}', 'https://www.facebook.com/joesateast', 'https://twitter.com/joesateast', 'https://www.linkedin.com/company/joe''s-bar-at-east', '', '', '', ''),
  (108940, 'adamstown-bowling-club-108940', 'Adamstown Bowling Club', '', 'Adamstown Bowling Club located in Adamstown provide it''s guest and members facilities like restaurants, function rooms, bowl galas and many more  leisure facilities.', 275243, '2016-04-22 01:14:58', '2016-04-22 01:17:33', '', 191, 1155, 'bowling club', 275243, 0, '', 'abcbowlo@gmail.com', '0249573447', '', '', '0249573442', 'http://www.adamstownbowlo.bowls.com.au/', 'Adamstown Bowling Club is a small and friendly club where our professional staff will make you feel at home, a club where you can be a name and not just a number.\n\nWe have three excellent bowling greens, and offer a range of services and facilities including Tab, Sky Channel, Fox Sports, Keno plus much more. At the ABC Bowlo the beer is cold, the BBQ''s work and the members are always close by to lend a helping hand. The club continues to grow and is seen by many locals as a great place to relax and unwind from a hard days work.\n\nThe club has two great BBQ areas that are available for bookings 365 days of the Year. Or if you have a special occasion you would like to celebrate we have two Fantastic Functions Rooms for FREE HIRE.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.9583333333]],"6":[[0.4166666667,0.9583333333]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/adamstown.bowlo/', 'https://twitter.com/ABCbowlo_Newcas', '', '', '', '', 'https://plus.google.com/115336205302713077827/about'),
  (108941, 'forster-bowling-club-108941', 'Forster Bowling Club', '', 'Forster Bowling Club located in Forster provides members and guests a premium range of services to enjoy. Enjoy our services including TAB facilities, lawn bowling and many more. ', 275255, '2016-04-22 01:28:44', '2016-04-22 01:31:03', '', 191, 1151, 'bowling club', 275255, 0, '', '', '0265546155', '', '', '0265556526', 'http://www.forsterbowlingclub.com.au/', 'Forster Bowling Club  is a fantastic family friendly venue in the picturesque tourist town of Forster Tuncurry. Along with our great lawn bowls competitions (including the popular barefoot bowls days), we also have our tenpin bowling complex built in 2002 which is now called Forster Entertainment Centre featuring Tenpin Bowling, Laser Skirmish ,Jurassic Putt Putt and a Game Zone, fun for all of the family!\n\nOur TAB facilities are open 7 days a week, with 2 terminals located at the main bar for your convenience.\n\nDanny’s Family Restaurant is our club’s in-house restaurant, with a mouth watering “All you can eat” buffet style dinner and bistro lunches.\n\nWe have an excellent assortment of meals available in our famous “All You Can Eat” dining selection(except Lunch time One Plate Only). Upon receiving your plate you can then proceed to choose from a great range of salads and seafood for starters, followed by some tasty carvery or delicious Chinese dishes and topped off with some fruit salad and ice cream for dessert!\n\nWe are open 7 days a week and bookings are always welcome\nParking\n', 'A', '{"1":[[0.4583333333,0.5833333333]],"2":[[0.4166666667,0.8333333333]],"3":[[0.375,0.8333333333]],"4":[[0.375,0.8333333333]],"5":[[0.375,0.8333333333]],"6":[[0.375,0.8333333333]],"0":[[0.4166666667,0.7083333333]]}', 'https://www.facebook.com/forsterbowlingclubandtenpin', '', 'https://www.linkedin.com/company/forster-bowling-club', '', '', '', 'https://plus.google.com/112090770083892605351/about'),
  (108942, 'walker-accounting-services-108942', 'Walker Accounting Services', '', 'Walker Accounting Services located in Dubbo specialises in bookkeeping, business advice and taxation.', 275263, '2016-04-22 01:33:03', '2016-04-22 01:44:47', '', 191, 1146, 'tax services\nbusiness advice and planning', 275263, 0, '', 'admin@walkercpa.com.au', '0268825940', '', '', '0268825910', 'http://www.walkercpa.com.au/', 'Setting up a new business? In need of a trustworthy advice? Or seeking a fresh and personal approach for your business or personal taxation requirements? Walker Accounting Services, located in the central west of New South Wales, could be the answer you are looking for.\n\nRecently relocated to new premises in the CBD of Dubbo, Walker Accounting Services offers a wide range of services to its clients with a friendly, no hidden cost policy. Specialising in small businesses and personal tax requirements, Walker Accounting Services will happily come to you, allowing you to get on with what you do best - running your business.\n\nWalker Accounting Services would welcome your inquiry as to how best they can be of assistance to your accounting needs.\n\nMichael Walker (B.Bus CPA) is the Principal of Walker Accounting and has an extensive rural business background in the central west of New South Wales. Originally from Cowra, Michael worked for 12 years in Young before moving with his family to Dubbo in 1996. Michael has been working in the accounting field in various business areas within Dubbo since that time, gaining extensive knowledge in small business, corporate enterprise and primary production.\n\nWith 25 years experience in the accounting industry Michael is very aware of the type of service that his clients seek, and offers a friendly and personal approach to his clients accounting needs in a relaxed and friendly atmosphere. ', 'A', '', '', '', '', '', '', '', ''),
  (108944, 'bar-beach-bowling-sports-club-108944', 'Bar Beach Bowling & Sports Club', '', 'Bar Beach Bowling & Sports Club located in Merewether provide it''s guests and members facilities including restaurants, function areas, gala bowling and more.', 275261, '2016-04-22 01:38:58', '2016-04-22 01:42:21', '', 191, 1147, 'bowling club\nsports club', 275261, 0, '', 'barbeachbc@bigpond.com', '0249293428', '', '', '', 'http://www.barbeachbowlo.com.au/', 'Bar Beach Bowling & Sports Club is located opposite the beautiful Bar Beach in Newcastle. Featuring a sports bar and The Cooks Hill Restaurant, ''The Bowlo'' as it is affectionately know features four function area options catering from 10 to 350 people. \n\nBar Beach Bowling & Sports Club offers a comprehensive range of facilities and services including:\n\n• Restaurants\n• Function areas\n• Gala Bowls\n\nand more.', 'A', '{"1":[[0.5416666667,0.9166666667]],"2":[[0.5,1]],"3":[[0.5,1]],"4":[[0.5,1]],"5":[[0.5,1]],"6":[[0.5,1]],"0":[[0.5,1]]}', 'https://www.facebook.com/barbeach.bowlo', '', '', '', '', '', 'https://plus.google.com/111228932674480889388/about'),
  (108945, 'chifley-s-bar-grill-108945', 'Chifley''s Bar & Grill', '', 'Chifley''s Bar and Grill located at Hotel Kurrajong Canberra features menu which is locally foraged and seasonal produced, actively adopting a paddock to plate philosophy to ensure freshness & flavour.', 275271, '2016-04-22 01:44:06', '2016-04-22 01:46:44', '', 191, 1144, 'international cuisine', 275271, 0, 'Hotel Kurrajong Canberra', '', '0262344444', '', '', '', 'http://chifleysbarandgrill.com.au/', 'Chifley''s Bar & Grill is named after the 16th Prime Minister of Australia, Ben Chifley. Paying homage to the past, with inspiration from today, the team creates a unique experience for diners in a classically elegant Dining Room, which extends to a glassed-in terrace overlooking the Hotel Gardens. The menu features locally foraged and seasonal produce, actively adopting a paddock to plate philosophy to ensure freshness and flavour.\n\nChifley''s Bar & Grill Menu\nWith a strong focus on premium beef, Chifley''s Bar & Grill features an impressive Steak menu, offering a choice of a range of cuts including David Blackmore Wagyu alongside an inventive selection of salads, sides and more. All produce is locally foraged and seasonal.\n\nChifley’s Bar & Grill is the master of the all-important business lunch.\n\nChoose from a selection of entrées and main courses from our seasonal menu to enjoy over lunch every day of the week.\n\n2 courses for $40 per person | 3 courses for $45 per person.\n\nAvailable Monday - Friday.', 'A', '{"1":[[0.2708333333,0.4166666667],[0.5,0.5833333333],[0.75,0.9583333333]],"2":[[0.2708333333,0.4166666667],[0.5,0.5833333333],[0.75,0.9583333333]],"3":[[0.2708333333,0.4166666667],[0.5,0.5833333333],[0.75,0.9583333333]],"4":[[0.2708333333,0.4166666667],[0.5,0.5833333333],[0.75,0.9583333333]],"5":[[0.2708333333,0.4166666667],[0.5,0.5833333333],[0.75,0.9583333333]],"6":[[0.2916666667,0.4375],[0.5,0.5833333333],[0.75,0.9583333333]],"0":[[0.2916666667,0.4375],[0.5,0.5833333333],[0.75,0.9583333333]]}', 'https://www.facebook.com/ChifleysBarandGrill', '', '', '', '', '', ''),
  (108946, 'the-fraternity-club-108946', 'The Fraternity Club', '', 'The Fraternity Club located in Fairy Meadow is a premium venue in the Illawara that features function rooms, bars and dining options including the Baci Cafe & La Trattoria bistro .', 275277, '2016-04-22 01:50:45', '2016-04-22 01:52:05', '', 191, 1142, 'bowling club\nsocial club', 275277, 0, '', 'enquiries@fraternityclub.com.au', '0242833333', '', '', '0242845064', 'http://www.fraternityclub.com.au/', 'The Fraternity Club has long established itself as a premier venue in the Illawarra, with some of the leading facilities in the area. There is a variety of function rooms, bars and dining options, including the Baci Cafe & La Trattoria bistro which has a sunny Al Fresco dining area!\n\nAlong with this, the Frat is home to a range of indoor sporting facilities as well as Futsal Courts and Bowling Greens, and HD Big Screens dedicated to showing Live Sport. \n\nProudly celebrating it''s 60th Birthday last year, The Fraternity Club is the home for a multicultural membership of almost 10 000, which is growing steadily.', 'A', '{"1":[[0.4166666667,0.0833333333]],"2":[[0.4166666667,0.0833333333]],"3":[[0.4166666667,0.0833333333]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.0833333333]]}', 'https://www.facebook.com/TheFraternityClub', 'https://twitter.com/FratClub2519', 'https://www.linkedin.com/company/fraternity-club', '', '', '', 'https://plus.google.com/102441970816252482763/about'),
  (108947, 'walker-bds-accountants-business-development-108947', 'Walker BDS Accountants Business Development', '', 'Walker BDS Accountants Business Development located in Tumut specialises in Bookkeeping, budgeting, estate planning, acquisitions and mergers.', 275285, '2016-04-22 01:51:02', '2016-04-22 01:54:53', '', 191, 1138, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing\npayroll', 275285, 0, '', 'admin@walkerbds.com.au', '0269473666', '', '', '', 'http://www.walkerbds.com.au/', 'At Walker BDS Accountants Business Development we understand that running a business requires a team. We are here to be your team.\n\nWe''ve also developed our traditional auditing and accounting practices into innovative client-focused services. Our flexibility and adaptability ensure we help you get the best results.\n\nAt Walker BDS Accountants Business Development we aim to provide you with advice when your business needs it, not just when you ask for it.\nWe help you manage every aspect of your business and because we establish a one-on-one relationship with each of our clients, our advice is tailor-made for your business.\n\nAt Walker BDS Accountants Business Development we have the unique insight that only experience can provide. Let us show you how to improve your business with our specially developed services.\n\nWalker BDS Accountants Business Development is not a traditional accounting firm, but we do still offer the very best traditional accounting services.\n\nOur audit team will work closely with you to get to know your business. We use the latest computerised systems, based around a detailed analytical review of the accounts. This enables us to offer an objective view of your business so we can advise you of any potential problem areas.\n\nThe GST-related services we offer include, but are not limited to advice on registering for GST, filing and adjusting GST returns, and ATO audit assistance.\n\nAt Walker BDS Accountants Business Development we offer a full range of taxation services. Our taxation consulting division is nationally recognised and we offer advice based on proven knowledge and experience. Our proactive approach ensures we deliver consistent service and build solid relationships that stand the test of time.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/WalkerBDS', 'http://au.linkedin.com/in/stevenwalkerbds', '', '', '', ''),
  (108948, 'xo-108948', 'XO', '', 'XO Restaurant located at Narrabundah delivers an innovative, modern approach to traditional South East Asian cuisine that is grounded by a commitment to unpretentious, honest food.', 275283, '2016-04-22 01:53:41', '2016-04-22 01:54:44', '', 191, 1140, 'international cuisine', 275283, 0, '', 'info@xo-restaurant.com.au', '0262959696', '', '', '', 'http://www.xo-restaurant.com.au/', 'XO delivers an innovative, modern approach to traditional South East Asian cuisine that is grounded by a commitment to unpretentious, honest food.\n\nXO is committed to sharing our passion for food and the communal share plate culture of Asian dining, XO delivers an innovative, modern approach to traditional South East Asian cuisine that is grounded by an unwavering commitment to unpretentious, honest food and the highest standards of service.', 'A', '{"1":[[0.75,0.9583333333]],"2":[[0.75,0.9583333333]],"3":[[0.75,0.9583333333]],"4":[[0.5,0.625],[0.75,0.9583333333]],"5":[[0.5,0.625],[0.75,0.9583333333]],"6":[[0.5,0.625],[0.75,0.9583333333]]}', 'https://www.facebook.com/xonarrabundah', '', 'https://www.linkedin.com/company/xo-narrabundah', '', '', '', 'https://plus.google.com/105545520623795024681/about'),
