  (108953, 'maitland-leagues-club-108953', 'Maitland Leagues Club', '', 'Maitland Leagues Club located in Maitland provide its guest and members facilities like function rooms for all type of events, a restaurant for large groups, live entertainment and more.', 275295, '2016-04-22 02:05:10', '2016-04-22 02:07:39', '', 191, 1124, 'leagues club', 275295, 0, '', 'gm@maitlandleagues.com.au', '0249335377', '', '', '', 'http://www.maitlandleagues.com.au/', 'Maitland Leagues Club has everything you need to have a great time out, whether you are after fun, family dining, socialising with friends, a relaxing drink or live entertainment. Located in the busy hub of central Maitland and with easy access to The Levee public area, the club welcomes you to enjoy the best in local entertainment seven days a week. Membership at Maitland Leagues Club starts from $4 per year and provides you with an amazing array of benefits.\n\nMaitland Leagues Club  are also proud to offer you access to our spectacular function spaces. If you’re looking for a space for a special event; corporate function, wedding or just a big celebration our functions team can help take out the stress with our affordable event options. Whatever you need, Maitland Leagues Club are here to help you have a great time. Contact us for more information. The club is wheelchair accessible and welcomes all patrons and guests.\n\n', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/Maitland-Leagues-Club-429826917112751/', '', '', '', '', '', ''),
