  (108957, 'marks-point-sports-club-108957', 'Marks Point Sports Club', '', 'Marks Point Sports Club located in Marks Point offer its guest and members facilities and services like live entertainment, local sporting activities, restaurant, function rooms and more.', 275305, '2016-04-22 02:15:51', '2016-04-22 02:19:33', '', 191, 1116, 'sports club', 275305, 0, '', 'admin@markspointsportsclub.com.au', '0249454441', '', '', '', 'http://www.markspointsportsclub.com.au/', 'Marks Point Sports Club (formerly Marks Point Bowling Club) located on Findon Street Marks Point is investing heavily in the interest of their members and guests with major renovations commenced in 2013 with a new Synthetic Bowling Green and in March 2014 our new Chinese Restaurant.\n\nMarks Point Sports Club has a heavy interest in all sporting activities but a main focus on lawn bowls which can be played on our natural or new synthetic green, football which is played weekly by local teams on our Baxter Oval which also is host to many athletic events for schools and sporting groups.\n\nEvery week we have multiple events including raffles, trivia, membership draws with cash prizes, bingo and live local and national entertainment. Each month we also have a larger event for such holidays of Father''s and Mother''s Day, Christmas in July, Chrismtas as well as a number of sporting events like Melbourne Cup, State of Origin and Football finals.\n\nMany other club upgrades will occur throughout 2014, as we work hard to deliver a premier venue for the people of Marks Point and surrounding suburbs. Stay tuned as we continue to build a quality facility with a family friendly atmosphere.', 'A', '{"1":[[0.375,0.8125]],"2":[[0.375,0.9375]],"3":[[0.375,0.9375]],"4":[[0.375,0.9791666667]],"5":[[0.375,0.9791666667]],"6":[[0.4166666667,0.9791666667]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/markspointsportsclub', 'https://twitter.com/markspointSC', '', '', '', '', 'https://plus.google.com/u/0/117055218360377266757/posts'),
