  (108962, 'pod-food-108962', 'Pod Food', '', 'Pod Food located at Pialligo have long been known as Canberra''s hidden culinary gem. Our menus ensure intrigue and delight. Degustation breakfast, breakfast, lunches, dinner and dinner degustations.', 275325, '2016-04-22 02:27:17', '2016-04-22 02:28:27', '', 191, 1103, '', 275325, 0, '', 'info@podfood.com.au', '0262573388', '', '', '', 'http://www.podfood.com.au/', 'Pod Food - Pialligo\nNestled in a unique position amongst the beautiful established gardens of Pialligo plant farm, the quaint character filled, fully restored 1930''s cottage offers a unique dining location close to the Canberra CBD. The venue is only minutes from Canberra International Airport as well as the boutique shopping precincts of Kingston and Manuka and has ample parking. Owner and chef John Leverink leads a dynamic, creative kitchen and restaurant team to create a memorable dining experience for all occasions.\n\nThe well established grounds of Pod Food are divided into three well lit areas: the cottage, deck and the garden terrace. These north facing areas are sunny in winter and shaded in summer, making this boutique and modern venue the perfect location for your next event.\n\nPodfood is now open for dinner Thursday - Monday evenings.\nBreakfast at Podfood | Saturday and Sunday mornings.', 'A', '{"1":[[0.5,0.5833333333],[0.7708333333,1]],"4":[[0.5,0.5833333333],[0.7708333333,1]],"5":[[0.5,0.5833333333],[0.7708333333,1]],"6":[[0.3541666667,0.4166666667],[0.5,0.5833333333],[0.7708333333,1]],"0":[[0.3541666667,0.4166666667],[0.5,0.5833333333],[0.7708333333,1]]}', 'https://www.facebook.com/PodFood', 'https://twitter.com/podfood', '', '', '', '', 'https://plus.google.com/106317303588275443595/posts'),
  (108966, 'capitol-bar-grill-restaurant-108966', 'Capitol Bar & Grill Restaurant', '', 'Capitol Bar and Grill Situated in Canberra is an  Italian themed concept with Signature antipasto table mix of refreshed Italian favourites teamed with prime cut steaks on the wood fired grill.', 275337, '2016-04-22 02:40:47', '2016-04-22 02:42:21', '', 191, 1095, 'italian restaurant', 275337, 0, '', 'Capitol@qthotels.com.au', '0262471488', '', '', '', '', 'A unique dining concept synonymous with the designer hotel brand QT Hotels, the Capitol Bar & Grill Restaurant takes you on a culinary journey that all food lovers should enjoy. For long lunches to special dinners, this Italian inspired eatery boasts a signature antipasto table mix, plus succulent steaks, fresh from the wood fried grill.\n\nOf course, leave room for dessert and a cheeky cocktail. heck, why not two!', 'A', '{"1":[[0.2708333333,1]],"2":[[0.2708333333,1]],"3":[[0.2708333333,1]],"4":[[0.2708333333,1]],"5":[[0.2708333333,1]],"6":[[0.2708333333,1]],"0":[[0.2708333333,1]]}', 'https://www.facebook.com/capitolbarandgrillcanberra', '', '', '', '', '', 'https://plus.google.com/113020150207741972754/about');
