  (108967, 'pj-walker-co-108967', 'PJ Walker & Co', '', 'PJ Walker & Co located in Dee Why specialises in Bookkeeping, Income tax returns for individuals, businesses, trusts, other and Business structures, advice and consulting.', 275343, '2016-04-22 02:43:48', '2016-04-22 02:43:48', '', 191, 1093, '', 275343, 0, '', 'phil@philwalker.com.au', '0299719708', '', '', '', 'http://www.philwalker.com.au/', '', 'A', '', '', '', '', '', '', '', ''),
  (108969, 'glen-innes-bowling-club-108969', 'Glen Innes Bowling Club', '', 'Glen Innes Bowling Club located in Glen Innes features bar, pool tables, dart & restaurant. Glen provide a good amenity for members & guests to relax & enjoy a true club atnosphere.', 275347, '2016-04-22 02:46:35', '2016-04-22 02:46:39', '', 191, 1090, 'bowling club', 275347, 0, '', '', '0267322989', '', '', '', 'http://gleninneslawnbowls.com/', 'Glen Innes Bowling Club has an excellent bar, pool tables, darts and other activities, providing a good amenity for members and visitors to relax and enjoy a true Club atmosphere. \n\nThe Club is closed on Good Friday and Christmas Day Restaurant The Club boasts a large,top quality Chinese Restaurant that provides a huge array of traditional dishes. The restaurant provides normal seating for in excess of forty diners with the function room accommodating much larger groups. Normal trading hours:\n\nVisitors are welcome at all of our social bowls events. We also encourage junior players to join our club, beginners or experienced.', 'A', '{"1":[[0.1041666667,0.8958333333]],"2":[[0.5,0.8958333333]],"3":[[0.5,0.8958333333]],"4":[[0.5,0.8958333333]],"5":[[0.4791666667,0.8958333333]],"6":[[0.4375,0.9375]],"0":[[0.3958333333,0.9375]]}', '', '', '', '', '', '', ''),
  (108971, 'merewether-golf-club-108971', 'Merewether Golf Club', '', 'Merewether Golf Club located in Adamstown offer its guest and members facilities and services like bar and bistro, ladies lounge, function areas, golf area and more.', 275351, '2016-04-22 02:48:55', '2016-04-22 02:54:07', '', 191, 1080, 'golf club', 275351, 0, '', 'mgc@merewethergolf.com.au', '0249631128', '', '', '', 'http://www.merewethergolf.com.au/', 'Merewether Golf Club was established in 1933 and is located in the heart of Newcastle, 10 minutes from the city centre and beaches, and less than 60 minutes from the Hunter Valley''s world-renowned vineyards and beautiful Port Stephens.\n\nOur picturesque, 18 hole course is nestled amongst abundant flora and fauna. The eucalypt tree lined fairways and formidable water hazards ensure an enjoyable and rewarding challenge.\n\nCome and visit our bar and bistro and be treated to great food, friendly staff, a relaxed atmosphere and affordable prices!\n\nOur Pro Shop caters for all golfers with a great range of clothing & equipment, lessons, advice and equipment repairs.\n\nLet our friendly & experienced team cater for your next corporate or charity golf day.\n\nMerewether Golf Club''s function venue is one of Newcastle’s best locations with views over the course and to the city - weddings, engagement parties, anniversaries, christenings, birthday parties and fund raising dinners can all be individually designed to suit your needs.\n\nVisitors are most welcome at Merewether Golf Club.\n\nSee you soon at the friendly club in the city!', 'A', '{"1":[[0.4166666667,0.8958333333]],"2":[[0.4166666667,0.8958333333]],"3":[[0.4166666667,0.8541666667]],"4":[[0.4166666667,0.8541666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.75]],"0":[[0.4166666667,0.75]]}', 'https://www.facebook.com/Merewether-Golf-Club-173511372790069/', 'https://twitter.com/MereGolfClub', '', '', '', '', 'https://plus.google.com/+merewethergolfclub/about'),
