  (108975, 'glenbrook-panthers-bowling-club-108975', 'Glenbrook Panthers Bowling Club', '', 'Glenbrook Panthers Bowling Club located in Glenbrook offers the perfect pit to stop the village of Glenbrook. Features sports betting, TAB and many more.', 275359, '2016-04-22 02:59:34', '2016-04-27 06:05:24', '', 191, 396, 'social club', 275359, 0, '', 'glenbrook@panthers.com.au', '0247206800', '', '', '', 'http://glenbrook.panthers.com.au/', 'Glenbrook Panthers Bowling Club is located at the foot of the majestic Blue Mountains, Glenbrook Panthers offers the perfect pit stop to explore the village of Glenbrook.We look forward to welcoming you at Glenbrook Panthers.\n\nEnjoy a bite to eat at Flavours Café whilst the kids play in the play area, or enjoy a drink in the sunshine on the terrace. Perhaps a game of Bowls is on your agenda, or you might like to catch the latest sporting moments whilst lounging in our bar.\n\nWe look forward to welcoming you at Glenbrook Panthers.', 'A', '{"1":[[0.4375,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4375,0.9583333333]],"4":[[0.4375,0.9583333333]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/GlenbrookPanthersBowlingClub', '', 'https://www.linkedin.com/company/glenbrook-panthers-bowling-club', '', '', '', 'https://plus.google.com/104737176823357718434/about'),
  (108977, 'action-accounting-consulting-services-108977', 'Action Accounting & Consulting Services', '', '', 0, '2016-04-22 03:06:18', '2016-04-22 03:06:22', '', 191, 1072, '', 0, 0, '', '', '0298208386', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108979, 'muree-golf-club-108979', 'Muree Golf Club', '', 'Muree Golf Club located in Raymond Terrace offers its guests and members services and facilities including function rooms, weekly events, restaurant, golf course area and more.', 275381, '2016-04-22 03:10:14', '2016-04-22 03:13:02', '', 191, 1064, 'golf club', 275381, 0, '', 'manager@mureegolfclub.com.au', '0249872142', '', '', '', 'http://www.mureegolfclub.com.au/', 'Muree Golf Club is a scenic 18-hole golf course on the Eastern fringe of Raymond Terrace CBD at Port Stephens, bounded by the Pacific Motorway, Pioneer Park and the historic Pioneer Cemetery. The course is a hidden jewel, and was selected for the 2010 NSW Amateur Medal, as only the second course outside the Sydney Metropolitan area since 1974. It is home to many giant tallowoods, a dense native gum which was sought after by early settlers for heavy hardwood suited to maritime and industrial uses. Our many trees are home to a koala population, protected by the foresight of the club’s founders in 1940, when they proclaimed in our constitution that we should protect and nurture them as part of the club’s raison d’etre. We have done this as best we could, but encroaching development has made the task more difficult.  Injured and sick koalas are often released here by professional carers, as a sanctuary situation is available to them here.\n\nThe vegetation is mature, with very little ‘impossible’ rough, and just a few water carries. Our course may be a little shorter than some, but it makes up for that in its subtle demand for accuracy.\n\nAs a tribute to the koalas and their dwindling numbers, we recently commissioned renowned Gloucester chainsaw artist Geoff Hitchcock to create our ‘Giant Koala’, fashioned from the remaining trunk of a blackbutt tree next to the (brand new August 2014) sixth green, which had become dangerous to players. You will note from what you see around our course and clubhouse that the koala has been the club’s emblem and mascot for more than 74 years at the time of writing.\n\nWe have a seven day Bistro and Restaurant, with pleasant views over the course and beyond for our patrons. Our auditorium is suited to weddings, parties or similar functions for up to 200 persons, with smaller functions also catered in dining facilities and/or al fresco. We operate gaming, racing and eftpos facilities, and our friendly staff are always keen to please.\n\nAccess to the course is via Kangaroo Street and Walker Crescent, and a little off the beaten track for our visitors.  The GPS might come in handy. If you don’t have one, simply look for the communications tower on the highest hill (not the one next to Woolies in town) and weave your way towards it. Golfing and Social Memberships are very affordable, with direct debit and time payment facilities popular.\n\n', 'A', '{"1":[[0.2708333333,0.9166666667]],"2":[[0.2708333333,0.9166666667]],"3":[[0.2708333333,0.9166666667]],"4":[[0.2708333333,0.9166666667]],"5":[[0.2708333333,0.9791666667]],"6":[[0.2291666667,0.9791666667]],"0":[[0.25,0.9166666667]]}', 'https://www.facebook.com/Muree-Golf-Club-Raymond-Terrace-192399684161676/', '', '', '', '', '', 'https://plus.google.com/102799530478310648286/about'),
  (108980, 'active-management-consultants-pty-ltd-108980', 'Active Management Consultants Pty Ltd', '', '', 0, '2016-04-22 03:11:14', '2016-04-22 03:11:30', '', 191, 1066, '', 0, 0, '', '', '0294186700', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108983, 'italian-and-sons-108983', 'Italian and Sons', '', 'Italian and Sons located at Braddon is the best place to eat Italian food in Canberra.', 275397, '2016-04-22 03:23:32', '2016-04-22 03:25:12', '', 191, 1057, 'italian restaurant', 275397, 0, '', '', '0261624888', '', '', '', 'http://www.italianandsons.com.au/', '', 'A', '{"1":[[0.75,0.9166666667]],"2":[[0.5,0.625],[0.75,0.9166666667]],"3":[[0.5,0.625],[0.75,0.9166666667]],"4":[[0.5,0.625],[0.75,0.9166666667]],"5":[[0.5,0.625],[0.75,0.9166666667]],"6":[[0.75,0.9166666667]]}', 'https://plus.google.com/110118284358017223946/about', 'https://twitter.com/vince_trimboli', '', '', '', '', ''),
  (108985, 'gordon-bowling-club-108985', 'Gordon Bowling Club', '', 'Gordon Bowling Club located in Gordon provides members & guests a place to relax after bowls. Enjoy the clubs bar facilities, light meals and many more.', 275411, '2016-04-22 03:33:20', '2016-04-22 03:33:28', '', 191, 1053, 'bowling club', 275411, 0, '', 'info@gordonbowlingclub.com.au', '0294985599', '', '', '', 'http://gordonbowlingclub.org.au/', 'Gordon Bowling Club is established in 1953, and we like to think of ourselves as a bowling club of sociable people. The club is very professionally run, full of friendly faces, and caters for every type of bowler from the highly competitive to the player who just enjoys a socially relaxing game.\n\nWe have three superb, well maintained greens, amongst the best in Sydney, to enjoy bowling all year round in a quiet, leafy corner of Gordon. Our newly renovated clubhouse provides a place for members and guests to relax before or after bowls while enjoying a panoramic view of the action on our number 1 green.The club offers licensed bar facilities, light meals and locker rooms all in a smoke-free, poker machine-free environment.\n\nMen’s bowls days are Wednesdays and Saturdays from 12:30 pm. During winter months, June through August, we start at 12:00. The office is open for telephone bookings between 10:00 and 11:00 am on those days, or you may book in person at the club ahead of the day. You can buy a sandwich for lunch before the start of play; there is a break for afternoon tea between about 2:30 and 3:00 pm, and games are usually finished by 4:30 pm.\n\nWomen’s bowls days are Tuesdays and Thursdays from 9:30 am. The office is open for telephone bookings between 8:00 and 8:45 am on those days, or you may book in person at the club ahead of the day. We have a light lunch following the game at about 12:30 pm.. Women are also welcome at the Saturday afternoon sessions, and some mixed games may be played depending on numbers.\n\nWomen are also welcome to bowl with the Men on Saturday afternoons and we have mixed bowls on one Friday evening each month during daylight saving (with a meal after bowls). We also have several special mixed bowls gala days during the year.\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', 'https://www.linkedin.com/company/gordon-bowling-club', '', '', '', ''),
  (108986, 'walker-s-accountants-advisers-108986', 'Walker''s Accountants & Advisers', '', 'Walker''s Accountants & Advisers located in Shepparton specialises in Business Services and Taxation, Self Managed Superannuation, bookkeeping, payroll and financial Services.', 275413, '2016-04-22 03:33:43', '2016-04-22 03:38:50', '', 191, 1049, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing\npayroll', 275413, 0, '', 'info@walkersaccountants.com.au', '0358312466', '', '', '0358314834', 'http://www.walkersaccountants.com.au/', 'Walker’s Accountants and Advisers was established in 1990 which followed a period of huge expansion of credit in the economy. The drought which commenced in 2002 was an even bigger challenge, but at least it was not a man-made disaster. Now we are back to flat economic times following another huge expansion of credit. Things move in cycles, but you just have to be careful not to fight the last war all over again. The experience we have gained over this 22 year period during good and ordinary economic times stands our clients in good stead.\n\nWalker''s Accountants & Advisers see our role as mentors and educators, and our technical skills are the tools we use to work to our clients best advantage, but the use of these tools must support the mentoring and education role, which we take very seriously.\n\nWalker''s Accountants & Advisers have found that the areas in which we can add the most value for our clients is planning their business operations, accounting for the business operations and reporting back. We also have experience in navigating the minefield of State and Federal Taxes, particularly Income Tax and Capital Gains Tax, GST, Payroll Tax and Workcover.\n\nWalker''s Accountants & Advisers understand the problem of small business, what makes small business people tick, and we know that small business requires strong, intelligent no nonsense advocacy when dealing with large business and with government departments who are generally not good in dealing with the concerns of small business. We are experts in negotiating with State and Federal Government Departments in the areas in which small business clients interests can be impaired.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108988, 'lanterne-rooms-108988', 'Lanterne Rooms', '', 'The Lanterne Rooms located at Campbell focuses on the oriental-style experience of food sharing, whether it be for a romantic dinner, a private party with friends or a quiet business lunch. ', 275431, '2016-04-22 03:38:58', '2016-04-22 03:40:11', '', 191, 1046, 'international cuisine', 275431, 0, '', 'lanternerooms@gmail.com', '0262496889', '', '', '', 'http://chairmangroup.com.au/lanterne_rooms/', '', 'A', '{"1":[[0.5,0.625],[0.75,0.9583333333]],"2":[[0.5,0.625],[0.75,0.9583333333]],"3":[[0.5,0.625],[0.75,0.9583333333]],"4":[[0.5,0.625],[0.75,0.9583333333]],"5":[[0.5,0.625],[0.75,0.9583333333]],"6":[[0.75,0.9583333333]]}', 'https://www.facebook.com/Lanterne-Rooms-561901930504796/', 'https://twitter.com/lanternerooms', '', '', '', '', 'https://plus.google.com/110188834346709204407/about'),
