  (108993, 'wall-business-services-108993', 'Wall Business Services', '', 'Wall Business Services located in Kalgoorlie specialises in Accounting, taxation, audit and information systems advice and business services.', 275449, '2016-04-22 03:49:59', '2016-04-22 03:49:59', '', 191, 1033, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing\npayroll', 275449, 0, '', 'accountant@wallbs.com.au', '0890914447', '', '', '0890914420', 'http://www.wallbs.com.au/', 'Wall Business Services is a Goldfields based accounting firm. The team offer practical down to earth advice about how to run your business on a day to day basis, specialising in business start-ups.\n\nWall Business Services  provide professional taxation and accounting needs for a range of business and individual clients. We offer the full range of services to clients; from those who want to drop off the work once a year to the client who wants a complete service on an on-going basis. Bookkeeping is also available on request.\n\nThe team work hard on numbers so that they are correct, the client understands them, the liability of taxation is minimised and wealth maximised. Call us today on 08 9091 4447 for an appointment to make your numbers work.\n\nWall Business Services offer services like  Accounting, taxation, audit and information systems advice, Implementation of accounting and management reporting systems, Computer systems and accounting software support - MYOB, Xero, Quickbooks and Arrow\nBusiness assessment for sales and purchases, Business, marketing, budgeting and cash-flow planning, Preparation and lodgement of income tax, GST and fringe benefit tax returns, Preparation of all types of financial statements for companies, trusts, partnerships, sole traders, self managed superannuation funds and government business enterprises and Bookkeeping is available by request.', 'A', '', '', '', 'https://www.linkedin.com/company/wall-business-services', '', '', '', ''),
  (108994, 'newcastle-club-108994', 'Newcastle Club', '', 'Newcastle Club located in Newcastle offer its members services and facilities including coffee lounge, wheeler room, dining room, social activities, function and meeting rooms and more.', 275451, '2016-04-22 03:50:53', '2016-04-22 03:52:36', '', 191, 1031, 'social club', 275451, 0, '', 'reception@newcastleclub.com.au', '0249291224', '', '', '0249296302', 'http://www.newcastleclub.com.au/', 'Newcastle Club is located in the heart of Newcastle CBD, the Newcastle Club is one of the oldest and most established private Clubs in Australia. This unique environment is a setting for members to relax, meet and socialise and a place to grow friendships and foster relationships among like-minded people. \n\nThe Newcastle Club offers old fashioned traditions of service, courtesy, comfort and charm, whilst meeting the needs of contemporary life in this fast moving world. The view across Newcastle Harbour gives members and their guests an opportunity to relax and enjoy the beauty and fascination of a busy working port. \n\nThe atmosphere of the Club is elegant yet relaxed, sophisticated yet friendly, and is viewed as a home-away-from-home by many of its Members. The Club is on terms of reciprocity with many clubs world-wide, and it welcomes their members to use our facilities. \n\nWhilst the Newcastle Club is a private Club, open only to members, guests to this website are invited to access information about the Club such as its history and information about the facilities of our historic Clubhouse.\n\nWe look forward to welcoming you to the Club.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
