  (108997, 'grafton-bowling-club-108997', 'Grafton Bowling Club', '', '', 0, '2016-04-22 03:57:36', '2016-04-22 03:57:40', '', 191, 1027, 'bowling club', 0, 0, '', '', '0266424033', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (108998, 'club-grandviews-108998', 'Club Grandviews', '', 'Club Grandviews located in Peakhurst features VIP & Sports lounges , live bands, raffles, 3 bowling greens ', 275461, '2016-04-22 05:08:57', '2016-05-02 05:45:09', '', 191, 1026, 'bowling club', 275461, 0, '', 'admin@clubgrandviews.com.au', '0295332255', '', '', '0295344231', 'http://www.clubgrandviews.com.au/', 'Club Grandviews is located in Peakhurst, 20 minutes from Sydney airport.\nOur Club offers our Members & their Guests a warm & friendly atmosphere including some of the best entertainment & fine food on offer.\n\nFormed in 1956, the Club has grown in that time to be one of the leading Bowls Clubs in NSW. The Club currently is well presented with the Mens fielding 7 Pennants teams & the Women competing in the Georges River District.\n\nWith modern premises now available, Social Members are welcome to enjoy the many benefits Club Grandviews has to offer including quality Dining at our “Tree Tops” bistro with Asian & Western cuisine at reasonable prices.\n\nFull Tab & Keno facilities are available to Members & their Guests with Bingo each Monday morning. Special Promotions are conducted every Thursday night with our bonanza Meat Tray raffles on Friday night and Sunday afternoons.\n\nBook at one of our upcoming Dinner shows or bring the family & enjoy many\nof the benefits Club Grandviews has to offer!\n\n ', 'A', '{"1":[[0.4375,0.9166666667]],"2":[[0.4375,0.9166666667]],"3":[[0.4375,0.9583333333]],"4":[[0.4375,0.9583333333]],"5":[[0.4375,0.9166666667]],"6":[[0.375,1]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/ClubGrandviews', '', '', '', '', '', 'https://plus.google.com/100416797283934240064/about'),
  (108999, 'newcastle-golf-club-108999', 'Newcastle Golf Club', '', 'Newcastle Golf Club located in Fern Bay offer its visitors and members services and facilities including corporate functions, private functions, meeting room, pro shop, golf course and many more.', 275467, '2016-04-22 05:15:43', '2016-04-22 05:19:57', '', 191, 1024, 'golf club', 275467, 0, '', 'office@newcastlegolf.com.au', '0249281365', '', '', '0249201190', 'http://www.newcastlegolf.com.au/', 'Newcastle Golf Club is located at the mouth of the Hunter River, a two hour drive from Sydney, Newcastle is one of only two courses in NSW given international recognition by the panel of experts rating the World’s Top 100 Courses.\n\nIt has recently been rated “International Honourable Mention”, meaning that it has won sufficient points to be worthy of inclusion in the Top 100 courses outside the USA.\n\nAs only a handful of the World Panel have played in Newcastle, it speaks volumes that those who have played this hidden gem rate it so highly.\n\nGolf Australia Magazine ranks Newcastle Number 17 in Australia (January 2013).\n\nA true championship course of 6200 metres (6780 yards), it is based on undulating sand dunes like those of the great historic links of Great Britain and Ireland.\n\nHowever, instead of fairways lined by gorse and heather, Newcastle is carved out of a forest of eucalypts and angophoras abounding in native flora and fauna, including kookaburras, bearded dragons and wallabies, making it a delightful as well as a challenging course to play.\n\nAlthough the course is situated only a few kilometres from the busy industrial city and port of Newcastle, the wide bands of trees separating the fairways give a feeling of peaceful isolation from the cares of the world.\n\nFacilities include a full-length practice fairway, large chipping and putting greens, fully serviced Pro Shop, bar and catering.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Newcastlegolf', '', '', '', '', '', ''),
