  (109003, 'the-royal-motor-yacht-club-toronto-109003', 'The Royal Motor Yacht Club - Toronto', '', 'The Royal Motor Yacht Club - Toronto located in Toronto offer its guest and members services and facilities including function rooms, live entertainment, bistro andmany more.', 275475, '2016-04-22 05:30:33', '2016-04-22 05:33:25', '', 191, 1020, 'sailing club', 275475, 0, '', 'info@rmyctoronto.com.au', '0249592051', '', '', '0249599552', 'https://www.rmyctoronto.com.au', 'Royal Motor Yacht Club is one of Lake Macquarie’s and the Hunter’s leading social, dining and entertainment venue. The Club is located in historic ‘Lake Holme’, the former waterfront residence of William Arnott, founder of Arnott biscuits. The Club offers a unique mix of 19th century architecture and modern facilities. The Club has the features of a private establishment, but the relaxed atmosphere of a modern social club.\n\nFeaturing quality food, reasonable prices, and unsurpassed views of Lake Macquarie, visitors are always welcome as are children and families.\n\nThe Club regularly features live entertainment, social activities and in a hub for the West Lakes business community. The Club is the perfect destination for your next event, wedding, corporate function or for just after work drinks.\n', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/RoyalMotorYachtClub', '', '', '', '', '', 'https://plus.google.com/115239935615083383248/about'),
