  (109011, 'addison-partners-109011', 'Addison Partners', '', 'Addison Partners is a full service professional accounting firm in Dungog, providing personalised service and specialised advice including Accounting, Taxation and Business Advisory and many more.', 275497, '2016-04-22 05:53:13', '2016-04-22 05:54:21', '', 191, 1011, 'tax services\nbusiness advice and planning', 275497, 0, '', '', '0249957300', '', '', '', 'http://www.addisonpartners.com.au/', 'Addison Partners Pty Ltd is a full service professional accounting firm in the Hunter region, New South Wales providing personalised service and specialised advice. Services offered include Accounting, Taxation and Business Advisory, Superannuation, Financial Planning, Mortgage Broking and Corporate Secretary services. ', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/107492882872141242013/about'),
  (109012, 'briars-at-greenlees-sporting-club-109012', 'Briars at Greenlees Sporting Club', '', 'Briars at Greenlees Sporting Club located in Concord features bistro, barefoot bowls, cricket, squash, hockey rugby and many more.', 275503, '2016-04-22 05:58:23', '2016-04-22 06:00:57', '', 191, 1009, 'sports club', 275503, 0, '', 'sports@briarsatgreenlees.com.au', '0297431907', '', '', '0297361872', 'http://www.briarsatgreenlees.com.au/', 'Briars at Greenlees Sporting Club mission is to develop, maintain and enhance Club spirit and performance which can meet expectations of our membership whilst retaining sporting culture.\n\nTo be the community''s most successful Sporting Club \nTo maximise the facilities available, provide excellent management and services to our membership base and be competitive in all our sporting arenas. \nThe aim of the Club is to foster and promote recreational activities on the sporting field to members of the community.\nIn addition the Club provides social facilities for after game functions and other social occasions. Within this environment Briars continues to play pivotal role for sport in the community and must now position itself for future growth and management opportunities.\n\n', 'A', '{"1":[[0.4583333333,0.9375]],"2":[[0.4583333333,0.9375]],"3":[[0.4583333333,0.9375]],"4":[[0.4583333333,1]],"5":[[0.4583333333,1]],"6":[[0.4375,1]],"0":[[0.3541666667,1]]}', 'https://www.facebook.com/briarssporting/', '', '', '', '', '', 'https://plus.google.com/108345184524736783142/about'),
  (109015, 'stockton-rsl-citizens-club-ltd-109015', 'Stockton RSL & Citizens Club Ltd', '', 'Stockton RSL & Citizens Club Ltd located in Stockton offer its guests and member services and facilities including function rooms, live entertainment, special events and many more.', 275515, '2016-04-22 06:05:27', '2016-04-22 06:08:14', '', 191, 1003, 'rsl club', 275515, 0, '', 'stocktonrsl@stocktonrsl.com.au', '0249282333', '', '', '', 'http://www.stocktonrsl.com.au/', 'At Stockton RSL  you’ll find friendly faces, welcoming staff and a range of services and facilities to suit just about everyone.\n\nEnjoy yourself at Stockton RSL You’ll be delighted by what’s on offer to members and visitors from the free entertainment, live shows and fantastic promotions to raffles, bingo and much more. Our "NEW" LEGEND BISTRO opened on 8th July with Sam Cheung and his team bringing worlds of flavour to Stockton and  is THE place for great food. Serving a vast array of Asian fusion and Australian meals with an  emphasis on fresh, quality produce and hunter valley meats, Sam and his team of chefs will also delight diners with their weekend blackboard specials and great value lunch specials. The Legend is open every day for lunch and dinner and bookings can be made by phoning 49283069.\n\nLocated right in the heart of Stockton, on the corner of Douglas and Clyde Streets and just 10 minutes from the Newcastle CBD by ferry, getting to Stockton RSL has never been easier. We are well serviced by public transport with ferries, buses and trains in close proximity with the bus stop right at our front door. Or if you are coming by car we have ample car parking. We even have a courtesy bus to service the local area, including the ferry terminal. Come on over..you’ll be glad you did!\n\nStockton RSL offers great modern function facilities for your next function. A choice of 4 rooms catering for weddings, birthdays, seminars, meetings or any social occasion from 10 to 240 people.', 'A', '{"1":[[0.375,0