  (109019, 'adel-el-hassan-co-pty-ltd-109019', 'Adel El Hassan & Co Pty Ltd', '', 'Adel El Hassan is located Wiley Park, providing a range of Financial Services including Taxation and Auditing specialties, Business Development, Superannuation Planning and many more.', 275519, '2016-04-22 06:11:03', '2016-04-22 06:13:27', '', 191, 1000, 'tax services\nbusiness advice and planning\nauditing', 275519, 0, '', 'info@adelelhassan.com', '0297594333', '', '', '', 'http://www.adelelhassan.com/', 'Adel El Hassan & Co was established in 1991, currently comprising of one principal and three supporting staff. The firm has vast experience in the provision of professional business services to a wide range of clients, including private family business, large corporations, aged care facilities, non-profit organizations, superannuation funds, medical practitioners, film industry, Australian opera and individuals.\n\nWe have developed specialist skills in the area of Budgeting, projections, cashflow forecasting and salary packaging. We believe it is important to offer our clients a total package of service.\n\nWe at Adel Hassan & Co will continue to seek out new ways of servicing our clients, as well as maintaining our high quality in the provision of the firm’s current range of services\n\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
