  (109023, 'wallman-k-s-co-109023', 'Wallman K S & Co', '', '', 0, '2016-04-22 06:16:26', '2016-04-22 06:16:26', '', 191, 996, '', 0, 0, '', '', '0894810977', '', '', '', '', '', 'A', '', '', '', '', '', '', '', ''),
  (109024, 'stanbuli-109024', 'Stanbuli', '', 'Stanbuli is an affectionate term for an Istanbul local and is an exciting Turkish Restaurant from Chef and Owner Ibrahim Kasif, located at Enmore.', 275545, '2016-04-22 06:18:47', '2016-04-22 06:20:46', '', 191, 994, 'international cuisine', 275545, 0, '', '', '0286243132', '', '', '', 'http://stanbuli.com.au/', 'STANBULI & Marie-Louise\nThe name Stanbuli is taken from the local lingo of Istanbul’s streets. Stanbuli is an affectionate term for an Istanbul local and is an exciting Turkish Restaurant from Chef and Owner Ibrahim Kasif. \n\nWhile travelling to Istanbul and Northern Cyprus Ibrahim dreamed of reinterpreting the cuisine of his own cultural heritage. Years later the dream of his own restaurant took on the form of a style of eatery known as a Meyhane. \n\nIntrinsic to a Meyhane is a sense of nostalgia and romance. Underpinning the Meyhane tradition is a convivial atmosphere characterised by a fun, social style of eating and drinking. Food is always shared – a central tenet of Turkish custom and an underlying feature in hosting guests.\n\nMeze – abundant / colourful and creative / seemingly endless little dishes – invites the diner to commence their evening with cold dishes serving up an array of vegetables, yoghurts, cheeses, fish and offal. Then seamlessly the diner moves to hot dishes, which crescendos into meats cooked over charcoal, all to be enjoyed with beer, wine or perhaps a Raki.', 'A', '{"3":[[0.75,0.9583333333]],"4":[[0.75,0.9583333333]],"5":[[0.75,0.9583333333]],"6":[[0.75,0.9583333333]],"0":[[0.75,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109025, 'tomago-bowling-sporting-club-109025', 'Tomago Bowling & Sporting Club', '', 'Tomago Bowling & Sporting Club located in Tomago offer its visitors and patrons services and facilities including live entertainment, function rooms, game of bowls, bistro, tab & keno and many more.', 275551, '2016-04-22 06:26:46', '2016-04-22 06:29:39', '', 191, 992, 'bowling club\nsports club', 275551, 0, '', '', '0249648007', '', '', '', 'http://www.tomagobowlingclub.com/', 'Tomago Bowling & Sporting Club was established in 1964 to support our local industry, its workforce, our nearby residents & anyone wanting to enjoy friendly comradeship, bowls & other sports. Here at Tomago Bowling & Sporting Club our hand of friendship is always extended.\n\nThe Club hosts community activities, regular activities & entertainment  functions for our members, work parties, weddings, sporting events, barefoot bowls and the best catering in Newcastle by leading chef''s Linda & Trevor Weld, who came from the same village in Essex, England and married as teenagers & later migrating to Australia in 1970.\nCLUB TOMAGO sponsors local  non professional sporting bodies, both junior and senior, along with supporting surrounding schools etc. As a smaller club we are proud of our support which we supply to charities & sport.\n \nSome regular events at the club include Tuesday night Bingo along with twilight bowls, Thursday morning bowls, Friday meat raffle along with members draw Joker Jackpot Draw. Entertainment and beautiful meals from the Bistro. Saturday bowls and Saturday nights is either Dinner Dance Nights running bi monthly or private booked functions. For bookings call Gary and he can sit down with you and arrange a night that fits your expectations, along with Trevor if food is required.\n \nThe sporting fields are available to use as well as the bowling green and club facilities. The Club also provides T A B, Keno, Eftpos and ATM facilities.Areas are available for smokers & also outdoor alfresco. Accompanied children are very welcome.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.7916666667]],"4":[[0.3541666667,0.8541666667]],"5":[[0.375,0.875]],"6":[[0.4583333333,0.75]],"0":[[0.625,0.7916666667]]}', 'https://www.facebook.com/pages/Tomago-Bowling-Sporting-Club/145381568884857', '', '', '', '', '', ''),
  (109027, 'glebe-point-diner-109027', 'Glebe Point Diner', '', 'Glebe Point Diner are proud to be a neighbourhood favourite. We aim to keep our menu small and ever-changing to best reflect the finest produce that is available.', 275563, '2016-04-22 06:38:45', '2016-04-22 06:41:16', '', 191, 988, '', 275563, 0, '', 'eat@glebepointdiner.com', '0296602646', '', '', '', 'http://www.glebepointdiner.com.au/', 'Glebe Point Diner\nThe food is simple and unpretentious with the focus firmly on the quality of the product. Everything served to you is made from scratch, from our bread and hand-churned butter to our ice-cream and sorbets.\n\nAt Glebe Point Diner we are proud to be a neighbourhood favourite. We aim to keep our menu small and ever-changing to best reflect the finest produce that is available, while staying loyal to our favourites such as the grain feed beef from Coorong, SA.  The menu changes daily and is designed to be appropriate to the season.\n\nWe have a ‘nose-to-tail’ philosophy which is about harnessing the potential of every animal we use. Wherever possible we buy whole beasts; breaking down and finding a use for the entire carcass is more ecologically sound, as well as physically and intellectually more challenging for us as chefs.\n\nFor us, cooking this way is about expressing a sense of generosity, respecting nature, and sharing with others.\n\nIt’s the food we love to eat.', 'A', '{"1":[[0.75,0.8958333333]],"2":[[0.75,0.8958333333]],"3":[[0.5,0.6041666667],[0.75,0.8958333333]],"4":[[0.5,0.6041666667],[0.75,0.8958333333]],"5":[[0.5,0.6041666667],[0.75,0.8958333333]],"6":[[0.5,0.6041666667],[0.75,0.8958333333]],"0":[[0.5,0.6041666667],[0.75,0.8958333333]]}', 'https://www.facebook.com/Glebe-Point-Diner-205040852845012/', '', 'https://www.linkedin.com/company/glebe-point-diner', '', '', '', 'https://plus.google.com/108934119947091346841/about'),
  (109028, 'wallsend-sporties-109028', 'Wallsend Sporties', '', 'Wallsend Sporties located in Wallsend offer its guests and members services and facilities including function rooms, social bowls, restaurant and more.', 275571, '2016-04-22 06:42:19', '2016-04-22 06:45:17', '', 191, 984, 'sports club\nsocial club', 275571, 0, '', 'info@wbbc.com.au', '0249501222', '', '', '0249502296', 'http://www.wallsendsporties.com.au/', 'Wallsend Sporties is Wallsend’s friendliest club. We are a proud to be part of the Wallsend community, catering to men and women bowlers in social and competition bowls and our local schools.\n\nVisitors are always welcome, whether for dining, a quiet drink, or a casual roll-up.\n\nOur function facilities include ‘free’ room hire, full catering from our Bistro or you can Self-cater in our great BBQ area.\n\nDrop in and visit any time – we would love to see you at Wallsend Sporties!', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.8541666667]],"3":[[0.375,0.8541666667]],"4":[[0.3541666667,0.8541666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.8541666667]],"0":[[0.375,0.8541666667]]}', 'https://www.facebook.com/wallsendsporties', '', '', '', '', '', ''),
  (109031, 'mark-walmsley-109031', 'Mark Walmsley', '', 'Mark Walmsley located in Stockton specialises in Accounting Services, Taxation Services and Reassurance Audit Services.', 275583, '2016-04-22 06:45:00', '2016-04-22 06:47:17', '', 191, 982, 'tax services\nbusiness advice and planning\nauditing', 275583, 0, '', 'admin@mwca.com.au', '0249201311', '', '', '', 'http://www.mwca.com.au/', 'Welcome to Mark Walmsley Chartered Accountant. We’ve been in business in Newcastle since 1994, providing excellent accounting and auditing services for a large range oaf clients. Our firm is a member of the Institute of Chartered Accountants in Australia and New Zealand. We started, in response to a demand from a number  of individuals and businesses seeking reliable, professional accountancy services. Our office is in Stockton, NSW, though modern technology, including cloud-based solutions allow us to serve clients from throughout Australia.\n\nClients of all sizes use our accounting services- from large-scale companies to individuals managing finances for themselves and/or a family. We’ve earned our strong reputation based on our experience and commitment to excellence. Our client base has grown with the help of modern accounting technology that grant us the opportunity to provide real time financial information and advice to  our clients. No matter where you’re located, give us a call. We’re here to help keep your books in order and we always demonstrate the utmost professionalism in our work.\n\nMark Walmsley Chartered Accountants continually adapt to the changing accounting technology to provide modern solutions for every client, whether it’s an entrepreneur, individual or large company. Mark Walmsley Chartered Accountant deliver up-to-date financial information and advice in real time with cloud-based technology solutions. Starting a business or seeking finance-related guidance? We are happy to assist individuals and businesses achieve their goals professionally and personally. Give us a call  today. We’re here to help you succeed!', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
