  (109034, 'warners-bay-sports-club-109034', 'Warners Bay Sports Club', '', 'Warners Bay Sports Club located in Warners Bay offer its guest and members services and facilities including function rooms, social bowls, dining, bars and more.', 275594, '2016-04-22 06:55:49', '2016-04-22 06:59:05', '', 191, 972, 'sports club', 275594, 0, '', 'info@warnersbaysportsclub.com.au', '0249488866', '0249474011', '', '0249472335', 'http://www.warnersbaysportsclub.com.au/', 'Warners Bay Sports Club was founded in 1955 on a mud flat covered with Tea Tree shrub and is situated adjacent to the shores of Lake Macquarie in Charles Street, some 200 metres walking distance from the Warners Bay shopping centre.  Awarded the Lake Macquarie Business Achiever Award in 2006 the club has recently undertaken extensive renovations and now boasts first class bar and lounge areas with Keno and sports betting facilities, comprehensive fine dining and bistro accommodation and a functions area catering for corporate events, weddings and top class live entertainment.\n\nWith over 1500 club members, in addition to pennant and club bowls the club proudly support various internal sporting bodies including, cricket, soccer and fishing.', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.3958333333,0.8541666667]],"3":[[0.375,0.8541666667]],"4":[[0.3958333333,0.875]],"5":[[0.4166666667,0.9583333333]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.8541666667]]}', 'https://www.facebook.com/warnersbaysports/', '', '', '', '', '', ''),
