  (109036, 'silvereye-109036', 'Silvereye', '', 'Silvereye Restaurant located at Chippendale offers informal dining, with contemporary Northern European influences incorporating Australian ingredients.', 275606, '2016-04-22 07:01:26', '2016-04-22 07:02:30', '', 191, 970, 'international cuisine', 275606, 0, '', 'info@silvereye-restaurant.com.au', '0282778520', '', '', '', 'http://www.silvereye-restaurant.com.au/', 'ABOUT SILVEREYE\n\nExecutive chef Sam Miller heads Silvereye’s open plan kitchen.\n\nThe intimate Silvereye dining room is located on the second floor of the heritage Clare building at The Old Clare Hotel. Looking to his own British heritage and experience as executive sous chef at Noma, Copenhagen; the food showcases the best of Australian produce. \n\nSam Miller brings his experience of working in some of Europe''s most influential restaurants, such as Noma, to The Old Clare Hotel with his first solo restaurant Silvereye. \n\nSilvereye serves two different tasting menus of multiple servings, which change regularly to suit the seasonality of ingredients. \n\nThe food at Silvereye has a strong natural aspect, focusing on herbal, vegetable, floral and creative elements that is product driven and respects the original ingredients. Traditional techniques such as pickling, fermenting, salting, curing and smoking are used in modern ways. \n\n ', 'A', '{"2":[[0.7708333333,0.9166666667]],"3":[[0.7708333333,0.9166666667]],"4":[[0.5,0.625],[0.7708333333,0.9166666667]],"5":[[0.5,0.625],[0.7708333333,0.9166666667]],"6":[[0.5,0.625],[0.7708333333,0.9166666667]]}', 'https://www.facebook.com/silvereyerestaurant/', '', '', '', '', '', ''),
  (109038, 'walsh-accounting-109038', 'Walsh Accounting', '', 'Walsh Accounting located in Barcaldine specialises in Accounting Services, Audit Services, Business support and Taxation Services.', 275616, '2016-04-22 07:08:04', '2016-04-22 07:12:49', '', 191, 963, 'tax services\nbusiness advice and planning\nauditing', 275616, 0, '', 'admin@walshaccounting.com.au', '0746511341', '', '', '0746511853', 'http://www.walshaccounting.com.au/', 'On 9 November 1980, Lionel Walsh established Walsh Accounting at its original location on Beech Street, Barcaldine. The firm has enjoyed steady growth over 35 years to achieve its goal of becoming a ‘one stop shop’ for its clients, providing a range of services including accounting, taxation, auditing, superannuation and business advisory.  The firm has grown from a small family operation to become a service provider for a wide region, now employing nine staff.  Since 1996, the firm has been operating at its current premises  in Ash Street, Barcaldine.\n\nThe growth of Walsh Accounting can be attributed to one thing – quality.  Over many years we have developed our staff, systems and technology to ensure we are able to provide the same high level of service to all clients, however big or small.\n\nIn this time, Walsh Accounting have developed expertise in the areas of Small business accounting and advisory services, Local government accounting and management services, Company audits, Not-for-profit financial statements and audits, Primary production businesses, Overdue multiple years tax returns, Self managed superannuation funds.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109039, 'adoranti-co-109039', 'Adoranti & Co', '', 'Adoranti & Co Pty Limited is a professional services firm focused on delivering innovative solutions to your accounting and business needs with highly proficient team who look beyond the numbers, and towards business growth.', 275618, '2016-04-22 07:10:12', '2016-04-22 07:13:08', '', 191, 961, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing', 275618, 0, '', 'mail@adoranti.com.au', '0249622440', '', '', '', 'http://adoranti.com.au/', 'Established in 1992, Adoranti & Co Pty Limited is a professional services firm focused on delivering innovative solutions to your accounting and business needs. We are a highly proficient team who look beyond the numbers, and towards business growth.\n\nOur relationship with clients is viewed as a joint venture, one in which the business goals are incorporated into our overall management goals and objectives.\n\nAdoranti & Co have philosophy to client services includes:\n\n-Understanding our clients needs, requirements and opportunities;\n-Assisting clients in analysing their own ideas and providing a fresh perspective;\n-Being realistic and results orientated;\n-Assisting our clients to improve the effectiveness and efficiency of their day to day operations; and\n-Being innovation orientated.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/adorantico/', 'https://twitter.com/adorantico?ref_src=twsrc%5Etfw', '', '', '', '', 'https://plus.google.com/106587703025486234565/about'),
  (109040, 'walsh-phillip-p-109040', 'Walsh Phillip P', '', '', 0, '2016-04-22 07:14:58', '2016-04-22 07:14:58', '', 191, 959, '', 0, 0, '', '', '0393260822', '', '', '', '', '', 'A', '', '', '', '', '', '', '', ''),
  (109041, 'bellingen-golf-club-109041', 'Bellingen Golf Club', '', 'Bellingen Golf Club located in Bellingen offer its guest and members services and facilities including function rooms, bistro, weekly golf competitions and more.', 275628, '2016-04-22 07:18:23', '2016-04-22 07:20:53', '', 191, 953, 'golf club', 275628, 0, '', '', '0266551312', '', '', '0266550251', 'http://www.bellingengolfclub.com.au/', 'Bellingen Golf Club has a modern air conditioned clubhouse and facilities that overlooks our beautiful 10 hole golf course on the banks of the Bellinger River with a magnificent mountain backdrop.\n\nOur beatiful tree lined golf course has an ACR rating of 68 with a par 70 and offers a challenge for all golfers.\n\nBellingen Golf Club has a private function room that can easily cater for up to 100 people with a great selection of menu choices available.\n\nFairway Bistro has a great menu selection and blackboard specials for lunch and dinner that can be enjoyed indoors or outdoors in a relaxed and friendly atmosphere.\n\nThere is always plenty of entertainment at the club with Friday nights monster raffles, member draw, Joker Draw and live music regularly presented by Bellingen Lookout.\n\nSo come and enjoy all our Golf Club has to offer.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Bellingen-Golf-Club-In-The-Rough-Bistro-160346064012811/', '', '', '', '', '', ''),
