  (109043, 'guildford-bowling-recreational-club-109043', 'Guildford Bowling & Recreational Club', '', 'Guildford Bowling & Recreational Club located in Guildford features bistro, TAB & keno, 3 bowling greens, dart boards, vending machines and more .', 275632, '2016-04-22 07:23:18', '2016-04-22 07:24:44', '', 191, 951, 'bowling club', 275632, 0, '', 'contact@clubmerrylands.com.au', '0298923433', '', '', '', 'http://www.guildfordbowlingclub.com.au/', 'Guildford Bowling & Recreational Club offer:\n\n• Dining \n  Bistro open for lunch and dinner every day  \n\n• Bars \nMain Bar\n• Free parking \n• TAB & Keno \n• Public & taxi phones \n• ATM  \n• 3 Bowling greens \n• Dart boards \n• Vending machines \n• Wheelchair & handicapped access ', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.0833333333]],"5":[[0.375,0.0833333333]],"6":[[0.375,1]],"0":[[0.375,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/114608049375126542210/about'),
  (109045, 'prosperity-advisers-group-109045', 'Prosperity Advisers Group', '', 'Prosperity Advisers Group delivers a portfolio of chartered accounting and wealth management services to a range of clients throughout Australia.', 275642, '2016-04-22 07:30:58', '2016-04-22 07:32:09', '', 191, 943, 'tax services\nbusiness advice and planning\nauditing', 275642, 0, '', 'mail@prosperityadvisers.com.au', '0282628700', '', '', '', 'http://www.prosperityadvisers.com.au/home/.aspx', 'The Prosperity Advisers Group delivers a portfolio of chartered accounting and wealth management services to a diverse range of clients.\n\nWith over 20 years of successful operation, Prosperity has the technical expertise, industry experience and resources to assist clients meet their financial objectives.\n\nProsperity Advisers Group have team of professionals work in partnership with clients to understand their goals and expectations, demonstrating a genuine commitment to their success.\n\nWe are proud of our firm’s exceptional growth, acknowledged by BRW, when inducted into the BRW Fast 100 Hall of Fame. \n\nWith more than 120 staff across our Sydney, Newcastle and Brisbane offices, Prosperity services the diverse needs of our clients in five core areas.\n \n-Business Services\n-Taxation\n-Corporate Assurance\n-Wealth Management\n-Employee Benefits and Services', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/prosperityadvisersgroup', '', '', '', '', '', 'https://plus.google.com/+ProsperityadvisersAust/about'),
  (109046, 'bowraville-ex-services-club-109046', 'Bowraville Ex Services Club', '', 'Bowraville Ex Services Club located in Bowraville  offer its guests and members services and facilities including gaming like TAB and Keno, weekly events, restaurant and many more.', 275644, '2016-04-22 07:31:46', '2016-04-22 07:33:08', '', 191, 941, 'social club', 275644, 0, '', '', '0265647304', '', '', '', 'http://www.bowravilleexservicesclub.com.au/', 'In the 1950s, Bowraville Ex Services Club started life as the Bowraville & District Ex-Servicemen’s Club. At that point, it was the premier meeting place for returning and ex-servicemen and –women from the First and Second World Wars. The club was licensed and registered in 1958. The Land was donated to the Club by Mr KJ Bustead and The Ex-Servicemen''s Club had to seek permission to be able to purchase the Land from the CWA and pay to relocate the building to its present site. \n\nOver the decades, the club went through many changes. In 1992, the club’s name was changed to the Bowraville & District Ex-Services Club Ltd. In 1995, the building was modernised and opened by then NSW State President of the RSL, Rusty Priest and Keith Payne, VC. Meanwhile, the club became the central point for Saturday night entertainment, with many local bands performing at club dances.\n\nToday, our club is a modern rural club, well-managed by a dedicated Board of Directors and Bar Manager. We are a central community meeting place and cater weddings, anniversaries, birthdays and other celebrations. We are a large community employer, with staff members working for us for years. \n\nIf you are seeking to join a community club, come to Bowraville Ex Services Club! Serving the Bowraville community for over 50 years, we offer many different ways for our members to get together, socialise and simply have a great time. Check out everything we have to offer, and be sure to contact us today to learn more about membership!', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109047, 'kensington-street-social-109047', 'Kensington Street Social', '', 'Kensington Street Social located on Chippendale features menu focuses on Mediterranean sharing plates that showcase the very best Australian produce and wine. With dishes designed to be shared.', 275656, '2016-04-22 07:33:58', '2016-04-22 07:35:14', '', 191, 937, 'international cuisine\nfine dining', 275656, 0, '', 'reservations@kensingtonstreetsocial.com', '0282778533', '', '', '', 'http://kensingtonstreetsocial.com/', 'ENSINGTON STREET SOCIAL IS THE DEBUT SYDNEY RESTAURANT BY RENOWNED MICHELIN-STARRED BRITISH CHEF JASON ATHERTON.\n\nLocated within The Old Clare Hotel in Chippendale, an industrial heritage-listed site that was formerly the Carlton & United Brewery administration building, the relaxed menu focuses on Mediterranean sharing plates that showcase the very best Australian produce and wine. With dishes designed to be shared, Culinary Director Jason Atherton and Executive Chef Robert Daniels have created a menu that is informal and versatile - whether you’re looking for a quick glass of wine and a sourdough flatbread sat at the bar overlooking the open kitchen, or a multiple course dinner with paired wines on the intimate mezzanine level.\n\nOn the menu: ‘English breakfast tea and toast’ – a play on tea and toast with wild mushroom tea served in a teapot alongside a relish and bone marrow toast; Queensland Spanner crab, frozen cucumber gazpacho, rhubarb; sea urchin rice with Moreton Bay bug tail, sea blight and bisque; and buffalo ricotta with lemon thyme peaches and honeycomb.\n\n', 'A', '{"1":[[0.2916666667,0.4375],[0.5,0.6041666667],[0.75,0.9166666667]],"2":[[0.2916666667,0.4375],[0.5,0.6041666667],[0.75,0.9166666667]],"3":[[0.2916666667,0.4375],[0.5,0.6041666667],[0.75,0.9166666667]],"4":[[0.2916666667,0.4375],[0.5,0.6041666667],[0.75,0.9166666667]],"5":[[0.2916666667,0.4375],[0.5,0.6041666667],[0.75,0.9166666667]],"6":[[0.3333333333,0.4375],[0.5,0.6041666667],[0.75,0.916666