  (109048, 'adrian-jacobsen-co-pty-ltd-109048', 'Adrian Jacobsen & Co Pty Ltd', '', '', 0, '2016-04-22 07:34:19', '2016-04-22 07:34:23', '', 191, 939, '', 0, 0, '', '', '0263310136', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
