  (109051, 'walters-accountants-109051', 'Walters Accountants', '', 'Walters Accountants located in Wamberal specialises in Taxation Services, Compliance Services, Business Planning, and GST & BAS Services.', 275662, '2016-04-22 07:39:27', '2016-04-22 07:41:40', '', 191, 932, 'bookkeeping\ntax services\nbusiness advice and planning\nauditing\npayroll', 275662, 0, '', '', '0243853030', '', '', '0243853023', 'http://waltersaccountants.com.au/', 'Walters Accountants provides sound financial advice on matters related to GST, BAS, business planning and taxation, in particular the all-important income tax return, compliance services, super funds and much more.\nThe perfectly equipped small business person needs to be a sales expert, manager, production person, administrator and accountant - all rolled into one.\n\nAs a small practice Walters Accountants can offer you the personalised and specialised service and care that can assist you in coping with all of these roles and developing them into a thriving business.  As well as reporting last year’s results let us help you make this year''s return even better!\n\nWalters Accountants'' most important role is to act as a sounding board or first port of call for the everyday questions of our clients on a vast array of accounting issues.\n\nWhether you are a small business with ambition to grow, a larger firm looking to expand or an individual seeking financial security, Walters Accountants can provide you with professional advice and support for all your business and individual needs.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
