  (109053, 'gulgong-bowling-sporting-club-109053', 'Gulgong Bowling & Sporting Club', '', 'Gulgong Bowling & Sporting Club located in Gulgong  is a relaxed destination offering good old fashioned country courtesy to our local community and visitors alike in safe comfortable surroundings. ', 275668, '2016-04-22 07:47:18', '2016-04-22 07:48:48', '', 191, 928, 'bowling club', 275668, 0, '', 'gbsclub@optusnet.com.au', '0263741054', '', '', '0263742280', 'http://www.gulgongbowlo.com.au/', 'Gulgong Bowling & Sporting Club is a relaxed destination offering good old fashioned country courtesy to our local community and visitors alike in safe comfortable surroundings. Situated in the Central Tablelands of NSW Gulgong is a heritage town offering quaint turn of the century architecture and one of the best Pioneer Museums in Australia.\n\nD’Fortune Bistro\n\nDelicious homestyle asian food.\nD’Fortune Bistro offers a comprehensive Asian menu at competitive prices. D''Fortune caters for finger food, Asian & Western buffet and banquets for all occasions, functions and a parties.', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/GulgongBowlo/', '', '', '', '', '', ''),
