  (109065, 'gymea-miranda-bowling-sports-club-109065', 'Gymea Miranda Bowling & Sports Club', '', 'Gymea Miranda Bowling & Sports Club located in Gymea offers members and guests TAB keno  and other gaming facilities.', 275690, '2016-04-22 08:32:50', '2016-04-22 08:37:48', '', 191, 898, 'bowling club', 275690, 0, '', 'functions@gymeabowls.com.au', '0295244688', '', '', '0295254031', 'http://www.gymeabowls.com.au/', 'Gymea Miranda Bowling & Sports Club is one of the largest bowling clubs in the Sutherland Shire. Signature Ritz, our top class bistro, attracts a large number of guests to the Club every day. Members and guests can enjoy TAB, Keno and our gaming facilities, we have 35 Pokie Machines. Fox Sport, a Trivia Evening, 3 weekly raffles and many more promotions.\n\nWELCOME TO GYMEABOWLS\nDiscover the best kept secret in the Shire! Our recently refurbished facilities offer a scenic, relaxed atmosphere and modern facilities. Come and enjoy a meal or a game of Barefoot Bowls with your friends!\n\nOur club has superbly appointed function rooms suitable for Weddings, Corporate Functions and Conferences. We can host up to 250 guests for private functions.\nOver 50 years young the Club has a growing member base and excellent facilities that include:\n\n• Three championship greens with manicured surrounds and gardens\n• Two function rooms with relaxing views and extensive catering • options at great prices.\n• Snack and Bistro dining available seven days a week.\n• Indoor Bowls, Darts, Fishing and Golf Social Club facilities.\n• Raffles, Members Draw, Trivia Night, etc.\n\nWe look forward to seeing you!', 'A', '{"1":[[0.4583333333,0.875]],"2":[[0.4583333333,0.875]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/GymeaBowls', '', '', '', '', '', 'https://plus.google.com/108318669227996807309/about'),
  (109068, 'halekulani-bowling-club-109068', 'Halekulani Bowling Club', '', 'Halekulani Bowling Club located in Budgewoi features sports betting, cricket, soccer, rugby betting and many more.', 275698, '2016-04-22 08:54:21', '2016-04-26 07:41:18', '', 191, 629, 'bowling club', 275698, 0, '', 'nturner@halibowling.com.au', '0243906400', '', '', '0243991436', 'http://www.halibowling.com.au/#', 'Halekulani Bowling Club is the number 1 entertainment venue on the Central Coast, specialises in private and corporate events, wedding receptions, charitable fundraisers, award evenings, engagements and birthdays. ', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,1]],"6":[[0.375,0.9791666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/halekulanibowlingclub', '', '', '', '', '', 'https://plus.google.com/100671329138255037725/about'),
  (109069, 'hamilton-north-bowling-club-109069', 'Hamilton North Bowling Club', '', 'Hamilton North Bowling Club located in Broadmeadow aims to provide best facilities for guests and members to enjoy. Also offers venue for group functions, food and drinks and other variety of services', 275702, '2016-04-22 09:06:36', '2016-04-22 09:08:08', '', 191, 895, 'bowling club', 275702, 0, '', 'admin@hamiltonnorthbc.com.au', '0249614574', '', '', '0249622911', 'http://www.hamiltonnorthbc.com.au/', 'Hamilton North Bowling Club provides a great place to socialise, meet new people, bring your family, hold your function, dine with friends or play a game of bowls or two.\n\nWe are located next to Smith Park on Boreas Road, Hamilton North.\n\nThe club aims to provide the best facilities for our members and guests to enjoy. We are a community-based club, welcoming individuals, families, sporting groups, community groups and bowlers. In addition, we also offer a great venue for group functions, providing great food, drinks and a wide variety of other services and facilities.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109071, 'navarra-venues-109071', 'Navarra Venues', '', 'Offering a wide range of event venues, Navarra Venues is one of Sydney''s most prestigious hosting companies.', 275710, '2016-04-24 20:22:04', '2016-04-24 20:22:28', '23078307445', 702, 892, '', 275710, 0, '', 'webnavarravenues@outlook.com', '1300235568', '1300235568', '1300235568', '1300235568', 'http://www.navarravenues.com.au/', 'Offering a wide range of event venues, Navarra Venues is one of Sydney''s most prestigious hosting companies. Despite its humble beginnings, they have grown and elevated themselves into a unique place in the landscape of hospitality in Sydney. The Team at Navarra Venues, led by the founder and CEO Filippo  Navarra, is a true reflection of strong family values and work ethics. They are dedicated to providing world-class service and business excellence for all your event needs.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109072, 'st-george-underwriting-agency-109072', 'St George Underwriting Agency', '', 'Providing Australia-wide landlord insurance for property owners, SGUA has become one of the most trusted providers in the industry today. ', 275712, '2016-04-25 10:39:44', '2016-04-25 10:41:17', '59009357582', 706, 890, 'home insurance', 275712, 0, '', '', '0894178501', '', '', '', 'https://www.sgua.com.au/', 'SGUA is an Australian-based underwriter that provides insurance on residential properties. With a range of cover options available and quick, efficient claim service in the case of an incident, we have become a leading provider in the niche industry. \n\nHaving operated in Australia since 1991, our insurance services are competitively priced and with comprehensive cover options we are able to effectively protect the interests of landlords and property owners in a wide variety of cases including: \n\nBuilding and content insurance  \nDamage by theft by tenant\nTenant default\nLegal liability \nMinimum standard excess \n\nContact SGUA or visit our website for more information. \n', 'A', '{"1":[[0.3333333333,0.6875]],"2":[[0.3333333333,0.6875]],"3":[[0.3333333333,0.6875]],"4":[[0.3333333333,0.6875]],"5":[[0.3333333333,0.6875]]}', '', '', '', '', '', '', ''),
  (109074, 'kogarah-rsl-club-109074', 'Kogarah RSL Club', '', 'Kogarah RSL Club is a fully licensed venue at Kogarah, providing great food 7 days and nights with excellent service, kids play area, Platinum TAB, Keno and more entertaining facilities!', 275726, '2016-04-25 23:11:03', '2016-04-25 23:12:46', '', 191, 884, 'rsl club', 275726, 0, '', 'reception@kogarahrsl.com.au', '0295878533', '', '', '0295878809', 'http://kogarahrsl.com.au/', 'Welcome to Kogarah RSL Club \n\nConveniently located on Railway Parade Kogarah and is easily accessible by both Carlton & Kogarah Railway Stations, or by car.\n\nFollowing the clubs recent renovations we are now the premier RSL Club in the St. George Area.  Offering two restaurant''s Sun Ho - Yum Cha and A La Carte and Sammy''s Café & Grill offering western style food and a kids play area.  A state of the art platinum TAB  and Sports Bar, completed with a relaxing bar area.\n\nAt Kogarah RSL you are always welcome, see you soon!\n', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.1041666667]],"6":[[0.4166666667,0.1041666667]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/KogarahRSL/', 'https://twitter.com/kogarahrsl', '', '', '', '', 'https://plus.google.com/109292348650865067092/posts'),
  (109075, 'coffs-harbour-catholic-club-109075', 'Coffs Harbour Catholic Club', '', 'Coffs Harbour Catholic Club located in Coffs Harbour Catholic Club  provide its guests and members a wide range of services and facilities including function rooms, dining and many more.', 275732, '2016-04-25 23:20:29', '2016-04-25 23:21:31', '', 191, 882, 'social club', 275732, 0, '', 'ccc_admin@omcs.com.au', '0266521477', '', '', '', 'http://www.coffsharbourcatholicclub.com.au/', 'The Coffs Harbour catholic Club is situated 1 KM west of the CBD.\n\nWe have something for the whole family.\n\nTreat yourself in our bistro or coffee shop open 7 days.\n\nThe club offers outstanding facilities for all accassions specialising in quality food and service from our proffessional and friendly staff.\n\nDrop in for a game of bowls or a hit of tennis.\n\nCome and try your luck in one of our many promotions with great prizes to be won.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
