  (109081, 'gloucester-soldiers-club-109081', 'Gloucester Soldiers Club', '', 'Gloucester Soldiers Club located in Gloucester provide its guests and members a wide range of services and faciities including live entertainment, dining, snack bars, raffles, bingo and many more.', 275748, '2016-04-26 00:02:14', '2016-04-26 00:04:37', '', 191, 867, 'social club', 275748, 0, '', '', '0265581006', '', '', '', 'http://www.gloucestersoldiersclub.com.au/', 'Gloucester Soldiers Club nestled in the foothills of the Bucketts and Mograni ranges, Gloucester boasts a vibrant main street and a wide selection of activities. Located right in the middle of town is the Gloucester Soldiers Club. We were incorporated in 1971, formed by returned veterans for returned veterans. We offer the best customer service, great food, excellent function facilities and all the amenities a modern services club has to offer. Our Club offers a relaxed atmosphere, features a wheelchair accessible lift and provides a great range of services, facilities and fun activities for members and guests to enjoy. We look forward to seeing you soon.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.3958333333,0.9375]],"5":[[0.3958333333,1]],"6":[[0.3958333333,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/Gloucester-Soldiers-Club-529821093738535/', '', '', '', '', '', 'https://plus.google.com/117304092120779067376/about'),
  (109087, 'kempsey-macleay-rsl-club-109087', 'Kempsey Macleay RSL Club', '', 'Kempsey Macleay RSL Club located in Kempsey  provide its guests and members a wide range of services and facilities including function rooms, live entertainment, dining, and many more.', 275768, '2016-04-26 00:24:12', '2016-04-26 00:28:00', '', 191, 852, 'rsl club', 275768, 0, '', 'admin@kmrsl.com.au', '0265601111', '', '', '0265601126', 'http://kempseymacleayrsl.com.au/', 'Kempsey Macleay RSL Club is situated in the heart of Kempsey’s CBD, the RSL club is perched on the Macleay River, whilst the Bowling and Sports club is located on Austral Street.\n\nWe invite members and guests to experience the array of dining and entertainment facilities available at our clubs. With fantastic live entertainment, TAB, Keno, Sky and Fox Sports live on the screens and other sports and leisure activities, there are loads of things to enjoy at the Kempsey Macleay RSL and Bowling and Sports clubs.\n\nKempsey Macleay RSL Club want to make sure you have an enjoyable experience whilst at our clubs. That’s why we pride ourselves on offering the best customer service experience. Our team take pride in ensuring you have a great time whilst at our clubs.  We offer a wheelchair accessible lift, comfortable atmosphere and a great range of services, facilities and fun activities for members and guests to enjoy.\n\nWe look forward to seeing you in the club’s soon!', 'A', '{"1":[[0.4166666667,0.9375]],"2":[[0.4166666667,0.9375]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,0.9791666667]],"6":[[0.4166666667,0.9791666667]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/KMRSLClub/', 'https://twitter.com/KMRSLCLUB', '', '', '', '', ''),
  (109088, 'kyogle-bowling-club-109088', 'Kyogle Bowling Club', '', 'Kyogle Bowling Club located in Kyogle provide its visitors and patrons a wide range of services and facilities including live entertainment, function rooms, ladies bowls, men''s bowl and many more.', 275776, '2016-04-26 00:34:31', '2016-04-26 00:38:14', '', 191, 846, 'bowling club', 275776, 0, '', '', '0266321108', '', '', '', 'http://www.kyoglebowlsclub.bowls.com.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Kyogle-Bowling-Club-124371501082867/timeline', '', '', '', '', '', ''),
  (109089, 'rockdale-businessmen-s-club-ltd-109089', 'Rockdale Businessmen''s Club Ltd', '', '', 0, '2016-04-26 00:35:53', '2016-04-26 00:36:15', '', 191, 850, 'social club', 0, 0, '', '', '0295973322', '', '', '0295994458', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109090, 'club-terrigal-bowling-club-109090', 'Club Terrigal Bowling Club', '', 'Club Terrigal Bowling Club is located at Terrigal and provide best facilities. Club Terrigal Bowling Club have eating & entertainment, sports & bars and top class bowls.', 275778, '2016-04-26 00:36:10', '2016-04-26 00:37:58', '', 191, 848, 'bowling club', 275778, 0, '', '', '0243841403', '', '', '', 'http://www.clubterrigal.com.au/', 'More than sixty years after its foundation, our Club continues to be a key point of life in Terrigal for locals and tourists alike. We play a strong role in the community as a whole, sponsoring groups such as Crusaders Basketball Club, and the Terrigal/Wamberal Netball Club. At the time of its silver anniversary, Terrigal was described as "THE club with a heart" and that still holds true to this day.\n\nTerrigal Bowling Club is a very successful bowling club. Throughout the year, our bowlers participate in Club Championships, Zone Events and Club Carnivals. We also have a healthy social bowls base that welcomes newcomers, visitors and bare foot bowls groups to our club.\n\nAs with most clubs, we have had to change with legislative laws and economic downturn, yet we continue to listen to our loyal customers and provide a venue with ambience, friendliness and entertainment the whole family can enjoy. Whilst creating a place to be at, our club has again traded with a profit for 2014/15 that will be spent on continued improvements to reward both visitors and members into the future.\n\nClub Terrigal Bowling Club have very recently completed a refurbishment of our club, so come in and check it out and enjoy our new facilities and ambience.', 'A', '{"1":[[0.4583333333,0.8333333333]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4166666667,0.8333333333]]}', '', '', '', '', '', '', ''),
  (109092, 'chatswood-rsl-109092', 'Chatswood RSL', '', 'Chatswood RSL is conveniently located in the hub of Chatswood CBD, hosting a variety of entertainment, events and promotions.', 275790, '2016-04-26 00:47:12', '2016-04-26 00:48:55', '', 191, 838, 'rsl club\nsocial club', 275790, 0, '', '', '0294197386', '', '', '', 'http://www.chatswoodrsl.com.au/', 'Chatswood RSL is conveniently located in the hub of Chatswood CBD, offering range of facilities including:\n\n- Shades bar and cafe\n- Outdoor Terrace\n- TAB\n- Bistro\n- Pool Tables\n\nChatswood RSl Club also offers a range of regular entertainment and activities.', 'A', '{"1":[[0.4166666667,0.1666666667]],"2":[[0.4166666667,0.1666666667]],"3":[[0.4166666667,0.1666666667]],"4":[[0.4166666667,0.1666666667]],"5":[[0.4166666667,0.1666666667]],"6":[[0.4166666667,0.1666666667]],"0":[[0.4166666667,0.1666666667]]}', 'https://www.facebook.com/Chatswood.RSL.Club', 'https://twitter.com/ChatswoodRSL', 'https://www.linkedin.com/company/chatswood-rsl', '', '', '', 'https://plus.google.com/101026491648091256376/about'),
  (109095, 'rowers-on-cooks-river-109095', 'Rowers On Cooks River', '', 'Rowers on Cooks River located on Wolli Creek features Regattas Cafe, Bar, Outdoor Terrace, Function rooms for that special occcasions and meeting rooms.', 275800, '2016-04-26 01:00:32', '2016-04-26 01:02:03', '', 191, 834, '', 275800, 0, '', 'manager@rowersoncooksriver.com.au', '0295991932', '', '', '0295674857', 'http://rowersoncooksriver.com.au/', 'St George Rowing Club, trading as Rowers of Cooks River, is a NSW registered club that supports competitive rowing. Rowers compete in the NSW Rowing Calendar of events.\n\nThe Club was formed in 1957 by the rowing fraternity to finance the expensive sport of rowing. It was initially formed with 24 members but that was increased to 200 in 1962 in order to secure a liquor license. The Club''s first own single storey Clubhouse was opened on April 28, 1962 on the banks of the Cooks River replacing a tin boating shed.\n\nIn the early years, regattas and training activities were conducted on the Cooks River. The construction of the nearby bridge to the airport together and the increasing siltation of Cooks River led to the rowing facilities being relocated to a small wooden building at Scylla Bay, Georges River, Como in Sydney’s Sutherland Shire in 1973.\n\nOn November 25, 1979 a modern Clubhouse was opened to replace the original building on the Cooks River. St George Rowing Club continues to compete and train from its Como base. In the past decade, local efforts have been made to rejuvenate Cooks River, and the club is welcoming back learn-to-row, rowing for leisure and corporate rowing activities.\n\nRowers representing St George Rowing Club have won a number of State and National Titles. The club has produced 3 Olympians.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0208333333]],"6":[[0.3333333333,0.0208333333]],"0":[[0.3333333333,0.9583333333]]}', 'https://www.facebook.com/rowersoncooksriver', '', '', '', '', '', 'https://plus.google.com/114136408014356726016/about'),
  (109099, 'woronora-river-rsl-citizens-club-109099', 'Woronora River RSL & Citizens Club', '', 'Woronora RSL & Citizens’ Club offers club members and guests facilities like the outdoor garden area overlooking Forbes Creek, as well as disabled access and facilities, TAB, Keno & Function Centre.', 275834, '2016-04-26 01:17:16', '2016-04-26 01:18:07', '', 191, 819, 'rsl club\nsocial club', 275834, 0, '', 'woronor@bigpond.net.au', '0295212341', '', '', '0295453695', 'http://woronorariverrsl.com.au/', 'Woronora RSL & Citizens’ Club\nWe are a small friendly Club, priding ourselves on providing our local community a social, entertainment and dining hub located in the beautiful bushland of the Woronora River Valley. \n \nOur War Memorial is the only one in the Sutherland Shire in a bush setting on the grounds of the Club itself.\n \nClub members and guests can enjoy the outdoor garden area overlooking Forbes Creek, as well as disabled access and facilities, TAB, Keno, Fox Sports, two full size Snooker tables, a 100 seat function centre “The River Room” with its own serviced bar and stage facilities and much more.\n \nWe look forward to seeing you and your family at Woronora RSL & Citizens’ Club.\n\n', 'A', '{"1":[[0.5833333333,0.9166666667]],"2":[[0.5833333333,0.9166666667]],"3":[[0.4791666667,0.9166666667]],"4":[[0.4791666667,1]],"5":[[0.4791666667,1]],"6":[[0.4791666667,1]],"0":[[0.4791666667,0.9166666667]]}', 'https://www.facebook.com/woronorariverrsl/', '', '', '', '', '', ''),
  (109101, 'granville-diggers-109101', 'Granville Diggers', '', '', 275853, '2016-04-26 01:36:25', '2016-04-26 01:38:21', '', 191, 811, 'rsl club', 275853, 0, '', 'info@granvillediggers.com.au', '0296377888', '', '', '0296374181', 'http://www.granvillediggers.com.au/', '', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.9583333333]]}', '', '', 'https://www.linkedin.com/company/granville-diggers', '', '', '', ''),
  (109105, 'nambucca-leagues-and-sports-club-109105', 'Nambucca Leagues and Sports Club ', '', 'Nambucca Leagues and Sports Club  located in Nambucca Heads provide its guests and members a wide range of services and facilities including bar, function rooms, dining, poker, bingo and many more.', 275879, '2016-04-26 02:05:06', '2016-04-26 02:08:38', '', 191, 796, 'leagues club\nsports club', 275879, 0, '', '', '0265687210', '', '', '', 'http://nambucca.com.au/nambuccaleaguesandsportsclub/', 'Nambucca Leagues and Sports Club is the perfect venue for after sport and after work.\n\nWe offer full bar service, beer garden with BBQ facilities or casual dining at the popular Precious Old Malaysia restaurant. Raffles, Keno and bingo also on through the week.\n\nThe club sponsors local league, soccer and cricket and overlooks Coronation Park, home of the mighty Nambucca Heads Roosters.\n\nCall in soon and visitors are most welcome.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109107, 'bankstown-polish-club-109107', 'Bankstown Polish Club', '', 'Bankstown Polish Club situated at the heart of Bankstown features facilities such as Bar, Restaurant, Cracovia kiosk, Main Dance Hall, Function room, Stage, poker machine and gaming room & outdoors.', 275883, '2016-04-26 02:08:54', '2016-04-26 02:10:43', '', 191, 794, 'social club', 275883, 0, '', 'bankstownpolishclub@bigpond.com', '0297082433', '', '', '', 'http://bankstownpolishclub.com.au/', 'Welcome to the Bankstown Polish Club\n\nDiscover one of Bankstown’s hidden treasures. Located in the heart of Bankstown CBD and easily accessible by car or on foot.\n\nThere is much to see and do here at the Bankstown Polish Club. After much renovations and promotions, the Polish Club has much installed for all members and guests.\n\nWhether its food, games, a drink or dancing, come on down and experience a night, week, month or year with the many fun filled activities that the Bankstown Polish Club has for you..\n\n', 'A', '{"3":[[0.7083333333,0.9166666667]],"4":[[0.625,0.9166666667]],"5":[[0.7083333333,0.9166666667]],"6":[[0.7083333333,1]],"0":[[0.5416666667,0.8541666667]]}', 'https://www.facebook.com/Bankstown-Polish-Club-177050065674744/', '', '', '', '', '', ''),
  (109108, 'mangrove-mountain-memorial-club-golf-course-109108', 'Mangrove Mountain Memorial Club & Golf Course', '', 'Mangrove Mountain Memorial Club & Golf Course is located at Central Mangrove and offer restaurants, BBQ facilities, two bars, large TV screens and TAB and Keno is also available.', 275887, '2016-04-26 02:14:28', '2016-04-26 02:17:01', '', 191, 792, 'golf club', 275887, 0, '', 'mmmclub@bigpond.com.au', '0243731129', '', '', '', 'http://mmmclub.com.au/', 'Mangrove Mountain Memorial Club & Golf Course has a solid community base, which has its origins some 90 years ago when the local Sub Branch of the RSL was formed.\n\nMangrove Mountain Memorial Club & Golf Course takes pride in its community spirit and continues to make resources available to the community. The Mangrove Mountain Memorial Club is proud to sponsor the Mountain District Soccer Club.\n\nThe golf course opened in 1974. In the early days the course was pretty rugged and, according to rumour, if you lost your ball in the rough you lit a fire that cleared the rough area so you could find your ball the next week!\n\nThe membership was then 20 and has now grown to 500. We have a new Clubhouse on course with a great 10 hole golf course and a Pro Shop which caters for the pro-golfer or the beginner. The golf course is being extended to 18 holes.', 'A', '{"1":[[0.4166666667,0.8333333333]],"2":[[0.4166666667,0.8333333333]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.9583333333]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/Mangrove-Mountain-Memorial-Club-and-Golf-Course-285804668097592', '', '', '', '', '', ''),
  (109109, 'bankstown-trotting-recreational-club-109109', 'Bankstown Trotting Recreational Club', '', 'Bankstown Trotting Recreational Club offers a range of activities including dance classes , line dancing, rockin roll, new vogue and sports team there''s something for everyone.', 275893, '2016-04-26 02:17:35', '2016-04-26 02:18:06', '', 191, 790, 'sports club\nsocial club', 275893, 0, '', 'shane@btrc.com.au', '0297092111', '0297092124', '', '', 'http://www.btrc.com.au/', 'Bankstown Trotting Recreational Club\nBankstown Trotting Recreational Club offers a range of activities including dance classes , line dancing, rockin roll, new vogue, there''s something for everyone. If it''s sport your interested in why not join one of our sporting teams.\n\nWe have great dining facilities, affordable and something for everyone.\n\nBring the kids to the Bistro & Grill . Kids eat free from the kids menu every Wednesday and Thursday night. There''s a range of dining experiences just waiting for you. \n\nTake a look at what Gigi''s Trackside Restaurant offers. You won''t be disappointed.\n\nThere''s a range of function, seminars and meeting rooms available.\n\nDon''t forget the courtesy bus is there to keep you safe.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109110, 'club-north-haven-109110', 'Club North Haven', '', 'Club North Haven located in North Haven provide its guest and members a variety of services and facilities including gaming, raffles, bingo, bowls, dining and many more.', 275895, '2016-04-26 02:17:58', '2016-04-26 02:22:08', '', 191, 788, 'bowling club\nsocial club', 275895, 0, '', 'contact@nhbrc.com.au', '0265599150', '', '', '0265597286', 'http://www.nhbrc.com.au/', 'Club North Haven is situated in 30 minutes south of Port Macquarie, the Club is home to some 300 bowling members, and is a favoured destination for travellers all year round. The highlight of the bowling calendar is the Riverview Carnival. Having celebrated its 50th year in 2008, the Carnival has grown to attract over 300 entrants from all across the country.\n\nCatering to a broader membership Club North Haven also offers a wealth of recreational and sporting activities for families and individuals. The local area provides idyllic conditions for outdoor activities. Our sub-clubs include golf, fishing, snooker, darts, and euchre. Other activites include Bingo, raffles, and social dance. New residents to the Camden Haven find the Club a great place to join social activities and meet new friends. With a focus on social enjoyment, the Club provides a welcoming environment for all visitors.\n\nOur own Haven Waters Motel & Apartments is just 100m from the Club. Also overlooking the Camden Haven River and only minutes walk from North Haven Beach, Haven Waters offers 3 1/2 star accommodation for over 60 guests; with rooms for singles, couples, and families. Couples choosing to hold their Wedding Reception at the Club will find Haven Waters a close, convenient and comfortable location for their visiting guests.\n\nOur play and stay packages are specially designed for travellers wanting to join our resident bowlers for a few days. Whatever your accommodation needs, our staff at Haven Waters will ensure you have an enjoyable and memorable stay.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109111, 'belfield-bowling-club-109111', 'Belfield Bowling Club', '', 'Belfield Bowling Club situated at the heart of Belfield features a wide range of facilities such as Pennants Bowls, Barefoot Bowls, Carlito’s Bistro, TAB, Gaming lounge and large screen for sports.', 275901, '2016-04-26 02:24:59', '2016-04-26 02:26:04', '', 191, 784, 'sports club', 275901, 0, '', 'info@belfieldbowls.org.au', '0296422346', '', '', '0296427751', 'http://belfieldbowls.org.au/', 'BELFIELD BOWLING CLUB\nThe Belfield Bowling and Recreation Club owes its origin to the Rudd Park Improvement Committee because it was at a~ meeting of that body that a suggestion was made to form a Bowling Club to provide bowling facilities for the residents of the district and at the same time to improve the park.\n\nWe pride ourselves on being the friendliest club in the area and welcome all visitors, bowling or social.\n\nOur facilities include; Pennants Bowls, Barefoot Bowls, Carlito’s Bistro, TAB, Gaming lounge and large screen for sports.\n\nFunctions\nWhether it be a Birthday, wedding or barefoot bowls, we have very competitive rates.\n\nThe well manicured greens set a natural back drop to our open and spacious floor. With a capacity of one hundred and fifty seated, we can hold functions for birthdays, engagements, christenings, sport presentations, charity events and celebrations of life.', 'A', '{"1":[[0.5,0.8333333333]],"2":[[0.5,0.8333333333]],"3":[[0.5,0.8333333333]],"4":[[0.5,0.8333333333]],"5":[[0.5,1]],"6":[[0.4583333333,0.8333333333]],"0":[[0.4583333333,0.8333333333]]}', 'https://www.facebook.com/belfieldbowls', '', 'https://www.linkedin.com/company/belfield-bowling-club', '', '', '', 'https://plus.google.com/109089703964681877572/about');
