  (109112, 'killara-bowling-club-109112', 'Killara Bowling Club', '', 'Killara Bowling Club is known as one of the best bowling establishments in the North Shore providing comprehensive schedule of bowling and social activities.', 275903, '2016-04-26 02:25:31', '2016-04-26 02:26:35', '', 191, 782, 'bowling club\nsocial club', 275903, 0, '', 'killarabc@tech2u.com.au', '0294982633', '', '', '', 'http://killarabowlingclub.com.au/kbc2/', 'Killara Bowling Club was established in 1916. Killara Bowling Club has grown from humble beginnings to become one of the best known bowling establishments on the North Shore.\n\nFor a century now, Killara Bowling Club has provided immense pleasure to thousands of men and women by providing a comprehensive schedule of bowling and social activities.\nFor the competitive: Internal championships, Intra-club and Zone competition including Carnivals.\nFor recreation: Social mixed bowls four days a week.\n\nThese activities are supported with clubhouse services of food and refreshments in a convivial atmosphere of stimulating conversation and good humour. Our mutual love for ‘our game’ leads to many great friendships.\n\nWe are full independent, owning our property which extends from Arnold Street to Locksley Street, a short walk from Killara Station.\n\n-Extensive heritage gardens and landscaping\n-Three first class bowling greens\n-Off-street parking for 24 vehicles', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Killara-Bowling-Club-156821881014224/', '', '', '', '', '', ''),
  (109113, 'pacific-palms-recreation-club-109113', 'Pacific Palms Recreation Club', '', 'Pacific Palms Recreation Club located in Elizabeth Beach provide its guests and members a variety of services and facilities including raffles, weekly activities, bars, function areas and many more.', 275919, '2016-04-26 02:31:09', '2016-04-26 02:40:21', '', 191, 764, 'social club', 275919, 0, '', 'enquiries@pprc.com.au', '0265540207', '', '', '', 'http://www.pprc.com.au/', 'The Pacific Palms Recreation Club (locally known as The Recky) is situated on the shores of beautful Wallis Lake at Pacific Palms. There''s no better place to enjoy a meal and refreshment and watch the sun go down across the lake and Wallingat National Park.\n\nOur Bistro is open for lunch and dinner daily, and you can get great meals that won''t break the family budget! We cater for all functions large and small, and specialise in weddings.\n\nFrom our outdoor dining to our welcoming staff we are sure The Recky has something for everyone.\n\nAnd if you don''t want to drive, we can pick you up and drop you off with our Club Courtesy Bus. We cover the local Beaches, Smiths Lakes, Tarbuck Bay, Green Point* and Coomba Park*, and all places in between.\n\nPS: if you are coming by boat, don''t forget we have a jetty right out the front of the Club where you can tie up whilst you enjoy lunch. There''s also a boat ramp for easy access to the lake.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/PacificPalmsRecClub', '', '', '', '', '', ''),
  (109114, 'club-belmore-109114', 'Club Belmore', '', '', 0, '2016-04-26 02:32:34', '2016-04-26 02:32:38', '', 191, 766, 'rsl club', 0, 0, '', '', '0297844300', '', '', '', '', '', 'A', '{"1":[[0.5,0.9166666667]],"2":[[0.5,0.9166666667]],"3":[[0.5,0.9166666667]],"4":[[0.5,0.9166666667]],"5":[[0.5,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109115, 'windsor-country-golf-club-109115', 'Windsor Country Golf Club', '', 'Windsor Country Golf Club is located at South Windsor and offer wedding, parties, christenings and wakes services.', 275935, '2016-04-26 02:39:48', '2016-04-26 02:52:05', '', 191, 740, 'golf club', 275935, 0, '', 'admin@windsorgolfclub.com.au', '0245774390', '', '', '0245772300', 'http://www.windsorgolfclub.com.au/', 'In 1955 a small group developed which, from time to time, played on a social basis on Sunday at Braeside Golf Course, Rouse Hill, subsequently known as Rouse Hill Public Golf Course. This course has since been sold for residential sub-division. Within about a year what began as a party of twelve or so players developed into a conflux of forty or more golfers from both the Hawkesbury district and the Sydney suburbs, and which now had adopted an official name “The Sunday Golf Club”.\n\nWindsor Country Golf Club is a championship 18 hole course, perfectly located on the outskirts of historic Windsor, an hour north-west of Sydney.\n\nThe modern clubhouse enjoys panoramic views to the Blue Mountains.\n\nWindsor Country Golf Club also have our function room available for hire, the function room is bright and spacious over looking the golf course and Blue Mountains.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/windsorcountrygolfclub/', '', '', '', '', '', ''),
  (109116, 'lane-cove-club-109116', 'Lane Cove Club', '', 'Lane Cove Club is located in 1 Birdwood avenue offering range of entertainment including exciting menus at our club restaurant, Live music and trivias.', 275927, '2016-04-26 02:41:02', '2016-04-26 02:42:56', '', 191, 762, 'social club', 275927, 0, '', 'lcclub@lanecoveclub.com.au', '0294285155', '', '', '', 'http://lanecoveclub.com.au/', 'Lane Cove Club is located in 1 Birdwood avenue offering range of entertainment including exciting new menu and some familiar faces behind the counter.  Come on in and have a look for yourself.  Children are more than welcome so bring the whole family. \n\nLive music is alive and well at the Lane Cove Club. Playing a wide variety of music from old classics to the current era.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.4583333333,0.9791666667]],"5":[[0.375,0.9791666667]],"6":[[0.5,0.9166666667]]}', 'https://www.facebook.com/lcclublimited/', '', '', '', '', '', 'https://plus.google.com/103064198679106920964/posts'),
  (109117, 'club-burwood-109117', 'Club Burwood', '', 'Club Burwood offers modern facilities such as Brasserie & Cafe, Outdoor Entertainment Terrace, Sports Lounge, Function Centre, Smoker’s Terrace, Keno, full TAB facilities with EasyBet and ''Trackside''.', 275933, '2016-04-26 02:46:06', '2016-04-26 02:49:28', '', 191, 749, 'rsl club\nsocial club', 275933, 0, '', 'info@burwoodrsl.com.au', '0297454100', '', '', '0297454944', 'http://www.clubburwood.com.au/', 'All Club venues provide something for everyone with lunch and dinner served daily and breakfast Sunday’s at Club Burwood RSL. We have something on every day including Raffles, Bingo, Promotions, free live entertainment Friday and Saturday Nights (RSL only). Both Clubs have loads of facilities and are open until late.\n\nClub Burwood RSL - 96 Shaftesbury Rd: 2 dining venues - Brasserie & Cafe, Free Live Entertainment from 8:30pm plus concerts, Outdoor Entertainment Terrace with year round cooling & heating, Japanese inspired Clifton Gardens with cascading waterfall and Koi fish pond, Great Concerts, Live Atmosphere Sports Viewing Lounges, Functions for up to 600, undercover parking, Keno, full TAB facilities with EasyBet and ''Trackside'' - fixed odds betting, Courtesy bus Wednesday - Sunday nights, Membership just $2 (Membership also accepted at Club Burwood), Daily promotions with CASH prizes.\n\n', 'A', '{"1":[[0.375,0.9791666667]],"2":[[0.375,1]],"3":[[0.375,0.125]],"4":[[0.375,0.125]],"5":[[0.375,0.125]],"6":[[0.375,0.125]],"0":[[0.375,0.125]]}', 'https://www.facebook.com/Club-Burwood-Group-Club-Burwood-RSL-Club-Burwood-Croydon-Park-Club-116475925061441/', '', '', '', '', '', 'https://plus.google.com/102241295620149266600/about'),
  (109118, 'lindfield-bowling-club-109118', 'Lindfield Bowling Club', '', 'Lindfield Bowling Club was established in the early 1950’s in the leafy surrounds of Carlyle Road with bar facilities as well as an attractive refurbished function venue.', 275943, '2016-04-26 02:56:56', '2016-04-26 02:59:46', '', 191, 736, 'bowling club\nsocial club', 275943, 0, '', 'lindfieldbowls@bigpond.com', '0294163907', '', '', '', 'http://www.lindfieldbowlingclub.com.au/', 'Lindfield Bowling Club is located in the leafy surrounds of Carlyle Road with ample off street parking. The Club was established in the early 1950’s and now sports three of the best greens in NSW.\n\nOne of the features distinguishing our Club is that on the three regular days Monday, Wednesday and Saturday both men and women are welcome to play on the same days and mixed games are available.\n\nLindfield Bowling Club has bar facilities as well as well as an attractive recently refurbished function venue.\n\nThese facilities currently provide for a bridge club as well as being available for a variety of social functions.\n\nNew members are especially welcome and free coaching is provided prior to joining the Club. Membership and green fees are at this point of time one of the lowest on the northern suburbs of Sydney. There are no age restrictions to membership.\n\nBowls is available to those seeking competitive as well as a social bowls. A range of men’s, women’s and mixed club competitions cater for a wide range of skills with handicap events being very popular\n\n ', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://www.google.com/maps/place/Lindfield+Bowling+Club/@-33.7631703,151.1928793,17z/data=!3m1!4b1!4m2!3m1!1s0x6b12a906b906c047:0x5adabd32503824eb?hl=en'),
  (109119, 'port-macquarie-golf-club-109119', 'Port Macquarie Golf Club', '', 'Port Macquarie Golf Club located in Port Macquarie provide its guests and members a wide range of services and facilities including bingo, trivia and raffles, poker, dining, function areas and more.', 275945, '2016-04-26 02:56:59', '2016-04-26 03:07:10', '', 191, 734, 'golf club', 275945, 0, '', 'reception@portmacquariegolf.com.au', '0265820409', '', '', '0265822116', 'http://portmacquariegolf.com.au/', 'Port Macquarie Golf Club was first formed in the early years of the century, although information is not available as to the exact date of formation. Old citizens have recollections of the game being played in 1906, but first printed references to be found are in 1911.\n\nThe course first played followed the foreshores from the Munster Street end of the camping reserve to the site of the cottages now situated east of Pacific Drive above the cliffs, thence westward to near Owen Street and then northward to Burrawan Street in the south-western corner of the portion of Oxley Park now occupied by the High School.\n\nGradually over the years it became almost entirely contained in Oxley Park. This area, with more people playing, and with crossed fairways, became dangerous to players and public, and in 1948 a search was begun to find a more suitable area. Finally, Mr. J. Scott, course architect, responsible for the design of Elanora, was commissioned to choose from the sites offering and to submit a plan. He chose the present site and work began in 1951.\n\nIn July 1953, Port Macquarie Golf Club moved to the new course but because of the necessity to maintain the old course for play, very little progress had been made on the new area. Members, however, elected to play under rugged conditions for a time in order that reasonable progress could be made.\n\nPlay was first over six holes, progressing fairly quickly to eleven holes. At this point course extensions were delayed for a few years because of the need for a more suitable clubhouse. That having been achieved, the southern extension was next brought into play. Work was finally completed to a sufficient degree to bring the full 18 holes into play in April 1967, and the official opening was pronounced in February 1968, by president of the New South Wales Gold Association, Mr Les Graham.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/PortMacquarieGolfClub/', 'https://twitter.com/PortGolf_Club', '', '', '', '', 'https://plus.google.com/102924040557961556445/about'),
  (109120, 'parramatta-workers-club-109120', 'Parramatta Workers Club', '', '', 0, '2016-04-26 02:57:06', '2016-04-26 02:58:32', '', 191, 738, 'social club', 0, 0, '', '', '0296335819', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109121, 'cabramatta-golf-club-109121', 'Cabramatta Golf Club', '', 'Cabramatta Golf Club features Function Rooms for anyone wanting to hold a birthday, engagement, wedding or just a get together, or holding formal seminars or training session.', 275965, '2016-04-26 03:07:57', '2016-04-26 03:09:49', '', 191, 730, 'golf club\nsports club', 275965, 0, 'Cabramatta Rd & Cumberland Hway', 'info@cabragolf.com.au', '0296028283', '', '', '0296013216', 'http://www.cabragolf.com.au/', 'Cabramatta Golf Club\nThe original Land Grant of 200 acres was given to Robert Cummings in 1805.\n\nFrom this area in 1927 Arthur Bull purchased 157 acres and then in 1939 W. Hansford bought 98 acres and constructed a golf course and clubhouse which was leased to the Cabramatta County Golf Club. The club was affiliated with the Metropolitan Golf Association and Sydney Sub District Golf Association. The original course was a par 66 on approximately 78 acres with 20 acres of undeveloped land south at the old 3rd green. A boundary fence ran behind the 3rd green across to the Cabramatta Creek.\n\nDuring 1946/47 discussions took place with the owners regarding purchasing the property and at the meeting held at the Granville Town Hall it was decided to buy the land at a cost of 16,000 pounds, financed by a loan from the bank of N.S.W and an equal investment by Member Debenture Holders. On 4th March 1947, Cabramatta Golf Club Ltd was formed and incorporated under the companies Act. The property was transferred on the 24th March 1947.\n\nFunction Rooms\nFor anyone wanting to hold a birthday, engagement, wedding or just a get together,\nor holding formal seminars or training session please ring the office on 9602 8283.\n\n•  Function Room 1\nUse of large screen and projector\nUse of music panel (bring own music)\nWill hold up to 50 people comfortably.\n$100.00\n\n•  Function Room 2\nUse of music panel (bring own music)\nUse of two (2) T.V.''s for running photos etc\nWill hold up to 60 people\n$150.00\n\n•  Function Room 3\nMain body of the club\nUse of large screen and projector\nUse of music panel (bring own music)\nWill hold up to 200 people comfortably\n$250.00\n\nRoom 1, 2 and 3 can be utilised as one if required.\n \nIf the services here are used such as bar and restaurant the hiring fee may be wavered on application.', 'A', '{"1":[[0.3333333333,1]],"2":[[0.3333333333,1]],"3":[[0.3333333333,1]],"4":[[0.3333333333,1]],"5":[[0.3333333333,1]],"6":[[0.3333333333,1]],"0":[[0.3333333333,1]]}', 'https://www.facebook.com/www.cabragolf.com.au', '', '', '', '', '', ''),
  (109123, 'rydalmere-central-bowling-club-109123', 'Rydalmere Central Bowling Club', '', 'Rydalmere Central Bowling Club is located at Rydalmere and offer Greens Bistro and have great function packages for all occasions with three size room available.', 275981, '2016-04-26 03:24:13', '2016-04-26 03:26:28', '', 191, 723, 'bowling club', 275981, 0, '', 'info@rydalmerebowlingclub.com.au', '0296381281', '', '', '', 'http://www.rydalmerebowlingclub.com.au/', 'Come on in and take a look around at Rydalmere Bowling Club.  Rydalmere Central Bowling Club have terrific outdoor areas overlooking our greens with heating for those colder months, shelter for those rainy days yet open enough to enjoy those summer southerly breezes. \n\nRydalmere Central Bowling Club''s indoor and outdoor gaming areas are popular along with our lounge area with big screen TV (FOX sports viewing) for all those important sporting events.\n\nThe auditorium area is great for our Friday night dancers and often booked for a variety of corporate & private events. With a large dance floor and stage, it makes a great venue for many occassions.\n\nIf your looking for a great meal at a terrific price, our Greens Bistro is the place to eat. You will find our full menu under the "Bistro and Function" tab.  Friday''s lunch offers the "LUNCHTIME EXPRESS".  For $10 you recieve a choice of two hot dishes, fried/boiled rice and a dim sim and spring roll.  Good luck getting through the portion size. It''s quality food at a great price.\n\nRydalmere Bowling Club is located at 6 Park Road, Rydalmere (crn Victoria Rd), and just 1 min from the bus station.  There is also plenty of parking for those who prefer to be the designated driver.', 'A', '{"1":[[0.4583333333,0.875]],"2":[[0.4583333333,0.875]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]],"6":[[0.4166666667,0.9583333333]],"0":[[0.3541666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/107349147591223147414/about'),
  (109125, 'ryde-parramatta-golf-club-109125', 'Ryde-Parramatta Golf Club', '', 'Ryde-Parramatta Golf Club is located at West Ryde and cater for every type of function including weddings, birthdays, reunions, corporate days, seminars and conferences.', 275989, '2016-04-26 03:32:23', '2016-04-26 03:32:48', '', 191, 719, 'golf club', 275989, 0, '', 'golf@rydeparramatta.com.au', '0298741204', '', '', '', 'http://www.rydeparramatta.com.au/', 'A nine hole course was constructed on the present site in 1926 by the then owners City Mutual Life Assurance Society Limited. A tournament for professionals was staged on 27th July 1927 to commemorate the opening.\n\nOn 19th August 1930, the Ryde Golf Club was incorporated and in 1932 the course was extended to 18 holes.\n\nAt Ryde-Parramatta Golf Club you will find an atmosphere of casual sophistication amongst beautiful surrounds.\n\nRyde-Parramatta Golf Club''s talented chef can prepare anything from morning tea to a delectable banquet or a stylish three course set menu. Choose from our extensive food and beverage packages or have our Executive Chef create a personalised menu to suit your next function.\n\nRyde-Parramatta Golf Club''s function staff are trained to ensure that you and your guests are treated attentively and professionally. The Events Manager will personally meet with you, identify your needs and complete the planning based on your requirements. The Events Manager thrives on the challenge to present on the day requests that may be individualistic. Our House Manager will also be on hand during your event to ensure your function runs smoothly and the staff professionalism is at its highest.', 'A', '{"1":[[0.25,0.8333333333]],"2":[[0.25,0.8333333333]],"3":[[0.25,0.8333333333]],"4":[[0.25,0.8333333333]],"5":[[0.25,0.8333333333]],"6":[[0.25,0.8333333333]],"0":[[0.25,0.8333333333]]}', 'https://www.facebook.com/RydeParraGC', 'https://twitter.com/RydeParraGC', '', '', '', '', ''),
  (109126, 'wyong-golf-club-109126', 'Wyong Golf Club', '', 'Wyong Golf Club is one of the Central Coast’s finest golf courses in Wyong, providing a challenging test for the experienced golfer yet can be enjoyed by beginners, juniors & social players.', 276008, '2016-04-26 03:43:06', '2016-04-26 03:44:17', '', 191, 711, 'golf club', 276008, 0, '', 'office@wyonggolfclub.com.au', '0243521361', '', '', '', 'http://www.wyonggolfclub.com/', 'Welcome to Wyong Golf Club one of the Central Coast’s finest golf courses. Located on the Pacific Highway north of Wyong, an easy hour’s drive from Sydney or 45 minutes from Newcastle just off the F3.\n\nOur clubhouse boasts modern amenities with full TAB, Keno, Fox Sports and free internet access and more. \n\nOur Bistro Restaurant is open 7 days, Lunch & Dinner. Lunch specials are only $10 and or choose any of the yummy dishes off the full Bistro menu.\n\nWedding packages are available for 70 to 150 guests. Ceremonies are held on course whilst the reception is conveniently located in our auditorium. With 180 degree views overlooking the golf course and south to the Ridgeway Mountains it makes a gorgeous back drop on dusk.\n\nWyong Golf Club provides a challenging test for the experienced golfer yet can be enjoyed by beginners, juniors and social players of all skill levels.\n', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.9583333333]],"6":[[0.375,0.9791666667]],"0":[[0.375,0.9791666667]]}', 'https://www.facebook.com/Wyong-Golf-Club-137076836343818/', '', '', '', '', '', 'https://plus.google.com/114111012226793724733/about'),
  (109127, 'st-marys-band-club-109127', 'St Marys Band Club', '', 'St Marys Band Club is located at St Marys and provide a wide range of function services. St Marys Band Club offer wedding & special events, private parties and more.', 276014, '2016-04-26 03:45:48', '2016-04-26 03:48:25', '', 191, 709, 'social club', 276014, 0, '', 'info@stmarysbandclub.com.au', '0296231211', '', '', '', 'http://www.stmarysbandclub.com.au/', 'The St Marys District Band Club has a very colourful history. In fact, it can trace back its roots right back to when the St Marys District Band was organised in 1882.\n \nOver the following 70 years several bands were formed in the district at various times and in 1923 a local businessman, Joe Armstein, gave the band a property containing a hall at St Marys.\n\nLocated in the heart of St Marys, St Marys Band Club a long standing premier venue in western Sydney offering a warm friendly atmosphere, first class service and excellent facilities.\n\nSt Marys Band Club host a range of activities, provide a variety of quality entertainment and can create a truly memorable experience catering for any special occasion.\n\nWhether it be a casual drink, a bite to eat or a big night out, we invite you and your friends to join us, relax and enjoy.', 'A', '{"1":[[0.375,0.9583333333]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,1]],"5":[[0.375,0.1666666667]],"6":[[0.375,0.1666666667]],"0":[[0.375,0.9583333333]]}', 'https://www.facebook.com/thebandclub', 'https://twitter.com/TheBandyStMarys', '', '', '', '', ''),
  (109128, 'the-pitt-town-district-sports-club-109128', 'The Pitt Town & District Sports Club', '', 'The Pitt Town & District Sports Club is located at Pitt Town and offer wedding & function packages. The Pitt Town & District Sports Club also have great facilities like KENO, courtesy bus and more.', 276020, '2016-04-26 03:56:49', '2016-04-26 03:59:44', '', 191, 707, 'sports club', 276020, 0, '', 'info@pitttownsports.com.au', '0245723658', '', '', '', 'http://www.pitttownsports.com.au/', 'Sports have always been prominent in Pitt Town and the surrounding district since its early days. Horse racing and cricket were some of the earliest sports, but there were also other unusual forms of competition concocted including sledge hammer carrying. \n\nThis involved competitors running while holding a sledge hammer by a nail in the handle with only their forefinger and thumb. The winner being the one to cover the course in the shortest time without dropping the hammer. And then there was Gentleman George Dawson who was educated at Pitt Town in the 1870’s and went on to become Australian Lightweight Boxing Champion in 1891.\n\nThe Windsor & Richmond Gazette reported in June 1907 “we understand there is a probability of a good sports club being started in Pitt Town, where there are a number of fleet footed pedestrians. When events are held they are keenly contested and the public evince great interest in the proceedings.\n\nFacilities:\n• Fox Sports on the Big Screen\n• KENO\n• Dining on the Verandah\n• Undercover Kids on Playground\n• TAB Facilities\n• Courtesy Bus\n\n', 'A', '{"1":[[0.5,0.875]],"2":[[0.5,0.9166666667]],"3":[[0.5,0.9166666667]],"4":[[0.5,0.9583333333]],"5":[[0.5,0.9791666667]],"6":[[0.4583333333,0.9791666667]],"0":[[0.5,0.875]]}', 'https://www.facebook.com/Pitt-Town-District-Sports-Club-418982028143769', '', '', '', '', '', 'https://plus.google.com/113750655091256121716/about'),
  (109129, 'wentworthville-memorial-bowling-club-109129', 'Wentworthville Memorial Bowling Club', '', '', 0, '2016-04-26 05:08:31', '2016-04-26 05:08:44', '', 191, 705, 'bowling club', 0, 0, '', '', '0296319518', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109130, 'canley-heights-rsl-sporting-club-109130', 'Canley Heights RSL & Sporting Club', '', 'Canley Heights RSL & Sporting Club located at Wakeley boast two great dining options, Delights Brasserie and Escape Pizzeria as well as numerous bars, outdoor areas, TAB and Keno.', 276026, '2016-04-26 05:16:54', '2016-04-26 05:19:11', '', 191, 703, 'rsl club\nsports club', 276026, 0, '', 'info@canleyheightsrsl.com.au', '0296049975', '', '', '', 'http://canleyheightsrsl.com.au/', 'Canley Heights RSL & Sporting Club is a medium sized multi-cultural, family orientated and community based club situated in Sydney’s South West.\n\nThe Club has undergone a number of renovations and refurbishments over the years to keep up with the ever-changing needs of the community and to keep the venue looking fresh and comfortable for our members and guests.\n\nWe pride ourselves on our customer service and friendly atmosphere. We appreciate our loyal members and welcome any new guests to our venue.\n\nWe have 2 outstanding Dining Areas – including an ala carte restaurant “Delight’s Brasserie” and the “Escape Pizzeria & Bar” of which also has an alfresco dining area to sit and relax with friends and family.\n\nWe can also cater for all your function needs including but not limited to weddings, engagements, parties, seminars and much more.\n\nWe have a modern TAB area and Keno facilities available.\n\nWe support a number of sub-clubs which in the community – including:  Soccer, Jnr Rugby League, Netball, Youth Club, Softball, Vigoro as well as local non-for-profit organisations.  We also recently took up sponsorship of the Fairfield / Liverpool Cricket Club.', 'A', '{"1":[[0.7083333333,0.9583333333]],"2":[[0.7083333333,0.875]],"3":[[0.7083333333,0.9583333333]],"4":[[0.7083333333,0.9583333333]],"5":[[0.7083333333,0.0416666667]],"6":[[0.7083333333,1]],"0":[[0.7083333333,0.8333333333]]}', '', 'https://twitter.com/CanleyhtsRSL', 'https://www.linkedin.com/company/canley-heights-rsl?trk=ppro_cprof', '', '', '', 'https://plus.google.com/103826264774445178545/posts'),
  (109134, 'chester-hill-rsl-and-bowling-club-109134', 'Chester Hill RSL and Bowling Club', '', 'Chester Hill RSL and Bowling Club features Function Rooms which is suitable for up to 300 people for every ocassions, Bowling club function rooms, entertainment area, RSL meeting Room and New lounge.', 276046, '2016-04-26 05:30:17', '2016-04-26 05:32:04', '', 191, 697, 'rsl club\nbowling club', 276046, 0, '', 'ee@iinet.net.au', '0296447922', '', '', '0296451082', 'http://chrsl.com.au/', 'Chester Hill RSL and Bowling Club\n\nOUR MISSIONS\n•  Chester Hill R.S.L Club mission is to be the best & friendliest destination\n•  Best for our Members & Guests\n•  Best for our Service\n•  Best for our Team\n•  Best for our Community\nNOT THE BIGGEST BUT THE BEST & FRIENDLIEST\n\nOUR VISION STATEMENT\nOur vision is to create a place of “WOW” for our Members, Guests & for our Team\nA place that is fun & memorable\n\nOUR TOP TEN VALUES\n1. Dreaming big dreams & having fun getting the job done.\n2. Wowing our Members & Guests through outstanding customer service.\n3. Empowering people to execute remarkable recoveries that ensure total guest satisfaction.\n4. Communicate openly with our customers and each other.\n5. Value honesty & integrity.\n6. Provide an enjoyable place to work that provides creativity, innovation & friendliness.\n7. Inspire a strong work ethic-work hard, work safe, work smart.\n8. Advocate a positive CAN-DO attitude.\n9. Creating & inspiring passionate people.\n10. Importantly, support those in need and our community.\n\nOUR BIG 3 OBJECTIVES\n1. Create an organization of success founded through an ethics of innovation & the pursuit of positive changes.\n2. Recognize and reward outstanding individual & team achievements, whilst creating an environment that encourages our Club’s success.\n3. Show our Members & Guests that we will deliver more value than our competitors by providing better and friendlier service, contemporary entertainment and out standing facilities.', 'A', '{"1":[[0.3958333333,0.9375]],"2":[[0.3958333333,0.9375]],"3":[[0.3958333333,0.9583333333]],"4":[[0.3958333333,1]],"5":[[0.3958333333,0.0416666667]],"6":[[0.3958333333,0.0416666667]],"0":[[0.3958333333,0.9166666667]]}', 'https://www.facebook.com/Chester-Hill-RSL-and-Bowling-Club-203037396434511/', '', 'https://www.linkedin.com/company/chester-hill-rsl-and-bowling-club-cooperative', '', '', '', 'https://plus.google.com/104181608997381396986/about'),
  (109135, 'south-grafton-ex-servicemen-s-club-109135', 'South Grafton Ex-Servicemen''s Club', '', 'South Grafton Ex-Servicemen''s Club located in South Grafton provide its guests and members a variety of services & facilities including auditorium, courtesy bus, daily events, entertainment and more.', 276048, '2016-04-26 05:30:32', '2016-04-26 05:36:36', '', 191, 693, 'social club', 276048, 0, '', 'admin@ssclub.com.au', '0266421422', '', '', '0266421502', 'http://www.sgex.com.au/', 'The South Grafton Ex-Servicemens Club is one of the Clarence Valleys biggest clubs, providing members and guests with a full range of entertainment activities.\n\nWe are active within the community providing support to a range of sporting and community groups with donations and other assistance. We also run a number of sporting sub-clubs within our operations.\n\nWe are located in beautiful surroundings, overlooking the mighty Clarence river, with a comprehensive range of facilities and services available for our members and guests including :\n\n• Conference rooms, suitable for a wide range of events\n• Restaurant\n• Bars\n• full TAB Facilities\n• full Keno Facilities\n• Beautiful Bowling Greens\n• Free Car Parking\n• 10 minutes from the local Railway Station\n• 20 minutes from the Airport\n• Several Motels within walking distance to the club\n• Bus for pickup and drop off within the town limits', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/sgexclub/?fref=ts', 'https://twitter.com/southservices', '', '', '', '', ''),
  (109136, 'penrith-golf-recreation-club-109136', 'Penrith Golf & Recreation Club', '', 'Penrith Golf & Recreation Club is located an Penrith and offer great facilities like catering, social activities, family attractions and functions that cater for 130 guests.', 276058, '2016-04-26 05:39:27', '2016-04-26 05:42:50', '', 191, 690, 'golf club\nsocial club', 276058, 0, '', 'admin@penrithgolfclub.com.au', '0247361633', '', '', '0247365580', 'http://www.penrithgolfclub.com.au/', 'Located in Penrith on The Northern Road 500m from the M4 Motorway, Penrith Golf Club is easily accessible.\n\nPenrith Golf & Recreation Club has been in operation since 1964 and is considered the best and most affordable golf club in the Greater Western Sydney Region.\n\nPenrith Golf & Recreation Club features many facilities to ensure you enjoy your time with us.\n\nPenrith Golf & Recreation Club features full bar with 14 different draught beers, Keno, TAB, Bistro, Foxsports, alfresco dining area overlooking the golf course and Blue Mountains and fully serviced private function room.\n\nPenrith Golf & Recreation Club Ltd will provide a quality golf course and a safe and enjoyable environment for its members, their guests and their families.\n\nPenrith Golf & Recreation Club Ltd offers two independent products that together will be recognized by the golfing industry and local community as the district leader:\n• A quality environment for the game of golf, and\n• A registered club operation that will be a leader in service standards and provider of a safe and friendly environment', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Penrith-Golf-Recreation-Club-Ltd-129491287881', 'https://twitter.com/GolfPenrith', '', '', '', '', ''),
  (109137, 'south-west-rocks-country-club-109137', 'South West Rocks Country Club', '', 'South West Rocks Country Club located in South West Rocks provide its guests and members a variety of services & facilities including entertainment, weekly activities, dining, function area and more', 276064, '2016-04-26 05:45:15', '2016-04-26 05:51:53', '', 191, 688, 'social club', 276064, 0, '', 'enquiries@rockscountryclub.com.au', '0265666252', '', '', '', 'http://www.rockscountryclub.com.au/', 'South West Rocks Country Club offers a fantastic range of dining, sporting and leisure facilities to enjoy. For the sports enthusiasts, the club boasts a challenging 18-hole golf course, three bowling greens and four synthetic tennis courts.\n\nFor the lovers of good food, there''s no better value in town than the Rocks Asian & Australian Buffet featuring a great selection of freshly prepared dishes for lunch and dinner. Seasons restaurant also offers delicious modern Australian cuisine in the comfort of an intimate restaurant setting and for those quick snacks the coffee shop offers a great range of tasty light meals, sweets and beverages to take your fancy. Experience live entertainment and many leisure activities including: - TAB, Keno, Bingo, Poker, Zumba and Raffles on throughout the week. Rocks Country Club - come and play with us!', 'A', '{"1":[[0.3958333333,1]],"2":[[0.3958333333,1]],"3":[[0.3958333333,1]],"4":[[0.3958333333,1]],"5":[[0.3958333333,1]],"6":[[0.3958333333,1]],"0":[[0.3958333333,1]]}', 'https://www.facebook.com/RocksCountryClub', 'https://twitter.com/swrcountryclub', '', '', '', '', 'https://plus.google.com/115621931298455248908/about'),
  (109139, 'polonia-sports-club-109139', 'Polonia Sports Club', '', 'Polonia Sports Club is located at Plumpton and cater for all functions, wedding receptions, wakes, christenings, annual presentation days and more.', 276078, '2016-04-26 05:52:22', '2016-04-26 05:54:20', '', 191, 684, 'sports club', 276078, 0, '', '', '0296256147', '', '', '', 'http://poloniasportsclub.com.au/', 'Polonia Sports Club are a small community club with membership of 150 Full Members. We are also looking at Associate Membership.\n\nPolonia Sports Club are situated on a 5 acre parcel of land at 23 Bungalow Road, Plumpton.\n\nAlthough, as the name suggests, we are a Polish-based club, we also welcome other nationalities.\n\nPolonia Sports Club can cater for all Functions, Wedding Receptions, Christenings, Wakes, Annual Presentation Days (conditions apply) Business Forums etc. Our club can cater for 150 seated.\n\nYou will not see any Poker Machines on our premises, as the Club decided after a trial that is was a waste of money, both for Patrons and the Club.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109140, 'taree-aquatic-club-109140', 'Taree Aquatic Club', '', 'Taree Aquatic Club located in Taree provide its guests and members a wide range of services & facilities including bingo, dining, sailing, courtesy bus, Keno facilities, mooring facilities and more.', 276082, '2016-04-26 05:59:42', '2016-04-26 06:01:25', '', 191, 682, 'sailing club', 276082, 0, '', 'enquiries@sailos.net.au', '0265521435', '', '', '0265515435', 'http://www.sailos.com.au/', 'Taree Aquatic Club, or "The Sailo''s" as it is known by locals, is the Manning Valley''s premier hospitality venue situated on the banks of the glorious Manning River in Taree. The Club''s bar and dining facilities feature a wonderful 180 degree vista of the river downstream towards Dumaresq Island and upstream towards the historic Martin Bridge. \n\nAs our name suggests our major activities centre on the river and we play host to sailing, powerboat racing, fishing and of course the sensational fireworks on New Years Eve as part of the Manning River Festival. All of these can be enjoyed from the comfort of the Club in a relaxed and friendly atmosphere with an emphasis on excellent dining, service with a smile and value for money. \n\nTaree Aquatic Club was officially formed and affiliated with the Vaucluse Amateur Sailing Association in 1946, as the parent body was then called. \n\nThe first official home of the Manning River Vee-Ess Sailing Club was at the North Coast Steam Navigation Co''s wharf shed, adjacent to the Martin Bridge. \n\nIn January 1947 the Vee-Jay Club was formed and was also housed in the wharf shed. Boat storage was then becoming a problem. In 1950 we decided to build a club shed at the foot of Macquarie Street. With the help of our bank which advanced us $600.00, we built the shed with voluntary labour. This clubhouse, when completed, served as our home for eight years. \n\nIn 1957 our increasing fleet numbers and membership indicated that again we would have to do something regarding a larger clubhouse. In 1958, after receiving a Conditional Club Licence and a loan from our bank, plus the sale of debentures, we commissioned our builder to go ahead and build the first section of the brick building that we occupy today. The building was completed in December 1958. \n\nBy 1962 it was obvious that further additions would be necessary in the near future. Planning and building commenced and they were officially opened on 8 November 1968 by Mr Bill Northam. \n\nAt this time it would be fitting, not to forget the great debt of gratitude the members of this Club owe to those early founders in 1945-46, who worked hard and willingly to make this Club what it is today, and especially we owe a great deal to the Ladies Auxiliary formed in those early days, who have been a tower of strength to the Club over the years. ', 'A', '{"1":[[0.4375,1]],"2":[[0.3958333333,1]],"3":[[0.4375,1]],"4":[[0.3958333333,1]],"5":[[0.4375,1]],"6":[[0.4375,1]],"0":[[0.4791666667,1]]}', '', '', '', '', '', '', ''),
  (109142, 'czechoslovakian-country-club-109142', 'CzechoSlovakian Country Club', '', 'CzechoSlovakian Country Club boasts many fine facilities including a licensed bar and restaurant, all set in peaceful tranquility of Kemps Creek.', 276094, '2016-04-26 06:11:33', '2016-04-26 06:14:12', '', 191, 678, 'social club', 276094, 0, 'PO Box 330', 'cscclubsydney@gmail.com', '0296068703', '', '0434143148', '', 'http://cscountryclub-sydney.com.au/', 'The CzechoSlovakian Country Club boasts many fine facilities including a licenced bar and restaurant, all set in peaceful tranquility of Kemps Creek. Our hall provides a great space for special events and is available for hire at inexpensive rates. \n\nOur Facilites\n\nWe provide a family friendly atmosphere, where children can play while parents relax. It''s a place where you can enjoy traditional Czech and Slovak food and sample Czech beer, all at affordable prices.\nThroughout the year, we put on many exciting activities for the whole familly where everyone is always welcome.\n\nOur facilities include\n\n- Licenced bar and restaurant\n- Kids corner and outside area\n- Table tennis facilities\n- Venue for hire', 'A', '{"2":[[0.75,0.875]],"5":[[0.75,0.875]],"6":[[0.7083333333,0.875]],"0":[[0.5,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/105850241075918416906/about'),
  (109143, 'taree-west-bowling-club-109143', 'Taree West Bowling Club', '', 'Taree West Bowling Club located in Taree provide its guests and members a variety of services and facilities including function area, dining, full TAB and keno facilities, entertainment and many more.', 276100, '2016-04-26 06:13:07', '2016-04-26 06:17:39', '', 191, 676, 'bowling club', 276100, 0, '', 'tony@cluboldbar.com.au', '0265522094', '', '', '0265515015', 'http://cluboldbar.com.au/taree-west/', 'Taree West Bowling Club member’s and staff will make you welcome when your visit. The members take enormous pride in their club and the role it has played in their lives over many years. Generations of members can reflect the importance Taree West Bowling Club has played in the community of Taree.\n\nTaree West Bowling Club is proud of its tradition of supporting local groups. We strive to provide an exceptionally satisfying, comfortable and safe place to meet and play.\n\nTaree West Bowling Club is a “Family Friendly” club.\n\nTaree West Bowling Club recently amalgamated with Club Old Bar. This Club has created history in being the first club outside of the Sydney metropolitan area to win the highly prestigious title of ClubsNSW Club of the Year. In fact the club has walked away with this highly coveted title in 2002, 2004, 2005 and 2006. Club Old Bar is the most awarded club in NSW. Club Old Bar has repeatedly proved themselves one of the best clubs in the state. Now Taree West has joined this club and aims to be the best.\n\nThe staff and management will work incredibly hard to make your stay at the club enjoyable.\n\nTaree West Bowling Club invites you enjoy our friendly and social atmosphere.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/tareewestbowlingclub/', 'https://twitter.com/clubtareewest', '', '', '', '', ''),
  (109145, 'urbenville-district-bowling-club-109145', 'Urbenville & District Bowling Club', '', 'Urbenville & District Bowling Club located in Urbenville provide its guests and members a wide range of services & facilities including social bowls, charity bowls days, fundraising bowl days & more.', 276114, '2016-04-26 06:24:55', '2016-04-26 06:28:10', '', 191, 670, 'bowling club', 276114, 0, '', 'ubc2@bigpond.com', '0266341269', '', '', '0266341480', 'http://www.urbenville.bowls.com.au/', '', 'A', '{"3":[[0.6666666667,1]],"5":[[0.7083333333,1]],"6":[[0.6666666667,1]],"0":[[0.6666666667,1]]}', 'https://www.facebook.com/urbenvillebowlingclub/', '', '', '', '', '', ''),
  (109146, 'glenorie-rsl-club-109146', 'Glenorie RSL Club', '', 'Glenorie RSL Club is located at Glenorie and also have bistro and beer garden. Glenorie RSL Club also offer functions for birthday parties, weddings, engagement parties, christmas parties and more.', 276118, '2016-04-26 06:31:30', '2016-04-26 06:35:17', '', 191, 664, 'rsl club', 276118, 0, '', 'info@glenoriersl.com.au', '0296521183', '', '', '', 'http://www.glenoriersl.com.au/', 'Glenorie RSL Club is located in the beautiful rural outskirts North West of Sydney, just off the Old Northern Road (On the Tourist Drive to Wiseman''s Ferry). Glenorie has a unique country village atmosphere, just minutes from the city. \n\nA Great place for all your special occasions:\n\n• Birthday parties\n• Engagement parties\n• Weddings\n• Christmas Parties\n• Sports Presentation\n• Fund Raising Events\n• Meetings and conferences\n• School or Family Reunions\n• and many more\n\nBeautiful bushland setting. We can arrange all the trimmings, Catering at very reasonable rates, Air-conditioned, Private outdoor area, The room comfortably seats 120 guests and is fully air-conditioned.\n\nGlenorie RSL Club have very reasonable rates, so come along, have a look and consider us for your next party or event.\n\nThe team, at Glenorie RSL is committed to making your event a very enjoyable and memorable occasion.\n\nGlenorie RSL Club can arrange the catering, decorations and music. All you need to worry about is enjoying the party.\n\nGlenorie RSL Club have special rates available for fundraisers. We want to help you raise the most money for your cause.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/GlenorieRSLClub/', '', '', '', '', '', 'https://plus.google.com/107667070043815991350/about'),
  (109148, 'wardell-sporting-recreation-club-109148', 'Wardell Sporting & Recreation Club', '', '', 0, '2016-04-26 06:37:10', '2016-04-26 06:39:49', '', 191, 663, 'golf club', 0, 0, '', '', '0266834437', '', '', '', '', '', 'A', '{"1":[[0.125,0.7708333333]],"2":[[0.125,0.7708333333]],"3":[[0.125,0.7708333333]],"4":[[0.125,0.8125]],"5":[[0.125,0.8958333333]],"0":[[0.3333333333,0.5]]}', 'https://www.facebook.com/wardellsportsrecreationclub', '', '', '', '', '', ''),
  (109149, 'kingswood-sports-club-109149', 'Kingswood Sports Club', '', 'Kingswood Sports Club is located at Kingswood and boasts modern alfresco dining, elite bowling greens, Sports Bar, an entertainment lounge, and two multi purpose function areas. ', 276128, '2016-04-26 06:46:11', '2016-04-26 06:49:30', '', 191, 660, 'bowling club', 276128, 0, '', 'info@Kingswoodsports.com.au', '0247374600', '', '', '', 'http://www.kingswoodsports.com.au/', 'Welcome to Kingswood Sports Club.\n\nSituated in the Nepean area of Sydney, Kingswood Sports Club provides the same quality facilities and service, and high standard of hospitality that people have come to expect of Easts Leagues Club. \n\nKingswood Sports offers a range of exciting facilities for its Members and their guests including: \n\n• Modern indoor and alfresco dining areas, BBQ area and large lounge area \n• Function room catering for up to 90 guests \n• Sports Bar & pool table \n• Two bowling greens ', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.9583333333]]}', 'https://www.facebook.com/kingswoodsportsclub', '', '', '', '', '', ''),
  (109151, 'west-tradies-109151', 'West Tradies', '', 'West Tradies is located at Dharruk and has flexible function spaces that can be adapted to suit any occasion, whether for business, a wedding or a special celebration. ', 276134, '2016-04-26 07:09:49', '2016-04-26 07:13:44', '', 191, 656, 'social club', 276134, 0, '', '', '0296751099', '', '', '', 'http://www.westtradies.com.au/', 'West Tradies is a community based club founded by members of building workers unions in 1973. It has recently changed its name from Mt Druitt Workers Club and has undergone a number of renovations and improvements to the indoor and outdoor areas including new courtyards, water features and upgrades to key facilities.\n\nWest Tradies offer a full range of club services and activities:\n• Bars and lounges\n• Brasserie\n• Cafe\n• Outdoor seating\n• BBQ area\n• Kids'' interactive games room\n• Children’s playground\n• Showroom\n• Function and meeting rooms \n• Bus service\n• Raffles\n• Bingo\n• Keno\n• TAB\n• Sub-clubs (indoor bowls, darts, fishing)\n\nWest Tradies is a community based club founded on a spirit of friendliness and service. \n\nWest Tradies are not as big as some but we have big ideas when it comes to professional service and caring for our customers. \n\nOur modern club has flexible function spaces that can be adapted to suit any occasion, whether for business, a wedding or a special celebration. \n\nOur staff are experienced in successfully delivering many types of events and you can be assured that they will work closely with you to ensure that all the details of your event are just as you want them and that everything runs smoothly on the day. ', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', '');
