  (109152, 'ettalong-bowling-club-109152', 'Ettalong Bowling club', '', 'Ettalong Bowling Club is located in Springwood Street, With a range of food options to meet a broad range of tastes and budgets, along with plenty of entertainment choices and friendly staff.', 276138, '2016-04-26 07:20:26', '2016-04-26 07:22:42', '', 191, 654, 'bowling club\nsocial club', 276138, 0, '', 'reception@ettalongbowlingclub.net', '0243410087', '', '', '', 'http://www.ettalongbowlingclub.net/', 'Ettalong Bowling Club – located at 103 Springwood Street provides a friendly and relaxed atmosphere offering a range of activities such as men’s and women’s bowls, live entertainment, a quality bistro, coffee shop, bottle shop, raffles, special promotions and much more.', 'A', '{"1":[[0.3541666667,0.9166666667]],"2":[[0.3541666667,0.9166666667]],"3":[[0.3541666667,0.9583333333]],"4":[[0.3541666667,0.9583333333]],"5":[[0.3541666667,0.0416666667]],"6":[[0.3333333333,0.0416666667]],"0":[[0.3333333333,0.875]]}', 'https://www.facebook.com/ettalongbowlingclub/', '', '', '', '', '', 'https://plus.google.com/112733215227813700634/about'),
