  (109156, 'lansvale-united-sports-club-109156', 'Lansvale United Sports Club', '', 'Lansvale United Sports Club features Lansvale United Classic Function Centre which caters for all occasions, weddings, business seminars, sporting presentations, and social club functions etc.', 276172, '2016-04-26 22:44:12', '2016-04-26 22:44:57', '', 191, 615, 'sports club', 276172, 0, '', 'lusc@tpg.com.au', '0297272288', '', '', '0297244163', 'http://www.lansvalesportsclub.com.au/', 'Lansvale United Sports Club provides a blue ribbon service for the community and the courtesy metropolitan area.  The club is located in a quiet family orientated area with off street car parking, and features Hartley''s Oval as its sporting grounds and also playing facilities for the kids. Other grounds are located at Parkes Reserve, crn Togil St & Noble St, Canley Vale, Also at Cherrybrook Park, Silverwater Cres Lansvale, & Strong Park, Hollywood Drive Lansvale as its sporting grounds\n\nThe club also features Lansvale United Classic Function Centre which caters for all occasions, weddings, business seminars, 21st''s, christenings, sporting presentations, and social club functions etc.\n\nWe have affiliated sports which include Baseball, Soccer, Rugby, Netball, Line Dancing, Darts, Fishing, Golf, Snooker / Pool & Bootscooting.\n\nYou can always come and try out our exquisite bistro providing a wide range of Australian and Chinese Meals, and many more varieties. Our Kitchen (Tennyson) New Dragon Inn Chinese Restaurant.', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.875]],"6":[[0.4166666667,0.875]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/LansvaleUnitedSortsClub', '', '', '', '', '', ''),
  (109160, 'wingham-golf-club-109160', 'Wingham Golf Club', '', 'Wingham Golf Club located in Wingham provide its guests and members a wide range of services including bar and lounge, function rooms, dining, KENO, take away alcohol and many more.', 276206, '2016-04-26 23:13:13', '2016-04-26 23:19:44', '', 191, 603, 'golf club', 276206, 0, '', 'winghamgolf@bigpond.com', '0265534761', '', '', '', 'http://www.winghamgolfclub.com.au/', 'Wingham Golf Club is so much more than a venue to play a round of golf. The Club offers comfortable surrounds where family friendly activities can be enjoyed within a fun and relaxed atmosphere. \n \nThe Club enjoys great camaraderie amongst its members, not just on the golf course, but back in the Clubhouse. We are a small, but friendly Club where everyone from all walks of life can come and enjoy themselves.\n \nThe Club encourages members and non-members, to utilise our facilities which include:\n \n• Bar and lounge areas where kids are welcome\n• Fantastic a la carte dining\n• Function room\n• Covered outdoor beer garden\n• Bar Snacks\n• Keno\n• Eftpos/ATM\n• Take Away Alcohol\n• Taxi Vouchers for Members\n• Changeroom Facilities\n• Disabled access', 'A', '{"1":[[0.4166666667,0.7916666667]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,0.9583333333]],"6":[[0.4166666667,0.875]],"0":[[0.4166666667,0.8333333333]]}', 'https://www.facebook.com/winghamgolfclub', '', '', '', '', '', 'https://plus.google.com/114716030603138048047/about'),
