  (109165, 'padstow-rsl-club-109165', 'Padstow RSL Club', '', 'Padstow RSL Club have two function areas available Auditorium and Dining Room which is perfect for birthdays, anniversaries, weddings and business meetings.', 276208, '2016-04-26 23:31:52', '2016-04-26 23:39:02', '', 191, 590, 'rsl club', 276208, 0, '', '', '0297730528', '', '', '0297923857', 'http://www.padstowrsl.com.au/', 'Welcome to Padstow RSL\nLocated in Sydney''s South West we have been proudly serving the community since 1956. From humble beginnings as the little tin shed “Milton Hall” we have grown to become a popular boutique club frequented by members and guests from near and far. \n\nRenowned for our fantastic hospitality, we provide guests with great food, beverages, raffles, entertainment and more. Why not drop in & take advantage of what we have to offer.\n\nFunctions\nHold your next function at Padstow RSL\n\nIf you have any special event or function\n\n•  Birthdays\n•  Anniversaries\n•  Weddings\n•  Business Meetings\n\nWe have two function areas available Auditorium and Dining Room\n\nOur Dining Room is a preferred area for many local organisations. It is used for meetings,seminars and training, as well as small dinner parties and wakes. Hire of the Dining Room is $100. Optional table service is an extra $100.\n\nOur Auditorium is perfect for any celebration suitable for 50-250 people, you can have peace of mind knowing your party will be arranged so you can enjoy yourself. Hire of the Auditorium is $400 Tables can be set to suit your personal taste. *21st Parties will require an additional fee of $300 As security is required.\n\nWe are able to arrange all your decorations such as balloons, flowers, table scatters & table bouquets, priced on order Microphone, Lighting, and your host DJ or Live music available.', 'A', '{"1":[[0.4375,0.875]],"2":[[0.4375,0.9375]],"3":[[0.4375,0.9166666667]],"4":[[0.4375,0.9791666667]],"5":[[0.4375,0.0208333333]],"6":[[0.4375,0.0208333333]],"0":[[0.4583333333,0.875]]}', 'https://www.facebook.com/Padstow-RSL-Club-131562030229601/', 'https://twitter.com/PadstowRsl', 'https://www.linkedin.com/company/padstow-rsl-club?trk=extra_biz_viewers_viewed', '', '', '', 'https://plus.google.com/105850107069781871557/about'),
  (109166, 'warringah-bowls-mosman-109166', 'Warringah Bowls Mosman', '', 'Warringah Bowls Mosman is located at Mosman and hosts an array of functions including private parties, corporate bowls events, barefoot bowls, engagements, birthdays, christenings.', 276210, '2016-04-26 23:37:05', '2016-04-26 23:46:41', '', 191, 588, 'bowling club', 276210, 0, '', 'warrbc@bigpond.net.au', '0299694313', '', '', '0299698470', 'http://www.mosmanbowling.com.au/', 'On the 23rd of November 1903, the Warringah Bowling Club was born.\n\nThis brief account of its conception and its growth may be of interest to present day members and to all bowlers who have played at Warringah, where is enjoyed the magnificent panorama of harbour and city which the Club commands, as a result of the foresight and initiative of those pioneer members of 107 years ago.\n\nWarringah Bowls Mosman was the outcome of the feeling of a number of then members of the Mosman Club that there was room for another bowling club in the district, and, on the above date, a meeting was held at the Buena Vista Hotel – then newly erected – to take the first steps to bring their ideas to fruition.\n\nWarringah Bowls Mosman''s separate hall can be hired for functions and is also perfect for seminars, workshops and get-togethers.\nHere at Warringah Bowls Mosman, we can make your event one to remember.\n\nOur main function room can accomodate up to 200 guests Cocktail, 100 seated or 150 Theatre (click here for images). we can accomodate up to 250 guests at any one time for social bowls. We have extensive indoor & outdoor catering facilities and can cater for a wide range of tastes. Our more intimate Snooker room can accomodate up to 40 guests.\n\nFor Hen’s days , buck’s days and birthdays , christmas parties to corporate and team building events', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9583333333]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/wbcmosman', '', '', '', '', '', 'https://plus.google.com/110662089131756413901/about'),
