  (109169, 'punchbowl-ex-services-community-club-109169', 'Punchbowl Ex Services & Community Club', '', '', 0, '2016-04-27 00:07:58', '2016-04-27 00:08:13', '', 191, 577, 'rsl club\nsocial club', 0, 0, '', '', '0297593431', '', '', '', '', '', 'A', '{"1":[[0.375,0.875]],"2":[[0.375,0.875]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.875]],"6":[[0.375,0.875]],"0":[[0.375,0.875]]}', '', '', '', '', '', '', ''),
  (109170, 'bingara-sporting-club-109170', 'Bingara Sporting Club', '', 'Bingara Sporting Club located in Bingara provide its guests and member a wide range of services and facilities including entertainment, sporting facilities, dining and many more.', 276234, '2016-04-27 00:08:36', '2016-04-27 00:12:50', '', 191, 573, 'sports club', 276234, 0, '', 'binsport@bigpond.net.au', '0267241206', '', '', '0267241207', 'http://www.bingara.com.au/index.cfm?page_id=1182&page_name=Bingara%20Sporting%20Club', 'Bingara Sporting Club Limited is a Licensed Club offering wonderful sporting, entertainment and function facilities.  We are very proud of our Sporting facilities which are all maintained by a dedicated, volunteer workforce.\n\nAt the Bingara Sporting Club, we have a wide range of sporting facilities that will suit anyone''s interests. Indoor facilities include squash and outdoors we boast an exquisite golf course, 2 bowling greens and 8 clay tennis courts.\n\nAll outdoor facilities are available for use all day, every day.  If the Club is not open simply place your green fees in the honesty box at the entrance to the golf course, with your name and sport written on the envelope.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
