  (109175, 'rosnay-golf-club-109175', 'Rosnay Golf Club', '', 'Rosnay Golf Club is a family friendly club located at Auburn. Members and visitors are encouraged to use the club''s facilities. Bar, Bistro, Darts, Keno, TAB and golf course.', 276256, '2016-04-27 00:32:05', '2016-04-27 00:34:47', '', 191, 565, 'golf club', 276256, 0, '', 'gm@rosnaygolfclub.com.au', '0296498429', '', '', '0296495310', 'http://rosnaygolfclub.com.au/', 'Rosnay Golf Club is located at 5 Weymouth Avenue, Auburn. Our home is Auburn Public Golf Course. Auburn Council own and maintain the course to a very high standard. New Bunkers and pathways have just been added.\n\nThe course has 18 holes with a par rating of 68. The course is flat, ensuring a pleasant day of golf, however, the placement of many trees demands skill. The Pro Shop is very well equipped with lessons from our Pro and golf cart/buggy hire available. We also provide practice facilities.\n\nThe Clubhouse has all the facilities you would expect including Bar, Bistro, TAB, Keno and ATM facilities with FREE WI FI. We also have lockers available to store your golf gear.\n\nRosnay Golf Club caters for all types of golfer. We have seniors and veteran’s competition on Tuesday and mixed open competitions on Friday, Saturday, Sunday and Public Holidays. Ladies are welcome to play in all our Competitions. Many Championships are held through the year and for the competitive golfer, we have many representative teams. Rosnay Golf Club is committed to fostering junior talent. Our annual Junior’s Fee of only $30.00 is aimed at introducing kids to this great game.', 'A', '{"2":[[0.4166666667,0.5833333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]],"0":[[0.375,0.7083333333]]}', 'https://www.facebook.com/rosnaygolf/', '', '', '', '', '', 'https://plus.google.com/104415036250219325900/about'),
