  (109179, 'guyra-bowling-recreation-club-109179', 'Guyra Bowling & Recreation Club', '', 'Guyra Bowling & Recreation Club located in Guyra provide its member and guests a wide range of services and facilities including social bowls, golf, dining, function areas, weekly event and many more.', 276274, '2016-04-27 01:03:03', '2016-04-27 01:03:54', '', 191, 554, 'bowling club', 276274, 0, '', 'admin@guyrabowlingclub.com', '0267791499', '', '', '0267791886', 'http://guyrabowlingclub.com/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109181, 'inverell-rsm-club-109181', 'Inverell RSM Club', '', 'Inverell RSM Club located in Inverell provide its guests and member a variety of services and facilities including dining, live entertainment, function areas, party area and many more.', 276282, '2016-04-27 01:12:58', '2016-04-27 01:17:35', '', 191, 546, 'rsl club\nsocial club', 276282, 0, '', 'manager@inverellrsm.com.au', '0267223066', '', '', '0267225480', 'http://www.inverellrsm.com.au/', 'Inverell RSM Club is a newly renovated club that boasts greater facilities for our patrons.\n\nInverell RSM Club facilities include our excellent Diggers Bistro, Aromas Coffee Shop, Little Diggers Play area, Two Bars , Two full size Snooker Tables, Two large covered Outdoor areas, One Bowling green as well as Full TAB & KENO Facilities.\n\nSky Channel, Austar & ATM are also provided for the benefit of Members & Guests.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/pages/Inverell-RSM-Club/166911963333259', 'https://twitter.com/rsmclub', '', '', '', '', 'https://plus.google.com/113902542629644665358/about'),
  (109182, 'the-australian-club-melbourne-109182', 'The Australian Club Melbourne', '', 'The Australian Club is a perfect venue for private functions. The chefs and kitchen staff provide the very best in traditional and modern cuisine for all occasions such as weddings & private dinners.', 276294, '2016-04-27 01:23:14', '2016-04-27 01:26:12', '', 191, 544, 'leagues club', 276294, 0, '', 'accommodation@theaustralianclub.com.au', '0396721700', '', '', '0396000656', 'https://theaustralianclub.com.au', 'Established in 1878, The Australian Club is one of nine clubs founded in Melbourne by English settlers in the 19th century. The Australian Club has a rich history and was originally founded as a venue for Melbourne and Victorian businessmen to lodge and associate.\n\nToday, The Australian Club still serves as a destination for those looking to escape the strain of modern life, and relax in an inviting and friendly atmosphere. All the original architecture remains intact, showing the club''s true 19th century Victorian origins. Although many of the rules of the club have changed over the years, it still retains its tradition and prosperity as one of Melbourne''s finest clubs.\n\nToday, members bring both male and female guests into the Club to enjoy not only its special surroundings, but also its fine cuisine and attentive service.\n\nBanquet Rooms & Facilities\nThe magnificent splendour of its 1880s boom time architecture makes The Australian Club a perfect venue for private functions. The chefs and kitchen staff provide the very best in traditional and modern cuisine, and the banquet and waiting staff are highly trained and attentive to every detail.\n\nWhether it''s a function for eight to 280 guests, there will be a room that meets your needs - including the splendid Main Dining Room and the Ellis Rowan Room with its exquisite murals. There are many handsome rooms designed to suit functions such as weddings, private dinners, cocktail parties, meetings and corporate functions.', 'A', '{"1":[[0.375,0.875]],"2":[[0.375,0.875]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.875]],"6":[[0.375,0.875]],"0":[[0.375,0.875]]}', '', '', '', '', '', '', ''),
  (109183, 'moama-bowling-club-109183', 'Moama Bowling Club', '', 'Moama Bowling Club located in Moama is a premier sports & entertainment venue along murray that features bars, bistro, cafe,  and endless opportunities to relax in comfort.', 276296, '2016-04-27 01:24:13', '2016-04-27 01:27:50', '', 191, 537, 'bowling club\nsocial club', 276296, 0, '', 'info@moamabowlingclub.com.au', '1800806777', '', '', '0354809888', 'http://moamabowlingclub.com.au/', 'Moama Bowling Club''s The Bistro guarantee a great quality food, excellent service and affordable prices set against a stunning dining backdrop ensures our satisfied guests return to Moama Bowling Club time and time again. Set in contemporary and stylish surrounds, The Bistro is an excellent choice for dining, featuring a wide variety of traditional favorites as well as a selection of mouth-watering specialties including steaks, seafood, pasta and risotto.\n\nWhether you’re celebrating with family and friends or entertaining work colleagues and clients, our expertly-skilled and trained staff will ensure your dining experience is a memorable one.\n\nFUNCTIONS\n The success of your function means as much to us at Moama Bowling Club as it does to you. It’s how we’ve gained our reputation as the premier club on the Murray River and it’s why we are the venue of choice for so many prestigious events.\n\nWe specialise in major business conferences, product releases, industry expos, business networking, weddings, sports awards nights, fundraising launches and auctions, concerts and recitals, dinner dances, deb balls, VIP guest speakers and service club changeovers.\n\n\n\n\n\n', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.0416666667]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/Moama-Bowling-Club-23688409205/', 'https://twitter.com/Moama_Bowling', '', '', '', '', 'https://plus.google.com/106356165394452142295/about'),
  (109184, 'seven-hills-toongabbie-rsl-club-109184', 'Seven Hills – Toongabbie RSL Club', '', 'Seven Hills – Toongabbie RSL Clubis located in Best Road, providing an entertainment and a range of exciting menus for all groups, family or children.', 276298, '2016-04-27 01:24:47', '2016-04-27 01:26:32', '', 191, 539, 'rsl club\ngolf club\nbowling club\nsocial club', 276298, 0, '', 'info@sevenhillsrsl.com.au', '0296222800', '', '', '', 'http://7hillsgroup.com.au/', 'Seven Hills – Toongabbie RSL Club is one of the industry leaders spanning across four sites, the RSL Club, Fox Hills Golf Club, Blacktown City Bowling Club and Pennant Hills Bowling Club. The club is renowned for its amazing support of the local community and its modern facilities.', 'A', '{"1":[[0.3958333333,0.0416666667]],"2":[[0.3958333333,0.0416666667]],"3":[[0.3958333333,0.0416666667]],"4":[[0.3958333333,0.0833333333]],"5":[[0.3958333333,0.125]],"6":[[0.3958333333,0.125]],"0":[[0.3958333333,0.0416666667]]}', 'https://www.facebook.com/7HillsRSL', 'https://twitter.com/7hillsRSL', '', '', '', '', 'https://plus.google.com/113216171149223638449/about'),
  (109186, 'moree-services-club-109186', 'Moree Services Club', '', 'Moree Services Club located in Moree provide its guests and members a variety of services and facilities including accomodation, function areas, live entertainment, dining and many more.', 276324, '2016-04-27 01:42:42', '2016-04-27 01:44:02', '', 191, 531, 'rsl club\nsocial club', 276324, 0, '', 'frontdesk@moreeservicesclub.com.au', '0267521566', '', '', '', 'http://moreeservicesclub.com.au/', 'Moree Services Club originally started in 1947 soon after WWII grew to occupy the building that is now the Moree Tafe. In 1968 the Club moved to its present location and over the years has moved with the times and now the Club has in excess of 5000 members.\n\nThe facilities of the club are also improving and Board of Directors is always looking for ways to improve those facilities offered to members.\n\nMoree Services Club is really a member affair as no person living within 25 kilometres of the club with out Board approval. (This is a point that you should remember, to avoid awkwardness if you bring a guest that cannot show that the live outside this area.)\n  \nGenerally the members are able to enjoy a wide variety of sports within the club that range from bowls to touch football, for the over 30s a mixed, to fishing and darts and the list goes on. This is supplemented by weekly meat and produce raffles, member’s draws and entertainment.\n\nDetails of the entertainment and the sporting groups as well as their contact numbers are available at the Office or on this website.\n\nMoree Services Club, as it has grown, has become to be known as the place in Moree to enjoy yourself without problems or hostility. There are, of course, times when the behavior of other members or visitors do not meet the clubs standard and these people are dealt with by the Board of Directors. If you find that you are in the position of having unacceptable behavior near you then please report it to the duty manager and they will rectify the situation. If you become involved then you may be asked to leave and explain to the Directors. \n\nBut enough of the dos and don’ts the club is here for the benefits of the members and if the management or staff can help you then please ask.', 'A', '{"1":[[0.5,0.875]],"2":[[0.5,0.875]],"3":[[0.5,0.875]],"4":[[0.5,0.875]],"5":[[0.5,0.875]],"6":[[0.5,0.875]],"0":[[0.5,0.875]]}', 'https://www.facebook.com/www.moreeservicesclub.com.au/', '', '', '', '', '', ''),
  (109187, 'bondi-golf-diggers-club-109187', 'Bondi Golf & Diggers Club', '', 'Bondi Golf & Diggers Club located at North Bondi features an  entertainment throughout the week such as trivia, raffles and more, as well as a fantastic bistro with all your pub classics!', 276326, '2016-04-27 01:42:57', '2016-04-27 01:44:50', '', 191, 525, 'golf club\nsocial club', 276326, 0, '', 'admin@bondigolf.com.au', '0291303170', '', '', '', 'http://www.bondigolf.com.au/', 'Welcome to Bondi Golf & Diggers Club \n\nIn 2004 the Bondi Golf Club and the Bondi Diggers merged together in one of Australia’s best locations, Bondi Beach. With stunning views from both the course and clubhouse, it has become one of Bondi’s secret treasures.\n \nThe Bondi Golf Club was founded in 1935. The 9-hole course is regarded as one of the most breathtaking sceneries around, which is open to the public all year. With a magnificent view of our rocky coastline, Bondi Beach, the harbour and the city skyscrapers.\n \nThe Bondi Diggers was founded in 1926 after the first world war. It pays respect to the soldiers that have fallen before us and those who currently put their lives on the lines for our country. The ‘mateship’ between soldiers that help defines our nation is noticeable in the charisma of the club, just ask the regulars!\n \nWith amazing views of Bondi and its surroundings, it is the perfect spot to enjoy a relaxing drink with friends and family. With entertainment throughout the week such as trivia, raffles and more, as well as a fantastic bistro with all your pub classics!', 'A', '{"1":[[0.625,0.9166666667]],"2":[[0.625,0.9166666667]],"3":[[0.3958333333,0.9166666667]],"4":[[0.4791666667,0.9166666667]],"5":[[0.4791666667,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Bondi-Golf-Diggers-Club-257685614306642/', '', '', '', '', '', ''),
  (109189, 'narrandera-bowling-recreation-club-109189', 'Narrandera Bowling & Recreation Club', '', '', 0, '2016-04-27 01:47:18', '2016-04-27 01:50:57', '', 191, 523, 'bowling club', 0, 0, '', 'admin@narranderabowls.com.au', '0269592127', '', '', '', '', '', 'A', '{"1":[[0.5833333333,0.8125]],"2":[[0.5,0.8125]],"3":[[0.5,0.8125]],"4":[[0.5833333333,0.8541666667]],"5":[[0.5,1]],"6":[[0.375,1]],"0":[[0.375,0.8125]]}', 'https://www.facebook.com/NarranderaBowlingRecreationClub/', '', '', '', '', '', ''),
  (109190, 'nsw-harness-racing-club-109190', 'NSW Harness Racing Club', '', 'NSW Harness Racing Club is located at Bankstown and offer horse racing, breeding and more.', 276346, '2016-04-27 01:47:57', '2016-04-27 01:52:03', '', 191, 521, 'sports club', 276346, 0, '', 'admin@hrnsw.com.au', '0297226600', '', '', '', 'http://www.harness.org.au/nsw.cfm', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/HRNSW', '', '', '', '', '', ''),
  (109192, 'narrabri-bowling-club-109192', 'Narrabri Bowling Club', '', 'Narrabri Bowling Club located in Narrabri provide its guests and members a variety of service and facilities including bowls events, dining, entertainment, promotions, accommodations and many more.', 276350, '2016-04-27 01:54:54', '2016-04-27 01:59:38', '', 191, 515, 'bowling club', 276350, 0, 'Corner Maitland Street and Kilarney Street', 'admin@narrabribowlingclub.com.au', '0267922205', '', '', '', 'http://www.narrabribowlingclub.com.au/', 'Narrabri Bowling Club takes socialising and lawn bowls seriously with the Narrabri Bowling Club boasting a sports bar supporting wide-screen sports action, fabulous fair from the Po Loy Restaurant, a corporate function and social events centre adjacent an outdoor deck overlooking the bowling greens.  Relax into our comfy lounge arm chairs and couches – the perfect place to check out the racing, football and other sports on our giant screens, or relax for a drink with friends. We provide TAB, Keno, Sky Channel and Fox Sports for your enjoyment.\n\nOffering a wealth of organised bowls events, great socialising, best value wining and dining, entertainment, exciting promotions, and four star accommodation– it is clear the Narrabri Bowling Club has all you need for your stay in Narrabri.', 'A', '{"1":[[0.4583333333,0.875]],"2":[[0.4583333333,0.875]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,1]],"6":[[0.375,1]],"0":[[0.375,0.875]]}', 'https://www.facebook.com/pages/Narrabri-Bowling-Club/175588265792550', '', '', '', '', '', 'https://plus.google.com/106257895195006441587/about'),
  (109194, 'the-new-england-club-109194', 'The New England Club', '', '', 0, '2016-04-27 02:03:05', '2016-04-27 02:04:39', '', 191, 510, 'social club', 0, 0, '', '', '0267323144', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109196, 'nundle-bowling-club-incorporated-109196', 'Nundle Bowling Club Incorporated', '', 'Nundle Bowling Club Incorporated located in Nundle provide its members and guests and wide range of services and facilities including dining, bar facilities, lawn bowls and many more.', 276372, '2016-04-27 02:09:43', '2016-04-27 02:11:38', '', 191, 496, 'bowling club', 276372, 0, '', '', '0267693268', '', '0428635352', '', 'http://www.nundle.com.au/dining/nundle-bowling-club-incorporated/', 'Nundle Bowling Club Inc is your family-friendly Club offering restaurant and bar facilities to locals and visitors alike. Enjoy a cheap and cheerful mid-week meal Wednesday evenings and, afterwards, try your hand at a game of darts or cards. The Club is open every Saturday evening for quality meals from 6pm. \n\nEnjoy a taste of Asia with Mun Ching Fu Asian Café open the first Saturday of every month from 6pm.\n\nSit back and relax in our alfresco dining area in the warmer months and enjoy the spectacular view of Nundle’s rolling hills.\n\nLawn bowls are played Wednesdays, Saturdays and Sundays from 1pm.', 'A', '{"3":[[0.75,0.875]],"6":[[0.75,0.9583333333]]}', '', '', '', '', '', '', ''),
  (109200, 'roseville-golf-club-109200', 'Roseville Golf Club', '', 'Roseville Golf Club is located at Roseville and cater birthdays, weddings, christenings, special events, after funeral gatherings, meeting & seminar and more.', 276386, '2016-04-27 02:17:38', '2016-04-27 02:22:38', '', 191, 489, 'golf club', 276386, 0, '', 'admin@rosevillegolf.com.au', '0284671800', '', '', '', 'http://www.rosevillegolf.com.au/cms/', 'Roseville Golf Club was officially founded on 18th January, 1923 following initial planning and purchase of land in 1922 for a nine hole golf course.  This was proposed by a group of sports enthusiasts who, tired of wet weather disrupting their tennis and cricket, wanted to play an all-weather game.\n\nPlay began on 1st October, 1923 with a 9 hole competition and, following the acquisition of further land, the 18 hole course was officially opened on 23rd May, 1925.\n\nFrom this time on, through good years and bad, members and staff have committed their time and effort to the continued advancement of Roseville Golf Club.\n\nLocated right in the heart of Sydney''s leafy north shore and is 20 minutes from Sydney''s CBD. Roseville Golf Club prides itself on their picturesque 18-hole golf course and is North Shores leading Function Venue.\n\n', 'A', '{"1":[[0.375,0.75]],"2":[[0.375,0.75]],"3":[[0.375,0.75]],"4":[[0.375,0.75]],"5":[[0.375,0.75]],"6":[[0.4166666667,0.75]],"0":[[0.4166666667,0.75]]}', 'https://www.facebook.com/Roseville-Golf-Club-157988881076320', '', '', '', '', '', 'https://plus.google.com/105510811051164586482/posts'),
  (109203, 'kahibah-sports-club-109203', 'Kahibah Sports Club', '', 'Kahibah Sports Club is located at Kahibah and can cater for your every need to create a memorable function for that special occasion. We have three new function rooms, quality catering.', 276408, '2016-04-27 02:30:46', '2016-04-27 02:41:01', '', 191, 472, 'sports club', 276408, 0, '', 'info@kahibahsports.com.au', '0249432987', '', '', '0249438751', 'http://www.kahibahsports.com.au/', 'Kahibah Bowling Club Co-op Ltd was established in 1958. The Clubhouse was officially opened on 6 May 1961 and since then there has been a series of extensions to the Club, many successes on the bowling green and lots of life-long friends made.\n\nPeople of all ages meet socially at Kahibah Sports Club due to the friendly atmosphere, great prices and regular social happenings. Great touring rock and roll artists often play live gigs and local acoustic artists play regularly. The newly refurbished club is home to three great function rooms that boast modern facilities. Taste Restaurant is located within the club and features a large, open dining area where friends and family can wine and dine with quality food and beverages.\n\nThe Kahibah men''s and women''s bowls teams have achieved excellence over the past 50 years and are well known in the greater Newcastle area for their skill and good sporting natures. Kahibah Sports Club runs barefoot bowls in the warmer months of the year that attracts younger people to the sport of bowls. Charity bowls events such as the Westpac Rescue Helicopter Service Charity Bowls Gala happen annually and all of the patrons, Board members and staff lend a hand to raise money for a good cause.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/107671636736274292908/about'),
  (109204, 'paddington-woollahra-rsl-memorial-and-community-club-109204', 'Paddington Woollahra RSL Memorial and Community Club', '', '', 0, '2016-04-27 02:32:31', '2016-04-27 02:32:56', '', 191, 480, 'rsl club', 0, 0, '', '', '0293328222', '', '', '', '', '', 'A', '{"1":[[0.375,0.875]],"2":[[0.375,0.875]],"3":[[0.375,0.875]],"4":[[0.375,0.875]],"5":[[0.375,0.875]],"6":[[0.375,0.875]],"0":[[0.375,0.875]]}', '', '', '', '', '', '', ''),
  (109207, 'tumbarumba-bowling-club-109207', 'Tumbarumba Bowling Club ', '', '', 0, '2016-04-27 02:40:26', '2016-04-27 02:40:40', '', 191, 474, 'bowling club', 0, 0, '', 'tumbabowls@hotmail.com', '0269482016', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/tumbabowls', '', '', '', '', '', ''),
  (109209, 'club-kotara-109209', 'Club Kotara', '', 'Club Kotara is located at Kotara and provide separate function room which cater for any function, large or small.', 276430, '2016-04-27 02:53:38', '2016-04-27 02:57:07', '', 191, 466, 'bowling club\nsocial club', 276430, 0, '', '', '0249573385', '', '', '', 'http://clubkotara.com.au/', 'Welcome to Club Kotara, located in the centre of Kotara, in a tranquil parkland setting, adjacent to Kotara Railway Station. \n\nOur club has evolved from being exclusively a Bowling Club to a central hub of the local community.\n\nClub Kotara have a family friendly bistro and separate function room which cater for any function, large or small. Regular musical entertainment nights, include karaoke, kids disco, hoy, trivia, bingo and raffles create a great atmosphere for locals and visitors.\n\nClub Kotara''s bowling greens have earned the praise of bowlers from far and wide and bare foot bowlers are encouraged to incorporate our BBQ facilities, free of charge, into their fun filled days.\n\nNo matter what the occasion, our friendly staff are here to please.', 'A', '{"1":[[0.375,0.8958333333]],"2":[[0.375,0.8958333333]],"3":[[0.4166666667,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.7916666667]]}', '', '', '', '', '', '', 'https://plus.google.com/104333883099304122477/about'),
  (109211, 'the-henry-sports-club-109211', 'The Henry Sports Club', '', 'The Henry Sports Club is your local club in Werrington County With so much to offer including trivia, entertainment, sports, TAB, meat raffles, breakfast, lunch and dinner dining options & many more.', 276436, '2016-04-27 03:06:07', '2016-04-27 03:16:47', '', 191, 458, 'sports club\nsocial club', 276436, 0, '', 'info@hlclub.com.au', '0296232119', '', '', '', 'http://www.henrysportsclub.com.au/', 'The Henry Sports Club is the best local club in the foothills of the Blue Mountains. We exist for the community and are proud to offer you so many fabulous services:\n\n-BottleMart\n-Huge TAB\n-Keno\n-Legends Bar\n-Legends Bistro\n-Outdoor Courtyard\n-Car Park\n-Courtesy Bus\n-Function Facilities\n-Trivia and Poker\n-Meat Raffles\n-Loads of Intra Clubs to choose from\n-Plus a hair and make up salon – Unique Hair\n\n We look forward to seeing you in the club soon.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/thehenrysportsclub/', '', '', '', '', '', ''),
  (109215, 'commercial-club-wagga-109215', 'Commercial Club Wagga', '', 'Commercial Club Wagga located in Wagga Wagga features bars, eateries, lounges, gaming function rooms, promotions, live entertainment and mant more.', 276460, '2016-04-27 03:19:25', '2016-04-27 03:20:44', '', 191, 453, 'social club', 276460, 0, '', '', '0269213012', '', '', '', 'http://waggarsl.com.au/commercial-club/', 'Commercial Club Wagga has been transformed into a modern and inviting venue attracting a diverse range of clientele. The Wagga RSL Club gave the Commercial Club Wagga a lifeline in August 2009 by proceeding with amalgamation. Since then extensive renovations have provided the CBD with an exciting and impressive venue to visit. ‘The Deck’ overlooking picturesque Gurwood Street creates the perfect atmosphere to sit back, relax and catch up with family, friends or business colleagues.', 'A', '{"1":[[0.4166666667,0.9375]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,0.9791666667]],"6":[[0.4166666667,0.0208333333]],"0":[[0.4166666667,0.9375]]}', 'https://www.facebook.com/WaggaRSL/?fref=nf', '', '', '', '', '', ''),
