  (109218, 'nbc-sports-club-109218', 'NBC Sports Club', '', 'NBC Sports Club is your one stop venue for lawn bowls, golf, fishing, cards, junior sport, entertainment and community involvement located in Northmead.', 276470, '2016-04-27 03:32:37', '2016-04-27 03:37:45', '', 191, 445, 'bowling club\nsports club', 276470, 0, '', 'info@nbcsportsclub.com.au', '0296302875', '', '', '', 'http://nbcsportsclub.com.au/', 'NBC Sports Club is your one stop venue for lawn bowls, golf, fishing, cards, junior sport, entertainment and community involvement. With just over 2,500 members we’re big enough to provide spaces that will accommodate your special event but small enough to ensure you still feel part of our family community.\n\nWe pride ourselves in providing exceptional customer service so come along and enjoy the wonderful food catered by Maze Group and see for yourself the way our people look after you with an extensive range of beverage and club services.\n\nYou can comfortably experience the ambience of our under cover verandas which are surrounded by beautiful gardens and manicured greens, or you can sit comfortably in our newly refurbished members lounge.\n\nWe take great pride in the way we engage with our local community via our support for local schools, scouts, junior sport, community and volunteer charity and welfare groups via our club grants and sponsorship programs.', 'A', '{"1":[[0.3958333333,0.9166666667]],"2":[[0.3958333333,0.9583333333]],"3":[[0.3958333333,0.9583333333]],"4":[[0.3958333333,0.9583333333]],"5":[[0.3958333333,1]],"6":[[0.3958333333,1]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/nbcsportsclub/?ref=br_tf', 'https://twitter.com/nbcsportsclub', '', '', '', '', 'https://plus.google.com/106929099662228509019/about'),
