  (109224, 'young-bowling-club-109224', 'Young Bowling Club', '', '', 0, '2016-04-27 05:04:48', '2016-04-27 05:05:02', '', 191, 434, 'bowling club', 0, 0, '', '', '0263821112', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109226, 'randwick-club-109226', 'Randwick Club', '', 'The Randwick Club has Function Rooms available for hire to suit any occasion. Dine at The Vu, our a la carte restaurant, well named for its spectacular & far-reaching views from Sydney Harbour Bridge.', 276512, '2016-04-27 05:17:28', '2016-04-27 05:19:27', '', 191, 426, 'leagues club\nsocial club', 276512, 0, '', 'enquire@rlclub.com.au', '0293994100', '', '', '0293994188', 'http://rlclub.com.au/', 'The Randwick Club has Function Rooms available for hire to suit any occasion. Whether you’re having an intimate dinner for 10, a family gathering for 50 or a party for 300 of your closest friends our friendly Staff can help you arrange a perfect Event. \n\nThe rooms available for hire include:\n\nMeeting Rooms on levels 3 & 4 which are perfect for small meeting groups or intimate dinners.\n\nThe Vista @ level 4 has a balcony & sweeping views over Randwick Racecourse & Centennial Parklands to the City Skyline.   It seats 60, and hold up to 80 with cocktail style events.\n\nThe Venu @ Level 3 for any function up to 300 seated.  With a large dance floor, stage and sound desk, it is an adaptable room from Wedding Receptions to Latin Dance Nights to Trivia Fundraisers.\n\nAll rooms at very competitive prices\n\nDining\nDine at The Vu, our a la carte restaurant, well named for its spectacular and far-reaching views from Sydney Harbour Bridge, to the Blue Mountains. The Vu is located on Level 4 of The Randwick Club and boasts some of the best views in Sydney. An updated menu where East meets West in fine modern dining, and international cuisine. A sports bar is adjacent to the restaurant for the casual diner and free wireless internet is also available.', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.4166666667,0.9583333333]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,0.9583333333]]}', '', '', '', '', '', '', 'https://plus.google.com/102701644086333057020/about'),
  (109227, 'castle-hill-bowling-club-109227', 'Castle Hill Bowling Club', '', '', 0, '2016-04-27 05:18:34', '2016-04-27 05:18:37', '', 191, 428, '', 0, 0, '', '', '0296342192', '', '', '', 'http://castlehillbc.com.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109229, 'club-rose-bay-109229', 'Club Rose Bay', '', 'Club Rose Bay has on offer a range of bars, function rooms, snooker tables and Keno facilities as well as weekly activities such as Bridge, Raffles & exercise classes.', 276516, '2016-04-27 05:23:31', '2016-04-27 05:25:17', '', 191, 422, 'social club', 276516, 0, '', 'email@clubrosebay.com.au', '0293719412', '', '', '0293717800', 'http://www.clubrosebay.com.au/', 'Welcome to Club Rose Bay\nSituated on one of Sydney''s stunning harbour beaches, Club Rose Bay is the perfect location for a relaxing drink with friends & family or even the most elaborate wedding or special event.\n\nThe Club''s spectacular location & facilities promise convenience, quality, affordability and comfort. Close to Rose Bay Ferry Wharf, numerous bus stops & Sydney Sea Planes as well as having ample parking available, members & guests have a variety of transport options on offer.\n\nFrom the bistro, members, guests & vistors can choose from a appetizing menu in a  casual dining surounding for lunch & dinner 7 days a week.\n\nClub Rose Bay has on offer a range of bars, function rooms, snooker tables and Keno facilities as well as weekly activities such as Bridge, Raffles & exercise classes.\n\nFor weddings & special events, see our ''Deck Bar Lounge.'' This lounge is the perfect venue with its own private outdoor deck overlooking the bay & the city as well as an exclusive bar & other additional privileges', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/ClubRoseBay', '', '', '', '', '', 'https://plus.google.com/113360836201187320718/about'),
  (109230, 'armidale-ycw-rugby-league-club-109230', 'Armidale YCW Rugby League Club', '', '', 0, '2016-04-27 05:26:41', '2016-04-27 05:30:09', '', 191, 421, 'sports club', 0, 0, '', '', '0267725773', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', '');
INSERT INTO `tbl_entity_organization` (`id`, `friendly_url`, `name`, `alternate_name`, `description`, `image_id`, `enter_time`, `update_time`, `abn`, `account_id`, `place_id`, `keywords`, `logo_id`, `banner_id`, `address_additional_info`, `email`, `telephone`, `alternate_telephone`, `mobile`, `fax_number`, `website_url`, `content`, `status`, `hours_work`, `facebook_link`, `twitter_link`, `linkedin_link`, `youtube_link`, `blog_link`, `pinterest_link`, `googleplus_link`) VALUES
  (109231, 'bargo-sports-club-109231', 'Bargo Sports Club', '', 'Bargo Sports Club located in Bargo is a friendly bowling club on the Southern Highlands offering all facilities you expect from a first class club. ', 276526, '2016-04-27 05:30:27', '2016-04-27 05:36:08', '', 191, 416, 'bowling club\nsports club', 276526, 0, '', 'bargosportsclub@chprsl.com.au', '0246841222', '', '', '0246842414', 'http://www.bargosportsclub.com.au/', 'Bargo Sports Club has been in operation since the early 1960''s and has a long history of supporting its local community. With over 2500 members Bargo Sports Club is an active and progressive club taking pride in offering local members a first class experience.\n\nBeing amalgamated with Canterbury Hurlstone-Park RSL, means Bargo Sports Club members also receive complimentary membership to Canterbury - Hurlstone Park RSL. \n\nBARGO GRILL\n  Great seafood, sumptuous steaks and a range of Australian dishes are available for lunch and dinner.\nOffering a fresh, modern cuisine with its own twists and influences, The Grill is sure to offer something for everyone to enjoy.\n \nCatering for a wide range of tastes and appetites, Bargo Grill’s charming ambience and alfresco dining is complemented by a contemporary menu.\n \nEnjoy great food, wine and friendly service – whether you''re having a quick snack, lunching with friends or enjoying an evening meal with family.\n\nENTERTAINMENT\n  Being incorporated with Canterbury Hurlstone Park RSL means we share in a long history of providing quality entertainment to our members and their guests.\n\nWe regularly hold shows in our Auditorium and provide entertainment in our main lounge area for special events. Show tickets are always affordable and can be pre-purchased from the club. All shows are for persons over the age of 18 years and doors generally open at 7:30pm with the show commencing from 8.30pm. We also have Free live entertainment in the main lounge every Friday night from 7pm featuring a range of local and well renowned entertainers.\n\nFUNCTIONS\n  Here at Bargo Sports Club you will find our functions team friendly, supportive and always willing to go that extra step to ensure that your special day is exactly that... Special!\n\nOur Auditorium seats up to 400 guests, without obtrusive pillars, and is fully equipped with quality Audio Visual equipment, a full size stage, a fantastic dance floor, hosting a separate bar and a magnificent view over the native bushland, our function facilities are sure to impress you and your guests.\n\nSPORTS\n  Supporting a healthy Bowling Community of over 100 men and women, Bargo Sports Club proudly provides arguably the best bowling surfaces in the Shire. We regularly hold social bowls for men and women as well as competition bowls and pennants.\n\n', 'A', '{"1":[[0.4166666667,0.7916666667]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.8958333333]],"4":[[0.4166666667,0.9375]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.9583333333]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Bargo-Sports-Club-111914642314/', '', 'https://www.linkedin.com/company/bargo-sports-club', '', '', '', 'https://plus.google.com/116278736002832102202/about'),
  (109232, 'oakdale-workers-sporting-recreation-club-ltd-109232', 'Oakdale Workers Sporting & Recreation Club Ltd', '', '', 0, '2016-04-27 05:34:05', '2016-04-27 05:34:26', '', 191, 418, 'social club', 0, 0, '', '', '0246596205', '', '', '', '', '', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109233, 'royal-prince-edward-yacht-club-109233', 'Royal Prince Edward Yacht Club', '', 'Royal Prince Edward Yacht Club (RPEYC) is a private yacht club located on Felix Bay, Point Piper on the southern shoreline of Sydney Harbour. The club features lounge and dining room for members.', 276538, '2016-04-27 05:37:20', '2016-04-27 05:38:42', '', 191, 414, 'sailing club\nsocial club', 276538, 0, '', 'secretary@rpeyc.com.au', '0293635809', '0293273149', '', '0293635807', 'http://www.rpeyc.com.au/', 'The Royal Prince Edward Yacht Club (RPEYC) is a private yacht club located on Felix Bay, Point Piper on the southern shoreline of Sydney Harbour.\nThere are currently 500 members of the RPEYC. Guests are welcome when accompanied by a Member.\n\nThe RPEYC hosts Wednesday afternoon racing in four divisions from October through to April and is also very active in race management of its own regattas as well as managing many of the Royal Sydney Squadron’s Saturday races.\n\nThe Clubhouse was purpose-built in 1924 as a yacht club, 2 years after the land was acquired and proffers spectacular views of the harbour from the Clubhouse and lawn. Many of the original features are still very evident. The full sized billiard table was “borrowed” in the 1930’s from the Commodore while he was overseas and remains to this day for use in the Club.\n\nThe first floor of the Clubhouse consists of the Club Bar, full sized billiard table, a large lounge room and separate dining room overlooking Shark Island.  Apart from fully catered lunches and dinners, the lounge and dining room are used extensively for information evenings and talks related to sailing.  Members are permitted to host their own private functions at the Club, catered to their specific requirements.\n\nThe grounds of the RPEYC include a dingy and kayak storage shed with a davit for lifting dinghies to road level and a barbeque. Tables and chairs are located on both the front and rear lawns, used predominantly for outside dining and entertainment. The front lawn leads onto Lady Martin’s beach, a popular sandy harbour beach for members and the public to use.\n\nThe RPEYC owns the jetty, which can be used to drop off or pick up members and their guests, subject to vessel size restrictions. The Club controls a number of moorings in Felix Bay that members can rent.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.375,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109235, 'queanbeyan-tigers-australian-football-club-109235', 'Queanbeyan Tigers Australian Football Club', '', 'Queanbeyan Tigers Australian Football Club is located at Queanbeyan and offer great facilities, events and more.', 276544, '2016-04-27 05:47:57', '2016-04-27 05:55:40', '', 191, 403, 'sports club', 276544, 0, '', 'general.manager@tigersclub.com.au', '0262978888', '', '', '', 'http://tigersclub.com.au/', 'Situated just on the New South Wales side of the ACT-NSW border, Queanbeyan could in some ways claim to be the birth place of Australian football, for it was there on 19 August 1835 that Thomas Wentworth Wills, popularly regarded as the sport’s founder, was born.\n\nRealistically, such a view depends on a somewhat sentimentalised interpretation of the history of Australian football, and one which has, to a certain extent, fallen out of favour in recent years, but it is nevertheless not without a certain charm and allure.\n\nThe Tigers 2010 Season was much the same as 2009. The senior team were defeated in the first semi final, the Reserves won consecutive titles and the Mulrooney Medal crossed the border for the second consecutive season – once again being won by Mitch Daniher.\n\nIn fact a Tiger player featured as Medal winners in 1st, Reserves, Under 18 and Under 16 Grades of the respective competitions.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109238, 'club-bega-109238', 'Club Bega', '', 'Club Bega located in Bega is a club that offers modern facility for all members and guests. Enjoy our modern facilities with great dining, relaxed seating areas and 2 bowling greens.', 276550, '2016-04-27 05:51:05', '2016-04-27 05:52:37', '', 191, 407, 'bowling club', 276550, 0, '', 'emma@clubbega.com.au', '0264921055', '', '', '', 'http://www.clubbega.com.au/', 'Club Bega  is the premier dining and bar experience in Bega. We have recently renovated facilities including our TAB Sports Bar, Graces Restaurant, comfortable lounge area, gaming room including 50 poker machines and 2 bowling greens.\n\nCLUB HOUSE\nThe very best in modern facilities in a relaxed atmosphere await at Club Bega.\nWe know you will enjoy your visit including the very popular Grace''s Cafe.\n\nFUNCTION ROOMS\nOur function room can be set up with four different floor plans to suit your needs. Graces can also provide catering to suit your requirements. Talk to us about designing a Menu for your special day.\n\nLAWN BOWLING\nOur newly renovated Club Bega, is a leading club for social & competition bowls on the Sapphire Coast, visitors are made most welcome.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Club-Bega-619530751431118/', '', '', '', '', '', ''),
