  (109241, 'the-taxi-club-109241', 'The Taxi Club', '', 'The Taxi Club is an Iconic Sydney venue. A place where diversity is right at home. No Ordinary Experience ... No Ordinary Club.', 0, '2016-04-27 06:03:55', '2016-04-27 06:03:58', '', 191, 398, 'social club', 0, 0, '', 'info@thetaxi.com.au', '0293314256', '', '', '', '', 'The Taxi Club is like no other Club in Sydney. If you''re Gay, Lesbian, Bisexual, Tranny, Transgender, Transsexual, Crossdresser, Goth, Punk, anything a bit special, or you just embrace diversity amongst our society, The Taxi''s for you!\n\nAlways a fun night out. People don''t hassle people and nobody judges anybody.', 'A', '{"1":[[0.6666666667,1]],"2":[[0.6666666667,1]],"3":[[0.6666666667,1]],"4":[[0.6666666667,1]],"5":[[0.6666666667,0.125]],"6":[[0.5833333333,0.1666666667]],"0":[[0.5833333333,1]]}', 'https://www.facebook.com/The-Taxi-Club-114028128617511', '', '', '', '', '', ''),
  (109242, 'belconnen-soccer-club-109242', 'Belconnen Soccer Club', '', 'Belconnen Soccer Club located in Mckellar has a host of facilities for kids, dining, function centres and a friendly atmosphere.', 276574, '2016-04-27 06:05:39', '2016-04-27 06:10:08', '', 191, 391, 'sports club', 276574, 0, '', 'info@belconnensoccerclub.com.au', '0262599900', '', '', '0262599955', 'http://www.belconnensoccerclub.com.au/', 'Belconnen Soccer Club has great dining options available at McKellar and Hawker.\n\nThe Belconnen Soccer Club is proud to support our Affiliate Clubs. Our club has a host of facilities for kids, dinning, function centres and a friendly atmosphere.\n\nBelconnen Soccer Club in conjunction with Relationships Australia promotes responsible gambling. \n\nMcKellar\nBlue Sky Bistro provides a great range of Asian and Modern Australian Cuisine. From Asian meals such as sizzling garlic king prawns, combination laksa to the all time favourites roast of the day or our famous Blue Sky Burger.\n\nBelconnen Soccer Clubs are the ideal venues for a wide range of functions, with facilities to suit occasions such as birthday celebrations, business meetings, farewell parties, small to medium conferences, seminars and training workshops.\n\nWe can help you plan and organise your function to the last detail. We’re flexible and will meet all of your needs to ensure a successful event.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/BelconnenSoccerClub', '', '', '', '', '', ''),
  (109246, 'warringah-golf-club-109246', 'Warringah Golf Club', '', 'Warringah Golf Club is located in North Manly offering Attractive & challenging course for all standards of golfers.', 276594, '2016-04-27 06:20:34', '2016-04-27 06:21:48', '', 191, 381, 'golf club', 276594, 0, '', 'enquire@warringahgolfclub.com.au', '0299054709', '', '', '', 'http://www.warringahgolfclub.com.au/', 'Warringah Golf Club and course is located within a half hour drive from the Sydney CBD, Here are 10 great things about our club and golf course which make it attractive for members, guests and social golfers.\n\n-Attractive and challenging course for all standards of golfers\n\n-A well maintained and easy to walk course with only one small hill at one end of the course\n\n-A great wet weather course – last to close and first to open after rain\n\n-Social golf playing times available 7 days a week including twilight golf throughout the year\n\n-The best stocked pro shop for all your golfing needs with the most competitive prices in Sydney\n\n-Golfing membership available for men, women and juniors along with house membership for regular patrons of the clubhouse.\n\n-A welcoming and friendly atmosphere for new members\n\n-Regular special days, occasions and social events for the enjoyment of members throughout the year\n\n-A comfortable clubhouse lounge with full bar facilities for members and guests. The function room is an ideal venue for functions for up to 150 people\n\n-The very popular Sports Bar with its full TAB and gaming facilities', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/warringahgolfclub/', '', '', '', '', '', ''),
