  (109250, 'sports-club-kaleen-109250', 'Sports Club Kaleen', '', 'Sports Club Kaleen is located at Kaleen and has a function room that can cater for up to 100 people for private and corporate functions.', 276608, '2016-04-27 06:36:33', '2016-04-27 06:40:52', '', 191, 365, 'sports club', 276608, 0, '', 'sckreception@eastlakefc.com.au', '0262411560', '', '', '', 'http://www.eastlakefc.com.au/', 'Sports Club Kaleen is the newest member of the Eastlake Football Club family.\n\nSituated opposite Kaleen Plaza inside the Kaleen Indoor Sports Centre, Sports Club Kaleen has a strong tradition of supporting numerous sporting groups in North Canberra.\n\nThe recently renovated club features 150 of the latest gaming machines, as well as ACTTAB facilities and live music every Friday night.\n\nSports Club Kaleen also welcomed our new bistro team “Taste To Taste” bringing a delicious menu and prices that are hard to beat.\n\nSports Club Kaleen is open from 9am daily. Check out our ‘What’s On’ section to find out about weekly specials and promotions at the Club.', 'A', '{"1":[[0.375,1]],"2":[[0.375,1]],"3":[[0.375,1]],"4":[[0.375,0.0625]],"5":[[0.375,0.1041666667]],"6":[[0.375,0.1041666667]],"0":[[0.375,0.0208333333]]}', 'https://www.facebook.com/Sports-Club-Kaleen-276507255714691', '', '', '', '', '', 'https://plus.google.com/102734718101642643341/about'),
  (109252, 'waverley-bowling-club-109252', 'Waverley Bowling Club', '', 'Waverley Bowling and Recreation Club. Located in 163 Birrell St, has 3 large Bowling Greens, Great Bistro and a nice outdoor area to relax and enjoy a quiet beverage.', 276622, '2016-04-27 06:43:35', '2016-04-27 06:45:45', '', 191, 361, 'bowling club', 276622, 0, '', 'manager@waverleybowlingclub.com', '0293893026', '', '', '0293894658', 'http://www.waverleybowlingclub.com/189', 'Welcome to Waverley Bowling Club..... \n\nConveniently located close to Bondi Beach, Waverley Bowling Club is the perfect venue to enjoy great food, a relaxing beverage and a game of bowls. \n\nWith three bowling greens and a spacious al fresco dining area, “Waverley Bowlo” offers the location venue for a laid back experience. \n\nHead down to Waverley Bowling Club today to experience everything the club has to offer! ', 'A', '{"1":[[0.4583333333,0.7916666667]],"2":[[0.4583333333,0.7916666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.7916666667]],"0":[[0.4583333333,0.7916666667]]}', 'https://www.facebook.com/Waverley-Bowling-Club-264260683613937/', '', '', '', '', '', 'https://plus.google.com/102433488644453331782/about'),
  (109253, 'blayney-bowling-club-109253', 'Blayney Bowling Club', '', 'Blayney Bowling Club located in Blayney provide its guests and members a wide range of services and facilities including TAB facilities, dining, pokies, children''s area, bowling greens and many more.', 0, '2016-04-27 06:51:41', '2016-04-27 06:58:16', '', 191, 355, 'bowling club', 0, 0, '', 'blayneybowlingclub@bigpond.com', '0263682424', '', '', '0263683315', '', '', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.0833333333]],"5":[[0.4583333333,0.0833333333]],"6":[[0.375,0.0833333333]],"0":[[0.375,0.875]]}', 'https://www.facebook.com/blayneybsc', '', '', '', '', '', ''),
  (109254, 'yarra-bay-sailing-club-109254', 'Yarra Bay Sailing Club', '', 'Yarra Bay Sailing Club provides A La Carte Dining at Csalt on the beach Restaurant and Bistro, Licensed Club facilities and a spacious Auditorium.', 276628, '2016-04-27 06:52:00', '2016-04-27 06:55:50', '', 191, 359, 'sailing club', 276628, 0, 'Yarra Road', 'yarrabay@tpg.com.au', '0293112592', '', '', '0296618545', 'http://www.yarrabaysailingclub.com.au/', 'Welcome to Yarra Bay Sailing Club, located on the historic shores of Botany Bay. Our fully licensed club directly overlooks Yarra Bay and is only a 10 minute drive from Sydney International Airport and 5 minutes from Eastern Suburbs Memorial Park. As a community club, we are focused on delivering reliable, friendly service to our members and guests.\n\nOur many facilities include our 180 seat Auditorium, the refurbished 100 seat Restaurant and The Beach Bar, all of which are ideal for functions. Our musical entertainment is very popular on Sunday afternoons, in the Beach Bar during summer (weather permitting) and in the Lounge Bar at other times.\n\nSurrounded by natural wonders, Yarra Bay Sailing Club is open 7 days a week, with ample car and bus parking available.\n\nThe Courtesy Bus service is available Thursday to Sunday.\n\nThe Club has the usual club facilities - TAB and Sky Channel, Keno, Fox Sports as well as trivia, meat and seafood raffles and frequent entertainment.', 'A', '{"1":[[0.5,0.7916666667]],"2":[[0.5,0.7916666667]],"3":[[0.5,0.7916666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/yarrabaysail', '', 'https://www.linkedin.com/company/yarra-bay-sailing-club', '', '', '', 'https://plus.google.com/117453183975176109470/about'),
  (109255, 'canberra-southern-cross-club-109255', 'Canberra Southern Cross Club', '', 'Canberra Southern Cross Club located in Philip has a range of affordable packages and experienced event managers at your services.', 276640, '2016-04-27 06:56:21', '2016-04-27 06:58:15', '', 191, 357, 'social club', 276640, 0, '', 'marketing@cscc.com.au', '0262837200', '', '', '', 'http://www.cscc.com.au/', 'Canberra Southern Cross Club is a not for profit organisation which opened it’s doors in August 1972. Over the past decade the Club has contributed over $13 million to the Canberra community across a multitude of organisations. We have a proud history of providing grants in excess of the required community contribution amount. In 2013/14 financial year we will provide 350 sporting clubs, social clubs and community groups $1.45 million in funding.\n\nWe employ 550 staff, have approximately 85,000 members and currently have four hospitality venues, five gymnasiums, two basketball stadiums and a Ferry, the MV Southern Cross. \n\nDINING AND DRINKS\n  Dine in style with friends and family and enjoy quality meals at great prices at your Southern Cross Club. With so many menu choices and options available, you have discovered the destination for an unforgettable dining experience. From an intimate dinner for two at our award-winning restaurants, set-menus perfect for celebrating special occasions with friends, to family-friendly casual meals with children’s play areas.', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"4":[[0.375,0.6666666667]],"5":[[0.375,0.6666666667]],"6":[[0.375,0.6666666667]],"0":[[0.375,1]]}', 'https://www.facebook.com/CanberraSouthernCrossClub', 'https://twitter.com/CanberraSCC', '', '', '', 'https://www.pinterest.com/canbsouthcross/', 'https://plus.google.com/110954637125121242515/about'),
  (109257, 'seaforth-bowling-club-109257', 'Seaforth Bowling Club', '', 'Seaforth Bowling Club is a Friendly Bowling Club of the Northern Beaches providing activities in the form of lawn bowls as well as entertainment and friendship.', 276646, '2016-04-27 07:03:06', '2016-04-27 07:04:47', '', 191, 353, 'bowling club', 276646, 0, '', 'seaforthbowlingclub@bigpond.com', '0299481119', '', '', '', 'http://www.seaforth.bowls.com.au/', 'Seaforth Bowling Club is located in a quiet location just off Wakehurst Parkway and offers three high-standard grass greens with a total of 17-18 rinks.  No. 2 Green has lights for night play.  There is also a smaller synthetic surface green for kids.  Barefoot bowls is available upon request.\n\nOur large club-house has a full club liquor licence and no poker machines.  Facilities include a well equipped commercial kitchen, a BBQ and large hall to accommodate up to approximately 200 people.  The club-house is availalbe for hire.', 'A', '{"2":[[0.375,0.75]],"3":[[0.375,0.5833333333]],"4":[[0.375,0.75]],"5":[[0.625,0.75]],"6":[[0.375,0.75]]}', 'https://www.facebook.com/SeaforthBowlingClub/', '', '', '', '', '', 'https://plus.google.com/111152939839517570302/about'),
  (109259, 'turramurra-bowling-club-109259', 'Turramurra Bowling Club', '', '', 0, '2016-04-27 07:12:47', '2016-04-27 07:12:52', '', 191, 350, '', 0, 0, '', 'functionhires@clubturramurra.com.au', '0291442800', '', '', '', 'http://www.clubturramurra.com.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109260, 'captains-flat-rsl-109260', 'Captains Flat RSL', '', 'Captains Flat RSL located in Captains Flat  is a friendly club where you can enjoy a social game of bowls in an historic setting. The club hosts birthday parties, and even visits by motorcycle clubs.', 276662, '2016-04-27 07:27:02', '2016-04-27 07:28:09', '', 191, 344, 'rsl club\nbowling club', 276662, 0, '', '', '0262366284', '', '', '', 'http://www.captainsflat.org/', 'Captains Flat RSL is a small but friendly club, where you can enjoy a social game of bowls in an historic setting. The green and clubhouse were built by volunteer labour from 1947, with materials supplied by the Lake George Mining Company. The green is still maintained by club members.\n\nThe Bowling Club is affiliated with Bowls ACT and members regularly visit other clubs in the region. The club hosts birthday parties, learn to bowl days and even visits by motorcycle clubs. Social games are held on Sundays at 11:30 am.\n', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Captains-Flat-RSL-Club-222274181266772/', '', '', '', '', '', ''),
  (109261, 'northern-suburbs-rugby-football-club-109261', 'Northern Suburbs Rugby Football Club', '', 'Northern Suburbs Rugby Football Club is one of Sydney''s most historic rugby clubs competing in Sydney''s Premier Shute Shield Competition.', 276666, '2016-04-27 07:31:39', '2016-04-27 07:33:17', '', 191, 343, 'leagues club', 276666, 0, '', 'adam@northsrugby.com.au', '0285404390', '', '', '', 'http://northsrugby.com.au/', 'Northern Suburbs Rugby Football Club is a rugby union club in Sydney, Australia, that was formed in 1900 from the merger of the Pirates and Wallaroos clubs. The club competes in the Shute Shield competition run by the New South Wales Rugby Union. The club has produced 42 Wallaby representatives. The club''s home ground is the historic North Sydney Oval on the North Shore of Sydney. The ground has been a venue for both codes of rugby and for cricket over more than a century.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/northsrugby', 'https://twitter.com/NSRFC_AUS', '', '', '', '', 'https://plus.google.com/101505568011386217758/about'),
  (109262, 'cooma-ex-services-club-109262', 'Cooma Ex-Services Club', '', 'Cooma Ex-Services Club located in Cooma provide a wide range of facilities and services for members and guests including Keno, TAB, bistro, 2 snooker tables function rooms and many more.', 276670, '2016-04-27 07:48:37', '2016-04-27 07:51:09', '', 191, 341, 'social club', 276670, 0, '', 'reception@coomaexservices.com.au', '0264521144', '', '', '', 'http://www.coomaexservices.com.au/', 'Cooma Ex-Services Club is the largest club on the Monaro, one hour south of Canberra located at 106 Vale Street in the heart of Cooma, gateway to the beautiful Snowy Mountains.\n\nWhether entertaining family or colleagues, catching a quick bite or relaxing with the whole family, you will never be disappointed with our great facilities and fantastic service.\n\n\nThe Cooma Ex-Services Club is the ideal venue for a wide range of conferences and functions. Whether arranging functions for 5 delegates or 300, from seated conference to trade exhibitions, luncheons to corporate dinners, we have the facilities to cater for you.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.8958333333]]}', 'https://www.facebook.com/Cooma-Ex-Services-Club-140108902675943/info/?tab=overview', 'https://twitter.com/coomaexservos', '', '', '', '', 'https://plus.google.com/112745723749666820955/about?hl=en'),
  (109263, 'palm-beach-golf-club-109263', 'Palm Beach Golf Club', '', 'Palm Beach Golf Club  isn''t just about golf, we also offer variety range of services and facilities including function room, parties, weddings and wide array of other special events.', 276676, '2016-04-27 07:55:21', '2016-04-27 07:56:53', '', 191, 339, 'golf club', 276676, 0, '', 'manager@palmbeachgolf.com.au', '0299744079', '', '', '', 'http://www.palmbeachgolf.com.au/', 'Palm Beach Golf Club features an 9-Hole Golf Course. Only a fifty-minute drive from the CBD of Sydney, the club is nestled between Pittwater and Palm Beach, under the Barrenjoey Lighthouse.  \n\nPalm Beach Golf Club isn''t just about golf, we also offer a unique and memorable setting for both golfing and non-golfing events. We offer a function room that can host birthday parties, weddings, corporate functions, anniversary celebrations, fund raisers and a wide array of other special events.', 'A', '{"1":[[0.3333333333,0.75]],"2":[[0.3333333333,0.75]],"3":[[0.3333333333,0.75]],"4":[[0.3333333333,0.9166666667]],"5":[[0.3333333333,0.9166666667]],"6":[[0.3333333333,0.9166666667]],"0":[[0.3333333333,0.75]]}', 'https://www.facebook.com/PBGCNSW/', '', '', '', '', '', 'https://plus.google.com/101478714531195151650/posts'),
  (109264, 'putney-tennyson-bowling-and-community-club-109264', 'Putney Tennyson Bowling and Community Club', '', 'Putney Tennyson Bowling Club offers a great relaxed, family friendly venue for you to enjoy a day or night out together or pop in anytime to meet new friends.', 276684, '2016-04-27 08:08:35', '2016-04-27 08:10:56', '', 191, 335, 'bowling club', 276684, 0, '', 'putneybowls@bigpond.com', '0298074964', '', '', '', 'http://www.putneybowlingclub.com.au/', 'The Putney-Tennyson Bowling and Recreation Club was established in 1971 as an initiative of the Putney Progress Association.  The first President was Tom Hickey who had agitated within the Progress Association for the formation of such a club. \n\nThe Putney-Tennyson Bowling and Recreation Club is located in Frances Road, opposite Morrison Park.  While it has greens for the bowlers, it is very much a community club, hosting many meetings of service organisations including Lions and Probus and supporting many local sporting clubs and other local organisations', 'A', '{"1":[[0.6458333333,0.875]],"2":[[0.6458333333,0.8958333333]],"3":[[0.4583333333,0.8958333333]],"4":[[0.625,0.9166666667]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.5,0.9166666667]]}', 'https://www.facebook.com/Putney-Tennyson-Bowling-Community-Club-170048916363119/', '', '', '', '', '', 'https://www.google.com/maps/place/Putney+Tennyson+Bowling+and+Community+Club/@-33.827432,151.1106431,17z/data=!3m1!4b1!4m2!3m1!1s0x6b12a5095737140d:0xa0255c07e6b90d16?hl=en'),
  (109265, 'corporate-business-furniture-109265', 'Corporate Business Furniture', '', 'At Corporate Business Furniture, we provide an exclusive range of office chairs and office furniture.', 0, '2016-04-27 08:15:04', '2016-04-27 08:15:37', '20499293419', 717, 333, '', 0, 0, 'Hallam', 'webmaster@corporatebusinessfurniture.com.au', '1300668566', '', '', '', 'http://www.corporatebusinessfurniture.com.au/', 'At Corporate Business Furniture, we provide an exclusive range of office chairs and office furniture. With over two decades of experience in office furniture solutions, we have earned the admiration of all those associated with us worldwide. We believe in quality in everything we do, we satisfy our customers with our wide range of innovative and superior quality office products, value and services.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109266, 'the-roseville-club-109266', 'The Roseville Club', '', 'The Roseville Club is your family and local community club offering one of the most affordable venues on the North Shore for every need!', 276692, '2016-04-27 08:21:43', '2016-04-27 08:22:45', '', 191, 326, 'social club', 276692, 0, '', 'ruth@therosevilleclub.com.au', '0294196849', '', '', '', 'http://www.rosevillememorialclub.com/', 'The Roseville Club is close and convenient for local residents and friendly and welcoming to all. It offers a range of services and activities to members and their guests and supports your local community in various ways - from sponsorship of local sporting teams and other groups to hosting special fundraising events for non-profit organisations. In fact, the Club has in the past donated over $200,000 to these groups and charities and with your support, will continue to do so.\n\nThe Roseville Club boasts a 120 seat Bistro with a mouth-watering menu that includes delicious pasta dishes and delectable desserts along with traditional meals such as piping hot roasts, sizzling steaks and succulent seafood. The Parkview Bistro is now open for Lunch and Dinner from Monday through Saturday and for lunch every Sunday.\n\nOur feature Bar is kept fully-stocked with an array of wines, boutique and local beers, which you can enjoy indoors or sitting in our Outdoor Terrace overlooking leafy Roseville Memorial Park. You can also order top quality Espresso coffee by Caffe’ Molinari at the Bar, then savour that great cuppa while enjoying the picturesque Memorial Park as a backdrop.\n\nWe have a variety of Function Rooms available for hire at very competitive rates, each complete with plasma screens and presentation equipment.\n\nIn addition to our alfresco Gaming Area, the Club offers the only TAB in Roseville as well as Club Keno and SKY Racing TV facilities. Most major sporting events broadcast by Fox Sports can be viewed on our ‘Big Screen TV’.\n \n', 'A', '{"1":[[0.4791666667,0.9375]],"2":[[0.4791666667,0.9375]],"3":[[0.4791666667,0.9791666667]],"4":[[0.4791666667,0.9791666667]],"5":[[0.4791666667,0.9791666667]],"6":[[0.4791666667,0.9791666667]],"0":[[0.4791666667,0.75]]}', 'https://www.facebook.com/The-Roseville-Club-178997992113807/', '', '', '', '', '', 'https://plus.google.com/110747740751124352947/about'),
  (109267, 'karuah-district-golf-club-pty-ltd-109267', 'Karuah & District Golf Club Pty Ltd', '', '', 0, '2016-04-27 08:26:07', '2016-04-27 08:26:15', '', 191, 324, '', 0, 0, '', '', '0249975693', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109268, 'h-h-jewellery-109268', 'H&H Jewellery', '', 'H&H Jewellery is a supplier of high quality jewellery collections, including: engagement rings, wedding rings, necklaces, pendants, dress rings, bracelets, earrings and bangles in Melbourne,Australia.', 0, '2016-04-27 08:30:00', '2016-04-27 08:31:18', '99083595957', 718, 314, '', 0, 0, '', 'webmaster@hhjewellery.com.au', '0396502727', '', '', '', 'https://www.hhjewellery.com.au/', 'H&H Jewellery store was first established in 1996 by brothers-in-law, Chris and Harry – Chris has a number of years experience in jewellery making and design, whilst Harry has been in the business since childhood and is now   recognised as a Master Jeweller. Since their conception, these jewellers in Melbourne have expanded and now have three stores – one each in Elsternwick, South Yarra and on Collins Street in the CBD. They are known for the creation of truly unique and exceptional pieces, including: wedding and engagement rings, bracelets, necklaces, rings, pendants and watches.\n', 'A', '{"1":[[0.3958333333,0.7291666667]],"2":[[0.3958333333,0.7083333333]],"3":[[0.3958333333,0.7083333333]],"4":[[0.3958333333,0.7083333333]],"5":[[0.3958333333,0.75]],"6":[[0.3958333333,0.7291666667]],"0":[[0.4166666667,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109271, 'tuross-head-country-club-109271', 'Tuross Head Country Club', '', 'Tuross Head Country Club is located at Tuross Head and offer club facilities such as bar snacks, pay/sky tv, bistro that is open 7 days, outdoor deck and more.', 276713, '2016-04-27 22:57:29', '2016-04-27 22:58:53', '', 191, 298, 'social club', 276713, 0, '', 'enquiries@turossheadcountryclub.com.au', '0244738186', '0244738348', '', '', 'http://www.turossheadcountryclub.com.au/', 'Tuross Head Country Club is the perfect venue for your dream wedding on the NSW South Coast. The Club has elegant seating capacity upstairs for up to 150 guests or a casual BBQ setting for birthday parties downstairs. Our scenic reception venue has stunning panoramic views of the ocean and lake.\n\nTuross Head Country Club is on the NSW South Coast, located between Batemans Bay and Bega, only 2.5hours drive from Canberra, and 4.5hours drive from Sydney.\n\nTuross Head is such a beautiful location for weddings that many people select Tuross Head as their wedding destination.\n\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Tuross-Head-Country-Club-248096401900246', '', '', '', '', '', 'https://plus.google.com/113930596414483507660/about'),
  (109272, 'balmain-bowling-club-109272', 'Balmain Bowling Club', '', 'Balmain Bowling Club features modern facilities like barefoot bowling fields, spacious bar, gambling and restaurant facilities. Our function rooms is perfect for any occasions for you & your family.', 276719, '2016-04-27 23:01:38', '2016-04-27 23:02:30', '', 191, 294, 'bowling club', 276719, 0, '', 'balmainbowlingclub@hotmail.com', '0298101071', '', '', '', 'http://www.balmainbowls.com.au/', 'Balmain Bowling Club was established in the School of Arts in 1879, and was incorporated as BBC in 1880. It is the oldest continuously operating Bowling Club in New South Wales.Apart from the state, zone, and club bowling competitions, the club has seen the development of barefoot bowling, which is now very popular for social and corporate functions.\n\nThe club was extensively renovated in 2004 to provide a modern facility. The two-level floor area was converted to one level, and now provides easy access to the spacious bar, gambling, and restaurant facilities. In 2008 a large external deck was \nconstructed, providing much-needed open space.\n\nThe Balmain Bowling Club provides the location for the best barefoot bowls day for any occasion. Be it a birthday party, corporate function, Christmas party or bucks and hens days.\n\nCatering can be organized for on & off the green in the form of sharing platters, finger food, a bbq or set menus.\n\nOur restaurant is a unique open plan facility, which offers the perfect venue for such functions as weddings, birthday parties, prize presentations and corporate events. You can be assured that your special function will be a great success with our experienced team handling the arrangements.', 'A', '{"1":[[0.4583333333,0.9791666667]],"2":[[0.4583333333,0.9791666667]],"3":[[0.4583333333,0.9791666667]],"4":[[0.4583333333,0.9791666667]],"5":[[0.4583333333,0.9791666667]],"6":[[0.4583333333,0.9791666667]],"0":[[0.4583333333,0.9791666667]]}', 'https://www.facebook.com/Balmain-Bowling-Club-148756941864128/', 'https://twitter.com/balmainbowls', '', '', '', '', 'https://plus.google.com/112760661227854079598/about'),
  (109273, 'yass-bowling-club-ltd-109273', 'Yass Bowling Club Ltd', '', 'Yass Bowling Club Ltd is located at Yass and offer self-catering facilities with many options to suit your budget.', 276725, '2016-04-27 23:09:52', '2016-04-27 23:11:29', '', 191, 292, 'bowling club', 276725, 0, '', '', '0262261313', '', '', '', 'http://www.yass.bowls.com.au/', 'The Yass Bowling Club provides men''s, women''s, social and competitive tournaments for all ages. The family friendly Club catering to your function needs.\n\nYass Women’s Bowling Club\n\nSince the formation of the Yass Women’s Bowling Club in 1955, the women’s contribution has been of inestimable value – they have become an invaluable part of Club life both on and off the greens. Bowling –wise over the years some excellent bowlers have come through the ranks – this is still the case today and , of course off the greens, their efforts on the social side have always been first class. It has to be recorded here that in the early days and (when under the helm of Jess Keith) their contribution by way of catering for functions has been magnificent and had a tremendous effect in reducing overall club indebtedness.\n\n', 'A', '{"1":[[0.6666666667,0.8333333333]],"2":[[0.6666666667,0.8333333333]],"3":[[0.6666666667,0.8333333333]],"4":[[0.6666666667,0.8333333333]],"5":[[0.6666666667,0.9166666667]],"6":[[0.5,1]],"0":[[0.5,0.8333333333]]}', 'https://www.facebook.com/yassbowlingclub', '', '', '', '', '', ''),
  (109274, 'bayview-golf-club-109274', 'Bayview Golf Club', '', 'Bayview Golf Club located in Mona Vale provides the members with access to stylish locker rooms, a Members’ Bar with an elegant restaurant and a function room that holds 200 guests. ', 276731, '2016-04-27 23:10:42', '2016-04-27 23:15:33', '', 191, 290, 'golf club', 276731, 0, '', 'reception@bayviewgolfclub.com.au', '0299993786', '', '', '0299795806', 'http://www.bayviewgolfclub.com/', 'Bayview Golf Club is a picturesque private golf club with a relaxed atmosphere making it ideal for playing golf and  socialising. Our magnificent clubhouse along with land that is wholly owned by the club is located in Mona Vale nearby to Pittwater and Broken Bay.  The club offers 18 holes of pure sporting enjoyment among the rolling hills of the Peninsula.\n\nThe course’s tree-lined and undulating fairways are impressive and test the skills of most golfers. The lake, creeks and water hazards add to the challenge.\n\nIn February 2009 Bayview invested in a new $7.2 million state of the art clubhouse. This provides the members with access to stylish locker rooms, a Members’ Bar with an elegant restaurant and a function room that holds 200 guests. Parking for 110 cars is located under the complex with 36 parking areas right outside the front door.\n\nOur Golf Club has had a number of name changes over the years – Bayview Links, Bayview Country Club and Bayview Country Golf Links but in 1948 Bayview Golf Club Limited was formed and the Course and Clubhouse leased by the Members. It was not until 1967 that the Members raised funds and purchased the Course and Clubhouse from Mrs Orr.\n\nBayview offers under cover parking for your guests & also has a wonderful terrace area which you may use to conduct your wedding ceremony.', 'A', '{"1":[[0.375,0.7916666667]],"2":[[0.375,0.7916666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.7916666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.8333333333]],"0":[[0.375,0.8333333333]]}', 'https://www.facebook.com/Bayview-Golf-Club-169068979798645/', 'https://twitter.com/bayview_golf', '', '', '', '', ''),
  (109275, 'yowani-country-club-109275', 'Yowani Country Club', '', 'Yowani Country Club is located at Lyneham and has a seminar room holding up to 150 theatre style, or 100 seated at tables. The room can be partitioned off for smaller groups of executives.', 276739, '2016-04-27 23:17:56', '2016-04-27 23:21:15', '', 191, 288, 'sports club\nsocial club', 276739, 0, '', 'club@yowani.com.au', '0262413377', '', '', '0262418561', 'http://yowani.com.au/', 'Yowani Country Club is unique in Canberra, offering members and visitors a challenging 18 hole golf course, lawn bowling greens, motel unit accommodation, facilities for functions and conferences and a great restaurant.\n\nYowani Country Club offers 24 modern, self-contained motel units situated next to the Southwell Park sporting complex at the corner of the Federal and Barton highways in Canberra’s inner north.\n\nThe city centre is only 6 kms away along Northbourne Avenue, and the bustling Dickson shopping and restaurant precinct is just 1 km from our front door.\n\nIdeal for the corporate team building day and business meetings, Yowani Country Club has superb facilities at competitive prices. You might like to combine your meeting with a round of golf or bowls.\n\nThe Club has a seminar room holding up to 150 theatre style, or 100 seated at tables. The room can be partitioned off for smaller groups of executives. Microphone and whiteboard are provided and other equipment can be arranged on request.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/yowanicountryclub', '', '', '', '', '', ''),
  (109276, 'berowra-rsl-club-109276', 'Berowra RSL Club', '', 'Club Berowra is a welcoming, family-oriented Club catering for all your dining and entertainment needs. Featuring the best Bistro dining and private function rooms for any occasions.', 276745, '2016-04-27 23:25:04', '2016-04-27 23:28:17', '', 191, 286, 'rsl club', 276745, 0, '', 'reception@berowrarsl.com.au', '0294561844', '', '', '0294562028', 'http://www.berowrarsl.com.au/', 'Welcome to Berowra RSL Club\n\nClub Berowra is a welcoming, family-oriented Club catering for all your dining and entertainment needs.\n\nConveniently located on the Pacific Highway at Berowra (opposite the Railway Station and local bus services), we are a great location not only for residents of Berowra and adjacent suburbs but also as a mid-way point between Sydney and the Central Coast.\n\nWe have ample parking available at the side and rear of the building and also offer a Courtesy Bus service for members and their guests which operates within our 5km radius from Tuesday to Sunday. \n\nEnjoy a quiet drink and conversation in the upstairs Starlight Lounge Bar or on our airy Sky Deck, or choose the Ernie Foster Lounge/ Sports Bar for TAB, sports coverage and pool. Both indoor and outdoor gaming areas are also available.\n\nThe Club has the facilities to accommodate groups from 10 to 250+ people for occasions such as meetings, seminars, workshops, promotions, conferences, cocktail parties, engagements, weddings, farewells, and birthday parties. We are Berowra''s premier option for functions - and there are no room charges for private functions! \n\nYou''re always welcome at the friendliest Club in Hornsby Shire - Berowra RSL Club!\n\nWe are open seven days a week all year round with the exception of Christmas Day.\n\nWe have several entertainment areas catering for all your needs:\n•	Spacious dining room\n•	Children''s areas\n•	Two Bars \n•	TAB\n•	Keno\n•	Gaming Areas\n•	Pool tables \n•	Outdoor Smoking Areas\n•	Shaded Sky Deck', 'A', '{"1":[[0.4583333333,0.8333333333]],"2":[[0.4583333333,0.9375]],"3":[[0.4583333333,0.8958333333]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.0416666667]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.8958333333]]}', 'https://www.facebook.com/berowrarsl/', '', '', '', '', '', ''),
  (109277, 'albion-park-rsl-memorial-club-109277', 'Albion Park RSL Memorial Club', '', 'Albion Park RSL Memorial Club is located at Albion Park and have a range of function packages to suit every occasion and every size function, available for your perusal.', 276751, '2016-04-27 23:28:38', '2016-04-27 23:32:20', '', 191, 284, 'social club', 276751, 0, '', '', '0242561200', '', '', '', 'http://www.albionparkrsl.com.au/', 'Albion Park RSL Memorial Club located at Albion Park.\n\nAlbion Park RSL Memorial Club have a range of function packages to suit every occasion and every size function, available for your perusal. Simply call in and see our friendly office staff who will be only to willing to help you make your upcoming celebration something special. While you are here ask for your complimentary brochure pack. \n\nPlease note also that function rooms are not available on Friday nights.\n\n', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4166666667,1]]}', 'https://www.facebook.com/albionparkrslclub', '', '', '', '', '', ''),
  (109278, 'berkeley-sports-and-social-club-109278', 'Berkeley Sports and Social Club', '', 'Berkeley Sports and Social Club is located at Berkeley and offers a selection of two elegant rooms, overlooking the breathtaking foreshores of Lake Illawarra, Sails is the perfect place for any event.', 276755, '2016-04-27 23:52:47', '2016-04-27 23:54:25', '', 191, 282, 'sports club\nsocial club', 276755, 0, '', 'berkeleyinfo@eastsgroup.com.au', '0242607000', '', '', '0242607009', 'http://www.berkeleysports.com.au/', 'Welcome to Easts Berkeley.\n\nOverlooking the picturesque surroundings of Lake Illawarra, Berkeley Sports Club offers a range of exciting facilities for its members and their guests including The Terrace Bar & Grill, The Cafe, TAB facilities, bars, bowling greens and tennis courts. \n\nBerkeley Sports Club also offers 3 unique function rooms ranging in size and style to cater for any special event. \n\nBerkeley Sports and Social Club offering a selection of two elegant rooms, overlooking the breathtaking foreshores of Lake Illawarra, Sails is the perfect place for any event, from birthdays to weddings and more! \n\nChoose from either the Lake Terrace or Robert Jenkins Room and select from sit down, buffet and cocktail menus catering for 30-120 people. ', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0833333333]],"4":[[0.4166666667,0.125]],"5":[[0.4166666667,0.125]],"6":[[0.4166666667,0.125]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/berkeleysportsclub', '', '', '', '', '', '');
