  (109279, 'bulli-workers-club-ltd-109279', 'Bulli Workers Club Ltd', '', 'Bulli Workers Club Ltd is located at Bulli and offer perfect venue for Christmas Parties, Presentation Dinners, Reunions, Conferences, Celebrations, Engagements, Birthdays or that special occasion.', 276761, '2016-04-28 00:05:14', '2016-04-28 00:09:07', '', 191, 281, 'social club', 276761, 0, '', 'sandra@bulliwc.com.au', '0242843379', '', '', '0242843889', 'http://www.bulliwc.com.au/', 'Welcome to Bulli Workers Club. \n\nSituated in the heart of Bulli and close to public transport, with its relaxing atmosphere The Workers Club is perfect for meeting up with new and old friends.\n\nWhy not drop in and enjoy a drink, dine in the Opals Restaurant or enjoy any of the other fun club activities.\n\n\nThe perfect venue for Christmas Parties, Presentation Dinners, Reunions, Conferences, Celebrations, Engagements, Birthdays or that special occasion. From large to small private functions we make your event the success it deserves.\n\nBulli Workers Club Ltd have two function rooms available, with the largest catered for up to 200 guests. The main function room has full toilet and disabled facilities, the room is connected to the kitchen for food service.\n\nBulli Workers Club Ltd have an excellent range of menus to choose from or menus designed to suit your budget. Menus can be obtained by contacting the Opals Restaurant.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9583333333]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/bulliworkers', '', '', '', '', '', 'https://plus.google.com/102671421580196560305/about'),
  (109280, 'the-chatswood-club-109280', 'The Chatswood Club', '', 'The Chatswood Club is your local registered club located right in the heart of Chatswood’s thriving business district. Features bar with selection of drinks and a restaurant perfect for work lunchout.', 276765, '2016-04-28 00:24:05', '2016-04-28 00:27:31', '', 191, 277, 'social club', 276765, 0, '', 'admin@chatswoodclub.com.au', '0294195481', '', '', '0294131973', 'http://www.chatswoodclub.com.au/', 'The Chatswood Club is your local registered club located right in the heart of Chatswood’s thriving business district. We have a great bar with a wide selection of drinks at competitive prices, a fantastic restaurant (perfect for the work lunch breaks), weekly promotions & a versatile function room.\n\n Above The Chatswood Club is the perfect venue for your next event. Whether it is a corporate or private function including, Weddings, 21st Birthdays, Reunions, Cocktail Parties, Sporting Events, Conferences, Sales Meetings, Product Launches or PR Functions, Level One is the place for your event. \n\nEach week The Chatswood Club is host to some great promotions Happy Hours, plus heaps more!!\n\nCome in and see what’s on today! ', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,1]],"6":[[0.5416666667,0.9166666667]],"0":[[0.625,0.9166666667]]}', 'https://www.facebook.com/ChatswoodClub/', 'https://twitter.com/chatswoodclub', 'https://www.linkedin.com/company/chatswood-club-ltd-', '', '', '', ''),
  (109281, 'coledale-r-s-l-club-109281', 'Coledale R.S.L. Club', '', 'Coledale R.S.L. Club is located at Coledale and has several entertainment areas catering for all your needs: spacious dining room, children''s areas, TAB, Keno, gaming areas and more.', 276771, '2016-04-28 00:29:28', '2016-04-28 00:30:49', '', 191, 275, 'rsl club', 276771, 0, '', 'coledalersl@bigpond.com.au', '0242671873', '', '', '', 'http://www.coledalersl.com.au/', 'Coledale RSL Club is the perfect spot to celebrate your special event by the beach – we have a dedicated hall and small stage, adjoining outdoor areas, the best bistro in the Northern Illawarra and quick access to public transport. Send us your information and we will stay in touch regarding availability and rates.\n\nColedale R.S.L. Club offers great food, ice cold beer on tap, raffles, live music, carpet bowls and TAB, and Functions for members and their guests.\n\nColedale RSL has several entertainment areas catering for all your needs: spacious dining room, children''s areas, TAB, Keno, gaming areas, pool table and outdoor smoking areas.', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/coledalerslclub', '', '', '', '', '', ''),
  (109282, 'canowindra-services-citizens-club-109282', 'Canowindra Services & Citizens Club', '', '', 0, '2016-04-28 00:30:22', '2016-04-28 00:31:00', '', 191, 273, 'rsl club', 0, 0, '', 'canowindraservices@bigpond.com', '0263441397', '', '', '0263441150', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109283, 'cheltenham-recreation-club-109283', 'Cheltenham Recreation Club', '', 'The Cheltenham Recreation Club features facilities such as tennis courts, bowling greens, croquet lawns and a clubhouse which is available for hire with function room, caterer, bar, kitchen & shower.', 276777, '2016-04-28 00:33:52', '2016-04-28 00:35:46', '', 191, 271, 'sports club\nsocial club', 276777, 0, '', 'crcltd@bigpond.com', '0298762629', '', '', '', 'http://www.crcl.org.au/', 'The Cheltenham Recreation Club Ltd\nThe Cheltenham Recreation Club is located in the attractive garden suburb of Cheltenham - 3 minutes walk from Cheltenham Railway Station. There are approximately 400 members who participate in tennis, croquet, bridge and bowls, or socially as House Members of the Club. If you ask current members what they like about the club, they''ll talk about the friends they''ve made, the setting, and the peaceful atmosphere.\n\nFacilities\nThe Club has:\n•  6 mod-grass tennis courts\n– incl. 2 with lights\n•  2 bowling greens\n•  2 croquet lawns\n•  clubhouse available for hire with function room, caterer, bar, kitchen, shower\n•  ample on site parking', 'A', '{"3":[[0.6458333333,0.7916666667]],"5":[[0.6458333333,0.8541666667]],"6":[[0.5,0.7916666667]]}', 'https://www.facebook.com/cheltenhamrec/', '', '', '', '', '', ''),
  (109285, 'the-beach-club-collaroy-109285', 'The Beach Club Collaroy', '', 'The Beach Club Collaroy, located literally overlooking the beach at Collaroy, is one of the best kept secrets on Sydney''s Northern Beaches. Features Waterfront bars and dining with live entertainment.', 276793, '2016-04-28 00:44:37', '2016-04-28 00:46:21', '', 191, 262, '', 276793, 0, '', 'reception@thebeachclub.com.au', '0299715355', '0299715195', '', '', 'http://www.thebeachclub.com.au/', 'Collaroy Services Beach Club was formed by the members of the Collaroy Sub Branch of the Returned Services League of Australia in 1963. The Beach Club, as it is known today, is located within heritage listed Arlington Hall on Sydney’s Northern Beaches and its stunning location right on Collaroy Beach provides patrons with incredible views over the Pacific Ocean stretching from the Central Coast to Long Reef. \n \nThe founders of the club transferred the property and rights to the Collaroy Services Beach Club whilst still allowing the Sub Branch to hold its meetings and social activities in the premises. Recently, many younger families have moved into the area attracted to the Northern Beaches’ relaxed and healthy seaside lifestyle close to Sydney. \n \nFundamental Objective: To plan for the future viability of the club whilst being mindful of the uniqueness of the club and its membership. The board recognise:\n\n•  Importance of directors and staff collaborating to take a hands-on role at community events\n•  A strong link between healthy, outdoor activity and good civic behaviour in young people\n•  Importance of establishing a recognised and branded partnership between community events and the club\n•  Capitalising on the club’s unique location and\n•  Taking an entrepreneurial approach to community events.\n \nMembers and guests enjoy spectacular views in comfort and safety. The club boasts a lift, new furniture, contemporary interior design and a choice of 24 beers on tap and a range of premium wines and cocktails. Since the club has completed a number of refurbishments since 2010, membership has swelled to over 10,000 people. \n \nWhat club members appreciate most, however, are the wonderful smiles and top-notch customer service from a talented team of managers and staff. ', 'A', '{"1":[[0.4166666667,1]],"2":[[0.4166666667,1]],"3":[[0.4166666667,1]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.3333333333,0.9166666667]]}', 'https://www.facebook.com/thebeachclub58', 'https://twitter.com/thebeachclub58', '', '', '', '', 'https://plus.google.com/117853634730347870383/about'),
  (109287, 'dalmacija-sydney-109287', 'Dalmacija Sydney', '', 'Dalmacija Sydney brings to you that all important home cooked experience with our mouth-watering cuisines from the southern coastline of Croatia – ‘Dalmacija’. ', 276815, '2016-04-28 00:56:41', '2016-04-28 01:01:47', '', 191, 251, 'social club', 276815, 0, '', 'info@dalmacijasydney.com.au', '0294501807', '', '', '0294501490', 'http://www.dalmacijasydney.com.au/', 'Welcome to Dalmacija Sydney\n\nA Touch of Dalmacija….come and experience the warmth and friendly service of ‘Dalmacija Sydney’ as we bring to you that all important home cooked experience with our mouth-watering cuisines from the southern coastline of Croatia – ‘Dalmacija’.\n \nDalmacija Sydney – Great Food with Great Service\n\nFunctions & Venue Hire\n\nEvents at Dalmacija Sydney\nDalmacija Sydney has a range of event space to suit every requirement, from a small party setting, to something more intimate such as a day conference for 100 attendees, or a large scale show in our 2 level Auditorium, for over 500.\n \nWith natural light, built in state of the art audio visual equipment and flexible floor plans, our variety in accommodating venues will certainly meet your needs. The layout allows one large event space or a series of meetings to be held concurrently.\n \nThe size of the venues provides an ideal setting for morning and afternoon tea, stand up conference luncheons and pre-dinner drinks, all in the one area.\n \nWith over 150 complimentary car parking spaces available for your guests to utilise when attending your event your next event at Dalmacija Sydney will be effortless.\n \nOur experienced, professional and dedicated events team will help manage your event and ensure your day is a complete success.\n•  Weddings\n•  Formals\n•  Christenings\n•  Birthday parties\n•  Corporate events\n•  Christmas parties\n\n', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.375,0.9166666667]],"5":[[0.375,0.9166666667]],"6":[[0.375,0.9166666667]],"0":[[0.375,0.9166666667]]}', 'https://www.facebook.com/Dalmacija-Sydney-Croatian-Club-164200593626810/', '', 'https://www.linkedin.com/company/dalmacija-sydney-croatian-club', '', '', '', ''),
  (109290, 'gerroa-boat-fisherman-s-club-109290', 'Gerroa Boat Fisherman''s Club', '', 'Gerroa Boat Fisherman''s Club is located at Gerroa and cater for all types of events, including weddings, birthdays, conferences and Christenings.', 276845, '2016-04-28 01:10:31', '2016-04-28 01:14:36', '', 191, 237, 'golf club\nsocial club', 276845, 0, '', 'info@gerroafishos.com.au', '0242341004', '', '', '0242340699', 'http://gerroafishos.com.au/', 'Situated on the South Coast’s most spectacular beach at Gerroa, the Gerroa Boat Fisherman’s Club boasts fantastic food, drinks and entertainment. Just two hours south of Sydney, the Fishos club is the perfect place for Sunday lunch, drinks after work or a great night out.\n\nThe modern club features a new expanded Seahorse Restaurant dining area, where guests of all ages can dine in air conditioned comfort. The restaurant is open for lunch and dinner, seven days a week. Full bar facilities are available, and our courtesy bus service can take you from your home or accommodation to the club for a great night, without the worry of drink driving or parking.\n\nAt the Fisho’s, we aim to cater for all types of events, including weddings, birthdays, conferences and Christenings. We have a range of packages available to suit all budgets, and style of function.\n\nOur ‘Panorama Room‘ overlooks beautiful Seven Mile Beach, with views to Point Perpendicular and Coolangatta Mountain.\nThe room seats up to 140 people seated, or 170 for cocktail style reception.\nPlease find below the Fisho’s Wedding Package for your perusal.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/gerroafishos', '', '', '', '', '', 'https://plus.google.com/117520052878754432661/about'),
  (109293, 'cumnock-bowling-club-109293', 'Cumnock Bowling Club', '', '', 276847, '2016-04-28 01:18:24', '2016-04-28 01:18:50', '', 191, 235, 'bowling club', 276847, 0, '', '', '0263677303', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/teamcumnockbc', '', '', '', '', ''),
  (109295, 'gladesville-bowling-sports-club-109295', 'Gladesville Bowling & Sports Club', '', 'Gladesville Bowling & Sports Club features the best in corporate lawn bowls, private parties and sports entertainment, situated in the heart of Gladesville.', 276857, '2016-04-28 01:30:08', '2016-04-28 01:32:41', '', 191, 228, 'sports club\nsocial club', 276857, 0, '', 'gbsc@bigpond.net.au', '0298174601', '', '', '0298171940', 'http://www.gladesvillesporties.com.au/', 'Welcome to Gladesville Bowling & Sports Club\n\nThe Lawn Bowls and Sports club has been actively improving facilities over the last few years and attracts members and guest who enjoy superb dining and the best sports entertainment at club prices.  Located just 10km from Sydney CBD we offer the best in corporate lawn bowls, private parties and sports entertainment.\n\nOur Men''s and Ladies'' Lawn bowls, snooker and golf clubs provide fun activities for members and their guests. The friendly and relaxed atmosphere ensures that every visit to the Gladesville Sporties is enjoyable. We hope to see you in the club soon!\n \nThe Function Auditorium caters for 200 people and is ideal for corporate functions and private parties.  This function room has a stage, dance floor and a private bar.   Audio visual equipement and catering is available on request. \n\nSports Bar:\nIn the Sports Bar you can watch all Grand Finals, Rugby, AFL, cricket, boxing, motorsports, soccer and other interesting sports. We screen all major sports events as available on Fox, Sky and the regular channels. Popular with members and guests the Sports Bar is a great place to enjoy your favourite sports.\n\nGladesville TAB:\nGladesville Sporties TAB boasts a mammoth TV wall containing 16 TVs with the latest, up to the minute information on all that Sports TAB has to offer. We are the first Club in the area to display all racing information on FLEXICAST. There are two large Sky channel screens to watch the races.   Check out the latest prices, last minute scratchings and results on the FLEXICAST screens.   Betting is available on horse racing, greyhound dogs, TAB sports betting and more.  Place your bets at The Gladesville Sporties TAB, grab a drink, watch the race or the game in the Sports Bar then collect your winnings.\n\nSnooker and Games Room:\nThe Snooker and Games Room facilitates two full size snooker tables and a regular size pool table, all are free to use for our members and their guests. ', 'A', '{"1":[[0.4583333333,0.9583333333]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,0.9583333333]],"6":[[0.4583333333,0.9583333333]],"0":[[0.4583333333,0.9583333333]]}', 'https://www.facebook.com/gladesvillesporties', '', '', '', '', '', 'https://plus.google.com/101686457545267458875/about'),
  (109297, 'forbes-sports-recreation-club-109297', 'Forbes Sports & Recreation Club', '', 'Forbes Sports & Recreation Club located in Forbes provide its guests and members a wide range of services and facilities including social bowls, competitions and tournaments, function areas and more.', 276875, '2016-04-28 01:38:59', '2016-04-28 01:41:41', '', 191, 220, 'sports club', 276875, 0, '', '', '0268521499', '', '', '', 'http://www.forbesbowlingclub.com.au/', 'The Forbes Sports and Recreation Club is a friendly, community-oriented club located beside the picturesque Lake Forbes.\n\nCome in and enjoy our excellent facilities which include three bowling greens, croquet, bar, pool table and bistro. \n\nWheelchair access to all areas of the club, along with ample street parking - including 2 designated disabled parking spaces - makes our club a welcoming place for all.\n\nEnjoy a game of lawn bowls or croquet.\n\nOur two function areas are available to cater for your special occasion, whether it be a wedding reception, work event, reunion or party.\n\nEnjoy a relaxed drink from the bar while enjoying our pool table and TAB facilities.\n\nVisitors are most welcome.', 'A', '{"1":[[0.5,0.9166666667]],"2":[[0.5,0.9166666667]],"3":[[0.375,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4583333333,0.0416666667]],"6":[[0.4583333333,0.0416666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Forbessportandrec/', '', '', '', '', '', ''),
  (109300, 'kembla-heights-bowling-and-recreation-club-109300', 'Kembla Heights Bowling and Recreation Club', '', 'Kembla Heights Bowling and Recreation Club is located at Kembla Heights and enjoy the fresh mountain air and scenic views, enjoy a game of bowls and more.', 276893, '2016-04-28 01:49:30', '2016-04-28 02:02:58', '', 191, 207, 'bowling club\nsocial club', 276893, 0, '', 'kemblaheightsbowlingclub@mail.com', '0242711265', '', '', '', 'http://www.kemblaheights.bowls.com.au/', 'Welcome to the Kembla Heights Bowling and Recreation Club\n\nKembla Heights Bowling and Recreation Club is a little club that will knock your socks off.  Nestled in the foothills of Mount Kembla, our club is a santuary away from the hustle and bustle, proving amazing mountain views and the friendliest people in the world.\n\nKembla Heights Bowing and Recreation Club is a friendly welcoming club nestled on the slopes of the Illawarra escarpment. Built by local coal miners and their families in the 1950''s, it continues to this day a proud sporting tradition. ''Kembla Bowlo'' is a family friendly community club. We seek to service the community and visitors alike with good old-fashioned hospitality and to partner with other community groups to strengthen the community spirit that is already strong in the village. We look forward to seeing you soon at the ''Kembla Bowlo''.\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Kembla-Heights-Bowling-and-Recreation-Club-180856828718586', 'https://twitter.com/kemblaheightsbc', '', '', '', '', ''),
  (109302, 'heaton-birmingham-gardens-bowling-club-109302', 'Heaton Birmingham Gardens Bowling Club', '', '', 0, '2016-04-28 02:02:42', '2016-04-28 02:02:46', '', 191, 209, '', 0, 0, '', 'info@thebowlo.com.au', '0249558725', '', '', '', 'http://thebowlo.com.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109305, 'katoomba-golf-club-109305', 'Katoomba Golf Club', '', 'Katoomba Golf Club located in Katoomba  provides its guests and members a wide range of services and facilities including pro shop, golf tutorials, restaurant, function area, accommodation and more.', 0, '2016-04-28 02:26:32', '2016-04-28 02:33:31', '', 191, 197, 'golf club', 0, 0, '', '', '0247822000', '', '', '0247823522', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109307, 'jindabyne-bowling-sports-club-109307', 'Jindabyne Bowling & Sports Club', '', 'Jindabyne Bowling & Sports Club located in Jindabyne provides members and guests facilities including lawn bowling green, two tennis courts, four squash courts, full bar and bistro and many more.', 276921, '2016-04-28 02:31:56', '2016-04-28 02:34:05', '', 191, 195, 'bowling club\nsports club', 276921, 0, '', 'jbc@exemail.com.au', '0264562133', '', '', '0264561014', 'http://jindabynebowlingclub.com.au/', 'Jindabyne Bowling & Sports Club is situated on the shores of beautiful Lake Jindabyne, approx 35kms from the 2 major ski resorts of Thredbo and Perisher. \n\nEnjoy the facilities of a lawn bowling green, two tennis courts, four squash courts, full bar and bistro all blessed with spectacular views over Banjo Patterson Park and Lake Jindabyne towards the Snowy Mountains.\n\nCome and enjoy our immaculately manicured green and join one of our social games. During the summer enter a team in the Wednesday afternoon business house bowls or see just what the Friday ‘Roast Run’ is all about.\nOur friendly staff are there to welcome you with a smile.\n\nThe Bowlo Bistro is arguably the best value family dining in the Snowy’s from steaks to seafood to Bistro favorites, all meals are freshly cooked and all dinner main meals come with our famous Salad and Veg buffet.\nThere’s something for everyone at the Jindabyne Bowling & Sports Club.\n\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', ''),
  (109308, 'nowra-bowling-recreation-club-109308', 'Nowra Bowling & Recreation Club', '', 'Nowra Bowling & Recreation Club is located at Nowra and offers an extensive array of dinning or takeaway Chinese and Thai dishes to satisfy even the fussiest eaters.', 276931, '2016-04-28 02:38:45', '2016-04-28 02:43:41', '', 191, 192, 'bowling club\nsocial club', 276931, 0, '', 'nowrabowls@internode.on.net', '0244212100', '', '', '0244218284', 'http://www.nowrabowls.com.au/', 'Nowra Bowling Club & Recreation Club was officially formed in 1914, but there has been some speculation that there was weather reports dating back to the 1890’s recorded at the Club, although this can’t be proven today.\n\nIn the early days of the Club, membership was restricted to gentlemen from local businesses and those persons thought to be of the “right” character or community leaders. Thankfully those attitudes have changed over the years and today our club enjoys the benefits of a wide ranging and diverse membership and the club now boasts over 3,000 members.\n\nOver the last 10 years, the Club has undergone several major renovations to update and improve the facilities offered to members and their guests. The Club now contains a new outdoor pavilion, larger poker machine area and modern dining facilities to name a few.\n\nThe Nowra Bowling & Recreation Club is the place to come to for the best Chinese food in the Shoalhaven, with friendly staff and a convenient location.  So why not come to our great little club on the South Coast, known locally at the club where you are “more than just a membership number”.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Nowra-Bowling-Recreation-Club-289312897802876', '', '', '', '', '', ''),
  (109311, 'merimbula-rsl-club-109311', 'Merimbula RSL Club', '', 'Merimbula RSL Club located in Merimbula is a relaxed coastal friendly environment with great affordable bottleshop, dining, bar and entertainment.', 276951, '2016-04-28 02:48:23', '2016-04-28 02:49:59', '', 191, 185, 'rsl club', 276951, 0, '', 'enquiries@merimbularsl.com.au', '0264951502', '', '', '0264953602', 'http://merimbularsl.com.au/rsl/', 'Merimbula RSL Club was opened in 1977 with further extensions in 2002. Our club renovations have given our members and guests more space, more comfort and more areas to appreciate the magnificient views of Merimbula and the waterways. The latest renovations are now finished and include a magnificient terrace, added space in the poker machine area, another function room, Terrace bar and extended kitchen.\n\nMerimbula RSL has seen a period of rapid growth over the past few years. These changes have seen membership increase, employment of staff increase along with the gaming machines expanded. While this growth has been significant and rapid, it has not been without the hard work and contribution of staff.\n\nWe provide services to veterans such as: pensions and welfare matters in conjunction with Dept. of Veterans Affairs; advocacy services in conjunction with Veterans Review Board; funeral services and assistance; school visits by veterans; hospital and home visitation services; home help, personal care, garden and maintenance, community transport and in-home respite care (in conjunction with Dept. of Vet Affairs); fundraising for our own veterans’ distress fund.\n\nWhat we offer \n\n• A relaxed coastal friendly environment\n• Affordable delicious family dining at the coral restaurant \n• Great bar bottleshop and gaming area\n• Stunning views over Merimbula Lake \n• Great member benefits and promotios\n• Events, functions, conferences, to suit any occasion\n• Great entertainment and live shows ', 'A', '{"1":[[0.4166666667,0.9583333333]],"2":[[0.3958333333,0.9583333333]],"3":[[0.4166666667,0.9583333333]],"4":[[0.3958333333,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4583333333,0.9583333333]]}', 'https://www.facebook.com/merimbula.rsl', 'https://twitter.com/merimbularsl', '', '', '', '', 'https://plus.google.com/109238615463276020020/about'),
  (109315, 'dungog-memorial-rsl-club-109315', 'Dungog Memorial RSL Club', '', '', 0, '2016-04-28 03:03:44', '2016-04-28 03:03:48', '', 191, 175, '', 0, 0, '', 'dunrsl@bravo.net.au', '0249923140', '', '', '', 'http://www.dungogrsl.com.au/', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109317, 'lithgow-golf-club-109317', 'Lithgow Golf Club', '', 'Lithgow Golf Club located in Marrangaroo provide its guests and members and wide range of services and facilities including function areas, pro shop, club house, junior golf, social golf and more.', 276983, '2016-04-28 03:07:36', '2016-04-28 03:15:54', '', 191, 164, 'golf club', 276983, 0, '', 'lithgowgolfclub@bigpond.com', '0263513164', '0263523422', '', '', 'http://www.lithgowgolfclub.com.au/', 'Lithgow Golf Club offers a 72 par grass green course & the perfect, picturesque setting for that special function.\n\nThe Clubhouse is a lovely federation homestead, built in the 1850''s, and great care has been taken to keep it true in character, set amongst meticulous grounds. This once grand home has been carefully converted to a working clubhouse, incorporating a function room, a pro-shop, a balcony area for the post mortem of the game and of course the all important 19th hole.\n\nThe bar area has been renovated to suit the style of the house, and a snack bar operates most golf days, offering a selection of good value dishes. The pro-shop, packed with everything you could need, has recently moved upstairs, which brings everything now, under the one roof.\n\nCome enjoy a round of golf, or relax at the clubhouse and enjoy the views and friendly atmosphere soon, at the Lithgow Golf Club.\n\nThe Lithgow Golf Club is the perfect, picturesque setting for that special function.\n\nThe Federation style clubhouse set amongst the quiet, rural location is the ideal venue for any function, from wedding receptions to Christmas events or even a family reunion. The newly renovated function room, complete with balcony area, overlooking the magnificent views of the course, is perfect to host functions for groups of 40 to 140 guests.\n\nLithgow Golf Club is also proud to offer renowned chef, James Barnes, to cater for all large functions. James will be sure to tempt you with his many dishes and plan a menu that adds a special touch to your function.\n\nThe Golf Club is a popular function centre, and weddings are our specialty. Many couples have chosen to make it their one-stop wedding venue, getting married on the course, with endless opportunities for beautiful photos, and then back to the romantic federation-style clubhouse for the reception, with pre dinner drinks on the balcony.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Lithgow-Golf-Club-130271540356306/', 'https://twitter.com/lithgowgolf', 'https://www.linkedin.com/company/lithgow-golf-club', '', '', '', 'https://plus.google.com/104046613106953610345/about'),
  (109319, 'boolaroo-bowling-club-109319', 'Boolaroo Bowling Club', '', 'Boolaroo Bowling Club is a registered club with 2 greens offering social and competition Bowls events, Dining at Koala Kitchen and friendly staff.', 276997, '2016-04-28 03:16:42', '2016-04-28 03:18:55', '', 191, 158, 'bowling club', 276997, 0, '', 'boolaroobc@optusnet.com.au', '0249581058', '', '', '', 'http://boolaroobowling.com/', 'Boolaroo Bowling Club is proud to be the first Bowling Club in Lake Macquarie established in 1927, still serving it''s members and guests with quality and friendly service to this day.\n\nBoolaroo Bowling Club is a registered club with licensed facilities and offers it''s members and guests ;\n\n- Two bowling greens, \n- a Croquette field, \n- Dining at Michael''s Kitchen\n\nEnjoy a social game of Bowls or for the serious Bowler join a team and compete in local and district events to represent your area and club.\n\nThe club also offers casual events weekly and monthly such as Meat raffles and trivia nights.', 'A', '{"1":[[1,0.7916666667]],"2":[[1,0.8333333333]],"3":[[1,0.8333333333]],"4":[[0.375,0.8333333333]],"5":[[1,0.875]],"6":[[1,0.8333333333]],"0":[[1,0.875]]}', 'https://www.facebook.com/boolaroobowlingclub', '', '', '', '', '', 'https://www.google.com/maps/place/Boolaroo+Bowling+Club/@-32.9569091,151.6180392,17z/data=!3m1!4b1!4m2!3m1!1s0x6b733c645e165b5b:0xcb7987a702673822?hl=en'),
  (109321, 'burwood-colliery-bowling-club-109321', 'Burwood Colliery Bowling Club', '', '', 0, '2016-04-28 03:21:03', '2016-04-28 03:21:25', '', 191, 152, '', 0, 0, '', '', '0249447146', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109322, 'carrington-bowling-club-109322', 'Carrington Bowling Club', '', '', 0, '2016-04-28 03:23:27', '2016-04-28 03:23:30', '', 191, 150, '', 0, 0, '', '', '0249614140', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109324, 'picton-bowling-club-109324', 'Picton Bowling Club', '', 'Picton Bowling Club located in Picton provides members and guests facilities including sports bar, bistro & brasserie, live entertainment, function rooms, lawn bowling facilities and many more.', 277007, '2016-04-28 03:38:04', '2016-04-28 03:39:50', '', 191, 146, 'bowling club', 277007, 0, '', 'info@pictonbowlingclub.com.au', '0246771578', '', '', '0246771613', 'http://pictonbowlingclub.com.au/', 'Picton Bowling Club is situated in the historic town of Picton, which nestles in a picturesque valley in the Wollondilly Shire approximately 80kms south west of Sydney.\n\nWe pride ourselves on providing a truly enjoyable club venue that offers exceptional value and our experienced staff always strive to serve and satisfy our many Wollondilly Shire members and our guests and members from other areas.\n\nFeaturing a main lounge, the Trevor Davis Sports Bar, a bistro and brasserie, live entertainment, well appointed function rooms and, of course, our top notch lawn bowl facilities, Picton Bowling Club offers the quintessential club experience that has something for everyone.\nWe also provide our members with a FREE Courtesy Bus running every Friday night.\n\nA popular venue with all who visit us, we invite you to come along, enjoy our club and see what everyone is talking about.\n\nDining\nBrasserie - From superb steaks to choice chicken, sumptuous seafood and much more, Picton Bowling Club’s fine Brasserie offers a wide range of delicious dishes for lunch and dinner, seven days a week.\n\nEntertainment\nLive Entertainment - Even if you’re not bowling, you’ll still have a ball at Picton Bowling Club. With a great range of entertainment and events every week, there’s always something exciting on offer.\n\nFunctions\nCorporate Venue - With 3 function rooms, plus a small meeting room, we can accommodate groups ranging from 5 to 180 people and offer essential audio-visual facilities and quality catering.\n\nPlus you’ll have our experienced and talented staff on hand to see to your every need and ensure that your business event is a true pleasure to attend.\n\nFrom hosting small meetings to holding seminars and training programs for businesses and community groups both large and small, we’ve had extensive experience in organising such functions and have made it our business to make every event run seamlessly and successfully.', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.9375]],"3":[[0.4166666667,0.9583333333]],"4":[[0.4166666667,0.9583333333]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/Picton-Bowling-Club-150344648393167/', '', 'https://www.linkedin.com/company/picton-bowling-club', '', '', '', ''),
  (109325, 'mendooran-merrygoen-memorial-club-109325', 'Mendooran Merrygoen Memorial Club', '', '', 0, '2016-04-28 03:41:14', '2016-04-28 03:43:05', '', 191, 144, 'social club', 0, 0, '', '', '0268861147', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Mendooran-Merrygoen-Memorial-Club-1694746917415973', '', '', '', '', '', ''),
  (109327, 'queanbeyan-golf-club-109327', 'Queanbeyan Golf Club', '', 'Queanbeyan Golf Club located in Queanbeyan is a home to some of the best greens in Australia. The club offers facilities such as restaurant, bar, poker machines, TAB area and more.', 277029, '2016-04-28 03:50:11', '2016-04-28 03:51:02', '', 191, 140, 'golf club', 277029, 0, '', 'admin@queanbeyangolf.com.au', '0262971669', '', '', '', 'http://www.queanbeyangolf.com.au/', 'Queanbeyan Golf Club is one of the regions toughest tests of golf, with great greens and narrow fairways. \n\nThe club house offers a great atmosphere overlooking the 18th Green, offering facilities such as the Asia Wok restaurant, Bar, poker machines and a TAB area. We can cater for Birthday parties, corporate meetings and business functions.\n\nThe Golf Club is open for social play all days, with times varying due to members competitions.\n\nThe Queanbeyan Pro Shop is also one of the leading golf outlets in the region, with Club Professional Jake Nagle and Teaching Professional Mat Rainsford running a very honest and approachable service for all your golfing needs and enquiries.\n\n', 'A', '{"1":[[0.4583333333,0.125]],"2":[[0.4583333333,0.8541666667]],"3":[[0.4583333333,0.8541666667]],"4":[[0.4583333333,0.8541666667]],"5":[[0.4583333333,0.8541666667]],"6":[[0.4583333333,0.8541666667]],"0":[[0.4583333333,0.8541666667]]}', 'https://www.facebook.com/Queanbeyan-Golf-Club-487158864728340/', '', '', '', '', '', 'https://plus.google.com/103886668944323662646/about'),
