  (109331, 'energy-window-fashions-109331', 'Energy Window Fashions', '', 'Energy Window Fashions is a premium supplier of awnings, curtains, shutters and roman blinds. Our range of blinds includes Roller Blinds, custom window blinds, Vertical Blinds, Roman & Timber Blinds.', 277484, '2016-04-28 04:36:40', '2016-05-02 00:14:03', '29762790024', 723, 130, 'shutters\nblinds', 277484, 277497, '', 'webmaster@energywf.com.au', '1300362670', '', '', '0397918273', 'https://www.energywindowfashions.com.au/', 'Energy Window Fashions is a retail and commercial supplier of quality custom made to measure blinds, shutters, curtains and awnings. \n\nWe are proudly Australian owned and operated with over 50 years industry experience, our product is sourced worldwide which helps us deliver latest trends, innovation and value to our customers.\n\nThe brand focus is strongly developed towards customer satisfaction providing them with the best possible solution for their window covering needs.\n\nAt Energy Window Fashions we don''t just sell window coverings, we provide window covering solutions.\n\nProducts:\n•  Roller Blinds\n•  Thermacell Cellular\n•  Roman Blinds\n•  Timber Venetian Blinds\n•  Aluminium Venetian Blinds\n•  Panel Blinds\n•  Vertical Blinds\n•  Motorised Blinds\n•  Blockout Blinds\n•  Dual Blinds\n•  Plantation Shutters\n•  Timber Shutters\n•  Fauxwood PVC Shutters\n•  Aluminium Shutters\n•  Outdoor Shutters - Fixed Louvre\n•  Roller Shutters\n•  Curtains\n•  Awnings\n•  Standard Awnings\n•  Straight Drop Awnings\n•  Pivot Arm Awnings\n•  Motorised Awnings', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]],"6":[[0.375,0.7083333333]]}', 'https://www.facebook.com/EnergyWF', '', 'https://www.linkedin.com/company/energy-window-fashions-pty-ltd', '', '', 'https://www.pinterest.com/energywf/', 'https://plus.google.com/+EnergyWindowFashionsAu/about'),
