  (109333, 'thirroul-bowling-leagues-recreation-club-109333', 'Thirroul Bowling Leagues & Recreation Club', '', 'Thirroul Bowling Leagues & Recreation Club is located at Thirroul and boasts 2 separate function rooms. The Norm Sorrell Function Room is located in the main club area.', 277088, '2016-04-28 05:16:57', '2016-04-28 05:21:28', '', 191, 120, 'leagues club\nsocial club', 277088, 0, '', '', '0242671148', '', '', '0242684083', 'http://thirroulbowlingclub.com.au/', 'Thirroul Bowling Leagues & Recreation Club is located at Thirroul.\n\n“The North’s Hidden Treasure” of the Illawarra. The Thirroul Bowling Leagues & Recreation club can be found conveniently located close to Thirroul Railway Station and it’s only a stone’s throw away from the pristine beach of Thirroul.\n\nMembers and guests can come for the bowling or come for the experience of our fantastic fresh food, live entertainment, leisure, functions and friendly staff. \n\nA warm welcome awaits you, discover the best kept secret of the north.\n\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]]}', 'https://www.facebook.com/thirroulbowlingclub', 'https://twitter.com/thirroulbowlo', '', '', '', '', ''),
  (109335, 'charlestown-bowling-club-109335', 'Charlestown Bowling Club', '', 'Charlestown Bowling Club caters for all age groups with Great Dining Options, Raffles, and Live Entertainment.', 277098, '2016-04-28 05:23:41', '2016-04-28 05:25:24', '', 191, 118, 'bowling club\nsocial club', 277098, 0, '', 'info@charlestownbc.com.au', '0249433766', '', '', '', 'http://charlestownbc.com.au/', 'Charlestown Bowling Club is very proud of our commitment to the community, providing ongoing support to local Charity, Health, Service and Sporting organisations annually.\n\nCharlestown Bowling Club provides members & visitors with great facilities, outstanding entertainment, a vibrant Bar & Bistro dining option along with fun filled social activities.\n\nOur newly refurbished club is family friendly and invites you to join us every day of the week.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.375,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/Charlestown-Bowling-Club-146577748751694/', '', '', '', '', '', 'https://plus.google.com/109706617079180499970/about'),
  (109338, 'erindale-vikings-109338', 'Erindale Vikings', '', 'Erindale Vikings located in Wanniassa provide a wide variety of facilities including entertainment dining options for their members and invited guests.', 277118, '2016-04-28 05:39:18', '2016-04-28 05:40:54', '', 191, 102, 'social club', 277118, 0, '', '', '0261212100', '', '', '', 'http://www.vikings.com.au/erindale/', 'Erindale Vikings is the first vikings club to open in 1979 . The club has  paved the way for licensed clubs in Canberra. The Sideline Bar that overlooks Viking Park,  is the perfect spot for fans to enjoy the game whilst in the Club, or enjoy a beverage at half time, complemented by the latest action on FoxSPORTS.\n\nFEATURES\n\nDINING FACILITIES\nTreat yourself to the culinary delights that the award winning chefs of Kutas provide 7 days a week for lunch and dinner. If a light snack or aromatic cappucino is your want, Moo&Brew Cafe also operates 7 days a week.\n\nENTERTAINMENT\nIt''s all about great live entertainment at Erindale Vikings - check out who is showcased this month in the Sideline Bar and The Auditorium, a state-of-the-art venue, next door showcasing touring artists.\n\nGaming lounge featuring 231 state of the art gaming machines.\n\nADDITIONAL FACILITIES\nACTTAB Facilities\nChildren''s Playground\n', 'A', '{"1":[[0.4166666667,0.0416666667]],"2":[[0.4166666667,0.0416666667]],"3":[[0.4166666667,0.0416666667]],"4":[[0.4166666667,0.1666666667]],"5":[[0.4166666667,0.1666666667]],"6":[[0.4166666667,0.1666666667]],"0":[[0.4166666667,0.0416666667]]}', 'https://www.facebook.com/Vikings-Group-130277753690866/', 'https://twitter.com/TheVikingsGroup', 'https://www.linkedin.com/company/vikings-group', '', '', '', ''),
  (109342, 'mosman-bowling-club-109342', 'Mosman Bowling Club', '', 'Mosman Bowling Club offers range of functions and facilities for community and corporate events. We pride ourselves on our beautiful old building, gardens and well maintained greens.', 277124, '2016-04-28 05:42:00', '2016-04-28 05:43:30', '', 191, 100, 'bowling club\nsocial club', 277124, 0, '', '', '0299695198', '', '', '', 'http://www.mosmanbowlingclub.org.au/', 'Mosman Bowling Club was established in 1901. We were known then as the Mosman Recreation Club. Lawn bowls commenced with the completion of the greens in 1902 when the club was officially opened.\n\nMosman Bowling Club welcome visitors for social bowls and to use our facilities for private functions, community and corporate events. We specialise in large corporate events where bowls can be part of the team building activity. However there are always opportunities for other social events to be held at our club. Just call the office to discuss your requirements. \n\nThe members of Mosman Bowling Club and Mosman Women''s Bowling Club pride themselves on our beautiful old building, gardens and well maintained greens. We are one of the few 100+ year old clubs in Sydney and the oldest club in the Mosman Municipality.\n\nWe welcome visitors to use our facilities for private functions, community and corporate events. Just call the office on 9969 5198 to discuss your requirements. We specialise in large corporate events where bowls is part of team building or celebration activities. If you are interested in playing bowls it would be difficult to find a more friendly and inclusive club.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://www.google.com/maps/place/Mosman+Bowling+Club/@-33.8285358,151.2399456,17z/data=!3m1!4b1!4m2!3m1!1s0x6b12ac1babb05a63:0x5164fa791c254984?hl=en'),
  (109343, 'wollongong-hellenic-club-109343', 'Wollongong Hellenic Club', '', 'Wollongong Hellenic Club is located at West Wollongong and offering a spacious restaurant dining area, sports bar, TAB and gaming facilities. ', 277128, '2016-04-28 05:48:28', '2016-04-28 05:53:19', '', 191, 98, 'social club', 277128, 0, '', 'whclub@bigpond.net.au', '0242271130', '', '', '0242266599', 'http://wgonghellenic.com.au/', 'Wollongong Hellenic Club is a fully licensed club offering a spacious restaurant dining area,sports bar, TAB and gaming facilities. \n\nWollongong Hellenic Club  also has a stage & dance floor and hosts regular live entertainment.\n\nWollongong Hellenic Club  features a children’s play area, pool table and dart boards.\n\nWe are a family friendly Club in Figtree striving to deliver high standards in food and customer service offering all our members and guests a great visit.\n\n', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.0833333333]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.0833333333]],"5":[[0.4166666667,0.0833333333]],"6":[[0.4166666667,0.0833333333]],"0":[[0.4166666667,0.7083333333]]}', 'https://www.facebook.com/HellenicClub', '', '', '', '', '', ''),
  (109346, 'gosford-sailing-club-109346', 'Gosford Sailing Club', '', 'Gosford Sailing Club is the ideal setting for special occasions and corporate events – not to mention just a great spot to enjoy superb cuisine and selection of fine wines at Latitude 33 Restaurant.', 277160, '2016-04-28 06:03:34', '2016-04-28 06:07:06', '', 191, 88, 'sailing club\nsocial club', 277160, 0, '', 'info@gossail.com.au', '0243257216', '', '', '', 'http://gosfordsailingclub.com/', 'Gosford Sailing Club\nTake in the relaxed scenic views and all our club has to offer.\n\nThe club has a family friendly atmosphere and visitors are always welcome.\n\nGosford Sailing Club is the ideal setting for special occasions and corporate events – not to mention just a great spot to enjoy superb cuisine and selection of fine wines at our stunning Latitude 33 Restaurant.\n\nFor something more casual, our members and guests regularly enjoy our Club Bar, Brasserie and gaming lounge facilities.\n\nGosford Sailing Club offers numerous Corporate and social sailing events to members and guests. Our sailing divisions and activities include yacht & dinghy racing, corporate events, junior and amateur sailing and learn to sail programs for kids and adults.\n\nWe believe our club is somewhat special – especially as the venue is perfect for any occasion. It is truly a great mix of people, and we welcome you to our club, both members and guests.', 'A', '{"1":[[0.4583333333,0.9583333333]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4583333333,0.9583333333]],"4":[[0.4583333333,0.9583333333]],"5":[[0.4583333333,1]],"6":[[0.4583333333,1]],"0":[[0.4583333333,0.8333333333]]}', 'https://www.facebook.com/GosSail', 'https://twitter.com/gossail', '', '', '', '', 'https://plus.google.com/116256091093071664935/about');
