  (109347, 'wollongong-tennis-club-109347', 'Wollongong Tennis Club', '', 'Wollongong Tennis Club is located at Gwynneville and offer a function room has a capacity of up to 120 people that cater Birthdays, Engagements, Weddings or any other type of event.', 277162, '2016-04-28 06:04:17', '2016-04-28 06:07:45', '', 191, 82, 'sports club', 277162, 0, '', 'info@wollongongtennisclub.com.au', '0242293766', '', '', '0242269601', 'http://www.wollongongtennisclub.com.au/', 'On 3rd August 1948, Wollongong City Council''s Chief Engineer reported to Council that McCabe Park was too narrow for the proper provision of sports grounds. In his opinion, playing areas should be located closer to where people lived rather than to where they worked. his recommendation was that the playing facilities should be removed and the park converted into a park and garden.\n\nWith some of the most stunning views of the courts and surrounding parklands that the Tennis Clubs has to offer, our beautiful Court View function room has a capacity of up to 120 people and is located in the top floor of our Club with floor to ceiling windows that give your guests a stunning outlook. Great for your 18th or 21st Birthdays, Engagements, Weddings or any other type of event. If you’re looking for affordable venue hire in Wollongong then you can’t look past the Wollongong Tennis Club.\n\nWe understand that flexibility is important when organising an event and we pride ourselves on being able to provide this.  If you have something different in mind, it would be our pleasure to create it for you.  Just let us know your needs, desires and your budget.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,1]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.875]]}', 'https://www.facebook.com/wollongongtennisclub/', '', '', '', '', '', 'https://plus.google.com/+WollongongtennisclubAu/posts'),
