  (109351, 'arncliffe-rsl-109351', 'Arncliffe RSL', '', '', 0, '2016-04-28 06:12:12', '2016-04-28 06:13:22', '', 191, 78, 'rsl club', 0, 0, '', 'info@bexleyrsl.com.au', '0295673966', '', '', '', '', '', 'A', '{"1":[[0.4791666667,0.7916666667]],"2":[[0.4791666667,0.7916666667]],"3":[[0.4791666667,0.875]],"4":[[0.4791666667,0.875]],"5":[[0.4791666667,0.9583333333]],"6":[[0.4166666667,0.875]],"0":[[0.5,0.8333333333]]}', '', '', '', '', '', '', ''),
  (109355, 'bexley-golf-club-109355', 'Bexley Golf Club', '', 'Bexley Golf Club is located at Kingsgrove and can cater for Corporate events, Birthdays, Weddings, Christenings and other social events.', 277202, '2016-04-28 06:35:32', '2016-04-28 06:37:06', '', 191, 60, 'golf club', 277202, 0, '', 'michael@bexleygolf.com.au', '0291509062', '', '', '0291505424', 'http://www.bexleygolf.com.au/', 'Bexley Golf Club welcomes anyone who has ever thought about playing golf more regularly to come and join, we have flexible payment options for all categories and are happy to induct men, women and children into the club.  \n\nJoining Bexley Golf Club will be one of the best things you have ever done and you will make friends that will last a lifetime.\n\nBexley Golf Club can cater for Corporate events, Birthdays, Weddings, Christenings and other social events.\n\nBexely Golf Club organizes a number of events and is experienced in hosting special occasions. From business meetings to weddings, from dinners to live band nights. Please feel free to contact us to book for your special occasion or for anykind of information.', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,0.9166666667]],"0":[[0.4166666667,0.9166666667]]}', '', '', '', '', '', '', 'https://plus.google.com/112887954582744065660/about'),
  (109356, 'light-and-space-roof-systems-109356', 'Light And Space Roof Systems', '', 'Light and Space Roof Systems provides complete outdoor living solutions. With over 18 years experience, we design Pergola, Verandahs, Patio and Pool Covers for commercial or residential property.', 277537, '2016-04-28 06:36:41', '2016-05-02 01:03:55', '41122018678', 724, 57, 'steel roof sheeting\ncommercial roofing', 277537, 277223, '', 'info@lightandspace.com.au', '1300867970', '', '', '', 'http://www.lightandspace.com.au/', 'Light & Space is in the field of providing services for roof structuring from years. This company builds roof structures for both residential and commercial properties. \n\nWe have accomplished many successful projects for schools, hotels, shopping malls and houses. Roof structures are offered for patios, verandahs, swimming pools covers and pergolas in any desired shape – curve, gabled, or straight. For erecting any required structure, highly skilled and experienced workers are hired. Apart from this service Light & Space also offer DIY kits for those who want to handle the project independently. Every product, whether in the DIY kit or used by any of our staff are of extremely high quality and offered with suitable warranty period.\n\nWhy Us?\n•  Affordable outdoor living solutions which compliment the style of your home\n•  Contemporary custom designs combine to transform your outdoor area into a unique year round living space\n•  Durable products and high quality workmanship ensure stability and longevity of your roof system\n•  With over 18 years experience we can provide you with extensive advice on design and applications of polycarbonate roofing\n•  Our structures suit both domestic and commercial markets.\n•  Our display centre will provide you with inspiration for your roofing system and lighting features\n•  We have built over 1,000 patio’s in Melbourne\n•  We offer DIY kits for roof systems which come complete with a full installation guide\n•  Finance is available for approved purchasers', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/LightAndSpaceRoofSystems', '', '', '', '', 'https://www.pinterest.com/salanitri/', 'https://plus.google.com/+LightandspaceAu-Pergola-Designers-Melbourne/posts'),
  (109357, 'peak-hill-bowling-club-109357', 'Peak Hill Bowling Club', '', '', 277233, '2016-04-28 06:52:04', '2016-04-28 07:00:07', '', 191, 47, 'bowling club', 277233, 0, '', 'peakhillbc1@gmail.com', '0268691508', '', '', '', '', '', 'A', '{"1":[[0.6875,0.8958333333]],"2":[[0.6875,0.8958333333]],"3":[[0.6875,0.8958333333]],"4":[[0.6875,0.8958333333]],"5":[[0.6666666667,0.9166666667]],"6":[[0.4583333333,0.9166666667]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/PeakHillBowlingClub/', '', '', '', '', '', ''),
  (109359, 'yass-soldiers-club-109359', 'Yass Soldiers Club', '', 'Yass Soldiers Club located in Yass is a community facility providing a comfortable meeting place for every demographic. Bars, Restaurant, Function Rooms, Gaming Floor', 277245, '2016-04-28 07:00:27', '2016-04-28 07:02:12', '', 191, 45, 'rsl club\nsocial club', 277245, 0, '', '', '0262261911', '', '', '', 'http://www.yasssoldiersclub.com.au/', 'Yass Soldiers Club is just 3 hours drive from Sydney, 6 hours from Melbourne or 45minutes from Canberra is the historic town of Yass, geographically located on the junction of the Hume and Barton Highways.\n\nYou''ll find our club situated on Meehan St, just off Comur Street (Main Street). Modern facilities, recently renovated, popular with locals and visitors alike. Great value food.\n\nWe at The Club can help you plan your function to the last detail. Our aim is to ensure your function is special. Our talented Chefs have created an extensive range of menus tailored to suit your tastes.\n\nVariations to any menu are available. Professionally trained staff will ensure you and your guests receive excellent service.\n\n\nFacilities\n• Keno\n• TAB / Sports TAB\n• 3 Function Rooms\n• Snooker, Pool\n• ATM / Eftpos\n• Conferences\n• Buses & Groups\n• Disabled Access\n• Big Screen TV\n• Bistro 7 days lunch & dinner\n• Club Parking\n• Badge Draws\n• BBQ Facilities\n• Coffee\n• Foxtel / Sky Channels\n• Live Bands & Specialty nights', 'A', '{"1":[[0.4166666667,0.9166666667]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9375]],"4":[[0.4166666667,0.9375]],"5":[[0.4166666667,1]],"6":[[0.4166666667,1]],"0":[[0.4166666667,0.9166666667]]}', 'https://www.facebook.com/yasssoldiersclub/', 'https://twitter.com/yasssoldiers', 'https://www.linkedin.com/company/yass-soldiers-club', '', '', '', ''),
  (109361, 'bellambi-bowling-club-109361', 'Bellambi Bowling Club', '', 'Bellambi Bowling Club located in Bellambi is is your local venue with great staff, lots of give aways, scenic views and lovely patrons. The club features TAB, keno, bistro, cafe and many more.\n', 277261, '2016-04-28 07:11:45', '2016-04-28 07:14:45', '', 191, 42, 'bowling club', 277261, 0, '', 'office@bellambibowlingclub.com.au', '0242859444', '', '', '0242859258', 'http://bellambibowlingclub.com.au/', 'Bellambi Bowling Club has 3 top quality bowling greens, where you are invited to relax and enjoy a game of bowls. Coaching is also available.\n\nOur outdoor areas are a wonderful venue for social club functions or just a BBQ with friends. Covered facilities and umbrella bay seating available.', 'A', '{"1":[[0.375,0.9166666667]],"2":[[0.375,0.9166666667]],"3":[[0.375,0.9583333333]],"4":[[0.375,0.9583333333]],"5":[[0.375,1]],"6":[[0.375,0.9583333333]],"0":[[0.375,0.9375]]}', 'https://www.facebook.com/BellambiBC', 'https://twitter.com/bellambibc', '', '', '', '', ''),
  (109363, 'the-rylstone-club-109363', 'The Rylstone Club', '', 'The Rylstone Club located in Rylstone provide its guests and members a wide range of services and facilities including restaurant, golf, bowls, squash, raffle, draws, Keno & TAB and many more.', 277275, '2016-04-28 07:19:11', '2016-04-28 07:20:41', '', 191, 38, 'rsl club\nsports club', 277275, 0, '', 'info@therylstoneclub.com.au', '0263791109', '', '', '', 'http://therylstoneclub.com.au/', 'The Rylstone Club is your local Friendly Club.\n\nRaffles, Members Draws, Golf, Bowls, Squash Courts, TAB, Keno, Snooker Table,  Jukebox, Restaurant & Courtesy Bus. \n \nNew Members are always Welcome.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/113174118436015759765/about'),
  (109364, 'st-patricks-sporting-club-109364', 'St Patricks Sporting Club', '', '', 0, '2016-04-28 07:27:33', '2016-04-28 07:27:38', '', 191, 32, 'sports club', 0, 0, '', '', '0263322753', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
  (109365, 'manly-warringah-football-association-109365', 'Manly Warringah Football Association', '', 'Manly Warringah Football Association is a progressive community based Football organisation dedicated to provide a safe, integrated pathway by developing, encouraging & supporting their aspirations.', 277285, '2016-04-28 07:35:16', '2016-04-28 07:38:17', '', 191, 27, 'leagues club', 277285, 0, '', 'reception@mwfa.com.au', '0299826228', '', '', '', 'http://www.mwfa.com.au/', 'The Manly Warringah Football Association was established in 1947 and has remained the sole focal point for the development of Football on Sydney’s Northern Beaches.\n\nThe community based Association consists of 17 member clubs throughout the Mosman, Manly, Warringah and Pittwater LGAs. It has the responsibility of administering the game of Football to 16 000 male and female players from the age of under 6 to over 35.\n\nThe Manly United Football is an affiliate of the Association and caters for representative players from the area. The Club caters for Under 9/10 boys through to senior men’s first grade and under 12 girls through to women’s first grade. All compete in the highest level of football in NSW, the NSW Premier League.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Manly-Warringah-Football-Association-176189235836675/', 'https://twitter.com/mw_football', '', '', '', '', 'https://www.google.com/maps/place/Manly+Warringah+Football+Association/@-33.7395116,151.2842106,17z/data=!3m1!4b1!4m2!3m1!1s0x6b0d551be1b0e473:0x4c0f71db7430e11b?hl=en'),
  (109369, 'bellbird-workers-club-ltd-109369', 'Bellbird Workers Club Ltd', '', '', 0, '2016-04-28 07:56:58', '2016-04-28 07:57:03', '', 191, 20, '', 0, 0, '', '', '0249902147', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
