  (109371, 'tullamore-bowling-citizens-club-109371', 'Tullamore Bowling & Citizens Club', '', '', 0, '2016-04-28 08:07:59', '2016-04-28 08:19:47', '', 191, 14, 'bowling club', 0, 0, '', '', '0268925250', '', '', '', '', '', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/TullamoreBowlingClub/', '', '', '', '', '', ''),
  (109372, 'jamberoo-bowling-recreation-club-109372', 'Jamberoo Bowling & Recreation Club', '', 'Jamberoo Bowling & Recreation Club located in Jamberoo provides members and guests the experience of fantastic fresh food, live entertainment, leisure, functions and friendly staff.', 277311, '2016-04-28 08:19:03', '2016-04-28 08:19:30', '', 191, 16, 'bowling club', 277311, 0, '', 'jamberoobowl@bigpond.com', '0242360140', '', '', '0242360816', 'http://www.jamberoobowlo.com.au/', 'Jamberoo Bowling & Recreation Club \n\nJamberoo is an historic village steeped in all that is old and sprinkled with a dash of the modern.\n \nMembers and guests to Club Jamberoo can come to our club for the bowling or come for the experience of our fantastic fresh food, live entertainment, leisure, functions and friendly staff.\nWith the club being in the centre of the local community, there are plenty of activities for everyone to enjoy such as Members Badge Draws, Pool Tables, Carpet Bowls, Tennis Courts nearby, Club Keno, TAB, multiple TV screens, weekly specials at The Wok & Grill Bistro and you''ll always find excellent chances to win with our Meat Raffle on every Wednesday, Friday and Sunday night.\n \nA warm welcome awaits you so come and discover our "diamond in the rough" and we hope to see you soon!', 'A', '{"1":[[0.4166666667,0.875]],"2":[[0.4166666667,0.875]],"3":[[0.4166666667,0.875]],"4":[[0.4166666667,0.875]],"5":[[0.4166666667,1]],"6":[[0.4166666667,0.9375]],"0":[[0.4166666667,0.875]]}', '', '', '', '', '', '', ''),
  (109374, 'belmont-golf-club-109374', 'Belmont Golf Club', '', 'Belmont Golf Club is located on the Pacific Highway, offering range of exciting menus from our bistro and providing functions and facilities for special occasions.', 277323, '2016-04-28 08:32:01', '2016-04-28 08:33:27', '', 191, 13, 'golf club', 277323, 0, '', '', '0249454348', '', '', '', 'http://www.belmontgolf.com.au/', 'Belmont Golf Club is home to a 18 hole Par 72 Championship Links course set amongst rolling green fairways and trees with many of the fairways having the Pacific Ocean as their backdrop.\n\nBelmont Golf Club first opened in 1952 and over the years the course has been continually improved to meet the playing expectations of golfers of all levels.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Belmont-Golf-Club-381811378522932/', '', '', '', '', '', 'https://www.google.com/maps/place/Belmont+Golf+Club/@-33.0560009,151.655516,17z/data=!3m1!4b1!4m2!3m1!1s0x6b7323ab5e47bf75:0x9880187d6bb60ec8?hl=en'),
  (109376, 'the-builders-club-109376', 'The Builders Club', '', 'The Builders Club located in Wollongong provide members and guests facilities including Bingo, TAB, Keno and many more. Come visit us .', 277329, '2016-04-28 08:39:05', '2016-04-28 08:40:49', '', 191, 11, 'bowling club\nsports club', 277329, 0, '', 'info@thebuilders.com.au', '0242296466', '', '', '', 'https://thebuilders.com.au/', 'The Builders Club is only 2km from Wollongong’s CBD, with plenty of onsite parking and nearby public transport. Open everyday from 9:30am until late, the Club is your social, entertainment, dining, gaming and function venue! Catching up with family and friends in the lounge or newly built outdoor deck, relaxing with a cold drink, or looking to dance the night away - we’ve got you covered!\n\nEach week The Builders Club is choc full of entertainment sure to meet your tastes. There’s LIVE music every Friday and Sunday, Trivia and meat raffles each Wednesday and Sunday, Thursday and Friday APL Poker, Thursday Karaoke, LIVE comedy twice a month and sporting clubs, plus the usual Club offerings of Bingo, TAB and Keno!\n\nENTERTAINMENT\nEntertaining is what we’re about at The Builders Club! Whether you’re looking to sit and relax with a cold drink with friends and family or dance the night away, we’ve got you covered!\n\nThere’s LIVE Music & Comedy, Concerts, Special Events, Tribute Shows, Variety Shows and more every week!\n\nFUNCTIONS\nThe Builders Function Centre is the venue where your “dream wedding” can become a reality or you can relax whilst we ensure your corporate event runs smoothly and professionally. From large to small private functions we make your event the success it deserves to be!\n\nAt The Builders Club, we can cater to all functions including:\nWeddings | Engagements | Birthdays | Christenings | Retirements | Conferences | Seminars | Corporate Training | Trade Displays | Christmas Parties and more!', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/builders.basement/', 'https://twitter.com/imbcillawarra', '', '', '', '', ''),
  (109377, 'kiama-bowling-recreation-club-109377', 'Kiama Bowling & Recreation Club', '', 'Kiama Bowling & Recreation Club located in Kiama is the club for all family, friends and guests. Enjoy a club priced meal, icy drink, facilities including TAB, keno and many more.', 277335, '2016-04-28 08:54:06', '2016-04-28 08:56:16', '', 191, 8, 'bowling club', 277335, 0, '', 'benc@kiamabowling.com.au', '0242321176', '', '', '0242331676', 'http://www.kiamabowling.com.au/', 'Kiama Bowling & Recreation Club,  the club for all the family, friends and guests. We are located just south of Kiama train station on Shoalhaven Street. Our clubhouse is fully air conditioned with a safe, welcoming and relaxed atmosphere for members and visitors. Enjoy a club priced meal and icy cold drink served by our friendly staff. Becoming a member. It’s easy. \n\nMemberships available are for the discerning bowler and a social membership for those who just like the atmosphere. We also support smaller clubs as we know the importance of community and the role we play in it. The TAB and Keno facilities are available to get the blood racing. TAB Kiosk and LCD TVs to cater for the punters needs. We also sell the coldest, best and cheapest beer in town. Come along to try to prove us wrong!', 'A', '{"1":[[0.5,0.8333333333]],"2":[[0.4166666667,0.9166666667]],"3":[[0.4166666667,0.9166666667]],"4":[[0.4166666667,0.9166666667]],"5":[[0.4166666667,0.9166666667]],"6":[[0.4166666667,1]],"0":[[0.4583333333,0.9166666667]]}', 'https://www.facebook.com/kiamabowls', '', '', '', '', '', 'https://plus.google.com/102372452161674269853/about'),
  (109378, 'simply-uniforms-trading-109378', 'Simply Uniforms Trading', '', 'Simply Uniforms provides a full range of corporate clothing,scrubs,uniform work wear, safety wear,caps and promotional products throughout Perth, WA and Australia.\n', 277343, '2016-04-28 08:59:27', '2016-04-28 09:02:13', '18793796990', 678, 5, 'clothing manufacturers', 277343, 277344, '', 'orders@simplyuniforms.com.au', '0893783765', '', '', '', 'http://www.simplyuniforms.com.au', 'Clothes play an important role in enhancing the appearance of a person. Different types of clothes are required in different situations. Simply Uniforms offers a variety of products like polos, t-shirts, office wear, work wear, medical wear, hospitality wear. outwear, hats and caps, promotional wear etc. There are plenty of options to choose from in terms of colour and size. They offer excellent quality products. The costs are reasonable in comparison to their competitors. You can also avail the option of home delivery.\n', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/SimplyUniforms', 'https://twitter.com/simplyuniforms', '', '', '', '', 'https://plus.google.com/+SimplyuniformsAu/posts'),
  (109379, 'mollymook-beach-bowling-recreation-club-109379', 'Mollymook Beach Bowling & Recreation Club', '', 'Mollymook Beach Bowling & Recreation Club located in Mollymook provides members and visitors a quality Club experience in a friendly atmosphere. The club features Bistro, Functions and many more.', 277362, '2016-04-28 09:07:14', '2016-04-28 09:09:45', '', 191, 3, 'bowling club', 277362, 0, '', '', '0244555222', '', '', '0244555980', 'http://www.mollymookbowling.com.au/', 'Mollymook Beach Bowling & Recreation Club is set in Beautiful bushland, less than 1 kilometre from picturesque Mollymook Beach and 5 minutes from Ulladullas'' CBD.\n\nThe newly extended and refurbished Clubhouse offers members and visitors a quality Club experience whilst still maintaining the friendly personal touch that this Club is famous for.\n\nThis popular destination boasts a wide choice of accommodation for all needs.\n\nFUNCTION\nThe Mollymook Beach Bowling and Recreation Club now also has available a Function Room with seating and catering up to 100 people.\n\nThe Function Room is available for various events such as weddings, birthday parties, farewells, Christmas parties, work functions and Conferences. If you''re looking for something a bit different why not try a Bowls and BBQ get together.\n\nThe Mollymook Beach Bowling Club is offering the best rates in town so look no further for the ideal location for your wedding, party or function.\n\n\nFacilities\n• Bistro\n• Functions/ Weddings\n• Pay / Sky TV\n• Courtesy Bus\n• Disabled Access\n• Big Screen TV\n• Darts\n• TAB', 'A', '{"1":[[0.4583333333,0.9166666667]],"2":[[0.4583333333,0.9166666667]],"3":[[0.4583333333,0.9166666667]],"4":[[0.4583333333,0.9166666667]],"5":[[0.4166666667,0.9583333333]],"6":[[0.4166666667,0.9583333333]],"0":[[0.4583333333,0.8333333333]]}', 'https://www.facebook.com/mollybowlo/', '', '', '', '', '', 'https://plus.google.com/117369242683657518435/about'),
  (109380, 'access-direct-109380', 'Access Direct', '', 'Access Direct is an Australian owned and operated business that specialises in canteen, cleaning, office and warehouse supplies.', 277579, '2016-04-29 04:05:34', '2016-05-02 01:16:38', '43995064191', 728, 1038, '', 277579, 277389, 'PO Box 206', 'sales@accessdirect.net.au', '0397961612', '1300887234', '', '0397961617', 'http://www.accessdirect.net.au/', 'Access Direct is an Australian owned and operated business that specialises in canteen, cleaning, office and warehouse supplies. \n\nSince commencing trading in 1994, our focus and commitment has been on personal, refreshing service and fast delivery.\n\nOur aim is to exceed your expectations by offering quality products, lowest prices and great support.\n\nFrom their Berwick location, they service all areas of Melbourne (including the Mornington Peninsula and Gippsland). They also service all sectors, from hospitals and childcare facilities through to restaurants and schools. \n\nAccess Direct prides themselves on timely deliveries, employing a friendly team and providing value for money. Products are divided into 8 main categories – canteen (coffee and disposables), janitorial (washroom consumables and cleaning chemicals), housekeeping (cleaning tools and vacuums), first aid and office (paper and ink), packaging (tape and envelopes), hand and body (soap and sunscreen), motel (laundry powder and toiletries), and protection (gloves and face masks).\n', 'A', '{"1":[[0.3125,0.75]],"2":[[0.3125,0.75]],"3":[[0.3125,0.75]],"4":[[0.3125,0.75]],"5":[[0.3125,0.75]]}', '', '', '', '', '', '', 'https://plus.google.com/112050002036794034395/about'),
  (109381, 'wentworth-golf-club-orange-109381', 'Wentworth Golf Club Orange', '', 'Wentworth Golf Club Orange located in Orange provide its guests and members a wide range of services and facilities including pro shop, bar, restaurant and more.', 277393, '2016-04-29 05:13:11', '2016-05-01 23:16:20', '', 191, 1036, 'golf club', 277393, 0, '', 'office@wentworthgolforange.com.au', '0263514505', '', '', '0263614551', 'http://www.wentworthgolforange.com.au/', 'Wentworth Golf Club Orange has been known as the friendly club since its inception in 1965 when the locals began to turn a paddock into a golf course by removing trees, blasting out stumps and carrying buckets to pick up rocks from the fairway and turn the area into an eighteen hole grass green golf course with twenty two sand bunkers, three dams, new trees and a small pine forest.\n\nToday you can still walk into the club and be greeted by friendly people, Mark at the Bar & Restaurant, Todd & Travis in the Pro-Shop, Kathie and Ian in the Office and don’t be surprised if President Simon or any of the other six Directors or members makes your acquaintance.\n\nWentworth Golf Club Orange once boasted the fourth largest membership in New South Wales. How we would love to have that again!\nNew members are welcome at Wentworth with social membership at $5.00 to Full membership for $560.00 with a number of categories in between; Juniors, Intermediate, 22yr to 30yr, Six Day and Associates with Pensioner discounts.\n\nThe course fees are reasonably priced to accommodate Members, Members Guests and Visitors with discounts on Group Social Play, the larger the group or number of games the greater the discount.\nCome and visit and enjoy the view from the Club House and Restaurant and hear the sound of laughter over the birds on the balcony.\n\nWe look forward to seeing you here.', 'A', '{"1":[[0.3333333333,0.7916666667]],"2":[[0.3333333333,0.7916666667]],"3":[[0.3333333333,0.9375]],"4":[[0.3333333333,0.9375]],"5":[[0.3333333333,0.9375]],"6":[[0.3333333333,0.4375]],"0":[[0.3333333333,0.7916666667]]}', 'https://www.facebook.com/Wentworth-Golf-Club-Orange-491982940946691/?rf=559693730871019', '', '', '', '', '', 'https://plus.google.com/115121808012115782531/about'),
  (109383, 'brighton-le-sands-rsl-club-109383', 'Brighton Le Sands RSL Club', '', 'Brighton Le Sands RSL Club is located at Brighton Le Sands and offered members of the community a safe and welcoming environment in which to dine, enjoy live entertainment and meet up with friends.', 277442, '2016-05-01 22:54:17', '2016-05-01 22:56:27', '', 191, 1901, 'rsl club', 277442, 0, '', 'info@brightonrsl.com.au', '0295675157', '', '', '0295990504', 'http://www.brightonrsl.com.au/www/home/', 'Brighton Le Sands RSL Club was formed on 2 March 1945 as a Sub Branch for returned service personnel from World War 1 and World War 2.\nIn 1972 the Brighton Le Sands RSL Club Limited was formed to oversee the operation of the licensed club. \n\nThe Club has always offered members of the community a safe and welcoming environment in which to dine, enjoy live entertainment and meet up with friends. \n\nIn the early 1990''s Brighton Le Sands RSL Club Ltd purchased and expanded into adjacent property in Bay Street. In 2004 extensive renovations were undertaken to transform the Club into the contemporary venue that guests enjoy today.\n\nBrighton RSL has a strong locally based membership and, thanks to its seaside location, attracts visitors from Sydney, across Australia and throughout the world.\n\nVisitors who travel to the Club by car are able to make use of a three level parking station located directly behind the building.', 'A', '{"1":[[0.4583333333,0.9375]],"2":[[0.4583333333,0.9583333333]],"3":[[0.4166666667,0.9791666667]],"4":[[0.4166666667,0.9791666667]],"5":[[0.4166666667,0.0416666667]],"6":[[0.4166666667,0.0416666667]],"0":[[0.4583333333,0.9375]]}', '', '', '', '', '', '', 'https://plus.google.com/108489974527863456216/about'),
